INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(1, 'AF', 'af', 'Afghanistan', 'Ahmad Shah DURRANI unified the Pashtun tribes and founded Afghanistan in 1747. The country served as a buffer between the British and Russian Empires until it won independence from notional British control in 1919. A brief experiment in democracy ended in a 1973 coup and a 1978 communist countercoup. The Soviet Union invaded in 1979 to support the tottering Afghan communist regime, touching off a long and destructive war. The USSR withdrew in 1989 under relentless pressure by internationally supported anti-communist mujahidin rebels. A series of subsequent civil wars saw Kabul finally fall in 1996 to the Taliban, a hardline Pakistani-sponsored movement that emerged in 1994 to end the country''s civil war and anarchy. Following the 11 September 2001 terrorist attacks, a US, Allied, and anti-Taliban Northern Alliance military action toppled the Taliban for sheltering Usama BIN LADIN.\nA UN-sponsored Bonn Conference in 2001 established a process for political reconstruction that included the adoption of a new constitution, a presidential election in 2004, and National Assembly elections in 2005. In December 2004, Hamid KARZAI became the first democratically elected president of Afghanistan, and the National Assembly was inaugurated the following December. KARZAI was reelected in August 2009 for a second term. The 2014 presidential election was the country''s first to include a runoff, which featured the top two vote-getters from the first round, Abdullah ABDULLAH and Ashraf GHANI. Throughout the summer of 2014, their campaigns disputed the results and traded accusations of fraud, leading to a US-led diplomatic intervention that included a full vote audit as well as political negotiations between the two camps. In September 2014, GHANI and ABDULLAH agreed to form the Government of National Unity, with GHANI inaugurated as president and ABDULLAH elevated to the newly-created position of chief executive officer. The day after the inauguration, the GHANI administration signed the US-Afghan Bilateral Security Agreement and NATO Status of Forces Agreement, which provide the legal basis for the post-2014 international military presence in Afghanistan.\nDespite gains toward building a stable central government, the Taliban remains a serious challenge for the Afghan Government in almost every province. The Taliban still considers itself the rightful government of Afghanistan, and it remains a capable and confident insurgent force despite its last two spiritual leaders being killed; it continues to declare that it will pursue a peace deal with Kabul only after foreign military forces depart.', 'Asia', '33 00 N, 65 00 E', '652,230 sq km', '34,124,811 (July 2017 est.)', 'Afghan(s)', 'Pashtun, Tajik, Hazara, Uzbek, other (includes smaller numbers of Baloch, Turkmen, Nuristani, Pamiri, Arab, Gujar, Brahui, Qizilbash, Aimaq, Pashai, and Kyrghyz)', 'Afghan Persian or Dari (official) 80% (Dari functions as the lingua franca), Pashto (official) 47%, Uzbek 11%, English 5%, Turkmen 2%, Urdu 2%, Pashayi 1%, Nuristani 1%, Arabic 1%, Balochi, Shughni, Pamiri, Hindi, Russian, German, French <.5% each, don''t know/refused <1%', 'Muslim 99.7% (Sunni 84.7 - 89.7%, Shia 10 - 15%), other 0.3% (2009 est.)', 'Islamic Republic of Afghanistan', 'presidential Islamic republic', 'Kabul', '34 provinces (welayat, singular - welayat); Badakhshan, Badghis, Baghlan, Balkh, Bamyan, Daykundi, Farah, Faryab, Ghazni, Ghor, Helmand, Herat, Jowzjan, Kabul, Kandahar, Kapisa, Khost, Kunar, Kunduz, Laghman, Logar, Nangarhar, Nimroz, Nuristan, Paktika, Paktiya, Panjshir, Parwan, Samangan, Sar-e Pul, Takhar, Uruzgan, Wardak, Zabul', '19 August 1919 (from UK control over Afghan foreign affairs)', 'Afghanistan is gradually recovering from decades of conflict. Before 2014, the economy had sustained nearly a decade of strong growth, largely because of international assistance. Since 2014, however, the economy has slowed, in large part because of the withdrawal of nearly 100,000 foreign troops that had artificially inflated the country’s economic growth. Despite improvements in life expectancy, incomes, and literacy since 2001, Afghanistan is extremely poor, landlocked, and highly dependent on foreign aid. Much of the population continues to suffer from shortages of housing, clean water, electricity, medical care, and jobs. Corruption, insecurity, weak governance, lack of infrastructure, and the Afghan Government''s difficulty in extending rule of law to all parts of the country pose challenges to future economic growth. Afghanistan''s living standards are among the lowest in the world.\r\nThe international community remains committed to Afghanistan''s development, pledging over $83 billion at ten donors'' conferences between 2003 and 2016. In October 2016, the donors at the Brussels conference pledged an additional $3.8 billion in development aid annually from 2017 to 2020. Despite this help, the Government of Afghanistan will need to overcome a number of challenges, including low revenue collection, anemic job creation, high levels of corruption, weak government capacity, and poor public infrastructure.\r\nIn 2016 Afghanistan''s growth rate was only marginally above that of 2014 and 2015. The drawdown of international security forces that started in 2012 has negatively affected economic growth, as a substantial portion of commerce, especially in the services sector, has catered to the ongoing international troop presence in the country. Afghan President Ashraf GHANI Ahmadzai is dedicated to instituting economic reforms to include improving revenue collection and fighting corruption. However, the reforms will take time to implement and Afghanistan will remain dependent on international donor support over the next several years.', '$19.45 billion (2016 est.)', 'opium, wheat, fruits, nuts; wool, mutton, sheepskins, lambskins, poppies', 'small-scale production of bricks, textiles, soap, furniture, shoes, fertilizer, apparel, food products, non-alcoholic beverages, mineral water, cement; handwoven carpets; natural gas, coal, copper', '7.983 million (2013 est.)', 'opium, fruits and nuts, handwoven carpets, wool, cotton, hides and pelts, precious and semi-precious gems', '1.034 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '189 million cu m (2015 est.)', 'YA (2016)', '43 (2016)', '9 (2013)', 'gas 466 km (2013)', '-', '42,150 km', '1,200 km; (chiefly Amu Darya, which handles vessels up to 500 DWT) (2011)', '2018-02-07 18:03:23', NULL),
