(3, 'AL', 'al', 'Albania', 'Albania declared its independence from the Ottoman Empire in 1912, but was conquered by Italy in 1939 and occupied by Germany in 1943. Communist partisans took over the country in 1944. Albania allied itself first with the USSR (until 1960), and then with China (to 1978). In the early 1990s, Albania ended 46 years of xenophobic communist rule and established a multiparty democracy. The transition has proven challenging as successive governments have tried to deal with high unemployment, widespread corruption, dilapidated infrastructure, powerful organized crime networks, and combative political opponents.\r\nAlbania has made progress in its democratic development since first holding multiparty elections in 1991, but deficiencies remain. Most of Albania''s post-communist elections were marred by claims of electoral fraud; however, international observers judged elections to be largely free and fair since the restoration of political stability following the collapse of pyramid schemes in 1997. Albania joined NATO in April 2009 and in June 2014 became a candidate for EU accession. Albania in November 2016 received a European Commission recommendation to open EU accession negotiations conditioned upon implementation of a judicial reform package passed earlier the same year. Although Albania''s economy continues to grow, it has slowed, and the country is still one of the poorest in Europe. A large informal economy and a weak energy and transportation infrastructure remain obstacles.', 'Europe', '41 00 N, 20 00 E', '28,748 sq km', '3,047,987 (July 2017 est.)', 'Albanian(s)', 'Albanian 82.6%, Greek 0.9%, other 1% (including Vlach, Romani, Macedonian, Montenegrin, and Egyptian), unspecified 15.5% (2011 est.)', 'Albanian 98.8% (official - derived from Tosk dialect), Greek 0.5%, other 0.6% (including Macedonian, Romani, Vlach, Turkish, Italian, and Serbo-Croatian), unspecified 0.1% (2011 est.)', 'Muslim 56.7%, Roman Catholic 10%, Orthodox 6.8%, atheist 2.5%, Bektashi (a Sufi order) 2.1%, other 5.7%, unspecified 16.2%', 'Republic of Albania', 'parliamentary republic', 'Tirana (Tirane)', '12 counties (qarqe, singular - qark); Berat, Diber, Durres, Elbasan, Fier, Gjirokaster, Korce, Kukes, Lezhe, Shkoder, Tirane, Vlore', '28 November 1912 (from the Ottoman Empire)', 'Albania, a formerly closed, centrally-planned state, is a developing country with a modern open-market economy. Albania managed to weather the first waves of the global financial crisis but, the negative effects of the crisis caused a significant economic slowdown. Since 2014, Albania’s economy has steadily improved and economic growth is projected to increase to 3.8% in 2017. However, close trade, remittance, and banking sector ties with Greece and Italy make Albania vulnerable to spillover effects of possible debt crises and weak growth in the euro zone.\r\nRemittances, a significant catalyst for economic growth, declined from 12-15% of GDP before the 2008 financial crisis to 5.8% of GDP in 2015, mostly from Albanians residing in Greece and Italy. The agricultural sector, which accounts for almost half of employment but only about one-fifth of GDP, is limited primarily to small family operations and subsistence farming, because of a lack of modern equipment, unclear property rights, and the prevalence of small, inefficient plots of land. Complex tax codes and licensing requirements, a weak judicial system, endemic corruption, poor enforcement of contracts and property issues, and antiquated infrastructure contribute to Albania''s poor business environment making attracting foreign investment difficult. Since 2015, Albania has launched an ambitious program to increase tax compliance and bring more businesses into the formal economy. In July 2016, Albania passed constitutional amendments reforming the judicial system in order to strengthen the rule of law and to reduce deeply entrenched corruption.\r\nAlbania’s electricity supply is uneven despite upgraded transmission capacities with neighboring countries. However, the government has recently taken steps to stem non-technical losses and has begun to upgrade the distribution grid. Better enforcement of electricity contracts has improved the financial viability of the sector, decreasing its reliance on budget support. Also, with help from international donors, the government is taking steps to improve the poor road and rail networks, a long standing barrier to sustained economic growth.\r\nInward FDI has increased significantly in recent years as the government has embarked on an ambitious program to improve the business climate through fiscal and legislative reforms. The government is focused on the simplification of licensing requirements and tax codes, and it entered into a new arrangement with the IMF for additional financial and technical support. Albania’s three-year IMF program, an extended fund facility arrangement, was successfully concluded in February 2017. Albania’s 2017 budget aims to reach a small primary surplus, which the Albanian Government plans to achieve by strengthening tax collection amid moderate public wage and pension increases. The country continues to face high public debt, exceeding its former statutory limit of 60% of GDP in 2013 and reaching 71% in 2016.', '$11.87 billion (2016 est.)', 'wheat, corn, potatoes, vegetables, fruits, olives and olive oil, grapes; meat, dairy products; sheep and goats', 'food; footwear, apparel and clothing; lumber, oil, cement, chemicals, mining, basic metals, hydropower', '1.358 million (2016 est.)\r\n', 'apparel and clothing, footwear; asphalt, metals and metallic ores, crude oil; cement and construction materials, vegetables, fruits, tobacco', '7.135 billion kWh (2016 est.)', '22,750 bbl/day (2016 est.)', '290 bbl/day (2016 est.)', '35 million cu m (2015 est.)', 'ZA (2016)', '4 (2016)', '1 (2013)', 'gas 498 km (a majority of the network is in disrepair and parts of it are missing); oil 249 km (2015)', '677 km (447 km of major railway lines and 230 km of secondary lines)', '18,000 km', '41 km (on the Bojana River) (2011)', '2018-02-07 18:03:24', NULL),
(4, 'DZ', 'dz', 'Algeria', 'After more than a century of rule by France, Algerians fought through much of the 1950s to achieve independence in 1962. Algeria''s primary political party, the National Liberation Front (FLN), was established in 1954 as part of the struggle for independence and has since largely dominated politics. The Government of Algeria in 1988 instituted a multi-party system in response to public unrest, but the surprising first round success of the Islamic Salvation Front (FIS) in the December 1991 balloting led the Algerian army to intervene and postpone the second round of elections to prevent what the secular elite feared would be an extremist-led government from assuming power. The army began a crackdown on the FIS that spurred FIS supporters to begin attacking government targets. Fighting escalated into an insurgency, which saw intense violence from 1992-98, resulting in over 100,000 deaths - many attributed to indiscriminate massacres of villagers by extremists. The government gained the upper hand by the late-1990s, and FIS''s armed wing, the Islamic Salvation Army, disbanded in January 2000.\r\nAbdelaziz BOUTEFLIKA, with the backing of the military, won the presidency in 1999 in an election widely viewed as fraudulent and won subsequent elections in 2004, 2009, and 2014. The government in 2011 introduced some political reforms in response to the Arab Spring, including lifting the 19-year-old state of emergency restrictions and increasing women''s quotas for elected assemblies, while also increasing subsidies to the populace. Since 2014, Algeria’s reliance on hydrocarbon revenues to fund the government and finance the large subsidies for the population has fallen under stress because of declining oil prices.', 'Africa', '28 00 N, 3 00 E', '2,381,741 sq km', '40,969,443 (July 2017 est.)', 'Algerian(s)', 'Arab-Berber 99%, European less than 1%', 'Arabic (official), French (lingua franca), Berber or Tamazight (official); dialects include Kabyle Berber (Taqbaylit), Shawiya Berber (Tacawit), Mzab Berber, Tuareg Berber (Tamahaq)', 'Muslim (official; predominantly Sunni) 99%, other (includes Christian and Jewish) <1% (2012 est.)', 'People''s Democratic Republic of Algeria', 'presidential republic', 'Algiers', '48 provinces (wilayas, singular - wilaya); Adrar, Ain Defla, Ain Temouchent, Alger, Annaba, Batna, Bechar, Bejaia, Biskra, Blida, Bordj Bou Arreridj, Bouira, Boumerdes, Chlef, Constantine, Djelfa, El Bayadh, El Oued, El Tarf, Ghardaia, Guelma, Illizi, Jijel, Khenchela, Laghouat, Mascara, Medea, Mila, Mostaganem, M''Sila, Naama, Oran, Ouargla, Oum el Bouaghi, Relizane, Saida, Setif, Sidi Bel Abbes, Skikda, Souk Ahras, Tamanrasset, Tebessa, Tiaret, Tindouf, Tipaza, Tissemsilt, Tizi Ouzou, Tlemcen', '5 July 1962 (from France)', 'Algeria''s economy remains dominated by the state, a legacy of the country''s socialist post-independence development model. In recent years the Algerian Government has halted the privatization of state-owned industries and imposed restrictions on imports and foreign involvement in its economy.\r\nHydrocarbons have long been the backbone of the economy, accounting for roughly 30% of GDP, 60% of budget revenues, and nearly 95% of export earnings. Algeria has the 10th-largest reserves of natural gas in the world and is the sixth-largest gas exporter. It ranks 16th in oil reserves. Hydrocarbon exports enabled Algeria to maintain macroeconomic stability and amass large foreign currency reserves while oil prices were high. In addition, Algeria''s external debt is extremely low at about 2% of GDP. However, Algeria has struggled to develop non-hydrocarbon industries because of heavy regulation and an emphasis on state-driven growth. Declining oil prices since 2014 have reduced the government’s ability to use state-driven growth to distribute rents and fund generous public subsidies. Algeria’s foreign exchange reserves have declined by more than 40% since late 2013 and its oil stabilization fund has decreased from about $75 billion at the end of 2013 to about $7 billion in 2017, which is the statutory minimum.\r\nAlgiers has strengthened protectionist measures since 2015 to limit its import bill and encourage domestic production of non-oil and gas industries. Since 2015, the government has imposed additional regulatory requirements on access to foreign exchange for imports and import quotas for specific products, such as cars, to limit their importation. Meanwhile, Algeria has not increased non-hydrocarbon exports, and hydrocarbon exports have declined because of field depletion and increased domestic demand.\r\nWith declining revenues caused by falling oil prices, the government has been under pressure to reduce spending. A wave of economic protests in February and March 2011 prompted Algiers to offer more than $23 billion in public grants and retroactive salary and benefit increases, moves which continue to weigh on public finances. In 2016, the government increased taxes on electricity and fuel, resulting in a modest increase in gasoline prices, and in 2017 raised by 2% the value-added tax on nearly all products, but has refrained from directly reducing subsidies, particularly for education, healthcare, and housing programs.\r\nLong-term economic challenges include diversifying the economy away from its reliance on hydrocarbon exports, bolstering the private sector, attracting foreign investment, and providing adequate jobs for younger Algerians.', '$159 billion (2016 est.)', 'wheat, barley, oats, grapes, olives, citrus, fruits; sheep, cattle', 'petroleum, natural gas, light industries, mining, electrical, petrochemical, food processing', '12.12 million (2016 est.)', 'petroleum, natural gas, and petroleum products 97% (2009 est.)', '64.67 billion kWh (2015 est.)', '1.348 million bbl/day (2016 est.)', '657,600 bbl/day (2014 est.)', '83.04 billion cu m (2015 est.)', '7T (2016)', '157 (2016)', '3 (2013)', 'condensate 2,600 km; gas 16,415 km; liquid petroleum gas 3,447 km; oil 7,036 km; refined products 144 km (2013)', '3,973 km', '113,655 km', '-', '2018-02-07 18:03:24', NULL),
(5, 'AS', 'as', 'American Samoa', 'Settled as early as 1000 B.C., Samoa was not reached by European explorers until the 18th century. International rivalries in the latter half of the 19th century were settled by an 1899 treaty in which Germany and the US divided the Samoan archipelago. The US formally occupied its portion - a smaller group of eastern islands with the excellent harbor of Pago Pago - the following year.', 'Oceania', '14 20 S, 170 00 W', '199 sq km', '51,504 (July 2017 est.)', 'American Samoan(s) (US nationals)', 'Pacific Islander 92.6% (includes Samoan 88.9%, Tongan 2.9%, other .8%), Asian 3.6% (includes Filipino 2.2%, other 1.4%), mixed 2.7%, other 1.2% (2010 est.)', 'Samoan 88.6% (closely related to Hawaiian and other Polynesian languages), English 3.9%, Tongan 2.7%, other Pacific islander 3%, other 1.8%', 'Christian 98.3%, other 1%, unaffiliated 0.7% (2010 est.)', 'Territory of American Samoa', 'presidential democracy; a self-governing territory of the US', 'Pago Pago', 'none (territory of the US)', 'none (territory of the US)', 'American Samoa has a traditional Polynesian economy in which more than 90% of the land is communally owned. Economic activity is strongly linked to the US with which American Samoa conducts most of its commerce. Tuna fishing and tuna processing plants are the backbone of the private sector with canned tuna the primary export. The two tuna canneries accounted for 13.1% of employment in 2013.\r\nIn late September 2009, an earthquake and the resulting tsunami devastated American Samoa and nearby Samoa, disrupting transportation and power generation, and resulting in about 200 deaths. The US Federal Emergency Management Agency oversaw a relief program of nearly $25 million. Transfers from the US Government add substantially to American Samoa''s economic well-being.\r\nAttempts by the government to develop a larger and broader economy are restrained by Samoa''s remote location, its limited transportation, and its devastating hurricanes. Tourism is a promising developing sector. In 2015, a new fish processing company completed refurbishing the processing facilities left behind by one of the two canneries that closed in 2009 and opened a new cannery. With two operating canneries once again, fish processing and exports will rise in the coming years.', '$748.6 million (2005)', 'bananas, coconuts, vegetables, taro, breadfruit, yams, copra, pineapples, papayas; dairy products, livestock', 'tuna canneries (largely supplied by foreign fishing vessels), handicrafts', '16,090 (2013)', 'canned tuna 93%', '163 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '-', '3 (2016)', '-', '-', '-', '241 km (2008)', '-', '2018-02-07 18:03:24', NULL),
(6, 'AD', 'ad', 'Andorra', 'The landlocked Principality of Andorra is one of the smallest states in Europe, nestled high in the Pyrenees between the French and Spanish borders. For 715 years, from 1278 to 1993, Andorrans lived under a unique coprincipality, ruled by French and Spanish leaders (from 1607 onward, the French chief of state and the Bishop of Urgell). In 1993, this feudal system was modified with the introduction of a modern, constitution; the co-princes remained as titular heads of state, but the government transformed into a parliamentary democracy.\r\nAndorra has become a popular tourist destination visited by approximately 8 million people each year drawn by the winter sports, summer climate, and duty-free shopping. Andorra has also become a wealthy international commercial center because of its mature banking sector and low taxes. As part of its effort to modernize its economy, Andorra has opened to foreign investment, and engaged in other reforms, such as advancing tax initiatives aimed at supporting a broader infrastructure. Although not a member of the EU, Andorra enjoys a special relationship with the bloc that is governed by various customs and cooperation agreements and uses the euro as its national currency.', 'Europe', '42 30 N, 1 30 E', '468 sq km', '76,965 (July 2017 est.)', 'Andorran(s)', 'Andorran 46.2%, Spanish 26.4%, Portuguese 12.8%, French 5%, other 9.6% (2016 est.)', 'Catalan (official), French, Castilian, Portuguese', 'Roman Catholic (predominant)', 'Principality of Andorra', 'parliamentary democracy (since March 1993) that retains its chiefs of state in the form of a co-prin', 'Andorra la Vella', '7 parishes (parroquies, singular - parroquia); Andorra la Vella, Canillo, Encamp, Escaldes-Engordany, La Massana, Ordino, Sant Julia de Loria', '1278 (formed under the joint sovereignty of the French Count of Foix and the Spanish Bishop of Urgell)', 'Andorra has a developed economy and a free market, with per capita income above the European average and above the level of its neighbors, Spain and France. The country has developed a sophisticated infrastructure including a one-of-a-kind micro-fiber-optic network for the entire country. Tourism, retail sales, and finance are the mainstays of Andorra''s small economy, accounting for more than three-quarters of GDP. Andorra''s duty-free status for some products and its summer and winter resorts attract millions of visitors annually, although the economic downturn in neighboring countries has curtailed the number of tourists. Andorra uses the euro and is effectively subject to the monetary policy of the European Central Bank. Andorra''s comparative advantage as a tax haven eroded when the borders of neighboring France and Spain opened; its bank secrecy laws have been relaxed under pressure from the EU and OECD.\r\nAgricultural production is limited - only about 5% of the land is arable - and most food has to be imported, making the economy vulnerable to changes in fuel and food prices. The principal livestock is sheep. Manufacturing output and exports consist mainly of perfumes and cosmetic products, products of the printing industry, electrical machinery and equipment, clothing, tobacco products, and furniture. Andorra is a member of the EU Customs Union and is treated as an EU member for trade in manufactured goods (no tariffs) and as a non-EU member for agricultural products.\r\nAndorra is open to, and actively seeking to attract, foreign investment. The Andorran economy is undergoing a process of diversification centered largely on the sectors of tourism, trade, property, and finance. To provide incentives for growth and diversification in the economy, the Andorran government began sweeping economic reforms in 2006. The Parliament approved three laws to complement the first phase of economic openness: on companies (October 2007), on business accounting (December 2007), and on foreign investment (April 2008 and June 2012). From 2011 to 2015, the Parliament also approved direct taxes in the form of taxes on corporations, on individual incomes of residents and non-residents, and on capital gains, savings, and economic activities. These regulations aim to establish a transparent, modern, and internationally comparable regulatory framework.\r\nThe principal objectives of the economic reform are to attract investment and businesses which can contribute most to Andorra’s economic development, offering greater diversification and contributing higher added value. Prior to 2008, when the first law on investment was approved, Andorra offered limited foreign investment opportunities largely due to concerns about the impact of foreign firms on such a small economy. As a consequence, non-citizens were allowed to own no more than 33% of a company. Only after residing in the country for a minimum of 20 years were foreigners entitled to own 100%.', '$2.712 billion (2012 est.)', 'small quantities of rye, wheat, barley, oats, vegetables, tobacco; sheep, cattle', 'tourism (particularly skiing), banking, timber, furniture', '39,750 (2016)', 'tobacco products, furniture', '99.48 million kWh (2015)', '0 bbl/day (2016)', '0 bbl/day (2016)', '0 cu m (2016) (2016)', 'C3 (2016)', '-', '-', '-', '-', '320 km (2015)', '-', '2018-02-07 18:03:24', NULL),
(7, 'AO', 'ao', 'Angola', 'Angola scores low on human development indexes despite using its large oil reserves to rebuild since the end of a 27-year civil war in 2002. Fighting between the Popular Movement for the Liberation of Angola (MPLA), led by Jose Eduardo DOS SANTOS, and the National Union for the Total Independence of Angola (UNITA), led by Jonas SAVIMBI, followed independence from Portugal in 1975. Peace seemed imminent in 1992 when Angola held national elections, but fighting picked up again in 1993. Up to 1.5 million lives may have been lost - and 4 million people displaced - during the more than a quarter century of fighting. SAVIMBI''s death in 2002 ended UNITA''s insurgency and cemented the MPLA''s hold on power. President DOS SANTOS pushed through a new constitution in 2010 and was elected to a five year term as president in 2012.', 'Africa', '12 30 S, 18 30 E', '1,246,700 sq km', '29,310,273 (July 2017 est.)', 'Angolan(s)', 'Ovimbundu 37%, Kimbundu 25%, Bakongo 13%, mestico (mixed European and native African) 2%, European 1%, other 22%', 'Portuguese 71.2% (official), Umbundu 23%, Kikongo 8.2%, Kimbundu 7.8%, Chokwe 6.5%, Nhaneca 3.4%, Nganguela 3.1%, Fiote 2.4%, Kwanhama 2.3%, Muhumbi 2.1%, Luvale 1%, other 3.6%', 'Roman Catholic 41.1%, Protestant 38.1%, other 8.6%, none 12.3% (2014 est.)', 'Republic of Angola', 'presidential republic', 'Luanda', '18 provinces (provincias, singular - provincia); Bengo, Benguela, Bie, Cabinda, Cunene, Huambo, Huila, Kwando Kubango, Kwanza Norte, Kwanza Sul, Luanda, Lunda Norte, Lunda Sul, Malanje, Moxico, Namibe, Uige, Zaire', '11 November 1975 (from Portugal)', 'Angola''s economy is overwhelmingly driven by its oil sector. Oil production and its supporting activities contribute about 50% of GDP, more than 70% of government revenue, and more than 90% of the country''s exports. Diamonds contribute an additional 5% to exports. Subsistence agriculture provides the main livelihood for most of the people, but half of the country''s food is still imported.\r\nIncreased oil production supported growth averaging more than 17% per year from 2004 to 2008. A postwar reconstruction boom and resettlement of displaced persons has led to high rates of growth in construction and agriculture as well. Some of the country''s infrastructure is still damaged or undeveloped from the 27-year-long civil war. However, the government since 2005 has used billions of dollars in credit from China, Brazil, Portugal, Germany, Spain, and the EU to help rebuild Angola''s public infrastructure. Land mines left from the war still mar the countryside, and as a result, the national military, international partners, and private Angolan firms all continue to remove them.\r\nThe global recession that started in 2008 stalled Angola’s economic growth. In particular, lower prices for oil and diamonds slowed GDP growth to 2.4% in 2009, and many construction projects stopped because Luanda accrued $9 billion in arrears to foreign construction companies when government revenue fell. Angola formally abandoned its currency peg in 2009, and in November 2009 signed onto an IMF Stand-By Arrangement loan of $1.4 billion to rebuild international reserves. Consumer inflation declined from 325% in 2000 to less than 9% in 2014, before rising again in 2015-16.\r\nFalling oil prices, the depreciation of the kwanza, and slower than expected growth in non-oil GDP have reduced growth prospects. Corruption, especially in the extractive sectors, is a major long-term challenge that poses an additional threat to the economy. Government spending in the run-up to the 2017 elections is likely to strain Luanda’s budget.', '$95.34 billion (2016 est.)', 'bananas, sugarcane, coffee, sisal, corn, cotton, cassava (manioc, tapioca), tobacco, vegetables, plantains; livestock; forest products; fish', 'petroleum; diamonds, iron ore, phosphates, feldspar, bauxite, uranium, and gold; cement; basic metal products; fish processing; food processing, brewing, tobacco products, sugar; textiles; ship repair', '12.1 million (2016 est.)', 'crude oil, diamonds, refined petroleum products, coffee, sisal, fish and fish products, timber, cotton', '9.438 billion kWh (2015 est.)', '1.77 million bbl/day (2016 est.)', '46,680 bbl/day (2014 est.)', '773 million cu m (2015 est.)', 'D2 (2016)', '176 (2013)', '1 (2013)', 'gas 352 km; liquid petroleum gas 85 km; oil 1,065 km; oil/gas/water 5 km (2013)', '2,852 km', '51,429 km', '1,300 km (2011)', '2018-02-07 18:03:24', NULL),
(8, 'AI', 'ai', 'Anguilla', 'Colonized by English settlers from Saint Kitts in 1650, Anguilla was administered by Great Britain until the early 19th century, when the island - against the wishes of the inhabitants - was incorporated into a single British dependency along with Saint Kitts and Nevis. Several attempts at separation failed. In 1971, two years after a revolt, Anguilla was finally allowed to secede; this arrangement was formally recognized in 1980, with Anguilla becoming a separate British dependency. On 7 September 2017, the island suffered extensive damage from Hurricane Irma, particularly to communications and residential and business infrastructure.', 'Central America and the Caribbean', '18 15 N, 63 10 W', '91 sq km', '17,087 (July 2017 est.)', 'Anguillan(s)', 'African/black 85.3%, hispanic 4.9%, mixed 3.8%, white 3.2%, East Indian/Indian 1%, other 1.6%, unspecified 0.3% (2011 est.)', 'English (official)', 'Protestant 73.2% (includes Anglican 22.7%, Methodist 19.4%, Pentecostal 10.5%, Seventh Day Adventist 8.3%, Baptist 7.1%, Church of God 4.9%, Presbytarian 0.2%, Brethren 0.1%), Roman Catholic 6.8%, Jehovah''s Witness 1.1%, other Christian 10.9%, other 3.2%, unspecified 0.3%, none 4.5% (2011 est.)', 'none', 'parliamentary democracy (House of Assembly); self-governing overseas territory of the UK', 'The Valley', 'none (overseas territory of the UK)', 'none (overseas territory of the UK)', 'Anguilla has few natural resources, and the economy depends heavily on luxury tourism, offshore banking, lobster fishing, and remittances from emigrants. Increased activity in the tourism industry has spurred the growth of the construction sector contributing to economic growth. Anguillan officials have put substantial effort into developing the offshore financial sector, which is small but growing. In the medium term, prospects for the economy will depend largely on the tourism sector and, therefore, on revived income growth in the industrialized nations as well as on favorable weather conditions.', '$175.4 million (2009 est.)', 'small quantities of tobacco, vegetables; cattle raising', 'tourism, boat building, offshore financial services', '6,049 (2001)', 'lobster, fish, livestock, salt, concrete blocks, rum', '-', '-', '-', '-', 'VP-A (2016)', '2 (2013)', '-', '-', '-', '175 km', '-', '2018-02-07 18:03:24', NULL),
(9, 'AQ', 'aq', 'Antarctica', 'Speculation over the existence of a "southern land" was not confirmed until the early 1820s when British and American commercial operators and British and Russian national expeditions began exploring the Antarctic Peninsula region and other areas south of the Antarctic Circle. Not until 1840 was it established that Antarctica was indeed a continent and not merely a group of islands or an area of ocean. Several exploration "firsts" were achieved in the early 20th century, but generally the area saw little human activity. Following World War II, however, the continent experienced an upsurge in scientific research. A number of countries have set up a range of year-round and seasonal stations, camps, and refuges to support scientific research in Antarctica. Seven have made territorial claims, but not all countries recognize these claims. In order to form a legal framework for the activities of nations on the continent, an Antarctic Treaty was negotiated that neither denies nor gives recognition to existing territorial claims; signed in 1959, it entered into force in 1961.', 'Antarctic Region', '90 00 S, 0 00 E', '14 million sq km', 'no indigenous inhabitants, but there are both permanent and summer-only staffed research stations', '-', '-', '', '-', 'none', 'Antarctic Treaty Summary - the Antarctic region is governed by a system known as the Antarctic Treat', '-', '-', '-', 'Scientific undertakings rather than commercial pursuits are the predominant human activity in Antarctica. Offshore fishing and tourism, both based abroad, account for Antarctica''s limited economic activity.\r\nAntarctic fisheries, targeting three main species - Patagonian and Antarctic toothfish (Dissostichus eleginoides and D. mawsoni), mackerel icefish (Champsocephalus gunnari), and krill (Euphausia superba) – reported landing 295,000 metric tons in 2013-14 (estimated fishing is from the area covered by the Convention on the Conservation of Antarctic Marine Living Resources (CCAMLR), which extends slightly beyond the Antarctic Treaty area). Unregulated fishing, particularly of Patagonian toothfish (also known as Chilean sea bass), is an ongoing problem. The CCAMLR determines the recommended catch limits for marine species.\r\nA total of 36,702 tourists visited the Antarctic Treaty area in the 2014-15 Antarctic summer, slightly lower than the 37,405 visitors in 2013-14. These estimates were provided to the Antarctic Treaty by the International Association of Antarctica Tour Operators (IAATO) and do not include passengers on overflights. Nearly all of them were passengers on commercial (nongovernmental) ships and several yachts that make trips during the summer.', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '23 (2013)', '-', '-', '-', '-', '-', '2018-02-07 18:03:24', NULL),
(10, 'AG', 'ag', 'Antigua and Barbuda', 'The Siboney were the first people to inhabit the islands of Antigua and Barbuda in 2400 B.C., but Arawak Indians populated the islands when COLUMBUS landed on his second voyage in 1493. Early Spanish and French settlements were succeeded by an English colony in 1667. Slavery, established to run the sugar plantations on Antigua, was abolished in 1834. The islands became an independent state within the British Commonwealth of Nations in 1981. On 6 September 2017, Hurricane Irma passed over the island of Barbuda devastating the island and forcing the evacuation of the population to Antigua. Almost all the structures on Barbuda were destroyed and the vegetation stripped, but Antigua was spared the worst.', 'Central America and the Caribbean', '17 03 N, 61 48 W', '442.6 sq km (Antigua 280 sq km; Barbuda 161 sq km)', '94,731 (July 2017 est.)', 'Antiguan(s), Barbudan(s)', 'black 87.3%, mixed 4.7%, hispanic 2.7%, white 1.6%, other 2.7%, unspecified 0.9% (2011 est.)', 'English (official), Antiguan creole', 'Protestant 68.3% (Anglican 17.6%, Seventh Day Adventist 12.4%, Pentecostal 12.2%, Moravian 8.3%, Methodist 5.6%, Wesleyan Holiness 4.5%, Church of God 4.1%, Baptist 3.6%), Roman Catholic 8.2%, other 12.2%, unspecified 5.5%, none 5.9% (2011 est.)', 'none', 'parliamentary democracy (Parliament) under a constitutional monarchy; a Commonwealth realm', 'Saint John''s', '6 parishes and 2 dependencies*; Barbuda*, Redonda*, Saint George, Saint John, Saint Mary, Saint Paul, Saint Peter, Saint Philip', '1 November 1981 (from the UK)', 'Tourism continues to dominate Antigua and Barbuda''s economy, accounting for nearly 60% of GDP and 40% of investment. The dual-island nation''s agricultural production is focused on the domestic market and constrained by a limited water supply and a labor shortage stemming from the lure of higher wages in tourism and construction. Manufacturing comprises enclave-type assembly for export with major products being bedding, handicrafts, and electronic components.\r\nLike other countries in the region, Antigua''s economy was severely hit by effects of the global economic recession in 2009. The country suffered from the collapse of its largest private sector employer, a steep decline in tourism, a rise in debt, and a sharp economic contraction between 2009 and 2011. Antigua has not yet returned to its pre-crisis growth levels.\r\nProspects for economic growth in the medium term will continue to depend on tourist arrivals from the US, Canada, and Europe and could be disrupted by potential damage from natural disasters. The new government, elected in 2014 and led by Prime Minister Gaston Browne, continues to face significant fiscal challenges. The government places some hope in a new Citizenship by Investment Program to both reduce public debt levels and spur growth.', '$1.46 billion (2016 est.)', 'cotton, fruits, vegetables, bananas, coconuts, cucumbers, mangoes, sugarcane; livestock', 'tourism, construction, light manufacturing (clothing, alcohol, household appliances)', '30,000 (1991)', 'petroleum products, bedding, handicrafts, electronic components, transport equipment, food and live animals', '330 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'V2 (2016)', '3 (2013)', '-', '-', '-', '1,170 km', '-', '2018-02-07 18:03:24', NULL),
(11, 'AR', 'ar', 'Argentina', 'In 1816, the United Provinces of the Rio Plata declared their independence from Spain. After Bolivia, Paraguay, and Uruguay went their separate ways, the area that remained became Argentina. The country''s population and culture were heavily shaped by immigrants from throughout Europe, with Italy and Spain providing the largest percentage of newcomers from 1860 to 1930. Up until about the mid-20th century, much of Argentina''s history was dominated by periods of internal political conflict between Federalists and Unitarians and between civilian and military factions.\r\nAfter World War II, an era of Peronist populism and direct and indirect military interference in subsequent governments was followed by a military junta that took power in 1976. Democracy returned in 1983 after a failed bid to seize the Falkland Islands (Islas Malvinas) by force, and has persisted despite numerous challenges, the most formidable of which was a severe economic crisis in 2001-02 that led to violent public protests and the successive resignations of several presidents. The years 2003-15 saw Peronist rule by Nestor and Cristina FERNANDEZ de KIRCHNER, whose policies isolated Argentina and caused economic stagnation. With the election of Mauricio MACRI in November 2015, Argentina began a period of reform and international reintegration.', 'South America', '34 00 S, 64 00 W', '2,780,400 sq km', '44,293,293 (July 2017 est.)', 'Argentine(s)', 'European (mostly Spanish and Italian descent) and mestizo (mixed European and Amerindian ancestry) 97.2%, Amerindian 2.4%, African 0.4% (2010 est.)', 'Spanish (official), Italian, English, German, French, indigenous (Mapudungun, Quechua)', 'nominally Roman Catholic 92% (less than 20% practicing), Protestant 2%, Jewish 2%, other 4%', 'Argentine Republic', 'presidential republic', 'Buenos Aires', '23 provinces (provincias, singular - provincia) and 1 autonomous city*; Buenos Aires, Catamarca, Chaco, Chubut, Ciudad Autonoma de Buenos Aires*, Cordoba, Corrientes, Entre Rios, Formosa, Jujuy, La Pampa, La Rioja, Mendoza, Misiones, Neuquen, Rio Negro, Salta, San Juan, San Luis, Santa Cruz, Santa Fe, Santiago del Estero, Tierra del Fuego - Antartida e Islas del Atlantico Sur (Tierra del Fuego), Tucuman', '9 July 1816 (from Spain)', 'Argentina benefits from rich natural resources, a highly literate population, an export-oriented agricultural sector, and a diversified industrial base. Although one of the world''s wealthiest countries 100 years ago, Argentina suffered during most of the 20th century from recurring economic crises, persistent fiscal and current account deficits, high inflation, mounting external debt, and capital flight. In 2016, the World Bank downgraded Argentina from a high-income to upper-middle-income economy, on par with Columbia.\r\nA severe depression, growing public and external indebtedness, and an unprecedented bank run culminated in 2001 in the most serious economic, social, and political crisis in the country''s turbulent history. Interim President Adolfo RODRIGUEZ SAA declared a default - at the time the largest ever - on the government''s foreign debt in December of that year, and abruptly resigned only a few days after taking office. His successor, Eduardo DUHALDE, announced an end to the peso''s decade-long 1-to-1 peg to the US dollar in early 2002. The economy bottomed out that year, with real GDP 18% smaller than in 1998 and almost 60% of Argentines below the poverty line. Real GDP rebounded to grow by an average 8.5% annually over the subsequent six years, taking advantage of previously idled industrial capacity and labor, and expansionary monetary and fiscal policies. Inflation also increased, however, during the administration of President Nestor KIRCHNER, which responded with price restraints on businesses, as well as export taxes and restraints, and beginning in 2007, with understating inflation data.\r\nCristina FERNANDEZ DE KIRCHNER succeeded her husband as president in late 2007, and the rapid economic growth of previous years began to slow sharply the following year as government policies held back exports and the world economy fell into recession. The economy in 2010 rebounded strongly from the 2009 recession, but slowed in late 2011 even as the government continued to rely on expansionary fiscal and monetary policies, which kept inflation in the double digits.\r\nIn order to deal with these problems, the government expanded state intervention in the economy: it nationalized the oil company YPF from Spain''s Repsol, expanded measures to restrict imports, and further tightened currency controls in an effort to bolster foreign reserves and stem capital flight. Between 2011 and 2013, Central Bank foreign reserves dropped $21.3 billion from a high of $52.7 billion. In July 2014, Argentina and China agreed on an $11 billion currency swap; the Argentine Central Bank has received the equivalent of $3.2 billion in Chinese yuan, which it counts as international reserves.\r\nWith the election of President Mauricio MACRI in November 2015, Argentina began a historic political and economic transformation, as his administration took steps to liberalize the Argentine economy, lifting capital controls, floating the peso, removing export controls on some commodities, cutting some energy subsidies, and reforming the country’s official statistics. Argentina negotiated debt payments with holdout bond creditors and returned to international capital markets in April 2016. In September 2016, Argentina completed its first IMF Article IV Consultation since 2006.\r\nAfter years of international isolation, Argentina has taken on several international leadership roles in 2017, including hosting the World Economic Forum on Latin America and the World Trade Organization Ministerial Conference, and is set to assume the presidency of the G-20 in 2018.', '$544.7 billion (2016 est.)', 'sunflower seeds, lemons, soybeans, grapes, corn, tobacco, peanuts, tea, wheat; livestock', 'food processing, motor vehicles, consumer durables, textiles, chemicals and petrochemicals, printing, metallurgy, steel', '17.76 million', 'soybeans and derivatives, petroleum and gas, vehicles, corn, wheat', '133.8 billion kWh (2015 est.)', '510,600 bbl/day (2016 est.)', '687,100 bbl/day (2014 est.)', '36.4 billion cu m (2015 est.)', 'LV (2016)', '1,138 (2013)', '2 (2013)', 'gas 29,930 km; liquid petroleum gas 41 km; oil 6,248 km; refined products 3,631 km (2013)', '36,917.4 km', '231,374 km', '11,000 km (2012)', '2018-02-07 18:03:24', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(12, 'AM', 'am', 'Armenia', 'Armenia prides itself on being the first nation to formally adopt Christianity (early 4th century). Despite periods of autonomy, over the centuries Armenia came under the sway of various empires including the Roman, Byzantine, Arab, Persian, and Ottoman. During World War I in the western portion of Armenia, the Ottoman Empire instituted a policy of forced resettlement coupled with other harsh practices that resulted in at least 1 million Armenian deaths. The eastern area of Armenia was ceded by the Ottomans to Russia in 1828; this portion declared its independence in 1918, but was conquered by the Soviet Red Army in 1920.\r\nArmenian leaders remain preoccupied by the long conflict with Azerbaijan over Nagorno-Karabakh, a primarily Armenian-populated region, assigned to Soviet Azerbaijan in the 1920s by Moscow. Armenia and Azerbaijan began fighting over the area in 1988; the struggle escalated after both countries attained independence from the Soviet Union in 1991. By May 1994, when a trilateral cease-fire between Armenia, Azerbaijan, and Nagorno-Karabakh took hold, ethnic Armenian forces held not only Nagorno-Karabakh but also seven surrounding regions - approximately 14 percent of Azerbaijan’s territory. The economies of both sides have been hurt by their inability to make substantial progress toward a peaceful resolution.\r\nTurkey closed the common border with Armenia in 1993 in support of Azerbaijan in its conflict with Armenia over control of Nagorno-Karabakh and surrounding areas, further hampering Armenian economic growth. In 2009, senior Armenian leaders began pursuing rapprochement with Turkey, aiming to secure an opening of the border, but Turkey has not yet ratified the Protocols normalizing relations between the two countries. In January 2015, Armenia joined Russia, Belarus, and Kazakhstan as a member of the Eurasian Economic Union.', 'Asia', '40 00 N, 45 00 E', '29,743 sq km', '3,045,191 (July 2017 est.)', 'Armenian(s)', 'Armenian 98.1%, Yezidi (Kurd) 1.1%, other 0.7% (2011 est.)', 'Armenian (official) 97.9%, Kurdish (spoken by Yezidi minority) 1%, other 1% (2011 est.)', 'Armenian Apostolic 92.6%, Evangelical 1%, other 2.4%, none 1.1%, unspecified 2.9% (2011 est.)', 'Republic of Armenia', 'parliamentary democracy', 'Yerevan', '11 provinces (marzer, singular - marz); Aragatsotn, Ararat, Armavir, Geghark''unik'', Kotayk'', Lorri, Shirak, Syunik'', Tavush, Vayots'' Dzor, Yerevan', '21 September 1991 (from the Soviet Union)', 'Under the old Soviet central planning system, Armenia developed a modern industrial sector, supplying machine tools, textiles, and other manufactured goods to sister republics, in exchange for raw materials and energy. Armenia has since switched to small-scale agriculture and away from the large agro industrial complexes of the Soviet era. Armenia has only two open trade borders - Iran and Georgia - because its borders with Azerbaijan and Turkey have been closed since 1991 and 1993, respectively, as a result of Armenia''s ongoing conflict with Azerbaijan over the separatist Nagorno-Karabakh region.\r\nArmenia joined the World Trade Organization in January 2003. The government has made some improvements in tax and customs administration in recent years, but anti-corruption measures have been largely ineffective. Armenia will need to pursue additional economic reforms and strengthen the rule of law in order to raise its economic growth and improve economic competitiveness and employment opportunities, especially given its economic isolation from Turkey and Azerbaijan.\r\nArmenia''s geographic isolation, a narrow export base, and pervasive monopolies in important business sectors have made it particularly vulnerable to deteriorations in the global commodity markets and the economic challenges in Russia. Armenia is particularly dependent on Russian commercial and governmental support, as most key Armenian infrastructure is Russian-owned and/or managed, especially in the energy sector. Remittances from expatriates working in Russia are equivalent to about 7-8% of GDP. Armenia joined the Russia-led Eurasian Economic Union in January 2015, but has expressed interest in expanding its economic ties with the European Union as well, and in March 2017 an EU-Armenia Comprehensive and Enhanced Partnership Agreement was initiated. Armenia’s rising government debt is leading Yerevan to tighten its fiscal policies – the debt almost reached the debt to GDP threshold set by national legislation as of March 2017.', '$10.57 billion (2016 est.)', 'fruit (especially grapes and apricots), vegetables; livestock', 'brandy, mining, diamond processing, metal-cutting machine tools, forging and pressing machines, electric motors, knitted wear, hosiery, shoes, silk fabric, chemicals, trucks, instruments, microelectronics, jewelry, software, food processing', '1.514 million (2016 est.)', 'unwrought copper, pig iron, nonferrous metals, gold, diamonds, mineral products, foodstuffs, brandy, cigarettes, energy', '7.393 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'EK (2016)', '11 (2013)', '-', 'gas (high and medium pressure) 3,838 km (2017)', '780 km', '7,792 km (2013)', '-', '2018-02-07 18:03:24', NULL),
(13, 'AW', 'aw', 'Aruba', 'Discovered and claimed for Spain in 1499, Aruba was acquired by the Dutch in 1636. The island''s economy has been dominated by three main industries. A 19th century gold rush was followed by prosperity brought on by the opening in 1924 of an oil refinery. The last decades of the 20th century saw a boom in the tourism industry. Aruba seceded from the Netherlands Antilles in 1986 and became a separate, autonomous member of the Kingdom of the Netherlands. Movement toward full independence was halted at Aruba''s request in 1990.', 'Central America and the Caribbean', '12 30 N, 69 58 W', '180 sq km', '115,120 (July 2017 est.)', 'Aruban(s)', 'Dutch 82.1%, Colombian 6.6%, Venezuelan 2.2%, Dominican 2.2%, Haitian 1.2%, other 5.5%, unspecified 0.1% (2010 est.)', 'Papiamento (official) (a creole language that is a mixture of Portuguese, Spanish, Dutch, English, and, to a lesser extent, French, as well as elements of African languages and the language of the Arawak) 69.4%, Spanish 13.7%, English (widely spoken) 7.1%, Dutch (official) 6.1%, Chinese 1.5%, other 1.7%, unspecified 0.4% (2010 est.)', 'Roman Catholic 75.3%, Protestant 4.9% (includes Methodist 0.9%, Adventist 0.9%, Anglican 0.4%, other Protestant 2.7%), Jehovah''s Witness 1.7%, other 12%, none 5.5%, unspecified 0.5% (2010 est.)', 'none', 'parliamentary democracy (Legislature); part of the Kingdom of the Netherlands', 'Oranjestad', 'none (part of the Kingdom of the Netherlands)', 'none (part of the Kingdom of the Netherlands)', 'Tourism, petroleum bunkering, hospitality, and financial and business services are the mainstays of the small open Aruban economy.\r\nTourism accounts for a majority of economic activity; as of 2014, over 1.7 million tourists visited Aruba annually, with the large majority of those from the US. The rapid growth of the tourism sector has resulted in a substantial expansion of other activities. Construction continues to boom, especially in the hotel sector.\r\nAruba is heavily dependent on imports and is making efforts to expand exports to improve its trade balance. Almost all consumer and capital goods are imported, with the US, the Netherlands, and Panama being the major suppliers.\r\nIn 2016, Citgo Petroleum Corporation, an indirect wholly owned subsidiary of Petroleos de Venezuela SA, and the Government of Aruba signed an agreement to restart Valero Energy Corp.''s former 235,000-b/d refinery . Tourism and related industries have continued to grow, and the Aruban government is working to attract more diverse industries. Aruba''s banking sector continues to be a strong sector; unemployment has significantly decreased.', '$2.516 billion (2009 est.)', 'aloes; livestock; fish', 'tourism, petroleum transshipment facilities, banking', '51,610', 'live animals and animal products, art and collectibles, machinery and electrical equipment, transport equipment', '959 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '1 cu m (2013 est.)', 'P4 (2016)', '1 (2013)', '-', '-', '-', '-', '-', '2018-02-07 18:03:24', NULL),
(14, 'AU', 'au', 'Australia', 'Prehistoric settlers arrived on the continent from Southeast Asia at least 40,000 years before the first Europeans began exploration in the 17th century. No formal territorial claims were made until 1770, when Capt. James COOK took possession of the east coast in the name of Great Britain (all of Australia was claimed as British territory in 1829 with the creation of the colony of Western Australia). Six colonies were created in the late 18th and 19th centuries; they federated and became the Commonwealth of Australia in 1901. The new country took advantage of its natural resources to rapidly develop agricultural and manufacturing industries and to make a major contribution to the Allied effort in World Wars I and II.\r\nIn recent decades, Australia has become an internationally competitive, advanced market economy due in large part to economic reforms adopted in the 1980s and its location in one of the fastest growing regions of the world economy. Long-term concerns include an aging population, pressure on infrastructure, and environmental issues such as floods, droughts, and bushfires. Australia is the driest inhabited continent on earth, making it particularly vulnerable to the challenges of climate change. Australia is home to 10 per cent of the world''s biodiversity, and a great number of its flora and fauna exist nowhere else in the world.', 'Oceania', '27 00 S, 133 00 E', '7,741,220 sq km', '23,232,413 (July 2017 est.)', 'Australian(s)', 'English 25.9%, Australian 25.4%, Irish 7.5%, Scottish 6.4%, Italian 3.3%, German 3.2%, Chinese 3.1%, Indian 1.4%, Greek 1.4%, Dutch 1.2%, other 15.8% (includes Australian aboriginal .5%), unspecified 5.4%', 'English 76.8%, Mandarin 1.6%, Italian 1.4%, Arabic 1.3%, Greek 1.2%, Cantonese 1.2%, Vietnamese 1.1%, other 10.4%, unspecified 5% (2011 est.)', 'Protestant 23.1% (Anglican 13.3%, Uniting Church 3.7%, Presbyterian and Reformed 2.3%, Baptist 1.5%, Pentecostal 1.1%, Lutheran .7%, other Protestant .5%), Roman Catholic 22.6%, other Christian 4.2%, Muslim 2.6%, Buddhist 2.4%, Orthodox 2.3% (Eastern Orthodox 2.1%, Oriental Orthodox .2%), Hindu 1.9%, other 1.3%, none 30.1%, unspecified 9.6% (2016 est.)', 'Commonwealth of Australia', 'parliamentary democracy (Federal Parliament) under a constitutional monarchy; a Commonwealth realm', 'Canberra', '6 states and 2 territories*; Australian Capital Territory*, New South Wales, Northern Territory*, Queensland, South Australia, Tasmania, Victoria, Western Australia', '1 January 1901 (from the federation of UK colonies)', 'Following two decades of continuous growth, low unemployment, contained inflation, very low public debt, and a strong and stable financial system, Australia enters 2017 facing a range of growth constraints, principally driven by the sharp fall in global prices of key export commodities. Demand for resources and energy from Asia and especially China has stalled and sharp drops in current prices have impacted growth.\r\nThe services sector is the largest part of the Australian economy, accounting for about 70% of GDP and 75% of jobs. Australia was comparatively unaffected by the global financial crisis as the banking system has remained strong and inflation is under control.\r\nAustralia benefited from a dramatic surge in its terms of trade in recent years, although this trend has reversed due to falling global commodity prices. Australia is a significant exporter of natural resources, energy, and food. Australia''s abundant and diverse natural resources attract high levels of foreign investment and include extensive reserves of coal, iron, copper, gold, natural gas, uranium, and renewable energy sources. A series of major investments, such as the US$40 billion Gorgon Liquid Natural Gas Project, will significantly expand the resources sector.\r\nAustralia is an open market with minimal restrictions on imports of goods and services. The process of opening up has increased productivity, stimulated growth, and made the economy more flexible and dynamic. Australia plays an active role in the WTO, APEC, the G20, and other trade forums. Australia’s free trade agreement (FTA) with China entered into force in 2015, adding to existing FTAs with the Republic of Korea, Japan, Chile, Malaysia, New Zealand, Singapore, Thailand, and the US, and a regional FTA with ASEAN and New Zealand. Australia continues to negotiate bilateral agreements with India and Indonesia, as well as larger agreements with its Pacific neighbors and the Gulf Cooperation Council countries, and an Asia-wide Regional Comprehensive Economic Partnership that includes the 10 ASEAN countries and China, Japan, Korea, New Zealand and India.', '$1.262 trillion (2016 est.)', 'wheat, barley, sugarcane, fruits; cattle, sheep, poultry', 'mining, industrial and transportation equipment, food processing, chemicals, steel', '12.74 million (2016 est.)', 'coal, iron ore, gold, meat, wool, alumina, wheat, machinery and transport equipment', '237.9 billion kWh (2015 est.)', '289,700 bbl/day (2016 est.)', '472,100 bbl/day (2016 est.)', '67.2 billion cu m (2015 est.)', 'VH (2016)', '480 (2013)', '1 (2013)', 'condensate/gas 637 km; gas 30,054 km; liquid petroleum gas 240 km; oil 3,609 km; oil/gas/water 110 km; refined products 72 km (2013)', '36,967.5 km', '823,217 km', '2,000 km (mainly used for recreation on Murray and Murray-Darling River systems) (2011)', '2018-02-07 18:03:24', NULL),
(15, 'AT', 'at', 'Austria', 'Once the center of power for the large Austro-Hungarian Empire, Austria was reduced to a small republic after its defeat in World War I. Following annexation by Nazi Germany in 1938 and subsequent occupation by the victorious Allies in 1945, Austria''s status remained unclear for a decade. A State Treaty signed in 1955 ended the occupation, recognized Austria''s independence, and forbade unification with Germany. A constitutional law that same year declared the country''s "perpetual neutrality" as a condition for Soviet military withdrawal. The Soviet Union''s collapse in 1991 and Austria''s entry into the EU in 1995 have altered the meaning of this neutrality. A prosperous, democratic country, Austria entered the EU Economic and Monetary Union in 1999.', 'Europe', '47 20 N, 13 20 E', '83,871 sq km', '8,754,413 (July 2017 est.)', 'Austrian(s)', 'Austrians 91.1%, former Yugoslavs 4% (includes Croatians, Slovenes, Serbs, and Bosniaks), Turks 1.6%, Germans 0.9%, other or unspecified 2.4% (2001 census)', 'German (official nationwide) 88.6%, Turkish 2.3%, Serbian 2.2%, Croatian (official in Burgenland) 1.6%, other (includes Slovene, official in South Carinthia, and Hungarian, official in Burgenland) 5.3% (2001 est.)', 'Catholic 73.8% (includes Roman Catholic 73.6%, other Catholic 0.2%), Protestant 4.9%, Muslim 4.2%, Orthodox 2.2%, other 0.8% (includes other Christian), none 12%, unspecified 2% (2001 est.)', 'Republic of Austria', 'federal parliamentary republic', 'Vienna', '9 states (Bundeslaender, singular - Bundesland); Burgenland, Kaernten (Carinthia), Niederoesterreich (Lower Austria), Oberoesterreich (Upper Austria), Salzburg, Steiermark (Styria), Tirol (Tyrol), Vorarlberg, Wien (Vienna)', '12 November 1918 (republic proclaimed); notable earlier dates: 976 (Margravate of Austria established); 17 September 1156 (Duchy of Austria founded); 11 August 1804 (Austrian Empire proclaimed)', 'Austria, with its well-developed market economy, skilled labor force, and high standard of living, is closely tied to other EU economies, especially Germany''s. Its economy features a large service sector, a relatively sound industrial sector, and a small, but highly developed agricultural sector.\r\nEconomic growth has been relatively weak in recent years, approaching 0.9% in 2015, but rising to 1.4% in 2016. Austria''s 5.8% unemployment rate, while low by European standards, is at its highest rate since the end of World War II, driven by an increased number of refugees and EU migrants entering the labor market. Without extensive vocational training programs and generous early retirement, the unemployment rate would be even higher.\r\nAlthough Austria''s fiscal position compares favorably with other euro-zone countries, it faces several external risks, such as unexpectedly weak world economic growth threatening the export market, Austrian banks'' continued exposure to Central and Eastern Europe, repercussions from the Hypo Alpe Adria bank collapse, political and economic uncertainties caused by the European sovereign debt crisis, the current refugee crisis, and continued unrest in Russia/Ukraine. The budget deficit stood at 1.4% of GDP in 2016 and public debt reached a post-war high of 86.2% of the GDP in 2015.', '$386.6 billion (2016 est.)', 'grains, potatoes, wine, fruit; dairy products, cattle, pigs, poultry; lumber and other forestry products', 'construction, machinery, vehicles and parts, food, metals, chemicals, lumber, paper and paperboard, communications equipment, tourism', '3.944 million (2016 est.)', 'machinery and equipment, motor vehicles and parts, paper and paperboard, metal goods, chemicals, iron and steel, textiles, foodstuffs', '56.05 billion kWh (2015 est.)', '15,160 bbl/day (2016 est.)', '188,000 bbl/day (2016 est.)', '1.263 billion cu m (2015 est.)', 'OE (2016)', '52 (2013)', '1 (2013)', 'gas 1,888 km; oil 594 km; refined products 157 km (2017)', '5,800 km (2016)', '138,696 km', '358 km (2011)', '2018-02-07 18:03:24', NULL),
(16, 'AZ', 'az', 'Azerbaijan', 'Azerbaijan - a nation with a majority-Turkic and majority-Shia Muslim population - was briefly independent (from 1918 to 1920) following the collapse of the Russian Empire; it was subsequently incorporated into the Soviet Union for seven decades. Azerbaijan has yet to resolve its conflict with Armenia over Nagorno-Karabakh, a primarily ethnic Armenian-populated region that Moscow recognized in 1923 as an autonomous republic within Soviet Azerbaijan after Armenia and Azerbaijan disputed the territory''s status. Armenia and Azerbaijan reignited their dispute over the area in 1988; the struggle escalated militarily after both countries attained independence from the Soviet Union in 1991. By May 1994, when a cease-fire took hold, ethnic Armenian forces held not only Nagorno-Karabakh but also seven surrounding provinces in the territory of Azerbaijan. The OSCE Minsk Group, co-chaired by the US, France, and Russia, is the framework established to mediate a peaceful resolution of the conflict.\r\nCorruption in the country is widespread, and the government, which eliminated presidential term limits in a 2009 referendum and approved extending presidential terms from 5 to 7 years in 2016, has been accused of authoritarianism. Although the poverty rate has been reduced and infrastructure investment has increased substantially in recent years due to revenue from oil and gas production, reforms have not adequately addressed weaknesses in most government institutions, particularly in the education and health sectors, as well as the court system.', 'Asia', '40 30 N, 47 30 E', '86,600 sq km', '9,961,396 (July 2017 est.)', 'Azerbaijani(s)', 'Azerbaijani 91.6%, Lezghin 2%, Russian 1.3%, Armenian 1.3%, Talysh 1.3%, other 2.4%', 'Azerbaijani (Azeri) (official) 92.5%, Russian 1.4%, Armenian 1.4%, other 4.7% (2009 est.)', 'Muslim 96.9% (predominantly Shia), Christian 3%, other <0.1, unaffiliated <0.1 (2010 est.)', 'Republic of Azerbaijan', 'presidential republic', 'Baku (Baki, Baky)', '66 rayons (rayonlar; rayon - singular), 11 cities (saharlar; sahar - singular);', '30 August 1991 (declared from the Soviet Union); 18 October 1991 (adopted by the Supreme Council of Azerbaijan)', 'Prior to the decline in global oil prices since 2014, Azerbaijan''s high economic growth was attributable to rising energy exports, and some non-export sectors also featured double-digit growth. Oil exports through the Baku-Tbilisi-Ceyhan Pipeline, the Baku-Novorossiysk, and the Baku-Supsa Pipelines remain the main economic driver, but efforts to boost Azerbaijan''s gas production are underway. The expected completion of the geopolitically important Southern Gas Corridor between Azerbaijan and Europe will open up another source of revenue from gas exports. Declining oil prices caused a 3.8% contraction in GDP in 2016, reinforced by a sharp reduction in the construction sector. The economic decline has been accompanied by higher inflation and a weakened banking sector in the aftermath of the two sharp currency devaluations in 2015.\r\nAzerbaijan has made limited progress with market-based economic reforms. Pervasive public and private sector corruption and structural economic inefficiencies remain a drag on long-term growth, particularly in non-energy sectors, but the government has made efforts to combat corruption, particularly in customs and with the “ASAN” one-stop window concept for government services. Several other obstacles impede Azerbaijan''s economic progress, including the need for more foreign investment in the non-energy sector and the continuing conflict with Armenia over the Nagorno-Karabakh region. While trade with Russia and the other former Soviet republics remains important, Azerbaijan has expanded trade with Turkey and Europe and is seeking new markets for non-oil/gas exports, mainly from the agricultural sector, for example with Gulf Cooperation Council member countries, the US, and others.\r\nLong-term prospects depend on world oil prices, Azerbaijan''s ability to implement export routes for its growing gas production, and its ability to improve the business environment and diversify the economy. In late 2016, the President approved a strategic roadmap that identified key non-energy segments of the economy for development, such as agriculture, logistics, and tourism.', '$37.56 billion (2016 est.)', 'fruit, vegetables, grain, rice, grapes, tea, cotton, tobacco; cattle, pigs, sheep, goats', 'petroleum and petroleum products, natural gas, oilfield equipment; steel, iron ore; cement; chemicals and petrochemicals; textiles', '5.032 million (2016 est.)', 'oil and gas roughly 90%, machinery, foodstuffs, cotton', '23.3 billion kWh (2015 est.)', '833,500 bbl/day (2016 est.)', '142,100 bbl/day (2014 est.)', '29.37 billion cu m (2016 est.)', '4K (2016)', '37 (2013)', '1 (2012)', 'condensate 89 km; gas 3,890 km; oil 2,446 km (2013)', '2,944.3 km', '52,942 km', '-', '2018-02-07 18:03:24', NULL),
(17, 'BS', 'bs', 'Bahamas', 'Lucayan Indians inhabited the islands when Christopher COLUMBUS first set foot in the New World on San Salvador in 1492. British settlement of the islands began in 1647; the islands became a colony in 1783. Piracy thrived in the 17th and 18th centuries because of The Bahamas close proximity to shipping lanes. Since attaining independence from the UK in 1973, The Bahamas has prospered through tourism, international banking, and investment management. Because of its location, the country is a major transshipment point for illegal drugs, particularly shipments to the US and Europe, and its territory is used for smuggling illegal migrants into the US.', 'Central America and the Caribbean', '24 15 N, 76 00 W', '13,880 sq km', '329,988', 'Bahamian(s)', 'black 90.6%, white 4.7%, black and white 2.1%, other 1.9%, unspecified 0.7% (2010 est.)', 'English (official), Creole (among Haitian immigrants)', 'Protestant 69.9% (includes Baptist 34.9%, Anglican 13.7%, Pentecostal 8.9% Seventh Day Adventist 4.4%, Methodist 3.6%, Church of God 1.9%, Brethren 1.6%), Roman Catholic 12%, other Christian 13% (includes Jehovah''s Witness 1.1%), other 0.6%, none 1.9%, unspecified 2.6% (2010 est.)', 'Commonwealth of The Bahamas', 'parliamentary democracy (Parliament) under a constitutional monarchy; a Commonwealth realm', 'Nassau', '31 districts; Acklins Islands, Berry Islands, Bimini, Black Point, Cat Island, Central Abaco, Central Andros, Central Eleuthera, City of Freeport, Crooked Island and Long Cay, East Grand Bahama, Exuma, Grand Cay, Harbour Island, Hope Town, Inagua, Long Island, Mangrove Cay, Mayaguana, Moore''s Island, North Abaco, North Andros, North Eleuthera, Ragged Island, Rum Cay, San Salvador, South Abaco, South Andros, South Eleuthera, Spanish Wells, West Grand Bahama', '10 July 1973 (from the UK)', 'The Bahamas has the second highest per capital GDP in the English-speaking Caribbean with an economy heavily dependent on tourism and international banking. Tourism accounts for approximately 75-80% of GDP and directly or indirectly employs half of the archipelago''s labor force. Financial services constitute the second-most important sector of the Bahamian economy, accounting for about 15% of GDP. Manufacturing and agriculture combined contribute less than 7% of GDP and show little growth, despite government incentives aimed at those sectors. On January 1, 2015, the Government introduced a 7.5% Value Added Tax (VAT) on most goods and services, a measure designed to strengthen the fiscal balance sheet. In August 2016, Moody’s downgraded the Bahamas’ bond and issue ratings to Baa3 from Baa2 with a stable outlook, maintaining that rating in its February 2017 review. In December 2016, S&P downgraded the country to BB+ (speculative grade) from BBB- (investment grade) with a stable outlook based on projections of slow economic growth and the pace of debt accumulation. The Bahamas is the only country in the Western Hemisphere that is not a member of the World Trade Organization.', '$8.717 billion (2016 est.)', 'citrus, vegetables; poultry', 'tourism, banking, oil bunkering, maritime industries, transshipment and logistics, salt, aragonite, pharmaceuticals', '196,900 (2013 est.)', 'Rock lobster, aragonite, crude salt, polystyrene products', '1.807 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'C6 (2016)', '61 (2013)', '1 (2013)', '-', '-', '2,700 km', '-', '2018-02-07 18:03:24', NULL),
(18, 'BH', 'bh', 'Bahrain', 'In 1783, the Sunni Al-Khalifa family took power in Bahrain. In order to secure these holdings, it entered into a series of treaties with the UK during the 19th century that made Bahrain a British protectorate. The archipelago attained its independence in 1971. A steady decline in oil production and reserves since 1970 prompted Bahrain to take steps to diversify its economy, in the process developing petroleum processing and refining, aluminum production, and hospitality and retail sectors. It has also endeavored to become a leading regional banking center, especially with respect to Islamic finance. Bahrain''s small size, central location among Gulf countries, economic dependence on Saudi Arabia, and proximity to Iran require it to play a delicate balancing act in foreign affairs among its larger neighbors. Its foreign policy activities usually fall in line with Saudi Arabia and the UAE.\r\nThe Sunni royal family has long struggled to manage relations with its large Shia-majority population. In early 2011, amid Arab uprisings elsewhere in the region, the Bahraini Government confronted similar pro-democracy and reform protests at home with police and military action, including deploying Gulf Cooperation Council security forces to Bahrain. Political talks throughout 2014 between the government and opposition and loyalist political groups failed to reach an agreement, prompting opposition political societies to boycott legislative and municipal council elections in late 2014. Ongoing dissatisfaction with the political status quo continues to factor into sporadic clashes between demonstrators and security forces.', 'Middle East', '26 00 N, 50 33 E', '760 sq km', '1,410,942 (July 2017 est.)', 'Bahraini(s)', 'Bahraini 46%, Asian 45.5%, other Arab 4.7%, African 1.6%, European 1%, other 1.2% (includes Gulf Co-operative country nationals, North and South Americans, and Oceanians) (2010 est.)', 'Arabic (official), English, Farsi, Urdu', 'Muslim 70.3%, Christian 14.5%, Hindu 9.8%, Buddhist 2.5%, Jewish 0.6%, folk religion <.1, unaffiliated 1.9%, other 0.2% (2010 est.)', 'Kingdom of Bahrain', 'constitutional monarchy', 'Manama', '4 governorates (muhafazat, singular - muhafazah); Asimah (Capital), Janubiyah (Southern), Muharraq, Shamaliyah (Northern)', '15 August 1971 (from the UK)', 'Low oil prices have generated a budget deficit of at least a $4 billion deficit in 2016, nearly 14% of GDP. Bahrain has few options for covering this deficit, with meager foreign assets and a constrained borrowing ability. In the last year the three major US credit agencies downgraded Bahrain’s sovereign debt rating to “junk” status, citing persistently low oil prices and the government’s inability to more effectively cut spending.\r\nOil comprises 86% of Bahraini budget revenues, despite past efforts to diversify its economy and to build communication and transport facilities for multinational firms with business in the Gulf. As part of its diversification plans, Bahrain implemented a Free Trade Agreement (FTA) with the US in August 2006, the first FTA between the US and a Gulf state.\r\nOther major economic activities are production of aluminum - Bahrain''s second biggest export after oil - finance, and construction. Bahrain continues to seek new natural gas supplies as feedstock to support its expanding petrochemical and aluminum industries.\r\nIn 2011, Bahrain experienced economic setbacks as a result of domestic unrest driven by the majority Shia population; however, the economy recovered in 2012-15, partly as a result of improved tourism. In addition to addressing its current fiscal woes, Bahraini authorities face the long-term challenge of boosting Bahrain’s regional competitiveness — especially regarding industry, finance, and tourism — and reconciling revenue constraints with popular pressure to maintain generous state subsidies and a large public sector. Over the past year, the government lifted subsidies on meat, diesel, kerosene, and gasoline and announced new higher prices for electricity and water, although it plans to roll these increases out more gradually than previous subsidy cuts.', '$31.86 billion (2016 est.)', 'fruit, vegetables; poultry, dairy products; shrimp, fish', 'petroleum processing and refining, aluminum smelting, iron pelletization, fertilizers, Islamic and offshore banking, insurance, ship repairing, tourism', '808,900', 'petroleum and petroleum products, aluminum, textiles', '26.78 billion kWh (2015 est.)', '50,000 bbl/day (2016 est.)', '270,100 bbl/day (2014 est.)', '15.5 billion cu m (2015 est.)', 'A9C (2016)', '4 (2013)', '1 (2013)', 'gas 20 km; oil 54 km (2013)', '-', '4,122 km', '-', '2018-02-07 18:03:24', NULL),
(19, 'BD', 'bd', 'Bangladesh', 'The huge delta region formed at the confluence of the Ganges and Brahmaputra River systems - now referred to as Bangladesh - was a loosely incorporated outpost of various empires centered on the Gangetic plain for much of the first millennium A.D. Muslim conversions and settlement in the region began in the 10th century, primarily from Arab and Persian traders and preachers. Europeans established trading posts in the area in the 16th century. Eventually the area known as Bengal, primarily Hindu in the western section and mostly Muslim in the eastern half, became part of British India. Partition in 1947 resulted in an eastern wing of Pakistan in the Muslim-majority area, which became East Pakistan. Calls for greater autonomy and animosity between the eastern and western wings of Pakistan led to a Bengali independence movement. That movement, led by the Awami League (AL) and supported by India, won the independence war for Bangladesh in 1971.\r\nThe post-independence AL government faced daunting challenges and in 1975 was overthrown by the military, triggering a series of military coups that resulted in a military-backed government and subsequent creation of the Bangladesh Nationalist Party (BNP) in 1978. That government also ended in a coup in 1981, followed by military-backed rule until democratic elections occurred in 1991. The BNP and AL alternated in power between 1991 and 2013, with the exception of a military-backed, emergency caretaker regime that suspended parliamentary elections planned for January 2007 in an effort to reform the political system and root out corruption. That government returned the country to fully democratic rule in December 2008 with the election of the AL and Prime Minister Sheikh HASINA. In January 2014, the incumbent AL won the national election by an overwhelming majority after the BNP boycotted, extending HASINA''s term as prime minister. With the help of international development assistance, Bangladesh has reduced the poverty rate from over half of the population to less than a third, achieved Millennium Development Goals for maternal and child health, and made great progress in food security since independence. The economy has grown at an annual average of about 6% over the last two decades and the country reached World Bank lower-middle income status in 2015.', 'Asia', '24 00 N, 90 00 E', '148,460 sq km', '157,826,578 (July 2017 est.)', 'Bangladeshi(s)', 'Bengali at least 98%, ethnic groups 1.1%', 'Bangla 98.8% (official, also known as Bengali), other 1.2% (2011 est.)', 'Muslim 89.1%, Hindu 10%, other 0.9% (includes Buddhist, Christian) (2013 est.)', 'People''s Republic of Bangladesh', 'parliamentary republic', 'Dhaka', '8 divisions; Barisal, Chittagong, Dhaka, Khulna, Mymensingh, Rajshahi, Rangpur, Sylhet', '16 December 1971 (from West Pakistan)', 'Bangladesh''s economy has grown roughly 6% per year since 1996 despite prolonged periods of political instability, poor infrastructure, endemic corruption, insufficient power supplies, and slow implementation of economic reforms. Although more than half of GDP is generated through the services sector, almost half of Bangladeshis are employed in the agriculture sector, with rice as the single-most-important product.\r\nGarment exports, the backbone of Bangladesh''s industrial sector, accounted for more than 80% of total exports and surpassed $25 billion in 2016. The sector continues to grow, despite a series of high-profile factory accidents that have killed more than 1,000 workers and crippling strikes, including a nationwide transportation blockade orchestrated by the political opposition during the first several months of 2015. Steady export growth in the garment sector combined with remittances from overseas Bangladeshis - which totaled about $15 billion and 8% of GDP in 2015 - are key contributors to Bangladesh''s sustained economic growth and rising foreign exchange reserves.', '$228.4 billion (2016 est.)', 'rice, jute, tea, wheat, sugarcane, potatoes, tobacco, pulses, oilseeds, spices, fruit; beef, milk, poultry', 'jute, cotton, garments, paper, leather, fertilizer, iron and steel, cement, petroleum products, tobacco, pharmaceuticals, ceramics, tea, salt, sugar, edible oils, soap and detergent, fabricated metal products, electricity, natural gas', '72.05 million', 'garments, knitwear, agricultural products, frozen food (fish and seafood), jute and jute goods, leather', '55.5 billion kWh (2015 est.)', '4,000 bbl/day (2016 est.)', '25,720 bbl/day (2014 est.)', '26.86 billion cu m (2015 est.)', 'S2 (2016)', '18 (2013)', '3 (2013)', 'gas 2,950 km (2013)', '2,460 km', '21,269 km', '8,370 km (includes up to 3,060 km of main cargo routes; network reduced to 5,200 km in the dry season) (2011)', '2018-02-07 18:03:24', NULL),
(20, 'BB', 'bb', 'Barbados', 'The island was uninhabited when first settled by the British in 1627. African slaves worked the sugar plantations established on the island until 1834 when slavery was abolished. The economy remained heavily dependent on sugar, rum, and molasses production through most of the 20th century. The gradual introduction of social and political reforms in the 1940s and 1950s led to complete independence from the UK in 1966. In the 1990s, tourism and manufacturing surpassed the sugar industry in economic importance.', 'Central America and the Caribbean', '13 10 N, 59 32 W', '430 sq km', '292,336 (July 2017 est.)', 'Barbadian(s) or Bajan (colloquial)', 'black 92.4%, white 2.7%, mixed 3.1%, East Indian 1.3%, other 0.2%, unspecified 0.2% (2010 est.)', 'English (official), Bajan (English-based creole language, widely spoken in informal settings)', 'Protestant 66.4% (includes Anglican 23.9%, other Pentecostal 19.5%, Adventist 5.9%, Methodist 4.2%, Wesleyan 3.4%, Nazarene 3.2%, Church of God 2.4%, Baptist 1.8%, Moravian 1.2%, other Protestant 0.9%), Roman Catholic 3.8%, other Christian 5.4% (includes Jehovah''s Witness 2.0%, other 3.4%), Rastafarian 1%, other 1.5%, none 20.6%, unspecified 1.2% (2010 est.)', 'none', 'parliamentary democracy (Parliament) under a constitutional monarchy; a Commonwealth realm', 'Bridgetown', '11 parishes and 1 city*; Bridgetown*, Christ Church, Saint Andrew, Saint George, Saint James, Saint John, Saint Joseph, Saint Lucy, Saint Michael, Saint Peter, Saint Philip, Saint Thomas', '30 November 1966 (from the UK)', 'Barbados is the wealthiest and one of the most developed countries in the Eastern Caribbean and enjoys one of the highest per capita incomes in the region. Historically, the Barbadian economy was dependent on sugarcane cultivation and related activities. However, in recent years the economy has diversified into light industry and tourism. Offshore finance and information services are important foreign exchange earners, boosted by being in the same time zone as eastern US financial centers and by a relatively highly educated workforce. Following the 2008-09 recession, the economy has grown due to increases in tourist arrivals, construction, financial services and exports. However, Barbados’ high public debt to GDP ratio and falling international reserves remain areas of concern. Growth prospects are limited because of a weak economic outlook.', '$4.552 billion (2016 est.)', 'sugarcane, vegetables, cotton', 'tourism, sugar, light manufacturing, component assembly for export', '142,500 (2016 est.)', 'manufactures, sugar, molasses, rum, other foodstuffs and beverages, chemicals, electrical components', '915 million kWh (2015 est.)', '1,000 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '20 million cu m (2014 est.)', '8P (2016)', '1 (2013)', '-', 'gas 33 km; oil 64 km; refined products 6 km (2013)', '-', '1,700 km', '-', '2018-02-07 18:03:25', NULL),
(21, 'BY', 'by', 'Belarus', 'After seven decades as a constituent republic of the USSR, Belarus attained its independence in 1991. It has retained closer political and economic ties to Russia than have any of the other former Soviet republics. Belarus and Russia signed a treaty on a two-state union on 8 December 1999 envisioning greater political and economic integration. Although Belarus agreed to a framework to carry out the accord, serious implementation has yet to take place. Since his election in July 1994 as the country''s first and only directly elected president, Aleksandr LUKASHENKO has steadily consolidated his power through authoritarian means and a centralized economic system. Government restrictions on political and civil freedoms, freedom of speech and the press, peaceful assembly, and religion have remained in place.', 'Europe', '53 00 N, 28 00 E', '207,600 sq km', '9,549,747 (July 2017 est.)', 'Belarusian(s)', 'Belarusian 83.7%, Russian 8.3%, Polish 3.1%, Ukrainian 1.7%, other 2.4%, unspecified 0.9% (2009 est.)', 'Russian (official) 70.2%, Belarusian (official) 23.4%, other 3.1% (includes small Polish- and Ukrainian-speaking minorities), unspecified 3.3% (2009 est.)', 'Orthodox 48.3%, Catholic 7.1%, other 3.5%, non-believers 41.1% (2011 est.)', 'Republic of Belarus', 'presidential republic in name, although in fact a dictatorship', 'Minsk', '6 provinces (voblastsi, singular - voblasts'') and 1 municipality* (horad); Brest, Homyel'' (Gomel''), Horad Minsk* (Minsk City), Hrodna (Grodno), Mahilyow (Mogilev), Minsk, Vitsyebsk (Vitebsk)', '25 August 1991 (from the Soviet Union)', 'As part of the former Soviet Union, Belarus had a relatively well-developed, though aging industrial base; it retained this industrial base - which is now outdated, energy inefficient, and dependent on subsidized Russian energy and preferential access to Russian markets - following the breakup of the USSR. The country also has a broad agricultural base which is largely inefficient and dependent on government subsidies. After an initial burst of capitalist reform between 1991 and 1994, including privatization of smaller state enterprises and some service sector businesses, creation of institutions of private property, and development of entrepreneurship, Belarus'' economic development greatly slowed. About 80% of all industry remains in state hands, and foreign investment has been hindered by a reluctance to welcome private investment absent joint ownership or affiliation with the state. A few businesses, which had been privatized after independence, were renationalized. State banks account for 75% of the banking sector.\r\nEconomic output declined for several years following the collapse of the Soviet Union, but revived in the mid-2000s due to the boom in oil prices. Belarus has only small reserves of crude oil, though it imports most of its crude oil and natural gas from Russia at prices substantially below world market prices. Belarus then derives export revenue by refining Russian crude and selling it at market prices. In late 2006, Russia began a process of rolling back its subsidies on oil and gas exports to Belarus. Several times since, Russia and Belarus have had serious disagreements over the level and price of Russian energy supplies. At one point in 2010, Russia stopped the export of all subsidized oil to Belarus save for domestic needs before the two countries reached a deal to restart the export of discounted oil to Belarus. Beginning in early 2016, Russia claims Belarus began accumulating debt – reaching $740 million by April 2017 – for paying below an agreed price for Russian natural gas. Russia decided to reduce its export of crude oil as a result of the debt. In April 2017, Belarus agreed to pay its gas debt and Russia restored the flow of crude.\r\nNew non-Russian foreign investment has been limited in recent years. In 2011, a financial crisis began, triggered by government-directed salary hikes, compounded by an increased cost in Russian energy inputs and an overvalued Belarusian ruble that lead to a nearly three-fold devaluation of the Belarusian ruble. In November 2011, Belarus agreed to sell to Russia its remaining shares of Beltransgaz, the Belarusian natural gas pipeline operator, in exchange for reduced prices for Russian natural gas. The situation stabilized in 2012, after Belarus received part of a $3 billion loan from the Russian-dominated Eurasian Economic Community Bailout Fund, a $1 billion loan from the Russian state-owned bank Sberbank, and $2.5 billion from the sale of Beltransgaz to Russian state-owned Gazprom; nevertheless, the Belarusian currency lost more than 60% of its value, as inflation reached new highs in 2011 and 2012, before calming in 2013. In December 2013, Russia announced a new loan for Belarus of up to $2 billion for 2014. Notwithstanding foreign assistance, the Belarusian economy continued to struggle under the weight of high external debt servicing payments and trade deficit. In mid-December 2014, structural economic shortcomings were aggravated by the devaluation of the Russian ruble, which triggered a near 40% devaluation of the Belarusian ruble.\r\nSince 2012, Belarus’s economy has suffered stagnation, which has led to widening productivity and income gaps between Belarus and neighboring countries. Since 2015, the Belarusian government has tightened its monetary policies (including allowing a more flexible exchange rate regime) and reduced subsidized government lending to state-owned industrial and agricultural enterprises, amid a drop in state budget revenues owing to falling global prices on key Belarusian export commodities - petroleum products and potash fertilizer. Belarus entered 2016 with a contracting economy and minimal hard currency reserves. GDP and foreign trade fell and unemployment rose, while inflation declined and hard currency reserves increased.', '$47.39 billion (2016 est.)', 'grain, potatoes, vegetables, sugar beets, flax; beef, milk', 'metal-cutting machine tools, tractors, trucks, earthmovers, motorcycles, synthetic fibers, fertilizer, textiles, refrigerators, washing machines and other household appliances', '4.381 million (2016 est.)', 'machinery and equipment, mineral products, chemicals, metals, textiles, foodstuffs', '32.04 billion kWh (2015 est.)', '32,670 bbl/day (2016 est.)', '471,600 bbl/day (2014 est.)', '30 million cu m (2015 est.)', 'EW (2016)', '65 (2013)', '1 (2013)', 'gas 5,386 km; oil 1,589 km; refined products 1,730 km (2013)', '5,528 km', '86,392 km', '2,500 km (major rivers are the west-flowing Western Dvina and Neman Rivers and the south-flowing Dnepr River and its tributaries, the Berezina, Sozh, and Pripyat Rivers) (2011)', '2018-02-07 18:03:25', NULL);
