(22, 'BE', 'be', 'Belgium', 'Belgium became independent from the Netherlands in 1830; it was occupied by Germany during World Wars I and II. The country prospered in the past half century as a modern, technologically advanced European state and member of NATO and the EU. In recent years, political divisions between the Dutch-speaking Flemish of the north and the French-speaking Walloons of the south have led to constitutional amendments granting these regions formal recognition and autonomy. The capital city of Brussels is home to numerous international organizations including the EU and NATO.', 'Europe', '50 50 N, 4 20 E', '30,528 sq km', '11,491,346 (July 2017 est.)', 'Belgian(s)', 'Belgian 75%, Italian 4.1%, Moroccan 3.7%, French 2.4%, Turkish 2%, Dutch 2%, other 12.8% (2011 est.)', 'Dutch (official) 60%, French (official) 40%, German (official) less than 1%', 'Roman Catholic 50%, Protestant and other Christian 2.5%, Muslim 5%, Jewish 0.4%, Buddhist 0.3%, atheist 9.2%, none 32.6% (2009 est.)', 'Kingdom of Belgium', 'federal parliamentary democracy under a constitutional monarchy', 'Brussels', '3 regions (French: regions, singular - region; Dutch: gewesten, singular - gewest); Brussels-Capital Region, also known as Brussels Hoofdstedelijk Gewest (Dutch), Region de Bruxelles-Capitale (French long form), Bruxelles-Capitale (French short form); Flemish Region (Flanders), also known as Vlaams Gewest (Dutch long form), Vlaanderen (Dutch short form), Region Flamande (French long form), Flandre (French short form); Walloon Region (Wallonia), also known as Region Wallone (French long form), Wallonie (French short form), Waals Gewest (Dutch long form), Wallonie (Dutch short form)', '4 October 1830 (a provisional government declared independence from the Netherlands); 21 July 1831 (King LEOPOLD I ascended to the throne)', 'Belgium’s central geographic location and highly developed transport network have helped develop a well-diversified economy, with a broad mix of transport, services, manufacturing, and high tech. Industry is concentrated mainly in the more heavily-populated region of Flanders in the north. Belgium is 100% reliant on foreign sources of fossil fuels, and the planned closure of its seven nuclear plants by 2025 should increase its dependence on foreign energy. Its role as a regional logistical hub makes its economy vulnerable to shifts in foreign demand, particularly with EU trading partners. Roughly three-quarters of Belgium''s trade is with other EU countries.\r\nBelgium’s GDP grew by 1.4% in 2016, unemployment at yearend was 8.4%, and the budget deficit was 2.7% of GDP. The economy largely recovered from the March 2016 terrorist attacks, which mainly impacted the Brussels region tourist and hospitality industry. Prime Minister Charles MICHEL''s center-right government has pledged to further reduce the deficit in response to EU pressure to decrease Belgium''s high public debt of about 107% of GDP, but such efforts could also dampen economic growth. In addition to restrained public spending, low wage growth and higher inflation promise to curtail a more robust recovery in private consumption.\r\nThe government has pledged to pursue a reform program to improve Belgium’s competitiveness, including changes to tax policy, labor market rules, and welfare benefits. These changes have generally made Belgian wages more competitive regionally, but risk worsening tensions with trade unions and triggering extended strikes.', '$466.6 billion (2016 est.)', 'sugar beets, fresh vegetables, fruits, grain, tobacco; beef, veal, pork, milk', 'engineering and metal products, motor vehicle assembly, transportation equipment, scientific instruments, processed food and beverages, chemicals, pharmaceuticals, base metals, textiles, glass, petroleum', '5.291 million (2016 est.)', 'chemicals, machinery and equipment, finished diamonds, metals and metal products, foodstuffs', '64.78 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '701,700 bbl/day (2016 est.)', '0 cu m (2014 est.)', 'OO (2016)', '41 (2013)', '1 (2013)', 'gas 3,139 km; oil 154 km; refined products 535 km (2013)', '3,592 km', '154,012 km', '2,043 km (1,528 km in regular commercial use) (2012)', '2018-02-07 18:03:25', NULL),
(23, 'BZ', 'bz', 'Belize', 'Belize was the site of several Mayan city states until their decline at the end of the first millennium A.D. The British and Spanish disputed the region in the 17th and 18th centuries; it formally became the colony of British Honduras in 1862. Territorial disputes between the UK and Guatemala delayed the independence of Belize until 1981. Guatemala refused to recognize the new nation until 1992 and the two countries are involved in an ongoing border dispute. Tourism has become the mainstay of the economy. Current concerns include the country''s heavy foreign debt burden, high unemployment, growing involvement in the Mexican and South American drug trade, high crime rates, and one of the highest HIV/AIDS prevalence rates in Central America.', 'Central America and the Caribbean', '17 15 N, 88 46 W', '22,966 sq km', '360,346 (July 2017 est.)', 'Belizean(s)', 'mestizo 52.9%, Creole 25.9%, Maya 11.3%, Garifuna 6.1%, East Indian 3.9%, Mennonite 3.6%, white 1.2%, Asian 1%, other 1.2%, unknown 0.3%', 'English 62.9% (official), Spanish 56.6%, Creole 44.6%, Maya 10.5%, German 3.2%, Garifuna 2.9%, other 1.8%, unknown 0.3%, none 0.2% (cannot speak)', 'Roman Catholic 40.1%, Protestant 31.5% (includes Pentecostal 8.4%, Seventh Day Adventist 5.4%, Anglican 4.7%, Mennonite 3.7%, Baptist 3.6%, Methodist 2.9%, Nazarene 2.8%), Jehovah''s Witness 1.7%, other 10.5% (includes Baha''i, Buddhist, Hindu, Mormon, Muslim, Rastafarian, Salvation Army), unspecified 0.6%, none 15.5% (2010 est.)', 'Belize', 'parliamentary democracy (National Assembly) under a constitutional monarchy; a Commonwealth realm', 'Belmopan', '6 districts; Belize, Cayo, Corozal, Orange Walk, Stann Creek, Toledo', '21 September 1981 (from the UK)', 'Tourism is the number one foreign exchange earner in this small economy, followed by exports of sugar, bananas, citrus, marine products, and crude oil.\nThe government''s expansionary monetary and fiscal policies, initiated in September 1998, led to GDP growth averaging nearly 4% in 1999-2007, however GDP growth slowed to 1% in 2015, and 0% in 2016. Oil discoveries in 2006 bolstered this growth and oil exploration continues, but production has fallen in recent years and future oil revenues remain uncertain and are offset by Belize’s growing imports of refined oil.\nAlthough Belize has the third highest per capita income in Central America, the average income figure masks a huge income disparity between rich and poor, and a key government objective remains reducing poverty and inequality with the help of international donors. High unemployment, a growing trade deficit and heavy foreign debt burden continue to be major concerns. Belize faces continued pressure from rising sovereign debt, and a growing trade imbalance.', '$1.74 billion (2016 est.)', 'bananas, cacao, citrus, sugar; fish, cultured shrimp; lumber', 'garment production, food processing, tourism, construction, oil', '120,500', 'sugar, bananas, citrus, clothing, fish products, molasses, wood, crude oil', '248 million kWh (2015 est.)', '2,000 bbl/day (2016 est.)', '33.05 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'V3 (2016)', '47 (2013)\r\n', '-', '-', '-', '2,870 km', '825 km (navigable only by small craft) (2011)', '2018-02-07 18:03:25', NULL),
(24, 'BJ', 'bj', 'Benin', 'Present day Benin was the site of Dahomey, a West African kingdom that rose to prominence in about 1600 and over the next two and a half centuries became a regional power, largely based on its slave trade. Coastal areas of Dahomey began to be controlled by the French in the second half of the 19th century; the entire kingdom was conquered by 1894. French Dahomey achieved independence in 1960; it changed its name to the Republic of Benin in 1975.\nA succession of military governments ended in 1972 with the rise to power of Mathieu KEREKOU and the establishment of a government based on Marxist-Leninist principles. A move to representative government began in 1989. Two years later, free elections ushered in former Prime Minister Nicephore SOGLO as president, marking the first successful transfer of power in Africa from a dictatorship to a democracy. KEREKOU was returned to power by elections held in 1996 and 2001, though some irregularities were alleged. KEREKOU stepped down at the end of his second term in 2006 and was succeeded by Thomas YAYI Boni, a political outsider and independent, who won a second five-year term in March 2011. Patrice TALON, a wealthy businessman, took office in 2016 after campaigning to restore public confidence in the government.', 'Africa', '6 29 N, 2 37 E', '112,622 sq km', '11,038,805', 'Beninese (singular and plural)', 'Fon and related 38.4%, Adja and related 15.1%, Yoruba and related 12%, Bariba and related 9.6%, Fulani and related 8.6%, Ottamari and related 6.1%, Yoa-Lokpa and related 4.3%, Dendi and related 2.9%, other 0.9%, foreigner 1.9% (2013 est.)', 'French (official), Fon and Yoruba (most common vernaculars in south), tribal languages (at least six major ones in north)', 'Muslim 27.7%, Roman Catholic 25.5%, Protestant 13.5% (Celestial 6.7%, Methodist 3.4%, other Protestant 3.4%), Vodoun 11.6%, other Christian 9.5%, other traditional religions 2.6%, other 2.6%, none 5.8% (2013 est.)', 'Republic of Benin', 'presidential republic', 'Porto-Novo (constitutional capital); Cotonou (seat', '12 departments; Alibori, Atacora, Atlantique, Borgou, Collines, Couffo, Donga, Littoral, Mono, Oueme, Plateau, Zou', '1 August 1960 (from France)', 'The free market economy of Benin has grown consecutively for three years, averaging about 5% annually since 2014, but its close trade links to Nigeria expose Benin to risks from volatile commodity prices. Cotton is a key export commodity; high prices supported export earnings, but prices have fallen. Inflation has subsided and remains just 1% over the past several years.\r\nDuring the first 6 months of President TALON’s administration, electrical supply, which has hampered Benin’s economic growth, increased and blackouts have been reduced. Private foreign direct investment is small, and foreign aid accounts for the majority of investment in infrastructure projects.\r\nBenin’s 2001 privatization policy continues in telecommunications, water, electricity, and agriculture. Benin has appealed for international assistance to mitigate piracy against commercial shipping in its territory. Pilferage has significantly dropped as the Port of Cotonou is still making progress towards implementing the International Ship and Port Facility Security (ISPS) Code in an effort to remain competitive. Projects included in Benin''s $307 million Millennium Challenge Corporation (MCC) compact (2006-11) were designed to increase investment and private sector activity by improving key institutional and physical infrastructure. The four projects focused on access to land, access to financial services, access to justice, and access to markets (including modernization of the port). The Port of Cotonou is the largest component of Benin’s economy with revenues projected to account for more than 40% of Benin’s national budget.\r\nRealizing its economic potential requires further efforts to infrastructure upgrades, stemming corruption, and expanding access to foreign markets in Nigeria and neighboring landlocked countries. In September 2015, Benin signed a MCC second Compact for $375 million that is designed to strengthen the national utility service provider, attract private sector investment, fund infrastructure investments in electricity generation and distribution, and develop off-grid electrification for poor and unserved households. In order to raise growth, Benin plans to attract more foreign investment, place more emphasis on tourism, facilitate the development of new food processing systems and agricultural products, encourage new information and communication technology, and establish Independent Power Producers (IPP).', '$8.577 billion (2016 est.)', 'cotton, corn, cassava (manioc, tapioca), yams, beans, palm oil, peanuts, cashews; livestock', 'textiles, food processing, construction materials, cement', '3.662 million (2007 est.)', 'cotton, cashews, shea butter, textiles, palm products, seafood', '311.6 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'TY (2016)', '6 (2013)', '-', '-', '438 km', '16,000 km', '150 km (seasonal navigation on River Niger along northern border) (2011)', '2018-02-07 18:03:25', NULL),
(25, 'BM', 'bm', 'Bermuda', 'Bermuda was first settled in 1609 by shipwrecked English colonists heading for Virginia. Self-governing since 1620, Bermuda is the oldest and most populous of the British overseas territories. Vacationing to the island to escape North American winters first developed in Victorian times. Tourism continues to be important to the island''s economy, although international business has overtaken it in recent years. Bermuda has also developed into a highly successful offshore financial center. A referendum on independence from the UK was soundly defeated in 1995.', 'North America', '32 17 N, 64 47 W', '54 sq km', '70,864 (July 2017 est.)', 'Bermudian(s)', 'black 53.8%, white 31%, mixed 7.5%, other 7.1%, unspecified 0.6% (2010 est.)', 'English (official), Portuguese', 'Protestant 46.2% (includes Anglican 15.8%, African Methodist Episcopal 8.6%, Seventh Day Adventist 6.7, Pentecostal 3.5%, Methodist 2.7%, Presbyterian 2.0%, Church of God 1.6%, Baptist 1.2%, Salvation Army 1.1%, Brethren 1.0%, other Protestant 2.0%), Roman Catholic 14.5%, Jehovah''s Witness 1.3%, other Christian 9.1%, Muslim 1%, other 3.9%, none 17.8%, unspecified 6.2% (2010 est.)', 'Bermuda', 'parliamentary democracy (Parliament); self-governing overseas territory of the UK', 'Hamilton', '9 parishes and 2 municipalities*; Devonshire, Hamilton, Hamilton*, Paget, Pembroke, Saint George*, Saint George''s, Sandys, Smith''s, Southampton, Warwick', 'none (overseas territory of the UK)', 'Tourism accounts for about 5% of Bermuda''s GDP, but a much larger share of employment. Over 80% of its visitors come from the US. The sector struggled in the wake of the global recession of 2008-09. International business, which consists primarily of reinsurance and other financial services, is the real bedrock of Bermuda''s economy, consistently accounting for about 85% of the island''s GDP. Even this sector, however, has lost roughly 5,000 high-paying expatriate jobs since 2008, weighing heavily on household consumption and retail sales. Bermuda must import almost everything. Agriculture and industry are limited due to the small size of the island.\r\nBermuda''s economy entered its seventh straight year of recession in 2015. Unemployment is 9%, public debt is growing and exceeds $2.3 billion, the government pension fund faces a $2.4 billion shortfall, and the economy has not attracted significant new foreign investment. Bermuda''s FY15/16 budget projects a 12% larger deficit than FY14/15. The government announced it would borrow $125 million in 2015 to meet current operating expenses. Still, Bermuda enjoys the fourth highest per capita income in the world, about 70% higher than that of the US.', '$5.198 billion (2013 est.)', 'bananas, vegetables, citrus, flowers; dairy products, honey', 'international business, tourism, light manufacturing', '33,490 (2014 est.)', 'reexports of pharmaceuticals', '662 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2014 est.)', 'VP-B (2016)', '1', '-', '-', '-', '447 km', '-', '2018-02-07 18:03:25', NULL),
(26, 'BT', 'bt', 'Bhutan', 'Following Britain’s victory in the 1865 Duar War, Britain and Bhutan signed the Treaty of Sinchulu, under which Bhutan would receive an annual subsidy in exchange for ceding land to British India. Ugyen WANGCHUCK - who had served as the de facto ruler of an increasingly unified Bhutan and had improved relations with the British toward the end of the 19th century - was named king in 1907. Three years later, a treaty was signed whereby the British agreed not to interfere in Bhutanese internal affairs, and Bhutan allowed Britain to direct its foreign affairs. Bhutan negotiated a similar arrangement with independent India after 1947. Two years later, a formal Indo-Bhutanese accord returned to Bhutan a small piece of the territory annexed by the British, formalized the annual subsidies the country received, and defined India''s responsibilities in defense and foreign relations. Under a succession of modernizing monarchs beginning in the 1950s, Bhutan joined the UN in 1971 and slowly continued its engagement beyond its borders.\nIn March 2005, King Jigme Singye WANGCHUCK unveiled the government''s draft constitution - which introduced major democratic reforms - and held a national referendum for its approval. In December 2006, the King abdicated the throne in favor of his son, Jigme Khesar Namgyel WANGCHUCK. In early 2007, India and Bhutan renegotiated their treaty, eliminating the clause that stated that Bhutan would be "guided by" India in conducting its foreign policy, although Thimphu continues to coordinate closely with New Delhi. Elections for seating the country''s first parliament were completed in March 2008; the king ratified the country''s first constitution in July 2008. Bhutan experienced a peaceful turnover of power following parliamentary elections in 2013, which resulted in the defeat of the incumbent party. The disposition of some 8,500 refugees of the more than 100,000 who fled or were forced out of Bhutan in the 1990s - and who are housed in two UN refugee camps in Nepal - remains unresolved.', 'Asia', '27 28 N, 89 38 E', '38,394 sq km', '758,288 (July 2017 est.)', 'Bhutanese (singular and plural)', 'Ngalop (also known as Bhote) 50%, ethnic Nepalese 35% (includes Lhotsampas - one of several Nepalese ethnic groups), indigenous or migrant tribes 15%', 'Sharchhopka 28%, Dzongkha (official) 24%, Lhotshamkha 22%, other 26% (includes foreign languages) (2005 est.)', 'Lamaistic Buddhist 75.3%, Indian- and Nepalese-influenced Hinduism 22.1%, other 2.6% (2005 est.)', 'Kingdom of Bhutan', 'constitutional monarchy', 'Thimphu', '20 districts (dzongkhag, singular and plural); Bumthang, Chhukha, Chirang, Daga, Gasa, Geylegphug, Ha, Lhuntshi, Mongar, Paro, Pemagatsel, Punakha, Samchi, Samdrup Jongkhar, Shemgang, Tashigang, Tashi Yangtse, Thimphu, Tongsa, Wangdi Phodrang', '17 December 1907 (became a unified kingdom under its first hereditary king)', 'Bhutan''s small economy is based largely on hydropower, agriculture, and forestry, which provide the main livelihood for more than half of the population. Because rugged mountains dominate the terrain and make the building of roads and other infrastructure difficult and expensive, industrial production is primarily of the cottage industry type. The economy is closely aligned with India''s through strong trade and monetary links and is dependent on India for financial assistance and migrant laborers for development projects, especially for road construction. Bhutan inked a pact in December 2014 to expand duty-free trade with Bangladesh.\nMultilateral development organizations administer most educational, social, and environment programs, and take into account the government''s desire to protect the country''s environment and cultural traditions. For example, the government, in its cautious expansion of the tourist sector, encourages visits by upscale, environmentally conscientious tourists. Complicated controls and uncertain policies in areas such as industrial licensing, trade, labor, and finance continue to hamper foreign investment.\nBhutan’s largest export - hydropower to India - could spur sustainable growth in the coming years if Bhutan resolves chronic delays in construction. Bhutan’s hydropower exports comprise 40% of total exports and 25% of GDP. Bhutan currently taps only 6.5% of its 24,000-megawatt hydropower potential and is behind schedule in building 12 new hydropower dams with a combined capacity of 10,000 megawatts by 2020 in accordance with a deal signed in 2008 with India. The high volume of imported materials to build hydropower plants has expanded Bhutan''s trade and current account deficits. Bhutan also is exploring energy exports to Bangladesh.', '$2.121 billion (2016 est.)', 'rice, corn, root crops, citrus; dairy products, eggs', 'cement, wood products, processed fruits, alcoholic beverages, calcium carbide, tourism', '353,000', 'electricity (to India), ferrosilicon, cement, cardamom, calcium carbide, steel rods/bars, dolomite, gypsum', '7.732 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2016 est.)', 'A5 (2016)', '2 (2013)', '-', '-', '-', '10,578 km', '-', '2018-02-07 18:03:25', NULL),
(27, 'BO', 'bo', 'Bolivia', 'Bolivia, named after independence fighter Simon BOLIVAR, broke away from Spanish rule in 1825; much of its subsequent history has consisted of a series of coups and countercoups, with the last coup occurring in 1978. Democratic civilian rule was established in 1982, but leaders have faced difficult problems of deep-seated poverty, social unrest, and illegal drug production.\r\nIn December 2005, Bolivians elected Movement Toward Socialism leader Evo MORALES president - by the widest margin of any leader since the restoration of civilian rule in 1982 - after he ran on a promise to change the country''s traditional political class and empower the nation''s poor, indigenous majority. In December 2009 and October 2014, President MORALES easily won reelection. His party maintained control of the legislative branch of the government, which has allowed him to continue his process of change. In February 2016, MORALES narrowly lost a referendum to approve a constitutional amendment that would have allowed him to compete in the 2019 presidential election. Despite the loss, MORALES has already been chosen by his party to run again in 2019, via a still-undetermined method for him to appear on the ballot.', 'South America', '16 30 S, 68 09 W', '1,098,581 sq km', '11,138,234 (July 2017 est.)', 'Bolivian(s)', 'mestizo (mixed white and Amerindian ancestry) 68%, indigenous 20%, white 5%, cholo/chola 2%, black 1%, other 1%, unspecified 3% ; 44% of respondents indicated feeling part of some indigenous group, predominantly Quechua or Aymara', 'Spanish (official) 60.7%, Quechua (official) 21.2%, Aymara (official) 14.6%, foreign languages 2.4%, Guarani (official) 0.6%, other native languages 0.4%, none 0.1%', 'Roman Catholic 76.8%, Evangelical and Pentecostal 8.1%, Protestant 7.9%, other 1.7%, none 5.5% (2012 est.)', 'Plurinational State of Bolivia', 'presidential republic', 'La Paz (administrative capital); Sucre (constituti', '9 departments (departamentos, singular - departamento); Beni, Chuquisaca, Cochabamba, La Paz, Oruro, Pando, Potosi, Santa Cruz, Tarija', '6 August 1825 (from Spain)', 'Bolivia is a resource rich country with strong growth attributed to captive markets for natural gas exports to Brazil and Argentina. However, the country remains one of the least developed countries in Latin America because of state-oriented policies that deter investment and growth.\r\nFollowing a disastrous economic crisis during the early 1980s, reforms spurred private investment, stimulated economic growth, and cut poverty rates in the 1990s. The period 2003-05 was characterized by political instability, racial tensions, and violent protests against plans - subsequently abandoned - to export Bolivia''s newly discovered natural gas reserves to large Northern Hemisphere markets. In 2005, the government passed a controversial hydrocarbons law that imposed significantly higher royalties and required foreign firms then operating under risk-sharing contracts to surrender all production to the state energy company in exchange for a predetermined service fee. High commodity prices between 2010 and 2014 sustained rapid growth and large trade surpluses with GDP growing 6.8% in 2013 and 5.4% in 2014. The global decline in oil prices that began in late 2014 exerted downward pressure on the price Bolivia receives for exported gas and resulted in lower GDP growth rates - 4.9% in 2015 and 4.3% in 2016 - and losses in government revenue as well as fiscal and trade deficits.\r\nA lack of foreign investment in the key sectors of mining and hydrocarbons, along with conflict among social groups, pose challenges for the Bolivian economy. In 2015, President Evo MORALES expanded efforts to court international investment and boost Bolivia’s energy production capacity. MORALES passed an investment law and promised not to nationalize additional industries in an effort to improve the investment climate. In early 2016, the Government of Bolivia approved the 2016-20 National Economic and Social Development Plan aimed at maintaining growth of 5% and reducing poverty.', '$34.05 billion (2016 est.)', 'soybeans, quinoa, Brazil nuts, sugarcane, coffee, corn, rice, potatoes, chia, coca', 'mining, smelting, petroleum, food and beverages, tobacco, handicrafts, clothing, jewelry', '4.992 million (2016 est.)', 'natural gas, silver, zinc, lead, tin, gold, quinoa, soybeans and soy products', '8.147 billion kWh (2015 est.)', '59,330 bbl/day (2016 est.)', '59,050 bbl/day (2014 est.)', '21.1 billion cu m (2016 est.)', 'CP (2016)\r\n', '21', '-', 'gas 5,457 km; liquid petroleum gas 51 km; oil 2,511 km; refined products 1,627 km (2013)', '3,504 km', '90,568 km', '10,000 km (commercially navigable almost exclusively in the northern and eastern parts of the country) (2012)', '2018-02-07 18:03:25', NULL),
(28, 'BA', 'ba', 'Bosnia and Herzegovina', 'Bosnia and Herzegovina declared sovereignty in October 1991 and independence from the former Yugoslavia on 3 March 1992 after a referendum boycotted by ethnic Serbs. The Bosnian Serbs - supported by neighboring Serbia and Montenegro - responded with armed resistance aimed at partitioning the republic along ethnic lines and joining Serb-held areas to form a "Greater Serbia." In March 1994, Bosniaks and Croats reduced the number of warring factions from three to two by signing an agreement creating a joint Bosniak-Croat Federation of Bosnia and Herzegovina. On 21 November 1995, in Dayton, Ohio, the warring parties initialed a peace agreement that ended three years of interethnic civil strife (the final agreement was signed in Paris on 14 December 1995).\r\nThe Dayton Peace Accords retained Bosnia and Herzegovina''s international boundaries and created a multiethnic and democratic government charged with conducting foreign, diplomatic, and fiscal policy. Also recognized was a second tier of government composed of two entities roughly equal in size: the predominantly Bosniak-Bosnian Croat Federation of Bosnia and Herzegovina and the predominantly Bosnian Serb-led Republika Srpska (RS). The Federation and RS governments are responsible for overseeing most government functions. Additionally, the Dayton Accords established the Office of the High Representative to oversee the implementation of the civilian aspects of the agreement. The Peace Implementation Council at its conference in Bonn in 1997 also gave the High Representative the authority to impose legislation and remove officials, the so-called "Bonn Powers." An original NATO-led international peacekeeping force (IFOR) of 60,000 troops assembled in 1995 was succeeded over time by a smaller, NATO-led Stabilization Force (SFOR). In 2004, European Union peacekeeping troops (EUFOR) replaced SFOR. Currently, EUFOR deploys around 600 troops in theater in a security assistance and training capacity.', 'Europe', '43 52 N, 18 25 E', '51,197 sq km', '3,856,181 (July 2017 est.)', 'Bosnian(s), Herzegovinian(s)', 'Bosniak 50.1%, Serb 30.8%, Croat 15.4%, other 2.7%, not declared/no answer 1%', 'Bosnian (official) 52.9%, Serbian (official) 30.8%, Croatian (official) 14.6%, other 1.6%, no answer 0.2% (2013 est.)', 'Muslim 50.7%, Orthodox 30.7%, Roman Catholic 15.2%, atheist 0.8%, agnostic 0.3%, other 1.2%, undeclared/no answer 1.1% (2013 est.)', 'Bosnia and Herzegovina', 'parliamentary republic', 'Sarajevo', '3 first-order administrative divisions - Brcko District (Brcko Distrikt) (ethnically mixed), the Federation of Bosnia and Herzegovina (Federacija Bosne i Hercegovine) (predominantly Bosniak-Croat), the Republic of Srpska (Republika Srpska) (predominantly Serb)', '1 March 1992 (from Yugoslavia); note - referendum for independence completed on 1 March 1992; independence declared on 3 March 1992', 'Bosnia and Herzegovina has a transitional economy with limited market reforms. The economy relies heavily on the export of metals, energy, textiles, and furniture as well as on remittances and foreign aid. A highly decentralized government hampers economic policy coordination and reform, while excessive bureaucracy and a segmented market discourage foreign investment. Foreign banks, primarily from Austria and Italy, control much of the banking sector, though the largest bank in the Republika Srpska entity is a private domestic one. The konvertibilna marka (convertible mark) - the national currency introduced in 1998 - is pegged to the euro through a currency board arrangement, which has maintained confidence in the currency and has facilitated reliable trade links with European partners. In 2016, Bosnia began a three-year IMF loan program that requires Bosnia to meet economic reform benchmarks to receive future funding installments.\r\nInterethnic warfare in Bosnia and Herzegovina caused production to plummet by 80% from 1992 to 1995 and unemployment to soar, but the economy made progress until 2008, when the global economic crisis caused a downturn. Since 2013, Bosnia and Herzegovina has posted positive economic growth, though severe flooding hampered recovery in 2014. Bosnia and Herzegovina became a full member of the Central European Free Trade Agreement in September 2007.\r\nBosnia and Herzegovina''s private sector is growing slowly, but foreign investment has dropped sharply since 2007. High unemployment remains the most serious macroeconomic problem. Successful implementation of a value-added tax in 2006 provided a steady source of revenue for the government and helped rein in gray-market activity, though public perceptions of government corruption and misuse of taxpayer money has encouraged a large informal economy to persist. National-level statistics have improved over time, but a large share of economic activity remains unofficial and unrecorded.\r\nBosnia and Herzegovina''s top economic priorities are: acceleration of integration into the EU; strengthening the fiscal system; public administration reform; World Trade Organization membership; and securing economic growth by fostering a dynamic, competitive private sector.', '$16.57 billion (2016 est.)', 'wheat, corn, fruits, vegetables; livestock', 'steel, coal, iron ore, lead, zinc, manganese, bauxite, aluminum, motor vehicle assembly, textiles, tobacco products, wooden furniture, ammunition, domestic appliances, oil refining', '1.401 million (2016 est.)', 'metals, clothing, wood products', '14.97 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '20,700 bbl/day (2014 est.)', '0 cu m (2014 est.)', 'T9 (2016)', '24 (2013)', '6 (2013)', 'gas 147 km; oil 9 km (2013)', '965 km', '22,926 km', '(Sava River on northern border; open to shipping but use limited) (2011)', '2018-02-07 18:03:25', NULL),
(29, 'BW', 'bw', 'Botswana', 'Formerly the British protectorate of Bechuanaland, Botswana adopted its new name at independence in 1966. More than four decades of uninterrupted civilian leadership, progressive social policies, and significant capital investment have created one of the most stable economies in Africa. The ruling Botswana Democratic Party has won every election since independence; President Ian KHAMA was reelected for a second term in 2014. Mineral extraction, principally diamond mining, dominates economic activity, though tourism is a growing sector due to the country''s conservation practices and extensive nature preserves. Botswana has one of the world''s highest known rates of HIV/AIDS infection, but also one of Africa''s most progressive and comprehensive programs for dealing with the disease.', 'Africa', '24 38 S, 25 54 E', '581,730 sq km', '2,214,858', 'Motswana (singular), Batswana (plural)', 'Tswana (or Setswana) 79%, Kalanga 11%, Basarwa 3%, other, including Kgalagadi and white 7%', 'Setswana 77.3%, Sekalanga 7.4%, Shekgalagadi 3.4%, English (official) 2.8%, Zezuru/Shona 2%, Sesarwa 1.7%, Sembukushu 1.6%, Ndebele 1%, other 2.8% (2011 est.)', 'Christian 79.1%, Badimo 4.1%, other 1.4% (includes Baha''i, Hindu, Muslim, Rastafarian), none 15.2%, unspecified 0.3% (2011 est.)', 'Republic of Botswana', 'parliamentary republic', 'Gaborone', '10 districts and 6 town councils*; Central, Chobe, Francistown*, Gaborone*, Ghanzi, Jwaneng*, Kgalagadi, Kgatleng, Kweneng, Lobatse*, North East, North West, Selebi-Phikwe*, South East, Southern, Sowa Town*', '30 September 1966 (from the UK)', 'Until the global recession, Botswana maintained one of the world''s highest economic growth rates since independence in 1966. Diamond mining fueled much of the economic expansion and currently accounts for one-quarter of GDP, approximately 85% of export earnings, and about one-third of the government''s revenues. Tourism is the secondary earner of foreign exchange and many Batswana engage in subsistence farming and cattle rearing. Through fiscal discipline and sound management, Botswana transformed itself from one of the poorest countries in the world to a middle-income country with a per capita GDP of approximately $16,900 in 2016. Botswana also ranks as one of the best credit risks in Africa.\r\nBotswana''s economy closely follows global economic trends because of its heavy reliance on a single luxury export. According to official government statistics, unemployment is around 20%, but unofficial estimates run much higher. De Beers, a major international diamond company, signed a 10-year deal with Botswana in 2012 and moved its rough stone sorting and trading division from London to Gaborone in 2013. The move was geared to support the development of Botswana''s nascent downstream diamond industry.\r\nBotswana’s economy recovered from the 2008 global recession in 2010, but has only grown modestly since then, primarily due to the downturn in the global diamond market, though water and power shortages also played a role. The prevalence of HIV/AIDS is second highest in the world and threatens the country''s impressive economic gains. In 2016, Botswana entered its fourth year of drought, detrimental to Botswana’s small, but vital agriculture sector, but diamond exports increased to their highest levels since 2013, buffering economic growth. As a result, the economy registered 2.9% growth in 2016.', '$15.57 billion (2016 est.)', 'livestock, sorghum, maize, millet, beans, sunflowers, groundnuts', 'diamonds, copper, nickel, salt, soda ash, potash, coal, iron ore, silver; beef processing; textiles', '1.187 million (2016 est.)', 'diamonds, copper, nickel, soda ash, beef, textiles', '2.789 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'A2 (2016)', '74 (2013)', '-', '-', '888 km', '17,916 km', '-', '2018-02-07 18:03:25', NULL),
(30, 'BV', 'bv', 'Bouvet Island', 'This uninhabited, volcanic, Antarctic island is almost entirely covered by glaciers making it difficult to approach; it is recognized as the most remote island on Earth. Bouvet Island was discovered in 1739 by a French naval officer after whom it is named. No claim was made until 1825, when the British flag was raised. A few expeditions visited the island in the late 19th century. In 1928, the UK waived its claim in favor of Norway, which had occupied the island the previous year. In 1971, Norway designated Bouvet Island and the adjacent territorial waters a nature reserve. Since 1977, Norway has run an automated meteorological station and studied foraging strategies and distribution of fur seals and penguins on the island. In February 2006, an earthquake weakened the station''s foundation causing it to be blown out to sea in a winter storm. Norway erected a new research station in 2014 that can hold six people for periods of two to four months.', 'Antarctic Region', '54 26 S, 3 24 E', '49 sq km', 'uninhabited', '-', '-', '', '-', 'Bouvet Island', '-', '-', '-', '-', 'no economic activity; declared a nature reserve', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '2018-02-07 18:03:25', NULL),
(31, 'BR', 'br', 'Brazil', 'Following more than three centuries under Portuguese rule, Brazil gained its independence in 1822, maintaining a monarchical system of government until the abolition of slavery in 1888 and the subsequent proclamation of a republic by the military in 1889. Brazilian coffee exporters politically dominated the country until populist leader Getulio VARGAS rose to power in 1930. By far the largest and most populous country in South America, Brazil underwent more than a half century of populist and military government until 1985, when the military regime peacefully ceded power to civilian rulers. Brazil continues to pursue industrial and agricultural growth and development of its interior. Having successfully weathered a period of global financial difficulty in the late 20th century, Brazil was seen as one of the world’s strongest emerging markets and a contributor to global growth. The awarding of the 2014 FIFA World Cup and 2016 Summer Olympic Games, the first ever to be held in South America, was seen as symbolic of the country’s rise. However, since about 2013, Brazil has been plagued by a shrinking economy, growing unemployment, and rising inflation. Political scandal resulted in the impeachment of President Dilma ROUSSEFF in May 2016, a conviction that was upheld by the Senate in August 2016; her vice president, Michel TEMER, will serve as president until 2018, completing her second term.', 'South America', '15 47 S, 47 55 W', '8,515,770 sq km', '207,353,391 (July 2017 est.)', 'Brazilian(s)', 'white 47.7%, mulatto (mixed white and black) 43.1%, black 7.6%, Asian 1.1%, indigenous 0.4% (2010 est.)', 'Portuguese (official and most widely spoken language)', 'Roman Catholic 64.6%, other Catholic 0.4%, Protestant 22.2% (includes Adventist 6.5%, Assembly of God 2.0%, Christian Congregation of Brazil 1.2%, Universal Kingdom of God 1.0%, other Protestant 11.5%), other Christian 0.7%, Spiritist 2.2%, other 1.4%, none 8%, unspecified 0.4% (2010 est.)', 'Federative Republic of Brazil', 'federal presidential republic', 'Brasilia', '26 states (estados, singular - estado) and 1 federal district* (distrito federal); Acre, Alagoas, Amapa, Amazonas, Bahia, Ceara, Distrito Federal*, Espirito Santo, Goias, Maranhao, Mato Grosso, Mato Grosso do Sul, Minas Gerais, Para, Paraiba, Parana, Pernambuco, Piaui, Rio de Janeiro, Rio Grande do Norte, Rio Grande do Sul, Rondonia, Roraima, Santa Catarina, Sao Paulo, Sergipe, Tocantins', '7 September 1822 (from Portugal)', 'Brazil is the eighth-largest economy in the world, but is recovering from a recession in 2015 and 2016 that ranks as the worst in the country’s history. Falling commodity prices reduced export revenues and investment, which weakened the Brazilian real and cut tax revenues. The weaker real made existing public debt, which was largely denominated in foreign currency, more expensive. Lower tax revenues strained the government budget.\nEconomic reforms proposed in 2016 aim to slow the growth of government spending and reduce barriers to foreign investment. Government spending growth helped to push public debt to 70% of GDP at the end of 2016 up from 50% in 2012. Policies to strengthen Brazil’s workforce and industrial sector, such as local content requirements, may have boosted employment at the expense of investment.\nFormer President Dilma ROUSSEFF was impeached and convicted in August 2016 for moving funds among government budgets; the economy has also been affected by multiple corruption scandals involving private companies and government officials. Sanctions against the firms involved — some of the largest in Brazil — has limited their business opportunities, producing a ripple effect on associated businesses and contractors. In addition, investment in these companies has declined because of the scandals.\nBrazil is a member of the Common Market of the South (Mercosur), a trade bloc including Argentina, Paraguay, Uruguay, and Venezuela. After the Asian and Russian financial crises, Mercosur adopted a protectionist stance to guard against exposure to the volatility of foreign markets. Brazil and its Mercosur partners have pledged to open the bloc to more trade and investment, but changes require approval of all five members, which makes policy adjustments too difficult to enact.', '$1.799 trillion (2016 est.)', 'coffee, soybeans, wheat, rice, corn, sugarcane, cocoa, citrus; beef', 'textiles, shoes, chemicals, cement, lumber, iron ore, tin, steel, aircraft, motor vehicles and parts, other machinery and equipment', '110.4 million (2016 est.)', 'transport equipment, iron ore, soybeans, footwear, coffee, automobiles', '559.2 billion kWh (2015 est.)', '2.515 million bbl/day (2016 est.)', '2.899 million bbl/day (2014 est.)', '20.41 billion cu m (2015 est.)', 'PP (2016)', '4,093 (2013)', '13 (2013)', 'condensate/gas 251 km; gas 17,312 km; liquid petroleum gas 352 km; oil 4,831 km; refined products 4,722 km (2013)', '29,849.9 km', '1,580,964 km', '50,000 km (most in areas remote from industry and population) (2012)', '2018-02-07 18:03:25', NULL),
(32, 'IO', 'io', 'British Indian Ocean Territory', 'Formerly administered as part of the British Crown Colony of Mauritius, the British Indian Ocean Territory (BIOT) was established as an overseas territory of the UK in 1965. A number of the islands of the territory were later transferred to the Seychelles when it attained independence in 1976. Subsequently, BIOT has consisted only of the six main island groups comprising the Chagos Archipelago. Only Diego Garcia, the largest and most southerly of the islands, is inhabited. It contains a joint UK-US naval support facility and hosts one of four dedicated ground antennas (the others are on Ascension (Saint Helena, Ascension, and Tristan da Cunha), Kwajalein (Marshall Islands), and at Cape Canaveral, Florida (US)) that assist in the operation of the Global Positioning System (GPS) navigation system. The US Air Force also operates a telescope array on Diego Garcia as part of the Ground-Based Electro-Optical Deep Space Surveillance System (GEODSS) for tracking orbital debris, which can be a hazard to spacecraft and astronauts.\r\nBetween 1967 and 1973, former agricultural workers, earlier residents in the islands, were relocated primarily to Mauritius, but also to the Seychelles. Negotiations between 1971 and 1982 resulted in the establishment of a trust fund by the British Government as compensation for the displaced islanders, known as Chagossians. Beginning in 1998, the islanders pursued a series of lawsuits against the British Government seeking further compensation and the right to return to the territory. In 2006 and 2007, British court rulings invalidated the immigration policies contained in the 2004 BIOT Constitution Order that had excluded the islanders from the archipelago, but upheld the special military status of Diego Garcia. In 2008, the House of Lords, as the final court of appeal in the UK, ruled in favor of the British Government by overturning the lower court rulings and finding no right of return for the Chagossians. In March 2015, the Permanent Court of Arbitration unanimously held that the marine protected area (MPA) that the UK declared around the Chagos Archipelago in April 2010 was in violation of the UN Convention on the Law of the Sea.', 'Political Map of the World', '6 00 S, 71 30 E; note - Diego Garcia 7 20 S, 72 25 E', '60 sq km', 'no indigenous inhabitants', '-', '-', '', '-', 'British Indian Ocean Territory', '-', '-', '-', '-', 'All economic activity is concentrated on the largest island of Diego Garcia, where a joint UK-US military facility is located. Construction projects and various services needed to support the military installation are performed by military and contract employees from the UK, Mauritius, the Philippines, and the US. Some of the natural resources found in this territory include coconuts, fish, and sugarcane. Sugarcane is still a major export for this territory. There are no industrial or agricultural activities on the islands. The territory earns foreign exchange by selling fishing licenses and postage stamps.', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '1 (2013)', '-', '-', '-', 'note: short section of paved road between port and airfield on Diego Garcia', '-', '2018-02-07 18:03:25', NULL),
(33, 'VG', 'vg', 'British Virgin Islands', 'First inhabited by Arawak and later by Carib Indians, the Virgin Islands were settled by the Dutch in 1648 and then annexed by the English in 1672. The islands were part of the British colony of the Leeward Islands from 1872-1960; they were granted autonomy in 1967. The economy is closely tied to the larger and more populous US Virgin Islands to the west; the US dollar is the legal currency. On 6 September 2017, Hurricane Irma devastated the island of Tortola. An estimated 80% of residential and business structures were destroyed or damaged, communications disrupted, and local roads rendered impassable.', 'Central America and the Caribbean', '18 25 N, 64 37 W', '151 sq km', '35,015 (July 2017 est.)', 'British Virgin Islander(s)', 'African/black 76.3%, Latino 5.5%, white 5.4%, mixed 5.3%, Indian 2.1%, East Indian 1.6%, other 3%, unspecified 0.8% (2010 est.)', 'English (official)', 'Protestant 70.2% (Methodist 17.6%, Church of God 10.4%, Anglican 9.5%, Seventh Day Adventist 9.0%, Pentecostal 8.2%, Baptist 7.4%, New Testament Church of God 6.9%, other Protestant 1.2%), Roman Catholic 8.9%, Jehovah''s Witness 2.5%, Hindu 1.9%, other 6.2%, none 7.9%, unspecified 2.4% (2010 est.)', 'British Virgin Islands', 'parliamentary democracy (House of Assembly); self-governing overseas territory of the UK', 'Road Town', 'none (overseas territory of the UK)', 'none (overseas territory of the UK)', 'The economy, one of the most stable and prosperous in the Caribbean, is highly dependent on tourism, which generates an estimated 45% of the national income. More than 934,000 tourists, mainly from the US, visited the islands in 2008. Because of traditionally close links with the US Virgin Islands, the British Virgin Islands has used the US dollar as its currency since 1959.\r\nLivestock raising is the most important agricultural activity; poor soils limit the islands'' ability to meet domestic food requirements.\r\nIn the mid-1980s, the government began offering offshore registration to companies wishing to incorporate in the islands, and incorporation fees now generate substantial revenues. Roughly 400,000 companies were on the offshore registry by yearend 2000. The adoption of a comprehensive insurance law in late 1994, which provides a blanket of confidentiality with regulated statutory gateways for investigation of criminal offenses, made the British Virgin Islands even more attractive to international business.', '$1.095 billion (2008)', 'fruits, vegetables; livestock, poultry; fish', 'tourism, light industry, construction, rum, concrete block, offshore banking center', '12,770 (2004)', 'rum, fresh fish, fruits, animals; gravel, sand', '126 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'VP-L (2016)', '4 (2013)', '-', '-', '-', '200 km', '-', '2018-02-07 18:03:25', NULL);
