(34, 'BN', 'bn', 'Brunei', 'The Sultanate of Brunei''s influence peaked between the 15th and 17th centuries when its control extended over coastal areas of northwest Borneo and the southern Philippines. Brunei subsequently entered a period of decline brought on by internal strife over royal succession, colonial expansion of European powers, and piracy. In 1888, Brunei became a British protectorate; independence was achieved in 1984. The same family has ruled Brunei for over six centuries. Brunei benefits from extensive petroleum and natural gas fields, the source of one of the highest per capita GDPs in the world. In 2017, Brunei celebrated the 50th anniversary of the Sultan Hassanal BOLKIAH’s accession to the throne.', 'Southeast Asia', '4 53 N, 114 56 E', '5,765 sq km', '443,593 (July 2017 est.)', 'Bruneian(s)', 'Malay 65.7%, Chinese 10.3%, other 24% (2016 est.)', 'Malay (Bahasa Melayu) (official), English, Chinese dialects', 'Muslim (official) 78.8%, Christian 8.7%, Buddhist 7.8%, other (includes indigenous beliefs) 4.7% (2011 est.)', 'Brunei Darussalam', 'absolute monarchy or sultanate', 'Bandar Seri Begawan', '4 districts (daerah-daerah, singular - daerah); Belait, Brunei-Muara, Temburong, Tutong', '1 January 1984 (from the UK)', 'Brunei is an energy-rich sultanate on the northern coast of Borneo in Southeast Asia. Brunei boasts a well-educated, largely English-speaking population; excellent infrastructure; and a stable government intent on attracting foreign investment. Crude oil and natural gas production account for approximately 65% of GDP and 95% of exports, with Japan as the primary export market.\nPer capita GDP is among the highest in the world, and substantial income from overseas investment supplements income from domestic hydrocarbon production. Bruneian citizens pay no personal income taxes, and the government provides free medical services and free education through the university level.\nThe Bruneian Government wants to diversify its economy away from hydrocarbon exports to other industries such as information and communications technology and halal manufacturing, permissible under Islamic law. Brunei’s trade in 2016 was set to increase following its regional economic integration in the ASEAN Economic Community, and the expected ratification of the Trans-Pacific Partnership trade agreement.', '$11.4 billion (2016 est.)', 'rice, vegetables, fruits; chickens, water buffalo, cattle, goats, eggs', 'petroleum, petroleum refining, liquefied natural gas, construction, agriculture, transportation', '203,600 (2014 est.)', 'mineral fuels, organic chemicals', '3.948 billion kWh (2015 est.)', '109,100 bbl/day (2016 est.)', '8,345 bbl/day (2014 est.)', '12 billion cu m (2015 est.)', 'V8 (2016)', '1 (2013)', '3 (2013)', 'condensate 33 km; condensate/gas 86 km; gas 628 km; oil 492 km (2013)', '-', '3,029 km', '209 km (navigable by craft drawing less than 1.2 m; the Belait, Brunei, and Tutong Rivers are major transport links) (2012)', '2018-02-07 18:03:25', NULL),
(35, 'BG', 'bg', 'Bulgaria', 'The Bulgars, a Central Asian Turkic tribe, merged with the local Slavic inhabitants in the late 7th century to form the first Bulgarian state. In succeeding centuries, Bulgaria struggled with the Byzantine Empire to assert its place in the Balkans, but by the end of the 14th century the country was overrun by the Ottoman Turks. Northern Bulgaria attained autonomy in 1878 and all of Bulgaria became independent from the Ottoman Empire in 1908. Having fought on the losing side in both World Wars, Bulgaria fell within the Soviet sphere of influence and became a People''s Republic in 1946. Communist domination ended in 1990, when Bulgaria held its first multiparty election since World War II and began the contentious process of moving toward political democracy and a market economy while combating inflation, unemployment, corruption, and crime. The country joined NATO in 2004 and the EU in 2007.', 'Europe', '42 41 N, 23 19 E', '110,879 sq km', '7,101,510 (July 2017 est.)', 'Bulgarian(s)', 'Bulgarian 76.9%, Turkish 8%, Romani 4.4%, other 0.7% (including Russian, Armenian, and Vlach), other (unknown) 10% (2011 est.)', 'Bulgarian (official) 76.8%, Turkish 8.2%, Romani 3.8%, other 0.7%, unspecified 10.5% (2011 est.)', 'Eastern Orthodox 59.4%, Muslim 7.8%, other (including Catholic, Protestant, Armenian Apostolic Orthodox, and Jewish) 1.7%, none 3.7%, unspecified 27.4% (2011 est.)', 'Republic of Bulgaria', 'parliamentary republic', 'Sofia', '28 provinces (oblasti, singular - oblast); Blagoevgrad, Burgas, Dobrich, Gabrovo, Haskovo, Kardzhali, Kyustendil, Lovech, Montana, Pazardzhik, Pernik, Pleven, Plovdiv, Razgrad, Ruse, Shumen, Silistra, Sliven, Smolyan, Sofia, Sofia-Grad (Sofia City), Stara Zagora, Targovishte, Varna, Veliko Tarnovo, Vidin, Vratsa, Yambol', '3 March 1878 (as an autonomous principality within the Ottoman Empire); 22 September 1908 (complete independence from the Ottoman Empire)', 'Bulgaria, a former communist country that entered the EU in 2007, has an open economy that historically has demonstrated strong growth, but its per-capita income remains one of the lowest among EU members and its reliance on energy imports and foreign demand for its exports makes its growth sensitive to external market conditions.\r\nThe government undertook significant structural economic reforms in the 1990s to move the economy from a centralized, planned economy to a more liberal, market-driven economy. These reforms included privatization of state-owned enterprises, liberalization of trade, and strengthening of the tax system - changes that initially caused some economic hardships but later helped to attract investment, spur growth, and make gradual improvements to living conditions. From 2000 through 2008, Bulgaria maintained robust, average annual real GDP growth in excess of 6%, which was followed by a deep recession in 2009 as the financial crisis caused domestic demand, exports, capital inflows and industrial production to contract, prompting the government to rein in spending. Real GDP growth remained slow - less than 2% annually - until 2015, when demand from EU countries for Bulgarian exports, plus an inflow of EU development funds, boosted growth to more than 3%. In recent years, low international energy prices have contributed to Bulgaria’s economic growth and helped to ease inflation; but, in 2017, rising international gas prices could dampen Bulgaria’s growth prospects.\r\nBulgaria is heavily reliant on energy imports from Russia, a potential vulnerability, and is a participant in EU-backed efforts to diversify regional natural gas supplies. In late 2016, the Bulgarian Government provided funding to Bulgaria’s National Electric Company to cover the $695 million compensation owed to Russian nuclear equipment manufacturer Atomstroyexport for the cancellation of the Belene Nuclear Power Plant project, which the Bulgarian Government terminated in 2012. In 2016, the Bulgarian Government established the State eGovernment Agency. This new agency is responsible for the implementation of projects related to electronic governance as well as coordination of national policies in this area with the EU requirements and practices, as well as to strengthen cybersecurity.\r\nDespite a favorable investment regime, including low, flat corporate income taxes, significant challenges remain. Corruption in public administration, a weak judiciary, low productivity, and the presence of organized crime continue to hamper the country''s investment climate and economic prospects.', '$52.39 billion (2016 est.)', 'vegetables, fruits, tobacco, wine, wheat, barley, sunflowers, sugar beets; livestock', 'electricity, gas, water; food, beverages, tobacco; machinery and equipment, automotive parts, base metals, chemical products, coke, refined petroleum, nuclear fuel; outsourcing centers', '2.556 million', 'clothing, footwear, iron and steel, machinery and equipment, fuels, agriculture, tobacco, IT components', '46.15 billion kWh (2015 est.)', '1,000 bbl/day (2016 est.)', '132,000 bbl/day (2014 est.)', 'Natural gas - production', 'LZ (2016)', '68 (2013)', '1 (2013)', 'gas 2,765 km; oil 346 km; refined products 378 km (2017)\r\n', '5,114 km', '19,512 km', '470 km (2009)\r\n', '2018-02-07 18:03:25', NULL),
(36, 'BF', 'bf', 'Burkina Faso', 'Burkina Faso (formerly Upper Volta) achieved independence from France in 1960. Repeated military coups during the 1970s and 1980s were followed by multiparty elections in the early 1990s. Former President Blaise COMPAORE (1987-2014) resigned in late October 2014 following popular protests against his efforts to amend the Constitution''s two-term presidential limit. By mid-November, a framework for an interim government was adopted under the terms of the National Transition Charter. An interim administration, led by President Michel KAFANDO and Prime Minister Yacouba Isaac ZIDA, began organizing presidential and legislative elections planned for October 2015, but these were postponed during a weeklong failed coup in September. The rescheduled elections were held on 29 November, and Roch Marc Christian KABORE was elected president in the first round. Burkina Faso''s high population growth and limited natural resources result in poor economic prospects for the majority of its citizens.', 'Africa', '13 00 N, 2 00 W', '274,200 sq km', '20,107,509', 'Burkinabe (singular and plural)', 'Mossi 52%, Fulani 8.4%, Gurma 7%, Bobo 4.9%, Gurunsi 4.6%, Senufo 4.5%, Bissa 3.7%, Lobi 2.4%, Dagara 2.4%, Tuareg/Bella 1.9%, Dioula 0.8%, unspecified/no answer 0.3%, other 7.2% (2010 est.)', 'French (official), native African languages belonging to Sudanic family spoken by 90% of the population', 'Muslim 61.5%, Roman Catholic 23.3%, traditional/animist 7.8%, Protestant 6.5%, other/no answer 0.2%, none 0.7% (2010 est.)', 'Burkina Faso', 'presidential republic', 'Ouagadougou', '13 regions; Boucle du Mouhoun, Cascades, Centre, Centre-Est, Centre-Nord, Centre-Ouest, Centre-Sud, Est, Hauts-Bassins, Nord, Plateau-Central, Sahel, Sud-Ouest', '5 August 1960 (from France)', 'Burkina Faso is a poor, landlocked country that depends on adequate rainfall. About 90% of the population is engaged in subsistence farming and cotton is the main cash crop. The country has few natural resources and a weak industrial base.\r\nCotton and gold are Burkina Faso’s key exports - gold has accounted for about three-quarters of the country’s total export revenues. Burkina Faso’s economic growth and revenue depends largely on production levels and global prices for the two commodities. The Burkinabe economy experienced high levels of growth over the last few years, and the country has seen an upswing in gold exploration, production, and exports.\r\nBurkina Faso experienced a number of public protests over the high cost of living, corruption, and other socioeconomic issues in 2013, while the fall of the COMPAORE government in 2014 and failed coup in September 2015 disrupted economic activity and strained government finances. A new three-year IMF program, approved in 2013, was recently completed. Discussions are currently underway on a new program. Political insecurity in neighboring Mali, unreliable energy supplies, and poor transportation links pose long-term challenges.', '$12.12 billion (2016 est.)', 'cotton, peanuts, shea nuts, sesame, sorghum, millet, corn, rice; livestock', 'cotton lint, beverages, agricultural processing, soap, cigarettes, textiles, gold', '8.501 million', 'gold, cotton, livestock', '944 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'XT (2016)', '23 (2013)', '-', '-', '622 km', '15,272 km', '-', '2018-02-07 18:03:25', NULL),
(37, 'BI', 'bi', 'Burundi', 'Burundi is a small country in East Africa bordered by Tanzania, Rwanda, and Lake Tanganyika. Burundi gained its independence from Belgium in 1962. Much of its history has been turbulent, and Burundi''s first democratically elected president was assassinated in October 1993 after only 100 days in office. The internationally brokered Arusha Agreement ended the 1993-2005 civil war, paving the way for a new constitution and 2005 elections. Pierre NKURUNZIZA was elected president in 2005 and 2010 and again in a controversial election in 2015. Burundi continues to face many political and economic challenges.', 'Africa', '3 22 S, 29 21 E', '27,830 sq km', '11,466,756', 'Burundian(s)', 'Hutu (Bantu) 85%, Tutsi (Hamitic) 14%, Twa (Pygmy) 1%, Europeans 3,000, South Asians 2,000', 'Kirundi 29.7% (official), Kirundi and other language 9.1%, French (official) and French and other language 0.3%, Swahili and Swahili and other language 0.2% (along Lake Tanganyika and in the Bujumbura area), English (official) and English and other language 0.06%, more than 2 languages 3.7%, unspecified 56.9%', 'Roman Catholic 62.1%, Protestant 23.9% (includes Adventist 2.3% and other Protestant 21.6%), Muslim 2.5%, other 3.6%, unspecified 7.9% (2008 est.)', 'Republic of Burundi', 'presidential republic', 'Bujumbura', '18 provinces; Bubanza, Bujumbura Mairie, Bujumbura Rural, Bururi, Cankuzo, Cibitoke, Gitega, Karuzi, Kayanza, Kirundo, Makamba, Muramvya, Muyinga, Mwaro, Ngozi, Rumonge, Rutana, Ruyigi', '1 July 1962 (from UN trusteeship under Belgian administration)', 'Burundi is a landlocked, resource-poor country with an underdeveloped manufacturing sector. Agriculture accounts for over 40% of GDP and employs more than 90% of the population. Burundi''s primary exports are coffee and tea, which account for more than 60% of foreign exchange earnings. Thus, Burundi''s export earnings - and its ability to pay for imports - rest primarily on favorable weather conditions and international coffee and tea prices, although exports are a relatively small share of GDP. Burundi is heavily dependent on aid from bilateral and multilateral donors. Foreign aid represented 48% of Burundi''s national income in 2015, one of the highest percentages in Sub-Saharan Africa, but decreased to 33.5% in 2016. Burundi joined the East African Community (EAC) in 2009.\r\nThe 1993-2005 civil war resulted in more than 200,000 deaths, forced more than 48,000 refugees into Tanzania, and displaced 140,000 others internally. Political stability, aid flows, and economic activity improved following the war’s end, but underlying weaknesses – low governmental capacity, a high poverty rate, poor educational levels, a weak legal system, a poor transportation network, and overburdened utilities – have prevented the implementation of planned economic reforms. Government corruption has also hindered the development of a private sector. The purchasing power of most Burundians has decreased as wage increases have not kept pace with inflation.\r\nIn 2015, Burundi’s economy suffered from political turmoil, including street protests and an attempted coup, following President NKURUNZIZA’s controversial announcement that he would run for a third term. Insecurity and refugee flows to neighboring countries slowed down economic activity and donors withdrew aid, increasing Burundi’s budget deficit and decreasing hard currency reserves. Real GDP growth dropped precipitously and has yet to recover to pre-conflict levels.', '$3.138 billion (2016 est.)', 'coffee, cotton, tea, corn, beans, sorghum, sweet potatoes, bananas, cassava (manioc, tapioca); beef, milk, hides', 'light consumer goods (sugar, shoes, soap, beer); cement, assembly of imported components; public works construction; food processing (fruits)', '4.842 million (2016 est.)', 'coffee, tea, sugar, cotton, hides', '230 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '9U (2016)', '7 (2013)', '1 (2012)', '-', '-', '12,322 km', '(mainly on Lake Tanganyika between Bujumbura, Burundi''s principal port, and lake ports in Tanzania, Zambia, and the Democratic Republic of the Congo) (2011)', '2018-02-07 18:03:25', NULL),
(38, 'KH', 'kh', 'Cambodia', 'Most Cambodians consider themselves to be Khmers, descendants of the Angkor Empire that extended over much of Southeast Asia and reached its zenith between the 10th and 13th centuries. Attacks by the Thai and Cham (from present-day Vietnam) weakened the empire, ushering in a long period of decline. The king placed the country under French protection in 1863, and it became part of French Indochina in 1887. Following Japanese occupation in World War II, Cambodia gained full independence from France in 1953. In April 1975, after a seven-year struggle, communist Khmer Rouge forces captured Phnom Penh and evacuated all cities and towns. At least 1.5 million Cambodians died from execution, forced hardships, or starvation during the Khmer Rouge regime under POL POT. A December 1978 Vietnamese invasion drove the Khmer Rouge into the countryside, began a 10-year Vietnamese occupation, and touched off almost 13 years of civil war.\r\nThe 1991 Paris Peace Accords mandated democratic elections and a cease-fire, which was not fully respected by the Khmer Rouge. UN-sponsored elections in 1993 helped restore some semblance of normalcy under a coalition government. Factional fighting in 1997 ended the first coalition government, but a second round of national elections in 1998 led to the formation of another coalition government and renewed political stability. The remaining elements of the Khmer Rouge surrendered in early 1999. Some of the surviving Khmer Rouge leaders have been tried or are awaiting trial for crimes against humanity by a hybrid UN-Cambodian tribunal supported by international assistance. Elections in July 2003 were relatively peaceful, but it took one year of negotiations between contending political parties before a coalition government was formed. In October 2004, King Norodom SIHANOUK abdicated the throne and his son, Prince Norodom SIHAMONI, was selected to succeed him. The most recent local (Commune Council) elections were held in Cambodia in 2012, with little of the preelection violence that preceded prior elections. National elections in July 2013 were disputed, with the opposition - the Cambodian National Rescue Party (CNRP) - boycotting the National Assembly. The political impasse was ended nearly a year later, with the CNRP agreeing to enter parliament in exchange for ruling party commitments to electoral and legislative reforms. The CNRP made further gains in local commune elections in June 2017, accelerating sitting Prime Minister Hun SEN’s efforts to marginalize the CNRP before national elections in 2018. Hun Sen arrested CNRP’s President Kem Sokha in September 2017 and subsequently dissolved the CNRP in November 2017 and banned its leaders from participating in politics for at least five years. CNRP’s seats in the National Assembly were redistributed to smaller, more pliant opposition parties.', 'Southeast Asia', '11 33 N, 104 55 E', '181,035 sq km', '16,204,486', 'Cambodian(s)', 'Khmer 97.6%, Cham 1.2%, Chinese 0.1%, Vietnamese 0.1%, other 0.9% (2013 est.)', 'Khmer (official) 96.3%, other 3.7% (2008 est.)', 'Buddhist (official) 96.9%, Muslim 1.9%, Christian 0.4%, other 0.8% (2008 est.)', 'Kingdom of Cambodia', 'parliamentary constitutional monarchy', 'Phnom Penh', '24 provinces (khett, singular and plural) and 1 municipality (krong, singular and plural)', '9 November 1953 (from France)', 'Cambodia has experienced strong economic growth over the last decade; GDP grew at an average annual rate of over 8% between 2000 and 2010 and at least 7% since 2011. The tourism, garment, construction and real estate, and agriculture sectors accounted for the bulk of growth. Around 600,000 people, the majority of whom are women, are employed in the garment and footwear sector. An additional 500,000 Cambodians are employed in the tourism sector, and a further 50,000 people in construction. Tourism has continued to grow rapidly with foreign arrivals exceeding 2 million per year since 2007 and reaching around 4.5 million visitors in 2014. Mining also is attracting some investor interest and the government has touted opportunities for mining bauxite, gold, iron and gems.\r\nCambodia remains one of the poorest countries in Asia and long-term economic development remains a daunting challenge, inhibited by endemic corruption, limited human resources, high income inequality, and poor job prospects. As of 2012, approximately 2.66 million people live on less than $1.20 per day, and 37% of Cambodian children under the age of 5 suffer from chronic malnutrition. More than 50% of the population is less than 25 years old. The population lacks education and productive skills, particularly in the impoverished countryside, which also lacks basic infrastructure.\r\nThe World Bank in 2016 formally reclassified Cambodia as a lower middle-income country as a result of continued rapid economic growth over the past several years. Cambodia’s graduation from a low-income country will reduce its eligibility for foreign assistance and will challenge the government to seek new sources of financing in 2017. The Cambodian Government has been working with bilateral and multilateral donors, including the Asian Development Bank, the World Bank and IMF, to address the country''s many pressing needs; more than 30% of the government budget comes from donor assistance. A major economic challenge for Cambodia over the next decade will be fashioning an economic environment in which the private sector can create enough jobs to handle Cambodia''s demographic imbalance.', '$20.16 billion (2016 est.)', 'rice, rubber, corn, vegetables, cashews, cassava (manioc, tapioca), silk', 'tourism, garments, construction, rice milling, fishing, wood and wood products, rubber, cement, gem mining, textiles', '7.777 million (2016 est.)', 'clothing, timber, rubber, rice, fish, tobacco, footwear', '4.236 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'XU (2016)', '16 (2013)', '1 (2013)', '-', '642 km', '44,709 km', '3,700 km (mainly on Mekong River) (2012)', '2018-02-07 18:03:25', NULL),
(39, 'CM', 'cm', 'Cameroon', 'French Cameroon became independent in 1960 as the Republic of Cameroon. The following year the southern portion of neighboring British Cameroon voted to merge with the new country to form the Federal Republic of Cameroon. In 1972, a new constitution replaced the federation with a unitary state, the United Republic of Cameroon. The country has generally enjoyed stability, which has enabled the development of agriculture, roads, and railways, as well as a petroleum industry. Despite slow movement toward democratic reform, political power remains firmly in the hands of President Paul BIYA.', 'Africa', '3 52 N, 11 31 E', '475,440 sq km', '24,994,885', 'Cameroonian(s)', 'Cameroon Highlanders 31%, Equatorial Bantu 19%, Kirdi 11%, Fulani 10%, Northwestern Bantu 8%, Eastern Nigritic 7%, other African 13%, non-African less than 1%', '24 major African language groups, English (official), French (official)', 'Roman Catholic 38.4%, Protestant 26.3%, other Christian 4.5%, Muslim 20.9%, animist 5.6%, other 1%, non-believer 3.2% (2005 est.)', 'Republic of Cameroon', 'presidential republic', 'Yaounde', '10 regions (regions, singular - region); Adamaoua, Centre, East (Est), Far North (Extreme-Nord), Littoral, North (Nord), North-West (Nord-Ouest), West (Ouest), South (Sud), South-West (Sud-Ouest)', '1 January 1960 (from French-administered UN trusteeship)', 'Cameroon’s market-based, diversified economy features oil and gas, timber, aluminum, agriculture, mining and the service sector. Oil remains Cameroon’s main export commodity, and despite falling global oil prices, still accounts for nearly 40% of exports. Cameroon’s economy suffers from factors that often impact underdeveloped countries, such as stagnant per capita income, a relatively inequitable distribution of income, a top-heavy civil service, endemic corruption, continuing inefficiencies of a large parastatal system in key sectors, and a generally unfavorable climate for business enterprise.\r\nSince 1990, the government has embarked on various IMF and World Bank programs designed to spur business investment, increase efficiency in agriculture, improve trade, and recapitalize the nation''s banks. The IMF continues to press for economic reforms, including increased budget transparency, privatization, and poverty reduction programs. The Government of Cameroon provides subsidies for electricity, food, and fuel that have strained the federal budget and diverted funds from education, healthcare, and infrastructure projects, as low oil prices have led to lower revenues.\r\nCameroon devotes significant resources to several large infrastructure projects currently under construction, including a deep seaport in Kribi and the Lom Pangar Hydropower Project. Cameroon’s energy sector continues to diversify, recently opening a natural gas-powered electricity generating plant. Cameroon continues to seek foreign investment to improve its inadequate infrastructure, create jobs, and improve its economic footprint, but its unfavorable business environment remains a significant deterrent to foreign investment.', '$29.33 billion (2016 est.)', 'coffee, cocoa, cotton, rubber, bananas, oilseed, grains, cassava (manioc, tapioca); livestock; timber', 'petroleum production and refining, aluminum production, food processing, light consumer goods, textiles, lumber, ship repair', '9.659 million (2016 est.)', 'crude oil and petroleum products, lumber, cocoa beans, aluminum, coffee, cotton', '6.61 billion kWh (2015 est.)', '93,200 bbl/day (2016 est.)', '54,740 bbl/day (2014 est.)', '680 million cu m (2015 est.)', 'TJ (2016)', '1,467 (2013)', '-', 'gas 53 km; liquid petroleum gas 5 km; oil 1,107 km; water 35 km (2013)', '987 km', '51,350 km', '(major rivers in the south, such as the Wouri and the Sanaga, are largely non-navigable; in the north, the Benue, which connects through Nigeria to the Niger River, is navigable in the rainy season only to the port of Garoua) (2010)', '2018-02-07 18:03:25', NULL),
(40, 'CA', 'ca', 'Canada', 'A land of vast distances and rich natural resources, Canada became a self-governing dominion in 1867, while retaining ties to the British crown. Canada repatriated its constitution from the UK in 1982, severing a final colonial tie. Economically and technologically, the nation has developed in parallel with the US, its neighbor to the south across the world''s longest international border. Canada faces the political challenges of meeting public demands for quality improvements in health care, education, social services, and economic competitiveness, as well as responding to the particular concerns of predominantly francophone Quebec. Canada also aims to develop its diverse energy resources while maintaining its commitment to the environment.', 'North America', '45 25 N, 75 42 W', '9,984,670 sq km', '35,623,680 (July 2017 est.)', 'Canadian(s)', 'Canadian 32.2%, English 19.8%, French 15.5%, Scottish 14.4%, Irish 13.8%, German 9.8%, Italian 4.5%, Chinese 4.5%, North American Indian 4.2%, other 50.9%', 'English (official) 58.7%, French (official) 22%, Punjabi 1.4%, Italian 1.3%, Spanish 1.3%, German 1.3%, Cantonese 1.2%, Tagalog 1.2%, Arabic 1.1%, other 10.5% (2011 est.)', 'Catholic 39% (includes Roman Catholic 38.8%, other Catholic .2%), Protestant 20.3% (includes United Church 6.1%, Anglican 5%, Baptist 1.9%, Lutheran 1.5%, Pentecostal 1.5%, Presbyterian 1.4%, other Protestant 2.9%), Orthodox 1.6%, other Christian 6.3%, Muslim 3.2%, Hindu 1.5%, Sikh 1.4%, Buddhist 1.1%, Jewish 1%, other 0.6%, none 23.9% (2011 est.)', '-', 'federal parliamentary democracy (Parliament of Canada) under a constitutional monarchy; a Commonweal', 'Ottawa', '10 provinces and 3 territories*; Alberta, British Columbia, Manitoba, New Brunswick, Newfoundland and Labrador, Northwest Territories*, Nova Scotia, Nunavut*, Ontario, Prince Edward Island, Quebec, Saskatchewan, Yukon*', '1 July 1867 (union of British North American colonies); 11 December 1931 (recognized by UK per Statute of Westminster)', 'Canada resembles the US in its market-oriented economic system, pattern of production, and high living standards. Since World War II, the impressive growth of the manufacturing, mining, and service sectors has transformed the nation from a largely rural economy into one primarily industrial and urban. Canada has a large oil and natural gas sector with the majority of crude oil production derived from oil sands in the western provinces, especially Alberta. Canada now ranks third in the world in proved oil reserves behind Venezuela and Saudi Arabia and is the world’s sixth-largest oil producer.\r\nThe 1989 Canada-US Free Trade Agreement and the 1994 North American Free Trade Agreement (which includes Mexico) dramatically increased trade and economic integration between the US and Canada. Canada and the US enjoy the world’s most comprehensive and highly balanced bilateral trade and investment relationship, with merchandise trade of $544 billion in 2016, services trade of over $80 billion, and two-way investment stocks of nearly $700 billion. Over three-fourths of Canada’s exports are destined for the US each year. Canada is the largest foreign supplier of energy to the US, including oil, natural gas, and electric power, and a top source of US uranium imports.\r\nGiven its abundant natural resources, highly skilled labor force, and modern capital stock, Canada enjoyed solid economic growth from 1993 through 2007. The global economic crisis of 2007-08 moved the Canadian economy into sharp recession by late 2008, and Ottawa posted its first fiscal deficit in 2009 after 12 years of surplus. Canada''s major banks emerged from the financial crisis of 2008-09 among the strongest in the world, owing to the financial sector''s tradition of conservative lending practices and strong capitalization. Since the fall in world oil prices in 2014, Canada has achieved modest economic growth.', '$1.53 trillion (2016 est.)', 'wheat, barley, oilseed, tobacco, fruits, vegetables; dairy products; fish; forest products', 'transportation equipment, chemicals, processed and unprocessed minerals, food products, wood and paper products, fish products, petroleum, natural gas', '19.44 million (2016 est.)', 'motor vehicles and parts, industrial machinery, aircraft, telecommunications equipment; chemicals, plastics, fertilizers; wood pulp, timber, crude petroleum, natural gas, electricity, aluminum', '643.2 billion kWh (2015 est.)', '3.679 million bbl/day (2016 est.)', '1.883 million bbl/day (2016 est.)', '149.9 billion cu m (2015 est.)', 'C (2016)', '9 (2013)', '26 (2013)', 'gas and liquid petroleum 110,000 km (2017)', '77,932 km', '1,042,300 km', '636 km (Saint Lawrence Seaway of 3,769 km, including the Saint Lawrence River of 3,058 km, shared with United States) (2011)', '2018-02-07 18:03:26', NULL),
(41, 'CV', 'cv', 'Cape Verde', 'The uninhabited islands were discovered and colonized by the Portuguese in the 15th century; Cabo Verde subsequently became a trading center for African slaves and later an important coaling and resupply stop for whaling and transatlantic shipping. The fusing of European and various African cultural traditions is reflected in Cabo Verde’s Crioulo language, music, and pano textiles. Following independence in 1975, and a tentative interest in unification with Guinea-Bissau, a one-party system was established and maintained until multi-party elections were held in 1990. Cabo Verde continues to sustain one of Africa''s most stable democratic governments. Repeated droughts during the second half of the 20th century caused significant hardship and prompted heavy emigration. As a result, Cabo Verde''s expatriate population is greater than its domestic one. Most Cabo Verdeans have both African and Portuguese antecedents. Cabo Verde’s population descends from its first permanent inhabitants in the late 15th-century – a preponderance of West African slaves, a small share of Portuguese colonists, and even fewer Italians, Spaniards, and Portuguese Jews. Among the nine inhabited islands, population distribution is variable. Islands in the east are very dry and are only sparsely settled to exploit their extensive salt deposits. The more southerly islands receive more precipitation and support larger populations, but agriculture and livestock grazing have damaged their soil fertility and vegetation. For centuries, the country’s overall population size has fluctuated significantly, as recurring periods of famine and epidemics have caused high death tolls and emigration.', 'Africa', '14 55 N, 23 31 W', '4,033 sq km', '560,899 (July 2017 est.)', 'Cabo Verdean(s)', 'Creole (mulatto) 71%, African 28%, European 1%', 'Portuguese (official), Crioulo (a blend of Portuguese and West African words)', 'Roman Catholic 77.3%, Protestant 4.6% (includes Church of the Nazarene 1.7%, Adventist 1.5%, Assembly of God 0.9%, Universal Kingdom of God 0.4%, and God and Love 0.1%), other Christian 3.4% (includes Christian Rationalism 1.9%, Jehovah''s Witness 1%, and New Apostolic 0.5%), Muslim 1.8%, other 1.3%, none 10.8%, unspecified 0.7% (2010 est.)', 'Republic of Cabo Verde', 'parliamentary republic', 'Praia', '22 municipalities (concelhos, singular - concelho); Boa Vista, Brava, Maio, Mosteiros, Paul, Porto Novo, Praia, Ribeira Brava, Ribeira Grande, Ribeira Grande de Santiago, Sal, Santa Catarina, Santa Catarina do Fogo, Santa Cruz, Sao Domingos, Sao Filipe, Sao Lourenco dos Orgaos, Sao Miguel, Sao Salvador do Mundo, Sao Vicente, Tarrafal, Tarrafal de Sao Nicolau', '5 July 1975 (from Portugal)', 'Cabo Verde’s economy is vulnerable to external shocks and depends on development aid, foreign investment, remittances, and tourism. The economy is service-oriented with commerce, transport, tourism, and public services accounting for about three-fourths of GDP. Tourism is the mainstay of the economy and depends on conditions in the euro-zone countries. Cabo Verde annually runs a high trade deficit financed by foreign aid and remittances from its large pool of emigrants; remittances as a share of GDP are one of the highest in Sub-Saharan Africa.\r\nAlthough about 40% of the population lives in rural areas, the share of food production in GDP is low. The island economy suffers from a poor natural resource base, including serious water shortages, exacerbated by cycles of long-term drought, and poor soil for growing food on several of the islands, requiring it to import most of what it consumes. The fishing potential, mostly lobster and tuna, is not fully exploited.\r\nEconomic reforms are aimed at developing the private sector and attracting foreign investment to diversify the economy and mitigate high unemployment. The government’s elevated debt levels have limited its capacity to finance any shortfalls.', '$1.64 billion (2016 est.)', 'bananas, corn, beans, sweet potatoes, sugarcane, coffee, peanuts; fish', 'food and beverages, fish processing, shoes and garments, salt mining, ship repair', '196,100 (2007 est.)', 'fuel (re-exports), shoes, garments, fish, hides', '469 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2016 est.)', 'D4 (2016)', '1 (2017)', '-', '-', '-', '1,350 km', '-', '2018-02-07 18:03:26', NULL),
(42, 'BQ', 'bq', 'Caribbean Netherlands', 'Originally settled by Arawak Indians, Curacao was seized by the Dutch in 1634 along with the neighboring island of Bonaire. Once the center of the Caribbean slave trade, Curacao was hard hit economically by the abolition of slavery in 1863. Its prosperity (and that of neighboring Aruba) was restored in the early 20th century with the construction of the Isla Refineria to service the newly discovered Venezuelan oil fields. In 1954, Curacao and several other Dutch Caribbean possessions were reorganized as the Netherlands Antilles, part of the Kingdom of the Netherlands. In referenda in 2005 and 2009, the citizens of Curacao voted to become a self-governing country within the Kingdom of the Netherlands. The change in status became effective in October 2010 with the dissolution of the Netherlands Antilles.', 'Central America and the Caribbean', '12 06 N, 68 55 W', '444 sq km', '149,648 (July 2017 est.)', 'Curacaoan', 'Afro-Caribbean majority; Dutch, French, Latin American, East Asian, South Asian, Jewish minorities', 'Papiamento (official) (a creole language that is a mixture of Portuguese, Spanish, Dutch, English, and, to a lesser extent, French, as well as elements of African languages and the language of the Arawak) 81.2%, Dutch (official) 8%, Spanish 4%, English (official) 2.9%, other 3.9% (2001 census)', 'Roman Catholic 72.8%, Pentecostal 6.6%, Protestant 3.2%, Adventist 3%, Jehovah''s Witness 2%, Evangelical 1.9%, other 3.8%, none 6%, unspecified 0.6% (2011 est.)', '-', 'parliamentary democracy', 'Willemstad', 'none (part of the Kingdom of the Netherlands)', 'none (part of the Kingdom of the Netherlands)', 'Most of Curacao’s GDP results from services. Tourism, petroleum refining and bunkering, offshore finance, and transportation and communications are the mainstays of this small island economy, which is closely tied to the outside world. Curacao has limited natural resources, poor soil, and inadequate water supplies, and budgetary problems complicate reform of the health and education systems. Although GDP grew only slightly during the past decade, Curacao enjoys a high per capita income and a well-developed infrastructure compared to other countries in the region.\r\nCuracao has an excellent natural harbor that can accommodate large oil tankers, and the port of Willemstad hosts a free trade zone and a dry dock. Venezuelan state-owned oil company PdVSA, under a contract in effect until 2019, leases the single refinery on the island from the government, directly employing some 1,000 people. Most of the oil for the refinery is imported from Venezuela and most of the refined products are exported to the US and Asia. Almost all consumer and capital goods are imported, with the US, the Netherlands, and Venezuela being the major suppliers.\r\nThe government is attempting to diversify its industry and trade. Curacao is an Overseas Countries and Territories (OCT) of the European Union. Nationals of Curacao are citizens of the European Union, even though it is not a member. Based on its OCT status, products that originate in Curacao have preferential access to the EU and are exempt from import duties. Curacao is a beneficiary of the Caribbean Basin Initiative and, as a result, products originating in Curacao can be imported tax free into the US if at least 35% has been added to the value of these products in Curacao. The island has state-of-the-art information and communication technology connectivity with the rest of the world, including a Tier IV datacenter. With several direct satellite and submarine optic fiber cables, Curacao has one of the best Internet speeds and reliability in the Western Hemisphere.', '$5.6 billion (2012 est.)', 'aloe, sorghum, peanuts, vegetables, tropical fruit', 'tourism, petroleum refining, petroleum transshipment, light manufacturing, financial and business services', '73,010 (2013)', 'petroleum products', '1.785 billion kWh (2012 est.)', '-', '531.1 bbl/day (2010 est.)', '0 cu m (2009 est.)', 'PJ (2016)', '3 (2013)', '-', '-', '-', '550 km', '-', '2018-02-07 18:03:26', NULL),
(43, 'KY', 'ky', 'Cayman Islands', 'The Cayman Islands were colonized from Jamaica by the British during the 18th and 19th centuries and were administered by Jamaica after 1863. In 1959, the islands became a territory within the Federation of the West Indies. When the Federation dissolved in 1962, the Cayman Islands chose to remain a British dependency. The territory has transformed itself into a significant offshore financial center.', 'Central America and the Caribbean', '19 18 N, 81 23 W', '264 sq km', '58,441', 'Caymanian(s)', 'mixed 40%, white 20%, black 20%, expatriates of various ethnic groups 20%', 'English (official) 90.9%, Spanish 4%, Filipino 3.3%, other 1.7%, unspecified 0.1% (2010 est.)', 'Protestant 67.8% (includes Church of God 22.6%, Seventh Day Adventist 9.4%, Presbyterian/United Church 8.6%, Baptist 8.3%, Pentecostal 7.1%, non-denominational 5.3%, Anglican 4.1%, Wesleyan Holiness 2.4%), Roman Catholic 14.1%, Jehovah''s Witness 1.1%, other 7%, none 9.3%, unspecified 0.7% (2010 est.)', '-', 'parliamentary democracy (Legislative Assembly); self-governing overseas territory of the UK', 'George Town (on Grand Cayman)', '6 districts; Bodden Town, Cayman Brac and Little Cayman, East End, George Town, North Side, West Bay', 'none (overseas territory of the UK)', 'With no direct taxation, the islands are a thriving offshore financial center. More than 93,000 companies were registered in the Cayman Islands as of 2008, including almost 300 banks, 800 insurers, and 10,000 mutual funds. A stock exchange was opened in 1997. Nearly 90% of the islands'' food and consumer goods must be imported. The Caymanians enjoy a standard of living comparable to that of Switzerland.\r\nTourism is also a mainstay, accounting for about 70% of GDP and 75% of foreign currency earnings. The tourist industry is aimed at the luxury market and caters mainly to visitors from North America. Total tourist arrivals exceeded 1.9 million in 2008, with about half from the US.', '$2.25 billion (2008 est.)', 'vegetables, fruit; livestock; turtle farming', 'tourism, banking, insurance and finance, construction, construction materials, furniture', '39,000', 'turtle products, manufactured consumer goods', '624 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'VP-C (2016)', '33 (2013)', '-', '-', '-', '785 km', '-', '2018-02-07 18:03:26', NULL),
(44, 'CF', 'cf', 'Central African Republic', 'The former French colony of Ubangi-Shari became the Central African Republic upon independence in 1960. After three tumultuous decades of misrule - mostly by military governments - civilian rule was established in 1993 but lasted only a decade. In March 2003, President Ange-Felix PATASSE was deposed in a military coup led by General Francois BOZIZE, who established a transitional government. Elections held in 2005 affirmed General BOZIZE as president; he was reelected in 2011 in voting widely viewed as flawed. The government still lacks full control of the countryside, where lawlessness persists. Several rebel groups joined together in early December 2012 to launch a series of attacks that left them in control of numerous towns in the northern and central parts of the country. The rebels - unhappy with BOZIZE''s government - participated in peace talks in early January 2013 which resulted in a coalition government including the rebellion''s leadership. In March 2013, the coalition government dissolved, rebels seized the capital, and President BOZIZE fled the country. Rebel leader Michel DJOTODIA assumed the presidency and the following month established a National Transitional Council (CNT). In January 2014, the CNT elected Catherine SAMBA-PANZA as interim president. Elections completed in March 2016 installed independent candidate Faustin-Archange TOUADERA as president; he continues to work towards peace between the government and armed groups, and is developing a disarmament, demobilization, reintegration, and repatriation (DDRR) program to reintegrate the armed groups into society.', 'Africa', '4 22 N, 18 35 E', '622,984 sq km', '5,625,118\r\nnote: estimates for this country explicitly take into account the effects of excess mortality due to AIDS; this can result in lower life expectancy, higher infant mortality, higher death rates, lower population growth rates, and changes in the ', 'Central African(s)', 'Baya 33%, Banda 27%, Mandjia 13%, Sara 10%, Mboum 7%, M''Baka 4%, Yakoma 4%, other 2%', 'French (official), Sangho (lingua franca and national language), tribal languages', 'indigenous beliefs 35%, Protestant 25%, Roman Catholic 25%, Muslim 15%', 'Central African Republic', 'presidential republic', 'Bangui', '14 prefectures (prefectures, singular - prefecture), 2 economic prefectures* (prefectures economiques, singular - prefecture economique), and 1 commune**; Bamingui-Bangoran, Bangui**, Basse-Kotto, Haute-Kotto, Haut-Mbomou, Kemo, Lobaye, Mambere-Kadei, Mbomou, Nana-Grebizi*, Nana-Mambere, Ombella-Mpoko, Ouaka, Ouham, Ouham-Pende, Sangha-Mbaere*, Vakaga', '13 August 1960 (from France)', 'Subsistence agriculture, together with forestry and mining, remains the backbone of the economy of the Central African Republic (CAR), with about 60% of the population living in outlying areas. The agricultural sector generates more than half of GDP. Timber and diamonds account for most export earnings, followed by cotton. Important constraints to economic development include the CAR''s landlocked geography, poor transportation system, largely unskilled work force, and legacy of misdirected macroeconomic policies. Factional fighting between the government and its opponents remains a drag on economic revitalization. Distribution of income is extraordinarily unequal. Grants from France and the international community can only partially meet humanitarian needs.\r\nSince 2009, the IMF has worked closely with the government to institute reforms that have resulted in some improvement in budget transparency, but other problems remain. The government''s additional spending in the run-up to the 2011 election worsened CAR''s fiscal situation. In 2012, the World Bank approved $125 million in funding for transport infrastructure and regional trade, focused on the route between CAR''s capital and the port of Douala in Cameroon. In July 2016, the IMF approved a three-year extended credit facility valued at $116 million. The World Bank in late 2016 approved a $20 million grant to restore basic fiscal management, improve transparency, and assist with economic recovery.\r\nParticipants in the Kimberley Process, a commitment to remove conflict diamonds from the global supply chain, partially lifted the ban on diamond exports from CAR in 2015, but persistent insecurity will prevent GDP from recovering to its pre-2013 level.', '$1.78 billion (2016 est.)', 'cotton, coffee, tobacco, cassava (manioc, tapioca), yams, millet, corn, bananas; timber', 'gold and diamond mining, logging, brewing, sugar refining', '2.194 million (2016 est.)', 'diamonds, timber, cotton, coffee', '174 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'TL (2016)', '39 (2013)', '-', '-', '-', '20,278 km', '2,800 km (the primary navigable river is the Ubangi, which joins the River Congo; it was the traditional route for the export of products because it connected with the Congo-Ocean railway at Brazzaville; because of the warfare on both sides of the River Congo from 1997, importers and exporters preferred routes through Cameroon) (2011)', '2018-02-07 18:03:26', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(45, 'TD', 'td', 'Chad', 'Chad, part of France''s African holdings until 1960, endured three decades of civil warfare, as well as invasions by Libya, before peace was restored in 1990. The government eventually drafted a democratic constitution and held flawed presidential elections in 1996 and 2001. In 1998, a rebellion broke out in northern Chad, which has sporadically flared up despite several peace agreements between the government and insurgents. In June 2005, President Idriss DEBY held a referendum successfully removing constitutional term limits and won another controversial election in 2006. Sporadic rebel campaigns continued throughout 2006 and 2007. The capital experienced a significant insurrection in early 2008, but has had no significant rebel threats since then, in part due to Chad''s 2010 rapprochement with Sudan, which previously used Chadian rebels as proxies. In late 2015, the government imposed a state of emergency in the Lake Chad region following multiple attacks by the terrorist group Boko Haram throughout the year; Boko Haram also launched several bombings in N''Djamena in mid-2015. DEBY in 2016 was reelected to his fifth term in an election that was peaceful but flawed. In December 2015, Chad completed a two-year rotation on the UN Security Council. In January 2017, DEBY completed a one-year term as President of the African Union.', 'Africa', '12 06 N, 15 02 E', '1.284 million sq km', '12,075,985 (July 2017 est.)', 'Chadian(s)', 'Sara (Ngambaye/Sara/Madjingaye/Mbaye) 29.9%, Kanembu/Bornu/Buduma 9.7%, Arab 9.6%, Wadai/Maba/Masalit/Mimi 7.5%, Gorane 5.8%, Masa/Musseye/Musgum 4.9%, Marba/Lele/Mesme 3.7%, Bulala/Medogo/Kuka 3.6%, Bidiyo/Migaama/Kenga/Dangleat 2.6%, Dadjo/Kibet/Muro 2.5%, Mundang 2.5%, Tupuri/Kera 2.1%, Gabri/Kabalaye/Nanchere/Somrai 2%, Fulani/Fulbe/Bodore 1.9%, Karo/Zime/Peve 1.3%, Zaghawa/Bideyat/Kobe 1.1%, Tama/Assongori/Mararit 1.1%, Baguirmi/Barma 1.1%, Mesmedje/Massalat/Kadjakse 0.8%, other Chadian ethnicities 3.2%, Chadians of foreign ethnicities 0.9%, foreign nationals 0.4%, unspecified 1.7% (2014-15 est.)', 'French (official), Arabic (official), Sara (in south), more than 120 different languages and dialects', 'Muslim 52.1%, Protestant 23.9%, Roman Catholic 20%, animist 0.3%, other Christian 0.2%, none 2.8%, unspecified 0.7% (2014-15 est.)', 'Republic of Chad', 'presidential republic', 'N''Djamena', '23 regions (regions, singular - region); Barh el Gazel, Batha, Borkou, Chari-Baguirmi, Ennedi-Est, Ennedi-Ouest, Guera, Hadjer-Lamis, Kanem, Lac, Logone Occidental, Logone Oriental, Mandoul, Mayo-Kebbi Est, Mayo-Kebbi Ouest, Moyen-Chari, Ouaddai, Salamat, Sila, Tandjile, Tibesti, Ville de N''Djamena, Wadi Fira', '11 August 1960 (from France)', 'Chad’s landlocked location results in high transportation costs for imported goods and dependence on neighboring countries. Oil and agriculture are mainstays of Chad’s economy. Oil provides about 60% of export revenues, while cotton, cattle, livestock, and gum arabic provide the bulk of Chad''s non-oil export earnings. The services sector contributes about one-third of GDP and has attracted foreign investment mostly through telecommunications and banking.\r\nNearly all of Chad’s fuel is provided by one domestic refinery, and unanticipated shutdowns occasionally result in shortages. The country regulates the price of domestic fuel, providing an incentive for black market sales.\r\nAlthough high oil prices and strong local harvests supported the economy in the past, low oil prices now stress Chad’s fiscal position. Chad relies on foreign assistance and foreign capital for most of its public and private sector investment. Investment in Chad is difficult due to its limited infrastructure, lack of trained workers, extensive government bureaucracy, and corruption. Chad obtained a three-year extended credit facility from the IMF in 2014 and was granted debt relief under the Heavily Indebted Poor Countries Initiative in April 2015.\r\nIn 2017, economic policy will be driven by efforts that started in 2016 to reverse the recession and to repair damage to public finances and exports. The government is implementing an emergency action plan to counterbalance the drop in oil revenue and to diversify the economy. Multinational partners, such as the African Development Bank, the EU, and the World Bank are likely to continue budget support in 2017, but Chad will remain at high debt risk, given its dependence on oil revenue and pressure to spend on subsidies and security.', '$10.1 billion (2016 est.)', 'cotton, sorghum, millet, peanuts, sesame, corn, rice, potatoes, onions, cassava (manioc, tapioca), cattle, sheep, goats, camels', 'oil, cotton textiles, brewing, natron (sodium carbonate), soap, cigarettes, construction materials', '5.443 million (2016 est.)', 'oil, livestock, cotton, sesame, gum arabic, shea butter', '215 million kWh (2015 est.)', '110,200 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '-', '59 (2013)', '-', 'oil 582 km (2013)', '-', '40,000 km', '(Chari and Legone Rivers are navigable only in wet season) (2012)', '2018-02-07 18:03:26', NULL),
(46, 'CL', 'cl', 'Chile', 'Prior to the arrival of the Spanish in the 16th century, the Inca ruled northern Chile while an indigenous people, the Mapuche, inhabited central and southern Chile. Although Chile declared its independence in 1810, it did not achieve decisive victory over the Spanish until 1818. In the War of the Pacific (1879-83), Chile defeated Peru and Bolivia to win its present northern regions. In the 1880s, the Chilean central government gained control over the central and southern regions inhabited by the Mapuche. After a series of elected governments, the three-year-old Marxist government of Salvador ALLENDE was overthrown in 1973 by a military coup led by General Augusto PINOCHET, who ruled until a democratically-elected president was inaugurated in 1990. Sound economic policies, maintained consistently since the 1980s, contributed to steady growth, reduced poverty rates by over half, and helped secure the country''s commitment to democratic and representative government. Chile has increasingly assumed regional and international leadership roles befitting its status as a stable, democratic nation.', 'South America', '33 27 S, 70 40 W', '756,102 sq km', '17,789,267 (July 2017 est.)', 'Chilean(s)', 'white and non-indigenous 88.9%, Mapuche 9.1%, Aymara 0.7%, other indigenous groups 1% (includes Rapa Nui, Likan Antai, Quechua, Colla, Diaguita, Kawesqar, Yagan or Yamana), unspecified 0.3% (2012 est.)', 'Spanish 99.5% (official), English 10.2%, indigenous 1% (includes Mapudungun, Aymara, Quechua, Rapa Nui), other 2.3%, unspecified 0.2%', 'Roman Catholic 66.7%, Evangelical or Protestant 16.4%, Jehovah''s Witness 1%, other 3.4%, none 11.5%, unspecified 1.1% (2012 est.)', 'Republic of Chile', 'presidential republic', 'Santiago; note - Valparaiso is the seat of the nat', '15 regions (regiones, singular - region); Aysen, Antofagasta, Araucania, Arica y Parinacota, Atacama, Biobio, Coquimbo, Libertador General Bernardo O''Higgins, Los Lagos, Los Rios, Magallanes y de la Antartica Chilena, Maule, Region Metropolitana (Santiago), Tarapaca, Valparaiso', '18 September 1810 (from Spain)', 'Chile has a market-oriented economy characterized by a high level of foreign trade and a reputation for strong financial institutions and sound policy that have given it the strongest sovereign bond rating in South America. Exports of goods and services account for approximately one-third of GDP, with commodities making up some 60% of total exports. Copper is Chile’s top export and provides 20% of government revenue.\r\nFrom 2003 through 2013, real growth averaged almost 5% per year, despite the slight contraction in 2009 that resulted from the global financial crisis. Growth slowed to an estimated 1.7% in 2016. A continued drop in copper prices prompted Chile to experience its second consecutive year of slow growth, elevated inflation, and a depreciating currency.\r\nChile deepened its longstanding commitment to trade liberalization with the signing of a free trade agreement with the US, effective 1 January 2004. Chile has 22 trade agreements covering 60 countries including agreements with the EU, Mercosur, China, India, South Korea, and Mexico. In May 2010, Chile signed the OECD Convention, becoming the first South American country to join the OECD. In October 2015, Chile signed the Trans-Pacific Partnership trade agreement.\r\nThe Chilean Government has generally followed a countercyclical fiscal policy, accumulating surpluses in sovereign wealth funds during periods of high copper prices and economic growth, and generally allowing deficit spending only during periods of low copper prices and growth. As of 31 October 2016, those sovereign wealth funds - kept mostly outside the country and separate from Central Bank reserves - amounted to more than $23.5 billion. Chile used these funds to finance fiscal stimulus packages during the 2009 economic downturn.\r\nIn 2014, President Michelle BACHELET introduced tax reforms aimed at delivering her campaign promise to fight inequality and to provide access to education and health care. The reforms are expected to generate additional tax revenues equal to 3% of Chile’s GDP, mostly by increasing corporate tax rates to OECD averages.', '$247 billion (2016 est.)', 'grapes, apples, pears, onions, wheat, corn, oats, peaches, garlic, asparagus, beans; beef, poultry, wool; fish; timber', 'copper, lithium, other minerals, foodstuffs, fish processing, iron and steel, wood and wood products, transport equipment, cement, textiles', '8.762 million (2016 est.)', 'copper, fruit, fish products, paper and pulp, chemicals, wine', '71.66 billion kWh (2015 est.)', '4,423 bbl/day (2016 est.)', '215,300 bbl/day (2016 est.)', '1.008 billion cu m (2015 est.)', 'CC (2016)', '481 (2013)', '1 (2013)', 'gas 3,160 km; liquid petroleum gas 781 km; oil 985 km; refined products 722 km (2013)', '7,281.5 km', '77,764 km', '-', '2018-02-07 18:03:26', NULL),
(47, 'CN', 'cn', 'China', 'For centuries China stood as a leading civilization, outpacing the rest of the world in the arts and sciences, but in the 19th and early 20th centuries, the country was beset by civil unrest, major famines, military defeats, and foreign occupation. After World War II, the Communist Party of China under MAO Zedong established an autocratic socialist system that, while ensuring China''s sovereignty, imposed strict controls over everyday life and cost the lives of tens of millions of people. After 1978, MAO''s successor DENG Xiaoping and other leaders focused on market-oriented economic development and by 2000 output had quadrupled. For much of the population, living standards have improved dramatically but political controls remain tight. Since the early 1990s, China has increased its global outreach and participation in international organizations.', 'Asia', '39 55 N, 116 23 E', '9,596,960 sq km', '1,379,302,771 (July 2017 est.)', 'Chinese (singular and plural)', 'Han Chinese 91.6%, Zhuang 1.3%, other (includes Hui, Manchu, Uighur, Miao, Yi, Tujia, Tibetan, Mongol, Dong, Buyei, Yao, Bai, Korean, Hani, Li, Kazakh, Dai, and other nationalities) 7.1%', 'Standard Chinese or Mandarin (official; Putonghua, based on the Beijing dialect), Yue (Cantonese), Wu (Shanghainese), Minbei (Fuzhou), Minnan (Hokkien-Taiwanese), Xiang, Gan, Hakka dialects, minority languages (see Ethnic groups entry)', 'Buddhist 18.2%, Christian 5.1%, Muslim 1.8%, folk religion 21.9%, Hindu < 0.1%, Jewish < 0.1%, other 0.7% (includes Daoist (Taoist)), unaffiliated 52.2%', 'People''s Republic of China', 'communist state', 'Beijing', '23 provinces (sheng, singular and plural), 5 autonomous regions (zizhiqu, singular and plural), and 4 municipalities (shi, singular and plural)', '1 October 1949 (People''s Republic of China established); notable earlier dates: 221 B.C. (unification under the Qin Dynasty); 1 January 1912 (Qing Dynasty replaced by the Republic of China)', 'Since the late 1970s, China has moved from a closed, centrally planned system to a more market-oriented one that plays a major global role. China has implemented reforms in a gradualist fashion, resulting in efficiency gains that have contributed to a more than tenfold increase in GDP since 1978. Reforms began with the phaseout of collectivized agriculture, and expanded to include the gradual liberalization of prices, fiscal decentralization, increased autonomy for state enterprises, growth of the private sector, development of stock markets and a modern banking system, and opening to foreign trade and investment. China continues to pursue an industrial policy, state-support of key sectors, and a restrictive investment regime. Measured on a purchasing power parity (PPP) basis that adjusts for price differences, China in 2016 stood as the largest economy in the world, surpassing the US in 2014 for the first time in modern history. China became the world''s largest exporter in 2010, and the largest trading nation in 2013. Still, China''s per capita income is below the world average.\r\nAfter keeping its currency tightly linked to the US dollar for years, China in July 2005 moved to an exchange rate system that references a basket of currencies. From mid-2005 to late 2008, the renminbi appreciated more than 20% against the US dollar, but the exchange rate remained virtually pegged to the dollar from the onset of the global financial crisis until June 2010, when Beijing allowed resumption of a gradual liberalization. In 2015, the People’s Bank of China announced it would continue to carefully push for full convertibility of the renminbi (RMB) after the currency was accepted as part of the IMF’s special drawing rights basket. After engaging in one-way, large-scale intervention to resist appreciation of the RMB for a decade, China’s 2016 intervention in foreign exchange markets has sought to prevent a rapid RMB depreciation that would have negative consequences for the United States, China, and the global economy.\r\nChina’s economic growth has slowed since 2011. The Chinese Government faces numerous economic challenges including: (a) reducing its high domestic savings rate and correspondingly low domestic household consumption; (b) servicing its high corporate debt burdens to maintain financial stability; (c) facilitating higher-wage job opportunities for the aspiring middle class, including rural migrants and college graduates, while maintaining competitiveness; (d) dampening speculative investment in the real estate sector; (e) reducing industrial overcapacity; and (f) raising productivity growth rates through the more efficient allocation of capital. Economic development has progressed further in coastal provinces than in the interior, and by 2016 more than 169.3 million migrant workers and their dependents had relocated to urban areas to find work. One consequence of China’s population control policy known as the “one-child policy” - which was relaxed in 2016 to permit all families to have two children - is that China is now one of the most rapidly aging countries in the world. Deterioration in the environment - notably air pollution, soil erosion, and the steady fall of the water table, especially in the North - is another long-term problem. China continues to lose arable land because of erosion and urbanization. The Chinese government is seeking to add energy production capacity from sources other than coal and oil, focusing on natural gas, nuclear, and clean energy development. In 2016, China ratified the Paris Agreement, a multilateral agreement to combat climate change, and committed to peak its carbon dioxide emissions between 2025 and 2030.\r\nThe government''s 13th Five-Year Plan, unveiled in March 2016, emphasizes the need to increase innovation and boost domestic consumption to make the economy less dependent on government investment, exports, and heavy industry. However, China has made only marginal progress toward these rebalancing goals. Under President XI Jinping, Beijing has signaled its understanding that China''s long-term economic health depends on giving the market a more decisive role in allocating resources, but has moved slowly on market-oriented reforms because of potential negative consequences for stability and short-term economic growth. He has also increased state-control over key sectors and Party control over state-owned enterprises. Chinese leaders in 2010 pledged to double China’s GDP by 2020, and the 13th Five Year Plan includes annual economic growth targets of at least 6.5% through 2020 to achieve that goal. In recent years, China has renewed its support for state-owned enterprises in sectors considered important to "economic security," explicitly looking to foster globally competitive industries. Chinese leaders also have undermined some market-oriented reforms by reaffirming the “dominant” role of the state in the economy, a stance that threatens to discourage private initiative and make the economy less efficient over time.', '$11.23 trillion (2016 est.)\r\nnote: because China''s exchange rate is determined by fiat rather than by market forces, the official exchange rate measure of GDP is not an accurate measure of China''s output; GDP at the official exchange rate substantially un', 'world leader in gross value of agricultural output; rice, wheat, potatoes, corn, tobacco, peanuts, tea, apples, cotton, pork, mutton, eggs; fish, shrimp', 'world leader in gross value of industrial output; mining and ore processing, iron, steel, aluminum, and other metals, coal; machine building; armaments; textiles and apparel; petroleum; cement; chemicals; fertilizer; consumer products (including footwear, toys, and electronics); food processing; transportation equipment, including automobiles, railcars and locomotives, ships, aircraft; telecommunications equipment, commercial space launch vehicles, satellites', '807.1 million', 'electrical and other machinery, including computers and telecommunications equipment, apparel, furniture, textiles', '6.142 trillion kWh (2016 est.)', '3.981 million bbl/day (2016 est.)', '10.85 million bbl/day (2014 est.)', '138.4 billion cu m (2016 est.)', 'B (2016)', '507 (2013)', '47 (2013)', 'gas 70,000 km; crude oil 22,900 km; refined petroleum products 25,500 km; water 710,206 km (2015)', '124,000 km', '4,577,300 km', '110,000 km (navigable waterways) (2011)', '2018-02-07 18:03:26', NULL),
(48, 'CX', 'cx', 'Christmas Island', 'Named in 1643 for the day of its discovery, the island was annexed and settlement began by the UK in 1888 with the discovery of the island''s phosphate deposits. Following the Second World War, Christmas Island came under the jurisdiction of the new British Colony of Singapore. The island existed as a separate Crown colony from 1 January 1958 to 1 October 1958 when its transfer to Australian jurisdiction was finalized. That date is still celebrated on the first Monday in October as Territory Day. Almost two-thirds of the island has been declared a national park.', 'Southeast Asia', '10 25 S, 105 43 E', '135 sq km', '2,205 (July 2016 est.)', 'Christmas Islander(s)', 'Chinese 70%, European 20%, Malay 10%', 'English (official), Chinese, Malay', 'Buddhist 16.9%, Christian 16.4%, Muslim 14.8%, other 1.3%, none 9.2%, unspecified 41.5% (2011 est.)', 'Territory of Christmas Island', 'non-self-governing overseas territory of Australia', 'The Settlement', 'none (territory of Australia)', 'none (territory of Australia)', 'The main economic activities on Christmas Island are the mining of low grade phosphate, limited tourism, the provision of government services and, since 2005, the construction and operation of the Immigration Detention Center. The government sector includes administration, health, education, policing, customs, quarantine, and defense.', '-', 'NA', 'tourism, phosphate extraction (near depletion)', 'NA', 'phosphate', '-', '-', '-', '-', '-', '1 (2013)', '-', '-', '18 km', '140 km', '-', '2018-02-07 18:03:26', NULL),
(49, 'CC', 'cc', 'Cocos (Keeling) Islands', 'There are 27 coral islands in the group. Captain William KEELING discovered the islands in 1609, but they remained uninhabited until the 19th century. From the 1820s to 1978, members of the CLUNIES-ROSS family controlled the islands and the copra produced from local coconuts. Annexed by the UK in 1857, the Cocos Islands were transferred to the Australian Government in 1955. Apart from North Keeling Island, which lies 30 kilometers north of the main group, the islands form a horseshoe-shaped atoll surrounding a lagoon. North Keeling Island was declared a national park in 1995 and is administered by Parks Australia. The population on the two inhabited islands generally is split between the ethnic Europeans on West Island and the ethnic Malays on Home Island.', 'Southeast Asia', '12 10 S, 96 50 E', '14 sq km', '596 (July 2014 est.)', 'Cocos Islander(s)', 'Europeans, Cocos Malays', 'Malay (Cocos dialect), English', 'Sunni Muslim 80%, other 20% (2002 est.)', 'Territory of Cocos (Keeling) Islands', 'non-self-governing overseas territory of Australia', 'West Island', 'none (territory of Australia)', 'none (territory of Australia)', 'Coconuts, grown throughout the islands, are the sole cash crop. Small local gardens and fishing contribute to the food supply, but additional food and most other necessities must be imported from Australia. There is a small tourist industry.', '-', 'vegetables, bananas, pawpaws, coconuts', 'copra products, tourism', 'NA', 'copra', '-', '-', '-', '-', '-', '1 (2013)', '-', '-', '-', '22 km', '-', '2018-02-07 18:03:26', NULL),
(50, 'CO', 'co', 'Colombia', 'Colombia was one of the three countries that emerged after the dissolution of Gran Colombia in 1830 (the others are Ecuador and Venezuela). A decades-long conflict between government forces and antigovernment insurgent groups, principally the Revolutionary Armed Forces of Colombia (FARC) heavily funded by the drug trade, escalated during the 1990s. More than 31,000 former paramilitaries demobilized by the end of 2006 and the United Self Defense Forces of Colombia as a formal organization ceased to operate. In the wake of the paramilitary demobilization, organized criminal groups arose, whose members include some former paramilitaries. After four years of formal peace negotiations, the Colombian Government signed a revised final peace accord with the FARC in November 2016, which was subsequently ratified by the Colombian Congress. The accord calls for members of the FARC to demobilize, disarm, and reincorporate into society and politics, and it creates an alternative system for transitional justice that includes a “Special Jurisdiction for Peace” to address accountability for conflict-related crimes and established truth-telling mechanisms. The Colombian Government has stepped up efforts to reassert government control throughout the country, and now has a presence in every one of its administrative departments. Despite decades of internal conflict and drug related security challenges, Colombia maintains relatively strong democratic institutions characterized by peaceful, transparent elections and the protection of civil liberties.', 'South America', '4 36 N, 74 05 W', '1,138,910 sq km', '47,698,524 (July 2017 est.)', 'Colombian(s)', 'mestizo and white 84.2%, Afro-Colombian (includes mulatto, Raizal, and Palenquero) 10.4%, Amerindian 3.4%, Romani <.01, unspecified 2.1% (2005 est.)', 'Spanish (official)', 'Roman Catholic 79%, Protestant 14% (includes Pentecostal 6%, mainline Protestant 2%, other 6%), other 2%, unspecified 5% (2014 est.)', 'Republic of Colombia', 'presidential republic', 'Bogota', '32 departments (departamentos, singular - departamento) and 1 capital district* (distrito capital); Amazonas, Antioquia, Arauca, Atlantico, Bogota*, Bolivar, Boyaca, Caldas, Caqueta, Casanare, Cauca, Cesar, Choco, Cordoba, Cundinamarca, Guainia, Guaviare, Huila, La Guajira, Magdalena, Meta, Narino, Norte de Santander, Putumayo, Quindio, Risaralda, Archipielago de San Andres, Providencia y Santa Catalina (colloquially San Andres y Providencia), Santander, Sucre, Tolima, Valle del Cauca, Vaupes, Vichada', '20 July 1810 (from Spain)', 'Colombia’s economy benefits from free trade and sound fiscal policies but it has slowed in 2016 because of falling global oil prices, a strong dollar, and moderate inflation. Colombia heavily depends on energy and mining exports, making it vulnerable to a drop in commodity prices. Colombia is the world''s fourth largest coal exporter, the world’s second largest coffee and cut flowers exporter, and Latin America’s fourth largest oil producer. Economic development is hampered by inadequate infrastructure, poverty, narcotrafficking, and an uncertain security situation.\r\nAlthough real GDP growth averaged 4.7% for the past decade, growth fell to 2.0% in 2016. The El Nino weather pattern in early 2016 and a 40-day truckers strike caused food and energy prices to rise, with inflation spiking to a high of nearly 9% in July 2016. Declining oil prices have reduced government revenues. Colombia received about $1 billion in oil revenue in 2016, compared with $6 billion in 2014; oil accounts for 20% of government revenues. President Juan Manuel SANTOS signed into law a tax reform bill in December 2016 aimed at offsetting lost revenue from the drop in oil prices by decreasing corporate taxes to incentivize investment and by increasing the value added tax. The enactment of the tax reform bill was key to maintaining Colombia’s BBB investment-grade credit rating. Foreign investment has been hampered by Colombia’s struggle to address its fiscal problems. As of September 2016, FDI in Colombia had risen to $10.2 billion, up from $9.3 billion over the same period in 2015.\r\nColombia has signed or is negotiating Free Trade Agreements (FTA) with more than a dozen countries; the US-Colombia FTA went into force in May 2012. The US and Colombia have benefitted from the FTA, but Colombia’s ability to take full advantage of its enhanced access to American markets continues to be constrained by lack of export diversification. Non-tariff measures remain a point of contention for bilateral trade relations. The Colombian government acted in 2016 to address several bilateral trade irritants with the US, including truck scrappage, distilled spirits, pharmaceuticals, ethanol imports, and labor rights. US and industry stakeholders are still evaluating the implementation of recent reforms. Colombia is a founding member of the Pacific Alliance - a regional trade block formed in 2012 by Chile, Colombia, Mexico, and Peru to promote regional trade and economic integration. In 2013, Colombia began its accession process to the Organization for Economic Cooperation and Development.', '$282.4 billion (2016 est.)', 'coffee, cut flowers, bananas, rice, tobacco, corn, sugarcane, cocoa beans, oilseed, vegetables; shrimp; forest products', 'textiles, food processing, oil, clothing and footwear, beverages, chemicals, cement; gold, coal, emeralds', '24.41 million (2016 est.)', 'petroleum, coal, emeralds, coffee, nickel, cut flowers, bananas, apparel', '67.26 billion kWh (2015 est.)', '886,000 bbl/day (2016 est.)', '362,100 bbl/day (2014 est.)', '11.91 billion cu m (2015 est.)', 'HJ, HK (2016)', '836 (2013)', '3 (2013)', 'gas 4,991 km; oil 6,796 km; refined products 3,429 km (2013)', '2,141 km', '204,855 km (2015)', '24,725 km (18,300 km navigable; the most important waterway, the River Magdalena, of which 1,488 km is navigable, is dredged regularly to ensure safe passage of cargo vessels and container barges) (2012)', '2018-02-07 18:03:26', NULL),
(51, 'KM', 'km', 'Comoros', 'The archipelago of the Comoros in the Indian Ocean, composed of the islands of Mayotte, Anjouan, Moheli, and Grand Comore declared independence from France on 6 July 1975. France did not recognize the independence of Mayotte, which remains under French administration. Since independence, Comoros has endured political instability through realized and attempted coups. In 1997, the islands of Anjouan and Moheli declared independence from Comoros. In 1999, military chief Col. AZALI Assoumani seized power of the entire government in a bloodless coup; he initiated the 2000 Fomboni Accords, a power-sharing agreement in which the federal presidency rotates among the three islands, and each island maintains its local government. AZALI won the 2002 federal presidential election as president of the Union of the Comoros from Grand Comore Island, which held the first five-year term. AZALI stepped down in 2006 and President Ahmed Abdallah Mohamed SAMBI was elected to office as president from Anjouan. In 2007, Mohamed BACAR effected Anjouan''s de-facto secession from the Union of the Comoros, refusing to step down when Comoros'' other islands held legitimate elections in July. The African Union (AU) initially attempted to resolve the political crisis by applying sanctions and a naval blockade to Anjouan, but in March 2008 the AU and Comoran soldiers seized the island. The island''s inhabitants generally welcomed the move. In May 2011, Ikililou DHOININE won the presidency in peaceful elections widely deemed to be free and fair. In closely contested elections in 2016, former President AZALI Assoumani won a second term, when the rotating presidency returned to Grande Comore.', 'Africa', '11 42 S, 43 14 E', '2,235 sq km', '808,080 (July 2017 est.)', 'Comoran(s)', 'Antalote, Cafre, Makoa, Oimatsaha, Sakalava', 'Arabic (official), French (official), Shikomoro (official; a blend of Swahili and Arabic) (Comorian)', 'Sunni Muslim 98%, other (including Shia Muslim, Roman Catholic, Jehovah''s Witness, Protestant) 2%\r\nnote: Islam is the state religion', 'Union of the Comoros', 'federal presidential republic', 'Moroni', '3 islands and 4 municipalities*; Anjouan (Ndzuwani), Domoni*, Fomboni*, Grande Comore (N''gazidja), Moheli (Mwali), Moroni*, Moutsamoudou*', '6 July 1975 (from France)', 'One of the world''s poorest countries, the Comoros is made up of three islands that are hampered by inadequate transportation links, a young and rapidly increasing population, and few natural resources. The low educational level of the labor force contributes to a subsistence level of economic activity and a heavy dependence on foreign grants and technical assistance. Agriculture, including fishing, hunting, and forestry, accounts for 50% of GDP, employs 80% of the labor force, and provides most of the exports. Export income is heavily reliant on the three main crops of vanilla, cloves, and ylang ylang (perfume essence); and the Comoros'' export earnings are easily disrupted by disasters such as fires and extreme weather. Despite agriculture’s importance to the economy, the country imports roughly 70% of its food; rice, the main staple, accounts for the bulk of imports. Remittances from about 300,000 Comorans contribute about 25% of the country’s GDP.\r\nThe new government, elected in mid-2016, will be challenged to provide basic services, upgrade education and technical training, privatize commercial and industrial enterprises, improve health services, diversify exports, promote tourism, and reduce the high population growth rate. Recurring political instability, sometimes initiated from outside the country, has inhibited growth. In late 2015, Saudi Arabia provided a large budget grant to the Comorian Government, allowing arrears to be cleared and resulting in an overall fiscal surplus for 2016. The government has moved to improve revenue mobilization, reduce expenditures, and improve electricity access.', '$613 million (2016 est.)', 'vanilla, cloves, ylang-ylang (perfume essence), coconuts, bananas, cassava (manioc)', 'fishing, tourism, perfume distillation', '278,500 (2016 est.)', 'vanilla, ylang-ylang (perfume essence), cloves', '54 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'D6 (2016)', '4 (2013)', '-', '-', '-', '880 km', '-', '2018-02-07 18:03:26', NULL),
(52, 'CK', 'ck', 'Cook Islands', 'Named after Captain COOK, who sighted them in 1770, the islands became a British protectorate in 1888. By 1900, administrative control was transferred to New Zealand; in 1965, residents chose self-government in free association with New Zealand. The emigration of skilled workers to New Zealand, government deficits, and limited natural resources are of continuing concern.', 'Oceania', '21 12 S, 159 46 W', '236 sq km', '9,290 (July 2017 est.)', 'Cook Islander(s)', 'Cook Island Maori (Polynesian) 81.3%, part Cook Island Maori 6.7%, other 11.9% (2011 est.)', 'English (official) 86.4%, Cook Islands Maori (Rarotongan) (official) 76.2%, other 8.3%', 'Protestant 62.8% (Cook Islands Christian Church 49.1%, Seventh Day Adventist 7.9%, Assemblies of God 3.7%, Apostolic Church 2.1%), Roman Catholic 17%, Mormon 4.4%, other 8%, none 5.6%, no response 2.2% (2011 est.)', 'none', 'self-governing parliamentary democracy (Parliament of the Cook Islands) in free association with New', 'Avarua', 'none', 'none (became self-governing in free association with New Zealand on 4 August 1965 and has the right at any time to move to full independence by unilateral action)', 'Like many other South Pacific island nations, the Cook Islands'' economic development is hindered by the isolation of the country from foreign markets, the limited size of domestic markets, lack of natural resources, periodic devastation from natural disasters, and inadequate infrastructure. Agriculture, employing more than one-quarter of the working population, provides the economic base with major exports of copra and citrus fruit. Black pearls are the Cook Islands'' leading export. Manufacturing activities are limited to fruit processing, clothing, and handicrafts. Trade deficits are offset by remittances from emigrants and by foreign aid overwhelmingly from New Zealand. In the 1980s and 1990s, the country became overextended, maintaining a bloated public service and accumulating a large foreign debt. Subsequent reforms, including the sale of state assets, the strengthening of economic management, the encouragement of tourism, and a debt restructuring agreement, have rekindled investment and growth.', '$244.1 million (2010 est.)', 'copra, citrus, pineapples, tomatoes, beans, pawpaws, bananas, yams, taro, coffee; pigs, poultry', 'fruit processing, tourism, fishing, clothing, handicrafts', '6,820 (2001)', 'copra, papayas, fresh and canned citrus fruit, coffee; fish; pearls and pearl shells; clothing', '32 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'E5 (2016)', '11 (2013)', '-', '-', '-', '320 km', '-', '2018-02-07 18:03:26', NULL),
(53, 'CR', 'cr', 'Costa Rica', 'Although explored by the Spanish early in the 16th century, initial attempts at colonizing Costa Rica proved unsuccessful due to a combination of factors, including disease from mosquito-infested swamps, brutal heat, resistance by natives, and pirate raids. It was not until 1563 that a permanent settlement of Cartago was established in the cooler, fertile central highlands. The area remained a colony for some two and a half centuries. In 1821, Costa Rica became one of several Central American provinces that jointly declared their independence from Spain. Two years later it joined the United Provinces of Central America, but this federation disintegrated in 1838, at which time Costa Rica proclaimed its sovereignty and independence. Since the late 19th century, only two brief periods of violence have marred the country''s democratic development. In 1949, Costa Rica dissolved its armed forces. Although it still maintains a large agricultural sector, Costa Rica has expanded its economy to include strong technology and tourism industries. The standard of living is relatively high. Land ownership is widespread.', 'Central America and the Caribbean', '9 56 N, 84 05 W', '51,100 sq km', '4,930,258 (July 2017 est.)', 'Costa Rican(s)', 'white or mestizo 83.6%, mulato 6.7%, indigenous 2.4%, black of African descent 1.1%, other 1.1%, none 2.9%, unspecified 2.2% (2011 est.)', 'Spanish (official), English', 'Roman Catholic 76.3%, Evangelical 13.7%, Jehovah''s Witness 1.3%, other Protestant 0.7%, other 4.8%, none 3.2%', 'Republic of Costa Rica', 'presidential republic', 'San Jose', '7 provinces (provincias, singular - provincia); Alajuela, Cartago, Guanacaste, Heredia, Limon, Puntarenas, San Jose', '15 September 1821 (from Spain)', 'Since 2010, Costa Rica has enjoyed strong and stable economic growth - 4.3% in 2016. Exports of bananas, coffee, sugar, and beef are the backbone of its commodity exports. Various industrial and processed agricultural products have broadened exports in recent years, as have high value-added goods, including medical devices. Costa Rica''s impressive biodiversity also makes it a key destination for ecotourism.\r\nForeign investors remain attracted by the country''s political stability and relatively high education levels, as well as the incentives offered in the free-trade zones; Costa Rica has attracted one of the highest levels of foreign direct investment per capita in Latin America. The US-Central American-Dominican Republic Free Trade Agreement (CAFTA-DR), which became effective for Costa Rica in 2009, helped increase foreign direct investment in key sectors of the economy, including insurance and telecommunication. However, poor infrastructure, high energy costs, a complex bureaucracy, weak investor protection, and uncertainty of contract enforcement impede greater investment.\r\nCosta Rica’s economy also faces challenges due to a rising fiscal deficit, rising public debt, and relatively low levels of domestic revenue. Poverty has remained around 20-25% for nearly 20 years, and the government’s strong social safety net has eroded due to increased constraints on its expenditures. Costa Rica’s credit rating was downgraded from stable to negative in 2015, upping pressure on lending rates - which could hurt small business, on the budget deficit - which could hurt infrastructure development, and on the rate of return on investment - which could soften foreign direct investment (FDI). Unlike the rest of Central America, Costa Rica is not highly dependent on remittances - which represented just 0.7% of GDP in 2015, but instead relies on FDI - which accounted for 4% of GDP.', '$58.11 billion (2016 est.)', 'bananas, pineapples, coffee, melons, ornamental plants, sugar, corn, rice, beans, potatoes; beef, poultry, dairy; timber', 'medical equipment, food processing, textiles and clothing, construction materials, fertilizer, plastic products', '2.206 million', 'bananas, pineapples, coffee, melons, ornamental plants, sugar; beef; seafood; electronic components, medical equipment', '10.38 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'TI (2016)', '161 (2013)', '-', 'refined products 662 km (2013)', '278 km', '39,018 km', '730 km (seasonally navigable by small craft) (2011)\r\ncountry comparison to the world: 74', '2018-02-07 18:03:26', NULL);
