(54, 'KX', 'kx', 'Crimea', 'Ukraine was the center of the first eastern Slavic state, Kyivan Rus, which during the 10th and 11th centuries was the largest and most powerful state in Europe. Weakened by internecine quarrels and Mongol invasions, Kyivan Rus was incorporated into the Grand Duchy of Lithuania and eventually into the Polish-Lithuanian Commonwealth. The cultural and religious legacy of Kyivan Rus laid the foundation for Ukrainian nationalism through subsequent centuries. A new Ukrainian state, the Cossack Hetmanate, was established during the mid-17th century after an uprising against the Poles. Despite continuous Muscovite pressure, the Hetmanate managed to remain autonomous for well over 100 years. During the latter part of the 18th century, most Ukrainian ethnographic territory was absorbed by the Russian Empire. Following the collapse of czarist Russia in 1917, Ukraine achieved a short-lived period of independence (1917-20), but was reconquered and endured a brutal Soviet rule that engineered two forced famines (1921-22 and 1932-33) in which over 8 million died. In World War II, German and Soviet armies were responsible for 7 to 8 million more deaths. Although Ukraine achieved independence in 1991 with the dissolution of the USSR, democracy and prosperity remained elusive as the legacy of state control and endemic corruption stalled efforts at economic reform, privatization, and civil liberties.\r\nA peaceful mass protest referred to as the "Orange Revolution" in the closing months of 2004 forced the authorities to overturn a rigged presidential election and to allow a new internationally monitored vote that swept into power a reformist slate under Viktor YUSHCHENKO. Subsequent internal squabbles in the YUSHCHENKO camp allowed his rival Viktor YANUKOVYCH to stage a comeback in parliamentary (Rada) elections, become prime minister in August 2006, and be elected president in February 2010. In October 2012, Ukraine held Rada elections, widely criticized by Western observers as flawed due to use of government resources to favor ruling party candidates, interference with media access, and harassment of opposition candidates. President YANUKOVYCH''s backtracking on a trade and cooperation agreement with the EU in November 2013 - in favor of closer economic ties with Russia - and subsequent use of force against students, civil society activists, and other civilians in favor of the agreement led to a three-month protest occupation of Kyiv''s central square. The government''s use of violence to break up the protest camp in February 2014 led to all out pitched battles, scores of deaths, international condemnation, and the president''s abrupt departure for Russia. New elections in the spring allowed pro-West president Petro POROSHENKO to assume office on 7 June 2014.\r\nShortly after YANUKOVYCH''s departure in late February 2014, Russian President PUTIN ordered the invasion of Ukraine''s Crimean Peninsula claiming the action was to protect ethnic Russians living there. Two weeks later, a "referendum" was held regarding the integration of Crimea into the Russian Federation. The "referendum" was condemned as illegitimate by the Ukrainian Government, the EU, the US, and the UN General Assembly (UNGA). In response to Russia''s purported annexation of Crimea, 100 members of the UN passed UNGA resolution 68/262, rejecting the "referendum" as baseless and invalid and confirming the sovereignty, political independence, unity, and territorial integrity of Ukraine. Russia also continues to supply so-called separatists in two of Ukraine''s eastern provinces with manpower, funding, and materiel resulting in an armed conflict with the Ukrainian Government. Representatives from Ukraine, Russia, and the unrecognized separatist republics signed the Minsk Protocol and Memorandum in September 2014 to end the conflict. However, this agreement failed to stop the fighting. In a renewed attempt to alleviate ongoing clashes, leaders of Ukraine, Russia, France, and Germany negotiated a follow-on package of measures in February 2015 to implement the Minsk Agreements. Representatives from Ukraine, Russia, and the Organization for Security and Cooperation in Europe also meet regularly to facilitate implementation of the peace deal. More than 33,000 civilians have been killed or wounded in the fighting resulting from Russian aggression in eastern Ukraine.', 'Asia, Europe', '50 26 N, 30 31 E', '603,550 sq km', '44,033,874 (July 2017 est.)', 'Ukrainian(s)', 'Ukrainian 77.8%, Russian 17.3%, Belarusian 0.6%, Moldovan 0.5%, Crimean Tatar 0.5%, Bulgarian 0.4%, Hungarian 0.3%, Romanian 0.3%, Polish 0.3%, Jewish 0.2%, other 1.8% (2001 est.)', 'Ukrainian (official) 67.5%, Russian (regional language) 29.6%, ther (includes small Crimean Tatar-, Moldovan/Romanian-, and Hungarian-speaking minorities) 2.9% (2001 est.)', 'Orthodox (includes Ukrainian Autocephalous Orthodox (UAOC), Ukrainian Orthodox - Kyiv Patriarchate (UOC-KP), Ukrainian Orthodox - Moscow Patriarchate (UOC-MP)), Ukrainian Greek Catholic, Roman Catholic, Protestant, Muslim, Jewish\r\nnote: Ukraine''s population is overwhelmingly Christian; the vast majority - up to two-thirds - identify themselves as Orthodox, but many do not specify a particular branch; the UOC-KP and the UOC-MP each represent less than a quarter of the country''s population, the Ukrainian Greek Catholic Church accounts for 8-10%, and the UAOC accounts for 1-2%; Muslim and Jewish adherents each compose less than 1% of the total population (2013 est.)', 'none', 'semi-presidential republic', 'Kyiv (Kiev)', '24 provinces (oblasti, singular - oblast''), 1 autonomous republic* (avtonomna respublika), and 2 municipalities** (mista, singular - misto) with oblast status; Cherkasy, Chernihiv, Chernivtsi, Crimea or Avtonomna Respublika Krym* (Simferopol''), Dnipropetrovs''k (Dnipro), Donets''k, Ivano-Frankivs''k, Kharkiv, Kherson, Khmel''nyts''kyy, Kirovohrad (Kropyvnyts''kyy), Kyiv**, Kyiv, Luhans''k, L''viv, Mykolayiv, Odesa, Poltava, Rivne, Sevastopol''**, Sumy, Ternopil'', Vinnytsya, Volyn'' (Luts''k), Zakarpattya (Uzhhorod), Zaporizhzhya, Zhytomyr\r\nnote 1: administrative divisions have the same names as their administrative centers (exceptions have the administrative center name following in parentheses); plans include the eventual renaming of Dnipropetrovsk and Kirovohrad oblasts, but because these names are mentioned in the Constitution of Ukraine, the change will require a constitutional amendment\r\nnote 2: the US Government does not recognize Russia''s annexation of Ukraine''s Autonomous Republic of Crimea and the municipality of Sevastopol, nor their redesignation as the Republic of Crimea and the Federal City of Sevastopol', '24 August 1991 (from the Soviet Union); notable earlier dates: ca. 982 (VOLODYMYR I consolidates Kyivan Rus); 1648 (establishment of the Cossack Hetmanate)', 'After Russia, the Ukrainian Republic was the most important economic component of the former Soviet Union, producing about four times the output of the next-ranking republic. Its fertile black soil generated more than one-fourth of Soviet agricultural output, and its farms provided substantial quantities of meat, milk, grain, and vegetables to other republics. Likewise, its diversified heavy industry supplied unique equipment, such as, large diameter pipes and vertical drilling apparatus, and raw materials to industrial and mining sites in other regions of the former USSR.\r\nShortly after independence in August 1991, the Ukrainian Government liberalized most prices and erected a legal framework for privatization, but widespread resistance to reform within the government and the legislature soon stalled reform efforts and led to some backtracking. Output by 1999 had fallen to less than 40% of the 1991 level. Outside institutions - particularly the IMF encouraged Ukraine to quicken the pace and scope of reforms to foster economic growth. Ukrainian Government officials eliminated most tax and customs privileges in a March 2005 budget law, bringing more economic activity out of Ukraine''s large shadow economy. From 2000 until mid-2008, Ukraine''s economy was buoyant despite political turmoil between the prime minister and president. The economy contracted nearly 15% in 2009, among the worst economic performances in the world. In April 2010, Ukraine negotiated a price discount on Russian gas imports in exchange for extending Russia''s lease on its naval base in Crimea.\r\nUkraine’s oligarch-dominated economy grew slowly from 2010 to 2013. After former President YANUKOVYCH fled the country during the Revolution of Dignity, the international community began efforts to stabilize the Ukrainian economy, including a March 2014 IMF assistance package of $17.5 billion, of which Ukraine has received four disbursements, most recently in April 2017, bringing the total disbursed as of that date to approximately $8.4 billion. Ukraine has made significant progress on reforms designed to make the country prosperous, democratic, and transparent. But more improvements are needed, including fighting corruption, developing capital markets, and improving the legislative framework.\r\nRussia’s occupation of Crimea in March 2014 and ongoing aggression in eastern Ukraine have hurt economic growth. With the loss of a major portion of Ukraine’s heavy industry in Donbas and ongoing violence, Ukraine’s economy contracted by 6.6% in 2014 and by 14.3% in 2015, but grew by 2.3% in 2016 as key reforms took hold. After the EU and Ukraine enacted the Deep and Comprehensive Free Trade Area and Russia imposed a series of trade restrictions, the EU replaced Russia as Ukraine’s largest trading partner. Analysts predict approximately 2% growth in 2017, but a new prohibition on commercial trade with separatist-controlled territories will have an uncertain effect on Ukraine’s key industrial sectors.', '$93.26 billion (2016 est.)', 'grain, sugar beets, sunflower seeds, vegetables; beef, milk', 'coal, electric power, ferrous and nonferrous metals, machinery and transport equipment, chemicals, food processing', '18.04 million (2016 est.)', 'ferrous and nonferrous metals, fuel and petroleum products, chemicals, machinery and transport equipment, foodstuffs', '152.2 billion kWh (2015 est.)', '32,070 bbl/day (2016 est.)', '78,030 bbl/day (2014 est.)', '19 billion cu m (2015 est.)', 'UR (2016)', '187 (2013)', '9 (2013)', 'gas 36,720 km; oil 4,514 km; refined products 4,363 km (2013)', '21,733 km', '20,006 km', '1,672 km (most on Dnieper River) (2012)', '2018-02-07 18:03:26', NULL),
(55, 'HR', 'hr', 'Croatia', 'The lands that today comprise Croatia were part of the Austro-Hungarian Empire until the close of World War I. In 1918, the Croats, Serbs, and Slovenes formed a kingdom known after 1929 as Yugoslavia. Following World War II, Yugoslavia became a federal independent communist state under the strong hand of Marshal Josip Broz, aka TITO. Although Croatia declared its independence from Yugoslavia in 1991, it took four years of sporadic, but often bitter, fighting before occupying Serb armies were mostly cleared from Croatian lands, along with a majority of Croatia''s ethnic Serb population. Under UN supervision, the last Serb-held enclave in eastern Slavonia was returned to Croatia in 1998. The country joined NATO in April 2009 and the EU in July 2013.', 'Europe', '45 48 N, 16 00 E', '56,594 sq km', '4,292,095 (July 2017 est.)', 'Croat(s), Croatian(s)', 'Croat 90.4%, Serb 4.4%, other 4.4% (including Bosniak, Hungarian, Slovene, Czech, and Romani), unspecified 0.8% (2011 est.)', 'Croatian (official) 95.6%, Serbian 1.2%, other 3% (including Hungarian, Czech, Slovak, and Albanian), unspecified 0.2% (2011 est.)', 'Roman Catholic 86.3%, Orthodox 4.4%, Muslim 1.5%, other 1.5%, unspecified 2.5%, not religious or atheist 3.8% (2011 est.)', 'Republic of Croatia', 'parliamentary republic', 'Zagreb', '20 counties (zupanije, zupanija - singular) and 1 city* (grad - singular) with special county status; Bjelovarsko-Bilogorska(Bjelovar-Bilogora), Brodsko-Posavska (Brod-Posavina), Dubrovacko-Neretvanska (Dubrovnik-Neretva), Istarska (Istria), Karlovacka (Karlovac), Koprivnicko-Krizevacka (Koprivnica-Krizevci), Krapinsko-Zagorska (Krapina-Zagorje), Licko-Senjska (Lika-Senj), Medimurska (Medimurje), Osjecko-Baranjska (Osijek-Baranja), Pozesko-Slavonska (Pozega-Slavonia), Primorsko-Goranska (Primorje-Gorski Kotar), Sibensko-Kninska (Sibenik-Knin), Sisacko-Moslavacka (Sisak-Moslavina), Splitsko-Dalmatinska (Split-Dalmatia), Varazdinska (Varazdin), Viroviticko-Podravska (Virovitica-Podravina), Vukovarsko-Srijemska (Vukovar-Syrmia), Zadarska (Zadar), Zagreb*, Zagrebacka (Zagreb county)', '25 June 1991 (from Yugoslavia)', 'Though still one of the wealthiest of the former Yugoslav republics, Croatia''s economy suffered badly during the 1991-95 war. The country''s output during that time collapsed, and Croatia missed the early waves of investment in Central and Eastern Europe that followed the fall of the Berlin Wall. Between 2000 and 2007, however, Croatia''s economic fortunes began to improve with moderate but steady GDP growth between 4% and 6%, led by a rebound in tourism and credit-driven consumer spending. Inflation over the same period remained tame and the currency, the kuna, stable.\r\nCroatia experienced an abrupt slowdown in the economy in 2008 and is slowly recovering; economic growth was stagnant or negative in each year since 2009, but picked up in 2015-16. Difficult problems still remain including a stubbornly high unemployment rate, uneven regional development, and a challenging investment climate. In 2016 Croatia demonstrated a commitment to improving the business climate, simplifying its tax code to stimulate growth from domestic consumption and foreign investment. Even before 2016, Croatia has worked to become a regional energy player and plans to import liquefied natural gas through a prospective import terminal and re-export it to European consumers.\r\nOn 1 July 2013, Croatia joined the EU, following a decade-long application process. Croatia will be a member of the European Exchange Rate Mechanism, with its currency effectively pegged to the euro, until it meets the criteria for joining the Economic and Monetary Union and adopts the euro as its currency. EU accession has increased pressure on the government to reduce Croatia’s relatively high public debt, which triggered the EU’s excessive deficit procedure for fiscal consolidation. Zagreb has cut spending since 2012, and the government also raised additional revenues through more stringent tax collection and by raising the value-added tax. The government has also sought to accelerate privatization of non-strategic assets, with mixed success.', '$50.73 billion (2016 est.)', 'arable crops (wheat, corn, barley, sugar beet, sunflower, rapeseed, alfalfa, clover); vegetables (potatoes, cabbage, onion, tomato, pepper); fruits (apples, plum, mandarins, olives), grapes for wine; livestock (cattle, cows, pigs); dairy products', 'chemicals and plastics, machine tools, fabricated metal, electronics, pig iron and rolled steel products, aluminum, paper, wood products, construction materials, textiles, shipbuilding, petroleum and petroleum refining, food and beverages, tourism', '1.617 million (2016 est.)', 'transport equipment, machinery, textiles, chemicals, foodstuffs, fuels', '10.82 billion kWh (2015 est.)', '13,580 bbl/day (2016 est.)', '65,860 bbl/day (2014 est.)', '1.829 billion cu m (2015 est.)', '9A (2016)', '69 (2013)', '1 (2013)', 'gas 2,410 km; oil 610 km (2011)', '2,722 km', '169,694 km', '785 km (2009)', '2018-02-07 18:03:26', NULL),
(56, 'CU', 'cu', 'Cuba', 'The native Amerindian population of Cuba began to decline after the European discovery of the island by Christopher COLUMBUS in 1492 and following its development as a Spanish colony during the next several centuries. Large numbers of African slaves were imported to work the coffee and sugar plantations, and Havana became the launching point for the annual treasure fleets bound for Spain from Mexico and Peru. Spanish rule eventually provoked an independence movement and occasional rebellions that were harshly suppressed. US intervention during the Spanish-American War in 1898 assisted the Cubans in overthrowing Spanish rule. The Treaty of Paris established Cuban independence from Spain in 1898 and, following three-and-a-half years of subsequent US military rule, Cuba became an independent republic in 1902 after which the island experienced a string of governments mostly dominated by the military and corrupt politicians. Fidel CASTRO led a rebel army to victory in 1959; his authoritarian rule held the subsequent regime together for nearly five decades. He stepped down as president in February 2008 in favor of his younger brother Raul CASTRO. Cuba''s communist revolution, with Soviet support, was exported throughout Latin America and Africa during the 1960s, 1970s, and 1980s. On 8-9 September 2017, Hurricane Irma passed along the north coast of Cuba causing extensive damage to structures, roads, and power supplies.\r\nThe country faced a severe economic downturn in 1990 following the withdrawal of former Soviet subsidies worth $4-6 billion annually. Cuba at times portrays the US embargo, in place since 1961, as the source of its difficulties. Over the past decade, there has been growing communication with the Cuban Government to address national interests. As a result of efforts begun in December 2014 to re-establish diplomatic relations with the Cuban Government, which were severed in January 1961, the US and Cuba reopened embassies in their respective countries on 20 July 2015. However, the embargo remains in place.\r\nIllicit migration of Cuban nationals to the US via maritime and overland routes has been a longstanding challenge. In FY 2016, the US Coast Guard interdicted 5,228 Cuban nationals at sea. Also in FY 2016, 44,553 Cuban migrants presented themselves at various land border ports of entry throughout the US. On 12 January 2017, the US and Cuba signed a Joint Statement ending the so-called “wet-foot, dry-foot” policy – by which Cuban nationals who reached US soil were permitted to stay – facilitating the repatriation of Cuban migrants. Illicit Cuban migration has since dropped significantly.', 'Central America and the Caribbean', '23 07 N, 82 21 W', '110,860 sq km', '11,147,407 (July 2017 est.)', 'Cuban(s)', 'white 64.1%, mulatto or mixed 26.6%, black 9.3%', 'Spanish (official)', 'nominally Roman Catholic 85%, Protestant, Jehovah''s Witnesses, Jewish, Santeria\r\nnote: prior to CASTRO assuming power', 'Republic of Cuba', 'communist state', 'Havana', '15 provinces (provincias, singular - provincia) and 1 special municipality* (municipio especial); Artemisa, Camaguey, Ciego de Avila, Cienfuegos, Granma, Guantanamo, Holguin, Isla de la Juventud*, La Habana, Las Tunas, Matanzas, Mayabeque, Pinar del Rio, Sancti Spiritus, Santiago de Cuba, Villa Clara', '20 May 1902 (from Spain 10 December 1898; administered by the US from 1898 to 1902); not acknowledged by the Cuban Government as a day of independence', 'The government continues to balance the need for loosening its socialist economic system against a desire for firm political control. In April 2011, the government held the first Cuban Communist Party Congress in almost 13 years, during which leaders approved a plan for wide-ranging economic changes. Since then, the government has slowly and incrementally implemented limited economic reforms, including allowing Cubans to buy electronic appliances and cell phones, stay in hotels, and buy and sell used cars. The government has cut state sector jobs as part of the reform process, and it has opened up some retail services to "self-employment," leading to the rise of so-called "cuentapropistas" or entrepreneurs. Approximately 476,000 Cuban workers are currently registered as self-employed.\r\nThe Cuban regime has updated its economic model to include permitting the private ownership and sale of real estate and new vehicles, allowing private farmers to sell agricultural goods directly to hotels, allowing the creation of non-agricultural cooperatives, adopting a new foreign investment law, and launching a “Special Development Zone” around the Mariel port.\r\nSince late 2000, Venezuela has provided petroleum products to Cuba on preferential terms, supplying nearly 100,000 barrels per day. Cuba has been paying for the oil, in part, with the services of Cuban personnel in Venezuela, including some 30,000 medical professionals.', '$81.56 billion (2013 est.)', 'sugar, tobacco, citrus, coffee, rice, potatoes, beans; livestock', 'petroleum, nickel, cobalt, pharmaceuticals, tobacco, construction, steel, cement, agricultural machinery, sugar', '4.686 million\r\nnote: state sector 72.3%, non-state sector 27.7% (2016 est.)', 'petroleum, nickel, medical products, sugar, tobacco, fish, citrus, coffee', '19.12 billion kWh (2015 est.)', '49,830 bbl/day (2016 est.)', '102,800 bbl/day (2014 est.)', '1.25 billion cu m (2015 est.)', 'CU (2016)', '133 (2017)', '-', 'gas 41 km; oil 230 km (2013)', '8,367 km', '26,958 km (includes 1,416 km of expressways) (2015)', '240 km (almost all navigable inland waterways are near the mouths of rivers) (2011)\r\ncountry comparison to the world: 94', '2018-02-07 18:03:26', NULL),
(57, 'CW', 'cw', 'Curaçao', 'Originally settled by Arawak Indians, Curacao was seized by the Dutch in 1634 along with the neighboring island of Bonaire. Once the center of the Caribbean slave trade, Curacao was hard hit economically by the abolition of slavery in 1863. Its prosperity (and that of neighboring Aruba) was restored in the early 20th century with the construction of the Isla Refineria to service the newly discovered Venezuelan oil fields. In 1954, Curacao and several other Dutch Caribbean possessions were reorganized as the Netherlands Antilles, part of the Kingdom of the Netherlands. In referenda in 2005 and 2009, the citizens of Curacao voted to become a self-governing country within the Kingdom of the Netherlands. The change in status became effective in October 2010 with the dissolution of the Netherlands Antilles.', 'Central America and the Caribbean', '12 06 N, 68 55 W', '444 sq km', '149,648 (July 2017 est.)', 'Curacaoan', 'Afro-Caribbean majority; Dutch, French, Latin American, East Asian, South Asian, Jewish minorities', 'Papiamento (official) (a creole language that is a mixture of Portuguese, Spanish, Dutch, English, and, to a lesser extent, French, as well as elements of African languages and the language of the Arawak) 81.2%, Dutch (official) 8%, Spanish 4%, English (official) 2.9%, other 3.9% (2001 census)', 'Roman Catholic 72.8%, Pentecostal 6.6%, Protestant 3.2%, Adventist 3%, Jehovah''s Witness 2%, Evangelical 1.9%, other 3.8%, none 6%, unspecified 0.6% (2011 est.)', 'none', 'parliamentary democracy', 'Willemstad', 'none (part of the Kingdom of the Netherlands)\nnote: Curacao is one of four constituent countries of the Kingdom of the Netherlands; the other three are the Netherlands, Aruba, and Sint Maarten', 'none (part of the Kingdom of the Netherlands)', 'Most of Curacao’s GDP results from services. Tourism, petroleum refining and bunkering, offshore finance, and transportation and communications are the mainstays of this small island economy, which is closely tied to the outside world. Curacao has limited natural resources, poor soil, and inadequate water supplies, and budgetary problems complicate reform of the health and education systems. Although GDP grew only slightly during the past decade, Curacao enjoys a high per capita income and a well-developed infrastructure compared to other countries in the region.\r\nCuracao has an excellent natural harbor that can accommodate large oil tankers, and the port of Willemstad hosts a free trade zone and a dry dock. Venezuelan state-owned oil company PdVSA, under a contract in effect until 2019, leases the single refinery on the island from the government, directly employing some 1,000 people. Most of the oil for the refinery is imported from Venezuela and most of the refined products are exported to the US and Asia. Almost all consumer and capital goods are imported, with the US, the Netherlands, and Venezuela being the major suppliers.\r\nThe government is attempting to diversify its industry and trade. Curacao is an Overseas Countries and Territories (OCT) of the European Union. Nationals of Curacao are citizens of the European Union, even though it is not a member. Based on its OCT status, products that originate in Curacao have preferential access to the EU and are exempt from import duties. Curacao is a beneficiary of the Caribbean Basin Initiative and, as a result, products originating in Curacao can be imported tax free into the US if at least 35% has been added to the value of these products in Curacao. The island has state-of-the-art information and communication technology connectivity with the rest of the world, including a Tier IV datacenter. With several direct satellite and submarine optic fiber cables, Curacao has one of the best Internet speeds and reliability in the Western Hemisphere.', '$5.6 billion (2012 est.)', 'aloe, sorghum, peanuts, vegetables, tropical fruit', 'tourism, petroleum refining, petroleum transshipment, light manufacturing, financial and business services', '73,010 (2013)\r\ncountry comparison to the world: 185', 'petroleum products', '1.785 billion kWh (2012 est.)', '-', '531.1 bbl/day (2010 est.)', '0 cu m (2009 est.)', 'PJ (2016)', '1 (2017)', '-', '-', '-', '60,858 km', '-', '2018-02-07 18:03:27', NULL),
(58, 'CY', 'cy', 'Cyprus', 'A former British colony, Cyprus became independent in 1960 following years of resistance to British rule. Tensions between the Greek Cypriot majority and Turkish Cypriot minority came to a head in December 1963, when violence broke out in the capital of Nicosia. Despite the deployment of UN peacekeepers in 1964, sporadic intercommunal violence continued, forcing most Turkish Cypriots into enclaves throughout the island. In 1974, a Greek Government-sponsored attempt to overthrow the elected president of Cyprus was met by military intervention from Turkey, which soon controlled more than a third of the island. In 1983, the Turkish Cypriot administered area declared itself the "Turkish Republic of Northern Cyprus" ("TRNC"), but it is recognized only by Turkey. A UN-mediated agreement, the Annan Plan, failed to win approval by both communities in 2004. In February 2014, after a hiatus of nearly two years, the leaders of the two communities resumed formal discussions under UN auspices aimed at reuniting the divided island. Talks were suspended in October 2014, but resumed in earnest in May 2015 following the election of a new Turkish Cypriot "president." The entire island entered the EU on 1 May 2004, although the EU acquis - the body of common rights and obligations - applies only to the areas under the internationally recognized government, and is suspended in the area administered by Turkish Cypriots. However, individual Turkish Cypriots able to document their eligibility for Republic of Cyprus citizenship legally enjoy the same rights accorded to other citizens of EU states.', 'Middle East', '35 10 N, 33 22 E', '-', '1,221,549 (July 2017 est.)', 'Cypriot(s)', 'Greek 98.8%, other 1% (includes Maronite, Armenian, Turkish-Cypriot), unspecified 0.2%', 'Greek (official) 80.9%, Turkish (official) 0.2%, English 4.1%, Romanian 2.9%, Russian 2.5%, Bulgarian 2.2%, Arabic 1.2%, Filipino 1.1%, other 4.3%, unspecified 0.6%', 'Orthodox Christian 89.1%, Roman Catholic 2.9%, Protestant/Anglican 2%, Muslim 1.8%, Buddhist 1%, other (includes Maronite, Armenian Church, Hindu) 1.4%, unknown 1.1%, none/atheist 0.6%\r\nnote: data represent only the government-controlled area of Cyprus (2011 est.)', 'Republic of Cyprus', 'Republic of Cyprus - presidential democracy; Turkish Republic of Northern Cyprus (self-declared) - s', 'Nicosia (Lefkosia/Lefkosa)', '6 districts; Ammochostos (Famagusta); (all but a small part located in the Turkish Cypriot community), Keryneia (Kyrenia; the only district located entirely in the Turkish Cypriot community), Larnaka (Larnaca; with a small part located in the Turkish Cypriot community), Lefkosia (Nicosia; a small part administered by Turkish Cypriots), Lemesos (Limassol), Pafos (Paphos); note - the 5 "districts" of the "TRNC" are Gazimagusa (Famagusta), Girne (Kyrenia), Guzelyurt (Morphou), Iskele (Trikomo), Lefkosa (Nicosia)', '16 August 1960 (from the UK); note - Turkish Cypriots proclaimed self-rule on 13 February 1975 and independence in 1983, but these proclamations are recognized only by Turkey', 'The area of the Republic of Cyprus under government control has a market economy dominated by a services sector that accounts for more than four-fifths of GDP. Tourism, finance, shipping, and real estate have traditionally been the most important services. Cyprus has been a member of the EU since May 2004 and adopted the euro as its national currency in January 2008.\r\nDuring the first five years of EU membership, the Cyprus economy grew at an average rate of about 4%, with unemployment between 2004 and 2008 averaging about 4%. However, the economy tipped into recession in 2009 as the ongoing global financial crisis and resulting low demand hit the tourism and construction sectors. An overextended banking sector with excessive exposure to Greek debt added to the contraction. Cyprus’ biggest two banks were among the largest holders of Greek bonds in Europe and had a substantial presence in Greece through bank branches and subsidiaries. Following numerous downgrades of its credit rating, Cyprus lost access to international capital markets in May 2011. In July 2012, Cyprus became the fifth euro-zone government to request an economic bailout program from the European Commission, European Central Bank and the International Monetary Fund - known collectively as the "Troika."\r\nShortly after the election of President Nikos ANASTASIADES in February 2013, Cyprus reached an agreement with the Troika on a $13 billion bailout that triggered a two-week bank closure and the imposition of capital controls that remained partially in place until April 2015. Cyprus'' two largest banks merged and the combined entity was recapitalized through conversion of some large bank deposits to shares and imposition of losses on bank bondholders. As with other EU countries, the Troika conditioned the bailout on passing financial and structural reforms and privatizing state-owned enterprises. Despite downsizing and restructuring, the Cypriot financial sector throughout 2015 remained burdened by the largest stock of non-performing loans in the euro zone, equal to nearly half of all loans. Since the bailout, Cyprus has received positive appraisals by the Troika and outperformed fiscal targets but has struggled to overcome political opposition to bailout-mandated legislation, particularly regarding privatizations. Cyprus emerged from recession in 2015 and its economy grew an estimated 1.5% for the year, setting a positive tone for the scheduled end of the bailout program in March 2016. Growth recovered to 2.8% in 2016. The European Commission projects continued GDP growth in Cyprus of 2.5% in 2017 and an 11.1% reduction in unemployment, but the rate of non-performing loans (NPLs) is still very high at around 49%. If Cypriot banks can increase the pace of resolution of these NPLs, economic growth could exceed the projection.\r\nIn October 2013, a US-Israeli consortium completed preliminary appraisals of hydrocarbon deposits in Cyprus’ exclusive economic zone (EEZ), which estimated gross mean reserves of about 130 billion cubic meters. Though exploration continues in Cyprus’ EEZ, no additional commercially exploitable reserves were identified during the exploratory drilling in 2014/2015. Developing offshore hydrocarbon resources remains a critical component of the government’s economic recovery efforts, but development has been delayed as a result of regional developments and disagreements about exploitation methods.\r\nEconomy - overview: Even though the whole of the island is part of the EU, implementation of the EU "acquis communautaire" has been suspended in the area administered by Turkish Cypriots, known locally as the "Turkish Republic of Northern Cyprus" ("TRNC"), until political conditions permit the reunification of the island. The market-based economy of the "TRNC" is roughly one-fifth the size of its southern neighbor and is likewise dominated by the service sector with a large portion of the population employed by the government. In 2012 - the latest year for which data are available - the services sector, which includes the public sector, trade, tourism, and education, contributed 58.7% to economic output. In the same year, light manufacturing and agriculture contributed 2.7% and 6.2%, respectively. Manufacturing is limited mainly to food and beverages, furniture and fixtures, construction materials, metal and non-metal products, textiles and clothing. The “TRNC” maintains few economic ties with the Republic of Cyprus outside of trade in construction materials. Since its creation, the "TRNC" has heavily relied on financial assistance from Turkey, which supports the "TRNC" defense, telecommunications, water and postal services. The Turkish Lira is the preferred currency, though foreign currencies are widely accepted in business transactions. The "TRNC" remains vulnerable to the Turkish market and monetary policy because of its use of the Turkish Lira. The "TRNC" weathered the European financial crisis relatively unscathed - compared to the Republic of Cyprus - because of the lack of financial sector development, the health of the Turkish economy, and its separation from the rest of the island. The "TRNC" economy experienced growth estimated at 2.8% in 2013 and 2.3% in 2014 and is projected to grow 3.8% in 2015.', '$19.81 billion (2016 est.)', 'citrus, vegetables, barley, grapes, olives, vegetables; poultry, pork, lamb; dairy, cheese\r\ncitrus fruit, dairy, potatoes, grapes, olives, poultry, lamb', 'tourism, food and beverage processing, cement and gypsum, ship repair and refurbishment, textiles, light chemicals, metal products, wood, paper, stone and clay products\r\nfoodstuffs, textiles, clothing, ship repair, clay, gypsum, copper, furniture', '422,300 (2016 est.)', 'citrus, potatoes, pharmaceuticals, cement, clothing', '4.243 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '5B (2016)', '15 (2013)', '9 (2013)', '-', '-', '550 km', '-', '2018-02-07 18:03:27', NULL),
(59, 'CZ', 'cz', 'Czech Republic', 'At the close of World War I, the Czechs and Slovaks of the former Austro-Hungarian Empire merged to form Czechoslovakia. During the interwar years, having rejected a federal system, the new country''s predominantly Czech leaders were frequently preoccupied with meeting the increasingly strident demands of other ethnic minorities within the republic, most notably the Slovaks, the Sudeten Germans, and the Ruthenians (Ukrainians). On the eve of World War II, Nazi Germany occupied the territory that today comprises Czechia, and Slovakia became an independent state allied with Germany. After the war, a reunited but truncated Czechoslovakia (less Ruthenia) fell within the Soviet sphere of influence. In 1968, an invasion by Warsaw Pact troops ended the efforts of the country''s leaders to liberalize communist rule and create "socialism with a human face," ushering in a period of repression known as "normalization." The peaceful "Velvet Revolution" swept the Communist Party from power at the end of 1989 and inaugurated a return to democratic rule and a market economy. On 1 January 1993, the country underwent a nonviolent "velvet divorce" into its two national components, the Czech Republic and Slovakia. The Czech Republic joined NATO in 1999 and the European Union in 2004. The country changed its short-form name to Czechia in 2016.', 'Europe', '50 05 N, 14 28 E', '78,867 sq km', '10,674,723 (July 2017 est.)', 'Czech(s)', 'Czech 64.3%, Moravian 5%, Slovak 1.4%, other 1.8%, unspecified 27.5% (2011 est.)', 'Czech (official) 95.4%, Slovak 1.6%, other 3% (2011 census)', 'Roman Catholic 10.4%, Protestant (includes Czech Brethren and Hussite) 1.1%, other and unspecified 54%, none 34.5% (2011 est.)', 'Czech Republic', 'parliamentary republic', 'Prague', '13 regions (kraje, singular - kraj) and 1 capital city* (hlavni mesto); Jihocesky (South Bohemia), Jihomoravsky (South Moravia), Karlovarsky (Karlovy Vary), Kralovehradecky (Hradec Kralove), Liberecky (Liberec), Moravskoslezsky (Moravia-Silesia), Olomoucky (Olomouc), Pardubicky (Pardubice), Plzensky (Pilsen), Praha (Prague)*, Stredocesky (Central Bohemia), Ustecky (Usti), Vysocina (Highlands), Zlinsky (Zlin)', '1 January 1993 (Czechoslovakia split into the Czech Republic and Slovakia); note - although 1 January is the day the Czech Republic came into being, the Czechs commemorate 28 October 1918, the day the former Czechoslovakia declared its independence from the Austro-Hungarian Empire, as their independence day', 'Czechia is a prosperous market economy that boasts one of the highest GDP growth rates and lowest unemployment levels in the EU, but its dependence on exports makes economic growth vulnerable to contractions in external demand. Czechia’s exports comprise some 80% of GDP and largely consist of automobiles, the country’s single largest industry. Czechia acceded to the EU in 2004 but has yet to join the euro-zone. While the flexible koruna helps Czechia weather external shocks, its central bank (Czech National Bank - CNB) has since November 2013 intervened in the foreign exchange markets to cap the value of the koruna at 27/Euro, with a 2% inflation target. This intervention has also helped to keep exports competitively priced. After inflation exceeded the bank''s 2% target in early 2017, the CNB indicated it expects to end its intervention in the first half of 2017, though it will continue to intervene as necessary to maintain stability of the currency.\r\nAfter slowly recovering from a steep recession in 2009, the Czech economy again fell into recession in 2012 and 2013 because of a slump in demand within the EU and government austerity measures. Inflows of EU development funds underpinned a rebound in 2014-15. Real GDP growth reached 4.5% in 2015, in part due to last-minute spending of EU funds, and fell to 2.5% in 2016, still one of the highest rates in the EU. The Czech unemployment rate was 5.2% in 2016, one of the lowest rates in the EU.\r\nSince coming to power in 2014, the new government has undertaken some reforms to try to reduce corruption, attract investment, and improve social welfare programs, which could help increase the government’s revenues and improve living conditions for Czechs. The government introduced in December 2016 an online tax reporting system intended to reduce tax evasion and increase revenues. The government also plans to remove labor market rigidities to improve the business climate, bring procurement procedures in line with EU best practices, and boost wages. The country''s low unemployment rate has led to steady increases in salaries – 4-5% in each of the past two years, and the government is facing pressure from businesses to allow greater migration of qualified workers, at least from Ukraine and neighboring Central European countries.\r\nLong-term challenges include dealing with a rapidly aging population, a shortage of skilled workers, a lagging education system, funding an unsustainable pension and health care system, and diversifying away from manufacturing and toward a more high-tech, services-based, knowledge economy.', '$195.3 billion (2016 est.)', 'wheat, potatoes, sugar beets, hops, fruit; pigs, poultry', 'motor vehicles, metallurgy, machinery and equipment, glass, armaments', '5.35 million (2016 est.)', 'machinery and transport equipment, raw materials, fuel, chemicals', '77.74 billion kWh (2015 est.)', '2,333 bbl/day (2016 est.)', '121,000 bbl/day (2016 est.)', '247 million cu m (2015 est.)', 'OK (2016)', '128 (2013)', '1 (2013)', 'gas 7,160 km; oil 536 km; refined products 94 km (2013)', '9,621.5 km', '130,661 km (includes urban roads)', '664 km (principally on Elbe, Vltava, Oder, and other navigable rivers, lakes, and canals) (2010)\r\ncountry comparison to the world: 76', '2018-02-07 18:03:27', NULL),
(60, 'CD', 'cd', 'Democratic Republic of the Congo', 'Established as an official Belgian colony in 1908, the then-Republic of the Congo gained its independence in 1960, but its early years were marred by political and social instability. Col. Joseph MOBUTU seized power and declared himself president in a November 1965 coup. He subsequently changed his name - to MOBUTU Sese Seko - as well as that of the country - to Zaire. MOBUTU retained his position for 32 years through several sham elections, as well as through brutal force. Ethnic strife and civil war, touched off by a massive inflow of refugees in 1994 from fighting in Rwanda and Burundi, led in May 1997 to the toppling of the MOBUTU regime by a rebellion backed by Rwanda and Uganda and fronted by Laurent KABILA. KABILA renamed the country the Democratic Republic of the Congo (DRC), but in August 1998 his regime was itself challenged by a second insurrection again backed by Rwanda and Uganda. Troops from Angola, Chad, Namibia, Sudan, and Zimbabwe intervened to support KABILA''s regime. In January 2001, KABILA was assassinated and his son, Joseph KABILA, was named head of state. In October 2002, the new president was successful in negotiating the withdrawal of Rwandan forces occupying the eastern DRC; two months later, the Pretoria Accord was signed by all remaining warring parties to end the fighting and establish a government of national unity. A transitional government was set up in July 2003; it held a successful constitutional referendum in December 2005 and elections for the presidency, National Assembly, and provincial legislatures took place in 2006.\r\nIn 2009, following a resurgence of conflict in the eastern DRC, the government signed a peace agreement with the National Congress for the Defense of the People (CNDP), a primarily Tutsi rebel group. An attempt to integrate CNDP members into the Congolese military failed, prompting their defection in 2012 and the formation of the M23 armed group - named after the 23 March 2009 peace agreements. Renewed conflict led to large population displacements and significant human rights abuses before the M23 was pushed out of DRC to Uganda and Rwanda in late 2013 by a joint DRC and UN offensive. In addition, the DRC continues to experience violence committed by other armed groups including the Democratic Forces for the Liberation of Rwanda, the Allied Democratic Forces, and assorted Mai Mai militias. In the most recent national elections, held in November 2011, disputed results allowed Joseph KABILA to be reelected to the presidency. The DRC Constitution bars President KABILA from running for a third term, but the DRC Government has delayed national elections, originally slated for November 2016, to December 2018. The failure to hold elections as scheduled has fueled sporadic street protests by KABILA’s opponents.', 'Africa', '0 00 N, 25 00 E', '2,344,858 sq km', '83,301,151', 'Congolese (singular and plural)', 'over 200 African ethnic groups of which the majority are Bantu; the four largest tribes - Mongo, Luba, Kongo (all Bantu), and the Mangbetu-Azande (Hamitic) make up about 45% of the population', 'French (official), Lingala (a lingua franca trade language), Kingwana (a dialect of Kiswahili or Swahili), Kikongo, Tshiluba', 'Roman Catholic 50%, Protestant 20%, Kimbanguist 10%, Muslim 10%, other (includes syncretic sects and indigenous beliefs) 10%', 'Democratic Republic of the Congo', 'semi-presidential republic', 'Kinshasa', '26 provinces (provinces, singular - province); Bas-Uele (Lower Uele), Equateur, Haut-Katanga (Upper Katanga), Haut-Lomami (Upper Lomami), Haut-Uele (Upper Uele), Ituri, Kasai, Kasai-Central, Kasai-Oriental (East Kasai), Kinshasa, Kongo Central, Kwango, Kwilu, Lomami, Lualaba, Mai-Ndombe, Maniema, Mongala, Nord-Kivu (North Kivu), Nord-Ubangi (North Ubangi), Sankuru, Sud-Kivu (South Kivu), Sud-Ubangi (South Ubangi), Tanganyika, Tshopo, Tshuapa', '30 June 1960 (from Belgium)', 'The economy of the Democratic Republic of the Congo - a nation endowed with vast natural resource wealth - continues to struggle. Systemic corruption since independence in 1960, combined with countrywide instability and conflict that began in the early-90s, has dramatically reduced national output and government revenue and increased external debt. With the installation of a transitional government in 2003 after peace accords, economic conditions slowly began to improve as the transitional government reopened relations with international financial institutions and international donors, and President KABILA began implementing reforms.\r\nRenewed activity in the mining sector, the source of most export income, boosted Kinshasa''s fiscal position and GDP growth, but low commodity prices are leading to slower growth, rising inflation, and a growing fiscal deficit. An uncertain legal framework, corruption, and a lack of transparency in government policy are long-term problems for the large mining sector and for the economy as a whole.\r\nMuch economic activity still occurs in the informal sector and is not reflected in GDP data. The DRC signed a Poverty Reduction and Growth Facility with the IMF in 2009 and received $12 billion in multilateral and bilateral debt relief in 2010; but, at the end of 2012, the IMF suspended the last three payments under the loan facility - worth $240 million - because of concerns about the lack of transparency in mining contracts. In 2012, the DRC updated its business laws by adhering to OHADA, the Organization for the Harmonization of Business Law in Africa. The price of copper – the DRC’s primary export - plummeted in 2015 and remained at record lows during 2016-17, reducing government revenues, expenditures, and foreign exchange reserves.', '$40.42 billion (2016 est.)', 'coffee, sugar, palm oil, rubber, tea, cotton, cocoa, quinine, cassava (manioc, tapioca), bananas, plantains, peanuts, root crops, corn, fruits; wood products', 'mining (copper, cobalt, gold, diamonds, coltan, zinc, tin, tungsten), mineral processing, consumer products (textiles, plastics, footwear, cigarettes), metal products, processed foods and beverages, timber, cement, commercial ship repair', '31.36 million (2017 est.)', 'diamonds, copper, gold, cobalt, wood products, crude oil, coffee', '8.852 billion kWh (2015 est.)', '20,000 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '8.495 million cu m (2011 est.)', '9Q (2016)', '198 (2013)', '1 (2013)', 'gas 62 km; oil 77 km; refined products 756 km (2013)', '4,007 km', '153,497 km', '15,000 km (including the Congo River, its tributaries, and unconnected lakes) (2011)', '2018-02-07 18:03:27', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(61, 'DK', 'dk', 'Denmark', 'Once the seat of Viking raiders and later a major north European power, Denmark has evolved into a modern, prosperous nation that is participating in the general political and economic integration of Europe. It joined NATO in 1949 and the EEC (now the EU) in 1973. However, the country has opted out of certain elements of the EU''s Maastricht Treaty, including the European Economic and Monetary Union, European defense cooperation, and issues concerning certain justice and home affairs.', 'Europe', '55 40 N, 12 35 E', '43,094 sq km', '5,605,948 (July 2017 est.)', 'Dane(s)', 'Danish (includes Greenlandic (who are predominantly Inuit) and Faroese) 86.7%, Turkish 1.1%, other 12.2% (largest groups are Polish, Syrian, German, Iraqi, and Romanian)\r\nnote: data represent population by ancestry (2017 est.)', 'Danish, Faroese, Greenlandic (an Inuit dialect), German (small minority)', 'Evangelical Lutheran (official) 76%, Muslim 4%, other (denominations of less than 1% each, includes Roman Catholic, Jehovah''s Witness, Serbian Orthodox Christian, Jewish, Baptist, and Buddhist) 20% (2017 est.)', 'Kingdom of Denmark', 'parliamentary constitutional monarchy', 'Copenhagen', 'metropolitan Denmark - 5 regions (regioner, singular - region); Hovedstaden (Capital), Midtjylland (Central Jutland), Nordjylland (North Jutland), Sjaelland (Zealand), Syddanmark (Southern Denmark)\r\nnote: an extensive local government reform merged 271 municipalities into 98 and 13 counties into five regions, effective 1 January 2007', 'ca. 965 (unified and Christianized under HARALD I Gormson); 5 June 1849 (became a parliamentary constitutional monarchy)', 'This thoroughly modern market economy features a high-tech agricultural sector, advanced industry with world-leading firms in pharmaceuticals, maritime shipping, and in renewable energy, and a high dependence on foreign trade. Denmark is a net exporter of food, oil, and gas and enjoys a comfortable balance of payments surplus, but depends on imports of raw materials for the manufacturing sector. Danes enjoy a high standard of living, and the Danish economy is characterized by extensive government welfare measures and an equitable distribution of income. An aging population will be a long-term issue.\nDenmark is a member of the EU; Danish legislation and regulations conform to EU standards on almost all issues. Despite previously meeting the criteria to join the European Economic and Monetary Union, Denmark has negotiated an opt-out with the EU and is not required to adopt the euro. Within the EU, Denmark is among the strongest supporters of trade liberalization.\nDenmark is experiencing a modest economic expansion. The economy grew by 1.6% in 2015 and an estimated 1.3% in 2016. The expansion is expected to continue at similar rates in 2017 and 2018. The labor market has strengthened since 2013, and unemployment stood at 4.2% in early 2017, based on the national measure. By early 2017, some sectors were experiencing difficulties attracting qualified labor. Productivity growth was significantly below the OECD average from the mid-1990s until 2011, but has increased in recent years. Improvement in productivity is needed to ensure continued growth.\nDenmark maintained a healthy budget surplus for many years up to 2008, but the global financial crisis swung the budget balance into deficit. The 2016 deficit was 1.4%. The government projects lower deficits in 2017 and 2018, and public debt (EMU debt) as a share of GDP is expected to decline. In 2015, household indebtedness remained relatively high at more than 292% of net disposable income, while household net worth - from private pension schemes and other assets - amounted to 497% of net disposable income.', '$306.7 billion (2016 est.)', 'barley, wheat, potatoes, sugar beets; pork, dairy products; fish', 'iron, steel, nonferrous metals, chemicals, food processing, machinery and transportation equipment, textiles and clothing, electronics, construction, furniture and other wood products, shipbuilding and refurbishment, windmills, pharmaceuticals, medical equipment', '2.953 million (2016 est.)', 'machinery and instruments, meat and meat products, dairy products, fish, pharmaceuticals, furniture and design, windmills', '27.34 billion kWh (2015 est.)', '.140,600 bbl/day (2016 est.)', '187,700 bbl/day (2016 est.)', '4.618 billion cu m (2015 est.)', 'OY (2016)', '80 (2013)', '-', 'gas 1,536 km; oil 330 km (2015)', '3,476 km', '74,558 km', '400 km (2010)\r\ncountry comparison to the world: 87', '2018-02-07 18:03:27', NULL),
(62, 'DJ', 'dj', 'Djibouti', 'The French Territory of the Afars and the Issas became Djibouti in 1977. Hassan Gouled APTIDON installed an authoritarian one-party state and proceeded to serve as president until 1999. Unrest among the Afar minority during the 1990s led to a civil war that ended in 2001 with a peace accord between Afar rebels and the Somali Issa-dominated government. In 1999, Djibouti''s first multiparty presidential election resulted in the election of Ismail Omar GUELLEH as president; he was reelected to a second term in 2005 and extended his tenure in office via a constitutional amendment, which allowed him to serve a third term in 2011 and begin a fourth term in 2016. Djibouti occupies a strategic geographic location at the intersection of the Red Sea and the Gulf of Aden and serves as an important shipping portal for goods entering and leaving the east African highlands and transshipments between Europe, the Middle East, and Asia. The government holds longstanding ties to France, which maintains a significant military presence in the country, and has strong ties with the US. Djibouti hosts several thousand members of US armed services at US-run Camp Lemonnier.', 'Africa', '11 35 N, 43 09 E', '23,200 sq km', '865,267 (July 2017 est.)', 'Djiboutian(s)', 'Somali 60%, Afar 35%, other 5% (includes French, Arab, Ethiopian, and Italian)', 'French (official), Arabic (official), Somali, Afar', 'Muslim 94%, Christian 6%', 'Republic of Djibouti', 'semi-presidential republic', 'Djibouti', '6 districts (cercles, singular - cercle); Ali Sabieh, Arta, Dikhil, Djibouti, Obock, Tadjourah', '27 June 1977 (from France)', 'Djibouti''s economy is based on service activities connected with the country''s strategic location as a deepwater port on the Red Sea. Three-fourths of Djibouti''s inhabitants live in the capital city; the remainder are mostly nomadic herders. Scant rainfall and less than 4% arable land limits crop production to small quantities of fruits and vegetables, and most food must be imported.\nDjibouti provides services as both a transit port for the region and an international transshipment and refueling center. Imports, exports, and reexports represent 70% of port activity at Djibouti''s container terminal. Reexports consist primarily of coffee from landlocked neighbor Ethiopia. Djibouti has few natural resources and little industry. The nation is, therefore, heavily dependent on foreign assistance to support its balance of payments and to finance development projects. An official unemployment rate of nearly 50% - with youth unemployment near 80% - continues to be a major problem. Inflation was a modest 3% in 2014-2016, due to low international food prices and a decline in electricity tariffs.\nDjibouti’s reliance on diesel-generated electricity and imported food and water leave average consumers vulnerable to global price shocks, though in mid-2015 Djibouti passed new legislation to liberalize the energy sector. The government has emphasized infrastructure development for transportation and energy and Djibouti – with the help of foreign partners, particularly China – has begun to increase and modernize its port capacity.', '$1.889 billion (2016 est.)', 'fruits, vegetables; goats, sheep, camels, animal hides', 'construction, agricultural processing, shipping', '294,600 (2012)', 'reexports, hides and skins, coffee (in transit), scrap metal', '405 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'J2 (2016)', '13 (2013)', '-', '-', '97 km (Djibouti segment of the 756 km Addis Ababa-Djibouti railway)', '3,065 km', '-', '2018-02-07 18:03:27', NULL),
(63, 'DM', 'dm', 'Dominica', 'Dominica was the last of the Caribbean islands to be colonized by Europeans due chiefly to the fierce resistance of the native Caribs. France ceded possession to Great Britain in 1763, which colonized the island in 1805. In 1980, two years after independence, Dominica''s fortunes improved when a corrupt and tyrannical administration was replaced by that of Mary Eugenia CHARLES, the first female prime minister in the Caribbean, who remained in office for 15 years. On 18 September 2017, Hurricane Maria passed over the island causing extensive damage to structures, roads, communications, and the power supply, and largely destroying critical agricultural areas.', 'Central America and the Caribbean', '5 18 N, 61 24 W', '751 sq km', '73,897 (July 2017 est.)', 'Dominican(s)', 'black 86.6%, mixed 9.1%, indigenous 2.9%, other 1.3%, unspecified 0.2% (2001 est.)', 'English (official), French patois', 'Roman Catholic 61.4%, Protestant 28.6% (includes Evangelical 6.7%, Seventh Day Adventist 6.1%, Pentecostal 5.6%, Baptist 4.1%, Methodist 3.7%, Church of God 1.2%, other 1.2%), Rastafarian 1.3%, Jehovah''s Witness 1.2%, other 0.3%, none 6.1%, unspecified 1.1% (2001 est.)', 'Commonwealth of Dominica', 'parliamentary republic', 'Roseau', '10 parishes; Saint Andrew, Saint David, Saint George, Saint John, Saint Joseph, Saint Luke, Saint Mark, Saint Patrick, Saint Paul, Saint Peter', '3 November 1978 (from the UK)', 'The Dominican economy has been dependent on agriculture - primarily bananas - in years past, but increasingly has been driven by tourism as the government seeks to promote Dominica as an "ecotourism" destination. Moreover, Dominica has an offshore medical education sector. In order to diversify the island''s economy, the government is also attempting to foster an offshore financial industry and plans to sign agreements with the private sector to develop geothermal energy resources. In 2003, the government began a comprehensive restructuring of the economy - including the elimination of price controls, privatization of the state banana company, and tax increases - to address an economic and financial crisis and to meet IMF requirements. In 2009 and 2013, the economy contracted as a result of the global recession; growth remains anemic. Although public debt levels continue to exceed pre-recession levels, the debt burden declined from 78% of GDP in 2011 to approximately 70% in 2012.', '$581 million (2016 est.)', 'bananas, citrus, mangos, root crops, coconuts, cocoa\r\nnote: forest and fishery potential not exploited', 'soap, coconut oil, tourism, copra, furniture, cement blocks, shoes', '25,000 (2000 est.)', 'bananas, soap, bay oil, vegetables, grapefruit, oranges', '94 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'J7 (2016)', '2 (2013)', '-', '-', '-', '1,512 km', '-', '2018-02-07 18:03:27', NULL),
(64, 'DO', 'do', 'Dominican Republic', 'The Taino - indigenous inhabitants of Hispaniola prior to the arrival of the Europeans - divided the island into five chiefdoms and territories. Christopher COLUMBUS explored and claimed the island on his first voyage in 1492; it became a springboard for Spanish conquest of the Caribbean and the American mainland. In 1697, Spain recognized French dominion over the western third of the island, which in 1804 became Haiti. The remainder of the island, by then known as Santo Domingo, sought to gain its own independence in 1821 but was conquered and ruled by the Haitians for 22 years; it finally attained independence as the Dominican Republic in 1844. In 1861, the Dominicans voluntarily returned to the Spanish Empire, but two years later they launched a war that restored independence in 1865. A legacy of unsettled, mostly non-representative rule followed, capped by the dictatorship of Rafael Leonidas TRUJILLO from 1930 to 1961. Juan BOSCH was elected president in 1962 but was deposed in a military coup in 1963. In 1965, the US led an intervention in the midst of a civil war sparked by an uprising to restore BOSCH. In 1966, Joaquin BALAGUER defeated BOSCH in the presidential election. BALAGUER maintained a tight grip on power for most of the next 30 years when international reaction to flawed elections forced him to curtail his term in 1996. Since then, regular competitive elections have been held in which opposition candidates have won the presidency. Former President Leonel FERNANDEZ Reyna (first term 1996-2000) won election to a new term in 2004 following a constitutional amendment allowing presidents to serve more than one term, and was later reelected to a second consecutive term. In 2012, Danilo MEDINA Sanchez became president; he was reelected in 2016.', 'Central America and the Caribbean', '18 28 N, 69 54 W', '48,670 sq km', '10,734,247 (July 2017 est.)', 'Dominican(s)', 'mixed 70.4% (mestizo/indio 58%, mulatto 12.4%), black 15.8%, white 13.5%, other 0.3%\r\nnote: respondents self-identified their race; the term "indio" in the Dominican Republic is not associated with people of indigenous ancestry but people of mixed ancestry or skin color between light and dark (2014 est.)', 'Spanish (official)', 'Roman Catholic 95%, other 5%', 'Dominican Republic', 'presidential republic', 'Santo Domingo', '10 regions (regiones, singular - region); Cibao Nordeste, Cibao Noroeste, Cibao Norte, Cibao Sur, El Valle, Enriquillo, Higuamo, Ozama, Valdesia, Yuma', '27 February 1844 (from Haiti)', 'The Dominican Republic was for most of its history primarily an exporter of sugar, coffee, and tobacco, but in recent years the service sector has overtaken agriculture as the economy''s largest employer, due to growth in construction, tourism, and free trade zones. The mining sector has also played a greater role in the export market since late 2012 with the commencement of the extraction phase of the Pueblo Viejo Gold and Silver mine, one of the largest gold mines in the world. The country suffers from marked income inequality; the poorest half of the population receives less than one-fifth of GDP, while the richest 10% enjoys nearly 40% of GDP. High unemployment, a large informal sector, and underemployment remain important long-term challenges.\r\nThe economy is highly dependent upon the US, the destination for approximately half of exports. Remittances from the US amount to about 7% of GDP, equivalent to about a third of exports and two-thirds of tourism receipts. The Central America-Dominican Republic Free Trade Agreement came into force in March 2007, boosting investment and manufacturing exports.\r\nThe Dominican Republic''s economy rebounded from the global recession in 2010-16, and the fiscal situation is improving. A tax reform package passed in November 2012, a reduction in government spending, and lower energy costs helped to narrow the central government budget deficit from 6.6% of GDP in 2012 to 2.6% in 2016. A liability management operation in January 2015, in which the government paid down over $4 billion of the country’s Petrocaribe debt at a discount of 52% with proceeds from the sale of $2.5 billion in global bonds, reduced the country’s debt load by approximately by 4% of GDP. Since 2015 the Dominican Republic has posted the fastest economic growth in Latin America.', '$71.67 billion (2016 est.)', 'cocoa, tobacco, sugarcane, coffee, cotton, rice, beans, potatoes, corn, bananas; cattle, pigs, dairy products, beef, eggs', 'tourism, sugar processing, gold mining, textiles, cement, tobacco, electrical components, medical devices', '4.639 million (2016 est.)', 'gold, silver, cocoa, sugar, coffee, tobacco, meats, consumer goods', '15.53 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '27,060 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'HI (2016)', '36 (2013)', '1 (2013)', 'gas 27 km; oil 103 km (2013)', '496 km', '19,705 km', '-', '2018-02-07 18:03:27', NULL),
(65, 'TL', 'tl', 'East Timor', 'The Portuguese began to trade with the island of Timor in the early 16th century and colonized it in mid-century. Skirmishing with the Dutch in the region eventually resulted in an 1859 treaty in which Portugal ceded the western portion of the island. Imperial Japan occupied Portuguese Timor from 1942 to 1945, but Portugal resumed colonial authority after the Japanese defeat in World War II. East Timor declared itself independent from Portugal on 28 November 1975 and was invaded and occupied by Indonesian forces nine days later. It was incorporated into Indonesia in July 1976 as the province of Timor Timur (East Timor). An unsuccessful campaign of pacification followed over the next two decades, during which an estimated 100,000 to 250,000 people died. In an August 1999 UN-supervised popular referendum, an overwhelming majority of the people of Timor-Leste voted for independence from Indonesia. However, in the next three weeks, anti-independence Timorese militias - organized and supported by the Indonesian military - commenced a large-scale, scorched-earth campaign of retribution. The militias killed approximately 1,400 Timorese and forced 300,000 people into western Timor as refugees. Most of the country''s infrastructure, including homes, irrigation systems, water supply systems, and schools, and nearly all of the country''s electrical grid were destroyed. On 20 September 1999, Australian-led peacekeeping troops deployed to the country and brought the violence to an end. On 20 May 2002, Timor-Leste was internationally recognized as an independent state.\r\nIn 2006, internal tensions threatened the new nation''s security when a military strike led to violence and a breakdown of law and order. At Dili''s request, an Australian-led International Stabilization Force (ISF) deployed to Timor-Leste, and the UN Security Council established the UN Integrated Mission in Timor-Leste (UNMIT), which included an authorized police presence of over 1,600 personnel. The ISF and UNMIT restored stability, allowing for presidential and parliamentary elections in 2007 in a largely peaceful atmosphere. In February 2008, a rebel group staged an unsuccessful attack against the president and prime minister. The ringleader was killed in the attack, and most of the rebels surrendered in April 2008. Since the attack, the government has enjoyed one of its longest periods of post-independence stability, including successful 2012 elections for both the parliament and president and a successful transition of power in February 2015. In late 2012, the UN Security Council ended its peacekeeping mission in Timor-Leste and both the ISF and UNMIT departed the country.', 'Southeast Asia', '8 35 S, 125 36 E', '14,874 sq km', '1,291,358 (July 2017 est.)', 'Timorese', 'Austronesian (Malayo-Polynesian) (includes Tetun, Mambai, Tokodede, Galoli, Kemak, Baikeno), Melanesian-Papuan (includes Bunak, Fataluku, Bakasai), small Chinese minority', 'Tetun Prasa 30.6%, Mambai 16.6%, Makasai 10.5%, Tetun Terik 6.1%, Baikenu 5.9%, Kemak 5.8%, Bunak 5.5%, Tokodede 4%, Fataluku 3.5%, Waima''a 1.8%, Galoli 1.4%, Naueti 1.4%, Idate 1.2%, Midiki 1.2%, other 4.5%', 'Roman Catholic 97.6%, Protestant/Evangelical 2%, Muslim 0.2%, other 0.2% (2015 est.)', 'Democratic Republic of Timor-Leste', 'semi-presidential republic', 'Dili', '13 administrative districts; Aileu, Ainaro, Baucau, Bobonaro (Maliana), Cova-Lima (Suai), Dili, Ermera (Gleno), Lautem (Los Palos), Liquica, Manatuto, Manufahi (Same), Oecussi (Ambeno), Viqueque\r\nnote: administrative divisions have the same names as their administrative centers (exceptions have the administrative center name following in parentheses)', '20 May 2002 (from Indonesia); note - 28 November 1975 was the date independence was proclaimed from Portugal; 20 May 2002 was the date of international recognition of Timor-Leste''s independence from Indonesia', 'Since independence in 1999, Timor-Leste has faced great challenges in rebuilding its infrastructure, strengthening the civil administration, and generating jobs for young people entering the work force. The development of offshore oil and gas resources has greatly supplemented government revenues. This technology-intensive industry, however, has done little to create jobs in part because there are no production facilities in Timor-Leste. Gas is currently piped to Australia for processing, but Timor-Leste has expressed interest in developing a domestic processing capacity.\r\nIn June 2005, the National Parliament unanimously approved the creation of the Timor-Leste Petroleum Fund to serve as a repository for all petroleum revenues and to preserve the value of Timor-Leste''s petroleum wealth for future generations. The Fund held assets of $16 billion, as of mid-2016. Oil accounts for over 90% of government revenues, and the drop in the price of oil in 2014-16 has led to concerns about the long-term sustainability of government spending. Timor-Leste compensated for the decline in price by exporting more oil. The Ministry of Finance maintains that the Petroleum Fund is sufficient to sustain government operations for the foreseeable future.\r\nAnnual government budget expenditures increased markedly between 2009 and 2012 but dropped significantly through 2016. Historically, the government failed to spend as much as its budget allowed. The government has focused significant resources on basic infrastructure, including electricity and roads, but limited experience in procurement and infrastructure building has hampered these projects. The underlying economic policy challenge the country faces remains how best to use oil-and-gas wealth to lift the non-oil economy onto a higher growth path and to reduce poverty.', '$2.703 billion (2016 est.)\r\nnote: non-oil GDP', 'coffee, rice, corn, cassava (manioc, tapioca), sweet potatoes, soybeans, cabbage, mangoes, bananas, vanilla', 'printing, soap manufacturing, handicrafts, woven cloth', '286,700 (2016 est.)', 'oil, coffee, sandalwood, marble', '0 kWh (2015 est.)', '49,240 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '7.7 billion cu m (2015 est.)', '4W (2016)', '6 (2013)', '8 (2013)', '-', '-', '6,040 km', '-', '2018-02-07 18:03:27', NULL),
(66, 'EC', 'ec', 'Ecuador', 'What is now Ecuador formed part of the northern Inca Empire until the Spanish conquest in 1533. Quito became a seat of Spanish colonial government in 1563 and part of the Viceroyalty of New Granada in 1717. The territories of the Viceroyalty - New Granada (Colombia), Venezuela, and Quito - gained their independence between 1819 and 1822 and formed a federation known as Gran Colombia. When Quito withdrew in 1830, the traditional name was changed in favor of the "Republic of the Equator." Between 1904 and 1942, Ecuador lost territories in a series of conflicts with its neighbors. A border war with Peru that flared in 1995 was resolved in 1999. Although Ecuador marked 30 years of civilian governance in 2004, the period was marred by political instability. Protests in Quito contributed to the mid-term ouster of three of Ecuador''s last four democratically elected presidents. In late 2008, voters approved a new constitution, Ecuador''s 20th since gaining independence. General elections were held in April 2017, and voters elected President Lenin MORENO.', 'South America', '0 13 S, 78 30 W', '283,561 sq km', '16,290,913 (July 2017 est.)', 'Ecuadorian(s)', 'mestizo (mixed Amerindian and white) 71.9%, Montubio 7.4%, Amerindian 7%, white 6.1%, Afroecuadorian 4.3%, mulatto 1.9%, black 1%, other 0.4% (2010 est.)', 'Spanish (Castilian) 93% (official), Quechua 4.1%, other indigenous 0.7%, foreign 2.2%', 'Roman Catholic 74%, Evangelical 10.4%, Jehovah''s Witness 1.2%, other 6.4% (includes Mormon Buddhist, Jewish, Spiritualist, Muslim, Hindu, indigenous religions, African American religions, Pentecostal), atheist 7.9%, agnostic 0.1%\r\nnote: data represent persons at least 16 years of age from five Ecuadoran cities (2012 est.)', 'Republic of Ecuador', 'presidential republic', 'Quito', '24 provinces (provincias, singular - provincia); Azuay, Bolivar, Canar, Carchi, Chimborazo, Cotopaxi, El Oro, Esmeraldas, Galapagos, Guayas, Imbabura, Loja, Los Rios, Manabi, Morona-Santiago, Napo, Orellana, Pastaza, Pichincha, Santa Elena, Santo Domingo de los Tsachilas, Sucumbios, Tungurahua, Zamora-Chinchipe', '24 May 1822 (from Spain)', 'Ecuador is substantially dependent on its petroleum resources, which have accounted for more than half of the country''s export earnings and approximately 25% of public sector revenues in recent years.\r\nIn 1999/2000, Ecuador''s economy suffered from a banking crisis, with GDP contracting by 5.3% and poverty increasing significantly. In March 2000, the Congress approved a series of structural reforms that also provided for the adoption of the US dollar as legal tender. Dollarization stabilized the economy, and positive growth returned in the years that followed, helped by high oil prices, remittances, and increased non-traditional exports. The economy grew an average of 4.3% per year from 2002 to 2006, the highest five-year average in 25 years. After moderate growth in 2007, the economy reached a growth rate of 6.4% in 2008, buoyed by high global petroleum prices and increased public sector investment. President Rafael CORREA Delgado, who took office in January 2007, defaulted in December 2008 on Ecuador''s sovereign debt, which, with a total face value of approximately US$3.2 billion, represented about 30% of Ecuador''s public external debt. In May 2009, Ecuador bought back 91% of its "defaulted" bonds via an international reverse auction.\r\nEconomic policies under the CORREA administration - for example, an announcement in late 2009 of its intention to terminate 13 bilateral investment treaties, including one with the US - have generated economic uncertainty and discouraged private investment. China has become Ecuador''s largest foreign lender since Quito defaulted in 2008, allowing the government to maintain a high rate of social spending; Ecuador contracted with the Chinese government for more than $9.9 billion in forward oil sales, project financing, and budget support loans as of December 2013.\r\nThe level of foreign investment in Ecuador continues to be one of the lowest in the region as a result of an unstable regulatory environment, weak rule of law, and the crowding-out effect of public investments. Faced with a 2013 trade deficit of $1.1 billion, Ecuador erected technical barriers to trade in December 2013, causing tensions with its largest trading partners. Ecuador also decriminalized intellectual property rights violations in February 2014. In March, 2015 Ecuador imposed tariff surcharges from 5% to 45% on an estimated 32% of imports. In 2014, oil output increased slightly and production remained steady in 2015 however the oil price decrease from 2014 onward affected government revenue. Ecuador’s economy fell in to recession in 2015 and remained in recession in 2016. As a result, CORREA cut the budget twice in 2015, and reduced it further in 2016.', '$97.8 billion (2016 est.)', 'bananas, coffee, cocoa, rice, potatoes, cassava (manioc, tapioca), plantains, sugarcane; cattle, sheep, pigs, beef, pork, dairy products; fish, shrimp; balsa wood', 'petroleum, food processing, textiles, wood products, chemicals', '7.874 million (2016 est.)', 'petroleum, bananas, cut flowers, shrimp, cacao, coffee, wood, fish', '24.95 billion kWh (2015 est.)', '548,400 bbl/day (2016 est.)', '146,500 bbl/day (2014 est.)', '497 million cu m (2015 est.)', 'HC (2016)', '432 (2013)', '2 (2013)', 'extra heavy crude 527 km; gas 71 km; oil 2,131 km; refined products 1,526 km (2013)', '965 km', '43,670 km', '1,500 km (most inaccessible) (2012)', '2018-02-07 18:03:27', NULL),
(67, 'EG', 'eg', 'Egypt', 'The regularity and richness of the annual Nile River flood, coupled with semi-isolation provided by deserts to the east and west, allowed for the development of one of the world''s great civilizations. A unified kingdom arose circa 3200 B.C., and a series of dynasties ruled in Egypt for the next three millennia. The last native dynasty fell to the Persians in 341 B.C., who in turn were replaced by the Greeks, Romans, and Byzantines. It was the Arabs who introduced Islam and the Arabic language in the 7th century and who ruled for the next six centuries. A local military caste, the Mamluks took control about 1250 and continued to govern after the conquest of Egypt by the Ottoman Turks in 1517. Completion of the Suez Canal in 1869 elevated Egypt as an important world transportation hub. Ostensibly to protect its investments, Britain seized control of Egypt''s government in 1882, but nominal allegiance to the Ottoman Empire continued until 1914. Partially independent from the UK in 1922, Egypt acquired full sovereignty from Britain in 1952. The completion of the Aswan High Dam in 1971 and the resultant Lake Nasser have altered the time-honored place of the Nile River in the agriculture and ecology of Egypt. A rapidly growing population (the largest in the Arab world), limited arable land, and dependence on the Nile all continue to overtax resources and stress society. The government has struggled to meet the demands of Egypt''s population through economic reform and massive investment in communications and physical infrastructure.\r\nInspired by the 2010 Tunisian revolution, Egyptian opposition groups led demonstrations and labor strikes countrywide, culminating in President Hosni MUBARAK''s ouster in 2011. Egypt''s military assumed national leadership until a new parliament was in place in early 2012; later that same year, Mohammed MORSI won the presidential election. Following often violent protests throughout the spring of 2013 against MORSI''s government and the Muslim Brotherhood, the Egyptian Armed Forces intervened and removed MORSI from power in July 2013 and replaced him with interim president Adly MANSOUR. In January 2014, voters approved a new constitution by referendum and in May 2014 elected Abdelfattah ELSISI president. Egypt elected a new legislature in December 2015, the first parliament since 2012.', 'Africa', '30 03 N, 31 15 E', '1,001,450 sq km', '97,041,072 (July 2017 est.)', 'Egyptian(s)', 'Egyptian 99.6%, other 0.4% (2006 census)', 'Arabic (official), English and French widely understood by educated classes', 'Muslim (predominantly Sunni) 90%, Christian (majority Coptic Orthodox, other Christians include Armenian Apostolic, Catholic, Maronite, Orthodox, and Anglican) 10% (2015 est.)', 'Arab Republic of Egypt', 'presidential republic', 'Cairo', '27 governorates (muhafazat, singular - muhafazat); Ad Daqahliyah, Al Bahr al Ahmar (Red Sea), Al Buhayrah, Al Fayyum, Al Gharbiyah, Al Iskandariyah (Alexandria), Al Isma''iliyah (Ismailia), Al Jizah (Giza), Al Minufiyah, Al Minya, Al Qahirah (Cairo), Al Qalyubiyah, Al Uqsur (Luxor), Al Wadi al Jadid (New Valley), As Suways (Suez), Ash Sharqiyah, Aswan, Asyut, Bani Suwayf, Bur Sa''id (Port Said), Dumyat (Damietta), Janub Sina'' (South Sinai), Kafr ash Shaykh, Matruh, Qina, Shamal Sina'' (North Sinai), Suhaj', '28 February 1922 (from UK protectorate status; the revolution that began on 23 July 1952 led to a republic being declared on 18 June 1953 and all British troops withdrawn on 18 June 1956); note - it was ca. 3200 B.C. that the Two Lands of Upper (southern) and Lower (northern) Egypt were first united politically', 'Occupying the northeast corner of the African continent, Egypt is bisected by the highly fertile Nile valley, where most economic activity takes place. Egypt''s economy was highly centralized during the rule of former President Gamal Abdel NASSER but opened up considerably under former Presidents Anwar EL-SADAT and Mohamed Hosni MUBARAK.\r\nCairo from 2004 to 2008 pursued business climate reforms to attract foreign investment and facilitate growth. Poor living conditions and limited job opportunities for the average Egyptian contribute to public discontent, a major factor leading to the January 2011 revolution that ousted MUBARAK. The uncertain political, security, and policy environment since 2011 caused economic growth to slow significantly, hurting tourism, manufacturing, and other sectors and pushing up unemployment, which remains above 10%.\r\nWeak growth and limited foreign exchange earnings have made public finances unsustainable, leaving authorities dependent on expensive borrowing for deficit finance and on Gulf allies to help cover the import bill. In 2015-16, higher levels of foreign investment contributed to a slight rebound in GDP growth after a particularly depressed post-revolution period. In 2016, Cairo enacted a value-added tax, implemented fuel and electricity subsidy cuts, and floated its currency, which led to a sharp depreciation of the pound and corresponding inflation. In November 2016, the IMF approved a $12 billion, three-year loan for Egypt and disbursed the first $2.75 billion tranche.', '$332.3 billion (2016 est.)', 'cotton, rice, corn, wheat, beans, fruits, vegetables; cattle, water buffalo, sheep, goats', 'textiles, food processing, tourism, chemicals, pharmaceuticals, hydrocarbons, construction, cement, metals, light manufactures', '28.9 million (2016 est.)', 'crude oil and petroleum products, fruits and vegetables, cotton, textiles, metal products, chemicals, processed food', '171.9 billion kWh (2015 est.)', '494,300 bbl/day (2016 est.)', '471,800 bbl/day (2014 est.)', '3.61 billion cu m (2015 est.)', 'SU (2016)', '83 (2013)', '7 (2013)', 'condensate 486 km; condensate/gas 74 km; gas 7,986 km; liquid petroleum gas 957 km; oil 5,225 km; oil/gas/water 37 km; refined products 895 km; water 65 km (2013)', '5,085 km', '137,430 km', '3,500 km (includes the Nile River, Lake Nasser, Alexandria-Cairo Waterway, and numerous smaller canals in Nile Delta; the Suez Canal (193.5 km including approaches) is navigable by oceangoing vessels drawing up to 17.68 m) (2011)', '2018-02-07 18:03:27', NULL),
(68, 'SV', 'sv', 'El Salvador', 'El Salvador achieved independence from Spain in 1821 and from the Central American Federation in 1839. A 12-year civil war, which cost about 75,000 lives, was brought to a close in 1992 when the government and leftist rebels signed a treaty that provided for military and political reforms. El Salvador is beset by one of the world’s highest homicide rates and pervasive criminal gangs.', 'Central America and the Caribbean', '13 42 N, 89 12 W', '21,041 sq km', '6,172,011 (July 2017 est.)', 'Salvadoran(s)', 'mestizo 86.3%, white 12.7%, Amerindian 0.2% (includes Lenca, Kakawira, Nahua-Pipil), black 0.1%, other 0.6% (2007 est.)', 'Spanish (official), Nawat (among some Amerindians)', 'Roman Catholic 50%, Protestant 36%, other 2%, none 12% (2014 est.)', 'Republic of El Salvador', 'presidential republic', 'San Salvador', '14 departments (departamentos, singular - departamento); Ahuachapan, Cabanas, Chalatenango, Cuscatlan, La Libertad, La Paz, La Union, Morazan, San Miguel, San Salvador, San Vicente, Santa Ana, Sonsonate, Usulutan', '15 September 1821 (from Spain)', 'The smallest country in Central America geographically, El Salvador has the fourth largest economy in the region. With the global recession, real GDP contracted in 2009 and economic growth has since remained low, averaging less than 2% from 2010 to 2014, but recovered somewhat in 2015-16 with an average annual growth rate of 2.4%. Remittances accounted for approximately 17.1% of GDP in 2016 and were received by about a third of all households.\r\nIn 2006, El Salvador was the first country to ratify the Dominican Republic-Central American Free Trade Agreement, which has bolstered the export of processed foods, sugar, and ethanol, and supported investment in the apparel sector amid increased Asian competition. In September 2015, El Salvador kicked off a five-year $277 million second compact with the Millennium Challenge Corporation - a US Government agency aimed at stimulating economic growth and reducing poverty - to improve El Salvador''s competitiveness and productivity in international markets.\r\nThe Salvadoran Government maintained fiscal discipline during post-war reconstruction and rebuilding following earthquakes in 2001 and hurricanes in 1998 and 2005, but El Salvador''s public debt, estimated at 61.1% of GDP in 2016, has been growing over the last several years. Total external debt was nearly 60% of GDP in 2016.', '$26.8 billion (2016 est.)', 'coffee, sugar, corn, rice, beans, oilseed, cotton, sorghum; beef, dairy products', 'food processing, beverages, petroleum, chemicals, fertilizer, textiles, furniture, light metals', '2.76 million (2016 est.)', 'offshore assembly exports, coffee, sugar, textiles and apparel, ethanol, chemicals, electricity, iron and steel manufactures', '5.482 billion kWh (2016 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2016 est.)', 'YS (2016)', '68 (2013)', '2 (2013)', '-', '12.5 km', '6,979 km', '(Rio Lempa River is partially navigable by small craft) (2011)', '2018-02-07 18:03:27', NULL),
(69, 'GQ', 'gq', 'Equatorial Guinea', 'Equatorial Guinea gained independence in 1968 after 190 years of Spanish rule; it is one of the smallest countries in Africa consisting of a mainland territory and five inhabited islands. The capital of Malabo is located on the island of Bioko, approximately 25 km from the Cameroonian coastline in the Gulf of Guinea. Between 1968 and 1979, autocratic President Francisco MACIAS NGUEMA virtually destroyed all of the country''s political, economic, and social institutions before being deposed by his nephew Teodoro OBIANG NGUEMA MBASOGO in a coup. President OBIANG has ruled since October 1979 and was reelected in 2016. Although nominally a constitutional democracy since 1991, presidential and legislative elections since 1996 have generally been labeled as flawed. The president exerts almost total control over the political system and has placed legal and bureaucratic barriers that prevent political opposition. Equatorial Guinea has experienced rapid economic growth due to the discovery of large offshore oil reserves, and in the last decade has become Sub-Saharan Africa''s third largest oil exporter. Despite the country''s economic windfall from oil production, resulting in a massive increase in government revenue in recent years, the drop in global oil prices has placed significant strain on the state budget. Equatorial Guinea continues to seek to diversify its economy and to increase foreign investment despite limited improvements in the population''s living standards. Equatorial Guinea is the host of major regional and international conferences and continues to seek a greater role in regional affairs.', 'Africa', '2 00 N, 10 00 E', '28,051 sq km', '778,358 (July 2017 est.)', 'Equatorial Guinean(s) or Equatoguinean(s)', 'Fang 85.7%, Bubi 6.5%, Mdowe 3.6%, Annobon 1.6%, Bujeba 1.1%, other 1.4% (1994 census)', 'Spanish (official) 67.6%, other (includes French (official), Fang, Bubi) 32.4% (1994 census)', 'nominally Christian and predominantly Roman Catholic, pagan practices', 'Republic of Equatorial Guinea', 'presidential republic', 'Malabo; note - a new capital of Oyala is being bui', '7 provinces (provincias, singular - provincia); Annobon, Bioko Norte, Bioko Sur, Centro Sur, Kie-Ntem, Litoral, Wele-Nzas', '12 October 1968 (from Spain)', 'Exploitation of oil and gas deposits, beginning in the 1990s, has driven economic growth in Equatorial Guinea; a recent rebasing of GDP resulted in an upward revision of the size of the economy by approximately 30%. Forestry and farming are minor components of GDP. Although preindependence Equatorial Guinea counted on cocoa production for hard currency earnings, the neglect of the rural economy since independence has diminished the potential for agriculture-led growth. Subsistence farming is the dominant form of livelihood. Declining revenue from hydrocarbon production, high levels of infrastructure expenditures, lack of economic diversification, and corruption have pushed the economy into decline in recent years and limited improvements in the general population’s living conditions. Equatorial Guinea’s real GDP growth has been weak in recent years, averaging -0.5% per year from 2010 to 2014, because of a declining hydrocarbon sector. Inflation remained very low in 2016, down from an average of 4% in 2014.\r\nForeign assistance programs by the World Bank and the IMF have been cut since 1993 because of corruption and mismanagement, and as a middle income country Equatorial Guinea is now ineligible for most low-income donor funding. The government has been widely criticized for its lack of transparency and misuse of oil revenues and has attempted to address this issue by working toward compliance with the Extractive Industries Transparency Initiative. US foreign assistance to Equatorial Guinea is limited in part because of US restrictions pursuant to the Trafficking Victims Protection Act.\r\nEquatorial Guinea hosted two economic diversification symposia in 2014 that focused on attracting investment in five sectors: agriculture and animal ranching, fishing, mining and petrochemicals, tourism, and financial services. Undeveloped mineral resources include gold, zinc, diamonds, columbite-tantalite, and other base metals.', '$10.18 billion (2016 est.)', 'coffee, cocoa, rice, yams, cassava (manioc, tapioca), bananas, palm oil nuts; livestock; timber', 'petroleum, natural gas, sawmilling', '195,200 (2007 est.)', 'petroleum products, timber', '425 million kWh (2015 est.)', '227,000 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '6.2 billion cu m (2015 est.)', '3C (2016)', '7 (2013)', '-', 'condensate 42 km; condensate/gas 5 km; gas 79 km; oil 71 km (2013)', '-', '2,880 km (2000)', '-', '2018-02-07 18:03:27', NULL),
(70, 'ER', 'er', 'Eritrea', 'After independence from Italian colonial control in 1941 and 10 years of British administrative control, the UN established Eritrea as an autonomous region within the Ethiopian federation in 1952. Ethiopia''s full annexation of Eritrea as a province 10 years later sparked a violent 30-year struggle for independence that ended in 1991 with Eritrean rebels defeating government forces. Eritreans overwhelmingly approved independence in a 1993 referendum. ISAIAS Afworki has been Eritrea''s only president since independence; his rule, particularly since 2001, has been highly autocratic and repressive. His government has created a highly militarized society by pursuing an unpopular program of mandatory conscription into national service, sometimes of indefinite length. A two-and-a-half-year border war with Ethiopia that erupted in 1998 ended under UN auspices in December 2000. A UN peacekeeping operation was established that monitored a 25 km-wide Temporary Security Zone. The Eritrea-Ethiopia Boundary Commission (EEBC) created in April 2003 was tasked "to delimit and demarcate the colonial treaty border based on pertinent colonial treaties (1900, 1902, and 1908) and applicable international law." The EEBC on 30 November 2007 remotely demarcated the border, assigning the town of Badme to Eritrea, despite Ethiopia''s maintaining forces there from the time of the 1998-2000 war. Eritrea insisted that the UN terminate its peacekeeping mission on 31 July 2008. Eritrea has accepted the EEBC''s "virtual demarcation" decision and repeatedly called on Ethiopia to remove its troops. Ethiopia has not accepted the demarcation decision, and neither party has entered into meaningful dialogue to resolve the impasse. Eritrea is subject to several UN Security Council Resolutions (initially in 2009 and renewed annually) imposing an arms embargo and a travel ban and assets freeze on certain individuals, in view of evidence that it has supported armed opposition groups in the region.', 'Africa', '15 00 N, 39 00 E', '117,600 sq km', '5,918,919 (July 2017 est.)', 'Eritrean(s)', 'nine recognized ethnic groups: Tigrinya 55%, Tigre 30%, Saho 4%, Kunama 2%, Rashaida 2%, Bilen 2%, other (Afar, Beni Amir, Nera) 5% (2010 est.)', 'Tigrinya (official), Arabic (official), English (official), Tigre, Kunama, Afar, other Cushitic languages', 'Muslim, Coptic Christian, Roman Catholic, Protestant', 'State of Eritrea', 'presidential republic', 'Asmara (Asmera)', '6 regions (zobatat, singular - zoba); Anseba, Debub (South), Debubawi K''eyih Bahri (Southern Red Sea), Gash Barka, Ma''akel (Central), Semenawi Keyih Bahri (Northern Red Sea)', '24 May 1993 (from Ethiopia)', 'Since formal independence from Ethiopia in 1993, Eritrea has faced many economic problems, including lack of financial resources and chronic drought, which have been exacerbated by restrictive economic policies. Eritrea has a command economy under the control of the sole political party, the People''s Front for Democracy and Justice. Like the economies of many African nations, a large share of the population - nearly 80% in Eritrea - is engaged in subsistence agriculture, but the sector only produces a small share of the country''s total output.\r\nSince the conclusion of the Ethiopia-Eritrea war in 2000, the government has expanded military- and party-owned businesses to complete President ISAIAS''s development agenda. The government has strictly controlled the use of foreign currency by limiting access and availability; new regulations in 2013 aimed at relaxing currency controls have had little economic effect. Few large private enterprises exist in Eritrea and most operate in conjunction with government partners, including a number of large international mining ventures, which began production in 2013. In late 2015, the Government of Eritrea introduced a new currency, retaining the name nakfa, and restricted the amount of hard currency individuals could withdraw from banks per month. The changeover has resulted in exchange fluctuations and the scarcity of hard currency available in the market.\r\nWhile reliable statistics on Eritrea are difficult to obtain, erratic rainfall and the percentage of the labor force tied up in national service continue to interfere with agricultural production and economic development. Eritrea''s harvests generally cannot meet the food needs of the country without supplemental grain purchases. Copper, potash, and gold production are likely to continue to drive economic growth and government revenue over the next few years, but military spending will continue to compete with development and investment plans.', '$5.352 billion (2016 est.)', 'sorghum, lentils, vegetables, corn, cotton, tobacco, sisal; livestock, goats; fish', 'food processing, beverages, clothing and textiles, light manufacturing, salt, cement', '2.623 million (2016 est.)', 'gold and other minerals, livestock, sorghum, textiles, food, small industry manufactures', '383.8 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'E3 (2016)', '13 (2013)', '1 (2013)', '-', '306 km', '4,010 km', '-', '2018-02-07 18:03:28', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(71, 'EE', 'ee', 'Estonia', 'After centuries of Danish, Swedish, German, and Russian rule, Estonia attained independence in 1918. Forcibly incorporated into the USSR in 1940 - an action never recognized by the US and many other countries - it regained its freedom in 1991 with the collapse of the Soviet Union. Since the last Russian troops left in 1994, Estonia has been free to promote economic and political ties with the West. It joined both NATO and the EU in the spring of 2004, formally joined the OECD in late 2010, and adopted the euro as its official currency on 1 January 2011.', 'Europe', '59 00 N, 26 00 E', '45,228 sq km', '1,251,581 (July 2017 est.)', 'Estonian(s)', 'Estonian 68.7%, Russian 24.8%, Ukrainian 1.7%, Belarusian 1%, Finn 0.6%, other 1.6%, unspecified 1.6% (2011 est.)', 'Estonian (official) 68.5%, Russian 29.6%, Ukrainian 0.6%, other 1.2%, unspecified 0.1% (2011 est.)', 'Lutheran 9.9%, Orthodox 16.2%, other Christian (including Methodist, Seventh-Day Adventist, Roman Catholic, Pentecostal) 2.2%, other 0.9%, none 54.1%, unspecified 16.7% (2011 est.)', 'Republic of Estonia', 'parliamentary republic', 'Tallinn', '15 counties (maakonnad, singular - maakond); Harjumaa (Tallinn), Hiiumaa (Kardla), Ida-Virumaa (Johvi), Jarvamaa (Paide), Jogevamaa (Jogeva), Laanemaa (Haapsalu), Laane-Virumaa (Rakvere), Parnumaa (Parnu), Polvamaa (Polva), Raplamaa (Rapla), Saaremaa (Kuressaare), Tartumaa (Tartu), Valgamaa (Valga), Viljandimaa (Viljandi), Vorumaa (Voru)', '20 August 1991 (declared); 6 September 1991 (recognized by the Soviet Union)', 'Estonia, a member of the EU since 2004 and the euro zone since 2011, has a modern market-based economy and one of the higher per capita income levels in Central Europe and the Baltic region, but its economy is highly dependent on trade, leaving it vulnerable to external shocks. Estonia''s successive governments have pursued a free market, pro-business economic agenda, and sound fiscal policies that have resulted in balanced budgets and low public debt.\r\nThe economy benefits from strong electronics and telecommunications sectors and strong trade ties with Finland, Sweden, Germany, and Russia. After two years of robust recovery in 2011 and 2012, the Estonian economy faltered in 2013 with only 1.6% GDP growth, mainly due to a continuing recession in much of the EU. GDP growth in 2014 picked up to 2.9% but dropped below 2% in 2015-16 due to lower demand in key Scandinavian and Russian export markets. In 2016, the government implemented modest increases in fiscal spending, which may contribute to GDP growth in 2017.\r\nEstonia is challenged by a shortage of labor, both skilled and unskilled, although the government has amended its immigration law to allow easier hiring of highly qualified foreign workers.', '$23.33 billion (2016 est.)', 'grain, potatoes, vegetables; livestock and dairy products; fish', 'food, engineering, electronics, wood and wood products, textiles; information technology, telecommunications', '691,400 (2016 est.)', 'machinery and electrical equipment 30%, food products and beverages 9%, mineral fuels 6%, wood and wood products 14%, articles of base metals 7%, furniture and bedding 11%, vehicles and parts 3%, chemicals 4% (2016 est.)', '9.779 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2016 est.)', '0 cu m (2015 est.)', 'ES (2016)', '18 (2013)', '1 (2012)', 'gas 2,360 km (2016)', '2,146 km', '58,412 km (includes urban roads)', '335 km (320 km are navigable year-round) (2011)', '2018-02-07 18:03:28', NULL),
(72, 'ET', 'et', 'Ethiopia', 'Unique among African countries, the ancient Ethiopian monarchy maintained its freedom from colonial rule with the exception of a short-lived Italian occupation from 1936-41. In 1974, a military junta, the Derg, deposed Emperor Haile SELASSIE (who had ruled since 1930) and established a socialist state. Torn by bloody coups, uprisings, wide-scale drought, and massive refugee problems, the regime was finally toppled in 1991 by a coalition of rebel forces, the Ethiopian People''s Revolutionary Democratic Front. A constitution was adopted in 1994, and Ethiopia''s first multiparty elections were held in 1995. A border war with Eritrea in the late 1990s ended with a peace treaty in December 2000. In November 2007, the Eritrea-Ethiopia Border Commission (EEBC) issued specific coordinates as virtually demarcating the border and pronounced its work finished. Alleging that the EEBC acted beyond its mandate in issuing the coordinates, Ethiopia has not accepted them and has not withdrawn troops from previously contested areas pronounced by the EEBC as belonging to Eritrea. In August 2012, longtime leader Prime Minister MELES Zenawi died in office and was replaced by his Deputy Prime Minister HAILEMARIAM Desalegn, marking the first peaceful transition of power in decades.', 'Africa', '8 00 N, 38 00 E', '1,104,300 sq km', '105,350,020', 'Ethiopian(s)', 'Oromo 34.4%, Amhara (Amara) 27%, Somali (Somalie) 6.2%, Tigray (Tigrinya) 6.1%, Sidama 4%, Gurage 2.5%, Welaita 2.3%, Hadiya 1.7%, Afar (Affar) 1.7%, Gamo 1.5%, Gedeo 1.3%, Silte 1.3%, Kefficho 1.2%, other 8.8% (2007 est.)', 'Oromo (official working language in the State of Oromiya) 33.8%, Amharic (official national language) 29.3%, Somali (official working language of the State of Sumale) 6.2%, Tigrigna (Tigrinya) (official working language of the State of Tigray) 5.9%, Sidamo 4%, Wolaytta 2.2%, Gurage 2%, Afar (official working language of the State of Afar) 1.7%, Hadiyya 1.7%, Gamo 1.5%, Gedeo 1.3%, Opuuo 1.2%, Kafa 1.1%, other 8.1%, English (major foreign language taught in schools), Arabic (2007 est.)', 'Ethiopian Orthodox 43.5%, Muslim 33.9%, Protestant 18.5%, traditional 2.7%, Catholic 0.7%, other 0.6% (2007 est.)', 'Federal Democratic Republic of Ethiopia', 'federal parliamentary republic', 'Addis Ababa', '9 ethnically based states (kililoch, singular - kilil) and 2 self-governing administrations* (astedaderoch, singular - astedader); Adis Abeba* (Addis Ababa), Afar, Amara (Amhara), Binshangul Gumuz, Dire Dawa*, Gambela Hizboch (Gambela Peoples), Hareri Hizb (Harari People), Oromiya (Oromia), Sumale (Somali), Tigray, Ye Debub Biheroch Bihereseboch na Hizboch (Southern Nations, Nationalities and Peoples)', 'oldest independent country in Africa and one of the oldest in the world - at least 2,000 years (may be traced to the Aksumite Kingdom, which coalesced in the first century B.C.)', 'Ethiopia - the second most populous country in Africa - is a one-party state with a planned economy. For more than a decade before 2016, Ethiopia grew at a rate between 8% and 11% annually – one of the fastest growing states among the 188 IMF member countries. This growth was driven by government investment in infrastructure, as well as sustained progress in the agricultural and service sectors. More than 70% of Ethiopia’s population is still employed in the agricultural sector, but services have surpassed agriculture as the principal source of GDP.\r\nEthiopia has the lowest level of income-inequality in Africa and one of the lowest in the world, with a Gini coefficient comparable to that of the Scandinavian countries. Yet despite progress toward eliminating extreme poverty, Ethiopia remains one of the poorest countries in the world, due both to rapid population growth and a low starting base. Changes in rainfall associated with world-wide weather patterns resulted in the worst drought in 30 years in 2015-16, creating food insecurity for millions of Ethiopians.\r\nThe state is heavily engaged in the economy. Ongoing infrastructure projects include power production and distribution, roads, rails, airports and industrial parks. Key sectors are state-owned, including telecommunications, banking and insurance, and power distribution. Under Ethiopia''s constitution, the state owns all land and provides long-term leases to tenants. Title rights in urban areas, particularly Addis Ababa, are poorly regulated, and subject to corruption.\r\nEthiopia’s foreign exchange earnings are led by the services sector - primarily the state-run Ethiopian Airlines - followed by exports of several commodities. While coffee remains the largest foreign exchange earner, Ethiopia is diversifying exports, and commodities such as gold, sesame, khat, livestock and horticulture products are becoming increasingly important. Manufacturing represented less than 8% of total exports in 2016, but manufacturing exports should increase in future years due to a growing international presence.\r\nThe banking, insurance, telecommunications, and micro-credit industries are restricted to domestic investors, but Ethiopia has attracted roughly $8.5 billion in foreign direct investment, mostly from China, Turkey, India and the EU; US FDI is $567 million. Investment has been primarily in infrastructure, construction, agriculture/horticulture, agricultural processing, textiles, leather and leather products.\r\nIn the fall of 2015, the government finalized and published the current 2016-20 five-year plan, known as the Growth and Transformation Plan II, which emphasizes developing manufacturing in sectors where Ethiopia has a comparative advantage, such as textiles and garments, leather goods, and processed agricultural products. To support industrialization, Ethiopia plans to increase installed power generation capacity by 8,320 MW, up from a capacity of 2,000 MW, by building three more major dams and expanding to other sources of renewable energy.', '$72.52 billion (2016 est.)', 'cereals, coffee, oilseed, cotton, sugarcane, vegetables, khat, cut flowers; hides, cattle, sheep, goats; fish', 'food processing, beverages, textiles, leather, garments, chemicals, metals processing, cement', '51.05 million (2016 est.)', 'coffee (27%, by value), oilseeds (17%), edible vegetables including khat (17%), gold (13%), flowers (7%), live animals (7%), raw leather products (3%), meat products (3%)', '10.08 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'ET (2016)', '57 (2013)', '-', '-', '659 km (Ethiopian segment of the 756 km Addis Ababa-Djibouti railroad)', '110,414 km', '-', '2018-02-07 18:03:28', NULL),
(73, 'FK', 'fk', 'Falkland Islands', 'Although first sighted by an English navigator in 1592, the first landing (English) did not occur until almost a century later in 1690, and the first settlement (French) was not established until 1764. The colony was turned over to Spain two years later and the islands have since been the subject of a territorial dispute, first between Britain and Spain, then between Britain and Argentina. The UK asserted its claim to the islands by establishing a naval garrison there in 1833. Argentina invaded the islands on 2 April 1982. The British responded with an expeditionary force that landed seven weeks later and after fierce fighting forced an Argentine surrender on 14 June 1982. With hostilities ended and Argentine forces withdrawn, UK administration resumed. In response to renewed calls from Argentina for Britain to relinquish control of the islands, a referendum was held in March 2013, which resulted in 99.8% of the population voting to remain a part of the UK.', 'South America', '51 45 S, 59 00 W', '12,173 sq km', '3,198', 'Falkland Islander(s)', 'Falkland Islander 48.3%, British 23.1%, St. Helenian 7.5%, Chilean 4.6%, mixed 6%, other 8.5%, unspecified 2% (2016 est.)', 'English 89%, Spanish 7.7%, other 3.3% (2006 est.)', 'Christian 57.1%, other 1.6%, none 35.4%, unspecified 6% (2016 est.)', 'none', 'parliamentary democracy (Legislative Assembly); self-governing overseas territory of the UK', 'Stanley', 'none (overseas territory of the UK; also claimed by Argentina)', 'none (overseas territory of the UK; also claimed by Argentina)', 'The economy was formerly based on agriculture, mainly sheep farming, but fishing and tourism currently comprise the bulk of economic activity. In 1987, the government began selling fishing licenses to foreign trawlers operating within the Falkland Islands'' exclusive fishing zone. These license fees net more than $40 million per year, which help support the island''s health, education, and welfare system. The waters around the Falkland Islands are known for their squid, which account for around 75% of the annual 200,000-ton catch.\r\nDairy farming supports domestic consumption; crops furnish winter fodder. Foreign exchange earnings come from shipments of high-grade wool to the UK and from the sale of postage stamps and coins. In 2001, the government purchased 100 reindeer with the intent to increase the number to 10,000 over the following 20 years so that venison could be exported to Scandinavia and Chile.\r\nTourism, especially ecotourism, is increasing rapidly, with about 69,000 visitors in 2009. The British military presence also provides a sizable economic boost. The islands are now self-financing except for defense.\r\nIn 1993, the British Geological Survey announced a 200-mile oil exploration zone around the islands, and early seismic surveys suggest substantial reserves capable of producing 500,000 barrels per day. Political tensions between the UK and Argentina remain high following the start of oil drilling activities in the waters. Although production by a British exploration firm has yet to begin, the firm expects to be able to produce 60,000 barrels per day by 2020.', '$164.5 million (2007 est.)', 'fodder and vegetable crops; venison, sheep, dairy products; fish, squid', 'fish and wool processing; tourism', '1,944 (2012 est.)', 'wool, hides, meat, venison, fish, squid', '17 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'VP-F (2016)', '7 (2013)', '-', '-', '-', '440 km', '-', '2018-02-07 18:03:28', NULL),
(74, 'FO', 'fo', 'Faroe Islands', 'The population of the Faroe Islands is largely descended from Viking settlers who arrived in the 9th century. The islands have been connected politically to Denmark since the 14th century. A high degree of self-government was granted the Faroese in 1948, who have autonomy over most internal affairs while Denmark is responsible for justice, defense, and foreign affairs. The Faroe Islands are not part of the European Union.', 'Europe', '62 00 N, 7 00 W', '1,393 sq km', '50,730 (July 2017 est.)', 'Faroese (singular and plural)', 'Faroese 88% (Scandinavian and Anglo-Saxon descent), Danish 7.6%, other 4.4% (includes Icelandic, Norwegian, Greenlandic, Filipino, Thai, British)', 'Faroese 93.8% (derived from Old Norse), Danish 3.2%, other 3% (2011 est.)', 'Christian 89.3% (predominantly Evangelical Lutheran), other 0.7%, more than one religion 0.2%, none 3.8%, unspecified 6% (2011 est.)', 'none', 'parliamentary democracy (Faroese Parliament); part of the Kingdom of Denmark', 'Torshavn', 'none (part of the Kingdom of Denmark; self-governing overseas administrative division of Denmark); there are no first-order administrative divisions as defined by the US Government, but there are 30 municipalities', 'none (part of the Kingdom of Denmark; self-governing overseas administrative division of Denmark)', 'The Faroese economy has experienced a period of significant growth since 2011, due to higher fish prices and increased salmon farming and catches in the pelagic fisheries. Nominal GDP, measured in current prices, grew 8.0% in 2015 and 7.8% in 2016. The fisheries sector accounts for about 97% of exports and half of GDP. Dependence on fishing makes the economy vulnerable to price fluctuations. Unemployment is low, estimated at 2.5% in early 2017. Aided by an annual subsidy from Denmark, which amounts to about 4% of Faroese GDP, Faroese have a standard of living equal to that of Denmark.\r\nFor the first time in 8 years, the Faroe Islands managed to generate a public budget surplus in 2016, a trend which is continuing in 2017. The local government intends to use this to reduce public debt, which reached 38% of GDP in 2015. Increasing public infrastructure investments are likely to lead to continued growth in the short term, but could contribute to overheating the economy. Signs of overheating led the Danish Central Bank in fall of 2016 to advise the Faroese local government to initiate measures to cool the economy, including postponing spending on infrastructure spending. The local government is planning to allocate part of the expected public surplus to a business-cycle-equalization fund.', '$2.765 billion (2010 est.) ', 'milk, potatoes, vegetables, sheep, salmon, herring, mackerel and other fish', 'fishing, fish processing, tourism, small ship repair and refurbishment, handicrafts', '28,900 (2015 est.)', 'fish and fish products (97%) (2017 est.)', '317.4 million kWh (2016 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2016 est.)', '0 cu m (2016 est.)', 'OY-H (2016)', '1 (2013)', '-', '-', '-', '960 km', '-', '2018-02-07 18:03:28', NULL),
(75, 'FJ', 'fj', 'Fiji', 'Fiji became independent in 1970 after nearly a century as a British colony. Democratic rule was interrupted by two military coups in 1987 caused by concern over a government perceived as dominated by the Indian community (descendants of contract laborers brought to the islands by the British in the 19th century). The coups and a 1990 constitution that cemented native Melanesian control of Fiji led to heavy Indian emigration; the population loss resulted in economic difficulties, but ensured that Melanesians became the majority. A new constitution enacted in 1997 was more equitable. Free and peaceful elections in 1999 resulted in a government led by an Indo-Fijian, but a civilian-led coup in 2000 ushered in a prolonged period of political turmoil. Parliamentary elections held in 2001 provided Fiji with a democratically elected government led by Prime Minister Laisenia QARASE. Reelected in May 2006, QARASE was ousted in a December 2006 military coup led by Commodore Voreqe BAINIMARAMA, who initially appointed himself acting president but in January 2007 became interim prime minister. Following years of political turmoil, long-delayed legislative elections were held in September 2014 that were deemed "credible" by international observers and that resulted in BAINIMARAMA being reelected.', 'Oceania', '18 00 S, 175 00 E', '18,274 sq km', '920,938 (July 2017 est.)', 'Fijian(s)', 'iTaukei 56.8% (predominantly Melanesian with a Polynesian admixture), Indian 37.5%, Rotuman 1.2%, other 4.5% (European, part European, other Pacific Islanders, Chinese)', 'English (official), Fijian (official), Hindustani', 'Protestant 45% (Methodist 34.6%, Assembly of God 5.7%, Seventh Day Adventist 3.9%, and Anglican 0.8%), Hindu 27.9%, other Christian 10.4%, Roman Catholic 9.1%, Muslim 6.3%, Sikh 0.3%, other 0.3%, none 0.8% (2007 est.)', 'Republic of Fiji', 'parliamentary republic', 'Suva (on Viti Levu)', '14 provinces and 1 dependency*; Ba, Bua, Cakaudrove, Kadavu, Lau, Lomaiviti, Macuata, Nadroga and Navosa, Naitasiri, Namosi, Ra, Rewa, Rotuma*, Serua, Tailevu', '10 October 1970 (from the UK)', 'Fiji, endowed with forest, mineral, and fish resources, is one of the most developed and connected of the Pacific island economies. Earnings from the tourism industry, with an estimated 792,300 tourists visiting in 2016, and remittances from Fijian’s working abroad are the country’s largest foreign exchange earners.\r\nFiji''s sugar sector remains a significant industry and a major export, but crops and one of the sugar mills suffered damage during Cyclone Winston in 2016. The sector also faces the complete withdrawal of European Union preferential prices in 2017. Fiji’s trade imbalance continues to widen with increased imports and sluggish performance of domestic exports.\r\nThe return to parliamentary democracy and successful elections in September 2014 improved investor confidence, but increasing bureaucratic regulation, new taxes and lack of consultation with relevant stakeholders brought four consecutive years of decline for Fiji on the World Bank Ease of Doing Business index. Private sector investment in 2016 exceeded 20% of GDP, compared to 13% in 2013.', '$4.679 billion (2016 est.)', 'sugarcane, coconuts, cassava (manioc, tapioca), rice, sweet potatoes, bananas; cattle, pigs, horses, goats; fish', 'tourism, sugar processing, clothing, copra, gold, silver, lumber, small cottage industries', '351,300 (2016 est.)', 'sugar, garments, gold, timber, fish, molasses, coconut oil, mineral water', '890 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'DQ (2016)', '28 (2013)', '-', '-', '597 km', '3,440 km', '203 km (122 km are navigable by motorized craft and 200-metric-ton barges) (2012)', '2018-02-07 18:03:28', NULL),
(76, 'FI', 'fi', 'Finland', 'Finland was a province and then a grand duchy under Sweden from the 12th to the 19th centuries, and an autonomous grand duchy of Russia after 1809. It gained complete independence in 1917. During World War II, Finland successfully defended its independence through cooperation with Germany and resisted subsequent invasions by the Soviet Union - albeit with some loss of territory. In the subsequent half century, Finland transformed from a farm/forest economy to a diversified modern industrial economy; per capita income is among the highest in Western Europe. A member of the EU since 1995, Finland was the only Nordic state to join the euro single currency at its initiation in January 1999. In the 21st century, the key features of Finland''s modern welfare state are high quality education, promotion of equality, and a national social welfare system - currently challenged by an aging population and the fluctuations of an export-driven economy.', 'Europe', '64 00 N, 26 00 E', '338,145 sq km', '5,518,371 (July 2017 est.)', 'Finn(s)', 'Finn 93.4%, Swede 5.6%, Russian 0.5%, Estonian 0.3%, Romani 0.1%, Sami 0.1% (2006)', 'Finnish (official) 88.3%, Swedish (official) 5.3%, Russian 1.4%, other 5% (2016 est.)', 'Lutheran 72%, Orthodox 1.1%, other 1.6%, unspecified 25.3% (2016 est.)', 'Republic of Finland', 'parliamentary republic', 'Helsinki', '19 regions (maakunnat, singular - maakunta (Finnish); landskapen, singular - landskapet (Swedish)); Aland (Swedish), Ahvenanmaa (Finnish); Etela-Karjala (Finnish), Sodra Karelen (Swedish) [South Karelia]; Etela-Pohjanmaa (Finnish), Sodra Osterbotten (Swedish) [South Ostrobothnia]; Etela-Savo (Finnish), Sodra Savolax (Swedish) [South Savo]; Kanta-Hame (Finnish), Egentliga Tavastland (Swedish); Kainuu (Finnish), Kajanaland (Swedish); Keski-Pohjanmaa (Finnish), Mellersta Osterbotten (Swedish) [Central Ostrobothnia]; Keski-Suomi (Finnish), Mellersta Finland (Swedish) [Central Finland]; Kymenlaakso (Finnish), Kymmenedalen (Swedish); Lappi (Finnish), Lappland (Swedish); Paijat-Hame (Finnish), Paijanne-Tavastland (Swedish); Pirkanmaa (Finnish), Birkaland (Swedish) [Tampere]; Pohjanmaa (Finnish), Osterbotten (Swedish) [Ostrobothnia]; Pohjois-Karjala (Finnish), Norra Karelen (Swedish) [North Karelia]; Pohjois-Pohjanmaa (Finnish), Norra Osterbotten (Swedish) [North Ostrobothnia]; Pohjois-Savo (Finnish), Norra Savolax (Swedish) [North Savo]; Satakunta (Finnish and Swedish); Uusimaa (Finnish), Nyland (Swedish) [Newland]; Varsinais-Suomi (Finnish), Egentliga Finland (Swedish) [Southwest Finland]', '6 December 1917 (from Russia)', 'Finland has a highly industrialized, largely free-market economy with per capita GDP almost as high as that of Austria and the Netherlands and slightly above that of Germany and Belgium. Trade is important, with exports accounting for over one-third of GDP in recent years. The government is open to, and actively takes steps to attract, foreign direct investment.\r\nFinland is historically competitive in manufacturing - principally the wood, metals, engineering, telecommunications, and electronics industries. Finland excels in export of technology as well as promotion of startups in the information and communications technology, gaming, cleantech, and biotechnology sectors. Except for timber and several minerals, Finland depends on imports of raw materials, energy, and some components for manufactured goods. Because of the cold climate, agricultural development is limited to maintaining self-sufficiency in basic products. Forestry, an important export industry, provides a secondary occupation for the rural population.\r\nFinland had been one of the best performing economies within the EU before 2009 and its banks and financial markets avoided the worst of global financial crisis. However, the world slowdown hit exports and domestic demand hard in that year, causing Finland’s economy to contract from 2012 to 2014. The recession affected general government finances and the debt ratio. The economy returned to growth in 2015, posting a 0.3% GDP increase before growing 1.4% in 2016.\r\nFinland''s main challenges will be reducing high labor costs and boosting demand for its exports. In June 2016, the government enacted a Competitiveness Pact aimed at reducing labor costs, increasing hours worked, and introducing more flexibility into the wage bargaining system. The Government was also seeking to reform the health care system and social services. In the long term, Finland must address a rapidly aging population and decreasing productivity in traditional industries that threaten competitiveness, fiscal sustainability, and economic growth.', '$238.6 billion (2016 est.)', 'barley, wheat, sugar beets, potatoes; dairy cattle; fish', 'metals and metal products, electronics, machinery and scientific instruments, shipbuilding, pulp and paper, foodstuffs, chemicals, textiles, clothing', '2.685 million (2016 est.)', 'electrical and optical equipment, machinery, transport equipment, paper and pulp, chemicals, basic metals; timber', '65.17 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '303,600 bbl/day (2016 est.)', '8 million cu m (2015 est.)', 'OH (2016)', '148 (2013)', '-', 'gas transmission pipes 1,286 km; distribution pipes 1,932 km (2016)', '5,923 km', '454,000 km', '8,000 km (includes Saimaa Canal system of 3,577 km; southern part leased from Russia; water transport used frequently in the summer and widely replaced with sledges on the ice in winter; there are 187,888 lakes in Finland that cover 31,500 km); Finland also maintains 8,200 km of coastal fairways (2013)', '2018-02-07 18:03:28', NULL),
(77, 'FR', 'fr', 'France', 'France today is one of the most modern countries in the world and is a leader among European nations. It plays an influential global role as a permanent member of the United Nations Security Council, NATO, the G-7, the G-20, the EU, and other multilateral organizations. France rejoined NATO''s integrated military command structure in 2009, reversing DE GAULLE''s 1966 decision to withdraw French forces from NATO. Since 1958, it has constructed a hybrid presidential-parliamentary governing system resistant to the instabilities experienced in earlier, more purely parliamentary administrations. In recent decades, its reconciliation and cooperation with Germany have proved central to the economic integration of Europe, including the introduction of a common currency, the euro, in January 1999. In the early 21st century, five French overseas entities - French Guiana, Guadeloupe, Martinique, Mayotte, and Reunion - became French regions and were made part of France proper.', 'metropolitan France: Europe\r\nFrench Guiana: South America\r\nGuadeloupe: Central America and the Caribbean\r\nMartinique: Central America and the Caribbean\r\nMayotte: Africa\r\nReunion: World', 'metropolitan France: 46 00 N, 2 00 E\r\nFrench Guiana: 4 00 N, 53 00 W\r\nGuadeloupe: 16 15 N, 61 35 W\r\nMartinique: 14 40 N, 61 00 W\r\nMayotte: 12 50 S, 45 10 E\r\nReunion: 21 06 S, 55 36 E', '643,801 sq km; 551,500 sq km (metropolitan France)', '67,106,161\r\nnote: the above figure is for metropolitan France and five overseas regions; the metropolitan France population is 62,814,233 (July 2017 est.)', 'Frenchman(men), Frenchwoman(women)', 'Celtic and Latin with Teutonic, Slavic, North African, Indochinese, Basque minorities\r\noverseas departments: black, white, mulatto, East Indian, Chinese, Amerindian', 'French (official) 100%, declining regional dialects and languages (Provencal, Breton, Alsatian, Corsican, Catalan, Basque, Flemish, Occitan, Picard)', 'Christian (overwhelmingly Roman Catholic) 63-66%, Muslim 7-9%, Buddhist 0.5-0.75%, Jewish 0.5-0.75%, other 0.5-1.0%, none 23-28%\r\nnote: France maintains a tradition of secularism and has not officially collected data on religious affiliation since the 1872 national census, which complicates assessments of France''s religious composition; an 1872 law prohibiting state authorities from collecting data on individuals'' ethnicity or religious beliefs was reaffirmed by a 1978 law emphasizing the prohibition of the collection or exploitation of personal data revealing an individual''s race, ethnicity, or political, philosophical, or religious opinions; a 1905 law codified France''s separation of church and state (2015 est.)', 'French Republic', 'semi-presidential republic', 'Paris', '18 regions (regions, singular - region); Auvergne-Rhone-Alpes, Bourgogne-Franche-Comte (Burgundy-Free County), Bretagne (Brittany), Centre-Val de Loire (Center-Loire Valley), Corse (Corsica), Grand Est (Grand East), Guadeloupe, Guyane (French Guiana), Hauts-de-France (Upper France), Ile-de-France, Martinique, Mayotte, Normandie (Normandy), Nouvelle-Aquitaine (New Aquitaine), Occitanie (Occitania), Pays de la Loire (Lands of the Loire), Provence-Alpes-Cote d''Azur, Reunion\r\nnote: France is divided into 13 metropolitan regions (including the "territorial collectivity" of Corse or Corsica) and 5 overseas regions (French Guiana, Guadeloupe, Martinique, Mayotte, and Reunion) and is subdivided into 96 metropolitan departments and 5 overseas departments (which are the same as the overseas regions)', 'no official date of independence: 486 (Frankish tribes unified under Merovingian kingship); 10 August 843 (Western Francia established from the division of the Carolingian Empire); 14 July 1789 (French monarchy overthrown); 22 September 1792 (First French Republic founded); 4 October 1958 (Fifth French Republic established)', 'The French economy is diversified across all sectors. The government has partially or fully privatized many large companies, including Air France, France Telecom, Renault, and Thales. However, the government maintains a strong presence in some sectors, particularly power, public transport, and defense industries. Despite terrorist attacks, labor strikes, and bad weather, France is still the most visited country in the world with 83 million foreign tourists in 2016, including 530,000 who came for the 2016 Euro Cup. France''s leaders remain committed to a capitalism in which they maintain social equity by means of laws, tax policies, and social spending that mitigate economic inequality.\r\nFrance''s real GDP grew by 1.1% in 2016, down from 1.3% the year before. The unemployment rate (including overseas territories) increased from 7.8% in 2008 to 10.2% in 2015, before slightly falling to 10% in 2016. Youth unemployment in metropolitan France decreased from 24.6% in the fourth quarter of 2014 to 24% in the fourth quarter of 2016.\r\nLower-than-expected growth and high spending have strained France''s public finances. Despite measures to restore public finances since President Francois HOLLANDE took office in 2012, the budget deficit rose from 3.3% of GDP in 2008 to 7.5% of GDP in 2009 before improving to 3.4% of GDP in 2016. Meanwhile, France''s public debt rose from 89.5% of GDP in 2012 to 96% in 2016.\r\nPresident HOLLANDE’s policies aimed to enhance French industry’s competitiveness and to lower high jobless figures. The Competitiveness and Employment Tax Credit of 2012, the Responsibility and Solidarity Pact of 2014, the Investment Stimulus Plan, and the Emergency Jobs Plan represent more than $42.6 billion in support for businesses in 2017 by lowering French labor costs, but so far the results of these policies have been marginal on France’s competitiveness and job creation. In an effort to bolster social justice, the 2017 budget bill contained provisions to reduce income taxes for households and for small and medium sized enterprises.\r\nDuring his mandate, President HOLLANDE oversaw two highly unpopular economic reforms that led to widespread protests. The “Macron Law” of 2015, enacted to boost economic growth, authorized businesses to open some Sundays of each month and allowed flexibility to negotiate pay and working hours. The “El Khomri law,” imposed by decree in 2016, aimed to make it easier for businesses to employ people and gave employers more leeway to negotiate hours, wages, and time off', '$2.466 trillion (2016 est.)', 'wheat, cereals, sugar beets, potatoes, wine grapes; beef, dairy products; fish', 'machinery, chemicals, automobiles, metallurgy, aircraft, electronics; textiles, food processing; tourism', '30.43 million (2016 est.)', 'machinery and transportation equipment, aircraft, plastics, chemicals, pharmaceutical products, iron and steel, beverages', '536.1 billion kWh (2015 est.)', '16,420 bbl/day (2016 est.)', '1.27 million bbl/day (2016 est.)', '28 million cu m (2015 est.)', 'F (2016)', '464 (2013)', '1 (2013)', 'gas 15,322 km; oil 2,939 km; refined products 5,084 km (2013)', '29,640 km', '1,028,446 km (metropolitan France)', 'metropolitan France: 8,501 km (1,621 km navigable by craft up to 3,000 metric tons) (2010)', '2018-02-07 18:03:28', NULL),
