(79, 'PF', 'pf', 'French Polynesia', 'The French annexed various Polynesian island groups during the 19th century. In September 1995, France stirred up widespread protests by resuming nuclear testing on the Mururoa Atoll after a three-year moratorium. The tests were halted in January 1996. In recent years, French Polynesia''s autonomy has been considerably expanded.', 'Oceania', '15 00 S, 140 00 W', '4,167 sq km (118 islands and atolls; 67 are inhabited)', '287,881 (July 2017 est.)', 'French Polynesian(s)', 'Polynesian 78%, Chinese 12%, local French 6%, metropolitan French 4%', 'French (official) 70%, Polynesian (official) 28.2%, other 1.8% (2012 est.)', 'Protestant 54%, Roman Catholic 30%, other 10%, no religion 6%', 'Republic of The Gambia', 'parliamentary democracy (Assembly of French Polynesia); an overseas collectivity of France', 'Papeete (located on Tahiti)', '5 administrative subdivisions (subdivisions administratives, singular - subdivision administrative): Iles Australes (Austral Islands), Iles du Vent (Windward Islands), Iles Marquises (Marquesas Islands), Iles Sous-le-Vent (Leeward Islands), Iles Tuamotu-Gambier; note - the Leeward Islands and the Windward Islands together make up the Society Islands (Iles de la Societe)', 'none (overseas lands of France)', 'Since 1962, when France stationed military personnel in the region, French Polynesia has changed from a subsistence agricultural economy to one in which a high proportion of the work force is either employed by the military or supports the tourist industry. With the halt of French nuclear testing in 1996, the military contribution to the economy fell sharply.\r\nAfter growing at an average yearly rate of 4.2% from 1997-2007, the economic and financial crisis in 2008 marked French Polynesia’s entry into recession. However, since 2014, French Polynesia has shown signs of recovery. Business turnover reached 1.8% year-on-year in September 2016, tourism increased 1.8% in 2015, and GDP grew 2.0% in 2015.\r\nFrench Polynesia’s tourism-dominated service sector accounted for 85% of total value added for the economy in 2012. Tourism employs 17% of the workforce. Pearl farming is the second biggest industry, accounting for 54% of exports in 2015; however, the output has decreased to 12.5 tons – the lowest level since 2008. A small manufacturing sector predominantly processes commodities from French Polynesia’s primary sector - 8% of total economy in 2012 - including agriculture and fishing.\r\nFrance has agreed to finance infrastructure, marine businesses, and cultural and ecological sites at roughly $80 million per year between 2015 and 2020. Japan, the US, and China are French Polynesia’s three largest trade partners.', '$4.795 billion (2012 est.)', 'coconuts, vanilla, vegetables, fruits, coffee; poultry, beef, dairy products; fish', 'tourism, pearls, agricultural processing, handicrafts, phosphates', '126,300 (2016 est.)', 'cultured pearls, coconut products, mother-of-pearl, vanilla, shark meat', '626 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'F-OH (2016)', '54 (2013)', '1 (2013)', '-', '-', '2,590 km', '--', '2018-02-07 18:03:28', NULL),
(80, 'TF', 'tf', 'French Southern Territories', 'In February 2007, the Iles Eparses became an integral part of the French Southern and Antarctic Lands (TAAF). The Southern Lands are now divided into five administrative districts, two of which are archipelagos, Iles Crozet and Iles Kerguelen; the third is a district composed of two volcanic islands, Ile Saint-Paul and Ile Amsterdam; the fourth, Iles Eparses, consists of five scattered tropical islands around Madagascar. They contain no permanent inhabitants and are visited only by researchers studying the native fauna, scientists at the various scientific stations, fishermen, and military personnel. The fifth district is the Antarctic portion, which consists of "Adelie Land," a thin slice of the Antarctic continent discovered and claimed by the French in 1840.\r\nIle Amsterdam: Discovered but not named in 1522 by the Spanish, the island subsequently received the appellation of Nieuw Amsterdam from a Dutchman; it was claimed by France in 1843. A short-lived attempt at cattle farming began in 1871. A French meteorological station established on the island in 1949 is still in use.\r\nIle Saint Paul: Claimed by France since 1893, the island was a fishing industry center from 1843 to 1914. In 1928, a spiny lobster cannery was established, but when the company went bankrupt in 1931, seven workers were abandoned. Only two survived until 1934 when rescue finally arrived.\r\nIles Crozet: A large archipelago formed from the Crozet Plateau, Iles Crozet is divided into two main groups: L''Occidental (the West), which includes Ile aux Cochons, Ilots des Apotres, Ile des Pingouins, and the reefs Brisants de l''Heroine; and L''Oriental (the East), which includes Ile d''Est and Ile de la Possession (the largest island of the Crozets). Discovered and claimed by France in 1772, the islands were used for seal hunting and as a base for whaling. Originally administered as a dependency of Madagascar, they became part of the TAAF in 1955.\r\nIles Kerguelen: This island group, discovered in 1772, consists of one large island (Ile Kerguelen) and about 300 smaller islands. A permanent group of 50 to 100 scientists resides at the main base at Port-aux-Francais.\r\nAdelie Land: The only non-insular district of the TAAF is the Antarctic claim known as "Adelie Land." The US Government does not recognize it as a French dependency.\r\nBassas da India: A French possession since 1897, this atoll is a volcanic rock surrounded by reefs and is awash at high tide.\r\nEuropa Island: This heavily wooded island has been a French possession since 1897; it is the site of a small military garrison that staffs a weather station.\r\nGlorioso Islands: A French possession since 1892, the Glorioso Islands are composed of two lushly vegetated coral islands (Ile Glorieuse and Ile du Lys) and three rock islets. A military garrison operates a weather and radio station on Ile Glorieuse.\r\nJuan de Nova Island: Named after a famous 15th-century Spanish navigator and explorer, the island has been a French possession since 1897. It has been exploited for its guano and phosphate. Presently a small military garrison oversees a meteorological station.\r\nTromelin Island: First explored by the French in 1776, the island came under the jurisdiction of Reunion in 1814. At present, it serves as a sea turtle sanctuary and is the site of an important meteorological station.', 'Antarctic Region, Africa', 'Ile Amsterdam (Ile Amsterdam et Ile Saint-Paul): 37 50 S, 77 32 E\r\nIle Saint-Paul (Ile Amsterdam et Ile Saint-Paul): 38 72 S, 77 53 E\r\nIles Crozet: 46 25 S, 51 00 E\r\nIles Kerguelen: 49 15 S, 69 35 E\r\nBassas da India (Iles Eparses): 21 30 S, 39 50 E\r\nEurop', 'Ile Amsterdam (Ile Amsterdam et Ile Saint-Paul): total - 55 sq km; land - 55 sq km; water - 0 sq km\r\nIle Saint-Paul (Ile Amsterdam et Ile Saint-Paul): total - 7 sq km; land - 7 sq km; water - 0 sq km\r\nIles Crozet: total - 352 sq km; land - 352 sq km; wate', 'no indigenous inhabitants\r\nIle Amsterdam (Ile Amsterdam et Ile Saint-Paul): no permanent residents but has a meteorological station\r\nIle Saint-Paul (Ile Amsterdam et Ile Saint-Paul): uninhabited but is frequently visited by fishermen and has a scientific ', '-', '-', '', '-', 'Territory of the French Southern and Antarctic Lands', '-', '-', 'none (overseas territory of France); there are no first-order administrative divisions as defined by the US Government, but there are 5 administrative districts named Iles Crozet, Iles Eparses, Iles Kerguelen, Ile Saint-Paul et Ile Amsterdam; the fifth district is the "Adelie Land" claim in Antarctica that is not recognized by the US', '-', 'Economic activity is limited to servicing meteorological and geophysical research stations, military bases, and French and other fishing fleets. The fish catches landed on Iles Kerguelen by foreign ships are exported to France and Reunion.', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '4; note - one each on Europa Island, Glorioso Isla', '-', '-', '-', '-', '-', '2018-02-07 18:03:28', NULL),
(81, 'GA', 'ga', 'Gabon', 'Following, independence from France in 1960, El Hadj Omar BONGO Ondimba - one of the longest-ruling heads of state in the world - dominated the country''s political scene for four decades (1967-2009). President BONGO introduced a nominal multiparty system and a new constitution in the early 1990s. However, allegations of electoral fraud during local elections in December 2002 and the presidential election in 2005 exposed the weaknesses of formal political structures in Gabon. Following President BONGO''s death in 2009, a new election brought his son, Ali BONGO Ondimba, to power. Despite constrained political conditions, Gabon''s small population, abundant natural resources, and considerable foreign support have helped make it one of the more stable African countries.\r\nPresident Ali BONGO Ondimba’s controversial August 2016 reelection sparked unprecedented opposition protests that resulted in the burning of the parliament building. The election was contested by the opposition after fraudulent results were flagged by international election observers. Gabon’s Constitutional Court reviewed the election results but ruled in favor of President BONGO, upholding his win and extending his mandate to 2023.', 'Africa', '1 00 S, 11 45 E', '267,667 sq km', '1,772,255\r\nnote: estimates for this country explicitly take into account the effects of excess mortality due to AIDS; this can result in lower life expectancy, higher infant mortality, higher death rates, lower population growth rates, and changes in the ', 'Gabonese (singular and plural)', 'Bantu tribes, including four major tribal groupings (Fang, Bapounou, Nzebi, Obamba); other Africans and Europeans, 154,000, including 10,700 French and 11,000 persons of dual nationality', 'French (official), Fang, Myene, Nzebi, Bapounou/Eschira, Bandjabi', 'Roman Catholic 42.3%, Protestant 12.3%, other Christian 27.4%, Muslim 9.8%, animist 0.6%, other 0.5%, none/no answer 7.1% (2012 est.)', 'Gabonese Republic', 'presidential republic', 'Libreville', '9 provinces; Estuaire, Haut-Ogooue, Moyen-Ogooue, Ngounie, Nyanga, Ogooue-Ivindo, Ogooue-Lolo, Ogooue-Maritime, Woleu-Ntem', '17 August 1960 (from France)', 'Gabon enjoys a per capita income four times that of most sub-Saharan African nations, but because of high income inequality, a large proportion of the population remains poor. Gabon relied on timber and manganese exports until oil was discovered offshore in the early 1970s. From 2010 to 2016, oil accounted for approximately 80% of Gabon’s exports, 45% of its GDP, and 60% of its state budget revenues.\r\nGabon faces fluctuating prices for its oil, timber, and manganese exports. A rebound of oil prices from 2001 to 2013 helped growth, but declining production, as some fields passed their peak production, has hampered Gabon from fully realizing potential gains. GDP grew nearly 6% per year over the 2010-14 period, but slowed significantly in 2015 as oil prices declined. Low oil prices also weakened government revenue and negatively affected the trade and current account balances.\r\nDespite an abundance of natural wealth, poor fiscal management and over-reliance on oil has stifled the economy. Power cuts and water shortages are frequent. Significant cuts in budget expenditures - Gabon’s budget has contracted for four years in a row - have not extended to the government’s priority projects, like a new stadium for the Africa Cup of Nations.', '$14.02 billion (2016 est.)', 'cocoa, coffee, sugar, palm oil, rubber; cattle; okoume (a tropical softwood); fish', 'petroleum extraction and refining; manganese, gold; chemicals, ship repair, food and beverages, textiles, lumbering and plywood, cement', '546,300 (2016 est.)', 'crude oil, timber, manganese, uranium', '2.045 billion kWh (2015 est.)', '210,800 bbl/day (2016 est.)', '16,810 bbl/day (2014 est.)', '378 million cu m (2015 est.)', 'TR (2016)', '44 (2013)', '-', 'gas 807 km; oil 1,639 km; water 3 km (2013)', '649 km', '9,170 km', '1,600 km (310 km on Ogooue River) (2010)', '2018-02-07 18:03:28', NULL);
