(82, 'GM', 'gm', 'Gambia', 'The Gambia gained its independence from the UK in 1965. Geographically surrounded by Senegal, it formed a short-lived Confederation of Senegambia between 1982 and 1989. In 1991 the two nations signed a friendship and cooperation treaty, but tensions have flared up intermittently since then. Yahya JAMMEH led a military coup in 1994 that overthrew the president and banned political activity. A new constitution and presidential election in 1996, followed by parliamentary balloting in 1997, completed a nominal return to civilian rule. JAMMEH was elected president in all subsequent elections including most recently in late 2011. After 22 years of increasingly authoritarian rule, President JAMMEH was defeated in free and fair elections in December 2016. Due to The Gambia’s poor human rights record under JAMMEH, international development partners had distanced themselves, and substantially reduced aid to the country. These channels may re-open under the administration of President', 'Africa', '13 28 N, 16 34 W', '11,300 sq km', '2,051,363 (July 2017 est.)\r\ncountry comparison to the world: 146', 'Gambian(s)', 'Mandinka/Jahanka 34%, Fulani/Tukulur/Lorobo 22.4%, Wolof 12.6%, Jola/Karoninka 10.7%, Serahuleh 6.6%, Serer 3.2%, Manjago 2.1%, Bambara 1%, Creole/Aku Marabout 0.7%, other 0.9%, non-Gambian 5.2%, no answer 0.6% (2013 est.)', 'English (official), Mandinka, Wolof, Fula, other indigenous vernaculars', 'Muslim 95.7%, Christian 4.2%, none 0.1%, no response 0.1% (2013 est.)', 'Republic of The Gambia', 'presidential republic', 'Banjul', '5 regions, 1 city*, and 1 municipality**; Banjul*, Central River, Kanifing**, Lower River, North Bank, Upper River, West Coast', '18 February 1965 (from the UK)', 'The government has invested in the agriculture sector because three-quarters of the population depends on the sector for its livelihood and agriculture provides for about one-third of GDP, making The Gambia largely reliant on sufficient rainfall. The agricultural sector has untapped potential - less than half of arable land is cultivated and agricultural productivity is low. Small-scale manufacturing activity features the processing of cashews, groundnuts, fish, and hides. The Gambia''s reexport trade accounts for almost 80% of goods exports and China has been its largest trade partner for both exports and imports for several years.\r\nThe Gambia has sparse natural resource deposits. It relies heavily on remittances from workers overseas and tourist receipts. Remittance inflows to The Gambia amount to about one-fifth of the country’s GDP. The Gambia''s location on the ocean and proximity to Europe has made it one of the most frequented tourist destinations in West Africa, boosted by private sector investments in eco-tourism and facilities. Tourism normally brings in about 20% of GDP, but it suffered in 2014 from tourists’ fears of Ebola virus in neighboring West African countries. Unemployment and underemployment remain high.\r\nEconomic progress depends on sustained bilateral and multilateral aid, on responsible government economic management, and on continued technical assistance from multilateral and bilateral donors. International donors and lenders were concerned about the quality of fiscal management under the administration of former President Yahya JAMMEH, who reportedly stole hundreds of millions of dollars of the country’s funds during his 22 years in power, but anticipate significant improvements under the new administration of President Adama BARROW, who assumed power in early 2017. As of April 2017, the IMF, the World Bank, the European Union, and the African Development Bank were all negotiating with the new government of The Gambia to provide financial support in the coming months to ease the country’s financial crisis.\r\nThe country’s GDP contracted in 2016 largely as a result of the limited availability of foreign exchange, weak agricultural output, the border closure with Senegal during the first half of the year, and a slowdown in tourism during the political impasse that occurred at the height of the tourist season. The country faces a large fiscal deficit and a high domestic debt burden that has crowded out private sector investment and driven interest rates to new highs. The new government has committed to taking steps to reduce the deficit, including through expenditure caps, debt consolidation, and reform of state-owned enterprises.', '$965 million (2016 est.)', 'rice, millet, sorghum, peanuts, corn, sesame, cassava (manioc, tapioca), palm kernels; cattle, sheep, goats', 'peanuts, fish, hides, tourism, beverages, agricultural machinery assembly, woodworking, metalworking, clothing', '777,100 (2007 est.)', 'peanut products, fish, cotton lint, palm kernels', '240 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'C5 (2016)', '1 (2013)', '-', '-', '-', '3,740 km', '390 km (on River Gambia; small oceangoing vessels can reach 190 km) (2010)', '2018-02-07 18:03:28', NULL),
(83, 'GE', 'ge', 'Georgia', 'The region of present day Georgia contained the ancient kingdoms of Colchis and Kartli-Iberia. The area came under Roman influence in the first centuries A.D., and Christianity became the state religion in the 330s. Domination by Persians, Arabs, and Turks was followed by a Georgian golden age (11th-13th centuries) that was cut short by the Mongol invasion of 1236. Subsequently, the Ottoman and Persian empires competed for influence in the region. Georgia was absorbed into the Russian Empire in the 19th century. Independent for three years (1918-1921) following the Russian revolution, it was forcibly incorporated into the USSR in 1921 and regained its independence when the Soviet Union dissolved in 1991.\r\nMounting public discontent over rampant corruption and ineffective government services, followed by an attempt by the incumbent Georgian Government to manipulate parliamentary elections in November 2003, touched off widespread protests that led to the resignation of Eduard SHEVARDNADZE, president since 1995. In the aftermath of that popular movement, which became known as the "Rose Revolution," new elections in early 2004 swept Mikheil SAAKASHVILI into power along with his United National Movement (UNM) party. Progress on market reforms and democratization has been made in the years since independence, but this progress has been complicated by Russian assistance and support to the separatist regions of Abkhazia and South Ossetia. Periodic flare-ups in tension and violence culminated in a five-day conflict in August 2008 between Russia and Georgia, including the invasion of large portions of undisputed Georgian territory. Russian troops pledged to pull back from most occupied Georgian territory, but in late August 2008 Russia unilaterally recognized the independence of Abkhazia and South Ossetia, and Russian military forces remain in those regions.\r\nBillionaire philanthropist Bidzina IVANISHVILI''s unexpected entry into politics in October 2011 brought the divided opposition together under his Georgian Dream coalition, which won a majority of seats in the October 2012 parliamentary elections and removed UNM from power. Conceding defeat, SAAKASHVILI named IVANISHVILI as prime minister and allowed Georgian Dream to create a new government. Giorgi MARGVELASHVILI was inaugurated as president on 17 November 2013, ending a tense year of power-sharing between SAAKASHVILI and IVANISHVILI. IVANISHVILI voluntarily resigned from office after the presidential succession, and Georgia''s legislature on 20 November 2013 confirmed Irakli GARIBASHVILI as his replacement. GARIBASHVILI was replaced by Giorgi KVIRIKASHVILI in December 2015. KVIRIKASHVILI remained Prime Minister following Georgian Dream’s success in the October 2016 parliamentary elections, where the party won a constitutional majority. These changes in leadership represent unique examples of a former Soviet state that emerged to conduct democratic and peaceful government transitions of power. Popular and government support for integration with the West is high in Georgia. Joining the EU and NATO are among the country''s top foreign policy goals.', 'Asia', '42 00 N, 43 30 E', '69,700 sq km', '4,926,330 (July 2017 est.)', 'Georgian(s)', 'Georgian 86.8%, Azeri 6.3%, Armenian 4.5%, other 2.3% (includes Russian, Ossetian, Yazidi, Ukrainian, Kist, Greek) (2014 est.)', 'Georgian (official) 87.6%, Azeri 6.2%, Armenian 3.9%, Russian 1.2%, other 1%', 'Orthodox (official) 83.4%, Muslim 10.7%, Armenian Apostolic 2.9%, other 1.2% (includes Catholic, Jehovah''s Witness, Yazidi, Protestant, Jewish), none 0.5%, unspecified/no answer 1.2% (2014 est.)', 'none', 'semi-presidential republic', 'Tbilisi', '9 regions (mkharebi, singular - mkhare), 1 city (kalaki), and 2 autonomous republics (avtomnoy respubliki, singular - avtom respublika)\r\nregions: Guria, Imereti, Kakheti, Kvemo Kartli, Mtskheta Mtianeti, Racha-Lechkhumi and Kvemo Svaneti, Samegrelo and Zemo Svaneti, Samtskhe-Javakheti, Shida Kartli; note - the breakaway region of South Ossetia consists of the northern part of Shida Kartli, eastern slivers of the Imereti region and Racha-Lechkhumi and Kvemo Svaneti, and part of western Mtskheta-Mtianeti\r\ncity: Tbilisi\r\nautonomous republics: Abkhazia or Ap''khazet''is Avtonomiuri Respublika (Sokhumi), Ajaria or Acharis Avtonomiuri Respublika (Bat''umi)\r\nnote 1: the administrative centers of the two autonomous republics are shown in parentheses\r\nnote 2: the United States recognizes the breakaway regions of Abkhazia and South Ossetia to be part of Georgia', '9 April 1991 (from the Soviet Union); notable earlier date: A.D. 1008 (Georgia unified under King BAGRAT III)', 'Georgia''s main economic activities include cultivation of agricultural products such as grapes, citrus fruits, and hazelnuts; mining of manganese, copper, and gold; and producing alcoholic and nonalcoholic beverages, metals, machinery, and chemicals in small-scale industries. The country imports nearly all of its needed supplies of natural gas and oil products. It has sizeable hydropower capacity that now provides most of its energy needs.\r\nGeorgia has overcome the chronic energy shortages and gas supply interruptions of the past by renovating hydropower plants and by increasingly relying on natural gas imports from Azerbaijan instead of from Russia. Construction of the Baku-T''bilisi-Ceyhan oil pipeline, the South Caucasus gas pipeline, and the Kars-Akhalkalaki railroad are part of a strategy to capitalize on Georgia''s strategic location between Europe and Asia and develop its role as a transit hub for gas, oil, and other goods.\r\nGeorgia''s economy sustained GDP growth of more than 10% in 2006-07, based on strong inflows of foreign investment and robust government spending. However, GDP growth slowed following the August 2008 conflict with Russia, and sunk to negative 4% in 2009 as foreign direct investment and workers'' remittances declined in the wake of the global financial crisis. The economy rebounded in the period 2010-17, but FDI inflows, the engine of Georgian economic growth prior to the 2008 conflict, have not recovered fully. Unemployment has also remained high.\r\nThe country is pinning its hopes for renewed growth on a continued effort to liberalize the economy by reducing regulation, taxes, and corruption in order to attract foreign investment, with a focus on hydropower, agriculture, tourism, and textiles production. Georgia has historically suffered from a chronic failure to collect tax revenues; however, since 2004 the government has simplified the tax code, increased tax enforcement, and cracked down on petty corruption, leading to higher revenues. Georgia plans to improve the domestic investment environment through a four-year economic plan targeting the tax system, educational standards, infrastructure, and governance. The government has received high marks from the World Bank for improvements in business transparency. Since 2012, the Georgian Dream-led government has continued the previous administration''s low-regulation, low-tax, free market policies, while modestly increasing social spending, strengthening anti-trust policy, and amending the labor code to comply with International Labor Standards. In mid-2014, Georgia signed an association agreement with the EU, paving the way to free trade and visa-free travel. Georgia is also seeking to expand trade with China, concluding substantive negotiations on a trade agreement in October 2016.', '$15.23 billion (2016 est.)', 'citrus, grapes, tea, hazelnuts, vegetables; livestock', 'steel, machine tools, electrical appliances, mining (manganese, copper, gold), chemicals, wood products, wine', '1.998 million (2016 est.)', 'vehicles, ferro-alloys, fertilizers, nuts, scrap metal, gold, copper ores', '11.57 billion kWh (2016 est.)', '400 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '10 million cu m (2015 est.)', '4L (2016)', '22 (2013)', '2 (2013)', 'gas 1,596 km; oil 1,175 km (2013)', '1,363 km', '19,109 km', '-', '2018-02-07 18:03:28', NULL),
(84, 'DE', 'de', 'Germany', 'As Europe''s largest economy and second most populous nation (after Russia), Germany is a key member of the continent''s economic, political, and defense organizations. European power struggles immersed Germany in two devastating World Wars in the first half of the 20th century and left the country occupied by the victorious Allied powers of the US, UK, France, and the Soviet Union in 1945. With the advent of the Cold War, two German states were formed in 1949: the western Federal Republic of Germany (FRG) and the eastern German Democratic Republic (GDR). The democratic FRG embedded itself in key western economic and security organizations, the EC, which became the EU, and NATO, while the communist GDR was on the front line of the Soviet-led Warsaw Pact. The decline of the USSR and the end of the Cold War allowed for German reunification in 1990. Since then, Germany has expended considerable funds to bring eastern productivity and wages up to western standards. In January 1999, Germany and 10 other EU countries introduced a common European exchange currency, the euro.', 'Europe', '51 00 N, 9 00 E', '357,022 sq km', '80,594,017 (July 2017 est.)', 'German(s)', 'German 91.5%, Turkish 2.4%, other 6.1% (made up largely of Polish, Italian, Romanian, Syrian, and Greek)', 'German (official)', 'Roman Catholic 29%, Protestant 27%, Muslim 4.4%, Orthodox Christian 1.9%, other 1.7%, none or members of unrecorded religious groups 36% (2015 est.)', 'Federal Republic of Germany', 'ederal parliamentary republic.', 'Berlin', '16 states (Laender, singular - Land); Baden-Wuerttemberg, Bayern (Bavaria), Berlin, Brandenburg, Bremen, Hamburg, Hessen (Hesse), Mecklenburg-Vorpommern (Mecklenburg-Western Pomerania), Niedersachsen (Lower Saxony), Nordrhein-Westfalen (North Rhine-Westphalia), Rheinland-Pfalz (Rhineland-Palatinate), Saarland, Sachsen (Saxony), Sachsen-Anhalt (Saxony-Anhalt), Schleswig-Holstein, Thueringen (Thuringia); note - Bayern, Sachsen, and Thueringen refer to themselves as free states (Freistaaten, singular - Freistaat), while Hamburg prides itself on being a Free and Hanseatic City (Freie und Hansestadt)', '18 January 1871 (establishment of the German Empire); divided into four zones of occupation (UK, US, USSR, and France) in 1945 following World War II; Federal Republic of Germany (FRG or West Germany) proclaimed on 23 May 1949 and included the former UK, US, and French zones; German Democratic Republic (GDR or East Germany) proclaimed on 7 October 1949 and included the former USSR zone; West Germany and East Germany unified on 3 October 1990; all four powers formally relinquished rights on 15 March 1991; notable earlier dates: 10 August 843 (Eastern Francia established from the division of the Carolingian Empire); 2 February 962 (crowning of OTTO I, recognized as the first Holy Roman Emperor)', 'The German economy - the fifth largest economy in the world in PPP terms and Europe''s largest - is a leading exporter of machinery, vehicles, chemicals, and household equipment and benefits from a highly skilled labor force. Like its Western European neighbors, Germany faces significant demographic challenges to sustained long-term growth. Low fertility rates and a large increase in net immigration are increasing pressure on the country''s social welfare system and necessitate structural reforms.\r\nReforms launched by the government of Chancellor Gerhard SCHROEDER (1998-2005), deemed necessary to address chronically high unemployment and low average growth, contributed to strong growth and falling unemployment. These advances, as well as a government subsidized, reduced working hour scheme, help explain the relatively modest increase in unemployment during the 2008-09 recession - the deepest since World War II. The German Government introduced a minimum wage in 2015 that increased to $9.79 (8.84 euros) in January 2017.\r\nStimulus and stabilization efforts initiated in 2008 and 2009 and tax cuts introduced in Chancellor Angela MERKEL''s second term increased Germany''s total budget deficit - including federal, state, and municipal - to 4.1% in 2010, but slower spending and higher tax revenues reduced the deficit to 0.8% in 2011 and in 2016 Germany reached a budget surplus of 0.6%. A constitutional amendment approved in 2009 limits the federal government to structural deficits of no more than 0.35% of GDP per annum as of 2016, though the target was already reached in 2012.\r\nThe German economy suffers from low levels of investment, and a government plan to invest 15 billion euros during 2016-18, largely in infrastructure, is intended to spur needed private investment. Following the March 2011 Fukushima nuclear disaster, Chancellor Angela MERKEL announced in May 2011 that eight of the country''s 17 nuclear reactors would be shut down immediately and the remaining plants would close by 2022. Germany plans to replace nuclear power largely with renewable energy, which accounted for 29.5% of gross electricity consumption in 2016, up from 9% in 2000. Before the shutdown of the eight reactors, Germany relied on nuclear power for 23% of its electricity generating capacity and 46% of its base-load electricity production. Domestic consumption, bolstered by low energy prices and a weak euro, and exports are likely to drive German GDP growth again in 2017.', '$3.479 trillion (2016 est.)', 'potatoes, wheat, barley, sugar beets, fruit, cabbages; milk products; cattle, pigs, poultry', 'among the world''s largest and most technologically advanced producers of iron, steel, coal, cement, chemicals, machinery, vehicles, machine tools, electronics, automobiles, food and beverages, shipbuilding, textiles', '45.42 million (2016 est.)', 'motor vehicles, machinery, chemicals, computer and electronic products, electrical equipment, pharmaceuticals, metals, transport equipment, foodstuffs, textiles, rubber and plastic products', '588.5 billion kWh (2015 est.)', '46,590 bbl/day (2016 est.)', '2.198 million bbl/day (2016 est.)', '8.73 billion cu m (2015 est.)', 'D (2016)', '539 (2013)', '23 (2013)', 'condensate 37 km; gas 26,985 km; oil 2,826 km; refined products 4,479 km; water 8 km (2013)', '43,468.3 km', '645,000 km', '7,467 km (Rhine River carries most goods; Main-Danube Canal links North Sea and Black Sea) (2012)', '2018-02-07 18:03:28', NULL),
(85, 'GH', 'gh', 'Ghana', 'Formed from the merger of the British colony of the Gold Coast and the Togoland trust territory, Ghana in 1957 became the first sub-Saharan country in colonial Africa to gain its independence. Ghana endured a series of coups before Lt. Jerry RAWLINGS took power in 1981 and banned political parties. After approving a new constitution and restoring multiparty politics in 1992, RAWLINGS won presidential elections in 1992 and 1996 but was constitutionally prevented from running for a third term in 2000. John KUFUOR of the opposition New Patriotic Party (NPP) succeeded him and was reelected in 2004. John Atta MILLS of the National Democratic Congress won the 2008 presidential election and took over as head of state, but he died in July 2012 and was constitutionally succeeded by his vice president, John Dramani MAHAMA, who subsequently won the December 2012 presidential election. In 2016, however, Nana Addo Dankwa AKUFO-ADDO of the NPP defeated MAHAMA, marking the third time that the Ghana’s presidency has changed parties since the return to democracy.', 'Africa', '8 00 N, 2 00 W', '238,533 sq km', '27,499,924', 'Ghanaian(s)', 'Akan 47.5%, Mole-Dagbon 16.6%, Ewe 13.9%, Ga-Dangme 7.4%, Gurma 5.7%, Guan 3.7%, Grusi 2.5%, Mande 1.1%, other 1.4% (2010 est.)', 'Asante 16%, Ewe 14%, Fante 11.6%, Boron (Brong) 4.9%, Dagomba 4.4%, Dangme 4.2%, Dagarte (Dagaba) 3.9%, Kokomba 3.5%, Akyem 3.2%, Ga 3.1%, other 31.2%', 'Christian 71.2% (Pentecostal/Charismatic 28.3%, Protestant 18.4%, Catholic 13.1%, other 11.4%), Muslim 17.6%, traditional 5.2%, other 0.8%, none 5.2% (2010 est.)', 'Republic of Ghana', 'presidential republic', 'Accra', '10 regions; Ashanti, Brong-Ahafo, Central, Eastern, Greater Accra, Northern, Upper East, Upper West, Volta, Western', '6 March 1957 (from the UK)', 'Ghana has a market-based economy with relatively few policy barriers to trade and investment in comparison with other countries in the region, and Ghana is well-endowed with natural resources. Ghana''s economy was strengthened by a quarter century of relatively sound management, a competitive business environment, and sustained reductions in poverty levels, but in recent years has suffered the consequences of loose fiscal policy, high budget and current account deficits, and a depreciating currency.\nAgriculture accounts for about 20% of GDP and employs more than half of the workforce, mainly small landholders. Gold and cocoa exports, and individual remittances, are major sources of foreign exchange. Expansion of Ghana’s nascent oil industry has boosted economic growth, but the fall in oil prices since 2015 reduced by half Ghana’s oil revenue. Production at Jubilee, Ghana''s offshore oilfield, began in mid-December 2010. The country’s first gas processing plant at Atubao is also producing natural gas from the Jubilee field, providing power to several of Ghana’s thermal power plants.\nAs of 2016, key economic concerns facing the government include the lack of reliable electricity and the high debt burden, even amid strong GDP growth. While the MAHAMA administration attempted to ameliorate these concerns, little progress has been made, leaving much work to be done in 2017 by the incoming AKUFO-ADDO administration. Ghana signed a $920 million extended credit facility with the IMF in April 2015 to help it address its growing economic crisis. The IMF fiscal targets require Ghana to reduce the deficit by cutting subsidies, decreasing the bloated public sector wage bill, strengthening revenue administration, and boosting tax revenues. Priorities for the new administration include rescheduling some of Ghana’s $31 billion debt, stimulating economic growth, reducing inflation, and stabilizing the currency. Prospects for new oil and gas production, potentially higher global gold prices, and followthrough on tighter fiscal management are likely to help Ghana’s economy in 2017.', '$42.78 billion (2016 est.)', 'cocoa, rice, cassava (manioc, tapioca), peanuts, corn, shea nuts, bananas; timber', 'mining, lumbering, light manufacturing, aluminum smelting, food processing, cement, small commercial ship building, petroleum', '12.13 million (2016 est.)', 'oil, gold, cocoa, timber, tuna, bauxite, aluminum, manganese ore, diamonds, horticultural products', '11.09 billion kWh (2015 est.)', '100,500 bbl/day (2016 est.)', '2,815 bbl/day (2014 est.)', '63.54 million cu m (2016 est.)', '9G (2016)', '10 (2013)', '-', 'gas 394 km; oil 20 km; refined products 361 km (2013)', '947 km', '109,515 km', '1,293 km (168 km for launches and lighters on Volta, Ankobra, and Tano Rivers; 1,125 km of arterial and feeder waterways on Lake Volta) (2011)', '2018-02-07 18:03:28', NULL),
(86, 'GI', 'gi', 'Gibraltar', 'Strategically important, Gibraltar was reluctantly ceded to Great Britain by Spain in the 1713 Treaty of Utrecht; the British garrison was formally declared a colony in 1830. In a referendum held in 1967, Gibraltarians voted overwhelmingly to remain a British dependency. The subsequent granting of autonomy in 1969 by the UK led Spain to close the border and sever all communication links. Between 1997 and 2002, the UK and Spain held a series of talks on establishing temporary joint sovereignty over Gibraltar. In response to these talks, the Gibraltar Government called a referendum in late 2002 in which the majority of citizens voted overwhelmingly against any sharing of sovereignty with Spain. Since late 2004, Spain, the UK, and Gibraltar have held tripartite talks with the aim of cooperatively resolving problems that affect the local population, and work continues on cooperation agreements in areas such as taxation and financial services; communications and maritime security; policy, legal and customs services; environmental protection; and education and visa services. A new noncolonial constitution came into force in 2007, and the European Court of First Instance recognized Gibraltar''s right to regulate its own tax regime in December 2008. The UK retains responsibility for defense, foreign relations, internal security, and financial stability.\r\nSpain and the UK continue to spar over the territory. Throughout 2009, a dispute over Gibraltar''s claim to territorial waters extending out three miles gave rise to periodic non-violent maritime confrontations between Spanish and UK naval patrols and in 2013, the British reported a record number of entries by Spanish vessels into waters claimed by Gibraltar following a dispute over Gibraltar''s creation of an artificial reef in those waters. Spain renewed its demands for an eventual return of Gibraltar to Spanish control after the UK’s June 2016 vote to leave the EU, but London has dismissed any connection between the vote and its future commitment to Gibraltar. The European Commission has said that the UK will need to reach a separate bilateral agreement with Spain to allow Gibraltar to be covered by the UK''s broader EU exit agreement.', 'Europe', '36 08 N, 5 21 W', '6.5 sq km', '29,396 (July 2017 est.)', 'Gibraltarian(s)', 'Gibraltarian 79%, other British 13.2%, Spanish 2.1%, Moroccan 1.6%, other EU 2.4%, other 1.6% (2012 est.)', 'English (used in schools and for official purposes), Spanish, Italian, Portuguese', 'Roman Catholic 72.1%, Church of England 7.7%, other Christian 3.8%, Muslim 3.6%, Jewish 2.4%, Hindu 2%, other 1.1%, none 7.1%, unspecified 0.1% (2012 est.)', 'none', 'parliamentary democracy (Parliament); self-governing overseas territory of the UK', 'Gibraltar', 'none (overseas territory of the UK)', 'none (overseas territory of the UK)', 'Self-sufficient Gibraltar benefits from an extensive shipping trade, offshore banking, and its position as an international conference center. Tax rates are low to attract foreign investment. The British military presence has been sharply reduced and now contributes about 7% to the local economy, compared with 60% in 1984. In recent years, Gibraltar has seen major structural change from a public to a private sector economy, but changes in government spending still have a major impact on the level of employment.\r\nThe financial sector, tourism (over 11 million visitors in 2012), gaming revenues, shipping services fees, and duties on consumer goods also generate revenue. The financial sector, tourism, and the shipping sector contribute 30%, 30%, and 25%, respectively, of GDP. Telecommunications, e-commerce, and e-gaming account for the remaining 15%.', '$2.044 billion (2013 est.)', 'none', 'tourism, banking and finance, ship repairing, tobacco', '24,420 (2014 est.)', '(principally reexports) petroleum 51%, manufactured goods (2010 est.)', '194.6 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'VP-G (2016)', '1 (2013)', '-', '-', '-', '29 km', '-', '2018-02-07 18:03:28', NULL),
(87, 'GR', 'gr', 'Greece', 'Greece achieved independence from the Ottoman Empire in 1830. During the second half of the 19th century and the first half of the 20th century, it gradually added neighboring islands and territories, most with Greek-speaking populations. In World War II, Greece was first invaded by Italy (1940) and subsequently occupied by Germany (1941-44); fighting endured in a protracted civil war between supporters of the king and other anti-communist and communist rebels. Following the latter''s defeat in 1949, Greece joined NATO in 1952. In 1967, a group of military officers seized power, establishing a military dictatorship that suspended many political liberties and forced the king to flee the country. In 1974 following the collapse of the dictatorship, democratic elections and a referendum created a parliamentary republic and abolished the monarchy. In 1981, Greece joined the EC (now the EU); it became the 12th member of the European Economic and Monetary Union (EMU) in 2001. Greece has suffered a severe economic crisis since late 2009, due to nearly a decade of chronic overspending and structural rigidities. Since 2010, Greece has entered three bailout agreements with the European Commission, the European Central Bank (ECB), the IMF, and with the third, the European Stability Mechanism (ESM). The Greek Government agreed to its current, $96 billion bailout in August 2015, which will conclude in August 2018.', 'Europe', '39 00 N, 22 00 E', '131,957 sq km', '10,768,477 (July 2017 est.)', 'Greek(s)', 'population: Greek 93%, other (foreign citizens) 7% (2001 census)\r\nnote: data represent citizenship, since Greece does not collect data on ethnicity', 'Greek (official) 99%, other (includes English and French) 1%', 'Greek Orthodox (official) 98%, Muslim 1.3%, other 0.7%', 'Hellenic Republic', 'parliamentary republic', 'Athens', '13 regions (perifereies, singular - perifereia) and 1 autonomous monastic state* (aftonomi monastiki politeia); Agion Oros* (Mount Athos), Anatoliki Makedonia kai Thraki (East Macedonia and Thrace), Attiki (Attica), Dytiki Ellada (West Greece), Dytiki Makedonia (West Macedonia), Ionia Nisia (Ionian Islands), Ipeiros (Epirus), Kentriki Makedonia (Central Macedonia), Kriti (Crete), Notio Aigaio (South Aegean), Peloponnisos (Peloponnese), Sterea Ellada (Central Greece), Thessalia (Thessaly), Voreio Aigaio (North Aegean)', '3 February 1830 (from the Ottoman Empire); note - 25 March 1821, outbreak of the national revolt against the Ottomans; 3 February 1830, signing of the London Protocol recognizing Greek independence by Great Britain, France, and Russia', 'Greece has a capitalist economy with a public sector accounting for about 40% of GDP and with per capita GDP about two-thirds that of the leading euro-zone economies. Tourism provides 18% of GDP. Immigrants make up nearly one-fifth of the work force, mainly in agricultural and unskilled jobs. Greece is a major beneficiary of EU aid, equal to about 3.3% of annual GDP.\r\nThe Greek economy averaged growth of about 4% per year between 2003 and 2007, but the economy went into recession in 2009 as a result of the world financial crisis, tightening credit conditions, and Athens'' failure to address a growing budget deficit. By 2013, the economy had contracted 26%, compared with the pre-crisis level of 2007. Greece met the EU''s Growth and Stability Pact budget deficit criterion of no more than 3% of GDP in 2007-08, but violated it in 2009, when the deficit reached 15% of GDP. Deteriorating public finances, inaccurate and misreported statistics, and consistent underperformance on reforms prompted major credit rating agencies to downgrade Greece''s international debt rating in late 2009 and led the country into a financial crisis. Under intense pressure from the EU and international market participants, the government accepted a bailout program that called on Athens to cut government spending, decrease tax evasion, overhaul the civil-service, health-care, and pension systems, and reform the labor and product markets. Austerity measures reduced the deficit to 4.5% in 2016. Successive Greek governments, however, failed to push through many of the most unpopular reforms in the face of widespread political opposition, including from the country''s powerful labor unions and the general public.\r\nIn April 2010, a leading credit agency assigned Greek debt its lowest possible credit rating, and in May 2010, the IMF and euro-zone governments provided Greece emergency short- and medium-term loans worth $147 billion so that the country could make debt repayments to creditors. Greece, however, struggled to meet the targets set by the EU and the IMF, especially after Eurostat - the EU''s statistical office - revised upward Greece''s deficit and debt numbers for 2009 and 2010. European leaders and the IMF agreed in October 2011 to provide Athens a second bailout package of $169 billion. The second deal called for holders of Greek government bonds to write down a significant portion of their holdings to try to alleviate Greece’s government debt burden. However, Greek banks, saddled with a significant portion of sovereign debt, were adversely affected by the write down and $60 billion of the second bailout package was set aside to ensure the banking system was adequately capitalized.\r\nIn 2014, the Greek economy began to turn the corner on the recession. Greece achieved three significant milestones: balancing the budget - not including debt repayments; issuing government debt in financial markets for the first time since 2010; and generating 0.7% GDP growth — the first economic expansion since 2007.\r\nDespite the nascent recovery, widespread discontent with austerity measures helped propel the far-left Coalition of the Radical Left (SYRIZA) party into government in national legislative elections in January 2015. Between January and July 2015, frustrations between the SYRIZA-led government and Greece’s EU and IMF creditors over the implementation of bailout measures and disbursement of funds led the Greek government to run up significant arrears to suppliers and Greek banks to rely on emergency lending, and also called into question Greece’s future in the euro zone. To stave off a collapse of the banking system, Greece imposed capital controls in June 2015 shortly before rattling international financial markets by becoming the first developed nation to miss a loan payment to the IMF. Unable to reach an agreement with creditors, Prime Minister Alexios TSIPRAS held a nationwide referendum on 5 July on whether to accept the terms of Greece’s bailout, campaigning for the ultimately successful “no” vote. The TSIPRAS government subsequently agreed, however, to a new $96 billion bailout in order to avert Greece’s exit from the monetary bloc. On 20 August, Greece signed its third bailout which allowed it to cover significant debt payments to its EU and IMF creditors and ensure the banking sector retained access to emergency liquidity. The TSIPRAS government — which retook office on 20 September after calling new elections in late August — successfully secured disbursal of two delayed tranches of bailout funds. Despite the economic turmoil, Greek GDP did not contract as sharply as feared, with official estimates of a -0.2% contraction in 2015, boosted in part by a strong tourist season.\r\nIn 2016, Greece saw slight improvements in GDP and unemployment. The economy remains stagnant, because of unfinished economic reforms, a massive non-performing loan problem, and ongoing uncertainty regarding the political direction of the country. Some estimates put Greece’s black market at 20- to 25% of GDP, as more people have stopped reporting their income to avoid paying taxes that, in some cases, have risen to 70% of an individual’s gross income. These issues will continue to be a drag on the economy in 2017 and further delay recovery from the financial crisis.', '$194.6 billion (2016 est.)', 'wheat, corn, barley, sugar beets, olives, tomatoes, wine, tobacco, potatoes; beef, dairy products', 'tourism, food and tobacco processing, textiles, chemicals, metal products; mining, petroleum', '4.785 million (2016 est.)', 'food and beverages, manufactured goods, petroleum products, chemicals, textiles', '48.34 billion kWh (2015 est.)', '3,172 bbl/day (2016 est.)', '626,000 bbl/day (2016 est.)', '4 million cu m (2015 est.)', 'SX (2016)', '77 (2013)', '9 (2013)', 'gas 1,329 km; oil 94 km (2013)', '2,548 km', '116,960 km', '6 km (the 6-km-long Corinth Canal crosses the Isthmus of Corinth; it shortens a sea voyage by 325 km) (2012)', '2018-02-07 18:03:29', NULL),
(88, 'GL', 'gl', 'Greenland', 'Greenland, the world''s largest island, is about 81% ice-capped. Vikings reached the island in the 10th century from Iceland; Danish colonization began in the 18th century, and Greenland became an integral part of the Danish Realm in 1953. It joined the European Community (now the EU) with Denmark in 1973 but withdrew in 1985 over a dispute centered on stringent fishing quotas. Greenland remains a member of the Overseas Countries and Territories Association of the EU. Greenland was granted self-government in 1979 by the Danish parliament; the law went into effect the following year. Greenland voted in favor of increased self-rule in November 2008 and acquired greater responsibility for internal affairs when the Act on Greenland Self-Government was signed into law in June 2009. Denmark, however, continues to exercise control over several policy areas on behalf of Greenland, including foreign affairs, security, and financial policy in consultation with Greenland''s Self-Rule Government.', 'Arctic Region', '72 00 N, 40 00 W', '2,166,086 sq km', '57,713 (July 2017 est.)', 'Greenlander(s)', 'Inuit 88%, Danish and other 12% (2010 est.)', 'Greenlandic (East Inuit) (official), Danish (official), English', 'Evangelical Lutheran, traditional Inuit spiritual beliefs', 'none', 'parliamentary democracy (Parliament of Greenland or Inatsisartut); part of the Kingdom of Denmark', 'Nuuk (Godthaab)', '4 municipalities (kommuner, singular kommune); Kujalleq, Qaasuitsup, Qeqqata, Sermersooq\r\nnote: the North and East Greenland National Park (Avannaarsuani Tunumilu Nuna Allanngutsaaliugaq) and the Thule Air Base in Pituffik (in northwest Greenland) are two unincorporated areas; the national park''s 972,000 sq km - about 46% of the island - makes it the largest national park in the world and also the most northerly', 'none (extensive self-rule as part of the Kingdom of Denmark; foreign affairs is the responsibility of Denmark, but Greenland actively participates in international agreements relating to Greenland)', 'Greenland’s economy depends on exports of shrimp and fish, and on a substantial subsidy from the Danish Government. Fish account for over 90% of its exports, subjecting the economy to fluctuations in world demand. The subsidy from the Danish Government is budgeted to be about $535 million in 2017, more than 50% of government revenues, and 25% of GDP.\r\nThe economy is expanding after a period of decline. In 2016 the economy grew 4.6% compared to 1.1% in 2015 and negative growth in the years 2013-14. For 2017 the economy is expected to continue to expand at a more subdued rate. The expansion has been driven by larger quotas for shrimp, the predominant Greenlandic export, and also by increased activity in the construction sector, especially in Nuuk, the capital, where the harbor is being enlarged and a prison is under construction. Private consumption and tourism also are contributing to GDP growth more than in previous years. Tourism in Greenland has grown annually around 20% in 2015 and 2016, largely a result of increasing numbers of cruise lines now operating in Greenland''s western and southern waters during the peak summer tourism season.\r\nThe public sector, including publicly owned enterprises and the municipalities, plays a dominant role in Greenland''s economy. During the last decade the Greenland Home Rule Government pursued conservative fiscal and monetary policies, but public pressure has increased for better schools, health care, and retirement systems. The budget was in deficit in 2014 and 2016, but public debt remains low at about 5% of GDP. The government plans a balanced budget for the 2017–20 period.\r\nSignificant challenges face the island, including low levels of qualified labor, geographic dispersion, lack of industry diversification, the long-term sustainability of the public budget, and a declining population due to emigration. Catches in fisheries have been declining in recent years. Hydrocarbon exploration has ceased with declining oil prices and currently only three mines are under development. The island has potential for natural resource exploitation with rare-earth, uranium, and iron ore mineral projects proposed.', '$2.221 billion (2011 est.)', 'sheep, cow, reindeer, fish', 'fish processing (mainly shrimp and Greenland halibut); gold, zinc, anorthosite and ruby mining; handicrafts, hides and skins, small shipyards', '26,840 (2015 est.)', 'fish and fish products 91% (2015 est.)', '625 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2016 est.)', 'OY-H (2016)', '15 (2013)', '-', '-', '-', 'note: although there are short roads in towns, there are no roads between towns; inter-urban transport is either by sea or by air (2015)', '-', '2018-02-07 18:03:29', NULL),
(89, 'GD', 'gd', 'Grenada', 'Carib Indians inhabited Grenada when Christopher COLUMBUS discovered the island in 1498, but it remained uncolonized for more than a century. The French settled Grenada in the 17th century, established sugar estates, and imported large numbers of African slaves. Britain took the island in 1762 and vigorously expanded sugar production. In the 19th century, cacao eventually surpassed sugar as the main export crop; in the 20th century, nutmeg became the leading export. In 1967, Britain gave Grenada autonomy over its internal affairs. Full independence was attained in 1974 making Grenada one of the smallest independent countries in the Western Hemisphere. Grenada was seized by a Marxist military council on 19 October 1983. Six days later the island was invaded by US forces and those of six other Caribbean nations, which quickly captured the ringleaders and their hundreds of Cuban advisers. Free elections were reinstituted the following year and have continued since then.', 'Central America and the Caribbean', '12 07 N, 61 40 W', '344 sq km', '111,724 (July 2017 est.)', 'Grenadian(s)', 'African descent 82.4%, mixed 13.3%, East Indian 2.2%, other 1.3%, unspecified 0.9% (2011 est.)', 'English (official), French patois', 'Protestant 49.2% (includes Pentecostal 17.2%, Seventh Day Adventist 13.2%, Anglican 8.5%, Baptist 3.2%, Church of God 2.4%, Evangelical 1.9%, Methodist 1.6%, other 1.2%), Roman Catholic 36%, Jehovah''s Witness 1.2%, Rastafarian 1.2%, other 5.5%, none 5.7%, unspecified 1.3% (2011 est.)', 'none', 'parliamentary democracy (Parliament); a Commonwealth realm', 'Saint George''s', '6 parishes and 1 dependency*; Carriacou and Petite Martinique*, Saint Andrew, Saint David, Saint George, Saint John, Saint Mark, Saint Patrick', '7 February 1974 (from the UK)', 'Grenada relies on tourism as its main source of foreign exchange especially since the construction of an international airport in 1985. Strong performance in construction and manufacturing, together with the development of tourism and higher education - especially in medicine - contributed to growth in national output; however, economic growth remained stagnant in the 2010-14 period, after a sizable contraction in 2009, because of the global economic slowdown''s effects on tourism and remittances. Gross national saving – and wealth – has been declining since 2010.\r\nHurricanes Ivan (2004) and Emily (2005) severely damaged the agricultural sector - particularly nutmeg and cocoa cultivation - which had been a key driver of economic growth. Grenada has rebounded from the devastating effects of the hurricanes but is now saddled with the debt burden from the rebuilding process. Public debt-to-GDP is about 110%, leaving the MITCHELL administration limited room to engage in public investments and social spending. MITCHELL in 2013 announced a structural adjustment program that includes a plan to increase tax revenue.', '$1.056 billion (2016 est.)', 'bananas, cocoa, nutmeg, mace, citrus, avocados, root crops, sugarcane, corn, vegetables', 'food and beverages, textiles, light assembly operations, tourism, construction', '59,900 (2013 est.)', 'nutmeg, bananas, cocoa, fruit and vegetables, clothing, mace', '200 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'J3 (2016)', '3 (2013)', '-', '-', '-', '1,127 km', '-', '2018-02-07 18:03:29', NULL),
