(91, 'GU', 'gu', 'Guam', 'Spain ceded Guam to the US in 1898. Captured by the Japanese in 1941, it was retaken by the US three years later. The military installations on the island are some of the most strategically important US bases in the Pacific.', 'Oceania', '13 28 N, 144 47 E', '544 sq km', '167,358 (July 2017 est.)', 'Guamanian(s) (US citizens)', 'Chamorro 37.3%, Filipino 26.3%, white 7.1%, Chuukese 7%, Korean 2.2%, other Pacific Islander 2%, other Asian 2%, Chinese 1.6%, Palauan 1.6%, Japanese 1.5%, Pohnpeian 1.4%, mixed 9.4%, other 0.6% (2010 est.)', 'English 43.6%, Filipino 21.2%, Chamorro 17.8%, other Pacific island languages 10%, Asian languages 6.3%, other 1.1% (2010 est.)', 'Roman Catholic 85%, other 15% (1999 est.)', 'Territory of Guam', 'presidential democracy; a self-governing unincorporated territory of the US', 'Hagatna (Agana)', 'none (territory of the US)', 'none (territory of the US)', 'US national defense spending is the main driver of Guam’s economy, followed by tourism and other services. Guam serves as a forward US base for the Western Pacific and is home to thousands of American military personnel. Total federal spending (defense and non-defense) amounted to $1.973 billion in 2014, or 40.4% of GDP. Of that total, federal grants amounted to $373.3 million in 2013, or 32.6% of Guam’s total revenues for the fiscal year. Service exports, mainly spending by foreign tourists to Guam, amounted to $651 million in 2013, or 13.3% of GDP. In 2013, Guam’s economy grew 0.6%. Despite slow growth, Guam’s economy has been stable over the last decade. National defense spending cushions the island’s economy against fluctuations in tourism.', '$4.6 billion (2010 est.)', 'fruits, copra, vegetables; eggs, pork, poultry, beef', 'national defense, tourism, construction, transshipment services, concrete products, printing and publishing, food processing, textiles', '70,490\r\nnote: includes only the civilian labor force (2013 est.)\r\ncountry comparison to the world: 186', 'transshipments of refined petroleum products, construction materials, fish, foodstuffs and beverages', '1.623 billion kWh (2015 est.', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2014 est.)', '-', '5 (2013)', '-', '-', '-', '1,045 km (2008)', '-', '2018-02-07 18:03:29', NULL);
