(92, 'GT', 'gt', 'Guatemala', 'The Maya civilization flourished in Guatemala and surrounding regions during the first millennium A.D. After almost three centuries as a Spanish colony, Guatemala won its independence in 1821. During the second half of the 20th century, it experienced a variety of military and civilian governments, as well as a 36-year guerrilla war. In 1996, the government signed a peace agreement formally ending the internal conflict, which had left more than 200,000 people dead and had created, by some estimates, about 1 million refugees.', 'Central America and the Caribbean', '15 30 N, 90 15 W', '108,889 sq km', '15,460,732 (July 2017 est.)', 'Guatemalan(s)', 'mestizo (mixed Amerindian-Spanish - in local Spanish called Ladino) and European 60.1%, Maya 39.3% (K''iche 11.3%, Q''eqchi 7.6%, Kaqchikel 7.4%, Mam 5.5%, other 7.5%), non-Maya, non-mestizo 0.15% (Xinca (indigenous, non-Maya), Garifuna (mixed West and Central African, Island Carib, and Arawak)), other 0.5% (2001 est.)', 'Spanish (official) 68.9%, Maya languages 30.9% (K''iche 8.7%, Q''eqchi 7%, Mam 4.6%, Kaqchikel 4.3%, other 6.3%), other 0.3% (includes Xinca and Garifuna)', 'Roman Catholic, Protestant, indigenous Mayan beliefs', 'Republic of Guatemala', 'presidential republic', 'Guatemala City', '22 departments (departamentos, singular - departamento); Alta Verapaz, Baja Verapaz, Chimaltenango, Chiquimula, El Progreso, Escuintla, Guatemala, Huehuetenango, Izabal, Jalapa, Jutiapa, Peten, Quetzaltenango, Quiche, Retalhuleu, Sacatepequez, San Marcos, Santa Rosa, Solola, Suchitepequez, Totonicapan, Zacapa', '15 September 1821 (from Spain)', 'Guatemala is the most populous country in Central America with a GDP per capita roughly half the average for Latin America and the Caribbean. The agricultural sector accounts for 13.5% of GDP and 31% of the labor force; key agricultural exports include sugar, coffee, bananas, and vegetables. Guatemala is the top remittance recipient in Central America as a result of Guatemala''s large expatriate community in the US. These inflows are a primary source of foreign income, equivalent to over one-half of the country''s exports and one-tenth of its GDP.\r\nThe 1996 peace accords, which ended 36 years of civil war, removed a major obstacle to foreign investment, and Guatemala has since pursued important reforms and macroeconomic stabilization. The Dominican Republic-Central America Free Trade Agreement (CAFTA-DR) entered into force in July 2006, spurring increased investment and diversification of exports, with the largest increases in ethanol and non-traditional agricultural exports. While CAFTA-DR has helped improve the investment climate, concerns over security, the lack of skilled workers, and poor infrastructure continue to hamper foreign direct investment.\r\nThe distribution of income remains highly unequal with the richest 20% of the population accounting for more than 51% of Guatemala''s overall consumption. More than half of the population is below the national poverty line, and 23% of the population lives in extreme poverty. Poverty among indigenous groups, which make up more than 40% of the population, averages 79%, with 40% of the indigenous population living in extreme poverty. Nearly one-half of Guatemala''s children under age five are chronically malnourished, one of the highest malnutrition rates in the world.\r\nGuatemala is facing growing fiscal pressures, exacerbated by multiple corruption scandals that led to the resignation of the president, vice president, and numerous high-level economic officials in 2015.', '$67.5 billion (2016 est.)', 'sugarcane, corn, bananas, coffee, beans, cardamom; cattle, sheep, pigs, chickens', 'sugar, textiles and clothing, furniture, chemicals, petroleum, metals, rubber, tourism', '6.53 million (2016 est.)', 'sugar, coffee, petroleum, apparel, bananas, fruits and vegetables, cardamom, manufacturing products, precious stones and metals, electricity', '10.88 billion kWh (2016 est.)', '8,977 bbl/day (2016 est.)', '1,069 bbl/day (2016 est.)', '0 cu m (2013 est.)', 'TG (2016)', '291 (2013)', '1 (2013)', 'oil 480 km (2013)', '800 km', '17,621 km', '990 km (260 km navigable year round; additional 730 km navigable during high-water season) (2012)', '2018-02-07 18:03:29', NULL),
(93, 'GG', 'gg', 'Guernsey', 'Guernsey and the other Channel Islands represent the last remnants of the medieval Dukedom of Normandy, which held sway in both France and England. The islands were the only British soil occupied by German troops in World War II. The Bailiwick of Guernsey is a British crown dependency but is not part of the UK or of the EU. However, the UK Government is constitutionally responsible for its defense and international representation. The Bailiwick of Guernsey consists of the main island of Guernsey and a number of smaller islands including Alderney, Sark, Herm, Jethou, Brecqhou, and Lihou.', 'Europe', '49 28 N, 2 35 W', '78 sq km', '66,502 (July 2017 est.)', 'Channel Islander(s)', 'British and Norman-French descent with small percentages from other European countries', 'English, French, Norman-French dialect spoken in country districts', 'Protestant (Anglican, Presbyterian, Baptist, Congregational, Methodist), Roman Catholic', 'Bailiwick of Guernsey', 'parliamentary democracy (States of Deliberation); a Crown dependency of the UK', 'Saint Peter Port', 'none (British crown dependency); there are no first-order administrative divisions as defined by the US Government, but there are 10 parishes: Castel, Forest, Saint Andrew, Saint Martin, Saint Peter Port, Saint Pierre du Bois, Saint Sampson, Saint Saviour, Torteval, Vale\nnote: two additional parishes for Guernsey are sometimes listed - the parish of Saint Anne on the island of Alderney and the parish of Saint Peter on the island of Sark - but they are generally not included in the enumeration of parishes', 'none (British crown dependency)', 'Financial services account for about 40% of employment and about 55% of total income in this tiny, prosperous Channel Island economy. Tourism, manufacturing, and horticulture, mainly tomatoes and cut flowers, have been declining. Financial services, construction, retail, and the public sector have been growing. Light tax and death duties make Guernsey a popular tax haven. In October 2014, Guernsey signed an OECD agreement to automatically exchange some financial account information to limit tax avoidance and evasion.', '$2.742 billion (2005 est.)', 'tomatoes, greenhouse flowers, sweet peppers, eggplant, fruit; Guernsey cattle', 'tourism, banking', '31,470 (March 2006)', 'tomatoes, flowers and ferns, sweet peppers, eggplant, other vegetables', '-', '-', '-', '-', '-', '2 (2013)', '-', '-', '-', '-', '-', '2018-02-07 18:03:29', NULL),
(94, 'GN', 'gn', 'Guinea', 'Guinea is at a turning point after decades of authoritarian rule since gaining its independence from France in 1958. Sekou TOURE ruled the country as president from independence to his death in 1984. Lansana CONTE came to power in 1984 when the military seized the government after TOURE''s death. Gen. CONTE organized and won presidential elections in 1993, 1998, and 2003, though all the polls were rigged. Upon CONTE''s death in December 2008, Capt. Moussa Dadis CAMARA led a military coup, seizing power and suspending the constitution. His unwillingness to yield to domestic and international pressure to step down led to heightened political tensions that peaked in September 2009 when presidential guards opened fire on an opposition rally killing more than 150 people. In early December 2009, CAMARA was wounded in an assassination attempt and exiled to Burkina Faso. A transitional government led by Gen. Sekouba KONATE paved the way for Guinea''s transition to a fledgling democracy. The country held its first free and competitive democratic presidential and legislative elections in 2010 and 2013 respectively, and in October 2015 held a second consecutive presidential election. Alpha CONDE was reelected to a second five-year term as president in 2015, and the National Assembly was seated in January 2014. CONDE''s first cabinet is the first all-civilian government in Guinea. The country held a successful political dialogue in August and September 2016 that brought together the government and opposition to address long-standing tensions.', 'Africa', '11 00 N, 10 00 W', '245,857 sq km', '12,413,867 (July 2017 est.)', 'Guinean(s)', 'Fulani (Peul) 32.1%, Malinke 29.8%, Susu 19.8%, Guerze 6.2%, Kissi 4.7%, Toma 2.8%, other/no answer 4.6% (2012 est.)', 'French (official)', 'Muslim 86.2%, Christian 9.7%, animist/other/none 4.1% (2012 est.)', 'Republic of Guinea', 'presidential republic', 'Conakry', '7 regions administrative and 1 gouvenorat*; Boke, Conakry*, Faranah, Kankan, Kindia, Labe, Mamou, N''Zerekore', '2 October 1958 (from France)', 'Guinea is a poor country of approximately 12.9 million people in 2016 that possesses the world''s largest reserves of bauxite and largest untapped high-grade iron ore reserves, as well as gold and diamonds. In addition, Guinea has fertile soil, ample rainfall, and is the source of several West African rivers, including the Senegal, Niger, and Gambia. Guinea''s hydro potential is enormous and the country could be a major exporter of electricity. The country also has tremendous agriculture potential. Gold, bauxite, and diamonds are Guinea’s main exports. International investors have shown interest in Guinea''s unexplored mineral reserves, which have the potential to propel Guinea''s future growth.\r\nFollowing the death of long-term President Lansana CONTE in 2008 and the coup that followed, international donors, including the G-8, the IMF, and the World Bank, significantly curtailed their development programs in Guinea. However, the IMF approved a 3-year Extended Credit Facility arrangement in 2012, following the December 2010 presidential elections. In September 2012, Guinea achieved Heavily Indebted Poor Countries completion point status. Future access to international assistance and investment will depend on the government’s ability to be transparent, combat corruption, reform its banking system, improve its business environment, and build infrastructure. In April 2013, the government amended its mining code to reduce taxes and royalties. In 2014, Guinea also complied with requirements of the Extractive Industries Transparency Initiative by publishing its mining contracts and was found to be compliant. Guinea completed its program with the IMF in October 2016 even though some targeted reforms have been delayed. Currently Guinea is negotiating a new IMF program which will be based on Guinea’s new five-year economic plan, focusing on the development of higher value-added products, including from the agro-business sector and development of the rural economy.\r\nThe biggest threats to Guinea’s economy are political instability, a reintroduction of the Ebola virus epidemic, and low international commodity prices. Economic recovery will be a long process while the government adjusts to lower inflows of international donor aid following the surge of Ebola-related emergency support. Ebola stalled promising economic growth in the 2014-15 period and impeded several projects, such as offshore oil exploration and the Simandou iron ore project. The economy, however, grew by 6.6% in 2016 and 6.7% in 2017, mainly due to growth from bauxite mining and thermal energy generation as well as the resiliency of the agricultural sector. The 240-megawatt Kaleta Dam, inaugurated in September 2015, has expanded access to electricity for residents of Conakry. An enduring legacy of corruption, inefficiency, and lack of government transparency, combined with fears of Ebola virus, continue to undermine Guinea''s economic viability.\r\nGuinea’s iron ore industry took a hit in 2016 when investors in the Simandou iron ore project announced plans to divest from the project. In 2017, agriculture output and public investment boosted economic growth, while the mining sector continued to play a prominent role in economic performance.\r\nSuccessive governments have failed to address the country''s crumbling infrastructure. Guinea suffers from chronic electricity shortages; poor roads, rail lines and bridges; and a lack of access to clean water - all of which continue to plague economic development. The present government, led by President Alpha CONDE, is working to create an environment to attract foreign investment and hopes to have greater participation from western countries and firms in Guinea''s economic development.', '$9.183 billion (2016 est.)', 'rice, coffee, pineapples, mangoes, palm kernels, cocoa, cassava (manioc, tapioca), bananas, potatoes, sweet potatoes; cattle, sheep, goats; timber', 'bauxite, gold, diamonds, iron ore; light manufacturing, agricultural processing', '5.558 million (2017 est.)', 'bauxite, gold, diamonds, coffee, fish, agricultural products', '1 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '3X (2016)', '16 (2013)', '-', '-', '1,086 km', '44,348 km', '1,300 km (navigable by shallow-draft native craft in the northern part of the Niger River system) (2011)', '2018-02-07 18:03:29', NULL),
(95, 'GW', 'gw', 'Guinea-Bissau', 'Since independence from Portugal in 1974, Guinea-Bissau has experienced considerable political and military upheaval. In 1980, a military coup established authoritarian General Joao Bernardo ''Nino'' VIEIRA as president. Despite eventually setting a path to a market economy and multiparty system, VIEIRA''s regime was characterized by the suppression of political opposition and the purging of political rivals. Several coup attempts through the 1980s and early 1990s failed to unseat him. In 1994 VIEIRA was elected president in the country''s first free, multiparty election. A military mutiny and resulting civil war in 1998 eventually led to VIEIRA''s ouster in May 1999. In February 2000, a transitional government turned over power to opposition leader Kumba YALA after he was elected president in transparent polling. In September 2003, after only three years in office, YALA was overthrown in a bloodless military coup, and businessman Henrique ROSA was sworn in as interim president. In 2005, former President VIEIRA was reelected, pledging to pursue economic development and national reconciliation; he was assassinated in March 2009. Malam Bacai SANHA was elected in an emergency election held in June 2009, but he passed away in January 2012 from a long-term illness. A military coup in April 2012 prevented Guinea-Bissau''s second-round presidential election - to determine SANHA''s successor - from taking place. Following mediation by the Economic Community of Western African States, a civilian transitional government assumed power in 2012 and remained until Jose Mario VAZ won a free and fair election in 2014. A long-running dispute between factions in the ruling PAIGC party has brought the government to a political impasse; there have been five prime ministers since August 2015.', 'Africa', '12 00 N, 15 00 W', '36,125 sq km', '1,792,338 (July 2017 est.)', 'Bissau-Guinean(s)', 'Fulani 28.5%, Balanta 22.5%, Mandinga 14.7%, Papel 9.1%, Manjaco 8.3%, Beafada 3.5%, Mancanha 3.1%, Bijago 2.1%, Felupe 1.7%, Mansoanca 1.4%, Balanta Mane 1%, other 1.8%, none 2.2% (2008 est.)', 'Crioulo (lingua franca), Portuguese (official; largely used as a second or third language), Pular (a Fula language), Mandingo', 'Muslim 45.1%, Christian 22.1%, animist 14.9%, none 2%, unspecified 15.9% (2008 est.)', 'Republic of Guinea-Bissau', 'semi-presidential republic', 'Bissau', '9 regions (regioes, singular - regiao); Bafata, Biombo, Bissau, Bolama/Bijagos, Cacheu, Gabu, Oio, Quinara, Tombali', '24 September 1973 (declared); 10 September 1974 (from Portugal)', 'Guinea-Bissau is highly dependent on subsistence agriculture, cashew nut exports, and foreign assistance. Two out of three Bissau-Guineans remain below the absolute poverty line. The legal economy is based on cashews and fishing. Illegal logging and trafficking in narcotics also play significant roles. The combination of limited economic prospects, weak institutions, and favorable geography have made this West African country a way station for drugs bound for Europe.\r\nGuinea-Bissau has substantial potential for development of mineral resources, including phosphates, bauxite, and mineral sands. Offshore oil and gas exploration has begun. The country’s climate and soil make it feasible to grow a wide range of cash crops, fruit, vegetables, and tubers; however, cashews generate more than 80% of export receipts and are the main source of income for many rural communities.\r\nWith renewed donor support following elections in April-May 2014 and a successful regional bond issuance, the Government of Guinea-Bissau began to make progress paying salaries, settling domestic arrears, and gaining more control over revenues and expenditures, but it was deposed by the president in August 2015. A political stalemate since then has resulted in weak governance and reduced donor support.\r\nThe country is participating in a three-year, IMF extended credit facility program that was suspended because of a planned bank bailout. The program was renewed in 2017, but the major donors of direct budget support (the EU, World Bank, and African Development Bank) have halted their programs indefinitely. Diversification of the economy remains a key policy goal, but Guinea-Bissau’s poor infrastructure and business climate will constrain this effort.', '$1.152 billion (2016 est.)', 'rice, corn, beans, cassava (manioc, tapioca), cashew nuts, peanuts, palm kernels, cotton; timber; fish', 'agricultural products processing, beer, soft drinks', '731,300 (2013 est.)', 'fish, shrimp; cashews, peanuts, palm kernels, raw and sawn lumber', '34 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'J5 (2016)', '8 (2013)', '-', '-', '-', '3,455 km', '(rivers are partially navigable; many inlets and creeks provide shallow-water access to much of interior) (2012)', '2018-02-07 18:03:29', NULL),
(96, 'GY', 'gy', 'Guyana', 'Originally a Dutch colony in the 17th century, by 1815 Guyana had become a British possession. The abolition of slavery led to settlement of urban areas by former slaves and the importation of indentured servants from India to work the sugar plantations. The resulting ethnocultural divide has persisted and has led to turbulent politics. Guyana achieved independence from the UK in 1966, and since then it has been ruled mostly by socialist-oriented governments. In 1992, Cheddi JAGAN was elected president in what is considered the country''s first free and fair election since independence. After his death five years later, his wife, Janet JAGAN, became president but resigned in 1999 due to poor health. Her successor, Bharrat JAGDEO, was elected in 2001 and again in 2006. Early elections held in May 2015 resulted in the first change in governing party and the replacement of President Donald RAMOTAR by current President David GRANGER', 'South America', '5 00 N, 59 00 W', '214,969 sq km', '737,718\r\nnote: estimates for this country explicitly take into account the effects of excess mortality due to AIDS; this can result in lower life expectancy, higher infant mortality, higher death rates, lower population growth rates, and changes in the di', 'Guyanese (singular and plural)', 'East Indian 39.8%, black (African) 29.3%, mixed 19.9%, Amerindian 10.5%, other 0.5% (includes Portuguese, Chinese, white) (2012 est.)', 'English (official), Guyanese Creole, Amerindian languages (including Caribbean and Arawak languages), Indian languages (including Caribbean Hindustani, a dialect of Hindi), Chinese (2014 est.)', 'Protestant 34.8% (Pentecostal 22.8%, Seventh Day Adventist 5.4%, Anglican 5.2%, Methodist 1.4%), Hindu 24.8%, Roman Catholic 7.1%, Muslim 6.8%, Jehovah''s Witness 1.3%, Rastafarian 0.5%, other Christian 20.8%, other 0.9%, none 3.1% (2012 est.)', 'Cooperative Republic of Guyana', 'parliamentary republic', 'Georgetown', '10 regions; Barima-Waini, Cuyuni-Mazaruni, Demerara-Mahaica, East Berbice-Corentyne, Essequibo Islands-West Demerara, Mahaica-Berbice, Pomeroon-Supenaam, Potaro-Siparuni, Upper Demerara-Berbice, Upper Takutu-Upper Essequibo', '26 May 1966 (from the UK)', 'The Guyanese economy exhibited moderate economic growth in recent years and is based largely on agriculture and extractive industries. The economy is heavily dependent upon the export of six commodities - sugar, gold, bauxite, shrimp, timber, and rice - which represent nearly 60% of the country''s GDP and are highly susceptible to adverse weather conditions and fluctuations in commodity prices. Much of Guyana''s growth in recent years has come from a surge in gold production in response to global prices, although downward trends in gold prices may threaten future growth. In 2014, production of sugar dropped to a 24-year low.\r\nGuyana''s entrance into the Caricom Single Market and Economy in January 2006 broadened the country''s export market, primarily in the raw materials sector. Guyana has experienced positive growth almost every year over the past decade. Inflation has been kept under control. Recent years have seen the government''s stock of debt reduced significantly - with external debt now less than half of what it was in the early 1990s. Despite recent improvements, the government is still juggling a sizable external debt against the urgent need for expanded public investment. In March 2007, the Inter-American Development Bank, Guyana''s principal donor, canceled Guyana''s nearly $470 million debt, equivalent to 21% of GDP, which along with other Highly Indebted Poor Country debt forgiveness, brought the debt-to-GDP ratio down from 183% in 2006 to 67% in 2015. Guyana had become heavily indebted as a result of the inward-looking, state-led development model pursued in the 1970s and 1980s. Chronic problems include a shortage of skilled labor and a deficient infrastructure.', '$3.437 billion (2016 est.)', 'sugarcane, rice, edible oils; beef, pork, poultry; shrimp, fish', 'bauxite, sugar, rice milling, timber, textiles, gold mining', '313,800 (2013 est.)', 'sugar, gold, bauxite, alumina, rice, shrimp, molasses, rum, timber', '1 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '8R (2016)', '117 (2013)', '-', '-', '-', '7,970 km', '330 km (the Berbice, Demerara, and Essequibo Rivers are navigable by oceangoing vessels for 150 km, 100 km, and 80 km respectively) (2012)', '2018-02-07 18:03:29', NULL),
(97, 'HT', 'ht', 'Haiti', 'The native Taino - who inhabited the island of Hispaniola when it was discovered by Christopher COLUMBUS in 1492 - were virtually annihilated by Spanish settlers within 25 years. In the early 17th century, the French established a presence on Hispaniola. In 1697, Spain ceded to the French the western third of the island, which later became Haiti. The French colony, based on forestry and sugar-related industries, became one of the wealthiest in the Caribbean but only through the heavy importation of African slaves and considerable environmental degradation. In the late 18th century, Haiti''s nearly half million slaves revolted under Toussaint L''OUVERTURE. After a prolonged struggle, Haiti became the first post-colonial black-led nation in the world, declaring its independence in 1804. Currently the poorest country in the Western Hemisphere, Haiti has experienced political instability for most of its history. A massive magnitude 7.0 earthquake struck Haiti in January 2010 with an epicenter about 25 km (15 mi) west of the capital, Port-au-Prince. Estimates are that over 300,000 people were killed and some 1.5 million left homeless. The earthquake was assessed as the worst in this region over the last 200 years. President Michel MARTELLY resigned in February 2016 and was replaced by Interim President Jocelerme PRIVERT. President Jovenel MOISE won the November 2016 elections and assumed office in February 2017.', 'Central America and the Caribbean', '19 00 N, 72 25 W', '27,750 sq km', '10,646,714\r\nnote: estimates for this country explicitly take into account the effects of excess mortality due to AIDS; this can result in lower life expectancy, higher infant mortality, higher death rates, lower population growth rates, and changes in the', 'Haitian(s)', 'black 95%, mulatto and white 5%', 'French (official), Creole (official)', 'Roman Catholic (official) 54.7%, Protestant 28.5% (Baptist 15.4%, Pentecostal 7.9%, Adventist 3%, Methodist 1.5%, other 0.7%), voodoo (official) 2.1%, other 4.6%, none 10.2%', 'Republic of Haiti', 'semi-presidential republic', 'Port-au-Prince', '10 departments (departements, singular - departement); Artibonite, Centre, Grand''Anse, Nippes, Nord, Nord-Est, Nord-Ouest, Ouest, Sud, Sud-Est', '1 January 1804 (from France)', 'Haiti is a free market economy with low labor costs and tariff-free access to the US for many of its exports. Two-fifths of all Haitians depend on the agricultural sector, mainly small-scale subsistence farming, which remains vulnerable to damage from frequent natural disasters. Poverty, corruption, vulnerability to natural disasters, and low levels of education for much of the population represent some of the most serious impediments to Haiti’s economic growth. Remittances are the primary source of foreign exchange, equivalent to more than a quarter of GDP, and nearly double the combined value of Haitian exports and foreign direct investment.\r\nCurrently the poorest country in the Western Hemisphere, with close to 60% of the population living under the national poverty line, Haiti’s GDP growth rose to 5.5% in 2011 as the Haitian economy began recovering from the devastating January 2010 earthquake that destroyed much of its capital city, Port-au-Prince, and neighboring areas. However, growth slowed to below 2% in 2015 and 2016 as political uncertainty, drought conditions, decreasing foreign aid, and the depreciation of the national currency took a toll on investment and economic growth. Hurricane Matthew, the fiercest Caribbean storm in nearly a decade, made landfall in Haiti on 4 October 2016, with 140 mile-per-hour winds, creating a new humanitarian emergency. An estimated 2.1 million people were affected by the category 4 storm, which caused extensive damage to crops, houses, livestock, and infrastructure across Haiti’s southern peninsula.\r\nUS economic engagement under the Caribbean Basin Trade Partnership Act (CBTPA) and the 2008 Haitian Hemispheric Opportunity through Partnership Encouragement Act (HOPE II) have contributed to an increase in apparel exports and investment by providing duty-free access to the US. The Haiti Economic Lift Program (HELP) Act of 2010 extended the CBTPA and HOPE II until 2020, while the Trade Preferences Extension Act of 2015 extended trade benefits provided to Haiti in the HOPE and HELP Acts through September 2025. Apparel sector exports in 2016 reached approximately $850 million and account for over 90% of Haitian exports and more than 10% of the GDP.\r\nInvestment in Haiti is hampered by the difficulty of doing business and weak infrastructure, including access to electricity. Haiti''s outstanding external debt was cancelled by donor countries following the 2010 earthquake, but has since risen to above $2 billion as of December 2016, the majority of which is owed to Venezuela under the PetroCaribe program. Although the government has increased its revenue collection, it continues to rely on formal international economic assistance for fiscal sustainability, with over 20% of its annual budget coming from foreign aid or direct budget support.', '$8.232 billion (2016 est.)', 'coffee, mangoes, cocoa, sugarcane, rice, corn, sorghum; wood, vetiver', 'textiles, sugar refining, flour milling, cement, light assembly using imported parts', '4.594 million', 'apparel, manufactures, oils, cocoa, mangoes, coffee', '979.7 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'HH (2016)', '14 (2013)', '-', '-', '-', '4,266 km', '-', '2018-02-07 18:03:29', NULL),
(98, 'HM', 'hm', 'Heard Island and McDonald Islands', 'The UK transferred these uninhabited, barren, sub-Antarctic islands to Australia in 1947. Populated by large numbers of seal and bird species, the islands have been designated a nature preserve.', 'Antarctic Region', '53 06 S, 72 31 E', '412 sq km', 'uninhabited', '-', '-', '', '-', '-', '-', '-', '-', '-', 'The islands have no indigenous economic activity, but the Australian Government allows limited fishing in the surrounding waters. Visits to Heard Island typically focus on terrestrial and marine research and infrequent private expeditions.', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '2018-02-07 18:03:29', NULL),
(99, 'HN', 'hn', 'Honduras', 'Once part of Spain''s vast empire in the New World, Honduras became an independent nation in 1821. After two and a half decades of mostly military rule, a freely elected civilian government came to power in 1982. During the 1980s, Honduras proved a haven for anti-Sandinista contras fighting the Marxist Nicaraguan Government and an ally to Salvadoran Government forces fighting leftist guerrillas. The country was devastated by Hurricane Mitch in 1998, which killed about 5,600 people and caused approximately $2 billion in damage. Since then, the economy has slowly rebounded.', 'Central America and the Caribbean', '15 00 N, 86 30 W', '112,090 sq km', '9,038,741', 'Honduran(s)', 'mestizo (mixed Amerindian and European) 90%, Amerindian 7%, black 2%, white 1%', 'Spanish (official), Amerindian dialects', 'Roman Catholic 46%, Protestant 41%, atheist 1%, other 2%, none 9% (2014 est.)', 'Republic of Honduras', 'presidential republic', 'Tegucigalpa', '18 departments (departamentos, singular - departamento); Atlantida, Choluteca, Colon, Comayagua, Copan, Cortes, El Paraiso, Francisco Morazan, Gracias a Dios, Intibuca, Islas de la Bahia, La Paz, Lempira, Ocotepeque, Olancho, Santa Barbara, Valle, Yoro', '15 September 1821 (from Spain)', 'Honduras, the second poorest country in Central America, suffers from extraordinarily unequal distribution of income, as well as high underemployment. While historically dependent on the export of bananas and coffee, Honduras has diversified its export base to include apparel and automobile wire harnessing.\r\nHonduras’s economy depends heavily on US trade and remittances. The US-Central America-Dominican Republic Free Trade Agreement came into force in 2006 and has helped foster foreign direct investment, but physical and political insecurity, as well as crime and perceptions of corruption, may deter potential investors; about 15% of foreign direct investment is from US firms.\r\nThe economy registered modest economic growth of 3.1%-3.6% from 2010 to 2016, insufficient to improve living standards for the nearly 65% of the population in poverty. In 2016, Honduras faced rising public debt but its economy has performed better than expected due to low oil prices and improved investor confidence. The IMF continues to monitor the three-year standby arrangement signed in December 2014, aimed at easing Honduras’s poor fiscal position.', '$21.37 billion (2016 est.)', 'bananas, coffee, citrus, corn, African palm; beef; timber; shrimp, tilapia, lobster, sugar, oriental vegetables', 'sugar processing, coffee, woven and knit apparel, wood products, cigars', '3.677 million (2016 est.)', 'coffee, apparel, coffee, shrimp, automobile wire harnesses, cigars, bananas, gold, palm oil, fruit, lobster, lumber', '8.367 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'HR (2016)', '103 (2013)', '-', '-', '699 km', '14,742 km', '465 km (most navigable only by small craft) (2012)', '2018-02-07 18:03:29', NULL),
(100, 'HK', 'hk', 'Hong Kong', 'Occupied by the UK in 1841, Hong Kong was formally ceded by China the following year; various adjacent lands were added later in the 19th century. Pursuant to an agreement signed by China and the UK on 19 December 1984, Hong Kong became the Hong Kong Special Administrative Region of the People''s Republic of China on 1 July 1997. In this agreement, China promised that, under its "one country, two systems" formula, China''s socialist economic system would not be imposed on Hong Kong and that Hong Kong would enjoy a "high degree of autonomy" in all matters except foreign and defense affairs for the subsequent 50 years.', 'Southeast Asia', '22 15 N, 114 10 E', '1,108 sq km', '7,191,503 (July 2017 est.)', 'Chinese/Hong Konger', 'Chinese 92%, Filipino 2.5%, Indonesian 2.1%, other 3.4% (2016 est.)', 'Cantonese (official) 88.9%, English (official) 4.3%, Mandarin (official) 1.9%, other Chinese dialects 3.1%, other 1.9% (2016 est.)', 'eclectic mixture of local religions 90%, Christian 10%', 'Hong Kong Special Administrative Region', 'presidential limited democracy; a special administrative region of the People''s Republic of China', '', 'none (special administrative region of the People''s Republic of China)', 'none (special administrative region of China)', 'Hong Kong has a free market economy, highly dependent on international trade and finance - the value of goods and services trade, including the sizable share of reexports, is about four times GDP. Hong Kong has no tariffs on imported goods, and it levies excise duties on only four commodities, whether imported or produced locally: hard alcohol, tobacco, hydrocarbon oil, and methyl alcohol. There are no quotas or dumping laws. Hong Kong continues to link its currency closely to the US dollar, maintaining an arrangement established in 1983.\r\nHong Kong''s open economy left it exposed to the global economic slowdown that began in 2008. Although increasing integration with China through trade, tourism, and financial links aided a more rapid initial recovery than many observers anticipated, its continued reliance on foreign trade and investment leaves it vulnerable to renewed global financial market volatility or a slowdown in the global economy.\r\nThe Hong Kong Government is promoting the Special Administrative Region (SAR) as the site for Chinese renminbi (RMB) internationalization. Hong Kong residents are allowed to establish RMB-denominated savings accounts; RMB-denominated corporate and Chinese government bonds have been issued in Hong Kong; and RMB trade settlement is allowed. The territory far exceeded the RMB conversion quota set by Beijing for trade settlements in 2010 due to the growth of earnings from exports to the mainland. RMB deposits grew to roughly 9.4% of total system deposits in Hong Kong by the end of 2015. The government is pursuing efforts to introduce additional use of RMB in Hong Kong financial markets and is seeking to expand the RMB quota.\r\nThe mainland has long been Hong Kong''s largest trading partner, accounting for about half of Hong Kong''s total trade by value. Hong Kong''s natural resources are limited, and food and raw materials must be imported. As a result of China''s easing of travel restrictions, the number of mainland tourists to the territory has surged from 4.5 million in 2001 to 47.3 million in 2014, outnumbering visitors from all other countries combined. Mainland visitors to Hong Kong declined 3% in 2015 to approximately 45.7 million, reflecting an overall drop of 2.5% in total visitors to Hong Kong. Hong Kong has also established itself as the premier stock market for Chinese firms seeking to list abroad. In 2015, mainland Chinese companies constituted about 51% of the firms listed on the Hong Kong Stock Exchange and accounted for about 62.1% of the exchange''s market capitalization. During the past decade, as Hong Kong''s manufacturing industry moved to the mainland, its service industry has grown rapidly. In 2014, Hong Kong and China signed a new agreement on achieving basic liberalization of trade in services in Guangdong Province under the Closer Economic Partnership Agreement, adopted in 2003 to forge closer ties between Hong Kong and the mainland. The new measures, effective March 2015, cover a negative list and a most-favored treatment provision, and will improve access to the mainland''s service sector for Hong Kong-based companies.\r\nCredit expansion and a tight housing supply have caused Hong Kong property prices to rise rapidly; consumer prices increased 4.4% in 2014, but slowed to 2.9% in 2015. Lower- and middle-income segments of the population are increasingly unable to afford adequate housing.\r\nHong Kong’s economic integration with the mainland continues to be most evident in the banking and finance sector. Initiatives like the Hong Kong-Shanghai Stock Connect, the Mutual Recognition of Funds, and The Hong Kong Shanghai Gold Connect are all important steps towards opening up the Mainland’s capital markets and has reinforced Hong Kong’s leading role as China’s offshore RMB market. Additional connect schemes from bonds to commodities and other investment products are also under exploration by Hong Kong authorities.', '$320.9 billion (2016 est.)', 'fresh vegetables and fruit; poultry, pork; fish', 'textiles, clothing, tourism, banking, shipping, electronics, plastics, toys, watches, clock', '3.915 million (2016 est.)', 'electrical machinery and appliances, textiles, apparel, footwear, watches and clocks, toys, plastics, precious stones, printed material', '35.75 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'B-H (2016)', '2 (2013)', '9 (2013)', '-', '-', '2,100 km', '-', '2018-02-07 18:03:29', NULL),
(101, 'HU', 'hu', 'Hungary', 'Hungary became a Christian kingdom in A.D. 1000 and for many centuries served as a bulwark against Ottoman Turkish expansion in Europe. The kingdom eventually became part of the polyglot Austro-Hungarian Empire, which collapsed during World War I. The country fell under communist rule following World War II. In 1956, a revolt and an announced withdrawal from the Warsaw Pact were met with a massive military intervention by Moscow. Under the leadership of Janos KADAR in 1968, Hungary began liberalizing its economy, introducing so-called "Goulash Communism." Hungary held its first multiparty elections in 1990 and initiated a free market economy. It joined NATO in 1999 and the EU five years later.', 'Europe', '47 00 N, 20 00 E', '93,028 sq km', '9,850,845 (July 2017 est.)', 'Hungarian(s)', 'Hungarian 85.6%, Romani 3.2%, German 1.9%, other 2.6%, unspecified 14.1% (2011 est.)\r\nnote: percentages add up to more than 100% because respondents were able to identify more than one ethnic group; Romani populations are usually underestimated in official statistics and may represent 5–10% of Hungary''s population', 'Hungarian (official) 99.6%, English 16%, German 11.2%, Russian 1.6%, Romanian 1.3%, French 1.2%, other 4.2%', 'Roman Catholic 37.2%, Calvinist 11.6%, Lutheran 2.2%, Greek Catholic 1.8%, other 1.9%, none 18.2%, unspecified 27.2% (2011 est.)', 'none', 'parliamentary republic', 'Budapest', '19 counties (megyek, singular - megye), 23 cities with county rights (megyei jogu varosok, singular - megyei jogu varos), and 1 capital city (fovaros)', '16 November 1918 (republic proclaimed); notable earlier dates: 25 December 1000 (crowning of King STEPHEN I, traditional founding date); 30 March 1867 (Austro-Hungarian dual monarchy established)', 'Hungary has transitioned from a centrally planned to a market-driven economy with a per capita income nearly two-thirds that of the EU-28 average; however, in recent years the government has become more involved in managing the economy. Budapest has implemented unorthodox economic policies to boost household consumption and has relied on EU-funded development projects to generate growth.\r\nThe economy is largely driven by exports, making it vulnerable to external market shocks. Following the fall of communism in 1990, Hungary experienced a drop-off in exports and financial assistance from the former Soviet Union. Hungary embarked on a series of economic reforms, including privatization of state-owned enterprises and reduction of social spending programs, to shift from a centrally planned to a market-driven economy, and to reorient its economy towards trade with the West. These efforts helped to spur growth, attract investment, and reduce Hungary’s debt burden and fiscal deficits. However, living conditions for the average Hungarian initially deteriorated as inflation increased and unemployment reached double digits. Conditions slowly improved over the 1990s as the reforms came to fruition and export growth accelerated. Economic policies instituted during that decade helped position Hungary to join the European Union in 2004; Hungary has yet to join the euro-zone, however. Hungary suffered a historic economic contraction as a result of the global economic slowdown in 2008-09 as export demand and domestic consumption dropped, prompting it to take an IMF-EU financial assistance package.\r\nSince 2010, the government has backpedalled on reforms and taken a more nationalist and populist approach towards economic management. The government has favored national industries, and specifically government-linked businesses, through legislation, regulation, and public procurements. In 2010 and 2012, the government increased taxes on foreign-dominated sectors, such as banking and retail, because the move helped to raise revenues and decrease the budget deficit, thereby allowing Hungary to maintain access to EU development funds. The policy deterred private investment, however. In 2011 and 2014, Hungary nationalized private pension funds. The move squeezed financial service providers out of the system, but it also helped Hungary curb its public debt and lower its budget deficit to below 3% of GDP, as subsequent pension contributions have been channeled into the state-managed pension fund. Hungary’s public debt (at 73.9% of GDP) is still high compared to EU peers in Central Europe. Despite these reversals, real GDP growth has remained robust in the past several years because EU cyclical funding increased, EU demand for Hungarian exports rose, and domestic household consumption rebounded. To further boost household consumption ahead of an anticipated 2018 election, the government has announced plans to increase the minimum wage and public sector salaries, to decrease taxes on foodstuffs and services, to decrease personal income tax from 16% to 15%, as well as to introduce a uniform 9% business tax for both small and medium enterprises and large companies. Real GDP growth slowed in 2016 due to a cyclical fallback in EU funds, but is expected to increase to above 3% in 2017 and 2018.\r\nSystemic economic challenges include long-term and youth unemployment, labor shortages, widespread poverty in rural areas, vulnerabilities to changes in demand for exports, and a heavy reliance on Russian energy imports.', '$124.4 billion (2016 est.)', 'wheat, corn, sunflower seed, potatoes, sugar beets; pigs, cattle, poultry, dairy products', 'mining, metallurgy, construction materials, processed foods, textiles, chemicals (especially pharmaceuticals), motor vehicles', '4.586 million (2016 est.)', 'machinery and equipment 53.4%, other manufactures 31.2%, food products 8.4%, raw materials 3.4%, fuels and electricity 3.9% (2012 est.)', '28.67 billion kWh (2015 est.)', '13,830 bbl/day (2016 est.)', '156,100 bbl/day (2016 est.)', '1.772 billion cu m (2015 est.)', 'HA (2016)', '41 (2013)', '3 (2013)', 'gas (high-pressure transmission system) 5,873 km; gas (low-pressure distribution network) 83,619 km (2015); oil 850 km; refined products 1,200 km (2016)', '8,049 km', '203,601 km', '1,622 km (most on Danube River) (2011)', '2018-02-07 18:03:29', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(102, 'IS', 'is', 'Iceland', 'Settled by Norwegian and Celtic (Scottish and Irish) immigrants during the late 9th and 10th centuries A.D., Iceland boasts the world''s oldest functioning legislative assembly, the Althingi, established in 930. Independent for over 300 years, Iceland was subsequently ruled by Norway and Denmark. Fallout from the Askja volcano of 1875 devastated the Icelandic economy and caused widespread famine. Over the next quarter century, 20% of the island''s population emigrated, mostly to Canada and the US. Denmark granted limited home rule in 1874 and complete independence in 1944. The second half of the 20th century saw substantial economic growth driven primarily by the fishing industry. The economy diversified greatly after the country joined the European Economic Area in 1994, but Iceland was especially hard hit by the global financial crisis in the years following 2008. The economy is now on an upward trajectory, fueled primarily by a tourism and construction boom. Literacy, longevity, and social cohesion are first rate by world standards.', 'Arctic Region', '65 00 N, 18 00 W', '103,000 sq km', '339,747 (July 2017 est.)', 'Icelander(s)', 'homogeneous mixture of descendants of Norse and Celts 94%, population of foreign origin 6%', 'Icelandic, English, Nordic languages, German widely spoken', 'Evangelical Lutheran Church of Iceland (official) 69.9%, Roman Catholic 3.8%, Reykjavik Free Church 2.9%, Hafnarfjorour Free Church 2%, Asatru Association 1.1%, The Independent Congregation 1%, other religions 4% (includes Zuist and Pentecostal), none 6.1%, other or unspecified 9.2% (2017 est.)', 'Republic of Iceland', 'parliamentary republic', 'Reykjavik', '8 regions; Austurland, Hofudhborgarsvaedhi, Nordhurland Eystra, Nordhurland Vestra, Sudhurland, Sudhurnes, Vestfirdhir, Vesturland', '1 December 1918 (became a sovereign state under the Danish Crown); 17 June 1944 (from Denmark; birthday of Jon SIGURDSSON, leader of Iceland''s 19th Century independence movement)', 'Iceland''s economy combines a capitalist structure and free-market principles with an extensive welfare system. Except for a brief period during the 2008 crisis, Iceland has achieved high growth, low unemployment, and a remarkably even distribution of income. The economy depends heavily on the fishing industry, which provides 40% of merchandise export earnings, more than 12% of GDP, and employs nearly 5% of the work force. It remains sensitive to declining fish stocks, as well as to fluctuations in world prices for its main exports: fish and fish products, aluminum, and ferrosilicon. Since 2010, tourism has become the main pillar of Icelandic economic growth, with the number of tourists reaching 4.5 times the Icelandic population in 2016.\r\nIceland''s economy has been diversifying into manufacturing and service industries in the last decade, particularly within the fields of tourism, software production, and biotechnology. In fall 2013, the Icelandic Government approved a joint application by Icelandic, Chinese, and Norwegian energy firms to conduct oil exploration off Iceland’s northeast coast, although no exploration has yet taken place. Abundant geothermal and hydropower sources have attracted substantial foreign investment in the aluminum sector, boosted economic growth, and sparked some interest from high-tech firms looking to establish data centers using cheap green energy, although the financial crisis has put several investment projects on hold.\r\nFollowing the privatization of the banking sector in the early 2000s, domestic banks expanded aggressively in foreign markets, and consumers and businesses borrowed heavily in foreign currencies. Worsening global financial conditions throughout 2008 resulted in a sharp depreciation of the krona vis-a-vis other major currencies. The foreign exposure of Icelandic banks, whose loans and other assets totaled more than 10 times the country''s GDP, became unsustainable. Iceland''s three largest banks collapsed in late 2008. The country secured over $10 billion in loans from the IMF and other countries to stabilize its currency and financial sector, and to back government guarantees for foreign deposits in Icelandic banks. GDP fell 6.8% in 2009, and unemployment peaked at 9.4% in February 2009. Three new banks were established to take over the domestic assets of the collapsed banks. Two of them have majority ownership by the state, which intends to re-privatize them.\r\nSince the collapse of Iceland''s financial sector, government economic priorities have included stabilizing the krona, implementing capital controls, reducing Iceland''s high budget deficit, containing inflation, addressing high household debt, restructuring the financial sector, and diversifying the economy. Capital controls were finally lifted in March 2017, but some financial protections (e.g., reserve requirements for specified investments connected to new inflows of foreign currency) remain in place. Iceland’s financial woes prompted an initial increase in public support to join the EU and the euro zone, with accession negotiations beginning in July 2010, but negotiations were suspended under the center-right government that took power in 2013. The current ruling coalition does not intend to restart accession talks, but has signaled that it would allow a vote on the question of EU membership, if a bill came before parliament near the end of the current parliamentary term. Most macroeconomic indicators and employment have rebounded to pre-crisis levels, driven primarily by the unprecedented growth in tourism – averaging over 20% annually – following the well-publicized volcanic eruption in 2010.', '$20.05 billion (2016 est.)', 'potatoes, carrots, green vegetables, tomatoes, cucumbers; mutton, chicken, pork, beef, dairy products; fish', 'tourism, fish processing; aluminum smelting;; geothermal power, hydropower; medical/pharmaceutical products', '196,500 (2016 est.)', 'fish and fish products (42%), aluminum (38%), agricultural products, medicinal and medical products, ferro-silicon (2015)', '18.56 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2016 est.)', '0 cu m (2014 est.)', 'TF (2016)', '96 (2013)', '-', '-', '-', '12,890 km', '-', '2018-02-07 18:03:30', NULL),
(103, 'IN', 'in', 'India', 'The Indus Valley civilization, one of the world''s oldest, flourished during the 3rd and 2nd millennia B.C. and extended into northwestern India. Aryan tribes from the northwest infiltrated the Indian subcontinent about 1500 B.C.; their merger with the earlier Dravidian inhabitants created the classical Indian culture. The Maurya Empire of the 4th and 3rd centuries B.C. - which reached its zenith under ASHOKA - united much of South Asia. The Golden Age ushered in by the Gupta dynasty (4th to 6th centuries A.D.) saw a flowering of Indian science, art, and culture. Islam spread across the subcontinent over a period of 700 years. In the 10th and 11th centuries, Turks and Afghans invaded India and established the Delhi Sultanate. In the early 16th century, the Emperor BABUR established the Mughal Dynasty, which ruled India for more than three centuries. European explorers began establishing footholds in India during the 16th century.\r\nBy the 19th century, Great Britain had become the dominant political power on the subcontinent. The British Indian Army played a vital role in both World Wars. Years of nonviolent resistance to British rule, led by Mohandas GANDHI and Jawaharlal NEHRU, eventually resulted in Indian independence, which was granted in 1947. Large-scale communal violence took place before and after the subcontinent partition into two separate states - India and Pakistan. The neighboring nations have fought three wars since independence, the last of which was in 1971 and resulted in East Pakistan becoming the separate nation of Bangladesh. India''s nuclear weapons tests in 1998 emboldened Pakistan to conduct its own tests that same year. In November 2008, terrorists originating from Pakistan conducted a series of coordinated attacks in Mumbai, India''s financial capital. Despite pressing problems such as significant overpopulation, environmental degradation, extensive poverty, and widespread corruption, economic growth following the launch of economic reforms in 1991 and a massive youthful population are driving India''s emergence as a regional and global power.', 'Asia', '20 00 N, 77 00 E', '3,287,263 sq km', '1,281,935,911 (July 2017 est.)', 'Indian(s)', 'Indo-Aryan 72%, Dravidian 25%, Mongoloid and other 3% (2000)', 'Hindi 41%, Bengali 8.1%, Telugu 7.2%, Marathi 7%, Tamil 5.9%, Urdu 5%, Gujarati 4.5%, Kannada 3.7%, Malayalam 3.2%, Oriya 3.2%, Punjabi 2.8%, Assamese 1.3%, Maithili 1.2%, other 5.9%', 'Hindu 79.8%, Muslim 14.2%, Christian 2.3%, Sikh 1.7%, other and unspecified 2% (2011 est.)', 'Republic of India', 'federal parliamentary republic', 'New Delhi', '29 states and 7 union territories*; Andaman and Nicobar Islands*, Andhra Pradesh, Arunachal Pradesh, Assam, Bihar, Chandigarh*, Chhattisgarh, Dadra and Nagar Haveli*, Daman and Diu*, Delhi*, Goa, Gujarat, Haryana, Himachal Pradesh, Jammu and Kashmir, Jharkhand, Karnataka, Kerala, Lakshadweep*, Madhya Pradesh, Maharashtra, Manipur, Meghalaya, Mizoram, Nagaland, Odisha, Puducherry*, Punjab, Rajasthan, Sikkim, Tamil Nadu, Telangana, Tripura, Uttar Pradesh, Uttarakhand, West Bengal\r\nnote: although its status is that of a union territory, the official name of Delhi is National Capital Territory of Delhi', '15 August 1947 (from the UK)', 'India''s diverse economy encompasses traditional village farming, modern agriculture, handicrafts, a wide range of modern industries, and a multitude of services. Slightly less than half of the workforce is in agriculture, but services are the major source of economic growth, accounting for nearly two-thirds of India''s output but employing less than one-third of its labor force. India has capitalized on its large educated English-speaking population to become a major exporter of information technology services, business outsourcing services, and software workers.\r\nIndia is developing into an open-market economy, yet traces of its past autarkic policies remain. Economic liberalization measures, including industrial deregulation, privatization of state-owned enterprises, and reduced controls on foreign trade and investment, began in the early 1990s and served to accelerate the country''s growth, which averaged nearly 7% per year from 1997 to 2016. India''s economic growth slowed in 2011 because of a decline in investment caused by high interest rates, rising inflation, and investor pessimism about the government''s commitment to further economic reforms and about slow world growth. Rising macroeconomic imbalances in India and improving economic conditions in Western countries led investors to shift capital away from India, prompting a sharp depreciation of the rupee.\r\nGrowth rebounded in 2014 through 2016, exceeding 7% each year. Investors’ perceptions of India improved in early 2014, due to a reduction of the current account deficit and expectations of post-election economic reform, resulting in a surge of inbound capital flows and stabilization of the rupee. Since the election, the government has passed an important goods and services tax bill and raised foreign direct investment caps in some sectors, but most economic reforms have focused on administrative and governance changes largely because the ruling party remains a minority in India’s upper house of Parliament, which must approve most bills. Despite a high growth rate compared to the rest of the world, India’s government-owned banks faced mounting bad debt in 2015 and 2016, resulting in low credit growth and restrained economic growth.\r\nThe outlook for India''s long-term growth is moderately positive due to a young population and corresponding low dependency ratio, healthy savings and investment rates, and increasing integration into the global economy. However, long-term challenges remain significant, including: India''s discrimination against women and girls, an inefficient power generation and distribution system, ineffective enforcement of intellectual property rights, decades-long civil litigation dockets, inadequate transport and agricultural infrastructure, limited non-agricultural employment opportunities, high spending and poorly targeted subsidies, inadequate availability of quality basic and higher education, and accommodating rural-to-urban migration.', '$2.264 trillion (2016 est.)', 'rice, wheat, oilseed, cotton, jute, tea, sugarcane, lentils, onions, potatoes; dairy products, sheep, goats, poultry; fish', 'textiles, chemicals, food processing, steel, transportation equipment, cement, mining, petroleum, machinery, software, pharmaceuticals', '510.1 million (2016 est.)', 'petroleum products, precious stones, vehicles, machinery, iron and steel, chemicals, pharmaceutical products, cereals, apparel', '1.289 trillion kWh (2015 est.)', '734,500 bbl/day (2016 est.)', '4.793 million bbl/day (2014 est.)', '31.24 billion cu m (2015 est.)', 'VT (2016)', '346 (2013)', '45 (2013)', 'condensate/gas 9 km; gas 13,581 km; liquid petroleum gas 2,054 km; oil 8,943 km; oil/gas/water 20 km; refined products 11,069 km (2013)', '68,525 km', '4,699,024 km', '14,500 km (5,200 km on major rivers and 485 km on canals suitable for mechanized vessels) (2012)', '2018-02-07 18:03:30', NULL),
(104, 'ID', 'id', 'Indonesia', 'The Dutch began to colonize Indonesia in the early 17th century; Japan occupied the islands from 1942 to 1945. Indonesia declared its independence shortly before Japan''s surrender, but it required four years of sometimes brutal fighting, intermittent negotiations, and UN mediation before the Netherlands agreed to transfer sovereignty in 1949. A period of sometimes unruly parliamentary democracy ended in 1957 when President SOEKARNO declared martial law and instituted "Guided Democracy." After an abortive coup in 1965 by alleged communist sympathizers, SOEKARNO was gradually eased from power. From 1967 until 1998, President SUHARTO ruled Indonesia with his "New Order" government. After street protests toppled SUHARTO in 1998, free and fair legislative elections took place in 1999. Indonesia is now the world''s third most populous democracy, the world''s largest archipelagic state, and the world''s largest Muslim-majority nation. Current issues include: alleviating poverty, improving education, preventing terrorism, consolidating democracy after four decades of authoritarianism, implementing economic and financial reforms, stemming corruption, reforming the criminal justice system, addressing climate change, and controlling infectious diseases, particularly those of global and regional importance. In 2005, Indonesia reached a historic peace agreement with armed separatists in Aceh, which led to democratic elections in Aceh in December 2006. Indonesia continues to face low intensity armed resistance in Papua by the separatist Free Papua Movement.', 'Southeast Asia', '5 00 S, 120 00 E', '1,904,569 sq km', '260,580,739 (July 2017 est.)', 'Indonesian(s)', 'Javanese 40.1%, Sundanese 15.5%, Malay 3.7%, Batak 3.6%, Madurese 3%, Betawi 2.9%, Minangkabau 2.7%, Buginese 2.7%, Bantenese 2%, Banjarese 1.7%, Balinese 1.7%, Acehnese 1.4%, Dayak 1.4%, Sasak 1.3%, Chinese 1.2%, other 15% (2010 est.)', 'Bahasa Indonesia (official, modified form of Malay), English, Dutch, local dialects (of which the most widely spoken is Javanese)', 'Muslim 87.2%, Protestant 7%, Roman Catholic 2.9%, Hindu 1.7%, other 0.9% (includes Buddhist and Confucian), unspecified 0.4% (2010 est.)', 'Republic of Indonesia', 'presidential republic', 'Jakarta', '31 provinces (provinsi-provinsi, singular - provinsi), 1 autonomous province*, 1 special region** (daerah-daerah istimewa, singular - daerah istimewa), and 1 national capital district*** (daerah khusus ibukota); Aceh*, Bali, Banten, Bengkulu, Gorontalo, Jakarta Raya***, Jambi, Jawa Barat (West Java), Jawa Tengah (Central Java), Jawa Timur (East Java), Kalimantan Barat (West Kalimantan), Kalimantan Selatan (South Kalimantan), Kalimantan Tengah (Central Kalimantan), Kalimantan Timur (East Kalimantan), Kalimantan Utara (North Kalimantan), Kepulauan Bangka Belitung (Bangka Belitung Islands), Kepulauan Riau (Riau Islands), Lampung, Maluku, Maluku Utara (North Maluku), Nusa Tenggara Barat (West Nusa Tenggara), Nusa Tenggara Timur (East Nusa Tenggara), Papua, Papua Barat (West Papua), Riau, Sulawesi Barat (West Sulawesi), Sulawesi Selatan (South Sulawesi), Sulawesi Tengah (Central Sulawesi), Sulawesi Tenggara (Southeast Sulawesi), Sulawesi Utara (North Sulawesi), Sumatera Barat (West Sumatra), Sumatera Selatan (South Sumatra), Sumatera Utara (North Sumatra), Yogyakarta**\r\nnote: following the implementation of decentralization beginning on 1 January 2001, regencies and municipalities have become the key administrative units responsible for providing most government services', '17 August 1945 (declared independence from the Netherlands)', 'Indonesia, the largest economy in Southeast Asia, has seen a slowdown in growth since 2012, mostly due to the end of the commodities export boom. During the global financial crisis, Indonesia outperformed its regional neighbors and joined China and India as the only G20 members posting growth. Indonesia’s annual budget deficit is capped at 3% of GDP, and the Government of Indonesia lowered its debt-to-GDP ratio from a peak of 100% shortly after the Asian financial crisis in 1999 to less than 27 percent today. While Fitch and Moody''s Investors upgraded Indonesia''s credit rating to investment grade in December 2011, Standard & Poor’s has yet to raise Indonesia’s rating to this status amid several constraints to foreign direct investment in the country, such as a high level of protectionism.\r\nIndonesia still struggles with poverty and unemployment, inadequate infrastructure, corruption, a complex regulatory environment, and unequal resource distribution among its regions. President Joko WIDODO - elected in July 2014 – seeks to develop Indonesia’s maritime resources and pursue other infrastructure development, including significantly increasing its electrical power generation capacity. Fuel subsidies were significantly reduced in early 2015, a move which has helped the government redirect its spending to development priorities. Indonesia, with the nine other ASEAN members, will continue to move towards participation in the ASEAN Economic Community, though full implementation of economic integration has not yet materialized.', '$932.4 billion (2016 est.)', 'rubber and similar products, palm oil, poultry, beef, forest products, shrimp, cocoa, coffee, medicinal herbs, essential oil, fish and its similar products, and spices', 'petroleum and natural gas, textiles, automotive, electrical appliances, apparel, footwear, mining, cement, medical instruments and appliances, handicrafts, chemical fertilizers, plywood, rubber, processed food, jewelry, and tourism', '125.4 million (2016 est.)', 'mineral fuels, animal or vegetable fats (includes palm oil), electrical machinery, rubber, machinery and mechanical appliance parts', '221.3 billion kWh (2015 est.)', '831,100 bbl/day (2016 est.)', '990,700 bbl/day (2014 est.)', '72.8 billion cu m (2015 est.)', 'PK (2016)', '673 (2013)', '76 (2013)', 'condensate 1,064 km; condensate/gas 150 km; gas 11,702 km; liquid petroleum gas 119 km; oil 7,767 km; oil/gas/water 77 km; refined products 728 km; unknown 53 km; water 44 km (2013)', '8,159 km', '496,607 km', '21,579 km (2011)', '2018-02-07 18:03:30', NULL),
(105, 'IR', 'ir', 'Iran', 'Known as Persia until 1935, Iran became an Islamic republic in 1979 after the ruling monarchy was overthrown and Shah Mohammad Reza PAHLAVI was forced into exile. Conservative clerical forces led by Ayatollah Ruhollah KHOMEINI established a theocratic system of government with ultimate political authority vested in a learned religious scholar referred to commonly as the Supreme Leader who, according to the constitution, is accountable only to the Assembly of Experts (AOE) - a popularly elected 86-member body of clerics. US-Iranian relations became strained when a group of Iranian students seized the US Embassy in Tehran in November 1979 and held embassy personnel hostages until mid-January 1981. The US cut off diplomatic relations with Iran in April 1980. During the period 1980-88, Iran fought a bloody, indecisive war with Iraq that eventually expanded into the Persian Gulf and led to clashes between US Navy and Iranian military forces. Iran has been designated a state sponsor of terrorism for its activities in Lebanon and elsewhere in the world and remains subject to US, UN, and EU economic sanctions and export controls because of its continued involvement in terrorism and concerns over possible military dimensions of its nuclear program. Following the election of reformer Hojjat ol-Eslam Mohammad KHATAMI as president in 1997 and a reformist Majles (legislature) in 2000, a campaign to foster political reform in response to popular dissatisfaction was initiated. The movement floundered as conservative politicians, supported by the Supreme Leader, unelected institutions of authority like the Council of Guardians, and the security services reversed and blocked reform measures while increasing security repression.\r\nStarting with nationwide municipal elections in 2003 and continuing through Majles elections in 2004, conservatives reestablished control over Iran''s elected government institutions, which culminated with the August 2005 inauguration of hardliner Mahmud AHMADI-NEJAD as president. His controversial reelection in June 2009 sparked nationwide protests over allegations of electoral fraud, but the protests were quickly suppressed. Deteriorating economic conditions due primarily to government mismanagement and international sanctions prompted at least two major economically based protests in July and October 2012, but Iran''s internal security situation remained stable. President AHMADI-NEJAD''s independent streak angered regime establishment figures, including the Supreme Leader, leading to conservative opposition to his agenda for the last year of his presidency, and an alienation of his political supporters. In June 2013 Iranians elected a moderate conservative cleric Dr. Hasan Fereidun RUHANI to the presidency. He is a longtime senior member in the regime, but has made promises of reforming society and Iran''s foreign policy. The UN Security Council has passed a number of resolutions calling for Iran to suspend its uranium enrichment and reprocessing activities and comply with its IAEA obligations and responsibilities, and in July 2015 Iran and the five permanent members, plus Germany (P5+1) signed the Joint Comprehensive Plan of Action (JCPOA) under which Iran agreed to restrictions on its nuclear program in exchange for sanctions relief. Iran held elections in 2016 for the AOE and Majles, resulting in a conservative-controlled AOE and a Majles that many Iranians perceive as more supportive of the RUHANI administration than the previous, conservative-dominated body. Iran will hold presidential elections in May 2017. RUHANI is currently favored to win a second term.', 'Middle East', '32 00 N, 53 00 E', '1,648,195 sq km', '82,021,564 (July 2017 est.)', 'Iranian(s)', 'Persian, Azeri, Kurd, Lur, Baloch, Arab, Turkmen and Turkic tribes', 'Persian (official), Azeri Turkic and Turkic dialects, Kurdish, Gilaki and Mazandarani, Luri, Balochi, Arabic, other', 'Muslim (official) 99.4% (Shia 90-95%, Sunni 5-10%), other (includes Zoroastrian, Jewish, and Christian) 0.3%, unspecified 0.4% (2011 est.)', 'Islamic Republic of Iran', 'theocratic republic', 'Tehran', '31 provinces (ostanha, singular - ostan); Alborz, Ardabil, Azarbayjan-e Gharbi (West Azerbaijan), Azarbayjan-e Sharqi (East Azerbaijan), Bushehr, Chahar Mahal va Bakhtiari, Esfahan, Fars, Gilan, Golestan, Hamadan, Hormozgan, Ilam, Kerman, Kermanshah, Khorasan-e Jonubi (South Khorasan), Khorasan-e Razavi (Razavi Khorasan), Khorasan-e Shomali (North Khorasan), Khuzestan, Kohgiluyeh va Bowyer Ahmad, Kordestan, Lorestan, Markazi, Mazandaran, Qazvin, Qom, Semnan, Sistan va Baluchestan, Tehran, Yazd, Zanjan', '1 April 1979 (Islamic Republic of Iran proclaimed); notable earlier dates: ca. 550 B.C. (Achaemenid (Persian) Empire established); A.D. 1501 (Iran reunified under the Safavid Dynasty); 1794 (beginning of Qajar Dynasty); 12 December 1925 (modern Iran established under the PAHLAVI Dynasty)', 'Iran''s economy is marked by statist policies, inefficiencies, and reliance on oil and gas exports, but Iran also possesses significant agricultural, industrial, and service sectors. The Iranian government directly owns and operates hundreds of state-owned enterprises and indirectly controls many companies affiliated with the country''s security forces. Distortions - including inflation, price controls, subsidies, and a banking system holding billions of dollars of non-performing loans - weigh down the economy, undermining the potential for private-sector-led growth.\r\nPrivate sector activity includes small-scale workshops, farming, some manufacturing, and services, in addition to medium-scale construction, cement production, mining, and metalworking. Significant informal market activity flourishes and corruption is widespread.\r\nFiscal and monetary constraints, following the expansion of international sanctions in 2012 on Iran''s Central Bank and oil exports, significantly reduced Iran''s oil revenue, forced government spending cuts, and sparked a sharp currency depreciation. Iran’s economy contracted for the first time in two decades during both 2012 and 2013, but growth resumed in 2014. Iran''s stock market plunged between 2013 and 2015. Iran continues to suffer from high unemployment and underemployment. Lack of job opportunities has prompted many educated Iranian youth to seek employment overseas, resulting in a significant "brain drain."\r\nIn June 2013, the election of President Hasan RUHANI generated widespread public expectations of economic improvement and greater international engagement. RUHANI has achieved some success, including reining in inflation and, in July of 2015, securing the promise of sanctions relief for Iran by signing the Joint Comprehensive Plan of Action (JCPOA) with the P5+1. The JCPOA, which severely limits Iran’s nuclear program in exchange for unfreezing Iranian assets and reopening Iran to international trade, should bolster foreign direct investment, increase trade, and stimulate growth.', '$404.4 billion (2016 est.)', 'wheat, rice, other grains, sugar beets, sugarcane, fruits, nuts, cotton; dairy products, wool; caviar', 'petroleum, petrochemicals, gas, fertilizer, caustic soda, textiles, cement and other construction materials, food processing (particularly sugar refining and vegetable oil production), ferrous and nonferrous metal fabrication, armaments', '29.75 million', 'petroleum 80%, chemical and petrochemical products, fruits and nuts, carpets, cement, ore', '265.1 billion kWh (2015 est.)', '4.068 million bbl/day (2016 est.)', '1.801 million bbl/day (2014 est.)', '184.8 billion cu m (2015 est.)', '319 (2013)', '319 (2013)', '26 (2013)', 'condensate 7 km; condensate/gas 973 km; gas 20,794 km; liquid petroleum gas 570 km; oil 8,625 km; refined products 7,937 km (2013)', '8,483.5 km', '198,866 km', '850 km (on Karun River; some navigation on Lake Urmia) (2012)', '2018-02-07 18:03:30', NULL),
(106, 'IQ', 'iq', 'Iraq', 'Formerly part of the Ottoman Empire, Iraq was occupied by the United Kingdom during the course of World War I; in 1920, it was declared a League of Nations mandate under UK administration. In stages over the next dozen years, Iraq attained its independence as a kingdom in 1932. A "republic" was proclaimed in 1958, but in actuality a series of strongmen ruled the country until 2003. The last was SADDAM Husayn from 1979 to 2003. Territorial disputes with Iran led to an inconclusive and costly eight-year war (1980-88). In August 1990, Iraq seized Kuwait but was expelled by US-led UN coalition forces during the Gulf War of January-February 1991. Following Kuwait''s liberation, the UN Security Council (UNSC) required Iraq to scrap all weapons of mass destruction and long-range missiles and to allow UN verification inspections. Continued Iraqi noncompliance with UNSC resolutions over a period of 12 years led to the US-led invasion of Iraq in March 2003 and the ouster of the SADDAM Husayn regime. US forces remained in Iraq under a UNSC mandate through 2009 and under a bilateral security agreement thereafter, helping to provide security and to train and mentor Iraqi security forces.\r\nIn October 2005, Iraqis approved a constitution in a national referendum and, pursuant to this document, elected a 275-member Council of Representatives (COR) in December 2005. The COR approved most cabinet ministers in May 2006, marking the transition to Iraq''s first constitutional government in nearly a half century. Nearly nine years after the start of the Second Gulf War in Iraq, US military operations there ended in mid-December 2011. In January 2009 and April 2013, Iraq held elections for provincial councils in all governorates except for the three comprising the Kurdistan Regional Government and Kirkuk Governorate. Iraq held a national legislative election in March 2010 - choosing 325 legislators in an expanded COR - and, after nine months of deadlock, the COR approved the new government in December 2010. In April 2014, Iraq held a national legislative election and expanded the COR to 328 legislators. Prime Minister Nuri al-MALIKI dropped his bid for a third term in office, enabling new Prime Minister Haydar al-ABADI, a Shia Muslim from Baghdad, to win legislative approval of his new cabinet in September 2014. Since 2014, Iraq has been engaged in a military campaign against ISIS to recapture territory lost in the western and northern portion of the country.', 'Middle East', '33 00 N, 44 00 E', '438,317 sq km', '39,192,111 (July 2017 est.)', 'Iraqi(s)', 'Arab 75%-80%, Kurdish 15%-20%, Turkmen, Assyrian, Shabak, Yazidi, other 5%', 'Arabic (official), Kurdish (official), Turkmen (a Turkish dialect), Syriac (Neo-Aramaic), and Armenian are official in areas where native speakers of these languages constitute a majority of the population)', 'Muslim (official) 95 - 98% (Shia 64 - 69%, Sunni 29 - 34%), Christian 1% (includes Catholic, Orthodox, Protestant, Assyrian Church of the East), other 1 - 4%\r\nnote: while there has been voluntary relocation of many Christian families to northern Iraq, recent reporting indicates that the overall Christian population may have dropped by as much as 50 percent since the fall of the SADDAM Husayn regime in 2003, with many fleeing to Syria, Jordan, and Lebanon (2015 est.)', 'Republic of Iraq', 'federal parliamentary republic', 'Baghdad', '18 governorates (muhafazat, singular - muhafazah (Arabic); parezgakan, singular - parezga (Kurdish)) and 1 region*; Al Anbar; Al Basrah; Al Muthanna; Al Qadisiyah (Ad Diwaniyah); An Najaf; Arbil (Erbil) (Arabic), Hewler (Kurdish); As Sulaymaniyah (Arabic), Slemani (Kurdish); Babil; Baghdad; Dahuk (Arabic), Dihok (Kurdish); Dhi Qar; Diyala; Karbala''; Kirkuk; Kurdistan Regional Government*; Maysan; Ninawa; Salah ad Din; Wasit', '3 October 1932 (from League of Nations mandate under British administration); note - on 28 June 2004 the Coalition Provisional Authority transferred sovereignty to the Iraqi Interim Government', 'Iraq''s GDP grew by more than 10% in 2016, the best performance in the past decade, because of rising oil prices, a significant driver of Iraqi GDP. During 2016, security and financial stability throughout Iraq began to improve as Iraqi Security Forces made gains against the ongoing insurgency and oil prices slowly rose. The Iraqi Government entered into a Stand-By Arrangement (SBA) with the IMF in July 2016, which helped stabilize its finances by encouraging improved fiscal management, needed economic reform, and expenditure reduction. Iraq passed its first SBA review in December 2016, and additional progress on the program is critical to its long-term fiscal health. Diversification efforts – a key component to Iraq’s long-term economic development – require a strengthened investment climate to bolster private-sector engagement. Sustained improvements in the overall standard of living depend heavily on global oil prices, the central government passage of major policy reforms, and progress in the conflict with ISIL.\r\nIraq''s largely state-run economy is dominated by the oil sector, which provides more than 90% of government revenue and 80% of foreign exchange earnings. Oil exports in 2016 averaged 3.3 million barrels per day from southern Iraq, up from 2015. Moreover, the slow recovery of global oil prices improved export revenues throughout 2016, although monthly revenue remained below 2015 levels. Iraq''s contracts with major oil companies have the potential to further expand oil exports and revenues, but Iraq will need to make significant upgrades to its oil processing, pipeline, and export infrastructure to enable these deals to reach their economic potential.\r\nIraqi oil exports from northern fields are hampered by fundamental disagreements between the Iraqi Government and autonomous Kurdistan Regional Government (KRG) in Iraq’s Kurdistan region (IKR) on the roles of federal and regional authorities in the development and export of natural resources. In 2007, the KRG passed an oil law to develop IKR oil and gas reserves independent of the federal government. The KRG has signed about 50 contracts with foreign energy companies to develop its reserves, some of which lie in territories whose status is in dispute between Baghdad and Erbil. Some of the companies have left or returned blocks, citing lack of commercial prospects. In 2014, the KRG began exporting its oil unilaterally through its own pipeline to Turkey, which Baghdad claims is illegal. In the absence of a national hydrocarbons law, the two sides have entered into four provisional oil- and revenue-sharing deals since 2009, all of which collapsed. In September 2016, the two sides began implementing a fifth ad hoc agreement to split oil exports from Baghdad-controlled fields in Kirkuk.\r\nIraq is making slow progress enacting laws and developing the institutions needed to implement economic policy, and political reforms are still needed to assuage investors'' concerns regarding the uncertain business climate. The Government of Iraq is eager to attract additional foreign direct investment, but it faces a number of obstacles, including a tenuous political system and concerns about security and societal stability. Rampant corruption, outdated infrastructure, insufficient essential services, skilled labor shortages, and antiquated commercial laws stifle investment and continue to constrain growth of private, nonoil sectors. Under the Iraqi constitution, some competencies relevant to the overall investment climate are either shared by the federal government and the regions or are devolved entirely to local governments. Investment in the IKR operates within the framework of the Kurdistan Region Investment Law (Law 4 of 2006) and the Kurdistan Board of Investment, which is designed to provide incentives to help economic development in areas under the authority of the KRG.\r\nInflation has remained under control since 2006. However, Iraqi leaders remain hard-pressed to translate macroeconomic gains into an improved standard of living for the Iraqi populace. Unemployment remains a problem throughout the country despite a bloated public sector. Encouraging private enterprise through deregulation would make it easier for Iraqi citizens and foreign investors to start new businesses. Rooting out corruption and implementing reforms - such as restructuring banks and developing the private sector - would be important steps in this direction.', '$171.7 billion (2016 est.)', 'wheat, barley, rice, vegetables, dates, cotton; cattle, sheep, poultry', 'petroleum, chemicals, textiles, leather, construction materials, food processing, fertilizer, metal fabrication/processing', '8.9 million (2010 est.)', 'crude oil 99%, crude materials excluding fuels, food, live animals', '84 billion kWh (2016 est.)', '4.452 million bbl/day (2016 est.)', '484,800 bbl/day (2014 est.)', '1.002 billion cu m (2015 est.)', 'YI (2016)', '102 (2013)', '16 (2013)', 'gas 2,455 km; liquid petroleum gas 913 km; oil 5,432 km; refined products 1,637 km (2013)', '2,272 km', '59,623 km', '5,279 km (the Euphrates River (2,815 km), Tigris River (1,899 km), and Third River (565 km) are the principal waterways) (2012)', '2018-02-07 18:03:30', NULL),
(107, 'IE', 'ie', 'Ireland', 'Celtic tribes arrived on the island between 600 and 150 B.C. Invasions by Norsemen that began in the late 8th century were finally ended when King Brian BORU defeated the Danes in 1014. Norman invasions began in the 12th century and set off more than seven centuries of Anglo-Irish struggle marked by fierce rebellions and harsh repressions. The Irish famine of the mid-19th century saw the population of the island drop by one third through starvation and emigration. For more than a century after that the population of the island continued to fall only to begin growing again in the 1960s. Over the last 50 years, Ireland''s high birthrate has made it demographically one of the youngest populations in the EU. The modern Irish state traces its origins to the failed 1916 Easter Monday Uprising that touched off several years of guerrilla warfare resulting in independence from the UK in 1921 for 26 southern counties; six northern (Ulster) counties remained part of the UK. Deep sectarian divides between the Catholic and Protestant populations and systemic discrimination in Northern Ireland erupted into years of violence known as the "Troubles" that began in the 1960s. The Government of Ireland was part of a process along with the UK and US Governments that helped broker the Good Friday Agreement in Northern Ireland in 1998. This initiated a new phase of cooperation between the Irish and British Governments. Ireland was neutral in World War II and continues its policy of military neutrality. Ireland joined the European Community in 1973 and the euro-zone currency union in 1999. The economic boom years of the Celtic Tiger (1995-2007) saw rapid economic growth, which came to an abrupt end in 2008 with the meltdown of the Irish banking system. Today the economy is recovering, fueled by large and growing foreign direct investment, especially from US multi-nationals.', 'Europe', '53 00 N, 8 00 W', '70,273 sq km', '5,011,102 (July 2017 est.)', 'Irishman(men), Irishwoman(women), Irish (collective plural)', 'Irish 82.2%, Irish travelers 0.7%, other white 9.5%, Asian 2.1%, black 1.4%, other 1.5%, unspecified 2.6% (2016 est.)', 'English (official, the language generally used), Irish (Gaelic or Gaeilge) (official, spoken by approximately 39.8% of the population as of 2016; mainly spoken in areas along Ireland''s western coast known as gaeltachtai, which are officially recognized regions where Irish is the predominant language)', 'Roman Catholic 78.3%, Church of Ireland 2.7%, other Christian 1.6%, Orthodox 1.3%, Muslim 1.3%, other 2.4%, none 9.8%, unspecified 2.6% (2016 est.)', 'none', 'parliamentary republic', 'Dublin', '28 counties and 3 cities*; Carlow, Cavan, Clare, Cork, Cork*, Donegal, Dublin*, Dun Laoghaire-Rathdown, Fingal, Galway, Galway*, Kerry, Kildare, Kilkenny, Laois, Leitrim, Limerick, Longford, Louth, Mayo, Meath, Monaghan, Offaly, Roscommon, Sligo, South Dublin, Tipperary, Waterford, Westmeath, Wexford, Wicklow', '6 December 1921 (from the UK by treaty)', 'Ireland is a small, modern, trade-dependent economy. Ireland was among the initial group of 12 EU nations that began circulating the euro on 1 January 2002. GDP growth averaged 6% in 1995-2007, but economic activity dropped sharply during the world financial crisis and the subsequent collapse of its domestic property market and construction industry. Faced with sharply reduced revenues and a burgeoning budget deficit from efforts to stabilize its fragile banking sector, the Irish Government introduced the first in a series of draconian budgets in 2009. These measures were not sufficient to stabilize Ireland’s public finances. In 2010, the budget deficit reached 32.4% of GDP - the world''s largest deficit, as a percentage of GDP. In late 2010, the former COWEN government agreed to a $92 billion loan package from the EU and IMF to help Dublin recapitalize Ireland’s banking sector and avoid defaulting on its sovereign debt. In March 2011, the KENNY government intensified austerity measures to meet the deficit targets under Ireland''s EU-IMF bailout program.\r\nIn late 2013, Ireland formally exited its EU-IMF bailout program, benefiting from its strict adherence to deficit-reduction targets and success in refinancing a large amount of banking-related debt. In 2014, the economy rapidly picked up and GDP grew by 5.2%. The recovering economy assisted lowering the deficit to 2.5% of GDP. In late 2014, the government introduced a fiscally neutral budget, marking the end of the austerity program. Continued growth of tax receipts has allowed the government to lower some taxes and increase public spending while keeping to its deficit-reduction targets. In 2015, GDP growth exceeded 26%, the highest growth in the EU for two consecutive years. This dramatic increase reflected one-off statistical revisions, multinational corporate restructurings, and the aircraft leasing sector, rather than gains in the on the ground economy. Growth moderated to around 4.2% in 2016.\r\nIn the wake of the collapse of the construction sector and the downturn in consumer spending and business investment, the export sector, dominated by foreign multinationals, has become an even more important component of Ireland''s economy. Ireland’s low corporation tax of 12.5% and a talented pool of high-tech laborers have been key factors in encouraging business investment. Loose tax residency requirements made Ireland a common destination for international firms seeking to avoid taxation. In 2014, amid growing international pressure, the government announced it would phase in more stringent tax laws, effectively closing a commonly used loophole.', '$304.4 billion (2016 est.)', 'barley, potatoes, wheat; beef, dairy products', 'pharmaceuticals, chemicals, computer hardware and software, food products, beverages and brewing; medical devices', '2.193 million (2016 est.)', 'machinery and equipment, computers, chemicals, medical devices, pharmaceuticals; foodstuffs, animal products', '25.2 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '64,310 bbl/day (2016 est.)', '132 million cu m (2015 est.)', 'EI (2016)', '40 (2013)', '-', 'gas 2,147 km (2013)', '3,237 km', '96,036 km', '956 km (pleasure craft only) (2010)', '2018-02-07 18:03:30', NULL),
(108, 'IM', 'im', 'Isle of Man', 'Part of the Norwegian Kingdom of the Hebrides until the 13th century when it was ceded to Scotland, the isle came under the British Crown in 1765. Current concerns include reviving the almost extinct Manx Gaelic language. Isle of Man is a British Crown dependency but is not part of the UK or of the EU. However, the UK Government remains constitutionally responsible for its defense and international representation.', 'Europe', '54 15 N, 4 30 W', '572 sq km', '88,815 (July 2017 est.)', 'Manxman(men), Manxwoman(women)', 'white 96.5%, Asian/Asian British 1.9%, other 1.5% (2011 est.)', 'English, Manx Gaelic (about 2% of the population has some knowledge)', 'Protestant (Anglican, Methodist, Baptist, Presbyterian, Society of Friends), Roman Catholic', 'none', 'parliamentary democracy (Tynwald); a Crown dependency of the UK', 'Douglas', 'none; there are no first-order administrative divisions as defined by the US Government, but there are 24 local authorities each with its own elections', 'none (British crown dependency)', 'Financial services, manufacturing, and tourism are key sectors of the economy. The government offers low taxes and other incentives to high-technology companies and financial institutions to locate on the island; this has paid off in expanding employment opportunities in high-income industries. As a result, agriculture and fishing, once the mainstays of the economy, have declined in their contributions to GDP. The Isle of Man also attracts online gambling sites and the film industry. Online gambling sites provided about 10% of the islands income in 2014. The Isle of Man enjoys free access to EU markets and trade is mostly with the UK. In October 2014, the Isle of Man signed an OECD agreement to automatically exchange some financial account information to limit tax avoidance and evasion.', '$7.013 billion (2007 est.)', 'cereals, vegetables; cattle, sheep, pigs, poultry', 'financial services, light manufacturing, tourism', '41,790 (2006)', 'tweeds, herring, processed shellfish, beef, lamb', '-', '-', '-', '-', 'M (2016)', '1 (2013)', '-', '-', '63 km', '500 km (2008)', '-', '2018-02-07 18:03:30', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(109, 'IL', 'il', 'Israel', 'Following World War II, Britain withdrew from its mandate of Palestine, and the UN proposed partitioning the area into Arab and Jewish states, an arrangement rejected by the Arabs. Nonetheless, an Israeli state was declared in 1948, and Israel subsequently defeated the Arab armies in a series of wars that did not end deep tensions between the two sides. (The territories Israel has occupied since the 1967 war are not included in the Israel country profile, unless otherwise noted.) On 25 April 1982, Israel withdrew from the Sinai Peninsula pursuant to the 1979 Israel-Egypt Peace Treaty. In keeping with the framework established at the Madrid Conference in October 1991, Israel conducted bilateral negotiations with Palestinian representatives and Syria to achieve a permanent settlement with each. Israel and Palestinian officials on 13 September 1993 signed a Declaration of Principles (also known as the "Oslo Accords"), enshrining the idea of a two-state solution to their conflict and guiding an interim period of Palestinian self-rule. The parties achieved six additional significant interim agreements between 1994 and 1999 aimed at creating the conditions for a two-state solution, but most were never fully realized. Outstanding territorial and other disputes with Jordan were resolved in the 26 October 1994 Israel-Jordan Peace Treaty.\r\nProgress toward a final status agreement with the Palestinians was undermined by Israeli-Palestinian violence between 2001 and February 2005. Israel in 2005 unilaterally disengaged from the Gaza Strip, evacuating settlers and its military while retaining control over most points of entry into the Gaza Strip. The election of HAMAS to head the Palestinian Legislative Council in 2006 temporarily froze relations between Israel and the Palestinian Authority (PA). Israel engaged in a 34-day conflict with Hizballah in Lebanon from July-August 2006 and a 23-day conflict with HAMAS in the Gaza Strip from December 2008-January 2009. In November 2012, Israel engaged in a seven-day conflict with HAMAS in the Gaza Strip. Direct talks with the Palestinians most recently launched in July 2013 but were suspended in April 2014. The talks represented the fourth concerted effort to resolve final status issues between the sides since they were first discussed at Camp David in 2000. Three months later HAMAS and other militant groups launched rockets into Israel, which led to a 51-day conflict between Israel and militants in Gaza.', 'Middle East', '31 30 N, 34 45 E', '20,770 sq km', '8,299,706 (July 2017 est.) (includes populations of the Golan Heights of Golan Sub-District and also East Jerusalem, which was annexed by Israel after 1967)\r\nnote: approximately 22,000 Israeli settlers live in the Golan Heights (2016); approximately 201,0', 'Israeli(s)', 'Jewish 74.8% (of which Israel-born 75.6%, Europe/America/Oceania-born 16.6%, Africa-born 4.9%, Asia-born 2.9%), non-Jewish 25.2% (mostly Arab) (2015 est.)', 'Hebrew (official), Arabic (used officially for Arab minority), English (most commonly used foreign language)', 'Jewish 74.8%, Muslim 17.6%, Christian 2%, Druze 1.6%, other 4% (2015 est.)', 'State of Israel', 'parliamentary democracy (Tynwald); a Crown dependency of the UK', 'Jerusalem; note - the US recognized Jerusalem as I', '6 districts (mehozot, singular - mehoz); Central, Haifa, Jerusalem, Northern, Southern, Tel Aviv', '14 May 1948 (from League of Nations mandate under British administration)', 'Israel has a technologically advanced free market economy. Cut diamonds, high-technology equipment, and pharmaceuticals are among its leading exports. Its major imports include crude oil, grains, raw materials, and military equipment. Israel usually posts sizable trade deficits, which are offset by tourism and other service exports, as well as significant foreign investment inflows.\r\nBetween 2004 and 2013, growth averaged nearly 5% per year, led by exports. The global financial crisis of 2008-09 spurred a brief recession in Israel, but the country entered the crisis with solid fundamentals, following years of prudent fiscal policy and a resilient banking sector. Israel''s economy also weathered the 2011 Arab Spring because strong trade ties outside the Middle East insulated the economy from spillover effects.\r\nSlowing domestic and international demand and decreased investment resulting from Israel’s uncertain security situation reduced GDP growth to an average of roughly 2.6% per year during the period 2014-16. Natural gas fields discovered off Israel''s coast since 2009 have brightened Israel''s energy security outlook. The Tamar and Leviathan fields were some of the world''s largest offshore natural gas finds in the last decade. Political and regulatory issues have delayed the development of the massive Leviathan field, but production from Tamar provided a 0.8% boost to Israel''s GDP in 2013 and a 0.3% boost in 2014. One of the most carbon intense OECD countries, Israel generates about 57% of its power from coal and only 2.6% from renewable sources.\r\nIncome inequality and high housing and commodity prices continue to be a concern for many Israelis. Israel''s income inequality and poverty rates are among the highest of OECD countries, and there is a broad perception among the public that a small number of "tycoons" have a cartel-like grip over the major parts of the economy. Government officials have called for reforms to boost the housing supply and to increase competition in the banking sector to address these public grievances. Despite calls for reforms, the restricted housing supply continues to impact the well-being of younger Israelis seeking to purchase homes. Tariffs and non-tariff barriers, coupled with guaranteed prices and customs tariffs for farmers kept food prices high in 2016. Private consumption is expected to drive growth through 2017 with consumers benefitting from low inflation and a strong currency.\r\nIn the long term, Israel faces structural issues, including low labor participation rates for its fastest growing social segments - the ultraorthodox and Arab-Israeli communities. Also, Israel''s progressive, globally competitive, knowledge-based technology sector employs only about 8% of the workforce, with the rest mostly employed in manufacturing and services - sectors which face downward wage pressures from global competition. Expenditures on educational institutions remain low compared to most other OECD countries with similar GDP per capita.', '$317.7 billion (2016 est.)', 'citrus, vegetables, cotton; beef, poultry, dairy products', 'high-technology products (including aviation, communications, computer-aided design and manufactures, medical electronics, fiber optics), wood and paper products, potash and phosphates, food, beverages, and tobacco, caustic soda, cement, pharmaceuticals, construction, metal products, chemical products, plastics, cut diamonds, textiles, footwear', '3.925 million (2016 est.)', 'machinery and equipment, software, cut diamonds, agricultural products, chemicals, textiles and apparel', '60.44 billion kWh (2015 est.)', '390 bbl/day (2016 est.)', '278,300 bbl/day (2016 est.)', '8.5 billion cu m (2015 est.)', '4X (2016)', '29', '3 (2013)', 'gas 763 km; oil 442 km; refined products 261 km (2013)', '1,250 km', '18,566 km', '-', '2018-02-07 18:03:30', NULL),
(110, 'IT', 'it', 'Italy', 'Italy became a nation-state in 1861 when the regional states of the peninsula, along with Sardinia and Sicily, were united under King Victor EMMANUEL II. An era of parliamentary government came to a close in the early 1920s when Benito MUSSOLINI established a Fascist dictatorship. His alliance with Nazi Germany led to Italy''s defeat in World War II. A democratic republic replaced the monarchy in 1946 and economic revival followed. Italy is a charter member of NATO and the European Economic Community (EEC) and its subsequent successors the EC and the EU. It has been at the forefront of European economic and political unification, joining the Economic and Monetary Union in 1999. Persistent problems include sluggish economic growth, high youth and female unemployment, organized crime, corruption, and economic disparities between southern Italy and the more prosperous north.', 'Europe', '42 50 N, 12 50 E', '301,340 sq km', '62,137,802 (July 2017 est.)', 'Italian(s)', 'Italian (includes small clusters of German-, French-, and Slovene-Italians in the north and Albanian-Italians and Greek-Italians in the south)', 'Italian (official), German (parts of Trentino-Alto Adige region are predominantly German speaking), French (small French-speaking minority in Valle d''Aosta region), Slovene (Slovene-speaking minority in the Trieste-Gorizia area)', 'Christian 80% (overwhelmingly Roman Catholic with very small groups of Jehovah''s Witnesses and Protestants), Muslim (about 800,000 to 1 million), atheist and agnostic 20%', 'Italian Republic', 'parliamentary republic', 'Rome', '15 regions (regioni, singular - regione) and 5 autonomous regions (regioni autonome, singular - regione autonoma)', '17 March 1861 (Kingdom of Italy proclaimed; Italy was not finally unified until 1871)', 'Italy has a diversified economy, which is divided into a developed industrial north, dominated by private companies, and a less-developed, highly subsidized, agricultural south, where unemployment is higher. The Italian economy is driven in large part by the manufacture of high-quality consumer goods produced by small and medium-sized enterprises, many of them family-owned. Italy also has a sizable underground economy, which by some estimates accounts for as much as 17% of GDP. These activities are most common within the agriculture, construction, and service sectors.\r\nItaly is the third-largest economy in the euro zone, but its exceptionally high public debt and structural impediments to growth have rendered it vulnerable to scrutiny by financial markets. Public debt has increased steadily since 2007, reaching 133% of GDP in 2016. Investor concerns about Italy and the broader euro-zone crisis eased in 2013, bringing down Italy''s borrowing costs on sovereign government debt from euro-era records. The government still faces pressure from investors and European partners to sustain its efforts to address Italy''s longstanding structural impediments to growth, such as labor market inefficiencies, a sluggish judicial system, and a weak banking sector. Italy’s economy returned to modest growth in late 2014 for the first time since late 2011. In 2015-16, Italy’s economy grew 0.7% each year. In 2016, overall unemployment was 11.7%, but youth unemployment remains high at 37.1%.', '$1.851 trillion (2016 est.)', 'fruits, vegetables, grapes, potatoes, sugar beets, soybeans, grain, olives; beef, dairy products; fish', 'tourism, machinery, iron and steel, chemicals, food processing, textiles, motor vehicles, clothing, footwear, ceramics', '25.76 million (2016 est.)', 'engineering products, textiles and clothing, production machinery, motor vehicles, transport equipment, chemicals; foodstuffs, beverages, and tobacco; minerals, nonferrous metals', '269.3 billion kWh (2015 est.)', '70,670 bbl/day (2016 est.)', '1.567 million bbl/day (2016 est.)', '5.785 billion cu m (2016 est.)', 'I (2016)', '129 (2013)', '5 (2013)', 'gas 20,223 km; oil 1,393 km; refined products 1,574 km (2013)', '20,181.7 km', '487,700 km', '2,400 km (used for commercial traffic; of limited overall value compared to road and rail) (2012)', '2018-02-07 18:03:30', NULL),
(111, 'CI', 'ci', 'Ivory Coast', 'Close ties to France following independence in 1960, the development of cocoa production for export, and foreign investment all made Cote d''Ivoire one of the most prosperous of the West African states but did not protect it from political turmoil. In December 1999, a military coup - the first ever in Cote d''Ivoire''s history - overthrew the government. Junta leader Robert GUEI blatantly rigged elections held in late 2000 and declared himself the winner. Popular protest forced him to step aside and an election brought Laurent GBAGBO into power. Ivoirian dissidents and disaffected members of the military launched a failed coup attempt in September 2002 that developed into a rebellion and then a civil war. In 2003, a cease-fire resulted in the country being divided with the rebels holding the north, the government the south, and peacekeeping forces a buffer zone between the two. In March 2007, President GBAGBO and former New Forces rebel leader Guillaume SORO signed an agreement in which SORO joined GBAGBO''s government as prime minister and the two agreed to reunite the country by dismantling the buffer zone, integrating rebel forces into the national armed forces, and holding elections. Difficulties in preparing electoral registers delayed balloting until 2010. In November 2010, Alassane Dramane OUATTARA won the presidential election over GBAGBO, but GBAGBO refused to hand over power, resulting in a five-month resumption of violent conflict. In April 2011, after widespread fighting, GBAGBO was formally forced from office by armed OUATTARA supporters with the help of UN and French forces. The UN peacekeeping mission departed in June 2017. OUATTARA is focused on rebuilding the country''s economy and infrastructure while rebuilding the security forces. GBAGBO is in The Hague on trial for crimes against humanity.', 'Africa', '8 00 N, 5 00 W', '322,463 sq km', '24,184,810', 'Ivoirian(s)', 'Akan 28.8%, Voltaique or Gur 16.1%, Northern Mande 14.5%, Kru 8.5%, Southern Mande 6.9%, unspecified 0.9%, non-Ivoirian 42.3% (2014 est.)', 'French (official), 60 native dialects of which Dioula is the most widely spoken', 'Muslim 42.9%, Catholic 17.2%, Evangelical 11.8%, Methodist 1.7%, other Christian 3.2%, animist 3.6%, other religion 0.5%, none 19.1%', 'Republic of Cote d''Ivoire', 'presidential republic', 'Yamoussoukro (legislative capital), Abidjan (admin', '12 districts and 2 autonomous districts*; Abidjan*, Bas-Sassandra, Comoe, Denguele, Goh-Djiboua, Lacs, Lagunes, Montagnes, Sassandra-Marahoue, Savanes, Vallee du Bandama, Woroba, Yamoussoukro*, Zanzan', '7 August 1960 (from France)', 'Cote d''Ivoire is heavily dependent on agriculture and related activities, which engage roughly two-thirds of the population. Cote d''Ivoire is the world''s largest producer and exporter of cocoa beans and a significant producer and exporter of coffee and palm oil. Consequently, the economy is highly sensitive to fluctuations in international prices for these products and to climatic conditions. Cocoa, oil, and coffee are the country''s top export revenue earners, but the country has targeted agricultural processing of cocoa, cashews, mangoes, and other commodities as a high priority. Mining gold and exporting electricity are growing industries outside agriculture.\r\nFollowing the end of more than a decade of civil conflict in 2011, Cote d’Ivoire has experienced a boom in foreign investment and economic growth. In June 2012, the IMF and the World Bank announced $4.4 billion in debt relief for Cote d''Ivoire under the Highly Indebted Poor Countries Initiative. For the last 5 years Cote d''Ivoire''s growth rate has been among the highest in the world.', '$39.91 billion (2016 est.)', 'coffee, cocoa beans, bananas, palm kernels, corn, rice, cassava (manioc, tapioca), sweet potatoes, sugar, cotton, rubber; timber', 'foodstuffs, beverages; wood products, oil refining, gold mining, truck and bus assembly, textiles, fertilizer, building materials, electricity', '8.747 million (2017 est.)', 'cocoa, coffee, timber, petroleum, cotton, bananas, pineapples, palm oil, fish', '8.262 billion kWh (2015 est.)', '30,000 bbl/day (2016 est.)', '67,260 bbl/day (2014 est.)', '2.063 billion cu m (2015 est.)', 'TU (2016)', '27 (2013)', '1 (2013)', 'condensate 101 km; gas 256 km; oil 118 km; oil/gas/water 5 km; water 7 km (2013)', '660 km', '81,996 km', '980 km (navigable rivers, canals, and numerous coastal lagoons) (2011)', '2018-02-07 18:03:30', NULL),
(112, 'JM', 'jm', 'Jamaica', 'The island - discovered by Christopher COLUMBUS in 1494 - was settled by the Spanish early in the 16th century. The native Taino, who had inhabited Jamaica for centuries, were gradually exterminated and replaced by African slaves. England seized the island in 1655 and established a plantation economy based on sugar, cocoa, and coffee. The abolition of slavery in 1834 freed a quarter million slaves, many of whom became small farmers. Jamaica gradually increased its independence from Britain. In 1958 it joined other British Caribbean colonies in forming the Federation of the West Indies. Jamaica gained full independence when it withdrew from the Federation in 1962. Deteriorating economic conditions during the 1970s led to recurrent violence as rival gangs affiliated with the major political parties evolved into powerful organized crime networks involved in international drug smuggling and money laundering. Violent crime, drug trafficking, and poverty pose significant challenges to the government today. Nonetheless, many rural and resort areas remain relatively safe and contribute substantially to the economy.', 'Central America and the Caribbean', '18 15 N, 77 30 W', '10,991 sq km', '2,990,561 (July 2017 est.)', 'Jamaican(s)', 'black 92.1%, mixed 6.1%, East Indian 0.8%, other 0.4%, unspecified 0.7% (2011 est.)', 'English, English patois', 'Protestant 64.8% (includes Seventh Day Adventist 12.0%, Pentecostal 11.0%, Other Church of God 9.2%, New Testament Church of God 7.2%, Baptist 6.7%, Church of God in Jamaica 4.8%, Church of God of Prophecy 4.5%, Anglican 2.8%, United Church 2.1%, Methodist 1.6%, Revived 1.4%, Brethren 0.9%, and Moravian 0.7%), Roman Catholic 2.2%, Jehovah''s Witness 1.9%, Rastafarian 1.1%, other 6.5%, none 21.3%, unspecified 2.3% (2011 est.)', 'none', 'parliamentary democracy (Parliament) under a constitutional monarchy; a Commonwealth realm', 'Kingston', '14 parishes; Clarendon, Hanover, Kingston, Manchester, Portland, Saint Andrew, Saint Ann, Saint Catherine, Saint Elizabeth, Saint James, Saint Mary, Saint Thomas, Trelawny, Westmoreland', '6 August 1962 (from the UK)', 'The Jamaican economy is heavily dependent on services, which accounts for more than 70% of GDP. The country continues to derive most of its foreign exchange from tourism, remittances, and bauxite/alumina. Earnings from remittances and tourism each account for about 15% of GDP, while bauxite/alumina exports have declined to less than 5% of GDP.\r\nJamaica''s economy has grown on average less than 1% a year for the last three decades and many impediments remain to growth: a bloated public sector which crowds out spending on important projects; high crime and corruption; red-tape; and a high debt-to-GDP ratio. Jamaica, however, has made steady progress in reducing its debt-to-GDP ratio from a high of almost 150% in 2012 to about 115% in 2017, in close collaboration with the International Monetary Fund. The existing Stand By Agreement requires Jamaica to produce an annual primary surplus of 7%, in an attempt to reduce its debt burden below 60% by 2025.\r\nEconomic growth reached 1.6% in 2016. The HOLNESS administration faces the difficult prospect of maintaining fiscal discipline to make debt payments while simultaneously attacking a serious crime problem. High unemployment exacerbates the crime problem, including gang violence fueled by the drug trade.', '$13.96 billion (2016 est.)', 'sugarcane, bananas, coffee, citrus, yams, ackees, vegetables; poultry, goats, milk; shellfish', 'tourism, bauxite/alumina, agricultural-processing, light manufactures, rum, cement, metal, paper, chemical products, telecommunications', '1.321 million (2016 est.)', 'alumina, bauxite, sugar, rum, coffee, yams, beverages, chemicals, apparel, mineral fuels', '3.894 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '19,760 bbl/day (2014 est.)', '0 cu m (2013 est.)', '6Y (2016)', '28 (2013)', '-', '-', '-', '22,121 km (includes 44 km of expressways)', '-', '2018-02-07 18:03:30', NULL),
(113, 'JP', 'jp', 'Japan', 'In 1603, after decades of civil warfare, the Tokugawa shogunate (a military-led, dynastic government) ushered in a long period of relative political stability and isolation from foreign influence. For more than two centuries this policy enabled Japan to enjoy a flowering of its indigenous culture. Japan opened its ports after signing the Treaty of Kanagawa with the US in 1854 and began to intensively modernize and industrialize. During the late 19th and early 20th centuries, Japan became a regional power that was able to defeat the forces of both China and Russia. It occupied Korea, Formosa (Taiwan), and southern Sakhalin Island. In 1931-32 Japan occupied Manchuria, and in 1937 it launched a full-scale invasion of China. Japan attacked US forces in 1941 - triggering America''s entry into World War II - and soon occupied much of East and Southeast Asia. After its defeat in World War II, Japan recovered to become an economic power and an ally of the US. While the emperor retains his throne as a symbol of national unity, elected politicians hold actual decision-making power. Following three decades of unprecedented growth, Japan''s economy experienced a major slowdown starting in the 1990s, but the country remains an economic power. In March 2011, Japan''s strongest-ever earthquake, and an accompanying tsunami, devastated the northeast part of Honshu island, killed thousands, and damaged several nuclear power plants. The catastrophe hobbled the country''s economy and its energy infrastructure, and tested its ability to deal with humanitarian disasters. Prime Minister Shinzo ABE was reelected to office in December 2012, and has since embarked on ambitious economic and security reforms to improve Japan''s economy and bolster the country''s international standing.', 'Asia', '36 00 N, 138 00 E', '377,915 sq km', '126,451,398 (July 2017 est.)', 'Japanese (singular and plural)', 'Japanese 98.5%, Koreans 0.5%, Chinese 0.4%, other 0.6%\r\nnote: up to 230,000 Brazilians of Japanese origin migrated to Japan in the 1990s to work in industries; some have returned to Brazil (2004)', 'Shintoism 79.2%, Buddhism 66.8%, Christianity 1.5%, other 7.1%', 'Shintoism 79.2%, Buddhism 66.8%, Christianity 1.5%, other 7.1%\r\nnote: total adherents exceeds 100% because many people practice both Shintoism and Buddhism (2012 est.)', 'none', 'parliamentary constitutional monarchy', 'Tokyo', '47 prefectures; Aichi, Akita, Aomori, Chiba, Ehime, Fukui, Fukuoka, Fukushima, Gifu, Gunma, Hiroshima, Hokkaido, Hyogo, Ibaraki, Ishikawa, Iwate, Kagawa, Kagoshima, Kanagawa, Kochi, Kumamoto, Kyoto, Mie, Miyagi, Miyazaki, Nagano, Nagasaki, Nara, Niigata, Oita, Okayama, Okinawa, Osaka, Saga, Saitama, Shiga, Shimane, Shizuoka, Tochigi, Tokushima, Tokyo, Tottori, Toyama, Wakayama, Yamagata, Yamaguchi, Yamanashi', '3 May 1947 (current constitution adopted as amendment to Meiji Constitution); notable earlier dates: 660 B.C. (traditional date of the founding of the nation by Emperor JIMMU); 29 November 1890 (Meiji Constitution provides for constitutional monarchy)', 'Over the past 70 years, government-industry cooperation, a strong work ethic, mastery of high technology, and a comparatively small defense allocation (slightly less than 1% of GDP) have helped Japan develop an advanced economy. Two notable characteristics of the post-World War II economy were the close interlocking structures of manufacturers, suppliers, and distributors, known as keiretsu, and the guarantee of lifetime employment for a substantial portion of the urban labor force. Both features have significantly eroded under the dual pressures of global competition and domestic demographic change.\r\nMeasured on a purchasing power parity basis that adjusts for price differences, Japan in 2016 stood as the fourth-largest economy in the world after first-place China, which surpassed Japan in 2001, and third-place India, which edged out Japan in 2012. For three postwar decades, overall real economic growth was impressive - a 10% average in the 1960s, 5% in the 1970s, and 4% in the 1980s. Growth slowed markedly in the 1990s, averaging just 1.7%, largely because of the aftereffects of inefficient investment and the collapse of an asset price bubble in the late 1980s, which entailed considerable time for firms to reduce excess debt, capital, and labor. Modest economic growth continued after 2000, but the economy has fallen into recession four times since 2008.\r\nJapan enjoyed an uptick in growth in 2013 on the basis of Prime Minister Shinzo ABE’s “Three Arrows” economic revitalization agenda - dubbed “Abenomics” - of monetary easing, “flexible” fiscal policy, and structural reform. Led by the Bank of Japan’s aggressive monetary easing, Japan is making modest progress in ending deflation, but demographic decline – a low birthrate and an aging, shrinking population – poses a major long-term challenge for the economy. The government currently faces the quandary of balancing its efforts to stimulate growth and institute economic reforms with the necessity of addressing its sizable public debt, which stands at 235% of GDP. To help raise government revenue, Japan adopted legislation in 2012 to gradually raise the consumption tax rate. However, the first such increase, in April 2014, led to another recession, so Prime Minister ABE has twice postponed the next increase, now scheduled for October 2019. Structural reforms to unlock productivity are seen as central to strengthening the economy in the long-run.\r\nScarce in critical natural resources, Japan has long been dependent on imported energy and raw materials. After the complete shutdown of Japan’s nuclear reactors following the earthquake and tsunami disaster in 2011, Japan''s industrial sector has become even more dependent than before on imported fossil fuels. However, ABE’s government is seeking to restart nuclear power plants that meet strict new safety standards and is emphasizing nuclear energy’s importance as a base-load electricity source. In August 2015, Japan successfully restarted one nuclear reactor at the Sendai Nuclear Power Plant in Kagoshima prefecture, and several other reactors around the country have since resumed operations; however, opposition from local governments has delayed several more restarts that remain pending. Reforms of the electricity and gas sectors, including full liberalization of Japan’s energy market in April 2016 and gas market in April 2017, constitute an important part of Prime Minister Abe’s economic program.\r\nIn October 2015, Japan and 11 trading partners reached agreement on the Trans-Pacific Partnership (TPP), a pact that had promised to open Japan''s economy to increased foreign competition and create new export opportunities for Japanese businesses. Japan was the second country to ratify the TPP in December 2016; the United States signaled its withdrawal from the TPP on January 23, 2017, and as of April 2017 the agreement has not gone into effect.', '$4.937 trillion (2016 est.)', 'vegetables, rice, fish, poultry, fruit, dairy products, pork, beef, flowers, potatoes/taros/yams, sugarcane, tea, legumes, wheat and barley', 'among world''s largest and most technologically advanced producers of motor vehicles, electronic equipment, machine tools, steel and nonferrous metals, ships, chemicals, textiles, processed foods', '66.73 million (2016 est.)', 'motor vehicles 14.9%; iron and steel products 5.4%; semiconductors 5%; auto parts 4.8%; power generating machinery 3.5%; plastic materials 3.3% (2014 est.)', '976.3 billion kWh (2015 est.)', '3,918 bbl/day (2016 est.)', '3.536 million bbl/day (2016 est.)', '4.453 billion cu m (2015 est.)', 'JA (2016)', '175 (2013)', '16 (2013)', 'gas 4,456 km; oil 174 km; oil/gas/water 104 km (2013)', '27,311 km', '1,218,772 km', '1,770 km (seagoing vessels use inland seas) (2010)', '2018-02-07 18:03:30', NULL),
(114, 'JE', 'je', 'Jersey', 'Jersey and the other Channel Islands represent the last remnants of the medieval Dukedom of Normandy that held sway in both France and England. These islands were the only British soil occupied by German troops in World War II. The Bailiwick of Jersey is a British Crown dependency but is not part of the UK or of the EU. However, the UK Government is constitutionally responsible for its defense and international representation.', 'Europe', '49 15 N, 2 10 W', '116 sq km', '98,840 (July 2017 est.)', 'Channel Islander(s)', 'Jersey 46.4%, British 32.7%, Portuguese/Madeiran 8.2%, Polish 3.3%, Irish, French, and other white 7.1%, other 2.4% (2011 est.)', 'English 94.5% (official), Portuguese 4.6%, other 0.9% (2001 census)', 'Protestant (Anglican, Baptist, Congregational New Church, Methodist, Presbyterian), Roman Catholic', 'Bailiwick of Jersey', 'parliamentary democracy (Assembly of the States of Jersey); a Crown dependency of the UK', 'Saint Helier', '(British crown dependency); there are no first-order administrative divisions as defined by the US Government, but there are 12 parishes; Grouville, Saint Brelade, Saint Clement, Saint Helier, Saint John, Saint Lawrence, Saint Martin, Saint Mary, Saint Ouen, Saint Peter, Saint Saviour, and Trinity', 'none (British crown dependency)', 'Jersey''s economy is based on international financial services, agriculture, and tourism. In 2010, the financial services sector accounted for about 50% of the island''s output. Potatoes, cauliflower, tomatoes, and especially flowers are important export crops, shipped mostly to the UK. The Jersey breed of dairy cattle is known worldwide and represents an important export income earner. Tourism accounts for one-quarter of GDP. Living standards come close to those of the UK. In recent years, the government has encouraged light industry to locate in Jersey with the result that an electronics industry has developed, displacing more traditional industries. All raw material and energy requirements are imported as well as a large share of Jersey''s food needs. Light taxes and death duties make the island a popular tax haven. In October 2014, Jersey signed an OECD agreement to automatically exchange some financial account information to limit tax avoidance and evasion.', '$4.796 billion (FY12/13 est.)', 'potatoes, cauliflower, tomatoes; beef, dairy products', 'tourism, banking and finance, dairy, electronics', '53,380 (June 2012)', 'light industrial and electrical goods, dairy cattle, foodstuffs, textiles, flowers', '-', '-', '-', '-', '-', '1 (2013)', '-', '-', '-', '576 km (2010)', '-', '2018-02-07 18:03:30', NULL),
(115, 'JO', 'jo', 'Jordan', 'Following World War I and the dissolution of the Ottoman Empire, the League of Nations awarded Britain the mandate to govern much of the Middle East. Britain demarcated a semi-autonomous region of Transjordan from Palestine in the early 1920s. The area gained its independence in 1946 and thereafter became The Hashemite Kingdom of Jordan. The country''s long-time ruler, King HUSSEIN (1953-99), successfully navigated competing pressures from the major powers (US, USSR, and UK), various Arab states, Israel, and a large internal Palestinian population. Jordan lost the West Bank to Israel in the 1967 Six-Day War. King HUSSEIN in 1988 permanently relinquished Jordanian claims to the West Bank; in 1994 he signed a peace treaty with Israel. King ABDALLAH II, King HUSSEIN''s eldest son, assumed the throne following his father''s death in 1999. He has implemented modest political and economic reforms, including the passage of a new electoral law in early 2016 ahead of legislative elections held in September. The Islamic Action Front, which is the political arm of the Jordanian Muslim Brotherhood, returned to parliament with 15 seats after boycotting the previous two elections in 2010 and 2013.', 'Middle East', '31 00 N, 36 00 E', '89,342 sq km', '10,248,069', 'Jordanian(s)', 'Arab 98%, Circassian 1%, Armenian 1%', 'Arabic (official), English (widely understood among upper and middle classes)', 'Muslim 97.2% (official; predominantly Sunni), Christian 2.2% (majority Greek Orthodox, but some Greek and Roman Catholics, Syrian Orthodox, Coptic Orthodox, Armenian Orthodox, and Protestant denominations), Buddhist 0.4%, Hindu 0.1%, Jewish <0.1, folk religionist <0.1, unaffiliated <0.1, other <0.1 (2010 est.)', 'Hashemite Kingdom of Jordan', 'parliamentary constitutional monarchy', 'Amman', '12 governorates (muhafazat, singular - muhafazah); ''Ajlun, Al ''Aqabah, Al Balqa'', Al Karak, Al Mafraq, Al ?Asimah (Amman), At Tafilah, Az Zarqa'', Irbid, Jarash, Ma''an, Madaba', '25 May 1946 (from League of Nations mandate under British administration)', 'Jordan''s economy is among the smallest in the Middle East, with insufficient supplies of water, oil, and other natural resources, underlying the government''s heavy reliance on foreign assistance. Other economic challenges for the government include chronic high rates of poverty, unemployment and underemployment, budget and current account deficits, and government debt.\r\nKing ABDALLAH, during the first decade of the 2000s, implemented significant economic reforms, such as expanding foreign trade and privatizing state-owned companies that attracted foreign investment and contributed to average annual economic growth of 8% for 2004 through 2008. The global economic slowdown and regional turmoil contributed to slower growth from 2010 to 2016 - with growth averaging 2.8% per year - and hurt export-oriented sectors, construction, and tourism. Since the onset of the civil war in Syria and resulting refugee crisis, one of Jordan’s most pressing socioeconomic challenges has been managing the influx of 650,000 UN-registered refugees, more than 80% of whom live in Jordan’s urban areas. Jordan’s own official census estimated the refugee number at 1.3 million as of early 2016.\r\nJordan is nearly completely dependent on imported energy—mostly natural gas—and energy consistently makes up 25-30 percent of Jordan’s imports. To diversify its energy mix, Jordan has secured several contracts for liquefied natural gas and is currently exploring nuclear power generation, exploitation of abundant oil shale reserves and renewable technologies, as well as the import of Israeli offshore gas. In August 2016, Jordan and the IMF agreed to a $723 million Extended Fund Facility that aims to build on the three-year, $2.1 billion IMF program that ended in August 2015 with the goal of helping Jordan correct budgetary and balance of payments imbalances.', '$38.71 billion (2016 est.)', 'citrus, tomatoes, cucumbers, olives, strawberries, stone fruits; sheep, poultry, dairy', 'tourism, information technology, clothing, fertilizer, potash, phosphate mining, pharmaceuticals, petroleum refining, cement, inorganic chemicals, light manufacturing', '2.205 million (2016 est.)', 'textiles, fertilizers, potash, phosphates, vegetables, pharmaceuticals', '17.76 billion kWh (2015 est.)', '22 bbl/day (2016 est.)', '65,150 bbl/day (2014 est.)', '151 million cu m (2015 est.)', 'JY (2016)', '18 (2013)', '1 (2012)', 'gas 473 km; oil 49 km (2013)', '509 km', '7,203 km', '-', '2018-02-07 18:03:30', NULL),
(116, 'KZ', 'kz', 'Kazakhstan', 'Ethnic Kazakhs, a mix of Turkic and Mongol nomadic tribes who migrated to the region by the 13th century, were rarely united as a single nation. The area was conquered by Russia in the 18th century, and Kazakhstan became a Soviet Republic in 1936. Soviet policies reduced the number of ethnic Kazakhs in the 1930s and enabled non-ethnic Kazakhs to outnumber natives. During the 1950s and 1960s agricultural "Virgin Lands" program, Soviet citizens were encouraged to help cultivate Kazakhstan''s northern pastures. This influx of immigrants (mostly Russians, but also some other deported nationalities) further skewed the ethnic mixture. Non-Muslim ethnic minorities departed Kazakhstan in large numbers from the mid-1990s through the mid-2000s and a national program has repatriated about a million ethnic Kazakhs back to Kazakhstan. These trends have allowed Kazakhs to become the titular majority again. This dramatic demographic shift has also undermined the previous religious diversity and made the country more than 70% Muslim.\r\nKazakhstan''s economy is larger than those of all the other Central Asian states largely due to the country''s vast natural resources. Current issues include: developing a cohesive national identity, expanding the development of the country''s vast energy resources and exporting them to world markets, diversifying the economy, enhancing Kazakhstan''s economic competitiveness, and strengthening relations with neighboring states and foreign powers. Astana successfully hosted an internationally recognized exposition in 2017. The three-month Expo 2017, themed Future Energy, was the first such exhibition by a former Soviet country.', 'Asia', '48 00 N, 68 00 E', '2,724,900 sq km', '18,556,698 (July 2017 est.)', 'Kazakhstani(s)', 'Kazakh (Qazaq) 63.1%, Russian 23.7%, Uzbek 2.9%, Ukrainian 2.1%, Uighur 1.4%, Tatar 1.3%, German 1.1%, other 4.4% (2009 est.)', 'Kazakh (official, Qazaq) 74% (understand spoken language), Russian (official, used in everyday business, designated the "language of interethnic communication") 94.4% (understand spoken language) (2009 est.)', 'Muslim 70.2%, Christian 26.2% (mainly Russian Orthodox), other 0.2%, atheist 2.8%, unspecified 0.5% (2009 est.)', 'Republic of Kazakhstan', 'presidential republic', 'Astana', '14 provinces (oblyslar, singular - oblys) and 2 cities* (qalalar, singular - qala); Almaty (Taldyqorghan), Almaty*, Aqmola (Kokshetau), Aqtobe, Astana*, Atyrau, Batys Qazaqstan [West Kazakhstan] (Oral), Mangghystau (Aqtau), Ongtustik Qazaqstan [South Kazakhstan] (Shymkent), Pavlodar, Qaraghandy, Qostanay, Qyzylorda, Shyghys Qazaqstan [East Kazakhstan] (Oskemen), Soltustik Qazaqstan [North Kazakhstan] (Petropavl), Zhambyl (Taraz)', '16 December 1991 (from the Soviet Union)', 'Kazakhstan, geographically the largest of the former Soviet republics, excluding Russia, possesses substantial fossil fuel reserves and other minerals and metals, such as uranium, copper, and zinc. It also has a large agricultural sector featuring livestock and grain. The government realizes that its economy suffers from an overreliance on oil and extractive industries and has made initial attempts to diversify its economy by targeting sectors like transport, pharmaceuticals, telecommunications, petrochemicals and food processing for greater development and investment.\r\nKazakhstan''s vast hydrocarbon and mineral reserves form the backbone of its economy. Chevron-led Tengizchevroil announced a $36.8 billion expansion of Kazakhstan’s premiere Tengiz oil field in July 2016. Meanwhile, the super-giant Kashagan field finally launched production in October 2016 after years of delay and an estimated $55 billion in development costs.\r\nKazakhstan is landlocked and depends on Russia to export its oil to Europe. It also exports oil directly to China. In 2010, Kazakhstan joined Russia and Belarus to establish a Customs Union in an effort to boost foreign investment and improve trade. The Customs Union evolved into a Single Economic Space in 2012 and the Eurasian Economic Union (EAEU) in January 2015. In part due to weak commodity prices, Kazakhstan’s exports to EAEU countries declined 23.5% in 2016. Imports from EAEU countries to Kazakhstan declined 13.7%.\r\nThe economic downturn of its EAEU partner, Russia, and the decline in global commodity prices from 2014 to 2015 contributed to an economic slowdown in Kazakhstan, which continues to experience its slowest economic growth since the financial crises of 2008-09. In 2014, Kazakhstan devalued its currency, the tenge, and announced a stimulus package to cope with its economic challenges. In the face of further decline in the ruble, oil prices, and the regional economy, Kazakhstan announced in 2015 it would replace its currency band with a floating exchange rate, leading to a sharp fall in the value of the tenge. Since reaching a low of 391 to the dollar in January 2016, the tenge has modestly appreciated, helped by somewhat higher oil prices.\r\nDespite some positive institutional and legislative changes in the last several years, investors remain concerned about corruption, bureaucracy, and arbitrary law enforcement, especially at the regional and municipal levels. An additional concern is the condition of the country’s banking sector, which suffers from low liquidity, poor asset quality, and a lack of transparency. Investors also question the potentially negative effects on the economy of a contested presidential succession as Kazakhstan’s first president, Nursultan NAZARBAYEV, who turns 77 in 2017, has not announced whether he will seek reelection in 2019.', '$133.7 billion (2016 est.)', 'grain (mostly spring wheat and barley), potatoes, vegetables, melons; livestock', 'oil, coal, iron ore, manganese, chromite, lead, zinc, copper, titanium, bauxite, gold, silver, phosphates, sulfur, uranium, iron and steel; tractors and other agricultural machinery, electric motors, construction materials', '8.999 million (2016 est.)', 'oil and oil products, natural gas, ferrous metals, chemicals, machinery, grain, wool, meat, coal', '100.4 billion kWh (2015 est.)', '1.595 million bbl/day (2016 est.)', '228,600 bbl/day (2016 est.)', '21.38 billion cu m (2016 est.)', 'UP (2016)', '96 (2013)', '3 (2013)', 'condensate 658 km; gas 12,432 km; oil 11,313 km; refined products 1,095 km; water 1,465 km (2013)', '14,184 km', '97,418 km', '4,000 km (on the Ertis (Irtysh) River (80%) and Syr Darya (Syrdariya) River) (2010)', '2018-02-07 18:03:30', NULL),
(117, 'KE', 'ke', 'Kenya', 'Founding president and liberation struggle icon Jomo KENYATTA led Kenya from independence in 1963 until his death in 1978, when Vice President Daniel MOI took power in a constitutional succession. The country was a de facto one-party state from 1969 until 1982, after which time the ruling Kenya African National Union (KANU) changed the constitution to make itself the sole legal party in Kenya. MOI acceded to internal and external pressure for political liberalization in late 1991. The ethnically fractured opposition failed to dislodge KANU from power in elections in 1992 and 1997, which were marred by violence and fraud, but were viewed as having generally reflected the will of the Kenyan people. President MOI stepped down in December 2002 following fair and peaceful elections. Mwai KIBAKI, running as the candidate of the multiethnic, united opposition group, the National Rainbow Coalition (NARC), defeated KANU candidate Uhuru KENYATTA, the son of founding president Jomo KENYATTA, and assumed the presidency following a campaign centered on an anticorruption platform.\r\nKIBAKI''s reelection in December 2007 brought charges of vote rigging from Orange Democratic Movement (ODM) candidate Raila ODINGA and unleashed two months of violence in which approximately 1,100 people died. African Union-sponsored mediation led by former UN Secretary General Kofi ANNAN in late February 2008 resulted in a power-sharing accord bringing ODINGA into the government in the restored position of prime minister. The power sharing accord included a broad reform agenda, the centerpiece of which was constitutional reform. In August 2010, Kenyans overwhelmingly adopted a new constitution in a national referendum. The new constitution introduced additional checks and balances to executive power and significant devolution of power and resources to 47 newly created counties. It also eliminated the position of prime minister following the first presidential election under the new constitution, which occurred in March 2013. Uhuru KENYATTA won the election and was sworn into office in April 2013; he began a second term in November 2017.', 'Africa', '1 00 N, 38 00 E', '580,367 sq km', '47,615,739', 'Kenyan(s)', 'Kikuyu 22%, Luhya 14%, Luo 13%, Kalenjin 12%, Kamba 11%, Kisii 6%, Meru 6%, other African 15%, non-African (Asian, European, and Arab) 1%', 'English (official), Kiswahili (official), numerous indigenous languages', 'Christian 83% (Protestant 47.7%, Catholic 23.4%, other Christian 11.9%), Muslim 11.2%, Traditionalists 1.7%, other 1.6%, none 2.4%, unspecified 0.2% (2009 est.)', 'Republic of Kenya', 'presidential republic', 'Nairobi', '47 counties; Baringo, Bomet, Bungoma, Busia, Elgeyo/Marakwet, Embu, Garissa, Homa Bay, Isiolo, Kajiado, Kakamega, Kericho, Kiambu, Kilifi, Kirinyaga, Kisii, Kisumu, Kitui, Kwale, Laikipia, Lamu, Machakos, Makueni, Mandera, Marsabit, Meru, Migori, Mombasa, Murang''a, Nairobi City, Nakuru, Nandi, Narok, Nyamira, Nyandarua, Nyeri, Samburu, Siaya, Taita/Taveta, Tana River, Tharaka-Nithi, Trans Nzoia, Turkana, Uasin Gishu, Vihiga, Wajir, West Pokot', '12 December 1963 (from the UK)', 'Kenya is the economic, financial, and transport hub of East Africa. Kenya’s real GDP growth has averaged over 5% for the last eight years. Since 2014, Kenya has been ranked as a lower middle income country because its per capita GDP crossed a World Bank threshold. While Kenya has a growing entrepreneurial middle class and steady growth, its economic and development trajectory could be impaired by weak governance and corruption. Although reliable numbers are hard to find, unemployment and under-employment are extremely high, and could be near 40% of the population.\r\nAgriculture remains the backbone of the Kenyan economy, contributing one-third of GDP. About 75% of Kenya’s population of roughly 44.2 million work at least part-time in the agricultural sector, including livestock and pastoral activities. Over 75% of agricultural output is from small-scale, rain-fed farming or livestock production.\r\nInadequate infrastructure continues to hamper Kenya’s efforts to improve its annual growth to the 8%-10% range so that it can meaningfully address poverty and unemployment. The KENYATTA administration has been successful in courting external investment for infrastructure development. International financial institutions and donors remain important to Kenya''s economic growth and development, but Kenya has also successfully raised capital in the global bond market. Kenya issued its first sovereign bond offering in mid-2014. Nairobi has contracted with a Chinese company to construct a new standard gauge railway connecting Mombasa and Nairobi, with completion expected in June 2017. In 2013, the country adopted a devolved system of government with the creation of 47 counties, and is in the process of devolving state revenues and responsibilities to the counties. Inflationary pressures and sharp currency depreciation peaked in early 2012 but have since abated following low global food and fuel prices and monetary interventions by the Central Bank. Drought-like conditions in parts of the country have pushed March 2017 inflation above 9%. Chronic budget deficits, including a shortage of funds in mid-2015, hampered the government’s ability to implement proposed development programs, but the economy is back in balance with many indicators, including foreign exchange reserves, interest rates, and FDI moving in the right direction. Underlying weaknesses were exposed in the banking sector in 2016 when the government was forced to take over three small and undercapitalized banks. In 2016, the government enacted legislation that limits interest rates banks can charge on loans and set a rate that banks must pay their depositors. This measure led to a sharp shrinkage of credit in the economy.\r\nTourism holds a significant place in Kenya’s economy. A spate of terrorist attacks by the Somalia-based group al-Shabaab reduced international tourism earning after their deadly 2013 attack on Nairobi’s Westgate mall, which killed 67 people, but the sector is now recovering. In 2016, tourist arrivals grew by 17% while revenues from tourism increased by 37%.', '$70.53 billion (2016 est.)', 'tea, coffee, corn, wheat, sugarcane, fruit, vegetables; dairy products, beef, fish, pork, poultry, eggs', 'small-scale consumer goods (plastic, furniture, batteries, textiles, clothing, soap, cigarettes, flour), agricultural products, horticulture, oil refining; aluminum, steel, lead; cement, commercial ship repair, tourism', '19.14 million (2016 est.)', 'tea, horticultural products, coffee, petroleum products, fish, cement', '9.548 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '14,320 bbl/day (2014 est.)', '0 cu m (2013 est.)', '5Y (2016)', '197 (2013)', '-', 'oil 4 km; refined products 928 km (2013)', '3,806 km', '161,452 km', 'none specifically; the only significant inland waterway is the part of Lake Victoria within the boundaries of Kenya; Kisumu is the main port and has ferry connections to Uganda and Tanzania (2011)', '2018-02-07 18:03:30', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(118, 'KI', 'ki', 'Kiribati', 'The Gilbert Islands became a British protectorate in 1892 and a colony in 1915; they were captured by the Japanese in the Pacific War in 1941. The islands of Makin and Tarawa were the sites of major US amphibious victories over entrenched Japanese garrisons in 1943. The Gilbert Islands were granted self-rule by the UK in 1971 and complete independence in 1979 under the new name of Kiribati. The US relinquished all claims to the sparsely inhabited Phoenix and Line Island groups in a 1979 treaty of friendship with Kiribati.', 'Oceania', '1 25 N, 173 00 E', '811 sq km', '108,145 (July 2017 est.)', 'I-Kiribati (singular and plural)', 'I-Kiribati 96.2%, I-Kiribati/mixed 1.8%, Tuvaluan 0.2%, other 1.8% (2015 est.)', 'I-Kiribati, English (official)', 'Roman Catholic 57.3%, Kiribati Uniting Church 31.3%, Mormon 5.3%, Baha''i 2.1%, Seventh Day Adventist 1.9%, other 2.1% (2015 est.)', 'Republic of Kiribati', 'presidential republic', 'Tarawa', '3 geographical units: Gilbert Islands, Line Islands, Phoenix Islands; note - there are no first-order administrative divisions, but there are 6 districts (Banaba, Central Gilberts, Line Islands, Northern Gilberts, Southern Gilberts, Tarawa) and 21 island councils - one for each of the inhabited islands (Abaiang, Abemama, Aranuka, Arorae, Banaba, Beru, Butaritari, Kanton, Kiritimati, Kuria, Maiana, Makin, Marakei, Nikunau, Nonouti, Onotoa, Tabiteuea, Tabuaeran, Tamana, Tarawa, Teraina)', '12 July 1979 (from the UK)', 'A remote country of 33 scattered coral atolls, Kiribati has few natural resources and is one of the least developed Pacific Island countries. Commercially viable phosphate deposits were exhausted by the time of independence from the United Kingdom in 1979. Earnings from fishing licenses and seafarer remittances are important sources of income, however, remittances and the number of seafarers employed declined in the global crisis, but has since improved. In 2013, fishing license revenues contributed close to half of government’s total revenue and total remittances from seafarers were equivalent to 6% of GDP.\r\nEconomic development is constrained by a shortage of skilled workers, weak infrastructure, and remoteness from international markets. The public sector dominates economic activity, with ongoing capital projects in infrastructure including road rehabilitation, water and sanitation projects, and renovations to the international airport, spurring some growth. Public debt increased from less than 10% of GDP in 2014 to 23% of GDP at the end of 2015 due to the Bonriki International Airport repair and upgrade project financed by development partner concessional loans.\r\nKiribati is dependent on foreign aid, which was estimated to have contributed over 43% in 2013 to the government’s finances. The country’s sovereign fund, the Revenue Equalization Reserve Fund (RERF), which is held offshore, had an estimated balance of $571 million (A$756 million) in 2015, equivalent to 344% of GDP. The RERF seeks to avoid exchange rate risk by holding investments in more than 20 currencies, including the Australian dollar, US dollar, the Japanese yen, and the Euro. Drawdowns from the RERF helped finance the government’s annual budget.', '$174 million (2016 est.)', 'copra, breadfruit, fish', 'fishing, handicrafts', '39,000', 'fish, coconut products', '24 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'T3 (2016)', '19 (2013)', '-', '-', '-', '670 km (2011)', '5 km (small network of canals in Line Islands) (2012)', '2018-02-07 18:03:30', NULL),
(119, 'XK', 'xk', 'Kosovo', 'The central Balkans were part of the Roman and Byzantine Empires before ethnic Serbs migrated to the territories of modern Kosovo in the 7th century. During the medieval period, Kosovo became the center of a Serbian Empire and saw the construction of many important Serb religious sites, including many architecturally significant Serbian Orthodox monasteries. The defeat of Serbian forces at the Battle of Kosovo in 1389 led to five centuries of Ottoman rule during which large numbers of Turks and Albanians moved to Kosovo. By the end of the 19th century, Albanians replaced Serbs as the dominant ethnic group in Kosovo. Serbia reacquired control over the region from the Ottoman Empire during the First Balkan War of 1912. After World War II, Kosovo''s present-day boundaries were established when Kosovo became an autonomous province of Serbia in the Socialist Federal Republic of Yugoslavia (S.F.R.Y.). Despite legislative concessions, Albanian nationalism increased in the 1980s, which led to riots and calls for Kosovo''s independence. The Serbs - many of whom viewed Kosovo as their cultural heartland - instituted a new constitution in 1989 revoking Kosovo''s autonomous status. Kosovo''s Albanian leaders responded in 1991 by organizing a referendum declaring Kosovo independent. Serbia undertook repressive measures against the Kosovar Albanians in the 1990s, provoking a Kosovar Albanian insurgency.\r\nBeginning in 1998, Serbia conducted a brutal counterinsurgency campaign that resulted in massacres and massive expulsions of ethnic Albanians (some 800,000 ethnic Albanians were forced from their homes in Kosovo). After international attempts to mediate the conflict failed, a three-month NATO military operation against Serbia beginning in March 1999 forced the Serbs to agree to withdraw their military and police forces from Kosovo. UN Security Council Resolution 1244 (1999) placed Kosovo under a transitional administration, the UN Interim Administration Mission in Kosovo (UNMIK), pending a determination of Kosovo''s future status. A UN-led process began in late 2005 to determine Kosovo''s final status. The 2006-07 negotiations ended without agreement between Belgrade and Pristina, though the UN issued a comprehensive report on Kosovo''s final status that endorsed independence. On 17 February 2008, the Kosovo Assembly declared Kosovo independent. Since then, over 110 countries have recognized Kosovo, and it has joined numerous international organizations. In October 2008, Serbia sought an advisory opinion from the International Court of Justice (ICJ) on the legality under international law of Kosovo''s declaration of independence. The ICJ released the advisory opinion in July 2010 affirming that Kosovo''s declaration of independence did not violate general principles of international law, UN Security Council Resolution 1244, or the Constitutive Framework. The opinion was closely tailored to Kosovo''s unique history and circumstances.\r\nDemonstrating Kosovo’s development into a sovereign, multi-ethnic, democratic country the international community ended the period of Supervised Independence in 2012. Elections were held throughout Kosovo in 2013 and 2014, at the municipal and national level respectively. Serbia continues to reject Kosovo''s independence, but the two countries reached an agreement to normalize their relations in April 2013 through EU-facilitated talks and are currently engaged in the implementation process. Kosovo seeks full integration into the international community, and has pursued bilateral recognitions and eventual membership in international organizations, such as the UN, EU, and NATO.', 'Europe', '42 35 N, 21 00 E', '10,887 sq km', '1,895,250 (July 2017 est.)', 'Kosovar (Albanian), Kosovac (Serbian)', 'Albanians 92.9%, Bosniaks 1.6%, Serbs 1.5%, Turk 1.1%, Ashkali 0.9%, Egyptian 0.7%, Gorani 0.6%, Romani 0.5%, other/unspecified 0.2%', 'Albanian (official) 94.5%, Bosnian 1.7%, Serbian (official) 1.6%, Turkish 1.1%, other 0.9% (includes Romani), unspecified 0.1%', 'Muslim 95.6%, Roman Catholic 2.2%, Orthodox 1.5%, other 0.07%, none 0.07%, unspecified 0.6% (2011 est.)', 'Republic of Kosovo', 'parliamentary republic', 'Pristina (Prishtine, Prishtina)', '38 municipalities (komunat, singular - komuna (Albanian); opstine, singular - opstina (Serbian)); Decan (Decani), Dragash (Dragas), Ferizaj (Urosevac), Fushe Kosove (Kosovo Polje), Gjakove (Dakovica), Gjilan (Gnjilane), Gllogovc (Glogovac), Gracanice (Gracanica), Hani i Elezit (Deneral Jankovic), Istog (Istok), Junik, Kacanik, Kamenice (Kamenica), Kline (Klina), Kllokot (Klokot), Leposaviq (Leposavic), Lipjan (Lipljan), Malisheve (Malisevo), Mamushe (Mamusa), Mitrovice e Jug (Juzna Mitrovica) [South Mitrovica], Mitrovice e Veriut (Severna Mitrovica) [North Mitrovica], Novoberde (Novo Brdo), Obiliq (Obilic), Partesh (Partes), Peje (Pec), Podujeve (Podujevo), Prishtine (Pristina), Prizren, Rahovec (Orahovac), Ranillug (Ranilug), Shterpce (Strpce), Shtime (Stimlje), Skenderaj (Srbica), Suhareke (Suva Reka), Viti (Vitina), Vushtrri (Vucitrn), Zubin Potok, Zvecan', '17 February 2008 (from Serbia)', 'Kosovo''s economy has shown progress in transitioning to a market-based system and maintaining macroeconomic stability, but it is still highly dependent on the international community and the diaspora for financial and technical assistance. Remittances from the diaspora - located mainly in Germany, Switzerland, and the Nordic countries - are estimated to account for about 17% of GDP and international donor assistance accounts for approximately 10% of GDP. With international assistance, Kosovo has been able to privatize a majority of its state-owned enterprises.\r\nKosovo''s citizens are the second poorest in Europe, after Moldova, with a per capita GDP (PPP) of $9,600 in 2016. An unemployment rate of 33%, and a youth unemployment rate near 60%, in a country where the average age is 26, encourages emigration and fuels a significant informal, unreported economy. Emigration remains challenging, however, because Kosovo lacks visa-free travel to the EU. Most of Kosovo''s population lives in rural towns outside of the capital, Pristina. Inefficient, near-subsistence farming is common - the result of small plots, limited mechanization, and a lack of technical expertise. Kosovo enjoys lower labor costs than the rest of the region. However, high levels of corruption, little contract enforcement, and unreliable electricity supply have discouraged potential investors. The official currency of Kosovo is the euro, but the Serbian dinar is also used illegally in Serb majority communities. Kosovo''s tie to the euro has helped keep core inflation low.\r\nMinerals and metals production - including lignite, lead, zinc, nickel, chrome, aluminum, magnesium, and a wide variety of construction materials - once the backbone of industry, has declined because of aging equipment and insufficient investment, problems exacerbated by competing and unresolved ownership claims of Kosovo’s largest mines. A limited and unreliable electricity supply is a major impediment to economic development, but Kosovo has received technical assistance to help improve the sector’s performance. In 2012, Kosovo privatized its electricity supply and distribution network. The US Government is cooperating with the Ministry of Economic Development (MED) and the World Bank to conclude a commercial tender for the construction of Kosovo C, a new lignite-fired power plant that would leverage Kosovo’s large lignite reserves. MED also has plans for the rehabilitation of an older coal power plant, Kosovo B, and the development of a coal mine that could supply both plants.\r\nIn June 2009, Kosovo joined the World Bank and International Monetary Fund, and began servicing its share of the former Yugoslavia''s debt. In order to help integrate Kosovo into regional economic structures, UNMIK signed (on behalf of Kosovo) its accession to the Central Europe Free Trade Area (CEFTA) in 2006. Kosovo joined the European Bank for Reconstruction and Development in 2012 and the Council of Europe Development Bank in 2013. In 2016, Kosovo implemented the Stabilization and Association Agreement (SAA) negotiations with the EU, focused on trade liberalization. Under the SAA, Kosovo — which gets approximately 58% of government revenue from tariffs on imports — is required to phase out tariffs on EU goods over the next seven years. In 2014, nearly 60% of customs duty-eligible imports into Kosovo were EU goods. In 2015, Kosovo negotiated a $185 million Stand-by Arrangement (SBA) with the IMF following the conclusion of its previous SBA in 2014. The IMF requested an extension of the current SBA to August 2017 to facilitate policy continuity and allow sufficient time for ongoing structural reforms to progress. In August 2015, as part of its EU-facilitated normalization process with Serbia, Kosovo signed agreements on telecommunications and energy distribution, but disagreements over who owns economic assets, such as the Trepca mining conglomerate, within Kosovo continue.\r\nKosovo experienced its first federal budget deficit in 2012, when government expenditures climbed sharply. In May 2014, the government introduced a 25% salary increase for public sector employees and an equal increase in certain social benefits. Central revenues could not sustain these increases, and the government was forced to reduce its planned capital investments. The government, led by Prime Minister MUSTAFA - a trained economist - recently made several changes to its fiscal policy, expanding the list of duty-free imports, decreasing the Value Added Tax (VAT) for basic food items and public utilities, and increasing the VAT for all other goods.\r\nWhile Kosovo’s economy continued to make progress, it needs further reform and investment to enable the level of growth required to reduce unemployment and raise living standards in a meaningful way.', '$6.624 billion (2016 est.)', 'wheat, corn, berries, potatoes, peppers, fruit; dairy, livestock; fish', 'mineral mining, construction materials, base metals, leather, machinery, appliances, foodstuffs and beverages, textiles', '483,200', 'mining and processed metal products, scrap metals, leather products, machinery, appliances, prepared foodstuffs, beverages and tobacco, vegetable products, textiles and apparel', '5.759 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2016)', 'Z6 (2016)', '6 (2013)', '2 (2013)', '-', '333 km', '2,003 km', '-', '2018-02-07 18:03:30', NULL),
(120, 'KW', 'kw', 'Kuwait', 'Kuwait has been ruled by the AL-SABAH dynasty since the 18th century. The threat of Ottoman invasion in 1899 prompted Amir Mubarak AL-SABAH to seek protection from Britain, ceding foreign and defense responsibility to Britain until 1961, when the country attained its independence. Kuwait was attacked and overrun by Iraq on 2 August 1990. Following several weeks of aerial bombardment, a US-led UN coalition began a ground assault on 23 February 1991 that liberated Kuwait in four days. Kuwait spent more than $5 billion to repair oil infrastructure damaged during 1990-91. The AL-SABAH family returned to power in 1991 and established one of the most independent legislatures in the Arab World. The country witnessed the historic election in 2009 of four women to its National Assembly. Amid the 2010-11 uprisings and protests across the Arab world, stateless Arabs, known as bidoon, staged small protests in early 2011 demanding citizenship, jobs, and other benefits available to Kuwaiti nationals. Youth activist groups'' repeated rallies in 2011 for the dismissal of a prime minister seen as being corrupt, ultimately led to his resignation in late 2011. Demonstrations renewed in late 2012 in response to an Amiri decree amending the electoral law. The opposition, led by a coalition of Sunni Islamists, tribalists, some liberals, and myriad youth groups, largely boycotted legislative elections in 2012 and 2013, which ushered in a legislature more amenable to the government''s agenda. However, the opposition, expressing strong opposition to the government’s fiscal reforms, participated in the November 2016 National Assembly election and won almost half of the positions. Since coming to power in 2006, the Amir has dissolved the National Assembly on seven occasions (the Constitutional Court annulled the Assembly in June 2012 and again in June 2013) and shuffled the cabinet over a dozen times, usually citing political stagnation and gridlock between the legislature and the government.', 'Middle East', '29 30 N, 45 45 E', '17,818 sq km', '2,875,422 (July 2017 est.)', 'Kuwaiti(s)', 'Kuwaiti 31.3%, other Arab 27.9%, Asian 37.8%, African 1.9%, other 1.1% (includes European, North American, South American, and Australian) (2013 est.)', 'Arabic (official), English widely spoken', 'Muslim (official) 76.7%, Christian 17.3%, other and unspecified 5.9%', 'State of Kuwait', 'constitutional monarchy', 'Kuwait City', '6 governorates (muhafazat, singular - muhafazah); Al Ahmadi, Al ''Asimah, Al Farwaniyah, Al Jahra'', Hawalli, Mubarak al Kabir', '19 June 1961 (from the UK)', 'Kuwait has a geographically small, but wealthy, relatively open economy with crude oil reserves of about 102 billion barrels - more than 6% of world reserves. Kuwaiti officials plan to increase production to 4 million barrels of oil equivalent per day by 2020. Petroleum accounts for over half of GDP, 92% of export revenues, and 90% of government income.\r\nIn 2015, Kuwait, for the first time in 15 years, realized a budget deficit after decades of high oil prices; in 2016, the deficit grew to 16.5% of GDP. Kuwaiti authorities announced cuts to fuel subsidies in August 2016, provoking outrage among the public and National Assembly, and the Amir dissolved the government for the seventh time in ten years. Despite Kuwait’s dependence on oil, the government has cushioned itself against the impact of lower oil prices, by saving annually at least 10% of government revenue in the Fund for Future Generations.\r\nKuwait has failed to diversify its economy or bolster the private sector, because of a poor business climate, a large public sector that employs about 76% of citizens, and an acrimonious relationship between the National Assembly and the executive branch that has stymied most economic reforms. The Kuwaiti Government has made little progress on its long-term economic development plan first passed in 2010. While the government planned to spend up to $104 billion over four years to diversify the economy, attract more investment, and boost private sector participation in the economy, many of the projects did not materialize because of an uncertain political situation or delays in awarding contracts.', '$110.9 billion (2016 est.)', 'fish', 'petroleum, petrochemicals, cement, shipbuilding and repair, water desalination, food processing, construction materials', '2.612 million', 'oil and refined products, fertilizers', '63.84 billion kWh (2015 est.)', '2.924 million bbl/day (2016 est.)', '920,000 bbl/day (2016 est.)', '16.91 billion cu m (2015 est.)', '9K (2016)', '7 (2013)', '4 (2013)', 'gas 261 km; oil 540 km; refined products 57 km (2013)', '-', '6,608 km (2010)', '-', '2018-02-07 18:03:30', NULL),
(121, 'KG', 'kg', 'Kyrgyzstan', 'A Central Asian country of incredible natural beauty and proud nomadic traditions, most of the territory of present-day Kyrgyzstan was formally annexed to the Russian Empire in 1876. The Kyrgyz staged a major revolt against the Tsarist Empire in 1916 in which almost one-sixth of the Kyrgyz population was killed. Kyrgyzstan became a Soviet republic in 1936 and achieved independence in 1991 when the USSR dissolved. Nationwide demonstrations in 2005 and 2010 resulted in the ouster of Kyrgyzstan’s first two presidents, Askar AKAEV and Kurmanbek BAKIEV. In 2017, Almazbek ATAMBAEV became the first Kyrgyzstani president to step down after serving a full term as required in the country’s constitution. Former Prime Minister and ruling Social-Democratic Party of Kyrgyzstan member Sooronbay JEENBEKOV replaced him after winning an October 2017 presidential election that was the most competitive in Kyrgyzstan’s history, although it was marred by allegations of illicit government interference to benefit JEENBEKOV. The president holds substantial powers as head of state even though the prime minister oversees Kyrgyzstan’s government and selects most cabinet members. The president represents the country internationally and can sign or veto laws, call for new elections, and nominate supreme court judges, cabinet members for posts related to security or defense, and numerous other high-level positions. Continuing concerns for Kyrgyzstan include the trajectory of democratization, endemic corruption, poor interethnic relations, border security vulnerabilities, and potential terrorist threats.', 'Asia', '41 00 N, 75 00 E', '199,951 sq km', '5,789,122 (July 2017 est.)', 'Kyrgyzstani(s)', 'Kyrgyz 73.2%, Uzbek 14.6%, Russian 5.8%, Dungan 1.1%, other 5.3% (includes Uyghur, Tajik, Turk, Kazakh, Tatar, Ukrainian, Korean, German) (2017 est.)', 'Kyrgyz (official) 71.4%, Uzbek 14.4%, Russian (official) 9%, other 5.2% (2009 est.)', 'Muslim 75%, Russian Orthodox 20%, other 5%', 'Kyrgyz Republic', 'parliamentary republic', 'Bishkek', '7 provinces (oblustar, singular - oblus) and 2 cities* (shaarlar, singular - shaar); Batken Oblusu, Bishkek Shaary*, Chuy Oblusu (Bishkek), Jalal-Abad Oblusu, Naryn Oblusu, Osh Oblusu, Osh Shaary*, Talas Oblusu, Ysyk-Kol Oblusu (Karakol)', '31 August 1991 (from the Soviet Union)', 'Kyrgyzstan is a landlocked, mountainous, lower middle income country with an economy dominated by minerals extraction, agriculture, and reliance on remittances from citizens working abroad. Cotton, wool, and meat are the main agricultural products, although only cotton is exported in any quantity. Other exports include gold, mercury, uranium, natural gas, and - in some years - electricity. The country has sought to attract foreign investment to expand its export base, including construction of hydroelectric dams, but a difficult investment climate and an ongoing legal battle with a Canadian firm over the joint ownership structure of the nation’s largest gold mine deter potential investors. Remittances from Kyrgyz migrant workers, predominantly in Russia and Kazakhstan, are equivalent to over one-quarter of Kyrgyzstan’s GDP.\r\nFollowing independence, Kyrgyzstan rapidly implemented market reforms, such as improving the regulatory system and instituting land reform. In 1998, Kyrgyzstan was the first Commonwealth of Independent States country to be accepted into the World Trade Organization. The government has privatized much of its ownership shares in public enterprises. Despite these reforms, the country suffered a severe drop in production in the early 1990s and has again faced slow growth in recent years as the global financial crisis, declining oil prices, and regional economic headwinds have damaged economies across Central Asia. The Kyrgyz government remains dependent on foreign donor support to finance its annual budget deficit of approximately 4 to 5% of GDP.\r\nKyrgyz leaders hope the country’s August 2015 accession to the Eurasian Economic Union (EAEU) will bolster trade and investment, but slowing economies in Russia and China and low commodity prices continue to hamper economic growth. While joining the EAEU has increased Kyrgyz labor mobility within member states, large-scale trade and investment pledged by Kyrgyz leaders has been slow in developing since accession. Kyrgyz entrepreneurs and politicians alike often contend that non-tariff measures imposed by other EAEU member states, particularly Kazakhstan, are negatively impacting sectors of the Kyrgyz economy that enjoy a comparative advantage, such as meat and dairy production. Since acceding to the EAEU, the Kyrgyz Republic has continued harmonizing its laws and regulations to conform to EAEU standards, though many local entrepreneurs have criticized this process as disjointed and incomplete. The keys to future growth include progress in fighting corruption, improving administrative transparency, restructuring and diversifying domestic industries, and attracting foreign aid and investment.', '$6.551 billion (2016 est.)', 'cotton, potatoes, vegetables, grapes, fruits and berries; sheep, goats, cattle, wool', 'small machinery, textiles, food processing, cement, shoes, lumber, refrigerators, furniture, electric motors, gold, rare earth metals', '2.787 million (2016 est.)', 'gold, cotton, wool, garments, meat; mercury, uranium, electricity; machinery; shoes', '12.8 billion kWh (2015 est.)', '1,000 bbl/day (2016 est.)', '1,776 bbl/day (2014 est.)', '30 million cu m (2015 est.)', 'EX (2016)', '28 (2013)', '-', 'gas 480 km; oil 16 km (2013)', '470 km', '34,000 km (2007)', '600 km (2010)', '2018-02-07 18:03:30', NULL),
(122, 'LA', 'la', 'Laos', 'Modern-day Laos has its roots in the ancient Lao kingdom of Lan Xang, established in the 14th century under King FA NGUM. For 300 years Lan Xang had influence reaching into present-day Cambodia and Thailand, as well as over all of what is now Laos. After centuries of gradual decline, Laos came under the domination of Siam (Thailand) from the late 18th century until the late 19th century, when it became part of French Indochina. The Franco-Siamese Treaty of 1907 defined the current Lao border with Thailand. In 1975, the communist Pathet Lao took control of the government, ending a six-century-old monarchy and instituting a strict socialist regime closely aligned to Vietnam. A gradual, limited return to private enterprise and the liberalization of foreign investment laws began in 1988. Laos became a member of ASEAN in 1997 and the WTO in 2013.', 'Southeast Asia', '18 00 N, 105 00 E', '236,800 sq km', '7,126,706 (July 2017 est.)', 'Lao(s) or Laotian(s)', 'Lao 53.2%, Khmou 11%, Hmong 9.2%, Phouthay 3.4%, Tai 3.1%, Makong 2.5%, Katong 2.2%, Lue 2%, Akha 1.8%, other 11.6%', 'Lao (official), French, English, various ethnic languages', 'Buddhist 64.7%, Christian 1.7%, none 31.4%, other/not stated 2.1% (2015 est.)', 'Lao People''s Democratic Republic', 'communist state', 'Vientiane (Viangchan)', '17 provinces (khoueng, singular and plural) and 1 capital city* (nakhon luang, singular and plural); Attapu, Bokeo, Bolikhamxai, Champasak, Houaphan, Khammouan, Louangnamtha, Louangphabang, Oudomxai, Phongsali, Salavan, Savannakhet, Viangchan (Vientiane)*, Viangchan, Xaignabouli, Xaisomboun, Xekong, Xiangkhouang', '19 July 1949 (from France)', 'The government of Laos, one of the few remaining one-party communist states, began decentralizing control and encouraging private enterprise in 1986. Economic growth averaged more than 6% per year in the period 1988-2008, and Laos'' growth has more recently been amongst the fastest in Asia, averaging nearly 8% per year for most of the last decade. However, growth has declined over the past year and is expected to be about 6.8% in 2017, according to the IMF.\r\nNevertheless, Laos remains a country with an underdeveloped infrastructure, particularly in rural areas. It has a basic, but improving, road system, and limited external and internal land-line telecommunications. Electricity is available to 83% of the population. Agriculture, dominated by rice cultivation in lowland areas, accounts for about 25% of GDP and 73% of total employment. Recently, the country has faced a persistent current account deficit, falling foreign currency reserves, and growing public debt, as slow recovery of the global economy, especially that of China, has driven down the prices of its mineral exports.\r\nLaos'' economy is heavily dependent on capital-intensive natural resource exports. The economy has benefited from high-profile foreign direct investment in hydropower dams along the Mekong River, copper and gold mining, logging, and construction, although some projects in these industries have drawn criticism for their environmental impacts.\r\nLaos gained Normal Trade Relations status with the US in 2004 and applied for Generalized System of Preferences trade benefits in 2013 after being admitted to the World Trade Organization earlier in the year. Laos held the chairmanship of ASEAN in 2016. Laos is in the process of implementing a value-added tax system. The government appears committed to raising the country''s profile among foreign investors and has developed special economic zones replete with generous tax incentives, but a limited labor pool, a small domestic market, and corruption remain impediments to investment. Laos also has ongoing problems with the business environment, including onerous registration requirements, a gap between legislation and implementation, and unclear or conflicting regulations.', '$15.77 billion (2016 est.)', 'sweet potatoes, vegetables, corn, coffee, sugarcane, tobacco, cotton, tea, peanuts, rice; cassava (manioc, tapioca), water buffalo, pigs, cattle, poultry', 'mining (copper, tin, gold, gypsum); timber, electric power, agricultural processing, rubber, construction, garments, cement, tourism', '3.521 million (2016 est.)', 'wood products, coffee, electricity, tin, copper, gold, cassava', '11.46 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'RDPL (2016)', '41 (2013)', '-', 'refined products 540 km (2013)', '-', '39,586 km', '4,600 km (primarily on the Mekong River and its tributaries; 2,900 additional km are intermittently navigable by craft drawing less than 0.5 m) (2012)', '2018-02-07 18:03:30', NULL),
(123, 'LV', 'lv', 'Latvia', 'Several eastern Baltic tribes merged in medieval times to form the ethnic core of the Latvian people (ca. 8th-12th centuries A.D.). The region subsequently came under the control of Germans, Poles, Swedes, and finally, Russians. A Latvian republic emerged following World War I, but it was annexed by the USSR in 1940 - an action never recognized by the US and many other countries. Latvia reestablished its independence in 1991 following the breakup of the Soviet Union. Although the last Russian troops left in 1994, the status of the Russian minority (some 26% of the population) remains of concern to Moscow. Latvia acceded to both NATO and the EU in the spring of 2004; it joined the euro zone in 2014 and the OECD in 2016. A dual citizenship law was adopted in 2013, easing naturalization for non-citizen children.', 'Europe', '57 00 N, 25 00 E', '64,589 sq km', '1,944,643 (July 2017 est.)', 'Latvian(s)', 'Latvian 61.8%, Russian 25.6%, Belarusian 3.4%, Ukrainian 2.3%, Polish 2.1%, Lithuanian 1.2%, other 3.6% (2016 est.)', 'Latvian (official) 56.3%, Russian 33.8%, other 0.6% (includes Polish, Ukrainian, and Belarusian), unspecified 9.4%', 'Lutheran 19.6%, Orthodox 15.3%, other Christian 1%, other 0.4%, unspecified 63.7% (2006)', 'Republic of Latvia', 'parliamentary republic', 'Riga', '110 municipalities (novadi, singular - novads) and 9 cities', '4 May 1990 (declared independence from the Soviet Union); 6 September 1991 (recognized by the Soviet Union)', 'Latvia is a small, open economy with exports contributing more than half of GDP. Due to its geographical location, transit services are highly-developed, along with timber and wood-processing, agriculture and food products, and manufacturing of machinery and electronics industries. Corruption continues to be an impediment to attracting foreign direct investment and Latvia''s low birth rate and decreasing population are major challenges to its long-term economic vitality.\r\nLatvia''s economy experienced GDP growth of more than 10% per year during 2006-07, but entered a severe recession in 2008 as a result of an unsustainable current account deficit and large debt exposure amid the slowing world economy. Triggered by the collapse of the second largest bank, GDP plunged 18% in 2009. The economy has yet to return to pre-crisis levels in real terms despite strong growth, especially in the export sector. Continued gains in competitiveness and investment will be key to maintaining economic growth, especially in light of unfavorable demographic trends.\r\nThe IMF, EU, and other international donors provided substantial financial assistance to Latvia as part of an agreement to defend the currency''s peg to the euro in exchange for the government''s commitment to stringent austerity measures. The IMF/EU program successfully concluded in December 2011, although, the austerity measures have imposed large social costs. The majority of companies, banks, and real estate have been privatized, although the state still holds sizable stakes in a few large enterprises, including 80% ownership of the Latvian national airline. Latvia officially joined the World Trade Organization in February 1999 and the EU in May 2004. Latvia also joined the euro zone in 2014 and the OECD in 2016.', '$27.69 billion (2016 est.)', 'grain, rapeseed, potatoes, vegetables; pork, poultry, milk, eggs; fish', 'processed foods, processed wood products, textiles, processed metals, pharmaceuticals, railroad cars, synthetic fibers, electronics', '988,600 (2016 est.)', 'foodstuffs, wood and wood products, metals, machinery and equipment, textiles', '5.342 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2016 est.)', '0 cu m (2014 est.)', 'YL (2016)', '42 (2013)', '1 (2013)', 'gas 928 km; refined products 415 km (2013)', '2,239 km', '72,440 km', '300 km (navigable year-round) (2010)', '2018-02-07 18:03:30', NULL),
(124, 'LB', 'lb', 'Lebanon', 'Following World War I, France acquired a mandate over the northern portion of the former Ottoman Empire province of Syria. The French demarcated the region of Lebanon in 1920 and granted this area independence in 1943. Since independence the country has been marked by periods of political turmoil interspersed with prosperity built on its position as a regional center for finance and trade. The country''s 1975-90 civil war that resulted in an estimated 120,000 fatalities, was followed by years of social and political instability. Sectarianism is a key element of Lebanese political life. Neighboring Syria has historically influenced Lebanon''s foreign policy and internal policies, and its military occupied Lebanon from 1976 until 2005. The Lebanon-based Hizballah militia and Israel continued attacks and counterattacks against each other after Syria''s withdrawal, and fought a brief war in 2006. Lebanon''s borders with Syria and Israel remain unresolved.', 'Middle East', '33 50 N, 35 50 E', '10,400 sq km', 'the majority of the people live on or near the Mediterranean coast, and of these most live in and around the capital, Beirut; favorable growing conditions in the Bekaa Valley, on the southeastern side of the Lebanon Mountains, have attracted farmers and t', 'Lebanese (singular and plural)', 'Arab 95%, Armenian 4%, other 1%', 'Arabic (official), French, English, Armenian', 'Muslim 54% (27% Sunni, 27% Shia), Christian 40.5% (includes 21% Maronite Catholic, 8% Greek Orthodox, 5% Greek Catholic, 6.5% other Christian), Druze 5.6%, very small numbers of Jews, Baha''is, Buddhists, Hindus, and Mormons', 'Lebanese Republic', 'parliamentary republic', 'Beirut', '8 governorates (mohafazat, singular - mohafazah); Aakkar, Baalbek-Hermel, Beqaa (Bekaa), Beyrouth (Beirut), Liban-Nord (North Lebanon), Liban-Sud (South Lebanon), Mont-Liban (Mount Lebanon), Nabatiye', '22 November 1943 (from League of Nations mandate under French administration)', 'Lebanon has a free-market economy and a strong laissez-faire commercial tradition. The government does not restrict foreign investment; however, the investment climate suffers from red tape, corruption, arbitrary licensing decisions, complex customs procedures, high taxes, tariffs, and fees, archaic legislation, and weak intellectual property rights. The Lebanese economy is service-oriented; main growth sectors include banking and tourism.\r\nThe 1975-90 civil war seriously damaged Lebanon''s economic infrastructure, cut national output by half, and derailed Lebanon''s position as a Middle Eastern entrepot and banking hub. Following the civil war, Lebanon rebuilt much of its war-torn physical and financial infrastructure by borrowing heavily, mostly from domestic banks, which saddled the government with a huge debt burden. Pledges of economic and financial reforms made at separate international donor conferences during the 2000s have mostly gone unfulfilled, including those made during the Paris III Donor Conference in 2007, following the July 2006 war.\r\nSpillover from the Syrian conflict, including the influx of more than 1.1 million registered Syrian refugees, has increased internal tension and slowed economic growth to the 1-2% range in 2011-17, after four years of averaging 8% growth. Syrian refugees have increased the labor supply, but are blamed for pushing more Lebanese into unemployment. Chronic fiscal deficits have increased Lebanon’s debt-to-GDP ratio, the third highest in the world; most of the debt is held internally by Lebanese banks. Weak economic growth limits tax revenues, while the largest government expenditures remain debt servicing, salaries for government workers, and transfers to the electricity sector. These limitations constrain other government spending, limiting its ability to invest in necessary infrastructure improvements, such as water, electricity, and transportation.', '$52.7 billion (2016 est.)', 'citrus, grapes, tomatoes, apples, vegetables, potatoes, olives, tobacco; sheep, goats', 'banking, tourism, food processing, wine, jewelry, cement, textiles, mineral and chemical products, wood and furniture products, oil refining, metal fabricating', '2.166 million', 'jewelry, base metals, chemicals, consumer goods, fruit and vegetables, tobacco, construction minerals, electric power machinery and switchgear, textile fibers, paper', '17.32 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'OD (2016)', '8 (2013)', '1 (2013)', 'gas 88 km (2013)', '401 km', '6,970 km (includes 170 km of expressways) (2005)', '-', '2018-02-07 18:03:30', NULL),
(125, 'LS', 'ls', 'Lesotho', 'Basutoland was renamed the Kingdom of Lesotho upon independence from the UK in 1966. The Basutho National Party ruled the country during its first two decades. King MOSHOESHOE was exiled in 1990, but returned to Lesotho in 1992 and was reinstated in 1995 and subsequently succeeded by his son, King LETSIE III, in 1996. Constitutional government was restored in 1993 after seven years of military rule. In 1998, violent protests and a military mutiny following a contentious election prompted a brief but bloody intervention by South African and Batswana military forces under the aegis of the Southern African Development Community. Subsequent constitutional reforms restored relative political stability. Peaceful parliamentary elections were held in 2002, but the National Assembly elections in 2007 were hotly contested and aggrieved parties disputed how the electoral law was applied to award proportional seats in the Assembly. In 2012, competitive elections involving 18 parties saw Prime Minister Motsoahae Thomas THABANE form a coalition government - the first in the country''s history - that ousted the 14-year incumbent, Pakalitha MOSISILI, who peacefully transferred power the following month. MOSISILI returned to power in snap elections in February 2015 after the collapse of THABANE’s coalition government and an alleged attempted military coup.', 'Africa', '29 30 S, 28 30 E', '30,355 sq km', '1,958,042', 'Mosotho (singular), Basotho (plural)', 'Sotho 99.7%, Europeans, Asians, and other 0.3%', 'Sesotho (official) (southern Sotho), English (official), Zulu, Xhosa', 'Christian 80%, indigenous beliefs 20%', 'Kingdom of Lesotho', 'parliamentary constitutional monarchy', 'Maseru', '10 districts; Berea, Butha-Buthe, Leribe, Mafeteng, Maseru, Mohale''s Hoek, Mokhotlong, Qacha''s Nek, Quthing, Thaba-Tseka', '4 October 1966 (from the UK)', 'Small, mountainous, and completely landlocked by South Africa, Lesotho depends on a narrow economic base of textile manufacturing, agriculture, remittances, and regional customs revenue. About three-fourths of the people live in rural areas and engage in animal herding and subsistence agriculture, although Lesotho produces less than 20% of the nation''s demand for food. Agriculture is vulnerable to weather and climate variability.\r\nLesotho relies on South Africa for much of its economic activity; Lesotho imports 85% of the goods it consumes from South Africa, including most agricultural inputs. Households depend heavily on remittances from family members working in South Africa in mines, on farms, and as domestic workers, though mining employment has declined substantially since the 1990s. Lesotho is a member of the Southern Africa Customs Union (SACU), and revenues from SACU accounted for roughly 26% of total GDP in 2016; however, SACU revenues are volatile and expected to decline over the next 5 years. Lesotho also gains royalties from the South African Government for water transferred to South Africa from a dam and reservoir system in Lesotho. However, the government continues to strengthen its tax system to reduce dependency on customs duties and other transfers.\r\nThe government maintains a large presence in the economy - government consumption accounted for about 26% of GDP in 2017. The government remains Lesotho''s largest employer; in 2016, the government wage bill rose to 23% of GDP – the largest in sub-Saharan Africa. Lesotho''s largest private employer is the textile and garment industry - approximately 36,000 Basotho, mainly women, work in factories producing garments for export to South Africa and the US. Diamond mining in Lesotho has grown in recent years and accounted for nearly 35% of total exports in 2015. Lesotho managed steady GDP growth at an average of 4.5% from 2010 to 2014, dropping to about 2.5% in 2015-16, but poverty remains widespread around 57% of the total population.', '$2.721 billion (2016 est.)', 'corn, wheat, pulses, sorghum, barley; livestock', 'food, beverages, textiles, apparel assembly, handicrafts, construction, tourism', '930,800 (2017 est.)', 'manufactures (clothing, footwear), wool and mohair, food and live animals, electricity, water, diamonds', '600 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '7P (2016)', '24 (2013)', '-', '-', '-', '5,940 km', '-', '2018-02-07 18:03:31', NULL),
(126, 'LR', 'lr', 'Liberia', 'Settlement of freed slaves from the US in what is today Liberia began in 1822; by 1847, the Americo-Liberians were able to establish a republic. William TUBMAN, president from 1944-71, did much to promote foreign investment and to bridge the economic, social, and political gaps between the descendants of the original settlers and the inhabitants of the interior. In 1980, a military coup led by Samuel DOE ushered in a decade of authoritarian rule. In December 1989, Charles TAYLOR launched a rebellion against DOE''s regime that led to a prolonged civil war in which DOE was killed. A period of relative peace in 1997 allowed for an election that brought TAYLOR to power, but major fighting resumed in 2000. An August 2003 peace agreement ended the war and prompted the resignation of former president Charles TAYLOR, who was convicted by the UN-backed Special Court for Sierra Leone in The Hague for his involvement in Sierra Leone''s civil war. After two years of rule by a transitional government, democratic elections in late 2005 brought President Ellen JOHNSON SIRLEAF to power. She subsequently won reelection in 2011 but was challenged to rebuild Liberia''s economy, particularly following the 2014-15 Ebola epidemic, and to reconcile a nation still recovering from 14 years of fighting. In July 2016, the UN handed over peacekeeping responsibility to Liberia and reduced the UN troop presence, which now serves a support role. Constitutional term limits barred President JOHNSON SIRLEAF from running for re-election. The November 2017 presidential runoff election was halted pending a ruling on fraud allegations.', 'Africa', '6 30 N, 9 30 W', '111,369 sq km', '4,689,021 (July 2017 est.)', 'Liberian(s)', 'Kpelle 20.3%, Bassa 13.4%, Grebo 10%, Gio 8%, Mano 7.9%, Kru 6%, Lorma 5.1%, Kissi 4.8%, Gola 4.4%, other 20.1% (2008 Census)', 'English 20% (official), some 20 ethnic group languages few of which can be written or used in correspondence', 'Christian 85.6%, Muslim 12.2%, Traditional 0.6%, other 0.2%, none 1.4% (2008 Census)', 'Republic of Liberia', 'presidential republic', 'Monrovia', '15 counties; Bomi, Bong, Gbarpolu, Grand Bassa, Grand Cape Mount, Grand Gedeh, Grand Kru, Lofa, Margibi, Maryland, Montserrado, Nimba, River Cess, River Gee, Sinoe', '26 July 1847', 'Liberia is a low-income country that relies heavily on foreign assistance and remittances from the diaspora. It is richly endowed with water, mineral resources, forests, and a climate favorable to agriculture. Its principal exports are iron ore, rubber, diamonds, and gold. Palm oil and cocoa are emerging as new export products. The government has attempted to revive raw timber extraction and is encouraging oil exploration.\r\nIn the 1990s and early 2000s, civil war and government mismanagement destroyed much of Liberia''s economy, especially infrastructure in and around the capital. Much of the conflict was fueled by control over Liberia’s natural resources. With the conclusion of fighting and the installation of a democratically elected government in 2006, businesses that had fled the country began to return. The country achieved high growth during the period 2010-13 due to favorable world prices for its commodities. However, during the 2014-2015 Ebola crisis, the economy declined and many foreign-owned businesses departed with their capital and expertise. The epidemic forced the government to divert scarce resources to combat the spread of the virus, reducing funds available for needed public investment. The cost of addressing the Ebola epidemic coincided with decreased economic activity reducing government revenue, although higher donor support significantly offset this loss. During the same period, global commodities prices for key exports fell and have yet to recover to pre-Ebola levels.\r\nIn 2017, gold was a key driver of growth, as a new mining project began its first full year of production; iron ore exports are also increased as Arcelor Mittal opened new mines at Mount Gangra. The completion of the rehabilitation of the Mount Coffee Hydroelectric Dam increased electricity production to support ongoing and future economic activity, although electricity tariffs remain high relative to other countries in the region and transmission infrastructure is limited. Presidential and legislative elections in October 2017 generated election-related spending pressures.\r\nRevitalizing the economy in the future will depend on economic diversification, increasing investment and trade, higher global commodity prices, sustained foreign aid and remittances, development of infrastructure and institutions, combating corruption, and maintaining political stability and security.', '$2.14 billion (2016 est.)', 'rubber, coffee, cocoa, rice, cassava (manioc, tapioca), palm oil, sugarcane, bananas; sheep, goats; timber', 'mining (iron ore and gold), rubber processing, palm oil processing, diamonds', '1.677 million (2017 est.)', 'rubber, timber, iron, diamonds, cocoa, coffee', '70.07 million kWh', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'A8 (2016)', '29 (2013)', '-', 'oil 4 km (2013)', '429 km', '10,600 km', '-', '2018-02-07 18:03:31', NULL);
