(127, 'LY', 'ly', 'Libya', 'The Italians supplanted the Ottoman Turks in the area around Tripoli in 1911 and did not relinquish their hold until 1943 when they were defeated in World War II. Libya then passed to UN administration and achieved independence in 1951. Following a 1969 military coup, Col. Muammar al-QADHAFI assumed leadership and began to espouse his political system at home, which was a combination of socialism and Islam. During the 1970s, QADHAFI used oil revenues to promote his ideology outside Libya, supporting subversive and terrorist activities that included the downing of two airliners - one over Scotland, another in Northern Africa - and a discotheque bombing in Berlin. UN sanctions in 1992 isolated QADHAFI politically and economically following the attacks; sanctions were lifted in 2003 following Libyan acceptance of responsibility for the bombings and agreement to claimant compensation. QADHAFI also agreed to end Libya''s program to develop weapons of mass destruction, and he made significant strides in normalizing relations with Western nations.\r\nUnrest that began in several Middle Eastern and North African countries in late 2010 erupted in Libyan cities in early 2011. QADHAFI''s brutal crackdown on protesters spawned a civil war that triggered UN authorization of air and naval intervention by the international community. After months of seesaw fighting between government and opposition forces, the QADHAFI regime was toppled in mid-2011 and replaced by a transitional government known as the National Transitional Council (NTC). In 2012, the NTC handed power to an elected parliament, the General National Congress (GNC). Voters chose a new parliament to replace the GNC in June 2014 - the House of Representatives (HoR), which relocated to the eastern city of Tobruk after fighting broke out in Tripoli.\r\nIn October 2015, the UN brokered an agreement among a broad array of Libyan political parties and social groups - known as the Libyan Political Agreement (LPA). Members of the Libyan Political Dialogue, including representatives of the HoR and ex-GNC, signed the LPA in December 2015. The LPA called for the formation of an interim Government of National Accord or GNA, with a nine-member Presidency Council, the HoR, and an advisory High Council of State that most ex-GNC members joined. The LPA’s roadmap for a two-year transition to a new constitution and elected government was subsequently endorsed by UN Security Council Resolution 2259, which also called upon member states to cease official contact with parallel institutions. In January 2016, the HoR voted to approve the LPA, including the Presidency Council, while voting against a controversial provision on security leadership positions. In March 2016, the GNA Presidency Council seated itself in Tripoli. In 2016, the GNA twice announced a slate of ministers who operate de facto, but the HoR did not endorse the ministerial list. HoR and ex-GNC-affiliated hardliners continued to oppose the GNA and hamper the LPA’s implementation. In September 2017, UN Special Representative Ghassan SALAME announced a new roadmap for political reconciliation. SALAME’s plan called for amendments to the LPA, a national conference of Libyan leaders, and a constitutional referendum and general elections within a year', 'Africa', '25 00 N, 17 00 E', '1,759,540 sq km', '6,653,210 (July 2017 est.)', 'Libyan(s)', 'Berber and Arab 97%, other 3% (includes Greeks, Maltese, Italians, Egyptians, Pakistanis, Turks, Indians, and Tunisians)', 'Arabic (official), Italian, English (all widely understood in the major cities); Berber (Nafusi, Ghadamis, Suknah, Awjilah, Tamasheq)', 'Muslim (official; virtually all Sunni) 96.6%, Christian 2.7%, Buddhist 0.3%, Hindu <0.1, Jewish <0.1, folk religion <0.1, unafilliated 0.2%, other <0.1', 'none', 'in transition', 'Tripoli (Tarabulus)', '22 districts (shabiyat, singular - shabiyat); Al Butnan, Al Jabal al Akhdar, Al Jabal al Gharbi, Al Jafarah, Al Jufrah, Al Kufrah, Al Marj, Al Marqab, Al Wahat, An Nuqat al Khams, Az Zawiyah, Banghazi, Darnah, Ghat, Misratah, Murzuq, Nalut, Sabha, Surt, Tarabulus, Wadi al Hayat, Wadi ash Shati', '24 December 1951 (from UN trusteeship)', 'Libya''s economy, almost entirely dependent on oil and gas exports, struggled during the period 2014-16 as the country plunged into civil war and world oil prices dropped to seven-year lows. In early 2015, armed conflict between rival forces for control of the country’s largest oil terminals caused a decline in Libyan crude oil production, which never recovered to more than one-third of the average pre-Revolution highs of 1.6 million barrels per day. The Central Bank of Libya continued to pay government salaries to a majority of the Libyan workforce and to fund subsidies for fuel and food, resulting in an estimated budget deficit of about 17% of GDP in 2017. The economy recovered handsomely in 2017 as conflict subsided.\r\nLibya’s economic transition away from QADHAFI’s notionally socialist model has completely stalled as political chaos persists and security continues to deteriorate. Libya’s leaders have hindered economic development by failing to use its financial resources to invest in national infrastructure. The country suffers from widespread power outages in its largest cities, caused by shortages of fuel for power generation. Living conditions, including access to clean drinking water, medical services, and safe housing, have all declined as the civil war has forced more people to become internally displaced, further straining local resources.\r\nExtremists affiliated with the Islamic State of Iraq and the Levant (ISIL) attacked Libyan oilfields in the first half of 2015; ISIL has a presence in many cities across Libya including near oil infrastructure, threatening future government revenues from oil and gas.', '$33.31 billion (2016 est.)', 'wheat, barley, olives, dates, citrus, vegetables, peanuts, soybeans; cattle', 'petroleum, petrochemicals, aluminum, iron and steel, food processing, textiles, handicrafts, cement', '1.114 million (2017 est.)', 'crude oil, refined petroleum products, natural gas, chemicals', '35.45 billion kWh', '384,700 bbl/day (2016 est.)', '102,100 bbl/day (2014 est.)', '11.6 billion cu m (2015 est.)', '5A (2016)', '146 (2013)', '2 (2013)', 'condensate 882 km; gas 3,743 km; oil 7,005 km (2013)', '-', '100,024 km', '-', '2018-02-07 18:03:31', NULL),
(128, 'LI', 'li', 'Liechtenstein', 'The Principality of Liechtenstein was established within the Holy Roman Empire in 1719. Occupied by both French and Russian troops during the Napoleonic Wars, it became a sovereign state in 1806 and joined the German Confederation in 1815. Liechtenstein became fully independent in 1866 when the Confederation dissolved. Until the end of World War I, it was closely tied to Austria, but the economic devastation caused by that conflict forced Liechtenstein to enter into a customs and monetary union with Switzerland. Since World War II (in which Liechtenstein remained neutral), the country''s low taxes have spurred outstanding economic growth. In 2000, shortcomings in banking regulatory oversight resulted in concerns about the use of financial institutions for money laundering. However, Liechtenstein implemented anti-money laundering legislation and a Mutual Legal Assistance Treaty with the US that went into effect in 2003.', 'Europe', '47 16 N, 9 32 E', '160 sq km', '38,244 (July 2017 est.)', 'Liechtensteiner(s)', 'Liechtensteiner 66%, other 34% (2013 est.)', 'German 94.5% (official) (Alemannic is the main dialect), Italian 1.1%, other 4.3% (2010 est.)', 'Roman Catholic (official) 75.9%, Protestant Reformed 6.5%, Muslim 5.4%, Lutheran 1.3%, other 2.9%, none 5.4%, unspecified 2.6% (2010 est.)', 'Principality of Liechtenstein', 'constitutional monarchy', 'Vaduz', '11 communes (Gemeinden, singular - Gemeinde); Balzers, Eschen, Gamprin, Mauren, Planken, Ruggell, Schaan, Schellenberg, Triesen, Triesenberg, Vaduz', '23 January 1719 (Principality of Liechtenstein established); 12 July 1806 (independence from the Holy Roman Empire); 24 August 1866 (independence from the German Confederation)', 'Despite its small size and lack of natural resources, Liechtenstein has developed into a prosperous, highly industrialized, free-enterprise economy with a vital financial service sector and the third highest per capita income in the world, after Qatar and Luxembourg. The Liechtenstein economy is widely diversified with a large number of small businesses. Low business taxes - a flat tax of 12.5% on the income is applied - and easy incorporation rules have induced many holding companies to establish nominal offices in Liechtenstein, providing 30% of state revenues.\r\nThe country participates in a customs union with Switzerland and uses the Swiss franc as its national currency. It imports more than 90% of its energy requirements. Liechtenstein has been a member of the European Economic Area (an organization serving as a bridge between the European Free Trade Association and the EU) since May 1995. The government is working to harmonize its economic policies with those of an integrated Europe.\r\nSince 2008, Liechtenstein has faced renewed international pressure - particularly from Germany and the US - to improve transparency in its banking and tax systems. In December 2008, Liechtenstein signed a Tax Information Exchange Agreement with the US. Upon Liechtenstein''s conclusion of 12 bilateral information-sharing agreements, the OECD in October 2009 removed the principality from its "grey list" of countries that had yet to implement the organization''s Model Tax Convention. By the end of 2010, Liechtenstein had signed 25 Tax Information Exchange Agreements or Double Tax Agreements. In 2011, Liechtenstein joined the Schengen area, which allows passport-free travel across 26 European countries.', '$6.672 billion (2010 est.)', 'wheat, barley, corn, potatoes; livestock, dairy products', 'electronics, metal manufacturing, dental products, ceramics, pharmaceuticals, food products, precision instruments, tourism, optical instruments', '38,520 (2012)', 'small specialty machinery, connectors for audio and video, parts for motor vehicles, dental products, hardware, prepared foodstuffs, electronic equipment, optical products', '68.43 million kWh (2015)', '-', '-', '-', 'HB (2016)', '-', '-', 'gas 20 km (2013)', '9 km', '380 km', '28 km (2010)', '2018-02-07 18:03:31', NULL),
(129, 'LT', 'lt', 'Lithuania', 'Lithuanian lands were united under MINDAUGAS in 1236; over the next century, through alliances and conquest, Lithuania extended its territory to include most of present-day Belarus and Ukraine. By the end of the 14th century Lithuania was the largest state in Europe. An alliance with Poland in 1386 led the two countries into a union through the person of a common ruler. In 1569, Lithuania and Poland formally united into a single dual state, the Polish-Lithuanian Commonwealth. This entity survived until 1795 when its remnants were partitioned by surrounding countries. Lithuania regained its independence following World War I but was annexed by the USSR in 1940 - an action never recognized by the US and many other countries. On 11 March 1990, Lithuania became the first of the Soviet republics to declare its independence, but Moscow did not recognize this proclamation until September of 1991 (following the abortive coup in Moscow). The last Russian troops withdrew in 1993. Lithuania subsequently restructured its economy for integration into Western European institutions; it joined both NATO and the EU in the spring of 2004. In 2015, Lithuania joined the euro zone.', 'Europe', '56 00 N, 24 00 E', '65,300 sq km', '2,823,859 (July 2017 est.)', 'Lithuanian(s)', 'Lithuanian 84.1%, Polish 6.6%, Russian 5.8%, Belarusian 1.2%, other 1.1%, unspecified 1.2% (2011 est.)', 'Lithuanian (official) 82%, Russian 8%, Polish 5.6%, other 0.9%, unspecified 3.5% (2011 est.)', 'Roman Catholic 77.2%, Russian Orthodox 4.1%, Old Believer 0.8%, Evangelical Lutheran 0.6%, Evangelical Reformist 0.2%, other (including Sunni Muslim, Jewish, Greek Catholic, and Karaite) 0.8%, none 6.1%, unspecified 10.1% (2011 est.)', 'Republic of Lithuania', 'semi-presidential republic', 'Vilnius', '60 municipalities (savivaldybe, singular - savivaldybe); Akmene, Alytaus Miestas, Alytus, Anksciai, Birstono, Birzai, Druskininkai, Elektrenai, Ignalina, Jonava, Joniskis, Jurbarkas, Kaisiadorys, Kalvarijos, Kauno Miestas, Kaunas, Kazlu Rudos, Kedainiai, Kelme, Klaipedos Miestas, Klaipeda, Kretinga, Kupiskis, Lazdijai, Marijampole, Mazeikiai, Moletai, Neringa, Pagegiai, Pakruojis, Palangos Miestas, Panevezio Miestas, Panevezys, Pasvalys, Plunge, Prienai, Radviliskis, Raseiniai, Rietavo, Rokiskis, Sakiai, Salcininkai, Siauliu Miestas, Siauliai, Silale, Silute, Sirvintos, Skuodas, Svencionys, Taurage, Telsiai, Trakai, Ukmerge, Utena, Varena, Vilkaviskis, Vilniaus Miestas, Vilnius, Visaginas, Zarasai', '11 March 1990 (declared independence from the Soviet Union); 6 September 1991 (recognized by the Soviet Union); notable earlier dates: 6 July 1253 (coronation of MINDAUGAS, traditional founding date); 1 July 1569 (Polish-Lithuanian Commonwealth created); 16 February 1918 (independence from Soviet Russia)', 'After the country declared independence from the Soviet Union in 1990, Lithuania faced an initial dislocation that is typical during transitions from a planned economy to a free-market economy. Macroeconomic stabilization policies, including privatization of most state-owned enterprises, and a strong commitment to a currency board arrangement led to an open and rapidly growing economy and rising consumer demand. Foreign investment and EU funding aided in the transition. Lithuania joined the WTO in May 2001, the EU in May 2004, and the euro zone in January 2015, and is now working to complete the OECD accession roadmap it received in July 2015. In 2017, joined the OECD Working Group on Bribery, an important step in the OECD accession process.\r\nThe Lithuanian economy was severely hit by the 2008-09 global financial crisis, but it has rebounded and become one of the fastest growing in the EU. Increases in exports, investment, and wage growth that supported consumption helped the economy grow by 3.6% in 2017. In 2015, Russia was Lithuania’s largest trading partner, followed by Poland, Germany, and Latvia; goods and services trade between the US and Lithuania totaled $2.2 billion. Lithuania opened a self-financed liquefied natural gas terminal in January 2015, providing the first non-Russian supply of natural gas to the Baltic States and reducing Lithuania’s dependence on Russian gas from 100% to approximately 30% in 2016.\r\nLithuania’s ongoing recovery hinges on improving the business environment, especially by liberalizing labor laws, and improving competitiveness and export growth, the latter hampered by economic slowdowns in the EU and Russia. In addition, a steady outflow of young and highly educated people is causing a shortage of skilled labor, which, combined with a rapidly aging population, could stress public finances and constrain long-term growth.', '$46.67 billion (2016 est.)', 'grain, potatoes, sugar beets, flax, vegetables; beef, milk, eggs, pork, cheese; fish', 'metal-cutting machine tools, electric motors, televisions, refrigerators and freezers, petroleum refining, shipbuilding (small ships), furniture, textiles, food processing, fertilizer, agricultural machinery, optical equipment, lasers, electronic components, computers, amber jewelry, information technology, video game development, app/software development, biotechnology', '1.467 million (2017 est.)', 'refined fuel, machinery and equipment, chemicals, textiles, foodstuffs, plastics', '3.433 billion kWh (2015 est.)', '2,000 bbl/day (2016 est.)', '174,800 bbl/day (2014 est.)', '0 cu m (2014 est.)', 'LY (2016)', '61 (2013)', '-', 'gas 1,921 km; refined products 121 km (2013)', '1,768 km', '84,166 km', '441 km (navigable year-round) (2007)', '2018-02-07 18:03:31', NULL),
(130, 'LU', 'lu', 'Luxembourg', 'Founded in 963, Luxembourg became a grand duchy in 1815 and an independent state under the Netherlands. It lost more than half of its territory to Belgium in 1839 but gained a larger measure of autonomy. In 1867, Luxembourg attained full independence under the condition that it promise perpetual neutrality. Overrun by Germany in both world wars, it ended its neutrality in 1948 when it entered into the Benelux Customs Union and when it joined NATO the following year. In 1957, Luxembourg became one of the six founding countries of the EEC (later the EU), and in 1999 it joined the euro currency zone.', 'Europe', '49 45 N, 6 10 E', '2,586 sq km', '594,130 (July 2017 est.)', 'Luxembourger(s)', 'Luxembourger 53.3%, Portuguese 16.2%, French 7.2%, Italian 3.5%, Belgian 3.4%, German 2.2%, British 1.1%, other 13.2%', 'Luxembourgish (official administrative and judicial language and national language (spoken vernacular)) 55.8%, Portuguese 15.7%, French (official administrative, judicial, and legislative language) 12.1%, German (official administrative and judicial language) 3.1%, Italian 2.9%, English 2.1%, other 8.4% (2011 est.)', 'Christian (predominantly Roman Catholic) 70.4%, Muslim 2.3%, other (includes Buddhist, folk religions, Hindu, Jewish) 0.5%, none 26.8% (2010 est.)', 'Grand Duchy of Luxembourg', 'constitutional monarchy', 'Luxembourg', '12 cantons (cantons, singular - canton); Capellen, Clervaux, Diekirch, Echternach, Esch-sur-Alzette, Grevenmacher, Luxembourg, Mersch, Redange, Remich, Vianden, Wiltz', '1839 (from the Netherlands)', 'This small, stable, high-income economy has historically featured solid growth, low inflation, and low unemployment. Luxembourg, the only Grand Duchy in the world, is a landlocked country in northwestern Europe surrounded by Belgium, France, and Germany. Despite its small landmass and small population, Luxembourg is the second-wealthiest country in the world when measured on a gross domestic product (PPP) per capita basis. Luxembourg has one of the highest current account surpluses as a share of GDP in the euro zone, and it maintains a healthy budgetary position, with a 2017 surplus of 0.5% of GDP, and the lowest public debt level in the region.\r\nSince 2002, Luxembourg’s government has proactively implemented policies and programs to support economic diversification and to attract foreign direct investment. The government focused on key innovative industries that showed promise for supporting economic growth: logistics, information and communications technology (ICT); health technologies, including biotechnology and biomedical research; clean energy technologies, and more recently, space technology and financial services technologies. The economy has evolved and flourished, posting strong GDP growth of 3.4% in 2017, far outpacing the European average of 1.8%.\r\nLuxembourg remains a financial powerhouse – the financial sector accounts for more than 35% of GDP - because of the exponential growth of the investment fund sector through the launch and development of cross-border funds (UCITS) in the 1990s. Luxembourg is the world’s second-largest investment fund asset domicile, after the US, with $4 trillion of assets in custody in financial institutions.\r\nLuxembourg has lost some of its advantage as a favorable tax location because of OECD and EU pressure, as well as the “LuxLeaks” scandal, which revealed advantageous tax treatments offered to foreign corporations. In 2015, the government’s compliance with EU requirements to implement automatic exchange of tax information on savings accounts - thus ending banking secrecy - has constricted banking activity. Likewise, changes to the way EU members collect taxes from e-commerce has cut Luxembourg’s sales tax revenues, requiring the government to raise additional levies and to reduce some direct social benefits as part of the tax reform package of 2017. The tax reform package also included reductions in the corporate tax rate and increases in deductions for families, both intended to increase purchasing power and increase competitiveness.', '$63.52 billion (2016 est.)', 'grapes, barley, oats, potatoes, wheat, fruits; dairy and livestock products', 'banking and financial services, construction, real estate services, iron, metals, and steel, information technology, telecommunications, cargo transportation and logistics, chemicals, engineering, tires, glass, aluminum, tourism, biotechnology', '282,800', 'machinery and equipment, steel products, chemicals, rubber products, glass', '735 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2016 est.)', '6 million cu m (2015 est.)', 'LX (2016)', '2 (2013)', '1 (2013)', 'gas 142 km; refined products 27 km (2013)', '275 km', '2,899 km', '37 km (on Moselle River) (2010)', '2018-02-07 18:03:31', NULL),
(131, 'MO', 'mo', 'Macau', 'Colonized by the Portuguese in the 16th century, Macau was the first European settlement in the Far East. Pursuant to an agreement signed by China and Portugal on 13 April 1987, Macau became the Macau Special Administrative Region of the People''s Republic of China on 20 December 1999. In this agreement, China promised that, under its "one country, two systems" formula, China''s political and economic system would not be imposed on Macau, and that Macau would enjoy a "high degree of autonomy" in all matters except foreign affairs and defense for the subsequent 50 years.', 'Southeast Asia', '22 10 N, 113 33 E', '28.2 sq km', '601,969 (July 2017 est.)', 'Chinese', 'Chinese 88.7%, Portuguese 1.1%, mixed 1.1%, other 9.2% (includes Macanese - mixed Portuguese and Asian ancestry) (2016 est.)', 'Cantonese 80.1%, Mandarin 5.5%, other Chinese dialects 5.3%, Tagalog 3%, English 2.8%, Portuguese 0.6%, other 2.8%', 'Buddhist 50%, Roman Catholic 15%, none or other 35% (1997 est.)', 'Macau Special Administrative Region', 'presidential limited democracy; a special administrative region of the People''s Republic of China', '-', 'none (special administrative region of the People''s Republic of China)', 'none (special administrative region of China)', 'Since opening up its locally-controlled casino industry to foreign competition in 2001, Macau has attracted tens of billions of dollars in foreign investment, transforming the territory into one of the world''s largest gaming centers. Macau''s gaming and tourism businesses were fueled by China''s decision to relax travel restrictions on Chinese citizens wishing to visit Macau. In 2016, Macau''s gaming-related taxes accounted for more than 76% of total government revenue.\r\nMacau''s economy slowed dramatically in 2009 as a result of the global economic slowdown, but strong growth resumed in the 2010-13 period, largely on the back of tourism from mainland China and the gaming sectors. In 2015, this city of 646,800 hosted nearly 30.7 million visitors. Almost 67% came from mainland China. Macau''s traditional manufacturing industry has slowed greatly since the termination of the Multi-Fiber Agreement in 2005. Services export — primarily gaming — increasingly has driven Macau’s economic performance. Mainland China’s anti-corruption campaign brought Macau’s gambling boom to a halt in 2014, with spending in casinos contracting 34.3% in 2015. As a result, Macau''s inflation-adjusted GDP contracted 21.5% in 2015 and another 2.1% in 2016 - down from double-digit expansion rates in the period 2010-13 - but the economy recovered handsomely in 2017.\r\nMacau continues to face the challenges of managing its growing casino industry, risks from money-laundering activities, and the need to diversify the economy away from heavy dependence on gaming revenues. Macau''s currency, the pataca, is closely tied to the Hong Kong dollar, which is also freely accepted in the territory.', '$51.16 billion (2016 est.)', 'only 2% of land area is cultivated, mainly by vegetable growers; fishing, mostly for crustaceans, is important; some of the catch is exported to Hong Kong', 'tourism, gambling, clothing, textiles, electronics, footwear, toys', '400,000 (2017 est.)', 'clothing, textiles, footwear, toys, electronics, machinery and parts', '904 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'B-M (2016)', '1 (2013)', '2 (2013)', '-', '-', '424 km', '-', '2018-02-07 18:03:31', NULL),
(132, 'MK', 'mk', 'Macedonia', 'Macedonia gained its independence peacefully from Yugoslavia in 1991. Greek objection to Macedonia’s name, insisting it implies territorial pretensions to the northern Greek province of the same name, and democratic backsliding have stalled the country’s movement toward Euro-Atlantic integration. Immediately after Macedonia declared independence, Greece sought to block Macedonian efforts to gain UN membership if the name “Macedonia” was used. Macedonia was eventually admitted to the UN in 1993 as “The Former Yugoslav Republic of Macedonia,” and at the same time it agreed to UN-sponsored negotiations on the name dispute. In 1995, Greece lifted a 20-month trade embargo and the two countries agreed to normalize relations, but the issue of the name remained unresolved and negotiations for a solution are ongoing. Since 2004, the US and over 130 other nations have recognized Macedonia by its constitutional name, Republic of Macedonia. Ethnic Albanian grievances over perceived political and economic inequities escalated into an insurgency in 2001 that eventually led to the internationally brokered Ohrid Framework Agreement (OFA), which ended the fighting and established guidelines for constitutional amendments and the creation of new laws that enhanced the rights of minorities. Relations between ethnic Macedonians and ethnic Albanians remain fragile, however.\r\nA nearly three-year political crisis that engulfed Macedonia finally ended in June 2017 following a six-month-long government formation period after a closely contested early legislative election in December 2016. The crisis began after the 2014 legislative and presidential election, and escalated in 2015 when the opposition party began releasing wiretap content that it alleged showed widespread government corruption. Although Macedonia became an EU candidate in 2005, the country still faces challenges, including overcoming the political crisis, fully implementing the OFA, resolving the outstanding name dispute with Greece, improving relations with Bulgaria, halting democratic backsliding, and stimulating economic growth and development. At the 2008 NATO Summit in Bucharest, Romania, the Allies agreed that Macedonia would be invited to join the Alliance as soon as a mutually acceptable resolution to the name dispute was reached with Greece.', 'Europe', '41 50 N, 22 00 E', '25,713 sq km', '2,103,721 (July 2017 est.)', 'Macedonian(s)', 'Macedonian 64.2%, Albanian 25.2%, Turkish 3.9%, Romani 2.7%, Serb 1.8%, other 2.2% (2002 est.)', 'Macedonian (official) 66.5%, Albanian 25.1%, Turkish 3.5%, Romani 1.9%, Serbian 1.2%, other 1.8% (2002 est.)', 'Macedonian Orthodox 64.8%, Muslim 33.3%, other Christian 0.4%, other and unspecified 1.5% (2002 est.)', 'Republic of Macedonia', 'parliamentary republic', 'Skopje', '70 municipalities (opstini, singular - opstina) and 1 city* (grad); Aracinovo, Berovo, Bitola, Bogdanci, Bogovinje, Bosilovo, Brvenica, Caska, Centar Zupa, Cesinovo-Oblesevo, Cucer Sandevo, Debar, Debarca, Delcevo, Demir Hisar, Demir Kapija, Dojran, Dolneni, Gevgelija, Gostivar, Gradsko, Ilinden, Jegunovce, Karbinci, Kavadarci, Kicevo, Kocani, Konce, Kratovo, Kriva Palanka, Krivogastani, Krusevo, Kumanovo, Lipkovo, Lozovo, Makedonska Kamenica, Makedonski Brod, Mavrovo i Rostusa, Mogila, Negotino, Novaci, Novo Selo, Ohrid, Pehcevo, Petrovec, Plasnica, Prilep, Probistip, Radovis, Rankovce, Resen, Rosoman, Skopje*, Sopiste, Staro Nagoricane, Stip, Struga, Strumica, Studenicani, Sveti Nikole, Tearce, Tetovo, Valandovo, Vasilevo, Veles, Vevcani, Vinica, Vrapciste, Zelenikovo, Zelino, Zrnovci', '8 September 1991 (referendum by registered voters endorsed independence from Yugoslavia)', 'Since its independence in 1991, Macedonia has made progress in liberalizing its economy and improving its business environment. Its low tax rates and free economic zones have helped to attract foreign investment, which is still low relative to the rest of Europe. Corruption and weak rule of law remain significant problems. Some businesses complain of opaque regulations and unequal enforcement of the law.\r\nMacedonia’s economy is closely linked to Europe as a customer for exports and source of investment, and has suffered as a result of prolonged weakness in the euro zone. Unemployment has remained consistently high at about 23%, but may be overstated based on the existence of an extensive gray market, estimated to be between 20% and 45% of GDP, which is not captured by official statistics.\r\nMacedonia is working to build a country-wide natural gas pipeline and distribution network. Currently, Macedonia receives its small natural gas supplies from Russia via Bulgaria. In 2016, Macedonia signed a memorandum of understanding with Greece to build an interconnector that could connect to the Trans-Adriatic Pipeline that will traverse the region once complete, or to an LNG import terminal in Greece.\r\nMacedonia maintained macroeconomic stability through the global financial crisis by conducting prudent monetary policy, which keeps the domestic currency pegged to the euro, and inflation at a low level. However, in the last two years, the internal political crisis has hampered economic performance, with GDP slowing in 2016, and both domestic private and public investments declining. Fiscal policies were lax, with unproductive public expenditures, including subsidies and pension increases, and rising guarantees for the debt of state owned enterprises, and fiscal targets were consistently missed. In 2017, public debt stabilized at about 47% of GDP, still relatively low compared to its Western Balkan neighbors and the rest of Europe. In 2016, Macedonia issued a Eurobond worth approximately $495 million to finance 2016 and part of 2017 budget needs.', '$11.42 billion (2016 est.)', 'grapes, tobacco, vegetables, fruits; milk, eggs', 'food processing, beverages, textiles, chemicals, iron, steel, cement, energy, pharmaceuticals, automotive parts', '950,800 (2017 est.)', 'foodstuffs, beverages, tobacco; textiles, miscellaneous manufactures, iron, steel; automotive parts', '5.303 billion kWh (2016 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2016 est.)', '0 cu m (2016)', 'Z3 (2016)', '10 (2013)', '-', 'gas 262 km; oil 120 km (2017)', '699 km', '14,182 km (includes 242 km of expressways)', '-', '2018-02-07 18:03:31', NULL),
(133, 'MG', 'mg', 'Madagascar', 'Madagascar was one of the last major landmasses on earth to be colonized by humans. The earliest settlers from present-day Indonesia arrived between A.D. 350 and 550. The island attracted Arab and Persian traders as early as the 7th century, and migrants from Africa arrived around A.D. 1000. Madagascar was a pirate stronghold during the late 17th and early 18th centuries, and served as a slave trading center into the 19th century. From the 16th to the late 19th century, a native Merina Kingdom dominated much of Madagascar. The island was conquered by the French in 1896 who made it a colony; independence was regained in 1960. During 1992-93, free presidential and National Assembly elections were held ending 17 years of single-party rule. In 1997, in the second presidential race, Didier RATSIRAKA, the leader during the 1970s and 1980s, was returned to the presidency. The 2001 presidential election was contested between the followers of Didier RATSIRAKA and Marc RAVALOMANANA, nearly causing secession of half of the country. In April 2002, the High Constitutional Court announced RAVALOMANANA the winner. RAVALOMANANA won a second term in 2006 but, following protests in 2009, handed over power to the military, which then conferred the presidency on the mayor of Antananarivo, Andry RAJOELINA, in what amounted to a coup d''etat. Following a lengthy mediation process led by the Southern African Development Community, Madagascar held UN-supported presidential and parliamentary elections in 2013. Former de facto finance minister Hery RAJAONARIMAMPIANINA won a runoff election in December 2013 and was inaugurated in January 2014.', 'Africa', '20 00 S, 47 00 E', '587,041 sq km', '25,054,161 (July 2017 est.)', 'Malagasy (singular and plural)', 'Malayo-Indonesian (Merina and related Betsileo), Cotiers (mixed African, Malayo-Indonesian, and Arab ancestry - Betsimisaraka, Tsimihety, Antaisaka, Sakalava), French, Indian, Creole, Comoran', 'French (official), Malagasy (official), English', 'Christian, indigenous religionist, Muslim', 'Republic of Madagascar', 'semi-presidential republic', 'Antananarivo', '6 provinces (faritany); Antananarivo, Antsiranana, Fianarantsoa, Mahajanga, Toamasina, Toliara', '26 June 1960 (from France)', 'Madagascar is a mostly unregulated economy with many untapped natural resources, but no capital markets, a weak judicial system, poorly enforced contracts, and rampant government corruption. The country faces challenges to improve education, healthcare, and the environment to boost long-term economic growth. Agriculture, including fishing and forestry, is a mainstay of the economy, accounting for more than one-fourth of GDP and employing roughly 80% of the population. Deforestation and erosion, aggravated by bushfires, slash-and-burn clearing techniques, and the use of firewood as the primary source of fuel, are serious concerns to the agriculture dependent economy.\r\nAfter discarding socialist economic policies in the mid-1990s, Madagascar followed a World Bank- and IMF-led policy of privatization and liberalization until the onset of a political crisis, which lasted from 2009 to 2013. The strategy had placed the country on a slow and steady growth path from an extremely low starting point. Exports of apparel boomed after gaining duty-free access to the US in 2000; however, Madagascar''s failure to comply with the requirements of the African Growth and Opportunity Act (AGOA) led to the termination of the country''s duty-free access in January 2010, a sharp fall in textile production, and a loss of more than 100,000 jobs.\r\nMadagascar regained AGOA access in January 2015 following the democratic election of a new president the previous year. Madagascar produces around 80% of the world’s vanilla supply; although supply was constrained by hurricane-related damage in 2017, international demand drove prices to record highs, increasing export earnings for Malagasy vanilla. Madagascar’s financial sector remains weak, limiting the use of monetary policy to control inflation, but an ongoing IMF program aims to strengthen financial and investment management capacity.', '$10.56 billion (2016 est.)', 'coffee, vanilla, sugarcane, cloves, cocoa, rice, cassava (manioc, tapioca), beans, bananas, peanuts; livestock products', 'meat processing, seafood, soap, beer, leather, sugar, textiles, glassware, cement, automobile assembly plant, paper, petroleum, tourism, mining', '13.4 million (2017 est.)', 'coffee, vanilla, shellfish, sugar, cotton cloth, clothing, chromite, petroleum products', '1.508 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '5R (2016)', '83 (2013)', '-', '-', '836 km', '37,476 km', '600 km (432 km navigable) (2011)', '2018-02-07 18:03:31', NULL),
(134, 'MW', 'mw', 'Malawi', 'Established in 1891, the British protectorate of Nyasaland became the independent nation of Malawi in 1964. After three decades of one-party rule under President Hastings Kamuzu BANDA, the country held multiparty presidential and parliamentary elections in 1994, under a provisional constitution that came into full effect the following year. President Bingu wa MUTHARIKA, elected in 2004 after a failed attempt by the previous president to amend the constitution to permit another term, struggled to assert his authority against his predecessor and subsequently started his own party, the Democratic Progressive Party in 2005. MUTHARIKA was reelected to a second term in 2009. He oversaw some economic improvement in his first term, but was accused of economic mismanagement and poor governance in his second term. He died abruptly in 2012 and was succeeded by vice president, Joyce BANDA, who had earlier started her own party, the People''s Party. MUTHARIKA''s brother, Peter MUTHARIKA, defeated BANDA in the 2014 election. Population growth, increasing pressure on agricultural lands, corruption, and the scourge of HIV/AIDS pose major problems for Malawi.', 'Africa', '13 30 S, 34 00 E', '118,484 sq km', '19,196,246', 'Malawian(s)', 'Chewa 35.1%, Lomwe 18.9%, Yao 13.1%, Ngoni 12%, Tumbuka 9.4%, Sena 3.5%, Tonga 1.8%, Nyanja 1%, Nkhonde 0.9%, other 1.8% (2015-16 est.)', 'English (official), Chichewa (common), Chinyanja, Chiyao, Chitumbuka, Chilomwe, Chinkhonde, Chingoni, Chisena, Chitonga, Chinyakyusa, Chilambya', 'Protestant 27.2% (includes Church of Central Africa Presbyterian 17.7%, Seventh Day Adventist/Baptist 6.9%, Anglican 2.6%), Catholic 18.4%, other Christian 41%, Muslim 12.1%, other 0.3%, none 1% (2015-16 est.)', 'Republic of Malawi', 'presidential republic', 'Lilongwe', '28 districts; Balaka, Blantyre, Chikwawa, Chiradzulu, Chitipa, Dedza, Dowa, Karonga, Kasungu, Likoma, Lilongwe, Machinga, Mangochi, Mchinji, Mulanje, Mwanza, Mzimba, Neno, Ntcheu, Nkhata Bay, Nkhotakota, Nsanje, Ntchisi, Phalombe, Rumphi, Salima, Thyolo, Zomba', 'Independence Day (Republic Day), 6 July (1964)', 'Landlocked Malawi ranks among the world''s most densely populated and least developed countries. The country’s economic performance has historically been constrained by policy inconsistency, macroeconomic instability, poor infrastructure, rampant corruption, high population growth, and poor health and education outcomes that limit labor productivity. The economy is predominately agricultural with about 80% of the population living in rural areas. Agriculture accounts for about one-third of GDP and 80% of export revenues. The performance of the tobacco sector is key to short-term growth as tobacco accounts for more than half of exports, although Malawi is looking to diversify away from tobacco to other cash crops.\r\nThe economy depends on substantial inflows of economic assistance from the IMF, the World Bank, and individual donor nations. Donors halted aid from 2013 to 2016 because of concerns about corruption and fiscal carelessness, but the World Bank resumed budget support in May 2017. In 2006, Malawi was approved for relief under the Heavily Indebted Poor Countries (HIPC) program but recent increases in domestic borrowing mean that debt servicing in 2016 exceeded the levels prior to HIPC debt relief.\r\nHeavily dependent on rain-fed agriculture, with corn being the staple crop, Malawi’s economy was hit hard by the El Nino-driven drought in 2015 and 2016, and now faces threat from the fall armyworm. The drought also slowed economic activity, led to two consecutive years of declining economic growth, and contributed to high inflation rates. Because of concerns about subsequent droughts, the government banned maize exports from 2016 to late 2017, causing a market glut and depressing local prices.', '$6.261 billion (2016 est.)', 'tobacco, sugarcane, tea, corn, potatoes, sweet potatoes, cassava (manioc, tapioca), sorghum, pulses, cotton, groundnuts, macadamia nuts, coffee; cattle, goats', 'tobacco, tea, sugar, sawmill products, cement, consumer goods', '7 million (2013 est.)', 'tobacco 55%, dried legumes (8.8%), sugar (6.7%), tea (5.7%), cotton (2%), peanuts, coffee, soy (2015 est.)', '2.12 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2017 est.)', '7Q (2016)', '32 (2013)', '-', '-', '767 km', '15,450 km', '700 km (on Lake Nyasa [Lake Malawi] and Shire River) (2010)', '2018-02-07 18:03:31', NULL),
(135, 'MY', 'my', 'Malaysia', 'During the late 18th and 19th centuries, Great Britain established colonies and protectorates in the area of current Malaysia; these were occupied by Japan from 1942 to 1945. In 1948, the British-ruled territories on the Malay Peninsula except Singapore formed the Federation of Malaya, which became independent in 1957. Malaysia was formed in 1963 when the former British colonies of Singapore, as well as Sabah and Sarawak on the northern coast of Borneo, joined the Federation. The first several years of the country''s independence were marred by a communist insurgency, Indonesian confrontation with Malaysia, Philippine claims to Sabah, and Singapore''s withdrawal in 1965. During the 22-year term of Prime Minister MAHATHIR bin Mohamad (1981-2003), Malaysia was successful in diversifying its economy from dependence on exports of raw materials to the development of manufacturing, services, and tourism. Prime Minister Mohamed NAJIB bin Abdul Razak (in office since April 2009) has continued these pro-business policies.', 'Southeast Asia', '2 30 N, 112 30 E', '329,847 sq km', '31,381,992 (July 2017 est.)', 'Malaysian(s)', 'Bumiputera 61.7% (Malays and indigenous peoples, including Orang Asli, Dayak, Anak Negeri), Chinese 20.8%, Indian 6.2%, other 0.9%, non-citizens 10.4% (2017 est.)', 'Bahasa Malaysia (official), English, Chinese (Cantonese, Mandarin, Hokkien, Hakka, Hainan, Foochow), Tamil, Telugu, Malayalam, Panjabi, Thai', 'Muslim (official) 61.3%, Buddhist 19.8%, Christian 9.2%, Hindu 6.3%, Confucianism, Taoism, other traditional Chinese religions 1.3%, other 0.4%, none 0.8%, unspecified 1% (2010 est.)', 'none', 'federal parliamentary constitutional monarchy', 'Kuala Lumpur', '13 states (negeri-negeri, singular - negeri); Johor, Kedah, Kelantan, Melaka, Negeri Sembilan, Pahang, Perak, Perlis, Pulau Pinang, Sabah, Sarawak, Selangor, Terengganu; and 1 federal territory (Wilayah Persekutuan) with 3 components, Kuala Lumpur, Labuan, and Putrajaya', '31 August 1957 (from the UK)', 'Malaysia, an upper middle-income country, has transformed itself since the 1970s from a producer of raw materials into a multi-sector economy. Under current Prime Minister NAJIB, Malaysia is attempting to achieve high-income status by 2020 and to move further up the value-added production chain by attracting investments in high technology, knowledge-based industries and services. NAJIB''s Economic Transformation Program is a series of projects and policy measures intended to accelerate the country''s economic growth. The government has also taken steps to liberalize some services sub-sectors. Malaysia is vulnerable to a fall in world commodity prices or a general slowdown in global economic activity.\r\nThe NAJIB administration is continuing efforts to boost domestic demand and reduce the economy''s dependence on exports. Domestic demand continues to anchor economic growth, supported mainly by private consumption, which accounts for 53% of GDP. Nevertheless, exports - particularly of electronics, oil and gas, and palm oil - remain a significant driver of the economy. In 2015, gross exports of goods and services were equivalent to 73% of GDP. The oil and gas sector supplied about 22% of government revenue in 2015, down significantly from prior years amid a decline in commodity prices and diversification of government revenues. Malaysia has embarked on a fiscal reform program aimed at achieving a balanced budget by 2020, including rationalization of subsidies and the 2015 introduction of a 6% value added tax. Sustained low commodity prices throughout the period not only strained government finances, but also shrunk Malaysia’s current account surplus and weighed heavily on the Malaysian ringgit, which was among the region’s worst performing currencies during 2013-17. The ringgit hit new lows following the US presidential election amid a broader selloff of emerging market assets.\r\nBank Negara Malaysia (the central bank) maintains adequate foreign exchange reserves; a well-developed regulatory regime has limited Malaysia''s exposure to riskier financial instruments, although it remains vulnerable to volatile global capital flows. In order to increase Malaysia’s competitiveness, Prime Minister NAJIB raised possible revisions to the special economic and social preferences accorded to ethnic Malays under the New Economic Policy of 1970, but retreated in 2013 after he encountered significant opposition from Malay nationalists and other vested interests. In September 2013 NAJIB launched the new Bumiputra Economic Empowerment Program, policies that favor and advance the economic condition of ethnic Malays.\r\nMalaysia signed the 12-nation Trans-Pacific Partnership (TPP) free trade agreement in February 2016, although the future of the TPP remains unclear following the US withdrawal from the agreement. Along with nine other ASEAN members, Malaysia established the ASEAN Economic Community in 2015, which aims to advance regional economic integration.', '$309.9 billion (2016 est.)', 'Peninsular Malaysia - palm oil, rubber, cocoa, rice; Sabah - palm oil, subsistence crops; rubber, timber; Sarawak - palm oil, rubber, timber; pepper', 'Peninsular Malaysia - rubber and oil palm processing and manufacturing, petroleum and natural gas, light manufacturing, pharmaceuticals, medical technology, electronics and semiconductors, timber processing; Sabah - logging, petroleum and natural gas production; Sarawak - agriculture processing, petroleum and natural gas production, logging', '14.94 million (2017 est.)', 'semiconductors and electronic equipment, palm oil, petroleum and liquefied natural gas, wood and wood products, palm oil, rubber, textiles, chemicals, solar panels', '141.9 billion kWh (2015 est.)', '666,900 bbl/day (2016 est.)', '512,900 bbl/day (2014 est.)', '63.43 billion cu m (2015 est.)', '9M (2016)', '114 (2013)', '4 (2013)', 'condensate 354 km; gas 6,439 km; liquid petroleum gas 155 km; oil 1,937 km; oil/gas/water 43 km; refined products 114 km; water 26 km (2013)', '1,851 km', '144,403 km (excludes local roads)', '7,200 km (Peninsular Malaysia 3,200 km; Sabah 1,500 km; Sarawak 2,500 km) (2011)', '2018-02-07 18:03:31', NULL);
