(136, 'MV', 'mv', 'Maldives', 'A sultanate since the 12th century, the Maldives became a British protectorate in 1887. It became a republic in 1968, three years after independence. President Maumoon Abdul GAYOOM dominated the islands'' political scene for 30 years, elected to six successive terms by single-party referendums. Following political demonstrations in the capital Male in August 2003, GAYOOM and his government pledged to embark upon a process of liberalization and democratic reforms, including a more representative political system and expanded political freedoms. Political parties were legalized in 2005.\r\nIn June 2008, a constituent assembly - termed the "Special Majlis" - finalized a new constitution ratified by GAYOOM in August 2008. The first-ever presidential elections under a multi-candidate, multi-party system were held in October 2008. GAYOOM was defeated in a runoff poll by Mohamed NASHEED, a political activist who had been jailed several years earlier by the GAYOOM regime. NASHEED faced a number of challenges including strengthening democracy and combating poverty and drug abuse. In early February 2012, after several weeks of street protests in response to his ordering the arrest of a top judge, NASHEED resigned the presidency and handed over power to Vice President Mohammed WAHEED Hassan Maniku. In mid-2012, a Commission of National Inquiry was established by the government to probe events leading up to NASHEED''s resignation. Though the commission found no evidence of a coup, the report recommended strengthening the country''s democratic institutions to avert similar events in the future, and to investigate alleged police misconduct during the crisis. NASHEED, WAHEED, and Abdulla YAMEEN ran in the 2013 elections with YAMEEN ultimately winning the presidency after three rounds of voting. As president, YAMEEN has sought to weaken democratic institutions, jail his political opponents, restrict the press, and exert control over the judiciary to strengthen his hold on power and limit dissent. Maldivian officials have played a prominent role in international climate change discussions (due to the islands'' vulnerability to rising sea-level).', 'Asia', '3 15 N, 73 00 E', '298 sq km', '392,709 (July 2017 est.)', 'Maldivian(s)', 'South Indians, Sinhalese, Arabs', 'Dhivehi (official, dialect of Sinhala, script derived from Arabic), English (spoken by most government officials)', 'Sunni Muslim (official)', 'Republic of Maldives', 'presidential republic', 'Male', '21 administrative atolls (atholhuthah, singular - atholhu); Addu, Ariatholhu Dhekunuburi, Ariatholhu Uthuruburi, Faadhippolhu, Felidhuatholhu, Fuvammulah, Hahdhunmathi, Huvadhuatholhu Dhekunuburi, Huvadhuatholhu Uthuruburi, Kolhumadulu, Maale, Maaleatholhu, Maalhosmadulu Dhekunuburi, Maalhosmadulu Uthuruburi, Miladhunmadulu Dhekunuburi, Miladhunmadulu Uthuruburi, Mulakatholhu, Nilandheatholhu Dhekunuburi, Nilandheatholhu Uthuruburi, Thiladhunmathee Dhekunuburi, Thiladhunmathee Uthuruburi', '26 July 1965 (from the UK)', 'Maldives has quickly become a middle-income country, driven by the rapid growth of its tourism and fisheries sectors, but the country still contends with a large and growing fiscal deficit. Economic growth slowed to 2.8% in 2015, mainly because of a decline in tourists from China and Russia. Despite lower growth, tourism-related tax receipts increased by 13% in 2015 because of higher tax rates. This increase in tax receipts led to higher usable foreign exchange reserves that helped partially fund increases in construction related imports.\r\nIn 2015, Maldives’ Parliament passed a constitutional amendment legalizing foreign ownership of land; foreign land-buyers must reclaim at least 70% of the desired land from the ocean and invest at least $1 billion in a construction project approved by Parliament.\r\nDiversifying the economy beyond tourism and fishing, reforming public finance, increasing employment opportunities, and combating corruption, cronyism, and a growing drug problem are near-term challenges facing the government. Over the longer term, Maldivian authorities worry about the impact of erosion and possible global warming on their low-lying country; 80% of the area is 1 meter or less above sea level.', '$4.52 billion (2016 est.)', 'coconuts, corn, sweet potatoes; fish', 'tourism, fish processing, shipping, boat building, coconut processing, woven mats, rope, handicrafts, coral and sand mining', '195,100 (2014)', 'fish', '350 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2016 est.)', '0 cu m (2016 est.)', '8Q (2016)', '9 (2013)', '-', '-', '-', '88 km', '-', '2018-02-07 18:03:31', NULL),
(137, 'ML', 'ml', 'Mali', 'The Sudanese Republic and Senegal became independent of France in 1960 as the Mali Federation. When Senegal withdrew after only a few months, what formerly made up the Sudanese Republic was renamed Mali. Rule by dictatorship was brought to a close in 1991 by a military coup that ushered in a period of democratic rule. President Alpha KONARE won Mali''s first two democratic presidential elections in 1992 and 1997. In keeping with Mali''s two-term constitutional limit, he stepped down in 2002 and was succeeded by Amadou Toumani TOURE, who was elected to a second term in a 2007 election that was widely judged to be free and fair. Malian returnees from Libya in 2011 exacerbated tensions in northern Mali, and Tuareg ethnic militias rebelled in January 2012. Low- and mid-level soldiers, frustrated with the poor handling of the rebellion, overthrew TOURE on 22 March. Intensive mediation efforts led by the Economic Community of West African States (ECOWAS) returned power to a civilian administration in April with the appointment of Interim President Dioncounda TRAORE. The post-coup chaos led to rebels expelling the Malian military from the country''s three northern regions and allowed Islamic militants to set up strongholds. Hundreds of thousands of northern Malians fled the violence to southern Mali and neighboring countries, exacerbating regional food shortages in host communities. An international military intervention to retake the three northern regions began in January 2013 and within a month most of the north had been retaken. In a democratic presidential election conducted in July and August of 2013, Ibrahim Boubacar KEITA was elected president. The Malian Government and northern armed groups signed an internationally-mediated peace accord in June 2015.', 'Africa', '17 00 N, 4 00 W', '1,240,192 sq km', '17,885,245 (July 2017 est.)', 'Malian(s)', 'Bambara 34.1%, Fulani (Peul) 14.7%, Sarakole 10.8%, Senufo 10.5%, Dogon 8.9%, Malinke 8.7%, Bobo 2.9%, Songhai 1.6%, Tuareg 0.9%, other Malian 6.1%, from member of Economic Community of West African States 0.3%, other 0.4% (2012-13 est.)', 'French (official), Bambara 46.3%, Peul/Foulfoulbe 9.4%, Dogon 7.2%, Maraka/Soninke 6.4%, Malinke 5.6%, Sonrhai/Djerma 5.6%, Minianka 4.3%, Tamacheq 3.5%, Senoufo 2.6%, Bobo 2.1%, unspecified 0.7%, other 6.3%', 'Muslim 94.8%, Christian 2.4%, Animist 2%, none 0.5%, unspecified 0.3% (2009 est.)', 'Republic of Mali', 'semi-presidential republic', 'Bamako', '8 regions (regions, singular - region), 1 district*; District de Bamako*, Gao, Kayes, Kidal, Koulikoro, Mopti, Segou, Sikasso, Tombouctou (Timbuktu); note - two new regions, Menaka and Taoudenni, were reportedly created in early 2016, but these have not yet been vetted by the US Board on Geographic Names', '22 September 1960 (from France)', 'Among the 25 poorest countries in the world, landlocked Mali depends on gold mining and agricultural exports for revenue. The country''s fiscal status fluctuates with gold and agricultural commodity prices and the harvest; cotton and gold exports make up around 80% of export earnings. Mali remains dependent on foreign aid.\r\nEconomic activity is largely confined to the riverine area irrigated by the Niger River; about 65% of Mali’s land area is desert or semidesert. About 10% of the population is nomadic and about 80% of the labor force is engaged in farming and fishing. Industrial activity is concentrated on processing farm commodities. The government subsidizes the production of cereals to decrease the country’s dependence on imported foodstuffs and to reduce its vulnerability to food price shocks.\r\nMali is developing its iron ore extraction industry to diversify foreign exchange earnings away from gold, but the pace will depend on global price trends. Although the political coup in 2012 slowed Mali’s growth, the economy has since bounced back, with GDP growth above 5% in 2014-17, although physical insecurity, high population growth, corruption, weak infrastructure, and low levels of human capital continue to constrain economic development. Higher rainfall helped to boost cotton output in 2017, and the country’s 2017 budget increased spending more than 10%, much of which was devoted to infrastructure and agriculture. Corruption and political turmoil are strong downside risks in 2018 and beyond.', '$15 billion (2016 est.)', 'cotton, millet, rice, corn, vegetables, peanuts; cattle, sheep, goats', 'food processing; construction; phosphate and gold mining', '6.447 million (2017 est.)', 'cotton, gold, livestock', '2.175 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'TZ, TT (2016)', '25 (2013)', '2 (2013)', '-', '593 km', '22,474 km', '1,800 km (downstream of Koulikoro; low water levels on the River Niger cause problems in dry years; in the months before the rainy season the river is not navigable by commercial vessels) (2011)', '2018-02-07 18:03:31', NULL),
(138, 'MT', 'mt', 'Malta', 'With a civilization that dates back thousands of years, Malta boasts some of the oldest megalithic sites in the world. Situated in the center of the Mediterranean, Malta’s islands have long served as a strategic military asset, with the islands at various times having come under control of the Phoenicians, Carthaginians, Greeks, Romans,', 'Europe', '35 50 N, 14 35 E', '316 sq km', '416,338 (July 2017 est.)', 'Maltese (singular and plural)', 'Maltese (descendants of ancient Carthaginians and Phoenicians with strong elements of Italian and other Mediterranean stock)', 'Maltese (official) 90.1%, English (official) 6%, multilingual 3%, other 0.9% (2005 est.)', 'Roman Catholic (official) more than 90% (2006 est.)', 'Republic of Malta', 'parliamentary republic', 'Valletta', '68 localities (Il-lokalita); Attard, Balzan, Birgu, Birkirkara, Birzebbuga, Bormla, Dingli, Fgura, Floriana, Fontana, Ghajnsielem, Gharb, Gharghur, Ghasri, Ghaxaq, Gudja, Gzira, Hamrun, Iklin, Imdina, Imgarr, Imqabba, Imsida, Imtarfa, Isla, Kalkara, Kercem, Kirkop, Lija, Luqa, Marsa, Marsaskala, Marsaxlokk, Mellieha, Mosta, Munxar, Nadur, Naxxar, Paola, Pembroke, Pieta, Qala, Qormi, Qrendi, Rabat, Rabat (Ghawdex), Safi, San Giljan/Saint Julian, San Gwann/Saint John, San Lawrenz/Saint Lawrence, Sannat, San Pawl il-Bahar/Saint Paul''s Bay, Santa Lucija/Saint Lucia, Santa Venera/Saint Venera, Siggiewi, Sliema, Swieqi, Tarxien, Ta'' Xbiex, Valletta, Xaghra, Xewkija, Xghajra, Zabbar, Zebbug, Zebbug (Ghawdex), Zejtun, Zurrieq', '21 September 1964 (from the UK)', 'Malta’s free market economy – the smallest economy in the euro-zone – relies heavily on trade in both goods and services, principally with Europe. Malta produces less than a quarter of its food needs, has limited fresh water supplies, and has few domestic energy sources. Malta''s economy is dependent on foreign trade, manufacturing, and tourism. Malta joined the EU in 2004 and adopted the euro on 1 January 2008.\r\nMalta has weathered the euro-zone crisis better than most EU member states due to a low debt-to-GDP ratio and financially sound banking sector. It maintains one of the lowest unemployment rates in Europe, and growth has fully recovered since the 2009 recession. In 2014 through 2016, Malta led the euro zone in growth, expanding more than 4.5% per year.\r\nMalta’s services sector continues to grow, with sustained growth in the financial services and online gaming sectors. Advantageous tax schemes remained attractive to foreign investors, though EU discussions of anti-tax avoidance measures have raised concerns among Malta’s financial services and insurance providers, as the measures could have a significant impact on those sectors. The tourism sector also continued to grow, with 2016 showing record-breaking numbers of both air and cruise passenger arrivals.\r\nMalta’s GDP growth remains strong and is supported by a strong labor market. The government has implemented new programs, including free childcare, to encourage increased labor participation. The high cost of borrowing and small labor market remain potential constraints to future economic growth. Increasingly, other EU and European migrants are relocating to Malta for employment, though wages have remained low compared to other European countries. Inflation remains low.', '$12.01 billion (2016 est.)', 'potatoes, cauliflower, grapes, wheat, barley, tomatoes, citrus, cut flowers, green peppers; pork, milk, poultry, eggs', 'tourism, electronics, ship building and repair, construction, food and beverages, pharmaceuticals, footwear, clothing, tobacco, aviation services, financial services, information technology services', '206,300 (2017 est.)', 'machinery and mechanical appliances; mineral fuels, oils and petroleum products; pharmaceutical products; books and newspapers; aircraft/spacecraft and parts; toys, games, and sports equipment', '1.228 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2016 est.)', '0 cu m (2016 est.)', '9H (2016)', '1 (2013)', '2 (2013)', '-', '-', '3,096 km', '-', '2018-02-07 18:03:31', NULL),
(139, 'MH', 'mh', 'Marshall Islands', 'After almost four decades under US administration as the easternmost part of the UN Trust Territory of the Pacific Islands, the Marshall Islands attained independence in 1986 under a Compact of Free Association. Compensation claims continue as a result of US nuclear testing on some of the atolls between 1947 and 1962. The Marshall Islands hosts the US Army Kwajalein Atoll Reagan Missile Test Site, a key installation in the US missile defense network. Kwajalein also hosts one of four dedicated ground antennas (the others are on Ascension (Saint Helena, Ascension, and Tristan da Cunha), Diego Garcia (British Indian Ocean Territory), and at Cape Canaveral, Florida (US)) that assist in the operation of the Global Positioning System (GPS) navigation system.', 'Oceania', '9 00 N, 168 00 E', '181 sq km', '74,539 (July 2017 est.)', 'Marshallese (singular and plural)', 'Marshallese 92.1%, mixed Marshallese 5.9%, other 2% (2006)', 'Marshallese (official) 98.2%, other languages 1.8% (1999 census)', 'Protestant 54.8%, Assembly of God 25.8%, Roman Catholic 8.4%, Bukot nan Jesus 2.8%, Mormon 2.1%, other Christian 3.6%, other 1%, none 1.5% (1999 census)', 'Republic of the Marshall Islands', 'presidential republic in free association with the US', 'Majuro; note - the capital is an atoll of 64 islan', '24 municipalities; Ailinglaplap, Ailuk, Arno, Aur, Bikini & Kili, Ebon, Enewetak & Ujelang, Jabat, Jaluit, Kwajalein, Lae, Lib, Likiep, Majuro, Maloelap, Mejit, Mili, Namdrik, Namu, Rongelap, Ujae, Utrik, Wotho, Wotje', '21 October 1986 (from the US-administered UN trusteeship)', 'US assistance and lease payments for the use of Kwajalein Atoll as a US military base are the mainstay of this small island country. Agricultural production, primarily subsistence, is concentrated on small farms; the most important commercial crops are coconuts and breadfruit. Industry is limited to handicrafts, tuna processing, and copra. Tourism holds some potential. The islands and atolls have few natural resources, and imports exceed exports.\r\nThe Marshall Islands received roughly $1 billion in aid from the US during the period 1986-2001 under the original Compact of Free Association (Compact). In 2002 and 2003, the US and the Marshall Islands renegotiated the Compact''s financial package for a 20-year period, 2004 to 2024. Under the amended Compact, the Marshall Islands will receive roughly $1.5 billion in direct US assistance. Under the amended Compact, the US and Marshall Islands are also jointly funding a Trust Fund for the people of the Marshall Islands that will provide an income stream beyond 2024, when direct Compact aid ends.', '$199 million (2016 est.)', 'coconuts, tomatoes, melons, taro, breadfruit, fruits; pigs, chickens', 'copra, tuna processing, tourism, craft items (from seashells, wood, and pearls)', '10,670 (2013 est.)', 'copra cake, coconut oil, handicrafts, fish', '620 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '-', 'V7 (2016)', '15 (2013)', '-', '-', '-', '2,028 km', '-', '2018-02-07 18:03:31', NULL),
