(141, 'MR', 'mr', 'Mauritania', 'Independent from France in 1960, Mauritania annexed the southern third of the former Spanish Sahara (now Western Sahara) in 1976 but relinquished it after three years of raids by the Polisario guerrilla front seeking independence for the territory. Maaouya Ould Sid Ahmed TAYA seized power in a coup in 1984 and ruled Mauritania with a heavy hand for more than two decades. A series of presidential elections that he held were widely seen as flawed. A bloodless coup in August 2005 deposed President TAYA and ushered in a military council that oversaw a transition to democratic rule. Independent candidate Sidi Ould Cheikh ABDALLAHI was inaugurated in April 2007 as Mauritania''s first freely and fairly elected president. His term ended prematurely in August 2008 when a military junta led by General Mohamed Ould Abdel AZIZ deposed him and installed a military council government. AZIZ was subsequently elected president in July 2009 and sworn in the following month. AZIZ sustained injuries from an accidental shooting by his own troops in October 2012 but has continued to maintain his authority. He was reelected in 2014 to a second and final term as president (according to the present constitution). The country continues to experience ethnic tensions among three major groups: Arabic-speaking descendants of slaves (Haratines), Arabic-speaking "White Moors" (Bidhan), and members of Sub-Saharan ethnic groups mostly originating in the Senegal River valley (Halpulaar, Soninke, and Wolof). Mauritania confronts a terrorism threat by al-Qa''ida in the Islamic Maghreb, which launched successful attacks between 2005 and 2011.\r\nThe activities of Al-Qaeda in the Islamic Maghreb (AQIM), and similar groups, pose a severe security threat to Mauritanians and foreign visitors. AQIM launched a series of attacks in Mauritania between 2005 and 2011, murdering American and foreign tourists and aid workers, attacking diplomatic and government facilities, and ambushing Mauritanian soldiers and gendarmes. A successful strategy against terrorism that combines dialogue with the terrorists and military actions has prevented the country from further terrorist attacks since 2011.', 'Africa', '20 00 N, 12 00 W', '1,030,700 sq km', '3,758,571 (July 2017 est.)', 'Mauritanian(s)', 'black Moors (Haratines - Arab-speaking slaves, former slaves, and their descendants of African origin, enslaved by white Moors) 40%, white Moors (of Arab-Berber descent, known as Bidhan) 30%, Sub-Saharan Mauritanians (non-Arabic speaking, Halpulaar, Soninke, Wolof, and Bamara ethnic groups) 30%', 'Arabic (official and national), Pular, Soninke, Wolof (all national languages), French', 'Muslim (official) 100%', 'Islamic Republic of Mauritania', 'presidential republic', 'Nouakchott', '15 regions (wilayas, singular - wilaya); Adrar, Assaba, Brakna, Dakhlet Nouadhibou, Gorgol, Guidimaka, Hodh ech Chargui, Hodh El Gharbi, Inchiri, Nouakchott Nord, Nouakchott Ouest, Nouakchott Sud, Tagant, Tiris Zemmour, Trarza', '28 November 1960 (from France)', 'Mauritania''s economy is dominated by extractive industries (oil and mines), fisheries and agriculture. Half the population still depends on farming and raising livestock, even though many nomads and subsistence farmers were forced into the cities by recurrent droughts in the 1970s, 1980s and 2000s. Recently, GDP growth has been driven largely by foreign investment in the mining and oil sectors.\r\nMauritania''s extensive mineral resources include iron ore, gold, copper, gypsum, and phosphate rock, and exploration is ongoing for tantalum, uranium, crude oil, and natural gas. Extractive commodities make up about three-quarters of Mauritania''s total exports, subjecting the economy to price swings in world commodity markets. Mining is also a growing source of government revenue, rising from 13% to 30% of total revenue from 2006 to 2016. The nation''s coastal waters are among the richest fishing areas in the world, and fishing accounts for about 20% of budget revenues, 45% of foreign currency earnings. Mauritania processes a total of 1,800,000 tons of fish per year, but overexploitation by foreign and national fleets threaten the sustainability of this key source of revenue.\r\nThe economy is highly sensitive to international food and extractive commodity prices. Other risks to Mauritania''s economy include its recurring droughts, dependence on foreign aid and investment, and insecurity in neighboring Mali, as well as significant shortages of infrastructure, institutional capacity, and human capital. Mauritania has sought additional IMF support by focusing efforts on poverty reduction. Investment in agriculture and infrastructure are the largest components of the country’s public expenditures.', '$4.985 billion (2016 est.)', 'dates, millet, sorghum, rice, corn; cattle, camel and sheep', 'fish processing, oil production, mining (iron ore, gold, copper)', '1.437 million (2017 est.)', 'iron ore, fish and fish products, livestock, gold, copper, crude oil', '1.191 billion kWh (2015 est.)', '5,000 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '5T (2016)', '30 (2013)', '-', '-', '728 km', '10,628 km', '(some navigation possible on the Senegal River) (2011)', '2018-02-07 18:03:31', NULL),
(142, 'MU', 'mu', 'Mauritius', 'Although known to Arab and Malay sailors as early as the 10th century, Mauritius was first explored by the Portuguese in the 16th century and subsequently settled by the Dutch - who named it in honor of Prince Maurits van NASSAU - in the 17th century. The French assumed control in 1715, developing the island into an important naval base overseeing Indian Ocean trade, and establishing a plantation economy of sugar cane. The British captured the island in 1810, during the Napoleonic Wars. Mauritius remained a strategically important British naval base, and later an air station, playing an important role during World War II for anti-submarine and convoy operations, as well as the collection of signals intelligence. Independence from the UK was attained in 1968. A stable democracy with regular free elections and a positive human rights record, the country has attracted considerable foreign investment and has one of Africa''s highest per capita incomes.', 'Africa', '20 17 S, 57 33 E', '2,040 sq km', '1,356,388 (July 2017 est.)', 'Mauritian(s)', 'Indo-Mauritian (compose approximately two thirds of the total population), Creole, Sino-Mauritian, Franco-Mauritian', 'Creole 86.5%, Bhojpuri 5.3%, French 4.1%, two languages 1.4%, other 2.6% (includes English, the official language of the National Assembly, which is spoken by less than 1% of the population), unspecified 0.1% (2011 est.)', 'Hindu 48.5%, Roman Catholic 26.3%, Muslim 17.3%, other Christian 6.4%, other 0.6%, none 0.7%, unspecified 0.1% (2011 est.)', 'Republic of Mauritius', 'parliamentary republic', 'Port Louis', '9 districts and 3 dependencies*; Agalega Islands*, Black River, Cargados Carajos Shoals*, Flacq, Grand Port, Moka, Pamplemousses, Plaines Wilhems, Port Louis, Riviere du Rempart, Rodrigues*, Savanne', '12 March 1968 (from the UK)', 'Since independence in 1968, Mauritius has undergone a remarkable economic transformation from a low-income, agriculturally based economy to a diversified, upper middle-income economy with growing industrial, financial, and tourist sectors. Mauritius has achieved steady growth over the last several decades, resulting in more equitable income distribution, increased life expectancy, lowered infant mortality, and a much-improved infrastructure.\r\nThe economy currently depends on sugar, tourism, textiles and apparel, and financial services, but is expanding into fish processing, information and communications technology, and hospitality and property development. Sugarcane is grown on about 90% of the cultivated land area and accounts for 15% of export earnings. The government''s development strategy centers on creating vertical and horizontal clusters of development in these sectors. Mauritius has attracted more than 32,000 offshore entities, many aimed at commerce in India, South Africa, and China. Investment in the banking sector alone has reached over $1 billion. Mauritius’ textile sector has taken advantage of the Africa Growth and Opportunity Act, a preferential trade program that allows duty free access to the US market, with Mauritian exports to the US growing by 40% from 2000 to 2014.\r\nMauritius'' sound economic policies and prudent banking practices helped mitigate negative effects of the global financial crisis in 2008-09. GDP grew in the 3-4% per year range in 2010-16, and the country continues to expand its trade and investment outreach around the globe. Growth in the US and Europe fostered goods and services exports, including tourism, while lower oil prices kept inflation low in 2016. Mauritius continues to rank first in sub-Saharan Africa on the World Bank’s Doing Business Report.', '$12.27 billion (2016 est.)', 'sugarcane, tea, corn, potatoes, bananas, pulses; cattle, goats; fish', 'food processing (largely sugar milling), textiles, clothing, mining, chemicals, metal products, transport equipment, nonelectrical machinery, tourism', '633,900 (2017 est.)', 'clothing and textiles, sugar, cut flowers, molasses, fish, primates (for research)', '2.857 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '3B (2016)', '5 (2013)', '-', '-', '-', '2,428 km', '-', '2018-02-07 18:03:31', NULL),
