(144, 'MX', 'mx', 'Mexico', 'The site of several advanced Amerindian civilizations - including the Olmec, Toltec, Teotihuacan, Zapotec, Maya, and Aztec - Mexico was conquered and colonized by Spain in the early 16th century. Administered as the Viceroyalty of New Spain for three centuries, it achieved independence early in the 19th century. Elections held in 2000 marked the first time since the 1910 Mexican Revolution that an opposition candidate - Vicente FOX of the National Action Party (PAN) - defeated the party in government, the Institutional Revolutionary Party (PRI). He was succeeded in 2006 by another PAN candidate Felipe CALDERON, but Enrique PENA NIETO regained the presidency for the PRI in 2012. The global financial crisis in late 2008 caused a massive economic downturn in Mexico the following year, although growth returned quickly in 2010. Ongoing economic and social concerns include low real wages, high underemployment, inequitable income distribution, and few advancement opportunities for the largely indigenous population in the impoverished southern states. Since 2007, Mexico''s powerful drug-trafficking organizations have engaged in bloody feuding, resulting in tens of thousands of drug-related homicides.', 'North America', '19 26 N, 99 08 W', '1,964,375 sq km', '124,574,795 (July 2017 est.)', 'Mexican(s)', 'mestizo (Amerindian-Spanish) 62%, predominantly Amerindian 21%, Amerindian 7%, other 10% (mostly European)', 'Spanish only 92.7%, Spanish and indigenous languages 5.7%, indigenous only 0.8%, unspecified 0.8%', 'Roman Catholic 82.7%, Pentecostal 1.6%, Jehovah''s Witness 1.4%, other Evangelical Churches 5%, other 1.9%, none 4.7%, unspecified 2.7% (2010 est.)', 'United Mexican States', 'federal presidential republic', 'Mexico City (Ciudad de Mexico)', '31 states (estados, singular - estado) and 1 city* (ciudad); Aguascalientes, Baja California, Baja California Sur, Campeche, Chiapas, Chihuahua, Coahuila, Colima, Cuidad de Mexico*, Durango, Guanajuato, Guerrero, Hidalgo, Jalisco, Mexico, Michoacan, Morelos, Nayarit, Nuevo Leon, Oaxaca, Puebla, Queretaro, Quintana Roo, San Luis Potosi, Sinaloa, Sonora, Tabasco, Tamaulipas, Tlaxcala, Veracruz, Yucatan, Zacatecas', '16 September 1810 (declared independence from Spain); 27 September 1821 (recognized by Spain)', 'Mexico''s $2.2 trillion economy has become increasingly oriented toward manufacturing since the North American Free Trade Agreement (NAFTA) entered into force in 1994. Per capita income is roughly one-third that of the US; income distribution remains highly unequal.\r\nMexico has become the US'' second-largest export market and third-largest source of imports. In 2016, two-way trade in goods and services exceeded $579 billion. Mexico has free trade agreements with 46 countries, putting more than 90% of trade under free trade agreements. In 2012, Mexico formed the Pacific Alliance with Peru, Colombia, and Chile.\r\nMexico''s current government, led by President Enrique PENA NIETO, has emphasized economic reforms, passing and implementing sweeping energy, financial, fiscal, and telecommunications reform legislation, among others, with the long-term aim to improve competitiveness and economic growth across the Mexican economy. Mexico began holding public auctions of exploration and development rights to select oil and gas resources in 2015 as a part of reforms that allow for private investment in the oil, gas, and electricity sectors. Mexico held its fourth auction in December 2016 and allocated 8 of 10 deepwater fields, demonstrating Mexico’s capacity to attract investment amid low oil prices. The government allocateed additional fields in 2017.\r\nSince 2013, Mexico’s economic growth has averaged 2% annually, falling short of private-sector expectations that President PENA NIETO’s sweeping reforms would bolster economic prospects. Growth is predicted to remain below potential given falling oil production, weak oil prices, structural issues such as low productivity, high inequality, a large informal sector employing over half of the workforce, weak rule of law, and corruption. Over the medium-term, the economy is vulnerable to global economic pressures, such as lower external demand, rising interest rates, and low oil prices - approximately 10% of government revenue comes from the state-owned oil company, PEMEX.', '$1.142 trillion (2016 est.)', 'corn, wheat, soybeans, rice, beans, cotton, coffee, fruit, tomatoes; beef, poultry, dairy products; wood products', 'food and beverages, tobacco, chemicals, iron and steel, petroleum, mining, textiles, clothing, motor vehicles, consumer durables, tourism', '54.51 million (2017 est.)', 'manufactured goods, oil and oil products, silver, fruits, vegetables, coffee, cotton', '292.7 billion kWh (2015 est.)', '2.187 million bbl/day (2016 est.)', '1.043 million bbl/day (2016 est.)', '40.37 billion cu m (2015 est.)', 'XA (2016)', '1,714 (2013)', '1 (2013)', 'gas 18,074 km; liquid petroleum 2,102 km; oil 8,775 km; oil/gas/water 369 km; refined products 7,565 km; water 123 km (2013)', '15,389 km', '377,660 km', '2,900 km (navigable rivers and coastal canals mostly connected with ports on the country''s east coast) (2012)', '2018-02-07 18:03:32', NULL),
(145, 'FM', 'fm', 'Micronesia', 'The Caroline Islands are a widely scattered archipelago in the western Pacific Ocean; they became part of a UN Trust Territory under US administration following World War II. The eastern four island groups adopted a constitution in 1979 and chose to become the Federated States of Micronesia. (The westernmost island group became Palau.) Independence came in 1986 under a Compact of Free Association with the US, which was amended and renewed in 2004. Present concerns include large-scale unemployment, overfishing, overdependence on US foreign aid, and state perception of inequitable allocation of US aid.', 'Oceania', '6 55 N, 158 15 E', '702 sq km', '104,196 (July 2017 est.)', 'Micronesian(s)', 'Chuukese/Mortlockese 49.3%, Pohnpeian 29.8%, Kosraean 6.3%, Yapese 5.7%, Yap outer islanders 5.1%, Polynesian 1.6%, Asian 1.4%, other 0.8% (2010 est.)', 'English (official and common language), Chuukese, Kosrean, Pohnpeian, Yapese, Ulithian, Woleaian, Nukuoro, Kapingamarangi', 'Roman Catholic 54.7%, Protestant 41.1% (includes Congregational 38.5%, Baptist 1.1%, Seventh Day Adventist 0.8%, Assembly of God 0.7%), Mormon 1.5%, other 1.9%, none 0.7%, unspecified 0.1% (2010 est.)', 'Federated States of Micronesia', 'federal republic in free association with the US', 'Palikir', '4 states; Chuuk (Truk), Kosrae (Kosaie), Pohnpei (Ponape), Yap', '3 November 1986 (from the US-administered UN trusteeship)', 'Economic activity consists largely of subsistence farming and fishing, and government, which employs two-thirds of the adult working population and receives funding largely - 58% in 2013 – from Compact of Free Association assistance provided by the US. The islands have few commercially valuable mineral deposits. The potential for tourism is limited by isolation, lack of adequate facilities, and limited internal air and water transportation.\r\nUnder the terms of the original Compact, the US provided $1.3 billion in grants and aid from 1986 to 2001. The US and the Federated States of Micronesia (FSM) negotiated a second (amended) Compact agreement in 2002-03 that took effect in 2004. The amended Compact runs for a 20-year period to 2023; during which the US will provide roughly $2.1 billion to the FSM. The amended Compact also develops a trust fund for the FSM that will provide a comparable income stream beyond 2024 when Compact grants end.\r\nThe country''s medium-term economic outlook appears fragile because of dependence on US assistance and lackluster performance of its small and stagnant private sector.', '$329 million (2016 est.)', 'taro, yams, coconuts, bananas, cassava (manioc, tapioca), sakau (kava), Kosraen citrus, betel nuts, black pepper, fish, pigs, chickens', 'tourism, construction; specialized aquaculture, craft items (shell and wood)', '37,920 (2010 est.)', 'fish, sakau (kava), betel nuts, black pepper', '192 million kWh (2002)', '0 bbl/day (2014)', '0 bbl/day (2014)', '0 cu m (2014)', 'V6 (2016)', '6 (2013)', '-', '-', '-', '388 km', '-', '2018-02-07 18:03:32', NULL),
(146, 'MD', 'md', 'Moldova', 'A large portion of present day Moldovan territory became a province of the Russian Empire in 1812 and then unified with Romania in 1918 in the aftermath of World War I. This territory was then incorporated into the Soviet Union at the close of World War II. Although Moldova has been independent from the Soviet Union since 1991, Russian forces have remained on Moldovan territory east of the Nistru River supporting the breakaway region of Transnistria, whose population is roughly equally composed of ethnic Ukrainians, Russians, and Moldovans.\r\nYears of Communist Party rule in Moldova post-independence ultimately ended with election-related violent protests and a rerun of parliamentary elections in 2009. Since then, a series of pro-European ruling coalitions have governed Moldova. As a result of the country''s most recent legislative election in November 2014, the three pro-European parties that entered Parliament won a total of 55 of the body''s 101 seats. Infighting among coalition members led to prolonged legislative gridlock and political instability, as well as the collapse of two governments, all ruled by pro-European coalitions centered around the Liberal Democratic Party (PLDM) and the Democratic Party (PDM). A political impasse ended in January 2016 when a new parliamentary majority led by PDM, joined by defectors from the Communists and PLDM, supported PDM member Pavel FILIP as prime minister.\r\nMoldova remains Europe''s poorest economy, but has made steps toward expanding its market access by signing and ratifying an Association Agreement with the EU in 2014, which fully entered into force in July 2016 after ratification by all EU member states. Igor DODON won Moldova''s first direct presidential election in over 20 years in November 2016.', 'Europe', '47 00 N, 29 00 E\r\n', '33,851 sq km\r\n', '3,474,121 (July 2017 est.)', 'Moldovan(s)', 'Moldovan 75.1%, Romanian 7%, Ukrainian 6.6%, Gagauz 4.6%, Russian 4.1%, Bulgarian 1.9%, other 0.8% (2014 est.)', 'Moldovan/Romanian 80.2% (official) (56.7% identify their mother tongue as Moldovan, which is virtually the same as Romanian; 23.5% identify Romanian as their mother tongue), Russian 9.7%, Gagauz 4.2% (a Turkish language), Ukrainian 3.9%, Bulgarian 1.5%, Romani 0.3%, other 0.2% (2014 est.)', 'Orthodox 90.1%, other Christian 2.6%, other 0.1%, agnostic <.1%, atheist 0.2%, unspecified 6.9% (2014 est.)', 'Republic of Moldova', 'parliamentary republic', 'Chisinau in Romanian (Kishinev in Russian)', '32 raions (raioane, singular - raion), 3 municipalities (municipii, singular - municipiul), 1 autonomous territorial unit (unitatea teritoriala autonoma), and 1 territorial unit (unitatea teritoriala)', '27 August 1991 (from the Soviet Union)', 'Despite recent progress, Moldova remains one of the poorest countries in Europe. With a moderate climate and productive farmland, Moldova''s economy relies heavily on its agriculture sector, featuring fruits, vegetables, wine, and tobacco. Moldova also depends on annual remittances of about $1.12 billion from the roughly one million Moldovans working in Europe, Russia, and other former Soviet Bloc countries.\r\nWith few natural energy resources, Moldova imports almost all of its energy supplies from Russia and Ukraine. Moldova''s dependence on Russian energy is underscored by a more than $5 billion debt to Russian natural gas supplier Gazprom, largely the result of unreimbursed natural gas consumption in the breakaway region of Transnistria. Moldova and Romania inaugurated the Ungheni-Iasi natural gas interconnector project in August 2014. The 43-kilometer pipeline between Moldova and Romania, allows for both the import and export of natural gas. Several technical and regulatory delays kept gas from flowing into Moldova until March 2015. Romanian gas exports to Moldova are largely symbolic. Moldova hopes to build a pipeline connecting Ungheni to Chisinau, bringing the gas to Moldovan population centers.\r\nThe government''s stated goal of EU integration has resulted in some market-oriented progress. Moldova experienced better than expected economic growth in 2014 due to increased agriculture production, to economic policies adopted by the Moldovan government since 2009, and to the receipt of EU trade preferences. During fall 2014, Moldova signed an Association Agreement and a Deep and Comprehensive Free Trade Agreement with the EU, connecting Moldovan products to the world’s largest market. Still, a $1 billion asset-stripping heist of Moldovan banks in late 2014 delivered a significant shock to the economy in 2015; a subsequent bank bailout increased inflationary pressures and contributed to the depreciation of the leu. Moldova’s growth has also been hampered by endemic corruption and a Russian import ban on Moldova’s agricultural products. The government’s push to restore stability and implement meaningful reform led to the approval of a $179 million three-year IMF program focused on improving the banking and fiscal environments.\r\nOver the longer term, Moldova''s economy remains vulnerable to corruption, political uncertainty, weak administrative capacity, vested bureaucratic interests, higher fuel prices, Russian political and economic pressure, and unresolved separatism in Moldova''s Transnistria region.', '$7.945 billion (2016 est.)', 'vegetables, fruits, grapes, grain, sugar beets, sunflower seeds, tobacco; beef, milk; wine', 'sugar processing, vegetable oil, food processing, agricultural machinery; foundry equipment, refrigerators and freezers, washing machines; hosiery, shoes, textiles', '1.295 million (2017 est.)', 'foodstuffs, textiles, machinery', '5.741 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '262 bbl/day (2016 est.)', '10 million cu m (2015 est.)', 'ER (2016)', '7 (2013)', '-', 'gas 1,916 km (2014)', '1,171 km', '9,352 km', '558 km (in public use on Danube, Dniester and Prut Rivers) (2011)', '2018-02-07 18:03:32', NULL),
(147, 'MC', 'mc', 'Monaco', 'The Genoese built a fortress on the site of present day Monaco in 1215. The current ruling GRIMALDI family first seized control in 1297 but was not able to permanently secure its holding until 1419. Economic development was spurred in the late 19th century with a railroad linkup to France and the opening of a casino. Since then, the principality''s mild climate, splendid scenery, and gambling facilities have made Monaco world famous as a tourist and recreation center.', 'Europe', '43 44 N, 7 25 E', '2 sq km', '30,645 (July 2017 est.)', 'Monegasque(s) or Monacan(s)', 'French (official) 47%, Monegasque 16%, Italian 16%, other 21%', 'French (official), English, Italian, Monegasque', 'Roman Catholic 90% (official), other 10%', 'Principality of Monaco', 'constitutional monarchy', 'Monaco', 'none; there are no first-order administrative divisions as defined by the US Government, but there are 4 quarters (quartiers, singular - quartier); Fontvieille, La Condamine, Monaco-Ville, Monte-Carlo; note - Moneghetti, a part of La Condamine, is sometimes called the 5th quarter of Monaco', '1419 (beginning of permanent rule by the House of GRIMALDI)', 'Monaco, bordering France on the Mediterranean coast, is a popular resort, attracting tourists to its casino and pleasant climate. The principality also is a banking center and has successfully sought to diversify into services and small, high-value-added, nonpolluting industries. The state retains monopolies in a number of sectors, including tobacco, the telephone network, and the postal service. Living standards are high, roughly comparable to those in prosperous French metropolitan areas.\r\nThe state has no income tax and low business taxes and thrives as a tax haven both for individuals who have established residence and for foreign companies that have set up businesses and offices. Monaco, however, is not a tax-free shelter; it charges nearly 20% value-added tax, collects stamp duties, and companies face a 33% tax on profits unless they can show that three-quarters of profits are generated within the principality. Monaco was formally removed from the OECD''s "grey list" of uncooperative tax jurisdictions in late 2009, but continues to face international pressure to abandon its banking secrecy laws and help combat tax evasion. In October 2014, Monaco officially became the 84th jurisdiction participating in the OECD’s Multilateral Convention on Mutual Administrative Assistance in Tax Matters, an effort to combat offshore tax avoidance and evasion.\r\nMonaco''s reliance on tourism and banking for its economic growth has left it vulnerable to downturns in France and other European economies which are the principality''s main trade partners. In 2009, Monaco''s GDP fell by 11.5% as the euro-zone crisis precipitated a sharp drop in tourism and retail activity and home sales. A modest recovery ensued in 2010 and intensified in 2013, with GDP growth of more than 9%, but Monaco''s economic prospects remain uncertain.', '$6.006 billion (2013 est.)', 'none', 'banking, insurance, tourism, construction, small-scale industrial and consumer products', '52,000', '-', '-', '-', '-', '-', '3A (2016)', '-', '1 (2012)', '-', '-', '77 km', '-', '2018-02-07 18:03:32', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(148, 'MN', 'mn', 'Mongolia', 'The Mongols gained fame in the 13th century when under Chinggis KHAAN they established a huge Eurasian empire through conquest. After his death the empire was divided into several powerful Mongol states, but these broke apart in the 14th century. The Mongols eventually retired to their original steppe homelands and in the late 17th century came under Chinese rule. Mongolia declared its independence from the Manchu-led Qing Empire in 1911 and achieved limited autonomy until 1919, when it again came under Chinese control. The Mongolian Revolution of 1921 ended Chinese dominance, and a communist regime, the Mongolian People’s Republic, took power in 1924.\r\nThe modern country of Mongolia, however, represents only part of the Mongols'' historical homeland; today, more ethnic Mongolians live in the Inner Mongolia Autonomous Region in the People''s Republic of China than in Mongolia. Since the country''s peaceful democratic revolution in 1990, the ex-communist Mongolian People''s Revolutionary Party (MPRP) - which took the name Mongolian People’s Party (MPP) in 2010 - has competed for political power with the Democratic Party (DP) and several other smaller parties, including a new party formed by former President ENKHBAYAR, which confusingly adopted for itself the MPRP name. In the country''s most recent parliamentary elections in June 2016, Mongolians handed the MPP overwhelming control of Parliament, largely pushing out the DP, which had overseen a sharp decline in Mongolia’s economy during its control of Parliament in the preceding years. Mongolians elected a DP member, Khaltmaa BATTULGA, as president in 2017.', 'Asia', '47 55 N, 106 55 E', '1,564,116 sq km', '3,068,243', 'Mongolian(s)', 'Khalkh 81.9%, Kazak 3.8%, Dorvod 2.7%, Bayad 2.1%, Buryat-Bouriates 1.7%, Zakhchin 1.2%, Dariganga 1%, Uriankhai 1%, other 4.6% (2010 est.)', 'Mongolian 90% (official) (Khalkha dialect is predominant), Turkic, Russian (1999)', 'Buddhist 53%, Muslim 3%, Shamanist 2.9%, Christian 2.2%, other 0.4%, none 38.6% (2010 est.)', 'none', 'semi-presidential republic', 'Ulaanbaatar', '21 provinces (aymguud, singular - aymag) and 1 municipality* (singular - hot); Arhangay, Bayanhongor, Bayan-Olgiy, Bulgan, Darhan-Uul, Dornod, Dornogovi, Dundgovi, Dzavhan (Zavkhan), Govi-Altay, Govisumber, Hentiy, Hovd, Hovsgol, Omnogovi, Orhon, Ovorhangay, Selenge, Suhbaatar, Tov, Ulaanbaatar*, Uvs', '29 December 1911 (independence declared from China; in actuality, autonomy attained); 11 July 1921 (from China)', 'Foreign direct investment in Mongolia''s extractive industries – which are based on extensive deposits of copper, gold, coal, molybdenum, fluorspar, uranium, tin, and tungsten - has transformed Mongolia''s landlocked economy from its traditional dependence on herding and agriculture. Exports now account for more than 40% of GDP. Mongolia depends on China for more than 60% of its external trade - China receives some 90% of Mongolia''s exports and supplies Mongolia with more than one-third of its imports. Mongolia also relies on Russia for 90% of its energy supplies, leaving it vulnerable to price increases. Remittances from Mongolians working abroad, particularly in South Korea, are significant.\r\nSoviet assistance, at its height one-third of GDP, disappeared almost overnight in 1990 and 1991 at the time of the dismantlement of the USSR. The following decade saw Mongolia endure both deep recession, because of political inaction, and natural disasters, as well as strong economic growth, because of market reforms and extensive privatization of the formerly state-run economy. The country opened a fledgling stock exchange in 1991. Mongolia joined the WTO in 1997 and seeks to expand its participation in regional economic and trade regimes.\r\nGrowth averaged nearly 9% per year in 2004-08 largely because of high copper prices globally and new gold production. By late 2008, Mongolia was hit by the global financial crisis and Mongolia''s real economy contracted 1.3% in 2009. In early 2009, the IMF reached a $236 million Stand-by Arrangement with Mongolia and it emerged from the crisis with a stronger banking sector and better fiscal management. In October 2009, Mongolia passed long-awaited legislation on an investment agreement to develop the Oyu Tolgoi (OT) mine, among the world''s largest untapped copper-gold deposits. However, a dispute with foreign investors developing OT called into question the attractiveness of Mongolia as a destination for foreign investment. This caused a severe drop in FDI, and a slowing economy, leading to the dismissal of Prime Minister ALTANKHUYAG in November 2014. The economy had grown more than 10% per year between 2011 and 2013 - largely on the strength of commodity exports and high government spending - before slowing to 7.8% in 2014, and falling to the 2% level in 2015 through 2017, even though government spending remained high.\r\nThe May 2015 agreement with Rio Tinto to restart the OT mine and the subsequent $4.4 billion finance package signing in December 2015 stemmed the loss of investor confidence. The current government has made restoring investor trust and reviving the economy its top priority, but has failed to invigorate the economy in the face of the large dropoff in foreign direct investment, mounting external debt, and a sizeable budget deficit. However, Mongolia reached staff-level agreement with the IMF in February 2017 on an Extended Fund Facility program, and once approved by the IMF Board, the program is expected to improve Mongolia’s long-term fiscal and economic stability.', '$10.87 billion (2016 est.)', 'wheat, barley, vegetables, forage crops; sheep, goats, cattle, camels, horses', 'construction and construction materials; mining (coal, copper, molybdenum, fluorspar, tin, tungsten, gold); oil; food and beverages; processing of animal products, cashmere and natural fiber manufacturing', '1.24 million (2016 est.)', 'copper, apparel, livestock, animal products, cashmere, wool, hides, fluorspar, other nonferrous metals, coal, crude oil', '5.192 billion kWh (2015 est.)', '23,430 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'JU (2016)', '44 (2013)', '1 (2013)', '-', '1,815 km', '49,249 km', '580 km (the only waterway in operation is Lake Hovsgol) (135 km); Selenge River (270 km) and Orhon River (175 km) are navigable but carry little traffic; lakes and rivers ice free from May to September) (2010)', '2018-02-07 18:03:32', NULL),
(149, 'ME', 'me', 'Montenegro', 'The use of the name Crna Gora or Black Mountain (Montenegro) began in the 13th century in reference to a highland region in the Serbian province of Zeta. The later medieval state of Zeta maintained its existence until 1496 when Montenegro finally fell under Ottoman rule. Over subsequent centuries, Montenegro managed to maintain a level of autonomy within the Ottoman Empire. From the 16th to 19th centuries, Montenegro was a theocracy ruled by a series of bishop princes; in 1852, it transformed into a secular principality. Montenegro was recognized as an independent sovereign principality at the Congress of Berlin in 1878. After World War I, during which Montenegro fought on the side of the Allies, Montenegro was absorbed by the Kingdom of Serbs, Croats, and Slovenes, which became the Kingdom of Yugoslavia in 1929. At the conclusion of World War II, it became a constituent republic of the Socialist Federal Republic of Yugoslavia. When the latter dissolved in 1992, Montenegro federated with Serbia, creating the Federal Republic of Yugoslavia and, after 2003, shifting to a looser State Union of Serbia and Montenegro. In May 2006, Montenegro invoked its right under the Constitutional Charter of Serbia and Montenegro to hold a referendum on independence from the state union. The vote for severing ties with Serbia barely exceeded 55% - the threshold set by the EU - allowing Montenegro to formally restore its independence on 3 June 2006. Montenegro is an EU candidate country, having officially applied to join in December 2008.', 'Europe', '42 26 N, 19 16 E', '13,812 sq km', '642,550 (July 2017 est.)', 'Montenegrin(s)', 'Montenegrin 45%, Serbian 28.7%, Bosniak 8.7%, Albanian 4.9%, Muslim 3.3%, Romani 1%, Croat 1%, other 2.6%, unspecified 4.9% (2011 est.)', 'Serbian 42.9%, Montenegrin (official) 37%, Bosnian 5.3%, Albanian 5.3%, Serbo-Croat 2%, other 3.5%, unspecified 4% (2011 est.)', 'Orthodox 72.1%, Muslim 19.1%, Catholic 3.4%, atheist 1.2%, other 1.5%, unspecified 2.6% (2011 est.)', 'none', 'parliamentary republic', 'Podgorica; note - Cetinje retains the status of "O', '23 municipalities (opstine, singular - opstina); Andrijevica, Bar, Berane, Bijelo Polje, Budva, Cetinje, Danilovgrad, Gusinje, Herceg Novi, Kolasin, Kotor, Mojkovac, Niksic, Petnijica, Plav, Pljevlja, Pluzine, Podgorica, Rozaje, Savnik, Tivat, Ulcinj, Zabljak', '3 June 2006 (from the State Union of Serbia and Montenegro)', 'Montenegro''s economy is transitioning to a market system. As of 2015, around 90% of Montenegrin state-owned companies have been privatized, including 100% of banking, telecommunications, and oil distribution. Tourism, which accounts for roughly 20% of Montenegro’s GDP, brings in three times as many visitors as Montenegro’s total population every year. Several new luxury tourism complexes are in various stages of development along the coast, and a number are being offered in connection with nearby boating and yachting facilities. In addition to tourism, energy and agriculture are considered two distinct pillars of the economy. Only 20% of Montenegro’s hydropower potential is utilized. Montenegro plans to become a net energy exporter, and the construction of an underwater cable to Italy, which will be completed by 2018, will help meet its goal.\r\nMontenegro uses the euro as its domestic currency, though it is not an official member of the euro zone. In January 2007, Montenegro joined the World Bank and IMF, and in December 2011, the WTO. Montenegro began negotiations to join the EU in 2012, having met the conditions set down by the European Council, which called on Montenegro to take steps to fight corruption and organized crime.\r\nThe government recognizes the need to remove impediments in order to remain competitive and open the economy to foreign investors. The biggest foreign investors in Montenegro are Russia, Italy, Cyprus, Denmark, Hungary and Serbia. Net foreign direct investment in 2016 reached $755 million and investment per capita is one of the highest in Europe.\r\nMontenegro is currently planning major overhauls of its road and rail networks, and possible expansions of its air transportation system. In 2014, the Government of Montenegro selected two Chinese companies to construct a 41 km-long section of the country’s highway system. Construction will cost around $1.1 billion. Cheaper borrowing costs have stimulated Montenegro’s growing debt, which currently sits at 65.9% of GDP. Montenegro first instituted a value-added tax (VAT) in April 2003, and introduced differentiated VAT rates of 17% and 7% (for tourism) in January 2006. In May 2013, the Montenegrin Government raised the higher level VAT rate to 19%.', '$4.405 billion (2016 est.)', 'tobacco, potatoes, citrus fruits, olives, grapes; sheep', 'steelmaking, aluminum, agricultural processing, consumer goods, tourism', '263,200 (2014 est.)', '-', '2.897 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '4O (2016)', '5 (2013)', '1 (2012)', '-', '250 km', '7,762 km', '-', '2018-02-07 18:03:32', NULL),
(150, 'MS', 'ms', 'Montserrat', 'English and Irish colonists from St. Kitts first settled on Montserrat in 1632; the first African slaves arrived three decades later. The British and French fought for possession of the island for most of the 18th century, but it finally was confirmed as a British possession in 1783. The island''s sugar plantation economy was converted to small farm landholdings in the mid-19th century. Much of this island was devastated and two-thirds of the population fled abroad because of the eruption of the Soufriere Hills Volcano that began on 18 July 1995. Montserrat has endured volcanic activity since, with the last eruption occurring in July 2003.', 'Central America and the Caribbean', '16 42 N, 62 13 W', '102 sq km', '5,292', 'Montserratian(s)', 'African/black 88.4%, mixed 3.7%, hispanic/Spanish 3%, caucasian/white 2.7%, East Indian/Indian 1.5%, other 0.7% (2011 est.)', 'English', 'Protestant 67.1% (includes Anglican 21.8%, Methodist 17%, Pentecostal 14.1%, Seventh Day Adventist 10.5%, and Church of God 3.7%), Roman Catholic 11.6%, Rastafarian 1.4%, other 6.5%, none 2.6%, unspecified 10.8% (2001 est.)', 'none', 'parliamentary democracy (Legislative Council); self-governing overseas territory of the UK', 'Plymouth; note - Plymouth was abandoned in 1997 be', '3 parishes; Saint Anthony, Saint Georges, Saint Peter', 'none (overseas territory of the UK)', 'Severe volcanic activity, which began in July 1995, has put a damper on this small, open economy. A catastrophic eruption in June 1997 closed the airport and seaports, causing further economic and social dislocation. Two-thirds of the 12,000 inhabitants fled the island. Some began to return in 1998 but lack of housing limited the number. The agriculture sector continued to be affected by the lack of suitable land for farming and the destruction of crops.\r\nProspects for the economy depend largely on developments in relation to the volcanic activity and on public sector construction activity. Half of the island remains uninhabitable. In January 2013, the EU announced the disbursement of a $55.2 million aid package to Montserrat in order to boost the country''s economic recovery, with a specific focus on public finance management, public sector reform, and prudent economic management.', '$NA', 'cabbages, carrots, cucumbers, tomatoes, onions, peppers; livestock products', 'tourism, rum, textiles, electronic appliances', '4,521 (2012)', 'electronic components, plastic bags, apparel; hot peppers, limes, live plants; cattle', '24 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'VP-M (2016)', '1 (2013)', '-', '-', '-', 'volcanic eruptions that began in 1995 destroyed most of the 227 km road system; a new road infrastructure has been built on the north end of the island (2017)', '-', '2018-02-07 18:03:32', NULL),
(151, 'MA', 'ma', 'Morocco', 'In 788, about a century after the Arab conquest of North Africa, a series of Moroccan Muslim dynasties began to rule in Morocco. In the 16th century, the Sa''adi monarchy, particularly under Ahmad al-MANSUR (1578-1603), repelled foreign invaders and inaugurated a golden age. The Alaouite Dynasty, to which the current Moroccan royal family belongs, dates from the 17th century. In 1860, Spain occupied northern Morocco and ushered in a half century of trade rivalry among European powers that saw Morocco''s sovereignty steadily erode; in 1912, the French imposed a protectorate over the country. A protracted independence struggle with France ended successfully in 1956. The internationalized city of Tangier and most Spanish possessions were turned over to the new country that same year. Sultan MOHAMMED V, the current monarch''s grandfather, organized the new state as a constitutional monarchy and in 1957 assumed the title of king. Since Spain''s 1976 withdrawal from what is today called Western Sahara, Morocco has extended its de facto administrative control to roughly 80% of this territory; however, the UN does not recognize Morocco as the administering power for Western Sahara. The UN since 1991 has monitored a cease-fire between Morocco and the Polisario Front - Western Sahara''s liberation movement - and leads ongoing negotiations over the status of the territory.\r\nKing MOHAMMED VI in early 2011 responded to the spread of pro-democracy protests in the region by implementing a reform program that included a new constitution, passed by popular referendum in July 2011, under which some new powers were extended to parliament and the prime minister but ultimate authority remains in the hands of the monarch. In November 2011, the Justice and Development Party (PJD) - a moderate Islamist party - won the largest number of seats in parliamentary elections, becoming the first Islamist party to lead the Moroccan Government. In September 2015, Morocco held its first ever direct elections for regional councils, one of the reforms included in the 2011 constitution. The PJD again won the largest number of seats in nationwide parliamentary elections in October 2016.', 'Africa', '32 00 N, 5 00 W', '446,550 sq km', '33,986,655 (July 2017 est.)', 'Moroccan(s)', 'Arab-Berber 99%, other 1%', 'Arabic (official), Berber languages (Tamazight (official), Tachelhit, Tarifit), French (often the language of business, government, and diplomacy)', 'Muslim 99% (official; virtually all Sunni, <0.1% Shia), other 1% (includes Christian, Jewish, and Baha''i); note - Jewish about 6,000 (2010 est.)', 'Kingdom of Morocco', 'parliamentary constitutional monarchy', 'Rabat', '11 regions (recognized); Beni Mellal-Khenifra, Casablanca-Settat, Draa-Tafilalet, Fes-Meknes, Guelmim-Oued Noun, Laayoune-Sakia al Hamra, Oriental, Marrakech-Safi, Rabat-Sale-Kenitra, Souss-Massa, Tanger-Tetouan-Al Hoceima', '2 March 1956 (from France)', 'Morocco has capitalized on its proximity to Europe and relatively low labor costs to work towards building a diverse, open, market-oriented economy. Key sectors of the economy include agriculture, tourism, aerospace, automotive, phosphates, textiles, apparel, and subcomponents. Morocco has increased investment in its port, transportation, and industrial infrastructure to position itself as a center and broker for business throughout Africa. Industrial development strategies and infrastructure improvements - most visibly illustrated by a new port and free trade zone near Tangier - are improving Morocco''s competitiveness.\r\nIn the 1980s, Morocco was a heavily indebted country before pursuing austerity measures and pro-market reforms, overseen by the IMF. Since taking the throne in 1999, King MOHAMMED VI has presided over a stable economy marked by steady growth, low inflation, and gradually falling unemployment, although poor harvests and economic difficulties in Europe contributed to an economic slowdown. To boost exports, Morocco entered into a bilateral Free Trade Agreement with the US in 2006 and an Advanced Status agreement with the EU in 2008. In late 2014, Morocco eliminated subsidies for gasoline, diesel, and fuel oil, dramatically reducing outlays that weighted on the country’s budget and current account. Subsidies on butane gas and certain food products remain in place. Morocco also seeks to expand its renewable energy capacity with a goal of making renewable more than 50% of installed electricity generation capacity by 2030.\r\nDespite Morocco''s economic progress, the country suffers from high unemployment, poverty, and illiteracy, particularly in rural areas. Key economic challenges for Morocco include reforming the education system and the judiciary.', '$110.7 billion (2016 est.)', 'barley, wheat, citrus fruits, grapes, vegetables, olives; livestock; wine', 'automotive parts, phosphate mining and processing, aerospace, food processing, leather goods, textiles, construction, energy, tourism', '12 million (2017 est.)', 'clothing and textiles, automobiles, electric components, inorganic chemicals, transistors, crude minerals, fertilizers (including phosphates), petroleum products, citrus fruits, vegetables, fish', '27.37 billion kWh (2015 est.)', '160 bbl/day (2016 est.)', '139,400 bbl/day (2014 est.)', '94 million cu m (2015 est.)', 'CN (2016)', '55 (2013)', '1 (2013)', 'gas 944 km; oil 270 km; refined products 175 km (2013)', '2,067 km', '58,395 km', '-', '2018-02-07 18:03:32', NULL),
(152, 'MZ', 'mz', 'Mozambique', 'Almost five centuries as a Portuguese colony came to a close with independence in 1975. Large-scale emigration, economic dependence on South Africa, a severe drought, and a prolonged civil war hindered the country''s development until the mid-1990s. The ruling Front for the Liberation of Mozambique (FRELIMO) party formally abandoned Marxism in 1989, and a new constitution the following year provided for multiparty elections and a free market economy. A UN-negotiated peace agreement between FRELIMO and rebel Mozambique National Resistance (RENAMO) forces ended the fighting in 1992. In 2004, Mozambique underwent a delicate transition as Joaquim CHISSANO stepped down after 18 years in office. His elected successor, Armando GUEBUZA, served two terms and then passed executive power to Filipe NYUSI in 2014. RENAMO’s residual armed forces have intermittently engaged in a low-level insurgency since 2012, although a late December 2016 ceasefire held throughout 2017.', 'Africa', '18 15 S, 35 00 E', '799,380 sq km', '26,573,706', 'Mozambican(s)', 'African 99.66% (Makhuwa, Tsonga, Lomwe, Sena, and others), Europeans 0.06%, Euro-Africans 0.2%, Indians 0.08%', 'Emakhuwa 25.3%, Portuguese (official) 10.7%, Xichangana 10.3%, Cisena 7.5%, Elomwe 7%, Echuwabo 5.1%, other Mozambican languages 30.1%, other 0.3%, unspecified 3.7% (2007 est.)', 'Roman Catholic 28.4%, Muslim 17.9%, Zionist Christian 15.5%, Protestant 12.2% (includes Pentecostal 10.9% and Anglican 1.3%), other 6.7%, none 18.7%, unspecified 0.7% (2007 est.)', 'Republic of Mozambique', 'presidential republic', 'Maputo', '10 provinces (provincias, singular - provincia), 1 city (cidade)*; Cabo Delgado, Gaza, Inhambane, Manica, Maputo, Cidade de Maputo*, Nampula, Niassa, Sofala, Tete, Zambezia', '25 June 1975 (from Portugal)', 'At independence in 1975, Mozambique was one of the world''s poorest countries. Socialist policies, economic mismanagement, and a brutal civil war from 1977 to 1992 further impoverished the country. In 1987, the government embarked on a series of macroeconomic reforms designed to stabilize the economy. These steps, combined with donor assistance and with political stability since the multi-party elections in 1994, propelled the country’s GDP from $4 billion in 1993, following the war, to about $37 billion in 2017. Fiscal reforms, including the introduction of a value-added tax and reform of the customs service, have improved the government''s revenue collection abilities.\r\nIn spite of these gains, more than half the population remains below the poverty line. Subsistence agriculture continues to employ the vast majority of the country''s work force. Citizens rioted in September 2010 after fuel, water, electricity, and bread price increases were announced. In an attempt to lessen the negative impact on the population, the government implemented subsidies, decreased taxes and tariffs, and instituted other fiscal measures.\r\nA substantial trade imbalance persists, although aluminum production from the Mozal Aluminum Smelter has significantly boosted export earnings in recent years. In 2012, the Mozambican Government took over Portugal''s last remaining share in the Cahora Bassa Hydroelectricity Company, a significant contributor to the Southern African Power Pool. The government has plans to expand the Cahora Bassa Dam and build additional dams to increase its electricity exports and fulfill the needs of its burgeoning domestic industries.\r\nMozambique''s once substantial foreign debt was reduced through forgiveness and rescheduling under the IMF''s Heavily Indebted Poor Countries (HIPC) and Enhanced HIPC initiatives. However, in 2016, information surfaced revealing that the Mozambican Government was responsible for over $2 billion in government-backed loans originally secured between 2012-14 by state-owned defense and security companies without parliamentary approval or national budget inclusion, which prompted the IMF and international donors to halt direct budget support to the Government of Mozambique. Mozambique grew at an average annual rate of 6%-8% in the decade leading up to 2015, one of Africa''s strongest performances, but growth slowed in 2016. The sizable external debt burden, donor withdrawal, elevated inflation, and currency depreciation contributed to slower growth in 2016-17.\r\nTwo major international consortiums are seeking approval to develop massive natural gas deposits off the coast of Cabo Delgado province, in what has the potential to become the largest infrastructure project in Africa. The government predicts sales of liquefied natural gas from these projects could generate several billion dollars in revenues annually sometime after 2022.', '$12.35 billion (2016 est.)', 'cotton, cashew nuts, sugarcane, tea, cassava (manioc, tapioca), corn, coconuts, sisal, citrus and tropical fruits, potatoes, sunflowers; beef, poultry', 'aluminum, petroleum products, chemicals (fertilizer, soap, paints), textiles, cement, glass, asbestos, tobacco, food, beverages', '12.98 million (2017 est.)', 'aluminum, prawns, cashews, cotton, sugar, citrus, timber; bulk electricity', '19.58 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '5.695 billion cu m (2015 est.)', 'C9 (2016)', '98 (2013)', '', 'gas 972 km; refined products 278 km (2013)', '4,787 km', '31,083 km', '460 km (Zambezi River navigable to Tete and along Cahora Bassa Lake) (2010)', '2018-02-07 18:03:32', NULL),
(153, 'MM', 'mm', 'Myanmar', 'Various ethnic Burmese and ethnic minority city-states or kingdoms occupied the present borders through the 19th century. Over a period of 62 years (1824-1886), Britain conquered Burma and incorporated the country into its Indian Empire. Burma was administered as a province of India until 1937 when it became a separate, self-governing colony; in 1948, Burma attained independence from the British Commonwealth. Gen. NE WIN dominated the government from 1962 to 1988, first as military ruler, then as self-appointed president, and later as political kingpin. In response to widespread civil unrest, NE WIN resigned in 1988, but within months the military crushed student-led protests and took power.\r\nMultiparty legislative elections in 1990 resulted in the main opposition party - the National League for Democracy (NLD) - winning a landslide victory. Instead of handing over power, the junta placed NLD leader (and 1991 Nobel Peace Prize recipient) AUNG SAN SUU KYI under house arrest from 1989 to 1995, 2000 to 2002, and from May 2003 to November 2010. In late September 2007, the ruling junta brutally suppressed protests over increased fuel prices led by prodemocracy activists and Buddhist monks, killing an unknown number of people and arresting thousands for participating in the demonstrations. In early May 2008, Burma was struck by Cyclone Nargis, which left over 138,000 dead and tens of thousands injured and homeless. Despite this tragedy, the junta proceeded with its May constitutional referendum, the first vote in Burma since 1990. Legislative elections held in November 2010, which the NLD boycotted and were considered flawed by many in the international community, saw the ruling Union Solidarity and Development Party garner over 75% of the contested seats.\r\nThe national legislature convened in January 2011 and selected former Prime Minister THEIN SEIN as president. Although the vast majority of national-level appointees named by THEIN SEIN were former or current military officers, the government initiated a series of political and economic reforms leading to a substantial opening of the long-isolated country. These reforms included releasing hundreds of political prisoners, signing a nationwide cease-fire with several of the country''s ethnic armed groups, pursuing legal reform, and gradually reducing restrictions on freedom of the press, association, and civil society. At least due in part to these reforms, AUNG SAN SUU KYI was elected to the national legislature in April 2012 and became chair of the Committee for Rule of Law and Tranquility. Burma served as chair of the Association of Southeast Asian Nations (ASEAN) for 2014. In a flawed but largely credible national legislative election in November 2015 featuring more than 90 political parties, the NLD again won a landslide victory. Using its overwhelming majority in both houses of parliament, the NLD elected HTIN KYAW, AUNG SAN SUU KYI’s confidant and long-time NLD supporter, as president. Burma''s first credibly elected civilian government after more than five decades of military dictatorship was sworn into office on 30 March 2016.', 'Southeast Asia', '22 00 N, 98 00 E', '676,578 sq km', '55,123,814', 'Burmese (singular and plural)', 'Burman (Bamar) 68%, Shan 9%, Karen 7%, Rakhine 4%, Chinese 3%, Indian 2%, Mon 2%, other 5%', 'Burmese (official)', 'Buddhist 87.9%, Christian 6.2%, Muslim 4.3%, Animist 0.8%, Hindu 0.5%, other 0.2%, none 0.1%', 'Union of Burma', 'parliamentary republic', 'Rangoon (Yangon); note - Nay Pyi Taw is the admini', '7 regions (taing-myar, singular - taing), 7 states (pyi ne-myar, singular - pyi ne), 1 union territory', '4 January 1948 (from the UK)', 'Since the transition to a civilian government in 2011, Burma has begun an economic overhaul aimed at attracting foreign investment and reintegrating into the global economy. Economic reforms have included establishing a managed float of the Burmese kyat in 2012, granting the Central Bank operational independence in July 2013, enacting a new anti-corruption law in September 2013, and granting licenses to nine foreign banks in 2014 and four more foreign banks in 2016. State Counselor AUNG SAN SUU KYI and the ruling National League for Democracy, who took power in March 2016, are seeking to improve Burma’s investment climate, following the US sanctions lift in October 2016 and reinstatement of Generalized System of Preferences trade benefits in November 2016. In October 2016, Burma passed a revised foreign investment law that consolidates investment regulations and eases the investment approval process. Parliament is also expected to pass amendments to the Companies Law and Gemstone Law later this year.\r\nThe government reforms since 2011 and the subsequent easing of most Western sanctions led to accelerated growth, from under 6% in 2011 to roughly 7% in 2013 through 2017. Burma’s abundant natural resources and young labor force are attracting foreign investment in the energy, garment, information technology, and food and beverage sectors.\r\nDespite these improvements, living standards have not improved for the majority of the people residing in rural areas. Burma remains one of the poorest countries in Asia – approximately 26% of the country’s 51 million people live in poverty. The isolationist policies and economic mismanagement of previous governments have left Burma with poor infrastructure, endemic corruption, underdeveloped human resources, and inadequate access to capital, which will require a major commitment to reverse. The Burmese government has been slow to address impediments to economic development such as insecure land rights, a restrictive trade licensing system, an opaque revenue collection system, and an antiquated banking system. AUNG SAN SUU KYI’s government is focusing on accelerating agricultural productivity and land reforms, modernizing and opening the financial sector, and developing transportation and electricity infrastructure.', '$66.97 billion (2016 est.)', 'rice, pulses, beans, sesame, groundnuts; sugarcane; fish and fish products; hardwood', 'agricultural processing; wood and wood products; copper, tin, tungsten, iron; cement, construction materials; pharmaceuticals; fertilizer; oil and natural gas; garments; jade and gems', '22.3 million (2017 est.)', 'natural gas; wood products; pulses and beans; fish; rice; clothing; minerals, including jade and gems', '15.48 billion kWh (2015 est.)', '15,000 bbl/day (2016 est.)', '15,870 bbl/day (2014 est.)', '17.5 billion cu m (2015 est.)', 'XY (2016)', '64 (2013)', '11 (2013)', 'gas 3,739 km; oil 1,321 km (2017', '5,031 km', '34,377 km (includes 358 km of expressways) (2010)', '12,800 km (2011)', '2018-02-07 18:03:32', NULL),
(154, 'NA', 'na', 'Namibia', 'South Africa occupied the German colony of South-West Africa during World War I and administered it as a mandate until after World War II, when it annexed the territory. In 1966, the Marxist South-West Africa People''s Organization (SWAPO) guerrilla group launched a war of independence for the area that became Namibia, but it was not until 1988 that South Africa agreed to end its administration in accordance with a UN peace plan for the entire region. Namibia has been governed by SWAPO since the country won independence in 1990, though the party has dropped much of its Marxist ideology. Prime Minister Hage GEINGOB was elected president in 2014 in a landslide victory, replacing Hifikepunye POHAMBA who stepped down after serving two terms. SWAPO retained its parliamentary super majority in the 2014 elections and established a system of gender parity in parliamentary positions.', 'Africa', '22 00 S, 17 00 E', '824,292 sq km', '2,484,780', 'Namibian(s)', 'black 87.5%, white 6%, mixed 6.5%', 'Oshivambo languages 48.9%, Nama/Damara 11.3%, Afrikaans 10.4% (common language of most of the population and about 60% of the white population), Otjiherero languages 8.6%, Kavango languages 8.5%, Caprivi languages 4.8%, English (official) 3.4%, other African languages 2.3%, other 1.7%', 'Christian 80% to 90% (at least 50% Lutheran), indigenous beliefs 10% to 20%', 'Republic of Namibia', 'presidential republic', 'Windhoek', '14 regions; Erongo, Hardap, //Karas, Kavango East, Kavango West, Khomas, Kunene, Ohangwena, Omaheke, Omusati, Oshana, Oshikoto, Otjozondjupa, Zambezi; note - the Karas Region was renamed //Karas in September 2013 to include the alveolar lateral click of the Khoekhoegowab language', '21 March 1990 (from South African mandate)', 'Namibia’s economy is heavily dependent on the extraction and processing of minerals for export. Mining accounts for 11.5% of GDP, but provides more than 50% of foreign exchange earnings. Rich alluvial diamond deposits make Namibia a primary source for gem-quality diamonds. Marine diamond mining is increasingly important as the terrestrial diamond supply has dwindled. The rising cost of mining diamonds, especially from the sea, combined with increased diamond production in Russia and China, has reduced profit margins. Namibian authorities have emphasized the need to add value to raw materials, do more in-country manufacturing, and exploit the services market, especially in the logistics and transportation sectors.\r\nNamibia is the world''s fifth-largest producer of uranium. The Chinese-owned Husab uranium mine is expected to start producing uranium ore in 2017. Once the Husab mine reaches full production, Namibia is expected to become the world’s second-largest producer of uranium. Namibia also produces large quantities of zinc and is a smaller producer of gold and copper. Namibia''s economy remains vulnerable to world commodity price fluctuations and drought.\r\nNamibia normally imports about 50% of its cereal requirements; in drought years, food shortages are problematic in rural areas. A high per capita GDP, relative to the region, obscures one of the world''s most unequal income distributions. A priority of the current government is poverty eradication. Despite a drought, real GDP growth remained strong in 2015 because of construction in the mining and housing sectors, coupled with an expansionary fiscal policy. GDP growth in 2017 slowed to about 1%, however, due to contractions in both the construction and mining sectors, as well as the ongoing drought. Growth is expected to recover modestly in 2018.\r\nA five-year Millennium Challenge Corporation compact ended in September 2014. As an upper middle income country, Namibia is ineligible for a second compact. The Namibian economy is closely linked to South Africa with the Namibian dollar pegged one-to-one to the South African rand. Namibia receives 30%-40% of its revenues from the Southern African Customs Union (SACU); volatility in the size of Namibia''s annual SACU allotment and global mineral prices complicates budget planning.', '$12.56 billion (2016 est.)', 'millet, sorghum, peanuts, grapes; livestock; fish', 'meatpacking, fish processing, dairy products, pasta, beverages; mining (diamonds, lead, zinc, tin, silver, tungsten, uranium, copper)', '956,800 (2017 est.)', 'diamonds, copper, gold, zinc, lead, uranium; cattle, white fish and mollusks', '1.519 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'V5 (2016)', '112 (2013)', '-', '-', '2,628 km', '44,138 km', '-', '2018-02-07 18:03:32', NULL),
(155, 'NR', 'nr', 'Nauru', 'The exact origins of the Nauruans are unclear since their language does not resemble any other in the Pacific region. Germany annexed the island in 1888. A German-British consortium began mining the island''s phosphate deposits early in the 20th century. Australian forces occupied Nauru in World War I; it subsequently became a League of Nations mandate. After the Second World War - and a brutal occupation by Japan - Nauru became a UN trust territory. It achieved independence in 1968 and joined the UN in 1999 as the world''s smallest independent republic.', 'Oceania', '0 32 S, 166 55 E', '21 sq km', '11,359 (July 2017 est.)', 'Nauruan(s)', 'Nauruan 58%, other Pacific Islander 26%, Chinese 8%, European 8%', 'Nauruan 93% (official, a distinct Pacific Island language), English 2% (widely understood, spoken, and used for most government and commercial purposes), other 5% (includes I-Kiribati 2% and Chinese 2%)', 'Protestant 60.4% (includes Nauru Congregational 35.7%, Assembly of God 13%, Nauru Independent Church 9.5%, Baptist 1.5%, and Seventh Day Adventist 0.7%), Roman Catholic 33%, other 3.7%, none 1.8%, unspecified 1.1% (2011 est.)', 'Republic of Nauru', 'parliamentary republic', 'no official capital; government offices in Yaren D', '14 districts; Aiwo, Anabar, Anetan, Anibare, Baitsi, Boe, Buada, Denigomodu, Ewa, Ijuw, Meneng, Nibok, Uaboe, Yaren', '31 January 1968 (from the Australia-, NZ-, and UK-administered UN trusteeship)', 'Revenues of this tiny island - a coral atoll with a land area of 21 square kilometers - traditionally have come from exports of phosphates. Few other resources exist, with most necessities being imported, mainly from Australia, its former occupier and later major source of support. Primary reserves of phosphates were exhausted and mining ceased in 2006, but mining of a deeper layer of "secondary phosphate" in the interior of the island began the following year. The secondary phosphate deposits may last another 30 years. Earnings from Nauru’s export of phosphate remains an important source of income. Few comprehensive statistics on the Nauru economy exist; estimates of Nauru''s GDP vary widely.\r\nThe rehabilitation of mined land and the replacement of income from phosphates are serious long-term problems. In anticipation of the exhaustion of Nauru''s phosphate deposits, substantial amounts of phosphate income were invested in trust funds to help cushion the transition and provide for Nauru''s economic future.\r\nAlthough revenue sources for government are limited, the opening of the Australian Regional Processing Center for asylum seekers since 2012 has sparked growth in the economy. Revenue derived from fishing licenses under the "vessel day scheme" has also boosted government income. Housing, hospitals, and other capital plant are deteriorating. The cost to Australia of keeping the Nauruan government and economy afloat continues to climb.', '$114 million (2015 est.)', 'coconuts', 'phosphate mining, offshore banking, coconut products', 'NA', 'phosphates', '25 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'C2 (2016)', '1 (2013)', '-', '-', '-', '30 km', '-', '2018-02-07 18:03:32', NULL),
(156, 'NP', 'np', 'Nepal', 'During the late 18th-early 19th centuries, the principality of Gorkha united many of the other principalities and states of the sub-Himalayan region into a Nepalese Kingdom. Nepal retained its independence following the Anglo-Nepalese War of 1814-16 and the subsequent peace treaty laid the foundations for two centuries of amicable relations between Britain and Nepal. (The Brigade of Gurkhas continues to serve in the British Army to the present day.) In 1951, the Nepali monarch ended the century-old system of rule by hereditary premiers and instituted a cabinet system that brought political parties into the government. That arrangement lasted until 1960, when political parties were again banned, but was reinstated in 1990 with the establishment of a multiparty democracy within the framework of a constitutional monarchy.\r\nAn insurgency led by Maoists broke out in 1996. The ensuing 10-year civil war between Maoist and government forces witnessed the dissolution of the cabinet and parliament and the re-assumption of absolute power by the king in 2002. A peace accord in 2006 led to the promulgation of an interim constitution in 2007. Following a nationwide Constituent Assembly (CA) election in 2008, the newly formed CA declared Nepal a federal democratic republic, abolished the monarchy, and elected the country''s first president. After the CA failed to draft a constitution by a May 2012 deadline set by the Supreme Court, then-Prime Minister Baburam BHATTARAI dissolved the CA. Months of negotiations ensued until March 2013 when the major political parties agreed to create an interim government headed by then-Chief Justice Khil Raj REGMI with a mandate to hold elections for a new CA. Elections were held in November 2013, in which the Nepali Congress won the largest share of seats in the CA and in February 2014 formed a coalition government with the second place Communist Party of Nepal-Unified Marxist-Leninist and with Nepali Congress President Sushil KOIRALA as prime minister. Nepal''s new constitution came into effect in September 2015, at which point the CA became the Parliament. Khagda Prasad Sharma OLI served as the first post-constitution prime minister from October 2015-August 2016, when a new coalition led by Maoist leader Pushpa Kamal DAHAL (aka "Prachanda") took over the premiership. The constitution provided for a transitional period during which three sets of elections – local, provincial, and national – needed to take place. The first local elections in 20 years occurred in three phases between May and September 2017, while state and federal elections proceeded in two phases in November and December 2017.', 'Asia', '28 00 N, 84 00 E', '147,181 sq km', '29,384,297 (July 2017 est.)', 'Nepali (singular and plural)', 'Chhettri 16.6%, Brahman-Hill 12.2%, Magar 7.1%, Tharu 6.6%, Tamang 5.8%, Newar 5%, Kami 4.8%, Muslim 4.4%, Yadav 4%, Rai 2.3%, Gurung 2%, Damai/Dholii 1.8%, Thakuri 1.6%, Limbu 1.5%, Sarki 1.4%, Teli 1.4%, Chamar/Harijan/Ram 1.3%, Koiri/Kushwaha 1.2%, other 19%', 'Nepali (official) 44.6%, Maithali 11.7%, Bhojpuri 6%, Tharu 5.8%, Tamang 5.1%, Newar 3.2%, Magar 3%, Bajjika 3%, Urdu 2.6%, Avadhi 1.9%, Limbu 1.3%, Gurung 1.2%, other 10.4%, unspecified 0.2%', 'Hindu 81.3%, Buddhist 9%, Muslim 4.4%, Kirant 3.1%, Christian 1.4%, other 0.5%, unspecified 0.2% (2011 est.)', 'Federal Democratic Republic of Nepal', 'federal parliamentary republic', 'Kathmandu', '14 zones (anchal, singular and plural); Bagmati, Bheri, Dhawalagiri, Gandaki, Janakpur, Karnali, Kosi, Lumbini, Mahakali, Mechi, Narayani, Rapti, Sagarmatha, Seti', '1768 (unified by Prithvi Narayan SHAH)', 'Nepal is among the poorest and least developed countries in the world, with about one-quarter of its population living below the poverty line. Nepal is heavily dependent on remittances, which amount to as much as 30% of GDP. Agriculture is the mainstay of the economy, providing a livelihood for almost two-thirds of the population but accounting for only one-third of GDP. Industrial activity mainly involves the processing of agricultural products, including pulses, jute, sugarcane, tobacco, and grain.\r\nNepal has considerable scope for exploiting its potential in hydropower, with an estimated 42,000 MW of commercially feasible capacity. Nepal and India signed trade and investment agreements in 2014 that increase Nepal’s hydropower potential, but political uncertainty and a difficult business climate have hampered foreign investment.\r\nNepal was hit by massive earthquakes in early 2015, which damaged or destroyed infrastructure and homes and set back economic development. Political gridlock in the past several years and recent public protests, predominantly in the southern Tarai region, have hindered post-earthquake recovery and prevented much-needed economic reform. Additional challenges to Nepal''s growth include its landlocked geographic location, persistent power shortages, and underdeveloped transportation infrastructure.', '$24.07 billion (2016 est.)', 'pulses, rice, corn, wheat, sugarcane, jute, root crops; milk, water buffalo meat', 'tourism, carpets, textiles; small rice, jute, sugar, and oilseed mills; cigarettes, cement and brick production', '15.6 million', 'clothing, pulses, carpets, textiles, juice, jute goods', '3.342 billion kWh (FY 2016 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '9N (2016)', '47 (2013)', '-', '-', '53 km', '27,990 km', '-', '2018-02-07 18:03:32', NULL);
