(157, 'NL', 'nl', 'Netherlands', 'The Dutch United Provinces declared their independence from Spain in 1579; during the 17th century, they became a leading seafaring and commercial power, with settlements and colonies around the world. After a 20-year French occupation, a Kingdom of the Netherlands was formed in 1815. In 1830, Belgium seceded and formed a separate kingdom. The Netherlands remained neutral in World War I, but suffered German invasion and occupation in World War II. A modern, industrialized nation, the Netherlands is also a large exporter of agricultural products. The country was a founding member of NATO and the EEC (now the EU) and participated in the introduction of the euro in 1999. In October 2010, the former Netherlands Antilles was dissolved and the three smallest islands - Bonaire, Sint Eustatius, and Saba - became special municipalities in the Netherlands administrative structure. The larger islands of Sint Maarten and Curacao joined the Netherlands and Aruba as constituent countries forming the Kingdom of the Netherlands.', 'Europe', '52 30 N, 5 45 E', '41,543 sq km', '17,084,719 (July 2017 est.)', 'Dutchman(men), Dutchwoman(women)', 'Dutch 77.4%, EU 6.2%, Turkish 2.3%, Moroccan 2.3%, Indonesian 2.1%, Surinamese 2%, other 7.7% (2017 est.)', 'Dutch (official)', 'Roman Catholic 23.7%, Protestant 15.5% (includes Dutch Reformed 6.5%, Protestant Church of The Netherlands 5.7%, Calvinist 3.3%), Islam 4.9%, other 5.7% (includes Hindu, Buddhist, Jewish), none 50.1% (2015 est.)', 'Kingdom of the Netherlands', 'parliamentary constitutional monarchy; part of the Kingdom of the Netherlands', 'Amsterdam; note - The Hague is the seat of governm', '12 provinces (provincies, singular - provincie); Drenthe, Flevoland, Fryslan (Friesland), Gelderland, Groningen, Limburg, Noord-Brabant (North Brabant), Noord-Holland (North Holland), Overijssel, Utrecht, Zeeland (Zealand), Zuid-Holland (South Holland)\r\nnote 1: the Netherlands is one of four constituent countries of the Kingdom of the Netherlands; the other three, Aruba, Curacao, and Sint Maarten, are all islands in the Caribbean; while all four parts are considered equal partners, in practice, most of the Kingdom''s affairs are administered by the Netherlands, which makes up about 98% of the Kingdom''s total land area and population\r\nnote 2: three other Caribbean islands, Bonaire, Saint Eustatius, and Saba, are considered to be special municipalities of the Netherlands proper', '23 January 1579 (the northern provinces of the Low Countries conclude the Union of Utrecht breaking with Spain; on 26 July 1581 they formally declared their independence with an Act of Abjuration; however, it was not until 30 January 1648 and the Peace of Westphalia that Spain recognized this independence)', 'The Netherlands, the sixth-largest economy in the European Union, plays an important role as a European transportation hub, with a consistently high trade surplus, stable industrial relations, and low unemployment. Industry focuses on food processing, chemicals, petroleum refining, and electrical machinery. A highly mechanized agricultural sector employs only 2% of the labor force but provides large surpluses for food-processing and underpins the country’s status as the world’s second largest agricultural exporter.\r\nThe Netherlands is part of the euro zone, and as such, its monetary policy is controlled by the European Central Bank. The Dutch financial sector is highly concentrated, with four commercial banks possessing over 80% of banking assets, and is four times the size of Dutch GDP.\r\nIn 2008, during the financial crisis, the government budget deficit hit 5.3% of GDP. Following a protracted recession from 2009 to 2013, during which unemployment doubled to 7.4% and household consumption contracted for four consecutive years, economic growth began inching forward in 2014. Since 2010, Prime Minister Mark RUTTE’s government has implemented significant austerity measures to improve public finances and has instituted broad structural reforms in key policy areas, including the labor market, the housing sector, the energy market, and the pension system. In 2017, the government budget returned to a surplus of 0.7% of GDP, with economic growth of 3.2%, and GDP per capita finally surpassed pre-crisis levels. The fiscal policy announced by the new government in the 2018-2021 coalition plans for increases in government consumption and public investment, fueling domestic demand and household consumption and investment. The new government’s policy also plans to increase demand for workers in the public and private sector, forecasting a further decline in the unemployment rate, which hit 4.8% in 2017.', '$824.5 billion (2016 est.)', 'vegetables, ornamentals, dairy, poultry and livestock products; propagation materials', 'agroindustries, metal and engineering products, electrical machinery and equipment, chemicals, petroleum, construction, microelectronics, fishing', '7.969 million (2017 est.)', 'machinery and transport equipment, chemicals, mineral fuels; food and livestock, manufactured goods', '102.5 billion kWh (2015 est.)', '18,090 bbl/day (2016 est.)', '1.28 million bbl/day (2016 est.)', '47.46 billion cu m', 'PH (2016)', '29 (2013)', '1 (2013)', 'gas 14,000 km; oil and refined products 2,500 km; chemicals 3,000 km (2016)', '3,058 km', '139,124 km (includes 3,654 km of expressways) (2016)', '6,237 km (navigable by ships up to 50 tons) (2012)', '2018-02-07 18:03:33', NULL),
(158, 'NC', 'nc', 'New Caledonia', 'Settled by both Britain and France during the first half of the 19th century, the island became a French possession in 1853. It served as a penal colony for four decades after 1864. Agitation for independence during the 1980s and early 1990s ended in the 1998 Noumea Accord, which over the past 20 years has transfered an increasing amount of governing responsibility from France to New Caledonia. The agreement also commits France to conduct a referendum by November 2018 for residents to decide whether New Caledonia should assume full sovereignty and independence.', 'Oceania', '21 30 S, 165 30 E', '18,575 sq km', '279,070 (July 2017 est.)', 'New Caledonian(s)', 'Kanak 40.3%, European 29.2%, Wallisian, Futunian 8.7%, Tahitian 2%, Indonesian 1.6%, Vietnamese 1%, Ni-Vanuatu 0.9%, other 16.2% (2009 est.)', 'French (official), 33 Melanesian-Polynesian dialects', 'Roman Catholic 60%, Protestant 30%, other 10%', 'Territory of New Caledonia and Dependencies', 'parliamentary democracy (Territorial Congress); an overseas collectivity of France', 'Noumea', '3 provinces; Province Iles (Islands Province), Province Nord (North Province), and Province Sud (South Province)', 'none none (overseas collectivity of France); note - a referendum on independence was held in 1998 but was rejected; a new referendum must be held by November 2018', 'New Caledonia has 11% of the world''s nickel reserves, representing the second largest reserves on the planet. Only a small amount of the land is suitable for cultivation, and food accounts for about 20% of imports. In addition to nickel, substantial financial support from France - equal to more than 15% of GDP - and tourism are keys to the health of the economy.\r\nDuring 2009-10, France sent more development assistance to New Caledonia than to any of its other overseas territories. In October 2014, French Prime Minister Manuel VALLS confirmed financial support to New Caledonia totaling $500 million for the period 2016-20. The new government, which inherited a $112 million deficit in 2013, is expected to focus on bringing the territory’s budget back into balance.\r\nWith the gradual increase in the production of two new nickel plants in 2015, average production of metallurgical goods stood at a record level of 94 thousand tons. However, the sector is exposed to the high volatility of nickel prices. In April 2016, PM VALLS committed $180 million to support New Caledonia’s main nickel company, Societe Le Nickel.', '$15.54 billion (2014 est.)', 'vegetables; beef, venison, other livestock products; fish', 'nickel mining and smelting', '119,500 (2016 est.)', 'ferronickels, nickel ore, fish', '2.807 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '-', '25 (2013)', '8 (2013)', '-', '-', '5,622 km (2006)', '-', '2018-02-07 18:03:33', NULL),
(159, 'NZ', 'nz', 'New Zealand', 'The Polynesian Maori reached New Zealand in about A.D. 800. In 1840, their chieftains entered into a compact with Britain, the Treaty of Waitangi, in which they ceded sovereignty to Queen Victoria while retaining territorial rights. That same year, the British began the first organized colonial settlement. A series of land wars between 1843 and 1872 ended with the defeat of the native peoples. The British colony of New Zealand became an independent dominion in 1907 and supported the UK militarily in both world wars. New Zealand''s full participation in a number of defense alliances lapsed by the 1980s. In recent years, the government has sought to address longstanding Maori grievances.', 'Oceania', '41 00 S, 174 00 E', '268,838 sq km', '4,510,327 (July 2017 est.)', 'New Zealander(s)', 'European 71.2%, Maori 14.1%, Asian 11.3%, Pacific peoples 7.6%, Middle Eastern, Latin American, African 1.1%, other 1.6%, not stated or unidentified 5.4%\r\nnote: based on the 2013 census of the usually resident population; percentages add up to more than 100% because respondents were able to identify more than one ethnic group (2013 est.)', 'English (de facto official) 89.8%, Maori (de jure official) 3.5%, Samoan 2%, Hindi 1.6%, French 1.2%, Northern Chinese 1.2%, Yue 1%, other or not stated 20.5%, New Zealand Sign Language (de jure official)', 'Christian 44.3% (Catholic 11.6%, Anglican 10.8%, Presbyterian and Congregational 7.8%, Methodist, 2.4%, Pentecostal 1.8%, other 9.9%), Hindu 2.1%, Buddhist 1.4%, Maori Christian 1.3%, Islam 1.1%, other religion 1.4% (includes Judaism, Spiritualism and New Age religions, Baha''i, Asian religions other than Buddhism), no religion 38.5%, not stated or unidentified 8.2%, objected to answering 4.1%\r\nnote: based on the 2013 census of the usually resident population; percentages add up to more than 100% because respondents were able to identify more than one religion (2013 est.)', 'none', 'parliamentary democracy (New Zealand Parliament) under a constitutional monarchy; a Commonwealth rea', 'Wellington', '16 regions and 1 territory*; Auckland, Bay of Plenty, Canterbury, Chatham Islands*, Gisborne, Hawke''s Bay, Manawatu-Wanganui, Marlborough, Nelson, Northland, Otago, Southland, Taranaki, Tasman, Waikato, Wellington, West Coast', '26 September 1907 (from the UK)', 'Over the past 40 years, the government has transformed New Zealand from an agrarian economy, dependent on concessionary British market access, to a more industrialized, free market economy that can compete globally. This dynamic growth has boosted real incomes, but left behind some at the bottom of the ladder and broadened and deepened the technological capabilities of the industrial sector.\r\nPer capita income rose for 10 consecutive years until 2007 in purchasing power parity terms, but fell in 2008-09. Debt-driven consumer spending drove robust growth in the first half of the decade, fueling a large balance of payments deficit that posed a challenge for policymakers. Inflationary pressures caused the central bank to raise its key rate steadily from January 2004 until it was among the highest in the OECD in 2007 and 2008. The higher rate attracted international capital inflows, which strengthened the currency and housing market while aggravating the current account deficit. Rising house prices, especially in Auckland, have become a political issue in recent years, as well as a policy challenge in 2016 and 2017, as the ability to afford housing has declined for many.\r\nThe economy fell into recession before the start of the global financial crisis and contracted for five consecutive quarters in 2008 and 2009. In line with global peers, the central bank cut interest rates aggressively and the government developed fiscal stimulus measures. The economy pulled out of recession in 2009, and achieved 3% growth from 2011 to 2017. Nevertheless, key trade sectors remain vulnerable to weak external demand and lower commodity prices. In the aftermath of the 2010 Canterbury earthquakes, the government has continued programs to expand export markets, develop capital markets, invest in innovation, raise productivity growth, and develop infrastructure, while easing its fiscal austerity. Expanding New Zealand’s network of free trade agreements remains a top foreign policy priority.', '$200.8 billion (2016 est.)', 'dairy products, sheep, beef, poultry, fruit, vegetables, wine, seafood, wheat and barley', 'agriculture, forestry, fishing, logs and wood articles, manufacturing, mining, construction, financial services, real estate services, tourism', '2.655 million (2017 est.)', 'dairy products, meat and edible offal, logs and wood articles, fruit, crude oil, wine', '42.77 billion kWh (2015 est.)', '34,730 bbl/day (2016 est.)', '117,100 bbl/day (2016 est.)', '4.954 billion cu m (2015 est.)', 'ZK (2016)', '123 (2013)', '-', 'condensate 331 km; gas 1,936 km; liquid petroleum gas 172 km; oil 288 km; refined products 198 km (2013)', '4,128 km', '94,902 km', '-', '2018-02-07 18:03:33', NULL),
(160, 'NI', 'ni', 'Nicaragua', 'The Pacific coast of Nicaragua was settled as a Spanish colony from Panama in the early 16th century. Independence from Spain was declared in 1821 and the country became an independent republic in 1838. Britain occupied the Caribbean Coast in the first half of the 19th century, but gradually ceded control of the region in subsequent decades. Violent opposition to governmental manipulation and corruption spread to all classes by 1978 and resulted in a short-lived civil war that brought the Marxist Sandinista guerrillas led by Daniel ORTEGA Saavedra to power in 1979. Nicaraguan aid to leftist rebels in El Salvador prompted the US to sponsor anti-Sandinista contra guerrillas through much of the 1980s. After losing free and fair elections in 1990, 1996, and 2001, former Sandinista President Daniel ORTEGA was elected president in 2006, 2011, and most recently in 2016. Municipal, regional, and national-level elections since 2008 have been marred by widespread irregularities. Nicaragua''s infrastructure and economy - hard hit by the earlier civil war and by Hurricane Mitch in 1998 - are being rebuilt, but democratic institutions have weakened under the ORTEGA administration as the president has garnered full control over all four branches of government: the presidency, the judicial, the National Assembly, and the Supreme Electoral Council.', 'Central America and the Caribbean', '12 08 N, 86 15 W', '130,370 sq km', '6,025,951 (July 2017 est.)', 'Nicaraguan(s)', 'mestizo (mixed Amerindian and white) 69%, white 17%, black 9%, Amerindian 5%', 'Spanish (official) 95.3%, Miskito 2.2%, Mestizo of the Caribbean coast 2%, other 0.5%', 'Roman Catholic 51.6%, Evangelical 33.9%, other 1.5%, unspecified 12.9%, none 0.2% (2016 est.)', 'Republic of Nicaragua', 'presidential republic', 'Managua', '15 departments (departamentos, singular - departamento) and 2 autonomous regions* (regiones autonomistas, singular - region autonoma); Boaco, Carazo, Chinandega, Chontales, Costa Caribe Norte*, Costa Caribe Sur*, Esteli, Granada, Jinotega, Leon, Madriz, Managua, Masaya, Matagalpa, Nueva Segovia, Rio San Juan, Rivas', '15 September 1821 (from Spain)', 'Nicaragua, the poorest country in Central America and the second poorest in the Western Hemisphere, has widespread underemployment and poverty. GDP growth of 4.5% in 2017 was insufficient to make a significant difference. Textiles and agriculture combined account for nearly 50% of Nicaragua''s exports. Beef, coffee, and gold are Nicaragua’s top three export commodities.\r\nThe Dominican Republic-Central America-United States Free Trade Agreement has been in effect since April 2006 and has expanded export opportunities for many Nicaraguan agricultural and manufactured goods.\r\nIn 2013, the government granted a 50-year concession with the option for an additional 50 years to a newly formed Chinese-run company to finance and build an inter-oceanic canal and related projects, at an estimated cost of $50 billion. The canal construction has not started.', '$13.69 billion (2016 est.)', 'coffee, bananas, sugarcane, rice, corn, tobacco, cotton, sesame, soya, beans, beef, veal, pork, poultry, dairy products, shrimp, lobsters, peanuts', 'food processing, chemicals, machinery and metal products, knit and woven apparel, petroleum refining and distribution, beverages, footwear, wood, electric wire harness manufacturing, mining', '3.046 million (2017 est.)', 'coffee, beef, gold, sugar, peanuts, shrimp and lobster, tobacco, cigars, automobile wiring harnesses, textiles, apparel', '3.218 billion kWh (2016 est.)', '0 bbl/day (2016 est.)', '14,260 bbl/day (2014 est.)', '0 cu m (2016 est.)', 'YN (2016)', '147 (2013)', '-', 'oil 54 km (2013)', '-', '23,897 km', '2,220 km (navigable waterways as well as the use of the large Lake Managua and Lake Nicaragua; rivers serve only the sparsely populated eastern part of the country) (2011)', '2018-02-07 18:03:33', NULL),
(161, 'NE', 'ne', 'Niger', 'Niger became independent from France in 1960 and experienced single-party and military rule until 1991, when Gen. Ali SAIBOU was forced by public pressure to allow multiparty elections, which resulted in a democratic government in 1993. Political infighting brought the government to a standstill and in 1996 led to a coup by Col. Ibrahim BARE. In 1999, BARE was killed in a counter coup by military officers who restored democratic rule and held elections that brought Mamadou TANDJA to power in December of that year. TANDJA was reelected in 2004 and in 2009 spearheaded a constitutional amendment allowing him to extend his term as president. In February 2010, military officers led a coup that deposed TANDJA and suspended the constitution. ISSOUFOU Mahamadou was elected in April 2011 following the coup and reelected to a second term in early 2016. Niger is one of the poorest countries in the world with minimal government services and insufficient funds to develop its resource base. The largely agrarian and subsistence-based economy is frequently disrupted by extended droughts common to the Sahel region of Africa. A Tuareg rebellion emerged in 2007 and ended in 2009. Niger is facing increased security concerns on its borders from various external threats including insecurity in Libya, spillover from the conflict in Mali, and violent extremism in northeastern Nigeria.', 'Africa', '13 31 N, 2 07 E', '1.267 million sq km', '19,245,344 (July 2017 est.)', 'Nigerien(s)', 'Hausa 53.1%, Zarma/Songhai 21.2%, Tuareg 11%, Fulani (Peul) 6.5%, Kanuri 5.9%, Gurma 0.8%, Arab 0.4%, Tubu 0.4%, other/unavailable 0.9% (2006 est.)', 'French (official), Hausa, Djerma', 'Muslim 80%, other (includes indigenous beliefs and Christian) 20%', 'Republic of Niger', 'semi-presidential republic', 'Niamey', '7 regions (regions, singular - region) and 1 capital district* (communaute urbaine); Agadez, Diffa, Dosso, Maradi, Niamey*, Tahoua, Tillaberi, Zinder', '3 August 1960 (from France)', 'Niger is a landlocked, sub-Saharan nation, whose economy centers on subsistence crops, livestock, and some of the world''s largest uranium deposits. Agriculture contributes approximately 25% of GDP and provides livelihood for 87% of the population. The UN ranked Niger as the second least developed country in the world in 2016 due to multiple factors such as food insecurity, lack of industry, high population growth, a weak educational sector, and few prospects for work outside of subsistence farming and herding.\r\nSince 2011 public debt has increased due to efforts to scale-up public investment, particularly that related to infrastructure, as well as due to increased security spending. The government relies on foreign donor resources for a large portion of its fiscal budget. The economy in recent years has been hurt by terrorist activity and kidnappings near its uranium mines and by instability in Mali and in the Diffa region of the country; concerns about security have resulted in increased support from regional and international partners on defense. Low uranium prices, demographics, and security expenditures may continue to put pressure on the government’s finances.\r\nFuture growth may be sustained by exploitation of oil, gold, coal, and other mineral resources. Although Niger has sizable reserves of oil, the prolonged drop in oil prices has reduced profitability. Food insecurity and drought remain perennial problems for Niger, and the government plans to invest more in irrigation. Niger’s three-year $131 million IMF Extended Credit Facility (ECF) agreement for the years 2012-15 was extended until the end of 2016. In February 2017, the IMF approved a new 3-year $134 million ECF. A $437 million Millennium Challenge Account compact for Niger, commencing in FY17, will focus on large-scale irrigation infrastructure development and community-based, climate-resilient agriculture, while promoting sustainable increases in agricultural productivity and sales.\r\nFormal private sector investment needed for economic diversification and growth remains a challenge, given the country’s limited domestic markets, access to credit, and competitiveness. Although President ISSOUFOU is courting foreign investors, including those from the US, as of April 2017, there were no US firms operating in Niger.', '$7.892 billion (2016 est.)', 'cowpeas, cotton, peanuts, millet, sorghum, cassava (manioc, tapioca), rice; cattle, sheep, goats, camels, donkeys, horses, poultry', 'uranium mining, petroleum, cement, brick, soap, textiles, food processing, chemicals, slaughterhouses', '6.5 million (2017 est.)', 'uranium ore, livestock, cowpeas, onions', '499.4 million kWh (2015 est.)', '13,000 bbl/day (2016 est.)', '16,570 bbl/day (2014 est.)', '0 cu m (2016 est.)', '5U (2016)', '30 (2013)', '1 (2013)', '-', '-', '18,949 km', '300 km (the Niger, the only major river, is navigable to Gaya between September and March) (2012)', '2018-02-07 18:03:33', NULL),
(162, 'NG', 'ng', 'Nigeria', 'British influence and control over what would become Nigeria and Africa''s most populous country grew through the 19th century. A series of constitutions after World War II granted Nigeria greater autonomy. After independence in 1960, politics were marked by coups and mostly military rule, until the death of a military head of state in 1998 allowed for a political transition. In 1999, a new constitution was adopted and a peaceful transition to civilian government was completed. The government continues to face the daunting task of institutionalizing democracy and reforming a petroleum-based economy, whose revenues have been squandered through corruption and mismanagement. In addition, Nigeria continues to experience longstanding ethnic and religious tensions. Although both the 2003 and 2007 presidential elections were marred by significant irregularities and violence, Nigeria is currently experiencing its longest period of civilian rule since independence. The general elections of April 2007 marked the first civilian-to-civilian transfer of power in the country''s history and the elections of 2011 were generally regarded as credible. The 2015 election is considered the most well run in Nigeria since the return to civilian rule, with the umbrella opposition party, the All Progressives Congress, defeating the long-ruling People''s Democratic Party that had governed since 1999.', 'Africa', '9 05 N, 7 32 E', '923,768 sq km', '190,632,261', 'Nigerian(s)', 'Nigeria, Africa''s most populous country, is composed of more than 250 ethnic groups; the most populous and politically influential are: Hausa and the Fulani 29%, Yoruba 21%, Igbo (Ibo) 18%, Ijaw 10%, Kanuri 4%, Ibibio 3.5%, Tiv 2.5%', 'English (official), Hausa, Yoruba, Igbo (Ibo), Fulani, over 500 additional indigenous languages', 'Muslim 50%, Christian 40%, indigenous beliefs 10%', 'Federal Republic of Nigeria', 'federal presidential republic', 'Abuja', '36 states and 1 territory*; Abia, Adamawa, Akwa Ibom, Anambra, Bauchi, Bayelsa, Benue, Borno, Cross River, Delta, Ebonyi, Edo, Ekiti, Enugu, Federal Capital Territory*, Gombe, Imo, Jigawa, Kaduna, Kano, Katsina, Kebbi, Kogi, Kwara, Lagos, Nasarawa, Niger, Ogun, Ondo, Osun, Oyo, Plateau, Rivers, Sokoto, Taraba, Yobe, Zamfara', '1 October 1960 (from the UK)', 'Nigeria is one of Sub Saharan Africa’s largest economies and relies heavily on oil as its main source of foreign exchange earnings and government revenues. Following the 2008-09 global financial crises, the banking sector was effectively recapitalized and regulation enhanced. Since then, Nigeria’s economic growth has been driven by growth in agriculture, telecommunications, and services. Economic diversification and strong growth have not translated into a significant decline in poverty levels; however, over 62% of Nigeria''s 170 million people still live in extreme poverty.\r\nDespite its strong fundamentals, oil-rich Nigeria has been hobbled by inadequate power supply, lack of infrastructure, delays in the passage of legislative reforms, an inefficient property registration system, restrictive trade policies, an inconsistent regulatory environment, a slow and ineffective judicial system, unreliable dispute resolution mechanisms, insecurity, and pervasive corruption. Regulatory constraints and security risks have limited new investment in oil and natural gas, and Nigeria''s oil production had been contracting every year since 2012 until a slight rebound in 2017.\r\nPresident BUHARI, elected in March 2015, has established a cabinet of economic ministers that includes several technocrats, and he has announced plans to increase transparency, diversify the economy away from oil, and improve fiscal management, but his reliance on the Central Bank governor has led to overwhelmingly protectionist policies aimed at defending the naira from further devaluation. President BUHARI ran on an anti-corruption platform, and has made some headway in alleviating corruption, such as an implementation of a Treasury Single Account that allows the government to better manage its resources. The government also is working to develop stronger public-private partnerships for roads, agriculture, and power.\r\nPartly because of lower oil prices, Nigeria entered a recession in 2016. However, GDP growth turned positive, with oil prices recovering and output stabilizing in 2017.', '$394.8 billion (2016 est.)', 'cocoa, peanuts, cotton, palm oil, corn, rice, sorghum, millet, cassava (manioc, tapioca), yams, rubber; cattle, sheep, goats, pigs; timber; fish', 'crude oil, coal, tin, columbite; rubber products, wood; hides and skins, textiles, cement and other construction materials, food products, footwear, chemicals, fertilizer, printing, ceramics, steel', '60.08 million (2017 est.)', 'petroleum and petroleum products 95%, cocoa, rubber (2012 est.)', '29.83 billion kWh (2015 est.)', '1.871 million bbl/day (2016 est.)', '70,140 bbl/day (2014 est.)', '45.15 billion cu m (2015 est.)', '5N (2016)', '54 (2013)', '5 (2013)', 'condensate 124 km; gas 4,045 km; liquid petroleum gas 164 km; oil 4,441 km; refined products 3,940 km (2013)', '3,798 km', '193,200 km', '8,600 km (Niger and Benue Rivers and smaller rivers and creeks) (2011)', '2018-02-07 18:03:33', NULL),
(163, 'NU', 'nu', 'Niue', 'Niue''s remoteness, as well as cultural and linguistic differences between its Polynesian inhabitants and those of the adjacent Cook Islands, has caused it to be separately administered by New Zealand. The population of the island continues to drop (from a peak of 5,200 in 1966 to 1,618 in 2017) with substantial emigration to New Zealand 2,400 km to the southwest.', 'Oceania', '19 02 S, 169 52 W', '260 sq km', '1,618 (July 2017 est.)', 'Niuean(s)', 'Niuen 66.5%, part-Niuen 13.4%, non-Niuen 20.1% (includes 12% European and Asian and 8% Pacific Islanders) (2011 est.)', 'Niuean (official) 46% (a Polynesian language closely related to Tongan and Samoan), Niuean and English 32%, English (official) 11%, Niuean and others 5%, other 6% (2011 est.)', 'Ekalesia Niue (Congregational Christian Church of Niue - a Protestant church founded by missionaries from the London Missionary Society) 67%, other Protestant 3% (includes Seventh Day Adventist 1%, Presbyterian 1%, and Methodist 1%), Mormon 10%, Roman Catholic 10%, Jehovah''s Witnesses 2%, other 6%, none 2% (2011 est.)', 'none', 'self-governing parliamentary democracy (Fouo Ekepule) in free association with New Zealand', 'Alofi', 'none; note - there are no first-order administrative divisions as defined by the US Government, but there are 14 villages at the second order', '19 October 1974 (Niue became a self-governing state in free association with New Zealand)', 'The economy suffers from the typical Pacific island problems of geographic isolation, few resources, and a small population. The agricultural sector consists mainly of subsistence gardening, although some cash crops are grown for export. Industry consists primarily of small factories for processing passion fruit, lime oil, honey, and coconut cream. The sale of postage stamps to foreign collectors is an important source of revenue.\r\nGovernment expenditures regularly exceed revenues, and the shortfall is made up by critically needed grants from New Zealand that are used to pay wages to public employees. Economic aid allocation from New Zealand in FY13/14 was US$10.1 million. Niue has cut government expenditures by reducing the public service by almost half.\r\nThe island in recent years has suffered a serious loss of population because of emigration to New Zealand. Efforts to increase GDP include the promotion of tourism and financial services, although the International Banking Repeal Act of 2002 resulted in the termination of all offshore banking licenses.', '$10.01 million (2003)', 'coconuts, passion fruit, honey, limes, taro, yams, cassava (manioc, tapioca), sweet potatoes; pigs, poultry, beef cattle', 'handicrafts, food processing', '663 (2001)', 'canned coconut cream, copra, honey, vanilla, passion fruit products, pawpaws, root crops, limes, footballs, stamps, handicrafts', '3 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '-', '1 (2013)', '-', '-', '-', '234 km', '-', '2018-02-07 18:03:33', NULL),
(164, 'NF', 'nf', 'Norfolk Island', 'Two British attempts at establishing the island as a penal colony (1788-1814 and 1825-55) were ultimately abandoned. In 1856, the island was resettled by Pitcairn Islanders, descendants of the Bounty mutineers and their Tahitian companions.', 'Oceania', '29 03 S, 167 58 E', '36 sq km', '1,748 (2016 est.)', 'Norfolk Islander(s)', 'Australian 79.5%, New Zealander 13.3%, Fijian 2.5%, Filipino 1.1%, English 1%, other 1.8%, unspecified 0.8% (2011 est.)', 'English (official) 67.6%, other 32.4% (includes Norfolk 23.7% - also known as Norfuk or Norf''k - which is a mixture of 18th century English and ancient Tahitian) (2011 est.)', 'Protestant 49.6% (Anglican 33.6%, Uniting Church in Australia 12.8%, Seventh Day Adventist 3.2%), Roman Catholic 11.7%, other 8.6%, none 23.5%, unspecified 6.6% (2011 est.)', 'Territory of Norfolk Island', 'non-self-governing overseas territory of Australia; note - the Norfolk Island Regional Council, whic', 'Kingston', 'none (territory of Australia)', 'none (territory of Australia)', 'Norfolk Island is suffering from a severe economic downturn. Tourism, the primary economic activity, is the main driver of economic growth. The agricultural sector has become self-sufficient in the production of beef, poultry, and eggs.', '-', 'Norfolk Island pine seed, Kentia palm seed, cereals, vegetables, fruit; cattle, poultry', 'tourism, light industry, ready mixed concrete', '978 (2006)', 'postage stamps, seeds of the Norfolk Island pine and Kentia palm, small quantities of avocados', '-', '-', '-', '-', '-', '1 (2013)', '-', '-', '-', '80 km', '-', '2018-02-07 18:03:33', NULL),
(165, 'KP', 'kp', 'North Korea', 'An independent kingdom for much of its long history, Korea was occupied by Japan beginning in 1905 following the Russo-Japanese War. Five years later, Japan formally annexed the entire peninsula. Following World War II, Korea was split with the northern half coming under Soviet-sponsored communist control. After failing in the Korean War (1950-53) to conquer the US-backed Republic of Korea (ROK) in the southern portion by force, North Korea (DPRK), under its founder President KIM Il Sung, adopted a policy of ostensible diplomatic and economic "self-reliance" as a check against outside influence. The DPRK demonized the US as the ultimate threat to its social system through state-funded propaganda, and molded political, economic, and military policies around the core ideological objective of eventual unification of Korea under Pyongyang''s control. KIM Il Sung''s son, KIM Jong Il, was officially designated as his father''s successor in 1980, assuming a growing political and managerial role until the elder KIM''s death in 1994. KIM Jong Un was publicly unveiled as his father''s successor in 2010.\r\nFollowing KIM Jong Il''s death in 2011, KIM Jong Un quickly assumed power and has now taken on most of his father''s former titles and duties. After decades of economic mismanagement and resource misallocation, the DPRK since the mid-1990s has faced chronic food shortages. In recent years, the North’s domestic agricultural production has increased, but still falls far short of producing sufficient food to provide for its entire population. The DPRK began to ease restrictions to allow semi-private markets, starting in 2002, but has made few other efforts to meet its goal of improving the overall standard of living. North Korea''s history of regional military provocations; proliferation of military-related items; long-range missile development; WMD programs including tests of nuclear devices in 2006, 2009, 2013, 2016, and 2017; and massive conventional armed forces are of major concern to the international community and have limited the DPRK’s international engagement, particularly economically. The regime abides by a policy calling for the simultaneous development of its nuclear weapons program and its economy.', 'Asia', '40 00 N, 127 00 E', '120,538 sq km', '25,248,140 (July 2017 est.)', 'Korean(s)', 'racially homogeneous; there is a small Chinese community and a few ethnic Japanese', 'Korean', 'traditionally Buddhist and Confucianist, some Christian and syncretic Chondogyo (Religion of the Heavenly Way)', 'Democratic People''s Republic of Korea', 'single-party state; official state ideology of "Juche" or "national self-reliance', 'Pyongyang', '9 provinces (do, singular and plural) and 3 cities (si, singular and plural)\r\nprovinces: Chagang, Hambuk (North Hamgyong), Hamnam (South Hamgyong), Hwangbuk (North Hwanghae), Hwangnam (South Hwanghae), Kangwon, P''yongbuk (North Pyongan), P''yongnam (South Pyongan), Ranggang\r\ncities: Namp''o, P''yongyang, Rason', '15 August 1945 (from Japan)', 'North Korea, one of the world''s most centrally directed and least open economies, faces chronic economic problems. Industrial capital stock is nearly beyond repair as a result of years of underinvestment, shortages of spare parts, and poor maintenance. Large-scale military spending and development of its ballistic missile and nuclear program severely draws off resources needed for investment and civilian consumption. Industrial and power outputs have stagnated for years at a fraction of pre-1990 levels. Frequent weather-related crop failures aggravated chronic food shortages caused by on-going systemic problems, including a lack of arable land, collective farming practices, poor soil quality, insufficient fertilization, and persistent shortages of tractors and fuel.\r\nThe mid 1990s through mid 2000s were marked by severe famine and widespread starvation. Significant food aid was provided by the international community through 2009. Since that time, food assistance has declined significantly. In the last few years, domestic corn and rice production has improved, although domestic production does not fully satisfy demand. A large portion of the population continues to suffer from prolonged malnutrition and poor living conditions. Since 2002, the government has allowed semi-private markets to begin selling a wider range of goods, allowing North Koreans to partially make up for diminished public distribution system rations. It also implemented changes in the management process of communal farms in an effort to boost agricultural output.\r\nIn December 2009, North Korea carried out a redenomination of its currency, capping the amount of North Korean won that could be exchanged for the new notes, and limiting the exchange to a one-week window. A concurrent crackdown on markets and foreign currency use yielded severe shortages and inflation, forcing Pyongyang to ease the restrictions by February 2010. In response to the sinking of the South Korean warship Cheonan and the shelling of Yeonpyeong Island in 2010, South Korea’s government cut off most aid, trade, and bilateral cooperation activities. In February 2016, South Korea ceased its remaining bilateral economic activity by closing the Kaesong Industrial Complex in response to North Korea’s fourth nuclear test a month earlier. This nuclear test and another in September 2016 resulted in two United Nations Security Council Resolutions that targeted North Korea’s foreign currency earnings, particularly coal and other mineral exports. Over the last decade, China has been North Korea’s primary trading partner.\r\nThe North Korean Government continues to stress its goal of improving the overall standard of living, but has taken few steps to make that goal a reality for its populace. In 2016, the regime used two mass mobilizations — one totaling 70 days and another 200 days — to spur the population to increase production and complete construction projects quickly. The regime released a five-year economic development strategy in May 2016 that outlined plans for promoting growth across sectors. Firm political control remains the government’s overriding concern, which likely will inhibit formal changes to North Korea’s current economic system.', '$28 billion (2013 est.)', 'rice, corn, potatoes, wheat, soybeans, pulses, beef, pork, eggs', 'military products; machine building, electric power, chemicals; mining (coal, iron ore, limestone, magnesite, graphite, copper, zinc, lead, and precious metals), metallurgy; textiles, food processing; tourism', '14 million', 'minerals, metallurgical products, manufactures (including armaments), textiles, agricultural and fishery products', '13.41 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '11,270 bbl/day (2014 est.)', '0 cu m (2014 est.)', 'P (2016)', '82 (2013)', '23 (2013)', 'oil 6 km (2013)', '7,435 km', '25,554 km', '2,250 km (most navigable only by small craft) (2011)', '2018-02-07 18:03:33', NULL),
(166, 'MP', 'mp', 'Northern Mariana Islands', 'Under US administration as part of the UN Trust Territory of the Pacific, the people of the Northern Mariana Islands decided in the 1970s not to seek independence but instead to forge closer links with the US. Negotiations for territorial status began in 1972. A covenant to establish a commonwealth in political union with the US was approved in 1975, and came into force on 24 March 1976. A new government and constitution went into effect in 1978.', 'Oceania', '15 12 N, 145 45 E', '464 sq km', '52,263 (July 2017 est.)', 'NA (US citizens)', 'Asian 50% (includes Filipino 35.3%, Chinese 6.8%, Korean 4.2%, and other Asian 3.7%), Native Hawaiian or other Pacific Islander 34.9% (includes Chamorro 23.9%, Carolinian 4.6%, and other Native Hawaiian or Pacific Islander 6.4%), other 2.5%, two or more ethnicities or races 12.7% (2010 est.)', 'Philippine languages 32.8%, Chamorro (official) 24.1%, English (official) 17%, other Pacific island languages 10.1%, Chinese 6.8%, other Asian languages 7.3%, other 1.9% (2010 est.)', 'Christian (Roman Catholic majority, although traditional beliefs and taboos may still be found)', 'Commonwealth of the Northern Mariana Islands', 'presidential democracy; a commonwealth in political union with the US', 'Saipan', 'none (commonwealth in political union with the US); there are no first-order administrative divisions as defined by the US Government, but there are 4 municipalities at the second order: Northern Islands, Rota, Saipan, Tinian', 'none (commonwealth in political union with the US)', 'The Northern Mariana Islands'' economy benefits substantially from financial assistance from the US. In fiscal year 2013, federal grants accounted for 35.4% of the Commonwealth’s total revenues. A small agriculture sector consists of cattle ranches and small farms producing coconuts, breadfruit, tomatoes, and melons.\r\nThe Commonwealth’s economy continued to recover in 2013. Real GDP increased 4.4%, following a 2.1% gain in 2012. Economic growth in 2013 reflected increases in consumer spending and exports of services, mainly spending by foreign tourists.\r\nTourism continued to grow in 2013, after posting double-digit growth in 2012. The tourist industry employs approximately a quarter of the work force and accounts for roughly one-fourth of GDP. The Commonwealth is making a concerted effort to broaden its tourism by extending casino gambling from the small Islands of Tinian and Rota to the main Island of Saipan, its political and commercial center.', '$1.232 billion (2013 est.)', 'vegetables and melons, fruits and nuts; ornamental plants; livestock, poultry, eggs; fish and aquaculture products', 'tourism, banking, construction, fishing, handicrafts, other services', '27,970', 'garments', '60,600 kWh (January 2009)', '-', '-', '-', '-', '5 (2013)', '1 (2013)', '-', '-', '536 km (2008)', '-', '2018-02-07 18:03:33', NULL),
(167, 'NO', 'no', 'Norway', 'Two centuries of Viking raids into Europe tapered off following the adoption of Christianity by King Olav TRYGGVASON in 994; conversion of the Norwegian kingdom occurred over the next several decades. In 1397, Norway was absorbed into a union with Denmark that lasted more than four centuries. In 1814, Norwegians resisted the cession of their country to Sweden and adopted a new constitution. Sweden then invaded Norway but agreed to let Norway keep its constitution in return for accepting the union under a Swedish king. Rising nationalism throughout the 19th century led to a 1905 referendum granting Norway independence. Although Norway remained neutral in World War I, it suffered heavy losses to its shipping. Norway proclaimed its neutrality at the outset of World War II, but was nonetheless occupied for five years by Nazi Germany (1940-45). In 1949, Norway abandoned neutrality and became a member of NATO. Discovery of oil and gas in adjacent waters in the late 1960s boosted Norway''s economic fortunes. In referenda held in 1972 and 1994, Norway rejected joining the EU. Key domestic issues include immigration and integration of ethnic minorities, maintaining the country''s extensive social safety net with an aging population, and preserving economic competitiveness.', 'Europe', '62 00 N, 10 00 E', '323,802 sq km', '5,320,045 (July 2017 est.)', 'Norwegian(s)', 'Norwegian 83.2% (includes about 60,000 Sami), other European 8.3%, other 8.5% (2017 est.)', 'Bokmal Norwegian (official), Nynorsk Norwegian (official), small Sami- and Finnish-speaking minorities', 'Church of Norway (Evangelical Lutheran - official) 71.5%, Roman Catholic 2.8%, other Christian 3.9%, Muslim 2.8%, other 2%, unspecified 7.5% (2016 est.)', 'Kingdom of Norway', 'parliamentary constitutional monarchy', 'capital', '19 counties (fylker, singular - fylke); Akershus, Aust-Agder, Buskerud, Finnmark, Hedmark, Hordaland, More og Romsdal, Nordland, Nord-Trondelag, Oppland, Oslo, Ostfold, Rogaland, Sogn og Fjordane, Sor-Trondelag, Telemark, Troms, Vest-Agder, Vestfold', '7 June 1905 (declared the union with Sweden dissolved); 26 October 1905 (Sweden agreed to the repeal of the union)', 'Norway has a stable economy with a vibrant private sector, a large state sector, and an extensive social safety net. Norway opted out of the EU during a referendum in November 1994; nonetheless, as a member of the European Economic Area, it contributes sizably to the EU budget.\r\nThe country is richly endowed with natural resources in addition to oil and gas, including hydropower, fish, forests, and minerals. Norway is a leading producer and the world’s second largest exporter of seafood, after China. The government manages the country’s petroleum resources through extensive regulation. The petroleum sector provides about 9% of jobs, 12% of GDP, 13% of the state’s revenue, and 37% of exports, according to official national estimates. Norway is one of the world''s leading petroleum exporters, though oil production in 2016 was close to 50% below its peak in 2000; annual gas production, conversely, more than doubled over the same time period. After a continual decline from 2001 to 2013, oil production rose in 2016 for the third year running, due to the higher production of existing oil fields and to new fields coming on stream.\r\nIn anticipation of eventual declines in oil and gas production, Norway saves state revenue from petroleum sector activities in the world''s largest sovereign wealth fund, valued at almost $900 billion as of early 2017. To help balance the federal budget each year, the government follows a “fiscal rule,” which states that spending of revenues from petroleum and fund investments shall correspond to the expected real rate of return on the fund, an amount it estimates is sustainable over time. In February 2017, the government revised the expected rate of return for the fund downward from 4% to 3%.\r\nAfter solid GDP growth in the 2004-07 period, the economy slowed in 2008, and contracted in 2009, before returning to modest, positive growth from 2010 to 2017. Lower oil prices in 2015 and 2016 caused growth to slow, increased unemployment, and weakened the Norwegian krone. The latter trend has mitigated the negative impact of lower oil and gas prices by making Norwegian exports cheaper for foreign buyers. The government has expressed willingness to increase public spending from the sovereign wealth fund to help prevent a recession.', '$392.1 billion (2016 est.)', 'barley, wheat, potatoes; pork, beef, veal, milk; fish', 'petroleum and gas, shipping, fishing, aquaculture, food processing, shipbuilding, pulp and paper products, metals, chemicals, timber, mining, textiles', '2.797 million (2017 est.)', 'petroleum and petroleum products, machinery and equipment, metals, chemicals, ships, fish', '149.5 billion kWh (2016 est.)', '1.648 million bbl/day (2016 est.)', '282,400 bbl/day (2016 est.)', '117.2 billion cu m (2015 est.)', 'LN (2016)', '95 (2013)', '1 (2013)', 'gas 8,520 km; oil/condensate 1,304 km (2017)', '4,250 km', '93,870 km (includes 393 km of expressways)', '1,577 km (2010)', '2018-02-07 18:03:33', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(168, 'OM', 'om', 'Oman', 'The inhabitants of the area of Oman have long prospered from Indian Ocean trade. In the late 18th century, the nascent sultanate in Muscat signed the first in a series of friendship treaties with Britain. Over time, Oman''s dependence on British political and military advisors increased, although the Sultanate never became a British colony. In 1970, QABOOS bin Said Al-Said overthrew his father, and has since ruled as sultan, but he has not designated a successor. His extensive modernization program has opened the country to the outside world, while preserving the longstanding close ties with the UK and US. Oman''s moderate, independent foreign policy has sought to maintain good relations with its neighbors and to avoid external entanglements. Inspired by the popular uprisings that swept the Middle East and North Africa beginning in January 2011, some Omanis staged demonstrations, calling for more jobs and economic benefits and an end to corruption. In response to those protester demands, QABOOS in 2011 pledged to implement economic and political reforms, such as granting legislative and regulatory powers to the Majlis al-Shura and increasing unemployment benefits. Additionally, in August 2012, the Sultan announced a royal directive mandating the speedy implementation of a national job creation plan for thousands of public and private sector Omani jobs. As part of the government''s efforts to decentralize authority and allow greater citizen participation in local governance, Oman successfully conducted its first municipal council elections in December 2012. Announced by the Sultan in 2011, the municipal councils have the power to advise the Royal Court on the needs of local districts across Oman''s 11 governorates. The Sultan returned to Oman in March 2015 after eight months in Germany, where he received medical treatment. He has since appeared publicly on a few occasions.', 'Middle East', '21 00 N, 57 00 E', '309,500 sq km', '3,424,386 (July 2017 est.)', 'Omani(s)', 'Arab, Baluchi, South Asian (Indian, Pakistani, Sri Lankan, Bangladeshi), African', 'Arabic (official), English, Baluchi, Urdu, Indian dialects', 'Muslim 85.9%, Christian 6.5%, Hindu 5.5%, Buddhist 0.8%, Jewish <0.1%, other 1%, unaffiliated 0.2% (2010 est.)', 'Sultanate of Oman', 'absolute monarchy', 'Muscat', '11 governorates (muhafazat, singular - muhafaza); Ad Dakhiliyah, Al Buraymi, Al Wusta, Az Zahirah, Janub al Batinah (Al Batinah South), Janub ash Sharqiyah (Ash Sharqiyah South), Masqat (Muscat), Musandam, Shamal al Batinah (Al Batinah North), Shamal ash Sharqiyah (Ash Sharqiyah North), Zufar (Dhofar)', '1650 (expulsion of the Portuguese)', 'Oman is heavily dependent on its dwindling oil resources, which generate 84% of government revenue. In 2016, low global oil prices drove Oman’s budget deficit to $11.5 billion, or approximately 19% of GDP, but the budget deficit was reduced to 13% of GDP in 2017 as Oman reduced government subsidies. Oman has limited foreign assets and is issuing debt to cover its deficit.\r\nOman is using enhanced oil recovery techniques to boost production, but has simultaneously pursued a development plan that focuses on diversification, industrialization, and privatization, with the objective of reducing the oil sector''s contribution to GDP from 46% at present to 9% by 2020 in accordance with Oman’s ninth five-year development plan. Tourism and gas-based industries are key components of the government''s diversification strategy.\r\nMuscat also has notably focused on creating more Omani jobs to employ the rising number of nationals entering the workforce. However, high social welfare benefits — that had increased in the wake of the 2011 Arab Spring — have challenged the government''s ability to effectively balance its budget in light of low export oil prices. In response, Omani officials imposed austerity measures to its gasoline and diesel subsidies in 2016, with further subsidy cuts planned for electricity and liquid petroleum gas. The spending cuts have faced some public opposition, which could hinder their implementation.', '$71.93 billion (2016 est.)', 'dates, limes, bananas, alfalfa, vegetables; camels, cattle; fish', 'crude oil production and refining, natural and liquefied natural gas production; construction, cement, copper, steel, chemicals, optic fiber', '968,800', 'petroleum, reexports, fish, metals, textiles', '30.79 billion kWh (2015 est.)', '1.007 million bbl/day (2016 est.)', '224,000 bbl/day (2014 est.)', '29.93 billion cu m (2015 est.)', 'A4O (2016)', '132 (2013)', '3 (2013)', 'condensate 106 km; gas 4,224 km; oil 3,558 km; oil/gas/water 33 km; refined products 264 km (2013)', '-', '60,230 km', '-', '2018-02-07 18:03:33', NULL),
(169, 'PK', 'pk', 'Pakistan', 'The Indus Valley civilization, one of the oldest in the world and dating back at least 5,000 years, spread over much of what is presently Pakistan. During the second millennium B.C., remnants of this culture fused with the migrating Indo-Aryan peoples. The area underwent successive invasions in subsequent centuries from the Persians, Greeks, Scythians, Arabs (who brought Islam), Afghans, and Turks. The Mughal Empire flourished in the 16th and 17th centuries; the British came to dominate the region in the 18th century. The separation in 1947 of British India into the Muslim state of Pakistan (with West and East sections) and largely Hindu India was never satisfactorily resolved, and India and Pakistan fought two wars and a limited conflict - in 1947-48, 1965, and 1999 respectively - over the disputed Kashmir territory. A third war between these countries in 1971 - in which India capitalized on Islamabad''s marginalization of Bengalis in Pakistani politics - resulted in East Pakistan becoming the separate nation of Bangladesh.\r\nIn response to Indian nuclear weapons testing, Pakistan conducted its own tests in mid-1998. India-Pakistan relations improved in the mid-2000s but have been rocky since the November 2008 Mumbai attacks and have been further strained by attacks in India by militants suspected of being based in Pakistan. Nawaz SHARIF took office as prime minister in 2013, marking the first time in Pakistani history that a democratically elected government completed a full term and transitioned to a successive democratically elected government. In July 2017, the Supreme Court disqualified SHARIF from public office, and Shahid Khaqan ABBASI replaced him as prime minister in August. Pakistan has been engaged in a decades-long armed conflict with militant groups that target government institutions and civilians, including the Tehrik-e-Taliban Pakistan (TTP) and other militant networks.', 'Asia', '30 00 N, 70 00 E', '796,095 sq km', '204,924,861 (July 2017 est.)', 'Pakistani(s)', 'Punjabi 44.7%, Pashtun (Pathan) 15.4%, Sindhi 14.1%, Sariaki 8.4%, Muhajirs 7.6%, Balochi 3.6%, other 6.3%', 'Punjabi 48%, Sindhi 12%, Saraiki (a Punjabi variant) 10%, Pashto (alternate name, Pashtu) 8%, Urdu (official) 8%, Balochi 3%, Hindko 2%, Brahui 1%, English (official; lingua franca of Pakistani elite and most government ministries), Burushaski, and other 8%', 'Muslim (official) 96.4% (Sunni 85-90%, Shia 10-15%), other (includes Christian and Hindu) 3.6% (2010 est.)', 'Islamic Republic of Pakistan', 'federal parliamentary republic', 'Islamabad', '4 provinces, 1 territory*, and 1 capital territory**; Balochistan, Federally Administered Tribal Areas*, Islamabad Capital Territory**, Khyber Pakhtunkhwa (formerly North-West Frontier Province), Punjab, Sindh\r\nnote: the Pakistani-administered portion of the disputed Jammu and Kashmir region consists of 2 administrative entities: Azad Kashmir and Gilgit-Baltistan', '14 August 1947 (from British India)', 'Decades of internal political disputes and low levels of foreign investment have led to underdevelopment in Pakistan. Pakistan has a large English-speaking population. A challenging security environment, electricity shortages, and a burdensome investment climate have deterred investors. Agriculture accounts for one-fifth of output and two-fifths of employment. Textiles and apparel account for more than half of Pakistan''s export earnings; Pakistan''s failure to diversify its exports has left the country vulnerable to shifts in world demand. Pakistan’s GDP growth has gradually increased since 2012. Official unemployment was 6% in 2017, but this fails to capture the true picture, because much of the economy is informal and underemployment remains high. Human development continues to lag behind most of the region.\r\nIn 2013, Pakistan embarked on a $6.3 billion IMF Extended Fund Facility, which focused on reducing energy shortages, stabilizing public finances, increasing revenue collection, and improving its balance of payments position. The program concluded in September 2016. Although Pakistan missed several structural reform criteria, it restored macroeconomic stability, improved its credit rating, and boosted growth. The Pakistani rupee, after heavy depreciation in 2013, remained relatively stable against the US dollar in 2015-17. Balance of payments concerns have reemerged, however, as a result of increased imports and declining remittances.\r\nPakistan must continue to address several longstanding issues, including expanding investment in education and healthcare, adapting to the effects of climate change and natural disasters, improving the country’s business environment, reducing dependence on foreign donors, and widening the country’s tax base. Given demographic challenges, Pakistan’s leadership will be pressed to implement economic reforms, promote further development of the energy sector, and attract foreign investment to support sufficient economic growth necessary to employ its growing and rapidly urbanizing population, much of which is under the age of 25.\r\nIn an effort to boost development, Pakistan and China are implementing the “China-Pakistan Economic Corridor,” with $60 billion in investments targeted towards energy and other infrastructure projects. Pakistan believes CPEC investments will enable growth rates of over 6% of GDP by laying the groundwork for increased exports. CPEC-related obligations, however, have raised IMF concern that capital outflows that will begin to increase in 2020.', '$278.9 billion (2015 est.)', 'cotton, wheat, rice, sugarcane, fruits, vegetables; milk, beef, mutton, eggs', 'textiles and apparel, food processing, pharmaceuticals, surgical instruments, construction materials, paper products, fertilizer, shrimp', '63.89 million', 'textiles (garments, bed linen, cotton cloth, yarn), rice, leather goods, sporting goods, chemicals, manufactures, surgical instruments, carpets and rugs', '104.5 billion kWh (2015 est.)', '85,500 bbl/day (2016 est.)', '259,500 bbl/day (2014 est.)', '39.3 billion cu m (2015 est.)', 'AP (2016)', '151 (2013)', '23 (2013)', 'gas 12,646 km; oil 2,576 km; refined products 1,087 km (2013)', '11,881 km', '263,942 km', '-', '2018-02-07 18:03:33', NULL),
(170, 'PW', 'pw', 'Palau', 'After three decades as part of the UN Trust Territory of the Pacific under US administration, this westernmost cluster of the Caroline Islands opted for independence in 1978 rather than join the Federated States of Micronesia. A Compact of Free Association with the US was approved in 1986 but not ratified until 1993. It entered into force the following year when the islands gained independence.', 'Oceania', '7 30 N, 134 30 E', '459 sq km', 'most of the population is located on the southern end of the main island of Babelthuap', 'Palauan(s)', 'Palauan (Micronesian with Malayan and Melanesian admixtures) 73%, Carolinian 2%, Asian 21.7%, caucasian 1.2%, other 2.1% (2015 est.)', 'Palauan (official on most islands) 65.2%, other Micronesian 1.9%, English (official) 19.1%, Filipino 9.9%, Chinese 1.2%, other 2.8%', 'Roman Catholic 45.3%, Protestant 34.9% (includes Evangelical 26.4%, Seventh Day Adventist 6.9%, Assembly of God .9%, Baptist .7%), Modekngei 5.7% (indigenous to Palau), Muslim 3%, Mormon 1.5%, other 9.7% (2015 est.)', 'Republic of Palau', 'presidential republic in free association with the US', 'Ngerulmud', '16 states; Aimeliik, Airai, Angaur, Hatohobei, Kayangel, Koror, Melekeok, Ngaraard, Ngarchelong, Ngardmau, Ngatpang, Ngchesar, Ngeremlengui, Ngiwal, Peleliu, Sonsorol', '1 October 1994 (from the US-administered UN trusteeship)', 'The economy is dominated by tourism, fishing, and subsistence agriculture. Government is a major employer of the work force relying on financial assistance from the US under the Compact of Free Association (Compact) with the US that took effect after the end of the UN trusteeship on 1 October 1994. The US provided Palau with roughly $700 million in aid for the first 15 years following commencement of the Compact in 1994 in return for unrestricted access to its land and waterways for strategic purposes. The population enjoys a per capita income roughly double that of the Philippines and much of Micronesia.\r\nBusiness and leisure tourist arrivals reached a record 167,966 in 2015, a 14.4% increase over the previous year, but fell to 138,408 in 2016. Long-run prospects for tourism have been bolstered by the expansion of air travel in the Pacific, the rising prosperity of industrial East Asia, and the willingness of foreigners to finance infrastructure development. Proximity to Guam, the region''s major destination for tourists from East Asia, and a regionally competitive tourist infrastructure enhance Palau''s advantage as a destination.', '$321 million (2016 est.)', 'coconuts, cassava (manioc, tapioca), sweet potatoes; fish, pigs, chickens, eggs, bananas, papaya, breadfruit, calamansi, soursop, Polynesian chestnuts, Polynesian almonds, mangoes, taro, guava, beans, cucumbers, squash/pumpkins (various), eggplant, green onions, kangkong (watercress), cabbages (various), radishes, betel nuts, melons, peppers, noni, okra', 'tourism, fishing, subsistence agriculture', '11,610 (2016)', 'shellfish, tuna, other fish (many species)', '-', '-', '-', '-', '-', '3 (2013)', '-', '-', '-', '-', '-', '2018-02-07 18:03:33', NULL),
