(172, 'PA', 'pa', 'Panama', 'Explored and settled by the Spanish in the 16th century, Panama broke with Spain in 1821 and joined a union of Colombia, Ecuador, and Venezuela - named the Republic of Gran Colombia. When the latter dissolved in 1830, Panama remained part of Colombia. With US backing, Panama seceded from Colombia in 1903 and promptly signed a treaty with the US allowing for the construction of a canal and US sovereignty over a strip of land on either side of the structure (the Panama Canal Zone). The Panama Canal was built by the US Army Corps of Engineers between 1904 and 1914. In 1977, an agreement was signed for the complete transfer of the Canal from the US to Panama by the end of the century. Certain portions of the Zone and increasing responsibility over the Canal were turned over in the subsequent decades. With US help, dictator Manuel NORIEGA was deposed in 1989. The entire Panama Canal, the area supporting the Canal, and remaining US military bases were transferred to Panama by the end of 1999. An ambitious expansion project to more than double the Canal''s capacity - by allowing for more Canal transits and larger ships - was carried out between 2007 and 2016.', 'Central America and the Caribbean', '9 00 N, 80 00 W', '75,420 sq km', '3,753,142 (July 2017 est.)', 'Panamanian(s)', 'mestizo (mixed Amerindian and white) 65%, Native American 12.3% (Ngabe 7.6%, Kuna 2.4%, Embera 0.9%, Bugle 0.8%, other 0.4%, unspecified 0.2%), black or African descent 9.2%, mulatto 6.8%, white 6.7% (2010 est.)', 'Spanish (official), indigenous languages (including Ngabere (or Guaymi), Buglere, Kuna, Embera, Wounaan, Naso (or Teribe), and Bri Bri), Panamanian English Creole (similar to Jamaican English Creole; a mixture of English and Spanish with elements of Ngabere; also known as Guari Guari and Colon Creole), English, Chinese (Yue and Hakka), Arabic, French Creole, other (Yiddish, Hebrew, Korean, Japanese)', 'Roman Catholic 85%, Protestant 15%', 'Republic of Panama', 'presidential republic', 'Panama City', '10 provinces (provincias, singular - provincia) and 3 indigenous regions* (comarcas); Bocas del Toro, Chiriqui, Cocle, Colon, Darien, Embera-Wounaan*, Herrera, Guna Yala*, Los Santos, Ngobe-Bugle*, Panama, Panama Oeste, Veraguas', '3 November 1903 (from Colombia; became independent from Spain on 28 November 1821)', 'Panama''s dollar-based economy rests primarily on a well-developed services sector that accounts for more than three-quarters of GDP. Services include operating the Panama Canal, logistics, banking, the Colon Free Trade Zone, insurance, container ports, flagship registry, and tourism and Panama is a center for offshore banking. Panama''s transportation and logistics services sectors, along with infrastructure development projects, have boosted economic growth; however, public debt surpassed $37 billion in 2016 because of excessive government spending and public works projects. The US-Panama Trade Promotion Agreement was approved by Congress and signed into law in October 2011, and entered into force in October 2012.\r\nFuture growth will be bolstered by the Panama Canal expansion project that began in 2007 and was completed in 2016 at a cost of $5.3 billion - about 10-15% of current GDP. The expansion project more than doubled the Canal''s capacity, enabling it to accommodate high-capacity vessels such as tankers and neopanamax vessels that are too large to traverse the existing canal. The US and China are the top users of the Canal.\r\nStrong economic performance has not translated into broadly shared prosperity, as Panama has the second worst income distribution in Latin America. About one-fourth of the population lives in poverty; however, from 2006 to 2012 poverty was reduced by 10 percentage points.', '$59.05 billion (2016 est.)', 'bananas, rice, corn, coffee, sugarcane, vegetables; livestock; shrimp', 'construction, brewing, cement and other construction materials, sugar milling', '1.633 million', 'fruit and nuts, fish, iron and steel waste, wood', '9.724 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'HP (2016)', '117 (2013)', '3 (2013)', 'oil 128 km (2013)', '77 km', '15,137 km', '800 km (includes the 82-km Panama Canal that is being widened) (2011)', '2018-02-07 18:03:33', NULL),
(173, 'PG', 'pg', 'Papua New Guinea', 'The eastern half of the island of New Guinea - second largest in the world - was divided between Germany (north) and the UK (south) in 1885. The latter area was transferred to Australia in 1902, which occupied the northern portion during World War I and continued to administer the combined areas until independence in 1975. A nine-year secessionist revolt on the island of Bougainville ended in 1997 after claiming some 20,000 lives. Since 2001, Bougainville has experienced autonomy. Under the terms of a peace accord, 2015 is the year that a five-year window opens for a referendum on the question of independence.', 'Oceania', '6 00 S, 147 00 E', '462,840 sq km', '6,909,701 (July 2017 est.)', 'Papua New Guinean(s)', 'Melanesian, Papuan, Negrito, Micronesian, Polynesian', 'Tok Pisin (official), English (official), Hiri Motu (official), some 839 indigenous languages spoken (about 12% of the world''s total); many languages have fewer than 1,000 speakers', 'Roman Catholic 27%, Protestant 69.4% (Evangelical Lutheran 19.5%, United Church 11.5%, Seventh-Day Adventist 10%, Pentecostal 8.6%, Evangelical Alliance 5.2%, Anglican 3.2%, Baptist 2.5%, other Protestant 8.9%), Baha''i 0.3%, indigenous beliefs and other 3.3% (2000 census)', 'Independent State of Papua New Guinea', 'parliamentary democracy (National Parliament) under a constitutional monarchy; a Commonwealth realm', 'Port Moresby', '20 provinces, 1 autonomous region*, and 1 district**; Bougainville*, Central, Chimbu, Eastern Highlands, East New Britain, East Sepik, Enga, Gulf, Hela, Jiwaka, Madang, Manus, Milne Bay, Morobe, National Capital**, New Ireland, Northern, Southern Highlands, Western, Western Highlands, West New Britain, West Sepik', '16 September 1975 (from the Australia-administered UN trusteeship)', 'Papua New Guinea (PNG) is richly endowed with natural resources, but exploitation has been hampered by rugged terrain, land tenure issues, and the high cost of developing infrastructure. The economy has a small formal sector, focused mainly on the export of those natural resources, and an informal sector, employing the majority of the population. Agriculture provides a subsistence livelihood for 85% of the people. The global financial crisis had little impact because of continued foreign demand for PNG''s commodities.\r\nMineral deposits, including copper, gold, and oil, account for nearly two-thirds of export earnings. Natural gas reserves amount to an estimated 155 billion cubic meters. Following construction of a $19 billion liquefied natural gas (LNG) project, PNG LNG, a consortium led by ExxonMobil, began exporting liquefied natural gas to Asian markets in May 2014. The project was delivered on time and only slightly above budget. The success of the project has encouraged other companies to look at similar LNG projects. French supermajor Total is expected to begin construction on the Papua LNG project by 2020. Due to lower global commodity prices, resource revenues of all types have fallen dramatically. PNG’s government has recently been forced to adjust spending levels downward.\r\nNumerous challenges still face the government of Peter O''NEILL, including providing physical security for foreign investors, regaining investor confidence, restoring integrity to state institutions, promoting economic efficiency by privatizing moribund state institutions, and maintaining good relations with Australia, its former colonial ruler. Other socio-cultural challenges could upend the economy including chronic law and order and land tenure issues.', '$21.81 billion (2016 est.)', 'coffee, cocoa, copra, palm kernels, tea, sugar, rubber, sweet potatoes, fruit, vegetables, vanilla; poultry, pork; shellfish', 'copra crushing, palm oil processing, plywood production, wood chip production; mining (gold, silver, copper); crude oil and petroleum products; construction, tourism', '3.681 million (2017 est.)', 'oil, gold, copper ore, logs, palm oil, coffee, cocoa, crayfish, prawns', '3.62 billion kWh (2015 est.)', '55,990 bbl/day (2016 est.)', '28,340 bbl/day (2014 est.)', '9.8 billion cu m (2015 est.)', 'P2 (2016)', '561 (2013)', '2 (2013)', 'oil 264 km (2013)', '-', '9,349 km', '11,000 km (2011)', '2018-02-07 18:03:33', NULL),
(174, 'PY', 'py', 'Paraguay', 'Paraguay achieved its independence from Spain in 1811. In the disastrous War of the Triple Alliance (1865-70) - between Paraguay and Argentina, Brazil, and Uruguay - Paraguay lost two-thirds of its adult males and much of its territory. The country stagnated economically for the next half century. Following the Chaco War of 1932-35 with Bolivia, Paraguay gained a large part of the Chaco lowland region. The 35-year military dictatorship of Alfredo STROESSNER ended in 1989, and, despite a marked increase in political infighting in recent years, Paraguay has held relatively free and regular presidential elections since the country''s return to democracy.', 'South America', '23 00 S, 58 00 W', '406,752 sq km', '6,943,739 (July 2017 est.)', 'Paraguayan(s)', 'mestizo (mixed Spanish and Amerindian) 95%, other 5%', 'Spanish (official), Guarani (official)', 'Roman Catholic 89.6%, Protestant 6.2%, other Christian 1.1%, other or unspecified 1.9%, none 1.1% (2002 census)', 'Republic of Paraguay', 'presidential republic', 'Asuncion', '17 departments (departamentos, singular - departamento) and 1 capital city*; Alto Paraguay, Alto Parana, Amambay, Asuncion*, Boqueron, Caaguazu, Caazapa, Canindeyu, Central, Concepcion, Cordillera, Guaira, Itapua, Misiones, Neembucu, Paraguari, Presidente Hayes, San Pedro', '14 May 1811 (from Spain)', 'Landlocked Paraguay has a market economy distinguished by a large informal sector, featuring re-export of imported consumer goods to neighboring countries, as well as the activities of thousands of microenterprises and urban street vendors. A large percentage of the population, especially in rural areas, derives its living from agricultural activity, often on a subsistence basis. Because of the importance of the informal sector, accurate economic measures are difficult to obtain.\r\nOn a per capita basis, real income has grown steadily over the past decade. The economy grew rapidly between 2003 and 2008 as strong world demand for commodities, combined with high prices and favorable weather, supported Paraguay''s commodity-based export expansion. Paraguay is the sixth largest soy producer in the world. Drought hit in 2008, reducing agricultural exports and slowing the economy even before the onset of the global recession. The economy fell 3.8% in 2009, as lower world demand and commodity prices caused exports to contract. Severe drought and outbreaks of hoof-and-mouth disease in 2012 led to a brief drop in beef and other agricultural exports. Since 2014, however, Paraguay’s economy has grown at a 4% average annual rate due to strong production and high global prices, at a time when other countries in the region have contracted.\r\nThe Paraguayan Government recognizes the need to diversify its economy and has taken steps in recent years to do so. In addition to looking for new commodity markets in the Middle East and Europe, Paraguayan officials have promoted the country’s low labor costs, cheap energy from its massive Itaipu Hydroelectric Dam, and single-digit tax rate on foreign firms. As a result, the number of factories operating in the country – mostly transplants from Brazil - has tripled since 2014.\r\nPolitical uncertainty, corruption, limited progress on structural reform, and deficient infrastructure are the main obstacles to long-term growth. Paraguay has been adverse to public debt throughout its history, but has recently changed its anti-debt policies to finance infrastructure improvements to attract foreign investment. Judicial corruption is endemic and is seen as the greatest barrier to attracting more foreign investment.', '$28.78 billion (2016 est.)', 'cotton, sugarcane, soybeans, corn, wheat, tobacco, cassava (manioc, tapioca), fruits, vegetables; beef, pork, eggs, milk; timber', 'sugar processing, cement, textiles, beverages, wood products, steel, base metals, electric power', '3.428 million (2017 est.)', 'soybeans, livestock feed, cotton, meat, edible oils, wood, leather, gold', '55.19 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'ZP (2016)', '799 (2013)', '-', '-', '30 km', '32,059 km', '3,100 km (primarily on the Paraguay and Paran? River systems) (2012)', '2018-02-07 18:03:34', NULL),
(175, 'PE', 'pe', 'Peru', 'Ancient Peru was the seat of several prominent Andean civilizations, most notably that of the Incas whose empire was captured by Spanish conquistadors in 1533. Peru declared its independence in 1821, and remaining Spanish forces were defeated in 1824. After a dozen years of military rule, Peru returned to democratic leadership in 1980, but experienced economic problems and the growth of a violent insurgency. President Alberto FUJIMORI''s election in 1990 ushered in a decade that saw a dramatic turnaround in the economy and significant progress in curtailing guerrilla activity. Nevertheless, the president''s increasing reliance on authoritarian measures and an economic slump in the late 1990s generated mounting dissatisfaction with his regime, which led to his resignation in 2000. A caretaker government oversaw a new election in the spring of 2001, which installed Alejandro TOLEDO Manrique as the new head of government - Peru''s first democratically elected president of indigenous ethnicity. The presidential election of 2006 saw the return of Alan GARCIA Perez who, after a disappointing presidential term from 1985 to 1990, oversaw a robust economic rebound. Former army officer Ollanta HUMALA Tasso was elected president in June 2011, and carried on the sound, market-oriented economic policies of the three preceding administrations. Poverty and unemployment levels have fallen dramatically in the last decade, and today Peru boasts one of the best performing economies in Latin America. Pedro Pablo KUCZYNSKI Godard won a very narrow presidential runoff election in June 2016.', 'South America', '10 00 S, 76 00 W', '1,285,216 sq km', '31,036,656 (July 2017 est.)', 'Peruvian(s)', 'Amerindian 45%, mestizo (mixed Amerindian and white) 37%, white 15%, black, Japanese, Chinese, and other 3%', 'Spanish (official) 84.1%, Quechua (official) 13%, Aymara (official) 1.7%, Ashaninka 0.3%, other native languages (includes a large number of minor Amazonian languages) 0.7%, other (includes foreign languages and sign language) 0.2% (2007 est.)', 'Roman Catholic 81.3%, Evangelical 12.5%, other 3.3%, none 2.9% (2007 est.)', 'Republic of Peru', 'presidential republic', 'Lima', '25 regions (regiones, singular - region) and 1 province* (provincia); Amazonas, Ancash, Apurimac, Arequipa, Ayacucho, Cajamarca, Callao, Cusco, Huancavelica, Huanuco, Ica, Junin, La Libertad, Lambayeque, Lima, Lima*, Loreto, Madre de Dios, Moquegua, Pasco, Piura, Puno, San Martin, Tacna, Tumbes, Ucayali\r\nnote: Callao, the largest port in Peru, is also referred to as a constitutional province, the only province of the Callao region', '28 July 1821 (from Spain)', 'Peru''s economy reflects its varied topography - an arid lowland coastal region, the central high sierra of the Andes, and the dense forest of the Amazon. A wide range of important mineral resources are found in the mountainous and coastal areas, and Peru''s coastal waters provide excellent fishing grounds. Peru is the world''s second largest producer of silver and copper.\r\nThe Peruvian economy grew by an average of 5.6% per year from 2009-13 with a stable exchange rate and low inflation. This growth was due partly to high international prices for Peru''s metals and minerals exports, which account for 55% of the country''s total exports. Growth slipped from 2014 to 2017, due to weaker world prices for these resources. Despite Peru''s strong macroeconomic performance, dependence on minerals and metals exports and imported foodstuffs makes the economy vulnerable to fluctuations in world prices.\r\nPeru''s rapid expansion coupled with cash transfers and other programs have helped to reduce the national poverty rate by over 35 percentage points since 2004, but inequality persists and continued to pose a challenge for the Ollanta HUMALA administration, which championed a policy of social inclusion and a more equitable distribution of income. Poor infrastructure hinders the spread of growth to Peru''s non-coastal areas. The HUMALA administration passed several economic stimulus packages in 2014 to bolster growth, including reforms to environmental regulations in order to spur investment in Peru’s lucrative mining sector, a move that was opposed by some environmental groups. However, in 2015, mining investment fell as global commodity prices remained low and social conflicts plagued the sector.\r\nPeru''s free trade policy continued under the HUMALA administration; since 2006, Peru has signed trade deals with the US, Canada, Singapore, China, Korea, Mexico, Japan, the EU, the European Free Trade Association, Chile, Thailand, Costa Rica, Panama, Venezuela, Honduras, concluded negotiations with Guatemala and the Trans-Pacific Partnership, and begun trade talks with El Salvador, India, and Turkey. Peru also has signed a trade pact with Chile, Colombia, and Mexico, called the Pacific Alliance, that seeks integration of services, capital, investment and movement of people. Since the US-Peru Trade Promotion Agreement entered into force in February 2009, total trade between Peru and the US has doubled. President Pedro Pablo KUCZYNSKI succeeded HUMALA in July 2016 and is focusing on economic reforms and free market policies aimed at boosting investment in Peru. Mining output increased significantly in 2016-17, which helped Peru attain one of the highest GDP growth rates in Latin America, and Peru should maintain strong growth in 2018. However, economic performance was depressed by delays in infrastructure mega-projects and the start of a corruption scandal associated with a Brazilian firm. Massive flooding in early 2017 also was a drag on growth, offset somewhat by additional public spending aimed at recovery efforts.', '$210 billion (2016 est.)', 'artichokes, asparagus, avocados, blueberries, coffee, cocoa, cotton, sugarcane, rice, potatoes, corn, plantains, grapes, oranges, pineapples, guavas, bananas, apples, lemons, pears, coca, tomatoes, mangoes, barley, medicinal plants, quinoa, palm oil, marigolds, onions, wheat, dry beans; poultry, beef, pork, dairy products; guinea pigs; fish', 'mining and refining of minerals; steel, metal fabrication; petroleum extraction and refining, natural gas and natural gas liquefaction; fishing and fish processing, cement, glass, textiles, clothing, food processing, beer, soft drinks, rubber, machinery, electrical machinery, chemicals, furniture', '17.03 million', 'copper, gold, lead, zinc, tin, iron ore, molybdenum, silver; crude petroleum and petroleum products, natural gas; coffee, asparagus and other vegetables, fruit, apparel and textiles, fishmeal, fish, chemicals, fabricated metal products and machinery, alloys', '46.31 billion kWh (2015 est.)', '40,270 bbl/day (2016 est.)', '187,200 bbl/day (2014 est.)', '12.62 billion cu m (2015 est.)', 'OB (2016)', '191 (2013)', '5 (2013)', 'extra heavy crude 786 km; gas 1,526 km; liquid petroleum gas 679 km; oil 1,033 km; refined products 15 km (2013)', '1,854.4 km', '140,672 km (18,699 km paved)', '8,808 km (8,600 km of navigable tributaries on the Amazon River system and 208 km on Lago Titicaca) (2011)', '2018-02-07 18:03:34', NULL),
(176, 'PH', 'ph', 'Philippines', 'The Philippine Islands became a Spanish colony during the 16th century; they were ceded to the US in 1898 following the Spanish-American War. In 1935 the Philippines became a self-governing commonwealth. Manuel QUEZON was elected president and was tasked with preparing the country for independence after a 10-year transition. In 1942 the islands fell under Japanese occupation during World War II, and US forces and Filipinos fought together during 1944-45 to regain control. On 4 July 1946 the Republic of the Philippines attained its independence. A 20-year rule by Ferdinand MARCOS ended in 1986, when a "people power" movement in Manila ("EDSA 1") forced him into exile and installed Corazon AQUINO as president. Her presidency was hampered by several coup attempts that prevented a return to full political stability and economic development. Fidel RAMOS was elected president in 1992. His administration was marked by increased stability and by progress on economic reforms. In 1992, the US closed its last military bases on the islands. Joseph ESTRADA was elected president in 1998. He was succeeded by his vice-president, Gloria MACAPAGAL-ARROYO, in January 2001 after ESTRADA''s stormy impeachment trial on corruption charges broke down and another "people power" movement ("EDSA 2") demanded his resignation. MACAPAGAL-ARROYO was elected to a six-year term as president in May 2004. Her presidency was marred by several corruption allegations but the Philippine economy was one of the few to avoid contraction following the 2008 global financial crisis, expanding each year of her administration. Benigno AQUINO III was elected to a six-year term as president in May 2010 and was succeeded by Rodrigo DUTERTE in May 2016.\r\nThe Philippine Government faces threats from several groups, some of which are on the US Government''s Foreign Terrorist Organization list. Manila has waged a decades-long struggle against ethnic Moro insurgencies in the southern Philippines, which has led to a peace accord with the Moro National Liberation Front and ongoing peace talks with the Moro Islamic Liberation Front. The decades-long Maoist-inspired New People''s Army insurgency also operates through much of the country. The Philippines faces increased tension with China over disputed territorial and maritime claims in the South China Sea.', 'Southeast Asia', '13 00 N, 122 00 E', '300,000 sq km', '104,256,076 (July 2017 est.)', 'Filipino(s)', 'Tagalog 28.1%, Cebuano 13.1%, Ilocano 9%, Bisaya/Binisaya 7.6%, Hiligaynon Ilonggo 7.5%, Bikol 6%, Waray 3.4%, other 25.3% (2000 census)', 'Filipino (official; based on Tagalog) and English (official); eight major dialects - Tagalog, Cebuano, Ilocano, Hiligaynon or Ilonggo, Bicol, Waray, Pampango, and Pangasinan', 'Catholic 82.9% (Roman Catholic 80.9%, Aglipayan 2%), Muslim 5%, Evangelical 2.8%, Iglesia ni Kristo 2.3%, other Christian 4.5%, other 1.8%, unspecified 0.6%, none 0.1% (2000 census)', 'Republic of the Philippines', 'presidential republic', 'Manila', '80 provinces and 39 chartered cities\r\nprovinces: Abra, Agusan del Norte, Agusan del Sur, Aklan, Albay, Antique, Apayao, Aurora, Basilan, Bataan, Batanes, Batangas, Biliran, Benguet, Bohol, Bukidnon, Bulacan, Cagayan, Camarines Norte, Camarines Sur, Camiguin, Capiz, Catanduanes, Cavite, Cebu, Compostela, Cotabato, Davao del Norte, Davao del Sur, Davao Oriental, Dinagat Islands, Eastern Samar, Guimaras, Ifugao, Ilocos Norte, Ilocos Sur, Iloilo, Isabela, Kalinga, Laguna, Lanao del Norte, Lanao del Sur, La Union, Leyte, Maguindanao, Marinduque, Masbate, Mindoro Occidental, Mindoro Oriental, Misamis Occidental, Misamis Oriental, Mountain, Negros Occidental, Negros Oriental, Northern Samar, Nueva Ecija, Nueva Vizcaya, Palawan, Pampanga, Pangasinan, Quezon, Quirino, Rizal, Romblon, Samar, Sarangani, Siquijor, Sorsogon, South Cotabato, Southern Leyte, Sultan Kudarat, Sulu, Surigao del Norte, Surigao del Sur, Tarlac, Tawi-Tawi, Zambales, Zamboanga del Norte, Zamboanga del Sur, Zamboanga Sibugay\r\nchartered cities: Angeles, Antipolo, Bacolod, Baguio, Butuan, Cagayan de Oro, Caloocan, Cebu, Cotabato, Dagupan, Davao, General Santos, Iligan, Iloilo, Lapu-Lapu, Las Pinas, Lucena, Makati, Malabon, Mandaluyong, Mandaue, Manila, Marikina, Muntinlupa, Naga, Navotas, Olongapo, Ormoc, Paranaque, Pasay, Pasig, Puerto Princesa, Quezon, San Juan, Santiago, Tacloban, Taguig, Valenzuela, Zamboanga (2012)', '4 July 1946 (from the US)', 'The economy has been relatively resilient to global economic shocks due to less exposure to troubled international securities, lower dependence on exports, relatively resilient domestic consumption, large remittances from about 10 million overseas Filipino workers and migrants, and a rapidly expanding outsourcing industry. During 2016, the current account balance narrowed to its lowest level since the 2008 global financial crisis, but nevertheless mustered a surplus for a 14th consecutive year. International reserves remain at comfortable levels and the banking system is stable.\r\nEfforts to improve tax administration and expenditures management have helped ease the Philippines'' debt burden and tight fiscal situation. The Philippines received investment-grade credit ratings on its sovereign debt under the former AQUINO administration and has had little difficulty financing its budget deficits. However, weak absorptive capacity and implementation bottlenecks have prevented the government from maximizing its expenditure plans. Although it has improved, the low tax-to-GDP ratio remains a constraint to supporting increasingly higher spending levels and sustaining high and inclusive growth over the longer term.\r\nEconomic growth has accelerated, averaging 6.1% per year from 2011 to 2016, compared with 4.5% under the MACAPAGAL-ARROYO government; and competitiveness rankings have improved. Although 2016 saw a record year for net foreign direct investment inflows, FDI to the Philippines has continued to lag regional peers, in part because the Philippine constitution and other laws restrict foreign ownership in important activities/sectors - such as land ownership and public utilities.\r\nAlthough the economy grew at a faster pace under the AQUINO government, challenges to achieving more inclusive growth remain. Wealth is concentrated in the hands of the rich. The unemployment rate declined from 7.3% to 5.5% between 2010 and 2016 but the jobs are low paying and tedious. Underemployment hovers at around 18% to 19% of the employed. At least 40% of the employed work in the informal sector. Poverty afflicts more than a fifth of the population. More than 60% of the poor reside in rural areas, where the incidence of poverty (about 30%) is more severe - a challenge to raising rural farm and non-farm incomes. Continued efforts are needed to improve governance, the judicial system, the regulatory environment, the infrastructure, and the overall ease of doing business.\r\n2016 saw the election of President Rodrigo DUTERTE, who has pledged to make inclusive growth and poverty reduction his top priority. DUTERTE believes that illegal drug use, crime and corruption are key barriers to economic development among the lower income class. This administration wants to reduce the poverty rate to 14% and graduate the economy to upper-middle income status by the end of President DUTERTE’s term in 2022. Key themes under the government’s Ten-Point Socioeconomic Agenda include continuity of macroeconomic policy, tax reform, higher investments in infrastructure and human capital development, and improving competitiveness and the overall ease of doing business. The administration has vowed to address spending bottlenecks and is pushing for congressional passage of a Comprehensive Tax Reform Program to help finance more aggressive infrastructure and social spending, starting in 2018. The government also supports relaxing restrictions on foreign ownership, except for land.', '$304.9 billion (2016 est.)', 'rice, fish, livestock, poultry, bananas, coconut/copra, corn, sugarcane, mangoes, pineapple, cassava', 'semiconductors and electronics assembly, food and beverage manufacturing, construction, electric/gas/water supply, chemical products, radio/television/communications equipment and apparatus, petroleum and fuel, textile and garments, non-metallic minerals, basic metal industries, transport equipment', '43.2 million (2016 est.)', 'semiconductors and electronic products, machinery and transport equipment, wood manufactures, chemicals, processed food and beverages, garments, coconut oil, copper concentrates, seafood, bananas/fruits', '90.8 billion kWh (2016 est.)', '20,000 bbl/day (2016 est.)', '169,000 bbl/day (2014 est.)', '2.6 billion cu m (2015 est.)', 'RP (2016)', '247 (2013)', '2 (2013)', 'gas 530 km (2014); oil 138 km; refined products 185 km (2013)', '995 km', '216,387 km', '3,219 km (limited to vessels with draft less than 1.5 m) (2011)', '2018-02-07 18:03:34', NULL),
(177, 'PN', 'pn', 'Pitcairn Islands', 'Pitcairn Island was discovered in 1767 by the British and settled in 1790 by the Bounty mutineers and their Tahitian companions. Pitcairn was the first Pacific island to become a British colony (in 1838) and today remains the last vestige of that empire in the South Pacific. Outmigration, primarily to New Zealand, has thinned the population from a peak of 233 in 1937 to less than 50 today.', 'Oceania', '25 04 S, 130 06 W', '47 sq km', '54 (July 2016 est.)', 'Pitcairn Islander(s)', 'descendants of the Bounty mutineers and their Tahitian wives', 'English (official), Pitkern (mixture of an 18th century English dialect and a Tahitian dialect)', 'Seventh-Day Adventist 100%', 'Pitcairn, Henderson, Ducie, and Oeno Islands', 'parliamentary democracy (Island Council); overseas territory of the UK', 'Adamstown', 'none (overseas territory of the UK)', 'none (overseas territory of the UK)', 'The inhabitants of this tiny isolated economy exist on fishing, subsistence farming, handicrafts, and postage stamps. The fertile soil of the valleys produces a wide variety of fruits and vegetables, including citrus, sugarcane, watermelons, bananas, yams, and beans. Bartering is an important part of the economy. The major sources of revenue are the sale of postage stamps to collectors and the sale of handicrafts to passing ships.', '-', 'honey; wide variety of fruits and vegetables; goats, chickens; fish', 'postage stamps, handicrafts, beekeeping, honey', '15 (2004)', 'honey, fruits, vegetables, curios, postage stamps', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '2018-02-07 18:03:34', NULL);
