(178, 'PL', 'pl', 'Poland', 'Poland''s history as a state began near the middle of the 10th century. By the mid-16th century, the Polish-Lithuanian Commonwealth ruled a vast tract of land in Central and Eastern Europe. During the 18th century, internal disorders weakened the nation, and in a series of agreements between 1772 and 1795, Russia, Prussia, and Austria partitioned Poland among themselves. Poland regained its independence in 1918 only to be overrun by Germany and the Soviet Union in World War II. It became a Soviet satellite state following the war, but its government was comparatively tolerant and progressive. Labor turmoil in 1980 led to the formation of the independent trade union "Solidarity" that over time became a political force with over 10 million members. Free elections in 1989 and 1990 won Solidarity control of the parliament and the presidency, bringing the communist era to a close. A "shock therapy" program during the early 1990s enabled the country to transform its economy into one of the most robust in Central Europe. Poland joined NATO in 1999 and the EU in 2004. With its transformation to a democratic, market-oriented country largely completed and with large investments in defense, energy, and other infrastructure, Poland is an increasingly active member of Euro-Atlantic organizations.', 'Europe', '52 00 N, 20 00 E', '312,685 sq km', ' 38,476,269 (July 2017 est.)', 'Pole(s)', 'Polish 96.9%, Silesian 1.1%, German 0.2%, Ukrainian 0.1%, other and unspecified 1.7%', 'Polish (official) 98.2%, Silesian 1.4%, other 1.1%, unspecified 1.3%', 'Catholic 87.2% (includes Roman Catholic 86.9% and Greek Catholic, Armenian Catholic, and Byzantine-Slavic Catholic .3%), Orthodox 1.3% (almost all are Polish Autocephalous Orthodox), Protestant 0.4% (mainly Augsburg Evangelical and Pentacostal), other 0.4% (includes Jehovah''s Witness, Buddhist, Hare Krishna, Gaudiya Vaishnavism, Muslim, Jewish, Mormon), unspecified 10.8% (2012 est.)', 'Republic of Poland', 'parliamentary republic', 'Warsaw', '16 provinces (wojewodztwa, singular - wojewodztwo); Dolnoslaskie (Lower Silesia), Kujawsko-Pomorskie (Kuyavia-Pomerania), Lodzkie (Lodz), Lubelskie (Lublin), Lubuskie (Lubusz), Malopolskie (Lesser Poland), Mazowieckie (Masovia), Opolskie (Opole), Podkarpackie (Subcarpathia), Podlaskie, Pomorskie (Pomerania), Slaskie (Silesia), Swietokrzyskie (Holy Cross), Warminsko-Mazurskie (Warmia-Masuria), Wielkopolskie (Greater Poland), Zachodniopomorskie (West Pomerania)', '11 November 1918 (republic proclaimed); notable earlier dates: 966 (adoption of Christianity, traditional founding date), 1 July 1569 (Polish-Lithuanian Commonwealth created)', 'Poland has the sixth-largest economy in the EU and has long had a reputation as a business-friendly country with largely sound macroeconomic policies. Since 1990, Poland has pursued a policy of economic liberalization. During the 2008-09 economic slowdown Poland was the only EU country to avoid a recession, in part because of the government’s loose fiscal policy combined with a commitment to rein in spending in the medium-term Poland is the largest recipient of EU development funds and their cyclical allocation can significantly impact the rate of economic growth.\r\nThe Polish economy performed well during the 2014-17 period, with the real GDP growth rate generally exceeding 3%, in part because of increases in government social spending that have helped to accelerate consumer-driven growth. However, since 2015, Poland has implemented new business restrictions and taxes on foreign-dominated economic sectors, including banking and insurance, energy, and healthcare, that have dampened investor sentiment and has increased the government’s ownership of some firms. The government reduced the retirement age in 2016 and has had mixed success in introducing new taxes and boosting tax compliance to offset the increased costs of social spending programs and relieve upward pressure on the budget deficit. Some credit ratings agencies estimate that Poland during the next few years is at risk of exceeding the EU’s 3%-of-GDP limit on budget deficits, possibly impacting its access to future EU funds. Poland’s economy is projected to perform well in the next few years in part because of an anticipated cyclical increase in the use of its EU development funds and continued, robust household spending.\r\nPoland faces several systemic challenges, which include addressing some of the remaining deficiencies in its road and rail infrastructure, business environment, rigid labor code, commercial court system, government red tape, and burdensome tax system, especially for entrepreneurs. Additional long-term challenges include diversifying Poland’s energy mix, strengthening investments in innovation, research, and development, as well as stemming the outflow of educated young Poles to other EU member states, especially in light of a coming demographic contraction due to emigration, persistently low fertility rates, and the aging of the Solidarity-era baby boom generation.', '$510 billion (2016 est.)', 'potatoes, fruits, vegetables, wheat; poultry, eggs, pork, dairy', 'machine building, iron and steel, coal mining, chemicals, shipbuilding, food processing, glass, beverages, textiles', '17.6 million (2017 est.)', 'machinery and transport equipment 37.8%, intermediate manufactured goods 23.7%, miscellaneous manufactured goods 17.1%, food and live animals 7.6% (2012 est.)', '152.1 billion kWh (2015 est.)', '20,100 bbl/day (2016 est.)', '557,700 bbl/day (2016 est.)', '6.132 billion cu m (2015 est.)', 'SP (2016)', '126 (2013)', '6 (2013)', 'gas 14,198 km; oil 1,374 km; refined products 777 km (2013)', '19,231 km', '417,026 km', '3,997 km (navigable rivers and canals) (2009)', '2018-02-07 18:03:34', NULL),
(179, 'PT', 'pt', 'Portugal', 'Following its heyday as a global maritime power during the 15th and 16th centuries, Portugal lost much of its wealth and status with the destruction of Lisbon in a 1755 earthquake, occupation during the Napoleonic Wars, and the independence of Brazil, its wealthiest colony, in 1822. A 1910 revolution deposed the monarchy; for most of the next six decades, repressive governments ran the country. In 1974, a left-wing military coup installed broad democratic reforms. The following year, Portugal granted independence to all of its African colonies. Portugal is a founding member of NATO and entered the EC (now the EU) in 1986.', 'Europe', '39 30 N, 8 00 W', '92,090 sq km', '10,839,514 (July 2017 est.)', 'Portuguese (singular and plural)', 'homogeneous Mediterranean population; citizens of black African descent who immigrated to mainland during decolonization number less than 100,000; since 1990, East Europeans have entered Portugal', 'Portuguese (official), Mirandese (official, but locally used)', 'Roman Catholic 81%, other Christian 3.3%, other (includes Jewish, Muslim, other) 0.6%, none 6.8%, unspecified 8.3%', 'Portuguese Republic', 'semi-presidential republic', 'Lisbon', '18 districts (distritos, singular - distrito) and 2 autonomous regions* (regioes autonomas, singular - regiao autonoma); Aveiro, Acores (Azores)*, Beja, Braga, Braganca, Castelo Branco, Coimbra, Evora, Faro, Guarda, Leiria, Lisboa (Lisbon), Madeira*, Portalegre, Porto, Santarem, Setubal, Viana do Castelo, Vila Real, Viseu', '1143 (Kingdom of Portugal recognized); 1640 (independence reestablished following 60-years of Spanish rule); 5 October 1910 (republic proclaimed)', 'Portugal has become a diversified and increasingly service-based economy since joining the European Community - the EU''s predecessor - in 1986. Over the following two decades, successive governments privatized many state-controlled firms and liberalized key areas of the economy, including the financial and telecommunications sectors. The country joined the Economic and Monetary Union in 1999 and began circulating the euro on 1 January 2002 along with 11 other EU members.\r\nThe economy grew by more than the EU average for much of the 1990s, but the rate of growth slowed in 2001-08. The economy contracted in 2009, and fell again from 2011 to 2013, as the government implemented spending cuts and tax increases to comply with conditions of an EU-IMF financial rescue package, signed in May 2011. Portugal successfully exited its EU-IMF program in May 2014. A modest recovery gathered steam in 2015 due to strong export performance and a rebound in private consumption. Growth slowed slightly in the first half of 2016, but rebounded in the last two quarters of the year to register at 1.4 percent for the year. Unemployment remains high, at 10.2%, at the end of 2016, but has improved steadily since peaking at 18% in 2013.\r\nThe center-left minority Socialist government has unwound some unpopular austerity measures while managing to remain within most EU fiscal targets. The budget deficit fell from 11.2% of GDP in 2010 to 2.0% in 2016, the country’s lowest since democracy was restored in 1974, and surpassing the EU and IMF projections of 3%. Portugal is expected to exit the EU’s excessive deficit procedure by mid-2017.', '$204.6 billion (2016 est.)', 'grain, potatoes, tomatoes, olives, grapes; sheep, cattle, goats, pigs, poultry, dairy products; fish', 'textiles, clothing, footwear, wood and cork, paper and pulp, chemicals, fuels and lubricants, automobiles and auto parts, base metals, minerals, porcelain and ceramics, glassware, technology, telecommunications; dairy products, wine, other foodstuffs; ship construction and refurbishment; tourism, plastics, financial services, optics', '5.178 million (2016 est.)', 'agricultural products, foodstuffs, wine, oil products, chemical products, plastics and rubber, hides, leather, wood and cork, wood pulp and paper, textile materials, clothing, footwear, machinery and tools, base metals', '49.66 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '308,700 bbl/day (2016 est.)', '0 cu m (2014 est.)', 'CR, CS (2016)', '64 (2013)', '-', 'gas 1,344 km; oil 11 km; refined products 188 km (2013)', '3,075.1 km', '82,900 km', '210 km (on Douro River from Porto) (2011)', '2018-02-07 18:03:34', NULL),
(180, 'PR', 'pr', 'Puerto Rico', 'Populated for centuries by aboriginal peoples, the island was claimed by the Spanish Crown in 1493 following Christopher COLUMBUS'' second voyage to the Americas. In 1898, after 400 years of colonial rule that saw the indigenous population nearly exterminated and African slave labor introduced, Puerto Rico was ceded to the US as a result of the Spanish-American War. Puerto Ricans were granted US citizenship in 1917. Popularly elected governors have served since 1948. In 1952, a constitution was enacted providing for internal self-government. In plebiscites held in 1967, 1993, and 1998, voters chose not to alter the existing political status with the US, but the results of a 2012 vote left open the possibility of American statehood. Economic recession on the island has led to a net population loss since about 2005, as large numbers of residents moved to the US mainland. The trend has accelerated since 2010; in 2014, Puerto Rico experienced a net population loss to the mainland of 64,000, more than double the net loss of 26,000 in 2010. Hurricane Maria struck the island on 20 September 2017 causing catastrophic damage including destruction of the electrical grid that had been cripled by Hurricane Irma just two weeks before. It was the worst storm to hit the island in eight decades and damage is estimated in the tens of billions of dollars.', 'Central America and the Caribbean', '18 15 N, 66 30 W', '9,104 sq km', '3,351,827 (July 2017 est.)', 'Puerto Rican(s) (US citizens)', 'white 75.8%, black/African American 12.4%, other 8.5% (includes American Indian, Alaskan Native, Native Hawaiian, other Pacific Islander, and others), mixed 3.3%', 'Spanish, English', 'Roman Catholic 85%, Protestant and other 15%', 'Commonwealth of Puerto Rico', 'presidential democracy; a self-governing commonwealth in political association with the US', 'San Juan', 'none (territory of the US with commonwealth status); there are no first-order administrative divisions as defined by the US Government, but there are 78 municipalities (municipios, singular - municipio) at the second order; Adjuntas, Aguada, Aguadilla, Aguas Buenas, Aibonito, Anasco, Arecibo, Arroyo, Barceloneta, Barranquitas, Bayamon, Cabo Rojo, Caguas, Camuy, Canovanas, Carolina, Catano, Cayey, Ceiba, Ciales, Cidra, Coamo, Comerio, Corozal, Culebra, Dorado, Fajardo, Florida, Guanica, Guayama, Guayanilla, Guaynabo, Gurabo, Hatillo, Hormigueros, Humacao, Isabela, Jayuya, Juana Diaz, Juncos, Lajas, Lares, Las Marias, Las Piedras, Loiza, Luquillo, Manati, Maricao, Maunabo, Mayaguez, Moca, Morovis, Naguabo, Naranjito, Orocovis, Patillas, Penuelas, Ponce, Quebradillas, Rincon, Rio Grande, Sabana Grande, Salinas, San German, San Juan, San Lorenzo, San Sebastian, Santa Isabel, Toa Alta, Toa Baja, Trujillo Alto, Utuado, Vega Alta, Vega Baja, Vieques, Villalba, Yabucoa, Yauco', 'none (territory of the US with commonwealth status)', 'Puerto Rico had one of the most dynamic economies in the Caribbean region until 2006; however, growth has been negative for each of the last 11 years. The downturn coincided with the phaseout of tax preferences that had led US firms to invest heavily in the Commonwealth since the 1950s, and a steep rise in the price of oil, which generates most of the island''s electricity.\r\nDiminished job opportunities prompted a sharp rise in outmigration, as many Puerto Ricans sought jobs on the US mainland. Unemployment reached 16% in 2011, but declined to 13.7% in December 2014. US minimum wage laws apply in Puerto Rico, hampering job expansion. Per capita income is about two-thirds that of the US mainland.\r\nThe industrial sector greatly exceeds agriculture as the locus of economic activity and income. Tourism has traditionally been an important source of income with estimated arrivals of more than 3.6 million tourists in 2008. Puerto Rico''s merchandise trade surplus is exceptionally strong, with exports nearly 50% greater than imports, and its current account surplus about 10% of GDP.\r\nClosing the budget deficit while restoring economic growth and employment remain the central concerns of the government. The gap between revenues and expenditures amounted to 0.6% of GDP in 2016, although analysts believe that not all expenditures have been accounted for in the budget and a better accounting of costs would yield an overall deficit of roughly 5% of GDP. Public debt declined to 92.5% of GDP in 2016, about $17,000 per person, or nearly three times the per capita debt of the State of Connecticut, the highest in the US. Much of that debt was issued by state-run schools and public corporations, including water and electric utilities. In June 2015, Governor Alejandro GARCIA Padilla announced that the island could not pay back at least $73 billion in debt and that it would seek a deal with its creditors.', '$105 billion (2016 est.)', 'sugarcane, coffee, pineapples, plantains, bananas; livestock products, chickens', 'pharmaceuticals, electronics, apparel, food products, tourism', '1.139 million (December 2014 est)', 'chemicals, electronics, apparel, canned tuna, rum, beverage concentrates, medical equipment', '20.3 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2014 est.)', '-', '29 (2013)', '-', '-', '-', '26,862 km (includes 454 km of expressways) (2012)', '-', '2018-02-07 18:03:34', NULL),
(181, 'QA', 'qa', 'Qatar', 'Ruled by the Al Thani family since the mid-1800s, Qatar within the last 60 years transformed itself from a poor British protectorate noted mainly for pearling into an independent state with significant oil and natural gas revenues. The continuous siphoning off of petroleum revenue through the mid-1990s by Qatari amirs permanently residing in Europe had stunted Qatar’s economic growth. Former amir HAMAD bin Khalifa Al Thani, who overthrew his father in a bloodless coup in 1995, ushered in wide-sweeping political and media reforms, unprecedented economic investment, and a growing Qatari regional leadership role, in part through the creation of the pan-Arab satellite news network Al-Jazeera and Qatar''s mediation of some regional conflicts. In the 2000s, Qatar resolved its longstanding border disputes with both Bahrain and Saudi Arabia and by 2007 had attained the highest per capita income in the world. Qatar did not experience domestic unrest or violence like that seen in other Near Eastern and North African countries in 2010-11, due in part to its immense wealth. In mid-2013, HAMAD peacefully abdicated, transferring power to his son, the current Amir TAMIM bin Hamad. TAMIM remains popular with the Qatari public, having prioritized improving the domestic welfare of Qataris, including establishing advanced healthcare and education systems and expanding the country''s infrastructure in anticipation of Doha''s hosting of the 2022 World Cup.\r\nRecently, Qatar’s relationships with its neighbors have been tense at times. Following the outbreak of regional unrest in 2011, Doha prided itself on its support for many popular revolutions, particularly in Libya and Syria. This stance was to the detriment of Qatar’s relations with Bahrain, Saudi Arabia, and the United Arab Emirates (UAE), which temporarily recalled their respective ambassadors from Doha in March 2014. TAMIM later oversaw a warming of Qatar’s relations with Bahrain, Saudi Arabia, and the UAE in November 2014 following Kuwaiti mediation and signing of the Riyadh Agreement. In June 2017, however, the Quartet — Bahrain, Egypt, Saudi Arabia, and the UAE — cut diplomatic and economic ties with Qatar in response to alleged violations of the agreement.', 'Middle East', '25 30 N, 51 15 E', '11,586 sq km', '2,314,307 (July 2017 est.)', 'Qatari(s)', 'non-Qatari 88.4%, Qatari 11.6% (2015 est.)', 'Arabic (official), English commonly used as a second language', 'Muslim 67.7%, Christian 13.8%, Hindu 13.8%, Buddhist 3.1%, folk religion <.1%, Jewish <.1%, other 0.7%, unaffiliated 0.9% (2010 est.)', 'State of Qatar', 'absolute monarchy', 'Doha', '8 municipalities (baladiyat, singular - baladiyah); Ad Dawhah, Al Khawr wa adh Dhakhirah, Al Wakrah, Ar Rayyan, Ash Shamal, Ash Shihaniyah, Az Za''ayin, Umm Salal', '3 September 1971 (from the UK)', 'Qatar’s oil and natural gas resources are the country’s main economic engine and government revenue source, driving Qatar’s high economic growth and per capita income levels, robust state spending on public entitlements, and booming construction spending, particularly as Qatar prepares to host the World Cup in 2022. Although the government has maintained high capital spending levels for ongoing infrastructure projects, low oil and natural gas prices in recent years have led the Qatari Government to tighten some spending to help stem a $12 billion budget deficit in 2016 - 7.8% of GDP.\r\nQatar’s reliance on oil and natural gas is likely to persist for the foreseeable future. Proved natural gas reserves exceed 25 trillion cubic meters - 13% of the world total and, among countries, third largest in the world. Proved oil reserves exceed 25 billion barrels, allowing production to continue at current levels for about 56 years. Despite the dominance of oil and natural gas, Qatar has made significant gains in strengthening non-oil sectors, such as manufacturing, construction, and financial services, leading non-oil GDP to steadily rise in recent years to just over half the total.', '$155.8 billion (2016 est.)', 'fruits, vegetables; poultry, dairy products, beef; fish', 'liquefied natural gas, crude oil production and refining, ammonia, fertilizer, petrochemicals, steel reinforcing bars, cement, commercial ship repair', '1.896 million (2016 est.)', 'liquefied natural gas (LNG), petroleum products, fertilizers, steel', '39.01 billion kWh (2015 est.)', '1.523 million bbl/day (2016 est.)', '278,300 bbl/day (2014 est.)', '164 billion cu m (2015 est.)', 'A7 (2016)', '6 (2013)', '1 (2013)', 'condensate 288 km; condensate/gas 221 km; gas 2,383 km; liquid petroleum gas 90 km; oil 745 km; refined products 103 km (2013)', '-', '9,830 km (2010)', '-', '2018-02-07 18:03:34', NULL),
(182, 'CG', 'cg', 'Republic of the Congo', 'Upon independence in 1960, the former French region of Middle Congo became the Republic of the Congo. A quarter century of experimentation with Marxism was abandoned in 1990 and a democratically elected government took office in 1992. A brief civil war in 1997 restored former Marxist President Denis SASSOU-Nguesso, and ushered in a period of ethnic and political unrest. Southern-based rebel groups agreed to a final peace accord in March 2003. The Republic of Congo is one of Africa''s largest petroleum producers, but with declining production it will need new offshore oil finds to sustain its oil earnings over the long term.', 'Africa', '1 00 S, 15 00 E', '342,000 sq km', '4,954,674', 'Congolese (singular and plural)', 'Kongo 48%, Sangha 20%, M''Bochi 12%, Teke 17%, Europeans and other 3%', 'French (official), Lingala (a lingua franca trade language), Kingwana (a dialect of Kiswahili or Swahili), Kikongo, Tshiluba', 'Roman Catholic 33.1%, Awakening Churches/Christian Revival 22.3%, Protestant 19.9%, Salutiste 2.2%, Muslim 1.6%, Kimbanguiste 1.5%, other 8.1%, none 11.3% (2010 est.)', 'Republic of the Congo', 'presidential republic', 'Brazzaville', '12 departments (departments, singular - department); Bouenza, Brazzaville, Cuvette, Cuvette-Ouest, Kouilou, Lekoumou, Likouala, Niari, Plateaux, Pointe-Noire, Pool, Sangha', '15 August 1960 (from France)', 'The economy is a mixture of subsistence farming and hunting, an industrial sector based largely on oil and support services, and government spending. Oil has supplanted forestry as the mainstay of the economy, providing a major share of government revenues and exports. Natural gas is increasingly being converted to electricity rather than being flared, greatly improving energy prospects. New mining projects, particularly iron ore, which entered production in late 2013, may add as much as $1 billion to annual government revenue.\r\nEconomic reform efforts have been undertaken with the support of international organizations, notably the World Bank and the IMF, including the recently concluded Article IV consultations. The current administration faces difficult economic challenges of stimulating recovery and reducing poverty. The recent drop in oil prices has constrained government spending; lower oil prices forced the government to cut more than $1 billion in planned spending. However, the government increased infrastructure spending for the September 2015 All-Africa Games and the March 2016 presidential election, which put further pressure on the budget. The fiscal deficit exceeded 18% of GDP in 2015. Substantial macroeconomic imbalances continued in 2016 following sustained low oil prices.', '$7.867 billion (2016 est.)', 'cassava (manioc, tapioca), sugar, rice, corn, peanuts, vegetables, coffee, cocoa; forest products', 'petroleum extraction, cement, lumber, brewing, sugar, palm oil, soap, flour, cigarettes', '2.055 million (2016 est.)', 'petroleum, lumber, plywood, sugar, cocoa, coffee, diamonds', '1.676 billion kWh (2015 est.)', '308,400 bbl/day (2016 est.)', '16,530 bbl/day (2014 est.)', '1.5 billion cu m (2015 est.)', 'TN (2016)', '27 (2013)', '-', 'gas 232 km; liquid petroleum gas 4 km; oil 982 km (2013)', '510 km', '17,000 km', '1,120 km (commercially navigable on Congo and Oubanqui Rivers above Brazzaville; there are many ferries across the river to Kinshasa; the Congo south of Brazzaville-Kinshasa to the coast is not navigable because of rapids, necessitating a rail connection to Pointe Noire; other rivers are used for local traffic only) (2011)', '2018-02-07 18:03:34', NULL),
