(184, 'RO', 'ro', 'Romania', 'The principalities of Wallachia and Moldavia - for centuries under the suzerainty of the Turkish Ottoman Empire - secured their autonomy in 1856; they were de facto linked in 1859 and formally united in 1862 under the new name of Romania. The country gained recognition of its independence in 1878. It joined the Allied Powers in World War I and acquired new territories - most notably Transylvania - following the conflict. In 1940, Romania allied with the Axis powers and participated in the 1941 German invasion of the USSR. Three years later, overrun by the Soviets, Romania signed an armistice. The post-war Soviet occupation led to the formation of a communist "people''s republic" in 1947 and the abdication of the king. The decades-long rule of dictator Nicolae CEAUSESCU, who took power in 1965, and his Securitate police state became increasingly oppressive and draconian through the 1980s. CEAUSESCU was overthrown and executed in late 1989. Former communists dominated the government until 1996 when they were swept from power. Romania joined NATO in 2004 and the EU in 2007.', 'Europe', '46 00 N, 25 00 E', '238,391 sq km', '21,529,967 (July 2017 est.)', 'Romanian(s)', 'Romanian 83.4%, Hungarian 6.1%, Romani 3.1%, Ukrainian 0.3%, German 0.2%, other 0.7%, unspecified 6.1% (2011 est.)', 'Romanian (official) 85.4%, Hungarian 6.3%, Romani 1.2%, other 1%, unspecified 6.1% (2011 est.)', 'Eastern Orthodox (including all sub-denominations) 81.9%, Protestant (various denominations including Reformed and Pentecostal) 6.4%, Roman Catholic 4.3%, other (includes Muslim) 0.9%, none or atheist 0.2%, unspecified 6.3% (2011 est.)', 'none', 'semi-presidential republic', 'Bucharest', '41 counties (judete, singular - judet) and 1 municipality* (municipiu); Alba, Arad, Arges, Bacau, Bihor, Bistrita-Nasaud, Botosani, Braila, Brasov, Bucuresti (Bucharest)*, Buzau, Calarasi, Caras-Severin, Cluj, Constanta, Covasna, Dambovita, Dolj, Galati, Gorj, Giurgiu, Harghita, Hunedoara, Ialomita, Iasi, Ilfov, Maramures, Mehedinti, Mures, Neamt, Olt, Prahova, Salaj, Satu Mare, Sibiu, Suceava, Teleorman, Timis, Tulcea, Vaslui, Valcea, Vrancea', '9 May 1877 (independence proclaimed from the Ottoman Empire; 13 July 1878 independence recognized by the Treaty of Berlin); 26 March 1881 (kingdom proclaimed); 30 December 1947 (republic proclaimed)', 'Romania, which joined the EU on 1 January 2007, began the transition from communism in 1989 with a largely obsolete industrial base and a pattern of output unsuited to the country''s needs. Romania''s macroeconomic gains have only recently started to spur creation of a middle class and to address Romania''s widespread poverty. Corruption and red tape continue to permeate the business environment.\r\nIn the aftermath of the global financial crisis, Romania signed a $26 billion emergency assistance package from the IMF, the EU, and other international lenders, but GDP contracted until 2011. In March 2011, Romania and the IMF/EU/World Bank signed a 24-month precautionary standby agreement, worth $6.6 billion, to promote fiscal discipline, encourage progress on structural reforms, and strengthen financial sector stability; no funds were drawn. In September 2013, Romanian authorities and the IMF/EU agreed to a follow-on standby agreement, worth $5.4 billion, to continue with reforms. This agreement expired in September 2015, and no funds were drawn. Progress on structural reforms has been uneven, and the economy still is vulnerable to external shocks.\r\nEconomic growth rebounded in the 2013-16 period, driven by strong industrial exports and excellent agricultural harvests, and the fiscal deficit was reduced substantially. Industry outperformed other sectors of the economy in 2016. Exports remained an engine of economic growth, led by trade with the EU, which accounts for roughly 70% of Romania trade. Domestic demand was a second driver, due to the mid-2015 cut, from 24% to 9%, of the VAT levied upon foodstuffs. In 2015, the Government of Romania succeeded in meeting its annual target for the budget deficit, the external deficit remained low, even if it rose due to increasing imports. For the first time since 1989, inflation turned into deflation, allowing for a gradual loosening of monetary policy throughout the period.\r\nAn aging population, significant tax evasion, insufficient health care, and an aggressive loosening of the fiscal package jeopardize the low fiscal deficit and public debt and are the economy''s top vulnerabilities.', '$187.6 billion (2016 est.)', 'wheat, corn, barley, sugar beets, sunflower seed, potatoes, grapes; eggs, sheep', 'electric machinery and equipment, auto assembly, textiles and footwear, light machinery, metallurgy, chemicals, food processing, petroleum refining, mining, timber, construction materials', '8.979 million (2016 est.)', 'machinery and equipment, other manufactured goods, agricultural products and foodstuffs, metals and metal products, chemicals, minerals and fuels, raw materials', '62.16 billion kWh (2015 est.)', '77,910 bbl/day (2016 est.)', '228,100 bbl/day (2014 est.)', '11.17 billion cu m (2015 est.)', 'YR (2016)', '45 (2013)', '2 (2013)', 'gas 3,726 km; oil 2,451 km (2013)', '11,268 km', '84,185 km', '1,731 km (includes 1,075 km on the Danube River, 524 km on secondary branches, and 132 km on canals) (2010)', '2018-02-07 18:03:34', NULL),
(185, 'RU', 'ru', 'Russia', 'Founded in the 12th century, the Principality of Muscovy was able to emerge from over 200 years of Mongol domination (13th-15th centuries) and to gradually conquer and absorb surrounding principalities. In the early 17th century, a new ROMANOV Dynasty continued this policy of expansion across Siberia to the Pacific. Under PETER I (ruled 1682-1725), hegemony was extended to the Baltic Sea and the country was renamed the Russian Empire. During the 19th century, more territorial acquisitions were made in Europe and Asia. Defeat in the Russo-Japanese War of 1904-05 contributed to the Revolution of 1905, which resulted in the formation of a parliament and other reforms. Repeated devastating defeats of the Russian army in World War I led to widespread rioting in the major cities of the Russian Empire and to the overthrow in 1917 of the imperial household. The communists under Vladimir LENIN seized power soon after and formed the USSR. The brutal rule of Iosif STALIN (1928-53) strengthened communist rule and Russian dominance of the Soviet Union at a cost of tens of millions of lives. After defeating Germany in World War II as part of an alliance with the US (1939-1945), the USSR expanded its territory and influence in Eastern Europe and emerged as a global power. The USSR was the principal adversary of the US during the Cold War (1947-1991). The Soviet economy and society stagnated in the decades following Stalin’s rule, until General Secretary Mikhail GORBACHEV (1985-91) introduced glasnost (openness) and perestroika (restructuring) in an attempt to modernize communism, but his initiatives inadvertently released forces that by December 1991 splintered the USSR into Russia and 14 other independent republics.\r\nFollowing economic and political turmoil during President Boris YELTSIN''s term (1991-99), Russia shifted toward a centralized authoritarian state under the leadership of President Vladimir PUTIN (2000-2008, 2012-present) in which the regime seeks to legitimize its rule through managed elections, populist appeals, a foreign policy focused on enhancing the country''s geopolitical influence, and commodity-based economic growth. Russia faces a largely subdued rebel movement in Chechnya and some other surrounding regions, although violence still occurs throughout the North Caucasus.', 'Asia', '60 00 N, 100 00 E', '17,098,242 sq km', '142,257,519 (July 2017 est.)', 'Russian(s)', 'Russian 77.7%, Tatar 3.7%, Ukrainian 1.4%, Bashkir 1.1%, Chuvash 1%, Chechen 1%, other 10.2%, unspecified 3.9%', 'Russian (official) 85.7%, Tatar 3.2%, Chechen 1%, other 10.1%', 'Russian Orthodox 15-20%, Muslim 10-15%, other Christian 2% (2006 est.)', 'Russian Federation', 'semi-presidential federation', 'Moscow', '46 provinces (oblasti, singular - oblast), 21 republics (respubliki, singular - respublika), 4 autonomous okrugs (avtonomnyye okrugi, singular - avtonomnyy okrug), 9 krays (kraya, singular - kray), 2 federal cities (goroda, singular - gorod), and 1 autonomous oblast (avtonomnaya oblast'')', '24 August 1991 (from the Soviet Union); notable earlier dates: 1157 (Principality of Vladimir-Suzdal created); 16 January 1547 (Tsardom of Muscovy established); 22 October 1721 (Russian Empire proclaimed); 30 December 1922 (Soviet Union established)', 'Russia has undergone significant changes since the collapse of the Soviet Union, moving from a centrally planned economy towards a more market-based system. Both economic growth and reform have stalled in recent years, however, and Russia remains a predominantly statist economy with a high concentration of wealth in officials'' hands. Economic reforms in the 1990s privatized most industry, with notable exceptions in the energy, transportation, banking, and defense-related sectors. The protection of property rights is still weak, and the state continues to interfere in the free operation of the private sector.\r\nRussia is one of the world''s leading producers of oil and natural gas, and is also a top exporter of metals such as steel and primary aluminum. Russia''s reliance on commodity exports makes it vulnerable to boom and bust cycles that follow the volatile swings in global prices. The economy, which had averaged 7% growth during the 1998-2008 period as oil prices rose rapidly, has seen diminishing growth rates since then due to the exhaustion of Russia’s commodity-based growth model.\r\nA combination of falling oil prices, international sanctions, and structural limitations pushed Russia into a deep recession in 2015, with the GDP falling by close to 4%. The downturn continued through 2016, with GDP contracting by 0.6%. Government support for import substitution has increased recently in an effort to diversify the economy away from extractive industries. Russia is heavily dependent on the movement of world commodity prices and the Central Bank of Russia estimates that if oil prices remain below $40 per barrel in 2017, the resulting shock would cause GDP to fall by up to 5%.', '$1.283 trillion (2016 est.)', 'grain, sugar beets, sunflower seeds, vegetables, fruits; beef, milk', 'complete range of mining and extractive industries producing coal, oil, gas, chemicals, and metals; all forms of machine building from rolling mills to high-performance aircraft and space vehicles; defense industries (including radar, missile production, advanced electronic components), shipbuilding; road and rail transportation equipment; communications equipment; agricultural machinery, tractors, and construction equipment; electric power generating and transmitting equipment; medical and scientific instruments; consumer durables, textiles, foodstuffs, handicrafts', '76.64 million (2016 est.)', 'petroleum and petroleum products, natural gas, metals, wood and wood products, chemicals, and a wide variety of civilian and military manufactures', '1.008 trillion kWh (2015 est.)', '10.55 million bbl/day (2016 est.)', '6.174 million bbl/day (2014 est.)', '598.6 billion cu m (2015 est.)', 'RA (2016)', '1,218 (2013)', '49 (2013)', 'gas 177,700 km; oil 54,800 km; refined products 19,300 km (2016)', '87,157 km', '1,283,387 km', '102,000 km (including 48,000 km with guaranteed depth; the 72,000-km system in European Russia links Baltic Sea, White Sea, Caspian Sea, Sea of Azov, and Black Sea) (2009)', '2018-02-07 18:03:34', NULL),
(186, 'RW', 'rw', 'Rwanda', 'In 1959, three years before independence from Belgium, the majority ethnic group, the Hutus, overthrew the ruling Tutsi king. Over the next several years, thousands of Tutsis were killed, and some 150,000 driven into exile in neighboring countries. The children of these exiles later formed a rebel group, the Rwandan Patriotic Front (RPF), and began a civil war in 1990. The war, along with several political and economic upheavals, exacerbated ethnic tensions, culminating in April 1994 in a state-orchestrated genocide, in which Rwandans killed up to a million of their fellow citizens, including approximately three-quarters of the Tutsi population. The genocide ended later that same year when the predominantly Tutsi RPF, operating out of Uganda and northern Rwanda, defeated the national army and Hutu militias, and established an RPF-led government of national unity. Approximately 2 million Hutu refugees - many fearing Tutsi retribution - fled to neighboring Burundi, Tanzania, Uganda, and former Zaire. Since then, most of the refugees have returned to Rwanda, but several thousand remained in the neighboring Democratic Republic of the Congo (DRC, the former Zaire) and formed an extremist insurgency bent on retaking Rwanda, much as the RPF did in 1990. Rwanda held its first local elections in 1999 and its first post-genocide presidential and legislative elections in 2003. Rwanda in 2009 staged a joint military operation with the Congolese Army in DRC to rout out the Hutu extremist insurgency there, and Kigali and Kinshasa restored diplomatic relations. Rwanda also joined the Commonwealth in late 2009 and assumed a nonpermanent seat on the UN Security Council for the 2013-14 term.', 'Africa', '2 00 S, 30 00 E', '26,338 sq km', '11,901,484', 'Rwandan(s)', 'Hutu (Bantu), Tutsi (Hamitic), Twa (Pygmy)', 'Kinyarwanda (official, universal Bantu vernacular) 93.2%, French (official) <.1, English (official) <.1, Swahili (or Kiswahili, used in commercial centers) <.1, more than one language, other 6.3%, unspecified 0.3% (2002 est.)', 'Protestant 50.2% (includes Adventist 12% and other Protestant 38.2%), Roman Catholic 44.3%, Muslim 2%, other 0.9% (includes traditionalist/animist), none 2.5%, unspecified <.1 (2002 est.)', 'Republic of Rwanda', 'presidential republic', 'Kigali', '4 provinces (in French - provinces, singular - province; in Kinyarwanda - intara for singular and plural) and 1 city* (in French - ville; in Kinyarwanda - umujyi); Est (Eastern), Kigali*, Nord (Northern), Ouest (Western), Sud (Southern)', '1 July 1962 (from Belgium-administered UN trusteeship)', 'Rwanda is a rural, agrarian country with about 35% of the population engaged in subsistence agriculture, and with some mineral and agro-processing. Population density is high but not concentrated in large metropolises – its 13 million people are spread out on a small amount of land (about the size of Vermont and New Hampshire combined). Tourism, minerals, coffee, and tea are Rwanda''s main sources of foreign exchange. Despite Rwanda''s fertile ecosystem, food production often does not keep pace with demand, requiring food imports. Energy shortages, instability in neighboring states, and lack of adequate transportation linkages to other countries continue to handicap private sector growth.\r\nThe 1994 genocide decimated Rwanda''s fragile economic base, severely impoverished the population, particularly women, and temporarily stalled the country''s ability to attract private and external investment. However, Rwanda has made substantial progress in stabilizing and rehabilitating its economy beyond pre-1994 levels. GDP has rebounded with an average annual growth of 6%-8% since 2003 and inflation has been reduced to single digits. In 2015, 39% of the population lived below the poverty line, according to government statistics, compared to 57% in 2006. Mining profits in 2015 were reduced by almost half, owing to the drop in global demand for minerals.\r\nAfrica''s most densely populated country is trying to overcome the limitations of its small, landlocked economy by leveraging regional trade; Rwanda joined the East African Community and is aligning its budget, trade, and immigration policies with its regional partners. The government has embraced an expansionary fiscal policy to reduce poverty by improving education, infrastructure, and foreign and domestic investment. In recognition of Rwanda''s successful management of its macro economy, the IMF graduated Rwanda to a Policy Support Instrument in 2010.\r\nThe Rwandan Government is seeking to become a regional leader in information and communication technologies. In 2012, Rwanda completed the first modern Special Economic Zone (SEZ) in Kigali. The SEZ seeks to attract investment in all sectors, but specifically in agribusiness, information and communications, trade and logistics, mining, and construction. In 2016, the government launched an online system to give investors information about public land and its suitability for agricultural development.', '$8.406 billion (2016 est.)', 'coffee, tea, pyrethrum (insecticide made from chrysanthemums), bananas, beans, sorghum, potatoes; livestock', 'cement, agricultural products, small-scale beverages, soap, furniture, shoes, plastic goods, textiles, cigarettes', '6.011 million (2016 est.)', 'coffee, tea, hides, tin ore', '600 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '9XR (2016)', '7 (2013)', '-', '-', '-', '4,700 km', '(Lac Kivu navigable by shallow-draft barges and native craft) (2011)', '2018-02-07 18:03:34', NULL),
(187, 'BL', 'bl', 'Saint Barthélemy', 'Discovered in 1493 by Christopher COLUMBUS who named it for his brother Bartolomeo, Saint Barthelemy was first settled by the French in 1648. In 1784, the French sold the island to Sweden, which renamed the largest town Gustavia, after the Swedish King GUSTAV III, and made it a free port; the island prospered as a trade and supply center during the colonial wars of the 18th century. France repurchased the island in 1877 and took control the following year. It was placed under the administration of Guadeloupe. Saint Barthelemy retained its free port status along with various Swedish appellations such as Swedish street and town names, and the three-crown symbol on the coat of arms. In 2003, the islanders voted to secede from Guadeloupe, and in 2007, the island became a French overseas collectivity. In 2012, it became an overseas territory of the EU, allowing it to exert local control over the permanent and temporary immigration of foreign workers including non-French European citizens.', 'Central America and the Caribbean', '17 90 N, 62 85 W', '25 sq km', '7,184 (July 2017 est.)', '-', 'white, Creole (mulatto), black, Guadeloupe Mestizo (French-East Asia)', 'French (primary), English', 'Roman Catholic, Protestant, Jehovah''s Witnesses', 'Overseas Collectivity of Saint Barthelemy', '-', 'Gustavia', '-', 'none (overseas collectivity of France)', 'The economy of Saint Barthelemy is based upon high-end tourism and duty-free luxury commerce, serving visitors primarily from North America. The luxury hotels and villas host 70,000 visitors each year with another 130,000 arriving by boat. The relative isolation and high cost of living inhibits mass tourism. The construction and public sectors also enjoy significant investment in support of tourism. With limited fresh water resources, all food must be imported, as must all energy resources and most manufactured goods. The tourism sector creates a strong employment demand and attracts labor from Brazil and Portugal. The country’s currency is the euro.', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '1 (2013)', '-', '-', '-', '-', '-', '2018-02-07 18:03:34', NULL),
(188, 'SH', 'sh', 'Saint Helena, Ascension and Tristan da Cunha', 'Saint Helena is a British Overseas Territory consisting of Saint Helena and Ascension Islands, and the island group of Tristan da Cunha.\r\nSaint Helena: Uninhabited when first discovered by the Portuguese in 1502, Saint Helena was garrisoned by the British during the 17th century. It acquired fame as the place of Napoleon BONAPARTE''s exile from 1815 until his death in 1821, but its importance as a port of call declined after the opening of the Suez Canal in 1869. During the Anglo-Boer War in South Africa, several thousand Boer prisoners were confined on the island between 1900 and 1903.\r\nSaint Helena is one of the most remote populated places in the world. The British Government committed to building an airport on Saint Helena in 2005. After more than a decade of delays and construction, a commercial air service to South Africa via Namibia was inaugurated in October of 2017. The weekly service to Saint Helena from Johannesburg via Windhoek in Namibia takes just over six hours (including the refueling stop in Windhoek) and replaces the mail ship that had made a five-day journey to the island every three weeks.\r\nAscension Island: This barren and uninhabited island was discovered and named by the Portuguese in 1503. The British garrisoned the island in 1815 to prevent a rescue of Napoleon from Saint Helena. It served as a provisioning station for the Royal Navy''s West Africa Squadron on anti-slavery patrol. The island remained under Admiralty control until 1922, when it became a dependency of Saint Helena. During World War II, the UK permitted the US to construct an airfield on Ascension in support of transatlantic flights to Africa and anti-submarine operations in the South Atlantic. In the 1960s the island became an important space tracking station for the US. In 1982, Ascension was an essential staging area for British forces during the Falklands War. It remains a critical refueling point in the air-bridge from the UK to the South Atlantic.\r\nThe island hosts one of four dedicated ground antennas (the others are on Diego Garcia (British Indian Ocean Territory), Kwajalein (Marshall Islands), and at Cape Canaveral, Florida (US)) that assist in the operation of the Global Positioning System (GPS) navigation system. NASA and the US Air Force also operate a Meter-Class Autonomous Telescope (MCAT) on Ascension as part of the deep space surveillance system for tracking orbital debris, which can be a hazard to spacecraft and astronauts.\r\nTristan da Cunha: The island group consists of Tristan da Cunha, Nightingale, Inaccessible, and Gough Islands. Tristan da Cunha, named after its Portuguese discoverer (1506), was garrisoned by the British in 1816 to prevent any attempt to rescue Napoleon from Saint Helena. Gough and Inaccessible Islands have been designated World Heritage Sites. South Africa leases a site for a meteorological station on Gough Island.', 'Africa', 'Saint Helena: 15 57 S, 5 42 W\r\nAscension Island: 7 57 S, 14 22 W\r\nTristan da Cunha island group: 37 15 S, 12 30 W', '394 sq km', '7,828', 'Saint Helenian(s)', 'African descent 50%, white 25%, Chinese 25%', 'English', 'Protestant 75.9% (includes Anglican 68.9, Baptist 2.1%, Seventh Day Adventist 1.8%, Salvation Army 1.7%, New Apostolic 1.4%), Jehovah''s Witness 4.1%, Roman Catholic 1.2%, other 2.5% (includes Baha''i), unspecified 0.8%, none 6.1%, no response 9.4%', 'Saint Helena, Ascension, and Tristan da Cunha', 'parliamentary democracy (Legislative Council); limited self-governing overseas territory of the UK', 'Jamestown', '3 administrative areas; Ascension, Saint Helena, Tristan da Cunha', 'none (overseas territory of the UK)', 'The economy depends largely on financial assistance from the UK, which amounted to about $27 million in FY06/07 or more than twice the level of annual budgetary revenues. The local population earns income from fishing, raising livestock, and sales of handicrafts. Because there are few jobs, 25% of the work force has left to seek employment on Ascension Island, on the Falklands, and in the UK.', '$NA', 'coffee, corn, potatoes, vegetables; fish, lobster; livestock; timber', 'construction, crafts (furniture, lacework, fancy woodwork), fishing, collectible postage stamps', '2,486 (1998 est.)', 'fish (frozen, canned, and salt-dried skipjack, tuna), coffee, handicrafts', '10 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'VQ-H (2016)', '2 (2015)', '-', '-', '-', '198 km (Saint Helena 138 km, Ascension 40 km, Tristan da Cunha 20 km)', '-', '2018-02-07 18:03:34', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(189, 'KN', 'kn', 'Saint Kitts and Nevis', 'Carib Indians occupied the islands of the West Indies for hundreds of years before the British began settlement in 1623. In 1967, the island territory of Saint Christopher-Nevis-Anguilla became an associated state of the UK with full internal autonomy. The island of Anguilla rebelled and was allowed to secede in 1971. The remaining islands achieved independence in 1983 as Saint Kitts and Nevis. In 1998, a referendum on Nevis to separate from Saint Kitts fell short of the two-thirds majority vote needed. Nevis continues in its efforts to separate from Saint Kitts.', 'Central America and the Caribbean', '17 20 N, 62 45 W', '261 sq km (Saint Kitts 168 sq km; Nevis 93 sq km)', '52,715 (July 2017 est.)', 'Kittitian(s), Nevisian(s)', 'predominantly black; some British, Portuguese, and Lebanese', 'English (official)', 'Anglican, other Protestant, Roman Catholic', 'Federation of Saint Kitts and Nevis', 'federal parliamentary democracy (National Assembly) under a constitutional monarchy; a Commonwealth ', 'Basseterre', '14 parishes; Christ Church Nichola Town, Saint Anne Sandy Point, Saint George Basseterre, Saint George Gingerland, Saint James Windward, Saint John Capesterre, Saint John Figtree, Saint Mary Cayon, Saint Paul Capesterre, Saint Paul Charlestown, Saint Peter Basseterre, Saint Thomas Lowland, Saint Thomas Middle Island, Trinity Palmetto Point', '19 September 1983 (from the UK)', 'The economy of Saint Kitts and Nevis depends on tourism; since the 1970s, tourism has replaced sugar as the economy’s traditional mainstay. Roughly 200,000 tourists visited the islands in 2009, but reduced tourism arrivals and foreign investment led to an economic contraction in the 2009-2013 period, and the economy returned to growth only in 2014. Like other tourist destinations in the Caribbean, Saint Kitts and Nevis is vulnerable to damage from natural disasters and shifts in tourism demand.\r\nFollowing the 2005 harvest, the government closed the sugar industry after several decades of losses. To compensate for lost jobs, the government has embarked on a program to diversify the agricultural sector and to stimulate other sectors of the economy, such as export-oriented manufacturing and offshore banking. The government has made notable progress in reducing its public debt, from 154% of GDP in 2011 to 83% in 2013, although it still faces one of the highest levels in the world, largely attributable to public enterprise losses. Saint Kitts and Nevis is among other countries in the Caribbean that supplement their economic activity through economic citizenship programs, whereby foreigners can obtain citizenship from Saint Kitts and Nevis by investing there.', '$900 million (2016 est.)', 'sugarcane, rice, yams, vegetables, bananas; fish', 'tourism, cotton, salt, copra, clothing, footwear, beverages', '18,170 (June 1995 est.)', 'machinery, food, electronics, beverages, tobacco', '208 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'V4 (2016)', '2 (2013)', '-', '-', '50 km', '383 km', '-', '2018-02-07 18:03:34', NULL),
(190, 'LC', 'lc', 'Saint Lucia', 'The island, with its fine natural harbor at Castries, was contested between England and France throughout the 17th and early 18th centuries (changing possession 14 times); it was finally ceded to the UK in 1814. Even after the abolition of slavery on its plantations in 1834, Saint Lucia remained an agricultural island, dedicated to producing tropical commodity crops. Self-government was granted in 1967 and independence in 1979.', 'Central America and the Caribbean', '13 53 N, 60 58 W', '616 sq km', '164,994 (July 2017 est.)', 'Saint Lucian(s)', 'black/African descent 85.3%, mixed 10.9%, East Indian 2.2%, other 1.6%, unspecified 0.1% (2010 est.)', 'English (official), French patois', 'Roman Catholic 61.5%, Protestant 25.5% (includes Seventh Day Adventist 10.4%, Pentecostal 8.9%, Baptist 2.2%, Anglican 1.6%, Church of God 1.5%, other Protestant 0.9%), other Christian 3.4% (includes Evangelical 2.3% and Jehovah''s Witness 1.1%), Rastafarian 1.9%, other 0.4%, none 5.9%, unspecified 1.4% (2010 est.)', 'none', 'parliamentary democracy (Parliament) under a constitutional monarchy; a Commonwealth realm', 'Castries', '10 districts; Anse-la-Raye, Canaries, Castries, Choiseul, Dennery, Gros-Islet, Laborie, Micoud, Soufriere, Vieux-Fort', '22 February 1979 (from the UK)', 'The island nation has been able to attract foreign business and investment, especially in its offshore banking and tourism industries. Tourism is Saint Lucia''s main source of jobs and income - accounting for 65% of GDP - and the island''s main source of foreign exchange earnings. The manufacturing sector is the most diverse in the Eastern Caribbean area. Crops such as bananas, mangos, and avocados continue to be grown for export, but St. Lucia''s once solid banana industry has been devastated by strong competition.\r\nSaint Lucia is vulnerable to a variety of external shocks, including volatile tourism receipts, natural disasters, and dependence on foreign oil. Furthermore, high public debt - 77% of GDP in 2012 - and high debt servicing obligations constrain the CHASTANET administration''s ability to respond to adverse external shocks.\r\nSt. Lucia has experienced anemic growth since the onset of the global financial crisis in 2008, largely because of a slowdown in tourism - airlines cut back on their routes to St. Lucia in 2012. Also, St. Lucia introduced a value added tax in 2012 of 15%, becoming the last country in the Eastern Caribbean to do so. In 2013, the government introduced a National Competitiveness and Productivity Council to address St. Lucia''s high public wages and lack of productivity.', '$1.675 billion (2016 est.)', 'bananas, coconuts, vegetables, citrus, root crops, cocoa', 'tourism; clothing, assembly of electronic components, beverages, corrugated cardboard boxes, lime processing, coconut processing', '79,700 (2012 est.)', 'bananas 41%, clothing, cocoa, avocados, mangoes, coconut oil (2010 est.)', '358 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'J6 (2016)', '2 (2013)', '-', '-', '-', '1,210 km', '-', '2018-02-07 18:03:34', NULL),
(191, 'MF', 'mf', 'Saint Martin', 'Although sighted by Christopher COLUMBUS in 1493 and claimed for Spain, it was the Dutch who occupied the island in 1631 and set about exploiting its salt deposits. The Spanish retook the island in 1633, but continued to be harassed by the Dutch. The Spanish finally relinquished Saint Martin to the French and Dutch, who divided it between themselves in 1648. Friction between the two sides caused the border to frequently fluctuate over the next two centuries, with the French eventually holding the greater portion of the island (about 57%). The cultivation of sugar cane introduced African slavery to the island in the late 18th century; the practice was not abolished until 1848. The island became a free port in 1939; the tourism industry was dramatically expanded during the 1970s and 1980s. In 2003, the populace of Saint Martin voted to secede from Guadeloupe and in 2007, the northern portion of the island became a French overseas collectivity. In 2010, the southern Dutch portion of the island became the independent nation of Sint Maarten within the Kingdom of the Netherlands. On 6 September 2017, Hurricane Irma passed over the island of Saint Martin causing extensive damage to roads, communications, electrical power, and housing; the UN estimated that 90% of the buildings were damaged or destroyed.', 'Central America and the Caribbean', '18 05 N, 63 57 W', '54.4 sq km', '32,125 (July 2017 est.)', '-', 'Creole (mulatto), black, Guadeloupe Mestizo (French-East Asia), white, East Indian', 'French (official), English, Dutch, French Patois, Spanish, Papiamento (dialect of Netherlands Antilles)', 'Roman Catholic, Jehovah''s Witness, Protestant, Hindu', 'Overseas Collectivity of Saint Martin', '-', 'Marigot', '-', 'none (overseas collectivity of France)', 'The economy of Saint Martin centers on tourism with 85% of the labor force engaged in this sector. Over one million visitors come to the island each year with most arriving through the Princess Juliana International Airport in Sint Maarten. The financial sector is also important to Saint Martin’s economy as it facilitates financial mediation for its thriving tourism sector. No significant agriculture and limited local fishing means that almost all food must be imported. Energy resources and manufactured goods are also imported, primarily from Mexico and the US. Saint Martin is reported to have one of the highest per capita income in the Caribbean. As with the rest of the Caribbean, Saint Martin’s financial sector is having to deal with losing correspondent banking relationships.', '$561.5 million (2005 est.)', '-', 'tourism, light industry and manufacturing, heavy industry', '17,300 (2008 est.)', '-', '-', '-', '-', '-', '-', '1 (2013)', '-', '-', '-', '-', '-', '2018-02-07 18:03:34', NULL),
(192, 'PM', 'pm', 'Saint Pierre and Miquelon', 'First settled by the French in the early 17th century, the islands represent the sole remaining vestige of France''s once vast North American possessions. They attained the status of an overseas collectivity in 2003.', 'North America', '46 50 N, 56 20 W', '242 sq km', '5,533 (July 2017 est.)', 'Frenchman(men), Frenchwoman(women)', 'Basques and Bretons (French fishermen)', 'French (official)', 'Roman Catholic 99%, other 1%', 'Territorial Collectivity of Saint Pierre and Miquelon', 'parliamentary democracy (Territorial Council); overseas collectivity of France', 'Saint-Pierre', 'none (territorial overseas collectivity of France); note - there are no first-order administrative divisions as defined by the US Government, but there are 2 communes at the second order - Saint Pierre, Miquelon', 'none (overseas collectivity collectivity of France; has been under French control since 1763)', 'The inhabitants have traditionally earned their livelihood by fishing and by servicing fishing fleets operating off the coast of Newfoundland. The economy has been declining, however, because of disputes with Canada over fishing quotas and a steady decline in the number of ships stopping at Saint Pierre.\r\nThe government hopes an expansion of tourism will boost economic prospects. Fish farming, crab fishing, and agriculture are being developed to diversify the local economy. Recent test drilling for oil may pave the way for development of the energy sector.', '$215.3 million (2006 est.)', 'vegetables; poultry, cattle, sheep, pigs; fish', 'fish processing and supply base for fishing fleets; tourism', '3,194 (2006)', 'fish and fish products, soybeans, animal feed, mollusks and crustaceans, fox and mink pelts', '47 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '-', '2 (2013)', '-', '-', '-', '117 km', '-', '2018-02-07 18:03:35', NULL),
(193, 'VC', 'vc', 'Saint Vincent and the Grenadines', 'Resistance by native Caribs prevented colonization on Saint Vincent until 1719. Disputed between France and the UK for most of the 18th century, the island was ceded to the latter in 1783. Between 1960 and 1962, Saint Vincent and the Grenadines was a separate administrative unit of the Federation of the West Indies. Autonomy was granted in 1969 and independence in 1979.', 'Central America and the Caribbean', '13 15 N, 61 12 W', '389 sq km (Saint Vincent 344 sq km)', '102,089 (July 2017 est.)', 'Saint Vincentian(s) or Vincentian(s)', 'black 66%, mixed 19%, East Indian 6%, European 4%, Carib Amerindian 2%, other 3%', 'English, French patois', 'Protestant 75% (Anglican 47%, Methodist 28%), Roman Catholic 13%, other (includes Hindu, Seventh-Day Adventist, other Protestant) 12%', 'none', 'parliamentary democracy (House of Assembly) under a constitutional monarchy; a Commonwealth realm', 'Kingstown', '6 parishes; Charlotte, Grenadines, Saint Andrew, Saint David, Saint George, Saint Patrick', '27 October 1979 (from the UK)', 'Success of the economy hinges upon seasonal variations in agriculture, tourism, and construction activity, as well as remittances. Much of the workforce is employed in banana production and tourism. Saint Vincent and the Grenadines is home to a small offshore banking sector and continues to fully adopt international regulatory standards.\r\nThis lower-middle-income country remains vulnerable to natural and external shocks. The economy has shown some signs of recovery due to increased tourist arrivals, falling oil prices and renewed growth in the construction sector. The much anticipated international airport opened in early 2017 with hopes for increased airlift and tourism activity. The government''s ability to invest in social programs and respond to external shocks is constrained by its high public debt burden, which was 67% of GDP at the end of 2013.', '$770 million (2016 est.)', 'bananas, coconuts, sweet potatoes, spices; small numbers of cattle, sheep, pigs, goats; fish', 'tourism; food processing, cement, furniture, clothing, starch', '57,520 (2007 est.)', 'bananas, eddoes and dasheen (taro), arrowroot starch; tennis racquets', '155 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'J8 (2016)', '6 (2013)', '-', '-', '-', '829 km', '-', '2018-02-07 18:03:35', NULL),
(194, 'WS', 'ws', 'Samoa', 'New Zealand occupied the German protectorate of Western Samoa at the outbreak of World War I in 1914. It continued to administer the islands as a mandate and then as a trust territory until 1962, when the islands became the first Polynesian nation to reestablish independence in the 20th century. The country dropped the "Western" from its name in 1997.', 'Oceania', '13 35 S, 172 20 W', '2,831 sq km', '200,108 (July 2017 est.)', 'Samoan(s)', 'Samoan 92.6%, Euronesians (persons of European and Polynesian blood) 7%, Europeans 0.4% (2001 census)', 'Samoan (Polynesian) (official), English', 'Protestant 57.4% (Congregationalist 31.8%, Methodist 13.7%, Assembly of God 8%, Seventh Day Adventist 3.9%), Roman Catholic 19.4%, Mormon 15.2%, Worship Centre 1.7%, other Christian 5.5%, other 0.7%, none 0.1%, unspecified 0.1% (2011 est.)', 'Independent State of Samoa', 'parliamentary republic', 'Apia', '11 districts; A''ana, Aiga-i-le-Tai, Atua, Fa''asaleleaga, Gaga''emauga, Gagaifomauga, Palauli, Satupa''itea, Tuamasaga, Va''a-o-Fonoti, Vaisigano', '1 January 1962 (from New Zealand-administered UN trusteeship)', 'The economy of Samoa has traditionally been dependent on development aid, family remittances from overseas, tourism, agriculture, and fishing. It has a nominal GDP of $830 million. Agriculture, including fishing, employs roughly two-thirds of the labor force and furnishes 90% of exports, featuring fish, coconut oil, nonu products, and taro. The manufacturing sector mainly processes agricultural products. One factory in the Foreign Trade Zone employs over 700 people to make automobile electrical harnesses for an assembly plant in Australia, and accounts for 65% of total exports, but it is set to close by yearend 2017. Industry accounts for nearly 24% of GDP while employing less than 6% of the work force. The service sector accounts for nearly three-quarters of GDP and employs approximately 50% of the labor force. Tourism is an expanding sector accounting for 25% of GDP; 132,000 tourists visited the islands in 2013.\r\nThe country is vulnerable to devastating storms. In September 2009, an earthquake and the resulting tsunami severely damaged Samoa and nearby American Samoa, disrupting transportation and power generation, and resulting in about 200 deaths. In December 2012, extensive flooding and wind damage from Tropical Cyclone Evan killed four people, displaced over 6,000, and damaged or destroyed an estimated 1,500 homes on Samoa''s Upolu Island.\r\nThe Samoan Government has called for deregulation of the country''s financial sector, encouragement of investment, and continued fiscal discipline, while at the same time protecting the environment. Foreign reserves are relatively healthy and inflation is low, but external debt is approximately 45% of GDP. Samoa became the 155th member of the WTO in May 2012, and graduated from least developed country status in January 2014.', '$786 million (2016 est.)', 'coconuts, nonu, bananas, taro, yams, coffee, cocoa', 'food processing, building materials, auto parts', '50,700 (2016 est.)', 'fish, coconut oil and cream, nonu, copra, taro, automotive parts, garments, beer', '127 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '5W (2016)', '4 (2013)', '-', '-', '-', '1,200 km', '-', '2018-02-07 18:03:35', NULL),
(195, 'SM', 'sm', 'San Marino', 'Geographically the third smallest state in Europe (after the Holy See and Monaco), San Marino also claims to be the world''s oldest republic. According to tradition, it was founded by a Christian stonemason named MARINUS in A.D. 301. San Marino''s foreign policy is aligned with that of the EU, although it is not a member; social and political trends in the republic track closely with those of its larger neighbor, Italy.', 'Europe', '43 46 N, 12 25 E', '61 sq km', '33,537 (July 2017 est.)', 'Sammarinese (singular and plural)', 'Sammarinese, Italian', 'Italian', 'Roman Catholic', 'Republic of San Marino', 'parliamentary republic', 'San Marino (city)', '9 municipalities (castelli, singular - castello); Acquaviva, Borgo Maggiore, Chiesanuova, Domagnano, Faetano, Fiorentino, Montegiardino, San Marino Citta, Serravalle', '3 September 301 (traditional founding date)', 'San Marino''s economy relies heavily on tourism, banking, and the manufacture and export of ceramics, clothing, fabrics, furniture, paints, spirits, tiles, and wine. The manufacturing and financial sectors account for more than half of San Marino''s GDP. The per capita level of output and standard of living are comparable to those of the most prosperous regions of Italy.\r\nSan Marino''s economy has been contracting since 2008, largely due to weakened demand from Italy - which accounts for nearly 90% of its export market - and financial sector consolidation. Difficulties in the banking sector, the recent global economic downturn, and the sizable decline in tax revenues have contributed to negative real GDP growth. The government has adopted measures to counter the downturn, including subsidized credit to businesses and is seeking to shift its growth model away from a reliance on bank and tax secrecy. San Marino does not issue public debt securities; when necessary, it finances deficits by drawing down central bank deposits.\r\nThe economy benefits from foreign investment due to its relatively low corporate taxes and low taxes on interest earnings. The income tax rate is also very low, about one-third the average EU level. San Marino continues to work towards harmonizing its fiscal laws with EU and international standards. In September 2009, the OECD removed San Marino from its list of tax havens that have yet to fully adopt global tax standards, and in 2010 San Marino signed Tax Information Exchange Agreements with most major countries. In 2013, the San Marino Government signed a Double Taxation Agreement with Italy, but a referendum on EU membership failed to reach the quorum needed to bring it to a vote.', '$1.591 billion (2016 est.)', 'wheat, grapes, corn, olives; cattle, pigs, horses, beef, cheese, hides', 'tourism, banking, textiles, electronics, ceramics, cement, wine', '21,960 (September 2013 es)', 'building stone, lime, wood, chestnuts, wheat, wine, baked goods, hides, ceramics', '-', '-', '-', '-', 'T7 (2016)', '-', '-', '-', '-', '292 km', '-', '2018-02-07 18:03:35', NULL),
(196, 'ST', 'st', 'São Tomé and Príncipe', 'Discovered and claimed by Portugal in the late 15th century, the islands'' sugar-based economy gave way to coffee and cocoa in the 19th century - all grown with African plantation slave labor, a form of which lingered into the 20th century. While independence was achieved in 1975, democratic reforms were not instituted until the late 1980s. The country held its first free elections in 1991, but frequent internal wrangling between the various political parties precipitated repeated changes in leadership and four failed, non-violent coup attempts in 1995, 1998, 2003, and 2009. In 2012, three opposition parties combined in a no confidence vote to bring down the majority government of former Prime Minister Patrice TROVOADA, but in 2014, legislative elections returned him to the office. President Evaristo CARVALHO, of the same political party as Prime Minister TROVOADA, was elected in September 2016, marking a rare instance in which the positions of president and prime minister are held by the same party. New oil discoveries in the Gulf of Guinea may attract increased attention to the small island nation.', 'Africa', '1 00 N, 7 00 E', '964 sq km', '201,025 (July 2017 est.)', 'Sao Tomean(s)', 'mestico, angolares (descendants of Angolan slaves), forros (descendants of freed slaves), servicais (contract laborers from Angola, Mozambique, and Cabo Verde), tongas (children of servicais born on the islands), Europeans (primarily Portuguese), Asians (mostly Chinese)', 'Portuguese 98.4% (official), Forro 36.2%, Cabo Verdian 8.5%, French 6.8%, Angolar 6.6%, English 4.9%, Lunguie 1%, other (including sign language) 2.4%', 'Catholic 55.7%, Adventist 4.1%, Assembly of God 3.4%, New Apostolic 2.9%, Mana 2.3%, Universal Kingdom of God 2%, Jehovah''s Witness 1.2%, other 6.2%, none 21.2%, unspecified 1% (2012 est.)', 'Democratic Republic of Sao Tome and Principe', 'semi-presidential republic', 'Sao Tome', '2 provinces; Principe, Sao Tome', '12 July 1975 (from Portugal)', 'This small, poor island economy has become increasingly dependent on cocoa since independence in 1975. Cocoa production has substantially declined in recent years because of drought and mismanagement. Sao Tome and Principe has to import fuels, most manufactured goods, consumer goods, and food, making it vulnerable to fluctuations in global commodity prices. Maintaining control of inflation, fiscal discipline, and increasing flows of foreign direct investment into the nascent oil sector are major economic problems facing the country. The government also has attempted to reduce price controls and subsidies.\r\nOver the years, Sao Tome and Principe has had difficulty servicing its external debt and has relied heavily on concessional aid and debt rescheduling. It benefited from $200 million in debt relief in December 2000 under the Highly Indebted Poor Countries program, which helped bring down the country''s $300 million debt burden. In April 2011, the country completed a Threshold Country Program with The Millennium Challenge Corporation to help increase tax revenues, reform customs, and improve the business environment. In 2016, Sao Tome and Portugal signed a five-year cooperation agreement worth approximately $64 million, some of which will be provided as loans.\r\nConsiderable potential exists for development of a tourist industry, and the government has taken steps to expand facilities in recent years. Potential also exists for the development of petroleum resources in Sao Tome and Principe''s territorial waters in the oil-rich Gulf of Guinea, which are being jointly developed in a 60-40 split with Nigeria, but any actual production is at least several years off. Volatile aid and investment inflows, even with a growing tourism sector, have kept growth moderate at around 4% annually, which is insufficient to alleviate poverty. The IMF in late 2016 expressed concern about the country’s banking sector vulnerabilities.', '$351 million (2016 est.)', 'cocoa, coconuts, palm kernels, copra, cinnamon, pepper, coffee, bananas, papayas, beans; poultry; fish', 'light construction, textiles, soap, beer, fish processing, timber', '67,870 (2016 est.)', 'cocoa 80%, copra, coffee, palm oil (2010 est.)', '66 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'S9 (2016)', '2 (2013)', '-', '-', '-', '320 km', '-', '2018-02-07 18:03:35', NULL),
(197, 'SA', 'sa', 'Saudi Arabia', 'Saudi Arabia is the birthplace of Islam and home to Islam''s two holiest shrines in Mecca and Medina. The king''s official title is the Custodian of the Two Holy Mosques. The modern Saudi state was founded in 1932 by ABD AL-AZIZ bin Abd al-Rahman Al SAUD (Ibn Saud) after a 30-year campaign to unify most of the Arabian Peninsula. One of his male descendants rules the country today, as required by the country''s 1992 Basic Law. Following Iraq''s invasion of Kuwait in 1990, Saudi Arabia accepted the Kuwaiti royal family and 400,000 refugees while allowing Western and Arab troops to deploy on its soil for the liberation of Kuwait the following year. The continuing presence of foreign troops on Saudi soil after the liberation of Kuwait became a source of tension between the royal family and the public until all operational US troops left the country in 2003. Major terrorist attacks in May and November 2003 spurred a strong ongoing campaign against domestic terrorism and extremism.\r\nFrom 2005 to 2015, King ABDALLAH incrementally modernized the Kingdom. Driven by personal ideology and political pragmatism, he introduced a series of social and economic initiatives, including expanding employment and social opportunities for women, attracting foreign investment, increasing the role of the private sector in the economy, and discouraging businesses from hiring foreign workers. Saudi Arabia saw protests during the 2011 Arab Spring but not the level of bloodshed seen in protests elsewhere in the region. Shia Muslims in the Eastern Province protested primarily against the detention of political prisoners, endemic discrimination, and Bahraini and Saudi Government actions in Bahrain. Riyadh took a cautious but firm approach by arresting some protesters but releasing most of them quickly and by using its state-sponsored clerics to counter political and Islamist activism.\r\nThe government held its first-ever elections in 2005 and 2011, when Saudis went to the polls to elect municipal councilors. In December 2015, women were allowed to vote and stand as candidates for the first time in municipal council elections, with 19 women winning seats. King SALMAN bin Abd al-Aziz Al Saud ascended to the throne in 2015 and placed the first next-generation prince, MUHAMMAD BIN NAIF bin Abd al-Aziz Al Saud, in the line of succession as Crown Prince. He designated his son, MUHAMMAD BIN SALMAN bin Abd al-Aziz Al Saud, as the Deputy Crown Prince. In March 2015, Saudi Arabia led a coalition of 10 countries in a military campaign to restore the government of Yemen, which had been ousted by Huthi forces allied with former president ALI ABDULLAH al-Salih. The war in Yemen has led to civilian casualties and shortages of basic supplies, which has drawn considerable international criticism. In December 2015, Deputy Crown Prince MUHAMMAD BIN SALMAN announced Saudi Arabia would lead a 34-nation Islamic Coalition to fight terrorism (it has since grown to 41 nations). In January 2016, Saudi Arabia executed 47 people on charges of terrorism, including Shia Muslim cleric NIMR al-Nimr. Iranian protesters overran Saudi diplomatic facilities in Iran to protest al-NIMR’s execution and the Saudi government responded by cutting off diplomatic ties with Iran.\r\nThe country remains a leading producer of oil and natural gas and holds about 16% of the world''s proven oil reserves as of 2015. The government continues to pursue economic reform and diversification, particularly since Saudi Arabia''s accession to the WTO in 2005, and promotes foreign investment in the Kingdom. In April 2016, the Saudi government announced a broad set of socio-economic reforms, known as Vision 2030. Low global oil prices throughout 2015 and 2016 significantly lowered Saudi Arabia’s governmental revenue. In response, the government cut subsidies on water, electricity, and gasoline; reduced government employee compensation packages; and announced limited new land taxes. In coordination with OPEC and some key non-OPEC countries, Saudi Arabia agreed cut oil output in early 2017 to regulate supply and help elevate global prices.', 'Middle East', '25 00 N, 45 00 E', '2,149,690 sq km', '28,571,770 (July 2017 est.)', 'Saudi(s)', 'Arab 90%, Afro-Asian 10%', 'Arabic (official)', 'Muslim (official; citizens are 85-90% Sunni and 10-15% Shia), other (includes Eastern Orthodox, Protestant, Roman Catholic, Jewish, Hindu, Buddhist, and Sikh) (2012 est.)', 'Kingdom of Saudi Arabia', 'absolute monarchy', 'Riyadh', '13 provinces (mintaqat, singular - mintaqah); Al Bahah, Al Hudud ash Shamaliyah (Northern Border), Al Jawf, Al Madinah (Medina), Al Qasim, Ar Riyad (Riyadh), Ash Sharqiyah (Eastern), ''Asir, Ha''il, Jazan, Makkah (Mecca), Najran, Tabuk', '23 September 1932 (unification of the kingdom)', 'Saudi Arabia has an oil-based economy with strong government controls over major economic activities. It possesses about 16% of the world''s proven petroleum reserves, ranks as the largest exporter of petroleum, and plays a leading role in OPEC. The petroleum sector accounts for roughly 87% of budget revenues, 42% of GDP, and 90% of export earnings.\nSaudi Arabia is encouraging the growth of the private sector in order to diversify its economy and to employ more Saudi nationals. Over 6 million foreign workers play an important role in the Saudi economy, particularly in the oil and service sectors; at the same time, however, Riyadh is struggling to reduce unemployment among its own nationals. Saudi officials are particularly focused on employing its large youth population, which generally lacks the education and technical skills the private sector needs.\nIn 2016, the Kingdom incurred a budget deficit estimated at 13.6% of GDP, which was financed by bond sales and drawing down reserves. Although the Kingdom can finance high deficits for several years by drawing down its considerable foreign assets or by borrowing, it has cut capital spending. Plans to cut deficits include introducing a value-added tax and reducing subsidies on electricity, water, and petroleum products. In January 2016, Crown Prince and Deputy Prime Minister MUHAMMAD BIN SALMAN announced that Saudi Arabia intends to list shares of its state-owned petroleum company, ARAMCO - another move to increase revenue and outside investment. The government has also looked at privatization and diversification of the economy more closely in the wake of a diminished oil market. Historically, Saudi Arabia has focused diversification efforts on power generation, telecommunications, natural gas exploration, and petrochemical sectors. More recently, the government has approached investors about expanding the role of the private sector in the health care, education and tourism industries. While Saudi Arabia has emphasized their goals of diversification for some time, current low oil prices may force the government to make more drastic changes ahead of their long-run timeline.', '$646.4 billion (2016 est.)', 'wheat, barley, tomatoes, melons, dates, citrus; mutton, chickens, eggs, milk', 'crude oil production, petroleum refining, basic petrochemicals, ammonia, industrial gases, sodium hydroxide (caustic soda), cement, fertilizer, plastics, metals, commercial ship repair, commercial aircraft repair, construction', '12.02 million', 'petroleum and petroleum products 90% (2012 est.)', '318 billion kWh (2015 est.)', '10.46 million bbl/day (2016 est.)', '2.221 million bbl/day (2014 est.)', '102.3 billion cu m (2015 est.)', 'HZ (2016)', '214 (2013)', '10 (2013)', 'condensate 209 km; gas 2,940 km; liquid petroleum gas 1,183 km; oil 5,117 km; refined products 1,151 km (2013)', '5,410 km', '221,372 km', '-', '2018-02-07 18:03:35', NULL),
(198, 'SN', 'sn', 'Senegal', 'The French colonies of Senegal and French Sudan were merged in 1959 and granted independence in 1960 as the Mali Federation. The union broke up after only a few months. Senegal joined with The Gambia to form the nominal confederation of Senegambia in 1982. The envisaged integration of the two countries was never implemented, and the union was dissolved in 1989. The Movement of Democratic Forces in the Casamance has led a low-level separatist insurgency in southern Senegal since the 1980s. Several peace deals have failed to resolve the conflict, but an unofficial cease-fire has remained largely in effect since 2012. Senegal remains one of the most stable democracies in Africa and has a long history of participating in international peacekeeping and regional mediation. Senegal was ruled by a Socialist Party for 40 years until Abdoulaye WADE was elected president in 2000. He was reelected in 2007 and during his two terms amended Senegal''s constitution over a dozen times to increase executive power and weaken the opposition. His decision to run for a third presidential term sparked a large public backlash that led to his defeat in a March 2012 runoff with Macky SALL, whose term runs until 2019. A 2016 constitutional referendum reduced the term to five years with a maximum of two consecutive terms for future presidents.', 'Africa', '14 00 N, 14 00 W', '196,722 sq km', '14,668,522 (July 2017 est.)', 'Senegalese (singular and plural)', 'Wolof 38.6%, Pular 26.6%, Serer 14.9%, Mandinka 4.6%, Jola 4.1%, Soninke 2.3%, other 8.9% (includes Europeans and persons of Lebanese descent) (2010-11 est.)', 'French (official), Wolof, Pular, Jola, Mandinka, Serer, Soninke', 'Muslim 95.3% (most adhere to one of the four main Sufi brotherhoods), Christian 4.3% (mostly Roman Catholic), animist 0.4% (2010-11 est.)', 'Republic of Senegal', 'presidential republic', 'Dakar', '14 regions (regions, singular - region); Dakar, Diourbel, Fatick, Kaffrine, Kaolack, Kedougou, Kolda, Louga, Matam, Saint-Louis, Sedhiou, Tambacounda, Thies, Ziguinchor', '4 April 1960 (from France); note - complete independence achieved upon dissolution of federation with Mali on 20 August 1960', 'Senegal’s economy is driven by mining, construction, tourism, fisheries and agriculture, which are the primary sources of employment in rural areas. The country''s key export industries include phosphate mining, fertilizer production, agricultural products and commercial fishing and it is also working on oil exploration projects. Senegal relies heavily on donor assistance, remittances and foreign direct investment. For the first time in the past 12 years, Senegal reached a growth rate of 6.5% in 2015 and surpassed 6.6% in 2016, due in part to a buoyant performance in agriculture because of higher rainfall and productivity in the sector.\r\nPresident Macky SALL, who was elected in March 2012 under a reformist policy agenda, inherited an economy with high energy costs, a challenging business environment, and a culture of overspending. President SALL unveiled an ambitious economic plan, the Emerging Senegal Plan (ESP), which aims to implement priority economic reforms and investment projects to increase economic growth while preserving macroeconomic stability and debt sustainability. Bureaucratic bottlenecks and a challenging business climate are among the perennial challenges that may slow the implementation of this plan.\r\nSenegal is receiving technical support from the IMF during 2015-17 under a Policy Support Instrument (PSI) to assist with implementation of the ESP. The PSI implementation continues to be satisfactory as concluded by the IMF’s second review mission in March 2016. Investors have signaled confidence in the country through Senegal’s successful Eurobond issuances in recent years, including in 2014.\r\nThe government will focus on 19 projects under the ESP for the 2016 budget to continue the structural transformation of the economy. These 19 projects include the Thies-Touba Highway, including the new airport- Mbour-Thies Highway. Senegal will increase the national family allowances program and the community development emergency program in 2016. Electricity supply is a chief constraint for Senegal’s development. Electricity prices in Senegal are among the highest in the world. Power Africa, a program led by USAID and OPIC, plans to increase the current 500 MW of generating capacity to over 1,000 mW in the next three to five years. Recent gas discoveries on the Senegal-Mauritanian border, as well as just south of Dakar, will help alleviate some of the energy shortages.', '$14.72 billion (2016 est.)', 'peanuts, millet, corn, sorghum, rice, cotton, tomatoes, green vegetables; cattle, poultry, pigs; fish', 'agricultural and fish processing, phosphate mining, fertilizer production, petroleum refining, zircon, and gold mining, construction materials, ship construction and repair', '6.737 million (2016 est.)', 'fish, groundnuts (peanuts), petroleum products, phosphates, cotton', '3.673 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '16,850 bbl/day (2014 est.)', '62 million cu m (2015 est.)', '6V (2016)', '20 (2013)', '-', 'gas 43 km; refined products 8 km (2017)', '906 km (713 km operational in 2017)', '16,496 km', '1,000 km (primarily on the Senegal, Saloum, and Casamance Rivers) (2012)', '2018-02-07 18:03:35', NULL),
(199, 'RS', 'rs', 'Serbia', 'The Kingdom of Serbs, Croats, and Slovenes was formed in 1918; its name was changed to Yugoslavia in 1929. Communist Partisans resisted the Axis occupation and division of Yugoslavia from 1941 to 1945 and fought nationalist opponents and collaborators as well. The military and political movement headed by Josip Broz "TITO" (Partisans) took full control of Yugoslavia when their domestic rivals and the occupiers were defeated in 1945. Although communists, TITO and his successors (Tito died in 1980) managed to steer their own path between the Warsaw Pact nations and the West for the next four and a half decades. In 1989, Slobodan MILOSEVIC became president of the Republic of Serbia and his ultranationalist calls for Serbian domination led to the violent breakup of Yugoslavia along ethnic lines. In 1991, Croatia, Slovenia, and Macedonia declared independence, followed by Bosnia in 1992. The remaining republics of Serbia and Montenegro declared a new Federal Republic of Yugoslavia (FRY) in April 1992 and under MILOSEVIC''s leadership, Serbia led various military campaigns to unite ethnic Serbs in neighboring republics into a "Greater Serbia." These actions ultimately failed and, after international intervention, led to the signing of the Dayton Peace Accords in 1995.\r\nMILOSEVIC retained control over Serbia and eventually became president of the FRY in 1997. In 1998, an ethnic Albanian insurgency in the formerly autonomous Serbian province of Kosovo provoked a Serbian counterinsurgency campaign that resulted in massacres and massive expulsions of ethnic Albanians living in Kosovo. The MILOSEVIC government''s rejection of a proposed international settlement led to NATO''s bombing of Serbia in the spring of 1999. Serbian military and police forces withdrew from Kosovo in June 1999, and the UN Security Council authorized an interim UN administration and a NATO-led security force in Kosovo. FRY elections in late 2000 led to the ouster of MILOSEVIC and the installation of democratic government. In 2003, the FRY became the State Union of Serbia and Montenegro, a loose federation of the two republics. Widespread violence predominantly targeting ethnic Serbs in Kosovo in March 2004 led to more intense calls to address Kosovo''s status, and the UN began facilitating status talks in 2006. In June 2006, Montenegro seceded from the federation and declared itself an independent nation. Serbia subsequently gave notice that it was the successor state to the union of Serbia and Montenegro.\r\nIn February 2008, after nearly two years of inconclusive negotiations, Kosovo declared itself independent of Serbia - an action Serbia refuses to recognize. At Serbia''s request, the UN General Assembly (UNGA) in October 2008 sought an advisory opinion from the International Court of Justice (ICJ) on whether Kosovo''s unilateral declaration of independence was in accordance with international law. In a ruling considered unfavorable to Serbia, the ICJ issued an advisory opinion in July 2010 stating that international law did not prohibit declarations of independence. In late 2010, Serbia agreed to an EU-drafted UNGA Resolution acknowledging the ICJ''s decision and calling for a new round of talks between Serbia and Kosovo, this time on practical issues rather than Kosovo''s status. Serbia and Kosovo signed the first agreement of principles governing the normalization of relations between the two countries in April 2013 and are in the process of implementing its provisions. In 2015, Serbia and Kosovo reached four additional agreements within the Brussels Dialogue framework. These included agreements on the Community of Serb-Majority Municipalities; telecommunications; energy production and distribution; and freedom of movement. President Aleksandar VUCIC has promoted an ambitious goal of Serbia joining the EU by 2020. Under his leadership as prime minister, in January 2014 Serbia opened formal negotiations for accession.', 'Europe', '44 00 N, 21 00 E', '77,474 sq km', '7,111,024', 'Serb(s)', 'Serb 83.3%, Hungarian 3.5%, Romani 2.1%, Bosniak 2%, other 5.7%, undeclared or unknown 3.4% (2011 est.)', 'Serbian (official) 88.1%, Hungarian 3.4%, Bosnian 1.9%, Romani 1.4%, other 3.4%, undeclared or unknown 1.8%', 'Orthodox 84.6%, Catholic 5%, Muslim 3.1%, Protestant 1%, atheist 1.1%, other 0.8% (includes agnostics, other Christians, Eastern religionists, Jewish), undeclared or unknown 4.5% (2011 est.)', 'Republic of Serbia', 'parliamentary republic', 'Belgrade (Beograd)', '119 municipalities (opstine, singular - opstina) and 26 cities (gradovi, singular - grad)\r\nmunicipalities: Ada*, Aleksandrovac, Aleksinac, Alibunar*, Apatin*, Arandelovac, Arilje, Babusnica, Bac*, Backa Palanka*, Backa Topola*, Backi Petrovac*, Bajina Basta, Batocina, Becej*, Bela Crkva*, Bela Palanka, Beocin*, Blace, Bogatic, Bojnik, Boljevac, Bor, Bosilegrad, Brus, Bujanovac, Cajetina, Cicevac, Coka*, Crna Trava, Cuprija, Despotovac, Dimitrov, Doljevac, Gadzin Han, Golubac, Gornji Milanovac, Indija*, Irig*, Ivanjica, Kanjiza*, Kladovo, Knic, Knjazevac, Koceljeva, Kosjeric, Kovacica*, Kovin*, Krupanj, Kucevo, Kula*, Kursumlija, Lajkovac, Lapovo, Lebane, Ljig, Ljubovija, Lucani, Majdanpek, Mali Idos*, Mali Zvornik, Malo Crnice, Medveda, Merosina, Mionica, Negotin, Nova Crnja*, Nova Varos, Novi Becej*, Novi Knezevac*, Odzaci*, Opovo*, Osecina, Paracin, Pecinci*, Petrovac na Mlavi, Plandiste*, Pozega, Presevo, Priboj, Prijepolje, Prokuplje, Raca, Raska, Razanj, Rekovac, Ruma*, Secanj*, Senta*, Sid*, Sjenica, Smederevska Palanka, Sokobanja, Srbobran*, Sremski Karlovci*, Stara Pazova*, Surdulica, Svilajnac, Svrljig, Temerin*, Titel*, Topola, Trgoviste, Trstenik, Tutin, Ub, Varvarin, Velika Plana, Veliko Gradiste, Vladicin Han, Vladimirci, Vlasotince, Vrbas*, Vrnjacka Banja, Zabalj*, Zabari, Zagubica, Zitiste*, Zitorada\r\ncities: Beograd, Cacak, Jagodina, Kikinda*, Kragujevac, Kraljevo, Krusevac, Leskovac, Loznica, Nis, Novi Pazar, Novi Sad*, Pancevo*, Pirot, Pozarevac, Sabac, Smederevo, Sombor*, Sremska Mitrovica*, Subotica*, Uzice, Valjevo, Vranje, Vrsac, Zajecar, Zrenjanin*\r\nnote: the northern 39 municipalities and 6 cities - about 28% of Serbia''s area - compose the Autonomous Province of Vojvodina and are indicated with *', '5 June 2006 (from the State Union of Serbia and Montenegro)', 'Serbia has a transitional economy largely dominated by market forces, but the state sector remains significant in certain areas. The economy relies on manufacturing and exports, driven largely by foreign investment. MILOSEVIC-era mismanagement of the economy, an extended period of international economic sanctions, civil war, and the damage to Yugoslavia''s infrastructure and industry during the NATO airstrikes in 1999 left the economy worse off than it was in 1990. In 2015, Serbia’s GDP was 27.5% below where it was in 1989.\r\nAfter former Federal Yugoslav President MILOSEVIC was ousted in September 2000, the Democratic Opposition of Serbia (DOS) coalition government implemented stabilization measures and embarked on a market reform program. Serbia renewed its membership in the IMF in December 2000 and rejoined the World Bank and the European Bank for Reconstruction and Development. Serbia has made progress in trade liberalization and enterprise restructuring and privatization, but many large enterprises - including the power utilities, telecommunications company, natural gas company, and others - remain state-owned. Serbia has made some progress towards EU membership, signing a Stabilization and Association Agreement with Brussels in May 2008, and with full implementation of the Interim Trade Agreement with the EU in February 2010, gained candidate status in March 2012. In January 2014, Serbia''s EU accession talks officially opened, and as of March 2017, Serbia had opened eight negotiating chapters. Serbia''s negotiations with the WTO are advanced, with the country''s complete ban on the trade and cultivation of agricultural biotechnology products representing the primary remaining obstacle to accession. Serbia maintains a three-year Stand-by Arrangement with the IMF worth approximately $1.3 billion that is scheduled to end in February 2018. The government has shown progress implementing economic reforms, such as fiscal consolidation, privatization, and reducing public spending.\r\nHigh unemployment and stagnant household incomes are ongoing political and economic problems. Serbia is slowly implementing structural economic reforms needed to ensure the country''s long-term prosperity. In 2016, Serbia reduced its budget deficit to 1.4% and slowed the rate of growth of its public debt as a percent of GDP, more than doubled between 2008 and 2015. Serbia''s concerns about inflation and exchange-rate stability preclude the use of expansionary monetary policy.\r\nMajor economic challenges ahead include: high unemployment rates and the need for private sector job creation; structural reforms of state-owned companies; strategic public sector reforms; and the need for new foreign direct investment. Other serious longer-term challenges include an inefficient judicial system, high levels of corruption, and an aging population. Factors favorable to Serbia''s economic growth include the economic reforms it is undergoing as part of its EU accession process and IMF agreement, its strategic location, a relatively inexpensive and skilled labor force, and free trade agreements with the EU, Russia, Turkey, and countries that are members of the Central European Free Trade Agreement.', '$37.75 billion (2016 est.)', 'wheat, maize, sunflower, sugar beets, grapes/wine, fruits (raspberries, apples, sour cherries), vegetables (tomatoes, peppers, potatoes), beef, pork, and meat products, milk and dairy products', 'automobiles, base metals, furniture, food processing, machinery, chemicals, sugar, tires, clothes, pharmaceuticals', '2.91 million (2016 est.)', 'automobiles, iron and steel, rubber, clothes, wheat, fruit and vegetables, nonferrous metals, electric appliances, metal products, weapons and ammunition', '38.11 billion kWh (2016 est.)', '20,000 bbl/day (2016 est.)', '67,360 bbl/day (2016 est.)', '586.3 million cu m (2016 est.)', 'YU (2016)', '26 (2013)', '2 (2012)', '-', '3,809 km', '44,248 km', '587 km (primarily on the Danube and Sava Rivers) (2009)', '2018-02-07 18:03:35', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(200, 'SC', 'sc', 'Seychelles', 'A lengthy struggle between France and Great Britain for the islands ended in 1814, when they were ceded to the latter. During colonial rule, a plantation-based economy developed that relied on imported labor, primarily from European colonies in Africa. Independence came in 1976. Single-party rule was brought to a close with a new constitution and free elections in 1993. President France-Albert RENE, who had served since 1977, was reelected in 2001, but stepped down in 2004. Vice President James Alix MICHEL took over the presidency and in 2006 was elected to a new five-year term; he was reelected in 2011 and again in 2015. In October 2016, James MICHEL resigned and handed over the presidency to his Vice-President Danny FAURE.', 'Africa', '4 35 S, 55 40 E', '455 sq km', '93,920 (July 2017 est.)', 'Seychellois (singular and plural)', 'mixed French, African, Indian, Chinese, and Arab', 'Seychellois Creole (official) 89.1%, English (official) 5.1%, French (official) 0.7%, other 3.8%, unspecified 1.4% (2010 est.)', 'Roman Catholic 76.2%, Protestant 10.5% (Anglican 6.1%, Pentecostal Assembly 1.5%, Seventh Day Adventist 1.2%, other Protestant 1.7), other Christian 2.4%, Hindu 2.4%, Muslim 1.6%, other non-Christian 1.1%, unspecified 4.8%, none 0.9% (2010 est.)', 'Republic of Seychelles', 'presidential republic', 'Victoria', '25 administrative districts; Anse aux Pins, Anse Boileau, Anse Etoile, Anse Royale, Au Cap, Baie Lazare, Baie Sainte Anne, Beau Vallon, Bel Air, Bel Ombre, Cascade, Glacis, Grand Anse Mahe, Grand Anse Praslin, Inner Islands, La Riviere Anglaise, Les Mamalles, Mont Buxton, Mont Fleuri, Plaisance, Pointe Larue, Port Glaud, Roche Caiman, Saint Louis, Takamaka', '29 June 1976 (from the UK)', 'Since independence in 1976, per capita output in this Indian Ocean archipelago has expanded to roughly seven times the pre-independence, near-subsistence level, moving the island into the upper-middle-income group of countries. Growth has been led by the tourist sector, which employs about 30% of the labor force and provides more than 70% of hard currency earnings, and by tuna fishing.\r\nIn recent years, the government has encouraged foreign investment to upgrade hotels and other services. At the same time, the government has moved to reduce the dependence on tourism by promoting the development of farming, fishing, and small-scale manufacturing.\r\nIn 2008, having depleted its foreign exchange reserves, Seychelles defaulted on interest payments due on a $230 million Eurobond, requested assistance from the IMF, and immediately enacted a number of significant structural reforms, including liberalization of the exchange rate, reform of the public sector to include layoffs, and the sale of some state assets. In December 2013, the IMF declared that Seychelles had successfully transitioned to a market-based economy with full employment and a fiscal surplus. Effective 1 January 2017, Seychelles will no longer be eligible for trade benefits under the US African Growth and Opportunities Act after having gained developed country status. Seychelles grew at 4.9% in 2016 because of a strong tourist sector and low commodity prices; its fiscal surplus reached 3% of GDP. The Seychellois Government met the IMF’s performance criteria for 2016 but recognizes a need to make additional progress to combat high poverty levels, estimated at 39% in 2013.', '$1.429 billion (2016 est.)', 'coconuts, cinnamon, vanilla, sweet potatoes, cassava (manioc, tapioca), copra, bananas; tuna', 'fishing, tourism, beverages', '39,560 (2006 est.)', 'canned tuna, frozen fish, petroleum products (reexports)', '347 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'S7 (2016)', '14 (2013)', '1 (2013)', '-', '-', '526 km', '-', '2018-02-07 18:03:35', NULL),
(201, 'SL', 'sl', 'Sierra Leone', 'The British set up a trading post near present-day Freetown in the 17th century. Originally the trade involved timber and ivory, but later it expanded into slaves. Following the American Revolution, a colony was established in 1787 and Sierra Leone became a destination for resettling black loyalists who had originally been resettled in Nova Scotia. After the abolition of the slave trade in 1807, British crews delivered thousands of Africans liberated from illegal slave ships to Sierra Leone, particularly Freetown. The colony gradually expanded inland during the course of the 19th century; independence was attained in 1961. Democracy is slowly being reestablished after the civil war (1991-2002) that resulted in tens of thousands of deaths and the displacement of more than 2 million people (about one third of the population). The military, which took over full responsibility for security following the departure of UN peacekeepers at the end of 2005, has developed as a guarantor of the country''s stability; the armed forces remained on the sideline during the 2007 and 2012 national elections. In March 2014, the closure of the UN Integrated Peacebuilding Office in Sierra Leone marked the end of more than 15 years of peacekeeping and political operations in Sierra Leone. The government''s stated priorities include furthering development - including recovering from the Ebola epidemic - creating jobs, and stamping out endemic corruption.', 'Africa', '8 30 N, 11 30 W', '71,740 sq km', '6,163,195 (July 2017 est.)', 'Sierra Leonean(s)', 'Temne 35%, Mende 31%, Limba 8%, Kono 5%, Kriole 2% (descendants of freed Jamaican slaves who were settled in the Freetown area in the late-18th century; also known as Krio), Mandingo 2%, Loko 2%, other 15% (includes refugees from Liberia''s recent civil war, and small numbers of Europeans, Lebanese, Pakistanis, and Indians) (2008 census)', 'English (official, regular use limited to literate minority), Mende (principal vernacular in the south), Temne (principal vernacular in the north), Krio (English-based Creole, spoken by the descendants of freed Jamaican slaves who were settled in the Freetown area, a lingua franca and a first language for 10% of the population but understood by 95%)', 'Muslim 60%, indigenous beliefs 30%, Christian 10%', 'Republic of Sierra Leone', 'presidential republic', 'Freetown', '3 provinces and 1 area*; Eastern, Northern, Southern, Western*', '27 April 1961 (from the UK)', 'Sierra Leone is extremely poor and nearly half of the working-age population engages in subsistence agriculture. The country possesses substantial mineral, agricultural, and fishery resources, but it is still recovering from a civil war that destroyed most institutions before ending in the early 2000s.\r\nIn recent years, economic growth has been driven by mining - particularly iron ore. The country’s principal exports are iron ore, diamonds, and rutile, and the economy is vulnerable to fluctuations in international prices. Until 2014, the government had relied on external assistance to support its budget, but it was gradually becoming more independent. The Ebola outbreak of 2014 and 2015, combined with falling global commodities prices, caused a significant contraction of economic activity in all areas. While the World Health Organization declared an end to the Ebola outbreak in Sierra Leone in November 2015, low commodity prices in 2015-2016 contributed to the country’s biggest fiscal shortfall since 2001. In 2017, increased iron ore exports are expected to support modest economic growth. Non-mining activities will remain constrained by inadequate infrastructure, such as power and roads, even though power sector projects may provide some additional electricity capacity in the near term.\r\nContinued economic growth will depend on rising commodities prices and increased efforts to diversify the sources of growth. Pervasive corruption and undeveloped human capital will continue to deter foreign investors. Sustained international donor support in the near future will partially offset these fiscal constraints.', '$3.716 billion (2016 est.)', 'rice, coffee, cocoa, palm kernels, palm oil, peanuts, cashews; poultry, cattle, sheep, pigs; fish', 'diamond mining; iron ore, rutile and bauxite mining; small-scale manufacturing (beverages, textiles, footwear)', '2.863 million (2016 est.)', 'iron ore, diamonds, rutile, cocoa, coffee, fish', '175 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '9L (2016)', '8 (2013)', '2 (2013)', '-', '-', '11,300 km', '800 km (600 km navigable year-round) (2011)', '2018-02-07 18:03:35', NULL),
(202, 'SG', 'sg', 'Singapore', 'A Malay trading port known as Temasek existed on the island of Singapore by the 14th century. The settlement changed hands several times in the ensuing centuries and was eventually burned in the 17th century and fell into obscurity. The British founded Singapore as a trading colony on the site in 1819. It joined the Malaysian Federation in 1963 but was ousted two years later and became independent. Singapore subsequently became one of the world''s most prosperous countries with strong international trading links (its port is one of the world''s busiest in terms of tonnage handled) and with per capita GDP equal to that of the leading nations of Western Europe.', 'Southeast Asia', '1 22 N, 103 48 E', '719.2 sq km', '5,888,926 (July 2017 est.)', 'Singaporean(s)', 'Chinese 74.3%, Malay 13.4%, Indian 9.1% (includes Sri Lankan), other 3.2% (2016 est.)', 'Mandarin (official) 36.3%, English (official) 29.8%, Malay (official) 11.9%, Hokkien 8.1%, Cantonese 4.1%, Tamil (official) 3.2%, Teochew 3.2%, other Indian languages 1.2%, other Chinese dialects 1.1%, other 1.1% (2010 est.)', 'Buddhist 33.9%, Muslim 14.3%, Taoist 11.3%, Catholic 7.1%, Hindu 5.2%, other Christian 11%, other 0.7%, none 16.4% (2010 est.)', 'Republic of Singapore', 'parliamentary republic', 'Singapore', 'none ', '9 August 1965 (from Malaysian Federation)', 'Singapore has a highly developed and successful free-market economy. It enjoys a remarkably open and corruption-free environment, stable prices, and a per capita GDP higher than that of most developed countries. Unemployment is very low. The economy depends heavily on exports, particularly of consumer electronics, information technology products, medical and optical devices, pharmaceuticals, and on its vibrant transportation, business, and financial services sectors.\r\nThe economy contracted 0.6% in 2009 as a result of the global financial crisis, but has continued to grow since 2010. Growth in 2014-16 was slower than during the previous decade, at under 3% annually, largely a result of soft demand for exports amid a sluggish global economy and weak growth in Singapore’s manufacturing sector.\r\nThe government is attempting to restructure Singapore’s economy by weaning its dependence on foreign labor, addressing weak productivity growth, and increasing Singaporean wages. Singapore has attracted major investments in advanced manufacturing, pharmaceuticals, and medical technology production and will continue efforts to strengthen its position as Southeast Asia''s leading financial and technology hub. Singapore is a member of the Regional Comprehensive Economic Partnership negotiations with the nine other ASEAN members plus Australia, China, India, Japan, South Korea, and New Zealand. In 2015, Singapore formed, with the other ASEAN members, the ASEAN Economic Community.', '$297 billion (2016 est.)', 'orchids, vegetables; poultry, eggs; fish, ornamental fish', 'electronics, chemicals, financial services, oil drilling equipment, petroleum refining, rubber processing and rubber products, processed food and beverages, ship repair, offshore platform construction, life sciences, entrepot trade', '3.673 million', 'machinery and equipment (including electronics and telecommunications), pharmaceuticals and other chemicals, refined petroleum products, foodstuffs and beverages', '47.48 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '955,500 bbl/day (2014 est.)', '0 cu m (2014 est.)', '9V (2016)', '9 (2013)', '-', 'gas 122 km; refined products 8 km (2013)', '-', '3,425 km', '-', '2018-02-07 18:03:35', NULL),
(203, 'SX', 'sx', 'Sint Maarten', 'Although sighted by Christopher COLUMBUS in 1493 and claimed for Spain, it was the Dutch who occupied the island in 1631 and began exploiting its salt deposits. The Spanish retook the island in 1633, but continued to be harassed by the Dutch. The Spanish finally relinquished the island of Saint Martin to the French and Dutch, who divided it amongst themselves in 1648. The establishment of cotton, tobacco, and sugar plantations dramatically expanded African slavery on the island in the 18th and 19th centuries; the practice was not abolished in the Dutch half until 1863. The island''s economy declined until 1939 when it became a free port; the tourism industry was dramatically expanded beginning in the 1950s. In 1954, Sint Maarten and several other Dutch Caribbean possessions became part of the Kingdom of the Netherlands as the Netherlands Antilles. In a 2000 referendum, the citizens of Sint Maarten voted to become a self-governing country within the Kingdom of the Netherlands. The change in status became effective in October of 2010 with the dissolution of the Netherlands Antilles. On 6 September 2017, Hurricane Irma passed over the island of Saint Martin/Sint Maarten causing extensive damage to roads, communications, electrical power, and housing; the UN estimated that 90% of the buildings were damaged or destroyed. Princess Juliana International Airport was heavily damaged and forced to close to commercial air traffic for five weeks.', 'Central America and the Caribbean', '18 4 N, 63 4 W', '34 sq km', '42,083 (July 2017 est.)', '-', '-', 'English (official) 67.5%, Spanish 12.9%, Creole 8.2%, Dutch (official) 4.2%, Papiamento (a Spanish-Portuguese-Dutch-English dialect) 2.2%, French 1.5%, other 3.5% (2001 census)', 'Protestant 41.9% (Pentecostal 14.7%, Methodist 10.0%, Seventh Day Adventist 6.6%, Baptist 4.7%, Anglican 3.1%, other Protestant 2.8%), Roman Catholic 33.1%, Hindu 5.2%, Christian 4.1%, Jehovah''s Witness 1.7%, Evangelical 1.4%, Muslim/Jewish 1.1%, other 1.3% (includes Buddhist, Sikh, Rastafarian), none 7.9%, no response 2.4% (2011 est.)', 'none', 'parliamentary democracy (Estates of Sint Maarten) under a constitutional monarchy', 'Philipsburg', 'none (part of the Kingdom of the Netherlands)', 'none (part of the Kingdom of the Netherlands)', 'The economy of Sint Maarten centers around tourism with nearly four-fifths of the labor force engaged in this sector. Nearly 1.8 million visitors came to the island by cruise ship and roughly 500,000 visitors arrived through Princess Juliana International Airport in 2013. Cruise ships and yachts also call on Sint Maarten''s numerous ports and harbors. Limited agriculture and local fishing means that almost all food must be imported. Energy resources and manufactured goods are also imported. Sint Maarten had the highest per capita income among the five islands that formerly comprised the Netherlands Antilles.', '$304.1 million (2014 est.)', 'sugar', 'tourism, light industry', '23,200 (2008 est.)', 'sugar', '304.3 million kWh (2008 est.)', '-', '-', '-', '-', '1 (2013)', '-', '-', '-', '53 km', '-', '2018-02-07 18:03:35', NULL),
(204, 'SK', 'sk', 'Slovakia', 'Slovakia traces its roots to the 9th century state of Great Moravia. Subsequently, the Slovaks became part of the Hungarian Kingdom, where they remained for the next 1,000 years. Following the formation of the dual Austro-Hungarian monarchy in 1867, language and education policies favoring the use of Hungarian (Magyarization) resulted in a strengthening of Slovak nationalism and a cultivation of cultural ties with the closely related Czechs, who were under Austrian rule. After the dissolution of the Austro-Hungarian Empire at the close of World War I, the Slovaks joined the Czechs to form Czechoslovakia. During the interwar period, Slovak nationalist leaders pushed for autonomy within Czechoslovakia, and in 1939 Slovakia became an independent state allied with Nazi Germany. Following World War II, Czechoslovakia was reconstituted and came under communist rule within Soviet-dominated Eastern Europe. In 1968, an invasion by Warsaw Pact troops ended the efforts of the country''s leaders to liberalize communist rule and create "socialism with a human face," ushering in a period of repression known as "normalization." The peaceful "Velvet Revolution" swept the Communist Party from power at the end of 1989 and inaugurated a return to democratic rule and a market economy. On 1 January 1993, the country underwent a nonviolent "velvet divorce" into its two national components, Slovakia and the Czech Republic. Slovakia joined both NATO and the EU in the spring of 2004 and the euro zone on 1 January 2009.', 'Europe', '48 40 N, 19 30 E', '49,035 sq km', '5,445,829 (July 2017 est.)', 'Slovak(s)', 'Slovak 80.7%, Hungarian 8.5%, Romani 2%, other and unspecified 8.8% (2011 est.)', 'Slovak (official) 78.6%, Hungarian 9.4%, Roma 2.3%, Ruthenian 1%, other or unspecified 8.8% (2011 est.)', 'Roman Catholic 62%, Protestant 8.2%, Greek Catholic 3.8%, other or unspecified 12.5%, none 13.4% (2011 est.)', 'Slovak Republic', 'parliamentary republic', 'Bratislava', '8 regions (kraje, singular - kraj); Banskobystricky, Bratislavsky, Kosicky, Nitriansky, Presovsky, Trenciansky, Trnavsky, Zilinsky', '1 January 1993 (Czechoslovakia split into the Czech Republic and Slovakia)', 'Slovakia’s economy suffered from a slow start in the first years after its separation from the Czech Republic in 1993, due to the country’s authoritarian leadership and high levels of corruption, but economic reforms implemented after 1998 have placed Slovakia on a path of strong growth. With a population of 5.4 million, the Slovak Republic has a small, open economy driven mainly by automobile and electronics exports, which account for more than 80% of GDP. Slovakia joined the EU in 2004 and the euro zone in 2009. The country’s banking sector is sound and predominantly foreign owned.\r\nSlovakia has been a regional FDI champion for several years, attractive due to a relatively low-cost yet skilled labor force, and a favorable geographic location in the heart of Central Europe. Among the most pressing domestic issues potentially threatening the attractiveness of the Slovak market are shortages in qualified labor force, persistent corruption issues, and an inadequate judiciary, as well as a lack of innovation. The energy sector in particular is characterized by unpredictable regulatory oversight and high costs, in part driven by government interference in regulated tariffs.', '$89.53 billion (2016 est.)', 'grains, potatoes, sugar beets, hops, fruit; pigs, cattle, poultry; forest products', 'automobiles; metal and metal products; electricity, gas, coke, oil, nuclear fuel; chemicals, synthetic fibers, wood and paper products; machinery; earthenware and ceramics; textiles; electrical and optical apparatus; rubber products; food and beverages; pharmaceutical', '2.759 million (2016 est.)', 'vehicles and related parts 27%, machinery and electrical equipment 20%, nuclear reactors and furnaces 12%, iron and steel 4%, mineral oils and fuels 5% (2015 est.)', '24.85 billion kWh (2015 est.)', '200 bbl/day (2016 est.)', '137,400 bbl/day (2016 est.)', '94 million cu m (2015 est.)', 'OM (2016)', '35 (2013)', '1 (2013)', 'gas transmission pipelines 2,270 km; high-pressure gas distribution pipelines 6,278 km; mid- and low-pressure gas distribution pipelines 27,023 km (2016); oil 510 km (2015)', '3,626 km', '54,869 km (includes local roads, national roads, and 420 km of highways) (2012)', '172 km (on Danube River) (2012)', '2018-02-07 18:03:35', NULL),
(205, 'SI', 'si', 'Slovenia', 'The Slovene lands were part of the Austro-Hungarian Empire until the latter''s dissolution at the end of World War I. In 1918, the Slovenes joined the Serbs and Croats in forming a new multinational state, which was named Yugoslavia in 1929. After World War II, Slovenia became a republic of the renewed Yugoslavia, which though communist, distanced itself from Moscow''s rule. Dissatisfied with the exercise of power by the majority Serbs, the Slovenes succeeded in establishing their independence in 1991 after a short 10-day war. Historical ties to Western Europe, a strong economy, and a stable democracy have assisted in Slovenia''s transformation to a modern state. Slovenia acceded to both NATO and the EU in the spring of 2004; it joined the euro zone and the Schengen zone in 2007.', 'Europe', '46 07 N, 14 49 E', '20,273 sq km', '1,972,126 (July 2017 est.)', 'Slovene(s)', 'Slovene 83.1%, Serb 2%, Croat 1.8%, Bosniak 1.1%, other or unspecified 12% (2002 census)', 'Slovenian (official) 91.1%, Serbo-Croatian 4.5%, other or unspecified 4.4%, Italian (official, only in municipalities where Italian national communities reside), Hungarian (official, only in municipalities where Hungarian national communities reside) (2002 census)', 'Catholic 57.8%, Muslim 2.4%, Orthodox 2.3%, other Christian 0.9%, unaffiliated 3.5%, other or unspecified 23%, none 10.1% (2002 census)', 'Republic of Slovenia', 'parliamentary republic', 'Ljubljana', '201 municipalities (obcine, singular - obcina) and 11 urban municipalities (mestne obcine, singular - mestna obcina)\r\nmunicipalities: Ajdovscina, Ankaran, Apace, Beltinci, Benedikt, Bistrica ob Sotli, Bled, Bloke, Bohinj, Borovnica, Bovec, Braslovce, Brda, Brezice, Brezovica, Cankova, Cerklje na Gorenjskem, Cerknica, Cerkno, Cerkvenjak, Cirkulane, Crensovci, Crna na Koroskem, Crnomelj, Destrnik, Divaca, Dobje, Dobrepolje, Dobrna, Dobrova-Polhov Gradec, Dobrovnik/Dobronak, Dolenjske Toplice, Dol pri Ljubljani, Domzale, Dornava, Dravograd, Duplek, Gorenja Vas-Poljane, Gorisnica, Gorje, Gornja Radgona, Gornji Grad, Gornji Petrovci, Grad, Grosuplje, Hajdina, Hoce-Slivnica, Hodos, Horjul, Hrastnik, Hrpelje-Kozina, Idrija, Ig, Ilirska Bistrica, Ivancna Gorica, Izola/Isola, Jesenice, Jezersko, Jursinci, Kamnik, Kanal, Kidricevo, Kobarid, Kobilje, Kocevje, Komen, Komenda, Kosanjevica na Krki, Kostel, Kozje, Kranjska Gora, Krizevci, Krsko, Kungota, Kuzma, Lasko, Lenart, Lendava/Lendva, Litija, Ljubno, Ljutomer, Log-Dragomer, Logatec, Loska Dolina, Loski Potok, Lovrenc na Pohorju, Luce, Lukovica,\r\nMajsperk, Makole, Markovci, Medvode, Menges, Metlika, Mezica, Miklavz na Dravskem Polju, Miren-Kostanjevica, Mirna, Mirna Pec, Mislinja, Mokronog-Trebelno, Moravce, Moravske Toplice, Mozirje, Muta, Naklo, Nazarje, Odranci, Oplotnica, Ormoz, Osilnica, Pesnica, Piran/Pirano, Pivka, Podcetrtek, Podlehnik, Podvelka, Poljcane, Polzela, Postojna, Prebold, Preddvor, Prevalje, Puconci, Race-Fram, Radece, Radenci, Radlje ob Dravi, Radovljica, Ravne na Koroskem, Razkrizje, Recica ob Savinji, Rence-Vogrsko, Ribnica, Ribnica na Pohorju, Rogaska Slatina, Rogasovci, Rogatec, Ruse, Selnica ob Dravi, Semic, Sevnica, Sezana, Slovenska Bistrica, Slovenske Konjice, Sodrazica, Solcava, Sredisce ob Dravi, Starse, Straza, Sveta Ana, Sveta Trojica v Slovenskih Goricah, Sveti Andraz v Slovenskih Goricah, Sveti Jurij ob Scavnici, Sveti Jurij v Slovenskih Goricah, Sveti Tomaz, Salovci, Sempeter-Vrtojba, Sencur, Sentilj, Sentjernej, Sentjur, Sentrupert, Skocjan, Skofja Loka, Skofljica, Smarje pri Jelsah, Smarjeske Toplice, Smartno ob Paki, Smartno pri Litiji, Sostanj, Store, Tabor, Tisina, Tolmin, Trbovlje, Trebnje, Trnovska Vas, Trzic, Trzin, Turnisce, Velika Polana, Velike Lasce, Verzej, Videm, Vipava, Vitanje, Vodice, Vojnik, Vransko, Vrhnika, Vuzenica, Zagorje ob Savi, Zalec, Zavrc, Zelezniki, Zetale, Ziri, Zirovnica, Zrece, Zuzemberk\r\nurban municipalities: Celje, Koper-Capodistria, Kranj, Ljubljana, Maribor, Murska Sobota, Nova Gorica, Novo Mesto, Ptuj, Slovenj Gradec, Velenje', '25 June 1991 (from Yugoslavia)', 'With excellent infrastructure, a well-educated work force, and a strategic location between the Balkans and Western Europe, Slovenia has one of the highest per capita GDPs in Central Europe, despite having suffered a protracted recession in the 2008-09 period in the wake of the global financial crisis. Slovenia became the first 2004 EU entrant to adopt the euro (on 1 January 2007) and has experienced one of the most stable political transitions in Central and Southeastern Europe.\nIn March 2004, Slovenia became the first transition country to graduate from borrower status to donor partner at the World Bank. In 2007, Slovenia was invited to begin the process for joining the OECD; it became a member in 2012. However, long-delayed privatizations, particularly within Slovenia’s largely state-owned and increasingly indebted banking sector, have fueled investor concerns since 2012 that the country would need EU-IMF financial assistance. In 2013, the European Commission granted Slovenia permission to begin recapitalizing ailing lenders and transferring their nonperforming assets into a “bad bank” established to restore bank balance sheets. From 2014 to 2016, export-led growth, fueled by demand in larger European markets pushed GDP growth to 2.3% per year, while stubbornly high unemployment fell slightly to below 12%.\nPrime Minister CERAR’s government took office in September 2014, pledging to press ahead with commitments to privatize a select group of state-run companies, rationalize public spending, and further stabilize the banking sector.', '$44.73 billion (2016 est.)', 'hops, wheat, coffee, corn, apples, pears; cattle, sheep, poultry', 'ferrous metallurgy and aluminum products, lead and zinc smelting; electronics (including military electronics), trucks, automobiles, electric power equipment, wood products, textiles, chemicals, machine tools', '920,400 (2016 est.)', 'manufactured goods, machinery and transport equipment, chemicals, food', '16.53 billion kWh (2016 est.)', '5 bbl/day (2016 est.)', '0 bbl/day (2016 est.)', '4.5 million cu m (2016 est.)', 'S5 (2016)', '16 (2013)', '-', 'gas 844 km; oil 5 km (2013)', '1,229 km', '38,985 km', '(some transport on the Drava River) (2012)', '2018-02-07 18:03:35', NULL),
(206, 'SB', 'sb', 'Solomon Islands', 'The UK established a protectorate over the Solomon Islands in the 1890s. Some of the bitterest fighting of World War II occurred on this archipelago. Self-government was achieved in 1976 and independence two years later. Ethnic violence, government malfeasance, endemic crime, and a narrow economic base have undermined stability and civil society. In June 2003, then Prime Minister Sir Allan KEMAKEZA sought the assistance of Australia in reestablishing law and order; the following month, an Australian-led multinational force arrived to restore peace and disarm ethnic militias. The Regional Assistance Mission to the Solomon Islands (RAMSI) has generally been effective in restoring law and order and rebuilding government institutions.', 'Oceania', '8 00 S, 159 00 E', '28,896 sq km', '647,581 (July 2017 est.)', 'Solomon Islander(s)', 'Melanesian 95.3%, Polynesian 3.1%, Micronesian 1.2%, other 0.3% (2009 est.)', 'Melanesian pidgin (in much of the country is lingua franca), English (official but spoken by only 1%-2% of the population), 120 indigenous languages', 'Protestant 73.4% (Church of Melanesia 31.9%, South Sea Evangelical 17.1%, Seventh Day Adventist 11.7%, United Church 10.1%, Christian Fellowship Church 2.5%), Roman Catholic 19.6%, other Christian 2.9%, other 4%, none 0.03%, unspecified 0.1% (2009 est.)', 'none', 'parliamentary democracy (National Parliament) under a constitutional monarchy; a Commonwealth realm', 'Honiara', '9 provinces and 1 city*; Central, Choiseul, Guadalcanal, Honiara*, Isabel, Makira and Ulawa, Malaita, Rennell and Bellona, Temotu, Western', '7 July 1978 (from the UK)', 'The bulk of the population depends on agriculture, fishing, and forestry for at least part of its livelihood. Most manufactured goods and petroleum products must be imported. The islands are rich in undeveloped mineral resources such as lead, zinc, nickel, and gold. Prior to the arrival of The Regional Assistance Mission to the Solomon Islands (RAMSI), severe ethnic violence, the closure of key businesses, and an empty government treasury culminated in economic collapse. RAMSI''s efforts to restore law and order and economic stability have led to modest growth as the economy rebuilds.', '$1.233 billion (2016 est.)', 'cocoa, coconuts, palm kernels, rice, fruit; cattle, pigs; fish; timber', 'fish (tuna), mining, timber', '202,500 (2007 est.)', 'timber, fish, copra, palm oil, cocoa', '90 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'H4 (2016)', '36 (2013)', '3 (2013)', '-', '-', '1,390 km', '-', '2018-02-07 18:03:35', NULL),
(207, 'SO', 'so', 'Somalia', 'Britain withdrew from British Somaliland in 1960 to allow its protectorate to join with Italian Somaliland and form the new nation of Somalia. In 1969, a coup headed by Mohamed SIAD Barre ushered in an authoritarian socialist rule characterized by the persecution, jailing, and torture of political opponents and dissidents. After the regime''s collapse early in 1991, Somalia descended into turmoil, factional fighting, and anarchy. In May 1991, northern clans declared an independent Republic of Somaliland that now includes the administrative regions of Awdal, Woqooyi Galbeed, Togdheer, Sanaag, and Sool. Although not recognized by any government, this entity has maintained a stable existence and continues efforts to establish a constitutional democracy, including holding municipal, parliamentary, and presidential elections. The regions of Bari, Nugaal, and northern Mudug comprise a neighboring semi-autonomous state of Puntland, which has been self-governing since 1998 but does not aim at independence; it has also made strides toward reconstructing a legitimate, representative government but has suffered some civil strife. Puntland disputes its border with Somaliland as it also claims the regions of Sool and Sanaag, and portions of Togdheer. Beginning in 1993, a two-year UN humanitarian effort (primarily in south-central Somalia) was able to alleviate famine conditions, but when the UN withdrew in 1995, having suffered significant casualties, order still had not been restored.\r\nIn 2000, the Somalia National Peace Conference (SNPC) held in Djibouti resulted in the formation of an interim government, known as the Transitional National Government (TNG). When the TNG failed to establish adequate security or governing institutions, the Government of Kenya, under the auspices of the Intergovernmental Authority on Development (IGAD), led a subsequent peace process that concluded in October 2004 with the election of Abdullahi YUSUF Ahmed as President of a second interim government, known as the Transitional Federal Government (TFG) of the Somali Republic. The TFG included a 275-member parliamentary body, known as the Transitional Federal Parliament (TFP). President YUSUF resigned late in 2008 while UN-sponsored talks between the TFG and the opposition Alliance for the Re-Liberation of Somalia (ARS) were underway in Djibouti. In January 2009, following the creation of a TFG-ARS unity government, Ethiopian military forces, which had entered Somalia in December 2006 to support the TFG in the face of advances by the opposition Islamic Courts Union (ICU), withdrew from the country. The TFP was doubled in size to 550 seats with the addition of 200 ARS and 75 civil society members of parliament. The expanded parliament elected Sheikh SHARIF Sheikh Ahmed, the former ICU and ARS chairman as president in January 2009. The creation of the TFG was based on the Transitional Federal Charter (TFC), which outlined a five-year mandate leading to the establishment of a new Somali constitution and a transition to a representative government following national elections. In 2009, the TFP amended the TFC to extend TFG''s mandate until 2011 and in 2011 Somali principals agreed to institute political transition by August 2012. The transition process ended in September 2012 when clan elders replaced the TFP by appointing 275 members to a new parliament who subsequently elected a new president.', 'Africa', '10 00 N, 49 00 E', '637,657 sq km\r\n', '11,031,386', 'Somali(s)', 'Somali 85%, Bantu and other non-Somali 15% (including 30,000 Arabs)', 'Somali (official, according to the 2012 Transitional Federal Charter), Arabic (official, according to the 2012 Transitional Federal Charter), Italian, English', 'Sunni Muslim (Islam) (official, according to the 2012 Transitional Federal Charter)', 'Federal Republic of Somalia', 'federal parliamentary republic', 'Mogadishu', '18 regions (plural - NA, singular - gobolka); Awdal, Bakool, Banaadir, Bari, Bay, Galguduud, Gedo, Hiiraan, Jubbada Dhexe (Middle Jubba), Jubbada Hoose (Lower Jubba), Mudug, Nugaal, Sanaag, Shabeellaha Dhexe (Middle Shabeelle), Shabeellaha Hoose (Lower Shabeelle), Sool, Togdheer, Woqooyi Galbeed', '1 July 1960 (from a merger of British Somaliland that became independent from the UK on 26 June 1960 and Italian Somaliland that became independent from the Italian-administered UN trusteeship on 1 July 1960 to form the Somali Republic)', 'Despite the lack of effective national governance, Somalia maintains an informal economy largely based on livestock, remittance/money transfer companies, and telecommunications. Somalia''s government lacks the ability to collect domestic revenue and external debt – mostly in arrears – was estimated at 93% of GDP in 2014.\r\nAgriculture is the most important sector, with livestock normally accounting for about 40% of GDP and more than 50% of export earnings. Nomads and semi-pastoralists, who are dependent upon livestock for their livelihood, make up a large portion of the population. Economic activity is estimated to have increased by 3.7% in 2016 because of growth in the agriculture, construction and telecommunications sector. Somalia''s small industrial sector, based on the processing of agricultural products, has largely been looted and the machinery sold as scrap metal.\r\nIn recent years, Somalia''s capital city, Mogadishu, has witnessed the development of the city''s first gas stations, supermarkets, and airline flights to Turkey since the collapse of central authority in 1991. Mogadishu''s main market offers a variety of goods from food to electronic gadgets. Hotels continue to operate and are supported with private-security militias. Formalized economic growth has yet to expand outside of Mogadishu and a few regional capitals, and within the city, security concerns dominate business. Telecommunication firms provide wireless services in most major cities and offer the lowest international call rates on the continent. In the absence of a formal banking sector, money transfer/remittance services have sprouted throughout the country, handling up to $1.6 billion in remittances annually, although international concerns over the money transfers into Somalia continues to threaten these services’ ability to operate in Western nations.', '$6.336 billion (2015 est.)', 'bananas, sorghum, corn, coconuts, rice, sugarcane, mangoes, sesame seeds, beans; cattle, sheep, goats; fish', 'light industries, including sugar refining, textiles, wireless communication', '4.154 million (2016 est.)', 'livestock, bananas, hides, fish, charcoal, scrap metal', '344 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '6O (2016)', '61 (2013)', '-', '-', '-', '22,100 km', '-', '2018-02-07 18:03:35', NULL),
(208, 'ZA', 'za', 'South Africa', 'Dutch traders landed at the southern tip of modern day South Africa in 1652 and established a stopover point on the spice route between the Netherlands and the Far East, founding the city of Cape Town. After the British seized the Cape of Good Hope area in 1806, many of the Dutch settlers (Afrikaners, called "Boers" (farmers) by the British) trekked north to found their own republics, Transvaal and Orange Free State. The discovery of diamonds (1867) and gold (1886) spurred wealth and immigration and intensified the subjugation of the native inhabitants. The Afrikaners resisted British encroachments but were defeated in the Second South African War (1899-1902); however, the British and the Afrikaners, ruled together beginning in 1910 under the Union of South Africa, which became a republic in 1961 after a whites-only referendum. In 1948, the Afrikaner-dominated National Party was voted into power and instituted a policy of apartheid - the separate development of the races - which favored the white minority at the expense of the black majority. The African National Congress (ANC) led the opposition to apartheid and many top ANC leaders, such as Nelson MANDELA, spent decades in South Africa''s prisons. Internal protests and insurgency, as well as boycotts by some Western nations and institutions, led to the regime''s eventual willingness to negotiate a peaceful transition to majority rule.\r\nThe first multi-racial elections in 1994 following the end of apartheid ushered in majority rule under an ANC-led government. South Africa has since struggled to address apartheid-era imbalances in decent housing, education, and health care. ANC infighting came to a head in 2008 when President Thabo MBEKI was recalled by Parliament, and Deputy President Kgalema MOTLANTHE, succeeded him as interim president. Jacob ZUMA became president after the ANC won general elections in 2009; he was reelected in 2014. His government has been plagued by numerous scandals, leading to gains by opposition parties at the municipal level in 2016.', 'Africa', '29 00 S, 24 00 E', '1,219,090 sq km', '54,841,552', 'South African(s)', 'black African 80.2%, white 8.4%, colored 8.8%, Indian/Asian 2.5%', 'isiZulu (official) 22.7%, isiXhosa (official) 16%, Afrikaans (official) 13.5%, English (official) 9.6%, Sepedi (official) 9.1%, Setswana (official) 8%, Sesotho (official) 7.6%, Xitsonga (official) 4.5%, siSwati (official) 2.5%, Tshivenda (official) 2.4%, isiNdebele (official) 2.1%, sign language 0.5%, other 1.6% (2011 est.)', 'Protestant 36.6% (Zionist Christian 11.1%, Pentecostal/Charismatic 8.2%, Methodist 6.8%, Dutch Reformed 6.7%, Anglican 3.8%), Catholic 7.1%, Muslim 1.5%, other Christian 36%, other 2.3%, unspecified 1.4%, none 15.1% (2001 est.)', 'Republic of South Africa', 'parliamentary republic', 'Pretoria (administrative capital); Cape Town (legi', '9 provinces; Eastern Cape, Free State, Gauteng, KwaZulu-Natal, Limpopo, Mpumalanga, Northern Cape, North West, Western Cape', '31 May 1910 (Union of South Africa formed from four British colonies: Cape Colony, Natal, Transvaal, and Orange Free State); 31 May 1961 (republic declared); 27 April 1994 (majority rule)', 'South Africa is a middle-income emerging market with an abundant supply of natural resources; well-developed financial, legal, communications, energy, and transport sectors; and a stock exchange that is Africa’s largest and among the top 20 in the world.\r\nEconomic growth has decelerated in recent years, slowing to an estimated 0.3% in 2016. Unemployment, poverty, and inequality - among the highest in the world - remain a challenge. Official unemployment is roughly 26% of the workforce, and runs significantly higher among black youth. Even though the country''s modern infrastructure supports a relatively efficient distribution of goods to major urban centers throughout the region, unstable electricity supplies retard growth. Eskom, the state-run power company, is building three new power stations and is installing new power demand management programs to improve power grid reliability; in late 2016 they issued a request for bids to revamp South Africa’s nuclear power generating capabilities. Load shedding and resulting rolling blackouts gripped many parts of South Africa in late 2014 and early 2015 because of electricity supply constraints due to technical problems at some generation units, unavoidable planned maintenance, and an accident at a power station.\r\nSouth Africa''s economic policy has focused on controlling inflation; however, the country faces structural constraints that also limit economic growth, such as skills shortages, declining global competitiveness, and frequent work stoppages due to strike action. The government faces growing pressure from urban constituencies to improve the delivery of basic services to low-income areas, to increase job growth, and to provide university level-education at affordable prices. Political infighting among South Africa’s ruling party and the volatility of the rand risks economic growth. International investors are concerned about the country’s long-term economic stability; as of December 2016, most major international credit ratings agencies placed South Africa only one level above junk bond status.', '$294.9 billion (2016 est.)', 'corn, wheat, sugarcane, fruits, vegetables; beef, poultry, mutton, wool, dairy products', 'mining (world''s largest producer of platinum, gold, chromium), automobile assembly, metalworking, machinery, textiles, iron and steel, chemicals, fertilizer, foodstuffs, commercial ship repair', '21.53 million (2016 est.)', 'gold, diamonds, platinum, other metals and minerals, machinery and equipment', '229.2 billion kWh (2015 est.)', '2,000 bbl/day (2016 est.)', '431,000 bbl/day (2014 est.)', '1.1 billion cu m (2015 est.)', 'ZS (2016)', '566 (2013)', '1 (2013)', 'condensate 94 km; gas 1,293 km; oil 992 km; refined products 1,460 km (2013)', '20,986 km', '747,014 km', '-', '2018-02-07 18:03:35', NULL),
(209, 'GS', 'gs', 'South Georgia and South Sandwich Islands', 'The islands, with large bird and seal populations, lie approximately 1,000 km east of the Falkland Islands and have been under British administration since 1908 - except for a brief period in 1982 when Argentina occupied them. Grytviken, on South Georgia, was a 19th and early 20th century whaling station. Famed explorer Ernest SHACKLETON stopped there in 1914 en route to his ill-fated attempt to cross Antarctica on foot. He returned some 20 months later with a few companions in a small boat and arranged a successful rescue for the rest of his crew, stranded off the Antarctic Peninsula. He died in 1922 on a subsequent expedition and is buried in Grytviken. Today, the station houses scientists from the British Antarctic Survey. Recognizing the importance of preserving the marine stocks in adjacent waters, the UK, in 1993, extended the exclusive fishing zone from 12 nm to 200 nm around each island.', 'Antarctic Region', '54 30 S, 37 00 W', '3,903 sq km', 'no indigenous inhabitants', '-', '-', '', '-', 'South Georgia and the South Sandwich Islands', '-', '-', '-', '-', 'Some fishing takes place in adjacent waters. Harvesting finfish and krill are potential sources of income. The islands receive income from postage stamps produced in the UK, the sale of fishing licenses, and harbor and landing fees from tourist vessels. Tourism from specialized cruise ships is increasing rapidly.', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '2018-02-07 18:03:35', NULL);
