(210, 'KR', 'kr', 'South Korea', 'An independent kingdom for much of its long history, Korea was occupied by Japan beginning in 1905 following the Russo-Japanese War. In 1910, Tokyo formally annexed the entire Peninsula. Korea regained its independence following Japan''s surrender to the US in 1945. After World War II, a democratic-based government (Republic of Korea, ROK) was set up in the southern half of the Korean Peninsula while a communist-style government was installed in the north (Democratic People''s Republic of Korea, DPRK). During the Korean War (1950-53), US troops and UN forces fought alongside ROK soldiers to defend South Korea from a DPRK invasion supported by China and the Soviet Union. A 1953 armistice split the Peninsula along a demilitarized zone at about the 38th parallel. PARK Chung-hee took over leadership of the country in a 1961 coup. During his regime, from 1961 to 1979, South Korea achieved rapid economic growth, with per capita income rising to roughly 17 times the level of North Korea.\r\nSouth Korea held its first free presidential election under a revised democratic constitution in 1987, with former ROK Army general ROH Tae-woo winning a close race. In 1993, KIM Young-sam (1993-98) became the first civilian president of South Korea''s new democratic era. President KIM Dae-jung (1998-2003) won the Nobel Peace Prize in 2000 for his contributions to South Korean democracy and his "Sunshine" policy of engagement with North Korea. President PARK Geun-hye, daughter of former ROK President PARK Chung-hee, took office in February 2013 as South Korea''s first female leader. In December 2016, the National Assembly passed an impeachment motion against President PARK over her alleged involvement in a corruption and influence-peddling scandal, immediately suspending her presidential authorities. The impeachment was upheld in March 2017, triggering an early presidential election in May 2017 won by MOON Jae-in. South Korea will host the Winter Olympic Games in February 2018. Discord with North Korea has permeated inter-Korean relations for much of the past decade, highlighted by the North''s attacks on a South Korean ship and island in 2010, the exchange of artillery fire across the DMZ in 2015, and multiple nuclear and missile tests in 2016 and 2017.', 'Asia', '37 00 N, 127 30 E', '99,720 sq km', '51,181,299 (July 2017 est.)', 'Korean(s)', 'homogeneous', 'Korean, English (widely taught in junior high and high school)', 'Protestant 19.7%, Buddhist 15.5%, Catholic 7.9%, none 56.9% (2015 est.)', 'Republic of Korea', 'presidential republic', 'Seoul; note - Sejong, located some 120 km (75 mi) ', '9 provinces (do, singular and plural), 6 metropolitan cities (gwangyeoksi, singular and plural), 1 special city (teugbyeolsi), and 1 special self-governing city (teukbyeoljachisi)\r\nprovinces: Chungbuk (North Chungcheong), Chungnam (South Chungcheong), Gangwon, Gyeongbuk (North Gyeongsang), Gyeonggi, Gyeongnam (South Gyeongsang), Jeju, Jeonbuk (North Jeolla), Jeonnam (South Jeolla)\r\nmetropolitan cities: Busan (Pusan), Daegu (Taegu), Daejeon (Taejon), Gwangju (Kwangju), Incheon (Inch''on), Ulsan\r\nspecial city: Seoul\r\nspecial self-governing city: Sejong', '15 August 1945 (from Japan)', 'South Korea over the past four decades has demonstrated incredible economic growth and global integration to become a high-tech industrialized economy. In the 1960s, GDP per capita was comparable with levels in the poorer countries of Africa and Asia. In 2004, South Korea joined the trillion-dollar club of world economies.\r\nA system of close government and business ties, including directed credit and import restrictions, initially made this success possible. The government promoted the import of raw materials and technology at the expense of consumer goods and encouraged savings and investment over consumption.\r\nThe Asian financial crisis of 1997-98 exposed longstanding weaknesses in South Korea''s development model, including high debt/equity ratios and massive short-term foreign borrowing. GDP plunged by 7% in 1998, and then recovered by 9% in 1999-2000. South Korea adopted numerous economic reforms following the crisis, including greater openness to foreign investment and imports. Growth moderated to about 4% annually between 2003 and 2007.\r\nSouth Korea''s export-focused economy was hit hard by the 2008 global economic downturn, but quickly rebounded in subsequent years, reaching over 6% growth in 2010. The US-Korea Free Trade Agreement was ratified by both governments in 2011 and went into effect in March 2012. Between 2012 and 2016, the economy experienced slow growth – 2%-3% per year - due to sluggish domestic consumption, a drop in foreign demand for South Korean exports, increased competition from regional rivals such as China and Japan, and declining investment. The administration in 2016 faced the challenge of balancing heavy reliance on exports with domestic restructuring efforts in the country’s shipbuilding and shipping industries.\r\nThe South Korean economy''s short-term challenges include a potential loss of consumer confidence due to issues with its mobile phone industry, as well as uncertainty stemming from a tumultuous domestic political situation. In the long-term, South Korea must deal with a rapidly aging population, inflexible labor market, dominance of large conglomerates (chaebols), and the heavy reliance on exports, which comprise more than 40% of GDP. South Korea’s low overall unemployment rate masks problems with high youth unemployment, low worker productivity, high labor underutilization, and low female participation in the workforce. The government has tried to implement structural reforms, but continues to face significant headwind from vested interests. Finally, the country could eventually face an unprecedented financial burden in the event the unification of the Korean Peninsula were to occur.', '$1.411 trillion (2016 est.)', 'rice, root crops, barley, vegetables, fruit, cattle, pigs, chickens, milk, eggs, fish', 'electronics, telecommunications, automobile production, chemicals, shipbuilding, steel', '27.25 million (2016 est.)', 'semiconductors, petrochemicals, automobile/auto parts, ships, wireless communication equipment, flat displays, steel, electronics, plastics, computers', '528.1 billion kWh (2016 est.)', '0 bbl/day (2016 est.)', '3.114 million bbl/day (2016 est.)', '188 million cu m (2015 est.)', 'HL (2016)', '111 (2013)', '466 (2013)', 'gas 2,216 km; oil 16 km; refined products 889 km (2013)', '3,874 km', '99,025 km', '1,600 km (most navigable only by small craft) (2011)', '2018-02-07 18:03:35', NULL),
(211, 'SS', 'ss', 'South Sudan', 'Egypt attempted to colonize the region of southern Sudan by establishing the province of Equatoria in the 1870s. Islamic Mahdist revolutionaries overran the region in 1885, but in 1898 a British force was able to overthrow the Mahdist regime. An Anglo-Egyptian Sudan was established the following year with Equatoria being the southernmost of its eight provinces. The isolated region was largely left to itself over the following decades, but Christian missionaries converted much of the population and facilitated the spread of English. When Sudan gained its independence in 1956, it was with the understanding that the southerners would be able to participate fully in the political system. When the Arab Khartoum government reneged on its promises, a mutiny began that led to two prolonged periods of conflict (1955-1972 and 1983-2005) in which perhaps 2.5 million people died - mostly civilians - due to starvation and drought. Ongoing peace talks finally resulted in a Comprehensive Peace Agreement, signed in January 2005. As part of this agreement, the south was granted a six-year period of autonomy to be followed by a referendum on final status. The result of this referendum, held in January 2011, was a vote of 98% in favor of secession.\r\nSince independence on 9 July 2011, South Sudan has struggled with good governance and nation building and has attempted to control rebel militia groups operating in its territory. Economic conditions have deteriorated since January 2012 when the government decided to shut down oil production following bilateral disagreements with Sudan. In December 2013, conflict between government and opposition forces led to a humanitarian crisis with millions of South Sudanese displaced and food insecure. The warring parties signed a peace agreement in August 2015 that created a transitional government of national unity in April 2016. However, in July 2016, fighting broke out between the two principal signatories plunging the country back into conflict.', 'Africa', '8 00 N, 30 00 E', '644,329 sq km', '13,026,129 (July 2017 est.)', 'South Sudanese (singular and plural)', 'Dinka 35.8%, Nuer 15.6%, Shilluk, Azande, Bari, Kakwa, Kuku, Murle, Mandari, Didinga, Ndogo, Bviri, Lndi, Anuak, Bongo, Lango, Dungotona, Acholi, Baka, Fertit (2011 est.)', 'English (official), Arabic (includes Juba and Sudanese variants), regional languages include Dinka, Nuer, Bari, Zande, Shilluk', 'animist, Christian', 'Republic of South Sudan', 'presidential republic', 'Juba', '10 states; Central Equatoria, Eastern Equatoria, Jonglei, Lakes, Northern Bahr el Ghazal, Unity, Upper Nile, Warrap, Western Bahr el Ghazal, Western Equatoria', '9 July 2011 (from Sudan)', 'Following several decades of civil war with Sudan, industry and infrastructure in landlocked South Sudan are severely underdeveloped and poverty is widespread. Subsistence agriculture provides a living for the vast majority of the population. Property rights are insecure and price signals are weak, because markets are not well organized. After independence, South Sudan''s central bank issued a new currency, the South Sudanese pound, allowing a short grace period for turning in the old currency.\r\nSouth Sudan has little infrastructure - approximately 200 kilometers of paved roads. Electricity is produced mostly by costly diesel generators, and indoor plumbing and potable water are scarce. South Sudan depends largely on imports of goods, services, and capital - mainly from Uganda, Kenya and Sudan.\r\nNevertheless, South Sudan does have abundant natural resources. At independence in 2011, South Sudan produced nearly three-fourths of former Sudan''s total oil output of nearly a half million barrels per day. The Government of South Sudan used to rely on oil for the vast majority of its budget revenues before oil production fell sharply. Oil is exported through a pipeline that runs to refineries and shipping facilities at Port Sudan on the Red Sea. The economy of South Sudan will remain linked to Sudan for some time, given the long lead time and great expense required to build another pipeline, should the government decide to do so. In January 2012, South Sudan suspended production of oil because of its dispute with Sudan over transshipment fees. This suspension lasted 15 months and had a devastating impact on GDP, which declined by 48% in 2012. With the resumption of oil flows the economy rebounded strongly during the second half of calendar year 2013. This occurred in spite of the fact that oil production, at an average level of 222,000 barrels per day, was 40% lower compared with 2011, prior to the shutdown. GDP grew by nearly 30% in 2013. However, the outbreak of conflict in December 2013 combined with a further reduction of oil production and exports, meant that GDP growth fell significantly in 2014 and 2015 as poverty and food insecurity rose. South Sudan holds one of the richest agricultural areas in Africa with fertile soils and abundant water supplies. Currently the region supports 10-20 million head of cattle.\r\nSouth Sudan is currently burdened by considerable debt because of increased military spending and revenue shortfalls due to low oil prices and decreased production. South Sudan has received more than $4 billion in foreign aid since 2005, largely from the UK, the US, Norway, and the Netherlands. Annual inflation peaked at over 800% in October 2016. The government has relied on borrowing from the central bank to fund budget expenses. The decision in December 2015 by the central bank to abandon a fixed exchange rate and allow the South Sudanese Pound to float has not reduced inflation in the short term. Long-term challenges include diversifying the formal economy, alleviating poverty, maintaining macroeconomic stability, improving tax collection and financial management and improving the business environment.', '$3.056 billion (2016 est.)', 'sorghum, maize, rice, millet, wheat, gum arabic, sugarcane, mangoes, papayas, bananas, sweet potatoes, sunflower seeds, cotton, sesame seeds, cassava (manioc, tapioca), beans, peanuts; cattle, sheep', '-', '-', '-', '310.3 million kWh (2015 est.)', '152,500 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'Z8 (2016)', '85 (2013)', '1 (2013)', '-', '248 km', '7,000 km', 'see entry for Sudan', '2018-02-07 18:03:35', NULL),
(212, 'ES', 'es', 'Spain', 'Spain''s powerful world empire of the 16th and 17th centuries ultimately yielded command of the seas to England. Subsequent failure to embrace the mercantile and industrial revolutions caused the country to fall behind Britain, France, and Germany in economic and political power. Spain remained neutral in World War I and II but suffered through a devastating civil war (1936-39). A peaceful transition to democracy following the death of dictator Francisco FRANCO in 1975, and rapid economic modernization (Spain joined the EU in 1986) gave Spain a dynamic and rapidly growing economy and made it a global champion of freedom and human rights. More recently Spain has emerged from a severe economic recession that began in mid-2008, posting three straight years of GDP growth above the EU average. Unemployment has fallen, but remains high especially among youth. Spain is the Eurozone’s fourth largest economy.', 'Europe', '40 00 N, 4 00 W', '505,370 sq km', '48,958,159 (July 2017 est.)', 'Spaniard(s)', 'composite of Mediterranean and Nordic types', 'Castilian Spanish (official nationwide) 74%, Catalan (official in Catalonia, the Balearic Islands, and the Valencian Community (where it is known as Valencian)) 17%, Galician (official in Galicia) 7%, Basque (official in the Basque Country and in the Basque-speaking area of Navarre) 2%, Aranese (official in the northwest corner of Catalonia (Vall d''Aran) along with Catalan, <5,000 speakers)', 'Roman Catholic 67.8%, atheist 9.1%, other 2.2%, non-believer 18.4%, unspecified 2.5% (2016 est.)', 'Kingdom of Spain', 'parliamentary constitutional monarchy', 'Madrid', '17 autonomous communities (comunidades autonomas, singular - comunidad autonoma) and 2 autonomous cities* (ciudades autonomas, singular - ciudad autonoma); Andalucia; Aragon; Asturias; Canarias (Canary Islands); Cantabria; Castilla-La Mancha; Castilla-Leon; Cataluna (Castilian), Catalunya (Catalan), Catalonha (Aranese) [Catalonia]; Ceuta*; Comunidad Valenciana (Castilian), Comunitat Valenciana (Valencian) [Valencian Community]; Extremadura; Galicia; Illes Baleares (Balearic Islands); La Rioja; Madrid; Melilla*; Murcia; Navarra (Castilian), Nafarroa (Basque) [Navarre]; Pais Vasco (Castilian), Euskadi (Basque) [Basque Country]', '1492; the Iberian peninsula was characterized by a variety of independent kingdoms prior to the Muslim occupation that began in the early 8th century A.D. and lasted nearly seven centuries; the small Christian redoubts of the north began the reconquest almost immediately, culminating in the seizure of Granada in 1492; this event completed the unification of several kingdoms and is traditionally considered the forging of present-day Spain', 'After experiencing a prolonged recession in the wake of the global financial crisis that began in 2008, in 2016 Spain marked the third full year of positive economic growth in nine years, largely due to increased private consumption. At the onset of the financial crisis, Spain''s GDP contracted by 3.7% in 2009, ending a 16-year growth trend, and continued contracting through most of 2013. In that year, the government successfully shored up struggling banks - exposed to the collapse of Spain''s depressed real estate and construction sectors - and in January 2014 completed an EU-funded restructuring and recapitalization program for its financial sector.\r\nUntil 2014, credit contraction in the private sector, fiscal austerity, and high unemployment weighed on domestic consumption and investment. The unemployment rate rose from a low of about 8% in 2007 to more than 26% in 2013, but labor reforms prompted a modest reduction to 19.7% in 2016. High unemployment has strained Spain''s public finances, as spending on social benefits increased while tax revenues fell. Spain’s budget deficit peaked at 11.4% of GDP in 2010, but Spain gradually reduced the deficit to about 5% of GDP in 2015, and 4.1% of GDP in 2016. Public debt has increased substantially – from 60.1% of GDP in 2010 to nearly 99.5% in 2016.\r\nExports were resilient throughout the economic downturn and helped to bring Spain''s current account into surplus in 2013 for the first time since 1986, where it remained through 2016. Rising labor productivity and an internal devaluation resulting from moderating labor costs and lower inflation have helped to improve foreign investor interest in the economy and positive FDI flows have been restored.\r\nPolitical gridlock after the national elections in December 2015 and June 2016 and ensuing government formation process constrained the caretaker government’s ability to implement needed labor, pension, health care, tax, and education reforms— in 2016. The European Commission criticized Spain’s 2016 budget for easing austerity measures and for its alleged overly optimistic growth and deficit projections. Spain’s borrowing costs are dramatically lower since their peak in mid-2012, and despite the recent uptick in economic activity, inflation has dropped sharply, from 1.5% in 2013 to a negative 0.3% in 2016.', '$1.233 trillion (2016 est.)', 'grain, vegetables, olives, wine grapes, sugar beets, citrus; beef, pork, poultry, dairy products; fish', 'textiles and apparel (including footwear), food and beverages, metals and metal manufactures, chemicals, shipbuilding, automobiles, machine tools, tourism, clay and refractory products, footwear, pharmaceuticals, medical equipment', '22.82 million (2016 est.)', 'machinery, motor vehicles; foodstuffs, pharmaceuticals, medicines, other consumer goods', '267.1 billion kWh (2015 est.)', '2,667 bbl/day (2016 est.)', '1.342 million bbl/day (2016 est.)', '62 million cu m (2015 est.)', 'EC (2016)', '150 (2013)', '10 (2013)', 'gas 10,481 km; oil 616 km; refined products 3,461 km (2013)', '16,101.5 km', '683,175 km', '1,000 km (2012)', '2018-02-07 18:03:35', NULL),
(213, 'LK', 'lk', 'Sri Lanka', 'The first Sinhalese arrived in Sri Lanka late in the 6th century B.C., probably from northern India. Buddhism was introduced circa 250 B.C., and the first kingdoms developed at the cities of Anuradhapura (from circa 200 B.C. to circa A.D. 1000) and Polonnaruwa (from about 1070 to 1200). In the 14th century, a south Indian dynasty established a Tamil kingdom in northern Sri Lanka. The Portuguese controlled the coastal areas of the island in the 16th century and the Dutch in the 17th century. The island was ceded to the British in 1796, became a crown colony in 1802, and was formally united under British rule by 1815. As Ceylon, it became independent in 1948; its name was changed to Sri Lanka in 1972. Prevailing tensions between the Sinhalese majority and Tamil separatists erupted into war in 1983. After two decades of fighting, the government and Liberation Tigers of Tamil Eelam (LTTE) formalized a cease-fire in February 2002 with Norway brokering peace negotiations. Both the LTTE and the government unofficially abrogated the ceasefire and violence between the LTTE and government forces intensified in 2006, but the government regained control of the Eastern Province in 2007. The government officially withdrew from the cease-fire agreement in January 2008 and by May 2009, the remnants of the LTTE had been defeated.\r\nSince the end of the conflict, the government has enacted an ambitious program of economic development projects, many of which are financed by loans from the Government of China. In addition to efforts at reconstructing its economy, the government has resettled more than 95% of those civilians displaced during the final phase of the conflict and released the vast majority of former LTTE combatants captured by Government Security Forces. Slow progress continues on more contentious and politically difficult issues such as reaching a political settlement with Tamil elected representatives and holding accountable those alleged to have been involved in human rights violations and other abuses during the conflict.', 'Asia', '7 00 N, 81 00 E', '65,610 sq km', '22,409,381 (July 2017 est.)', 'Sri Lankan(s)', 'Sinhalese 74.9%, Sri Lankan Tamil 11.2%, Sri Lankan Moors 9.2%, Indian Tamil 4.2%, other 0.5% (2012 est.)', 'Sinhala (official and national language) 74%, Tamil (official and national language) 18%, other 8%', 'Buddhist (official) 70.2%, Hindu 12.6%, Muslim 9.7%, Roman Catholic 6.1%, other Christian 1.3%, other 0.05% (2012 est.)', 'Democratic Socialist Republic of Sri Lanka', 'presidential republic', 'Colombo (commercial capital); Sri Jayewardenepura ', '9 provinces; Central, Eastern, North Central, Northern, North Western, Sabaragamuwa, Southern, Uva, Western', '4 February 1948 (from the UK)', 'Sri Lanka is attempting to sustain economic growth while maintaining macroeconomic stability under an IMF program. The government''s high debt payments and bloated civil service cadre, which have contributed to historically high budget deficits and low tax revenues, remain a concern. Government debt is about 77% of GDP and remains among the highest of the emerging markets.\r\nThe new government in 2015 drastically increased wages for public sector employees, which boosted demand for consumer goods but hurt the overall balance of payments and reduced foreign exchange reserves.\r\nTourism has experienced strong growth during recent years following the resolution of the government''s 26-year conflict with the Liberation Tigers of Tamil Eelam. The government has been pursuing large-scale reconstruction and development projects in its efforts to spur growth.', '$80.52 billion (2016 est.)', 'rice, sugarcane, grains, pulses, oilseed, spices, vegetables, fruit, tea, rubber, coconuts; milk, eggs, hides, beef; fish', 'processing of rubber, tea, coconuts, tobacco and other agricultural commodities; telecommunications, insurance, banking; tourism, shipping; clothing, textiles; cement, petroleum refining, information technology services, construction', '8.805 million (2016 est.)', 'textiles and apparel, tea and spices; rubber manufactures; precious stones; coconut products, fish', '12.64 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '35,650 bbl/day (2014 est.)', '0 cu m (2013 est.)', '4R (2016)', '19 (2013)', '1 (2013)', '-', '1,447 km', '114,093 km', '160 km (primarily on rivers in southwest) (2012)', '2018-02-07 18:03:35', NULL),
(214, 'SD', 'sd', 'Sudan', 'Military regimes favoring Islamic-oriented governments have dominated national politics since independence from Anglo-Egyptian co-rule in 1956. Sudan was embroiled in two prolonged civil wars during most of the remainder of the 20th century. These conflicts were rooted in northern economic, political, and social domination of largely non-Muslim, non-Arab southern Sudanese. The first civil war ended in 1972 but another broke out in 1983. Peace talks gained momentum in 2002-04 with the signing of several accords. The final North/South Comprehensive Peace Agreement (CPA), signed in January 2005, granted the southern rebels autonomy for six years followed by a referendum on independence for Southern Sudan. The referendum was held in January 2011 and indicated overwhelming support for independence. South Sudan became independent on 9 July 2011. Sudan and South Sudan have yet to fully implement security and economic agreements signed in September 2012 relating to the normalization of relations between the two countries. The final disposition of the contested Abyei region has also to be decided.\r\nFollowing South Sudan''s independence, conflict broke out between the government and the Sudan People''s Liberation Movement-North in Southern Kordofan and Blue Nile states (together known as the Two Areas), and has resulted in 1.1 million internally displaced persons or severely affected persons needing humanitarian assistance. A separate conflict broke out in the western region of Darfur in 2003, displacing nearly 2 million people and causing thousands of deaths. Fighting in both the Two Areas and Darfur between government forces and opposition has largely subsided, however the civilian populations are affected by low-level violence including inter-tribal conflict and banditry, largely a result of weak rule of law. The UN and the African Union have jointly commanded a Darfur peacekeeping operation (UNAMID) since 2007. Peacekeeping troops have struggled to address insecurity in Darfur and have increasingly become targets for attacks by armed groups. Sudan also has faced refugee influxes from neighboring countries, primarily Ethiopia, Eritrea, Chad, Central African Republic, and South Sudan. Armed conflict, poor transport infrastructure, and denial of access by both the government and armed opposition have impeded the provision of humanitarian assistance to affected populations.', 'Africa', '15 00 N, 30 00 E', '1,861,484 sq km', '37,345,935 (July 2017 est.)', 'Sudanese (singular and plural)', 'Sudanese Arab (approximately 70%), Fur, Beja, Nuba, Fallata', 'Arabic (official), English (official), Nubian, Ta Bedawie, Fur', 'Sunni Muslim, small Christian minority', 'Republic of the Sudan', 'presidential republic', 'Khartoum', '18 states (wilayat, singular - wilayah); Blue Nile, Central Darfur, East Darfur, Gedaref, Gezira, Kassala, Khartoum, North Darfur, North Kordofan, Northern, Red Sea, River Nile, Sennar, South Darfur, South Kordofan, West Darfur, West Kordofan, White Nile', '1 January 1956 (from Egypt and the UK)', 'Sudan has experienced protracted social conflict, civil war, and, in July 2011, the loss of three-quarters of its oil production due to the secession of South Sudan. The oil sector had driven much of Sudan''s GDP growth since 1999. For nearly a decade, the economy boomed on the back of rising oil production, high oil prices, and significant inflows of foreign direct investment. Since the economic shock of South Sudan''s secession, Sudan has struggled to stabilize its economy and make up for the loss of foreign exchange earnings. The interruption of oil production in South Sudan in 2012 for over a year and the consequent loss of oil transit fees further exacerbated the fragile state of Sudan’s economy. Ongoing conflicts in Southern Kordofan, Darfur, and the Blue Nile states, lack of basic infrastructure in large areas, and reliance by much of the population on subsistence agriculture, keep close to half of the population at or below the poverty line.\r\nSudan is also subject to comprehensive US sanctions. Sudan is attempting to develop non-oil sources of revenues, such as gold mining, while carrying out an austerity program to reduce expenditures. The world’s largest exporter of gum Arabic, Sudan produces 75-80% of the world’s total output. Agriculture continues to employ 80% of the work force.\r\nSudan introduced a new currency, still called the Sudanese pound, following South Sudan''s secession, but the value of the currency has fallen since its introduction. Khartoum formally devalued the currency in June 2012, when it passed austerity measures that included gradually repealing fuel subsidies. Sudan also faces high inflation, which reached 47% on an annual basis in November 2012 but subsided to about 20% in 2016-17.', '$91.24 billion (2016 est.)', 'cotton, groundnuts (peanuts), sorghum, millet, wheat, gum Arabic, sugarcane, cassava (manioc, tapioca), mangoes, papaya, bananas, sweet potatoes, sesame seeds; animal feed, sheep and other livestock', 'oil, cotton ginning, textiles, cement, edible oils, sugar, soap distilling, shoes, petroleum refining, pharmaceuticals, armaments, automobile/light truck assembly, milling', '11.92 million (2007 est.)', 'gold; oil and petroleum products; cotton, sesame, livestock, peanuts, gum Arabic, sugar', '12.69 billion kWh (2015 est.)', '104,900 bbl/day (2016 est.)', '89,300 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'ST (2016)', '74 (2013)', '6 (2013)', 'gas 156 km; oil 4,070 km; refined products 1,613 km (2013)', '7,251 km', '11,900 km', '4,068 km (1,723 km open year-round on White and Blue Nile Rivers) (2011)', '2018-02-07 18:03:35', NULL),
(215, 'SR', 'sr', 'Suriname', 'First explored by the Spaniards in the 16th century and then settled by the English in the mid-17th century, Suriname became a Dutch colony in 1667. With the abolition of African slavery in 1863, workers were brought in from India and Java. The Netherlands granted the colony independence in 1975. Five years later the civilian government was replaced by a military regime that soon declared Suriname a socialist republic. It continued to exert control through a succession of nominally civilian administrations until 1987, when international pressure finally forced a democratic election. In 1990, the military overthrew the civilian leadership, but a democratically elected government - a four-party coalition - returned to power in 1991. The coalition expanded to eight parties in 2005 and ruled until August 2010, when voters returned former military leader Desire BOUTERSE and his opposition coalition to power. President BOUTERSE was reelected unopposed in 2015.', 'South America', '4 00 N, 56 00 W', '163,820 sq km', '591,919 (July 2017 est.)', 'Surinamer(s)', 'Hindustani (also known locally as "East Indians"; their ancestors emigrated from northern India in the latter part of the 19th century) 27.4%, "Maroon" (their African ancestors were brought to the country in the 17th and 18th centuries as slaves and escaped to the interior) 21.7%, Creole (mixed white and black) 15.7%, Javanese 13.7%, mixed 13.4%, other 7.6%, unspecified 0.6% (2012 est.)', 'Dutch (official), English (widely spoken), Sranang Tongo (Surinamese, sometimes called Taki-Taki, is the native language of Creoles and much of the younger population and is lingua franca among others), Caribbean Hindustani (a dialect of Hindi), Javanese', 'Protestant 23.6% (includes Evangelical 11.2%, Moravian 11.2%, Reformed .7%, Lutheran .5%), Hindu 22.3%, Roman Catholic 21.6%, Muslim 13.8%, other Christian 3.2%, Winti 1.8%, Jehovah''s Witness 1.2%, other 1.7%, none 7.5%, unspecified 3.2% (2012 est.)', 'Republic of Suriname', 'presidential republic', 'Paramaribo', '10 districts (distrikten, singular - distrikt); Brokopondo, Commewijne, Coronie, Marowijne, Nickerie, Para, Paramaribo, Saramacca, Sipaliwini, Wanica', '25 November 1975 (from the Netherlands)', 'Suriname’s economy is dominated by the mining industry, with exports of oil and gold accounting for approximately 85% of exports and 27% of government revenues. This makes the economy highly vulnerable to mineral price volatility. The worldwide drop in international commodity prices and the cessation of alumina mining in Suriname significantly reduced government revenue and national income during the past few years. After 99 years of operations, a major US aluminum company recently discontinued its activities in Suriname. Public sector revenues fell, together with exports, international reserves, employment, and private sector investment.\r\nEconomic growth declined annually from just under 5% in 2012 to -10.4% in 2016. In January 2011, the government devalued the currency by 20% and raised taxes to reduce the budget deficit. Suriname began instituting macro adjustments between September 2015 and 2016; these included another 20% currency devaluation in November 2015 and foreign currency interventions by the Central Bank until March 2016, after which time the Bank allowed the Surinamese dollar (SRD) to float. By December 2016, the SRD had lost 46% of its value against the dollar. High import price pass-through from depreciation and electricity tariff increases caused inflation to increase 55.5% year-over-year in December 2016.\r\nSuriname''s economic prospects for the medium-term will depend on continued commitment to responsible monetary and fiscal policies and on the introduction of structural reforms to liberalize markets and promote competition. The government''s over-reliance on revenue from the extractive sector colors Suriname''s economic outlook. One credit bureau forecasted that the economy would contract 2% in 2017. Rising international oil prices and higher production by Suriname’s oil company, Staatsolie’s, will lift oil exports. Two new offshore oil exploration wells will draw 100 million dollars in foreign direct investment inflows. Higher gold prices and increased production from the Merian gold mine also will lift exports. However, investment overall is slowing and unemployment is rising, reflecting government spending cuts, weak business confidence, and the completion of large mining infrastructure projects. Fiscal problems, such as a failure to secure sufficient external financing, could result in additional pressure on the exchange rate and inflation.', '$3.625 billion (2016 est.)', 'rice, bananas, palm kernels, coconuts, plantains, peanuts; beef, chickens; shrimp; forest products', 'bauxite and gold mining, alumina production; oil, lumbering, food processing, fishing', '144,000 (2014 est.)', 'alumina, gold, crude oil, lumber, shrimp and fish, rice, bananas', '2.19 billion kWh (2015 est.)', '17,000 bbl/day (2016 est.)', '7,632 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'PZ (2016)', '55 (2013)', '-', 'oil 50 km (2013)', '-', '4,304 km', '1,200 km (most navigable by ships with drafts up to 7 m) (2011)', '2018-02-07 18:03:35', NULL),
