(217, 'SZ', 'sz', 'Swaziland', 'Autonomy for the Swazis of southern Africa was guaranteed by the British in the late 19th century; independence was granted in 1968. Student and labor unrest during the 1990s pressured King MSWATI III, Africa''s last absolute monarch, to grudgingly allow political reform and greater democracy, although he has backslid on these promises in recent years. A constitution came into effect in 2006, but the legal status of political parties was not defined and their status remains unclear. Swaziland has surpassed Botswana as the country with the world''s highest known HIV/AIDS prevalence rate.', 'Africa', '26 30 S, 31 30 E', '17,364 sq km', '1,467,152', 'Swazi(s)', 'African 97%, European 3%', 'English (official, used for government business), siSwati (official)', 'Christian 90% (Zionist - a blend of Christianity and indigenous ancestral worship - 40%, Roman Catholic 20%, other 30% - includes Anglican, Methodist, Mormon, Jehovah''s Witness), Muslim 2%, other 8% (includes Baha''i, Buddhist, Hindu, indigenous religionist, Jewish) (2015 est.)', 'Kingdom of Swaziland', 'absolute monarchy', 'Mbabane (administrative capital); Lobamba (royal a', '4 regions; Hhohho, Lubombo, Manzini, Shiselweni', '6 September 1968 (from the UK)', 'A small, landlocked kingdom, Swaziland is bordered in the north, west and south by the Republic of South Africa and by Mozambique in the east. Swaziland depends on South Africa for 60% of its exports and for more than 90% of its imports. Swaziland''s currency is pegged to the South African rand, effectively relinquishing Swaziland''s monetary policy to South Africa. The government is dependent on customs duties from the Southern African Customs Union (SACU) for 49% of revenue; income tax accounts for 27% and a valued added tax for 19% of revenues. Swaziland is a lower middle income country, but its income distribution is highly skewed, with an estimated 20% of the population controlling 80% of the nation’s wealth. As of 2017, more than one-quarter of the adult population was infected by HIV/AIDS; Swaziland has the world’s highest HIV prevalence rate.\r\nSubsistence agriculture employs approximately 70% of the population. The manufacturing sector diversified in the 1980s and 1990s, but manufacturing has grown little in the last decade. Sugar and soft drink concentrate are the largest foreign exchange earners. Mining has declined in importance in recent years. Coal, gold, diamond, and quarry stone mines are small scale, and the only iron ore mine closed in 2014.\r\nWith an estimated 28% unemployment rate, Swaziland''s need to increase the number and size of small and medium enterprises and to attract foreign direct investment is acute. On 1 January 2015, Swaziland lost its eligibility for benefits under the US African Growth and Opportunity Act after failing to meet benchmarks relating to workers’ rights.\r\nThe IMF forecasted that Swaziland’s economy will grow at a slower pace in 2017 because of a region-wide drought, which is likely to hurt Swaziland’s revenue from sugar exports and other agricultural products; tourism and transport sectors will also decline. Overgrazing, soil depletion, drought, and floods are persistent problems. Swaziland’s revenue from SACU receipts also are projected to decline in 2017, making it harder for the government to maintain fiscal balance.', '$3.786 billion (2016 est.)', 'sugarcane, corn, cotton, citrus, pineapples, cattle, goats', 'soft drink concentrates, coal, forestry, sugar processing, textiles, and apparel', '427,900 (2016 est.)', 'soft drink concentrates, sugar, timber, cotton yarn, refrigerators, citrus, and canned fruit', '431 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '3D (2016)', '14 (2013)', '-', '-', '301 km', '3,594 km', '-', '2018-02-07 18:03:36', NULL),
(218, 'SE', 'se', 'Sweden', 'A military power during the 17th century, Sweden has not participated in any war for two centuries. An armed neutrality was preserved in both world wars. Sweden''s long-successful economic formula of a capitalist system intermixed with substantial welfare elements was challenged in the 1990s by high unemployment and in 2000-02 and 2009 by the global economic downturns, but fiscal discipline over the past several years has allowed the country to weather economic vagaries. Sweden joined the EU in 1995, but the public rejected the introduction of the euro in a 2003 referendum.', 'Europe', '62 00 N, 15 00 E', '450,295 sq km', '9,960,487 (July 2017 est.)', 'Swede(s)', 'indigenous population: Swedes with Finnish and Sami minorities; most common countries of origin among immigrants: Finland, Syria, Iraq, Poland, Iran', 'Swedish (official)', 'Church of Sweden (Lutheran) 63%, other (includes Roman Catholic, Orthodox, Baptist, Muslim, Jewish, and Buddhist) 17% (2016 est.)', 'Kingdom of Sweden', 'parliamentary constitutional monarchy', 'Stockholm', '21 counties (lan, singular and plural); Blekinge, Dalarna, Gavleborg, Gotland, Halland, Jamtland, Jonkoping, Kalmar, Kronoberg, Norrbotten, Orebro, Ostergotland, Skane, Sodermanland, Stockholm, Uppsala, Varmland, Vasterbotten, Vasternorrland, Vastmanland, Vastra Gotaland', '6 June 1523 (Gustav VASA elected king of Sweden, marking the abolishment of the Kalmar Union between Denmark, Norway, and Sweden)', 'Sweden has achieved an enviable standard of living with its combination of free-market capitalism and extensive welfare benefits. Sweden remains outside the euro zone largely out of concern that joining the European Economic and Monetary Union would diminish the country’s sovereignty over its welfare system. Timber, hydropower, and iron ore constitute the resource base of an economy heavily oriented toward foreign trade.\r\nSweden’s economy experienced modest growth in 2014-16, with real GDP growth above 2%, but continues to struggle with deflationary pressure.', '$511 billion (2016 est.)', 'barley, wheat, sugar beets; meat, milk', 'iron and steel, precision equipment (bearings, radio and telephone parts, armaments), wood pulp and paper products, processed foods, motor vehicles', '5.276 million (2016 est.)', 'machinery 35%, motor vehicles, paper products, pulp and wood, iron and steel products, chemicals (2012 est.)', '154.3 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '418,700 bbl/day (2016 est.)', '0 cu m (2015 est.)', 'SE (2016)', '231 (2013)', '2 (2013)', 'gas 1,626 km (2013)', '14,127 km', '573,134 km (includes 2,050 km of expressways)', '2,052 km (2010)', '2018-02-07 18:03:36', NULL),
(219, 'CH', 'ch', 'Switzerland', 'The Swiss Confederation was founded in 1291 as a defensive alliance among three cantons. In succeeding years, other localities joined the original three. The Swiss Confederation secured its independence from the Holy Roman Empire in 1499. A constitution of 1848, subsequently modified in 1874, replaced the confederation with a centralized federal government. Switzerland''s sovereignty and neutrality have long been honored by the major European powers, and the country was not involved in either of the two world wars. The political and economic integration of Europe over the past half century, as well as Switzerland''s role in many UN and international organizations, has strengthened Switzerland''s ties with its neighbors. However, the country did not officially become a UN member until 2002. Switzerland remains active in many UN and international organizations but retains a strong commitment to neutrality.', 'Europe', '47 00 N, 8 00 E', '41,277 sq km', '8,236,303 (July 2017 est.)', 'Swiss (singular and plural)', 'German 65%, French 18%, Italian 10%, Romansch 1%, other 6%', 'German (or Swiss German) (official) 63%, French (official) 22.7%, Italian (official) 8.1%, English 4.9%, Portuguese 3.7%, Albanian 3%, Serbo-Croatian 2.4%, Spanish 2.2%, Romansch (official) 0.5%, other 7.1%', 'Roman Catholic 37.3%, Protestant 24.9%, other Christian 5.8%, Muslim 5.1%, other 1.4%, Jewish 0.2%, none 23.9%, unspecified 1.3% (2015 est.)', 'Swiss Confederation', 'federal republic (formally a confederation)', 'Bern', '26 cantons (cantons, singular - canton in French; cantoni, singular - cantone in Italian; Kantone, singular - Kanton in German); Aargau, Appenzell Ausserrhoden, Appenzell Innerrhoden, Basel-Landschaft, Basel-Stadt, Berne/Bern, Fribourg/Freiburg, Geneve, Glarus, Graubuenden/Grigioni/Grischun, Jura, Luzern, Neuchatel, Nidwalden, Obwalden, Sankt Gallen, Schaffhausen, Schwyz, Solothurn, Thurgau, Ticino, Uri, Valais/Wallis, Vaud, Zug, Zuerich', '1 August 1291 (founding of the Swiss Confederation)', 'Switzerland, a country that espouses neutrality, is a prosperous and modern market economy with low unemployment, a highly skilled labor force, and a per capita GDP among the highest in the world. Switzerland''s economy benefits from a highly developed service sector, led by financial services, and a manufacturing industry that specializes in high-technology, knowledge-based production. Its economic and political stability, transparent legal system, exceptional infrastructure, efficient capital markets, and low corporate tax rates also make Switzerland one of the world''s most competitive economies.\r\nThe Swiss have brought their economic practices largely into conformity with the EU''s to enhance their international competitiveness, but some trade protectionism remains, particularly for its small agricultural sector. The fate of the Swiss economy is tightly linked to that of its neighbors in the euro zone, which purchases half of Swiss exports. The global financial crisis of 2008 and resulting economic downturn in 2009 stalled demand for Swiss exports and put Switzerland into a recession. During this period, the Swiss National Bank (SNB) implemented a zero-interest rate policy to boost the economy, as well as to prevent appreciation of the franc, and Switzerland''s economy began to recover in 2010.\r\nThe sovereign debt crises unfolding in neighboring euro-zone countries, however, coupled with ongoing economic instability in Russia and other eastern European economies continue to pose a significant risk to the Swiss economy, driving up demand for the Swiss franc by investors seeking a safe-haven currency. In January 2015, the SNB abandoned the Swiss franc’s peg to the euro, roiling global currency markets and making active SNB intervention a necessary hallmark of present-day Swiss monetary policy. The independent SNB has upheld its zero interest rate policy and conducted major market interventions to prevent further appreciation of the Swiss franc, but parliamentarians have urged it to do more to weaken the currency. The franc''s strength has made Swiss exports less competitive and weakened the country''s growth outlook; GDP growth fell below 2% per year from 2011-16.\r\nIn recent years, Switzerland has responded to increasing pressure from neighboring countries and trading partners to reform its banking secrecy laws, by agreeing to conform to OECD regulations on administrative assistance in tax matters, including tax evasion. The Swiss government has also renegotiated its double taxation agreements with numerous countries, including the US, to incorporate OECD standards, and is openly considering the possibility of imposing taxes on bank deposits held by foreigners.', '$669 billion (2016 est.)', 'grains, fruits, vegetables; meat, eggs, dairy products', 'machinery, chemicals, watches, textiles, precision instruments, tourism, banking, insurance, pharmaceuticals', '5.119 million (2016 est.)', 'machinery, chemicals, metals, watches, agricultural products', '64.06 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '63,400 bbl/day (2016 est.)', '25 million cu m (2015 est.)', 'HB (2016)', '63 (2013)', '2 (2013)', 'gas 1,800 km; oil 94 km; refined products 7 km (2013)', '5,651.5 km', '71,464 km', '1,292 km (there are 1,227 km of waterways on lakes and rivers for public transport and 65 km on the Rhine River between Basel-Rheinfelden and Schaffhausen-Bodensee for commercial goods transport) (2010)', '2018-02-07 18:03:36', NULL);
INSERT INTO `countries` (`id`, `code`, `slug`, `name`, `background`, `map_reference`, `coordinates`, `area`, `population`, `nationality`, `ethnic_groups`, `languages`, `religions`, `conventional_name`, `government_type`, `capital`, `administrative_divisions`, `independence`, `economy_overview`, `gdp_exchange_rate`, `agriculture`, `industries`, `labor_force`, `exports`, `electricity`, `crude_oil`, `refined_petroleum`, `natural_gas`, `aircraft_code_prefix`, `airports`, `heliports`, `pipelines`, `railways`, `roadways`, `waterways`, `created_at`, `updated_at`) VALUES
(220, 'SY', 'sy', 'Syria', 'Following World War I, France acquired a mandate over the northern portion of the former Ottoman Empire province of Syria. The French administered the area as Syria until granting it independence in 1946. The new country lacked political stability and experienced a series of military coups. Syria united with Egypt in February 1958 to form the United Arab Republic. In September 1961, the two entities separated, and the Syrian Arab Republic was reestablished. In the 1967 Arab-Israeli War, Syria lost the Golan Heights region to Israel. During the 1990s, Syria and Israel held occasional, albeit unsuccessful, peace talks over its return. In November 1970, Hafiz al-ASAD, a member of the socialist Ba''th Party and the minority Alawi sect, seized power in a bloodless coup and brought political stability to the country. Following the death of President Hafiz al-ASAD, his son, Bashar al-ASAD, was approved as president by popular referendum in July 2000. Syrian troops - stationed in Lebanon since 1976 in an ostensible peacekeeping role - were withdrawn in April 2005. During the July-August 2006 conflict between Israel and Hizballah, Syria placed its military forces on alert but did not intervene directly on behalf of its ally Hizballah. In May 2007, Bashar al-ASAD''s second term as president was approved by popular referendum.\r\nInfluenced by major uprisings that began elsewhere in the region, and compounded by additional social and economic factors, antigovernment protests broke out first in the southern province of Dar''a in March 2011 with protesters calling for the repeal of the restrictive Emergency Law allowing arrests without charge, the legalization of political parties, and the removal of corrupt local officials. Demonstrations and violent unrest spread across Syria with the size and intensity of protests fluctuating. The government responded to unrest with a mix of concessions - including the repeal of the Emergency Law, new laws permitting new political parties, and liberalizing local and national elections - and with military force and detentions. The government''s efforts to quell unrest and armed opposition activity led to extended clashes between government forces, their allies, and oppositionists.\r\nInternational pressure on the ASAD regime intensified after late 2011, as the Arab League, the EU, Turkey, and the US expanded economic sanctions against the regime and those entities that support it. In December 2012, the Syrian National Coalition, was recognized by more than 130 countries as the sole legitimate representative of the Syrian people. In September 2015, Russia launched a military intervention on behalf of the ASAD regime, and government-aligned forces recaptured Aleppo city in December 2016, shifting the conflict in the regime’s favor. Political negotiations between the government and opposition delegations at UN-sponsored Geneva conferences since 2014 have failed to produce a resolution of the conflict. Russia, Iran, and Turkey since early 2017 have held negotiations in Astana to establish de-escalation zones to reduce violence in Syria, and Russia has also begun pushing for political negotiations in Sochi. Unrest continues in Syria, and according to an April 2016 UN estimate, the death toll among Syrian Government forces, opposition forces, and civilians was over 400,000. As of December 2017, approximately 13.1 million people were in need of humanitarian assistance in Syria, with 6.3 million people displaced internally, and an additional 5.4 million registered Syrian refugees, making the Syrian situation among the largest humanitarian crises worldwide', 'Middle East', '35 00 N, 38 00 E', '185,180 sq km', '18,028,549 (July 2017 est.)', 'Syrian(s)', 'Arab 90.3%, Kurdish, Armenian, and other 9.7%', 'Arabic (official), Kurdish, Armenian, Aramaic, Circassian, French, English', 'Muslim 87% (official; includes Sunni 74% and Alawi, Ismaili, and Shia 13%), Christian 10% (includes Orthodox, Uniate, and Nestorian), Druze 3%, Jewish (few remaining in Damascus and Aleppo)', 'Syrian Arab Republic', 'presidential republic; highly authoritarian regime', 'Damascus', '14 provinces (muhafazat, singular - muhafazah); Al Hasakah, Al Ladhiqiyah (Latakia), Al Qunaytirah, Ar Raqqah, As Suwayda'', Dar''a, Dayr az Zawr, Dimashq (Damascus), Halab, Hamah, Hims (Homs), Idlib, Rif Dimashq (Damascus Countryside), Tartus', '17 April 1946 (from League of Nations mandate under French administration)', 'Syria''s economy continues to deteriorate amid the ongoing conflict that began in 2011, declining by more than 70% from 2010 to 2016. The government has struggled to address the effects of international sanctions, widespread infrastructure damage, diminished domestic consumption and production, reduced subsidies, and high inflation, which have caused dwindling foreign exchange reserves, rising budget and trade deficits, a decreasing value of the Syrian pound, and falling household purchasing power.\r\nDuring 2014, the ongoing conflict and continued unrest and economic decline worsened the humanitarian crisis and elicited a greater need for international assistance, as the number of people in need inside Syria increased from 9.3 million to 12.2 million, and the number of Syrian refugees increased from 2.2 million to more than 3.3 million.\r\nPrior to the turmoil, Damascus had begun liberalizing economic policies, including cutting lending interest rates, opening private banks, consolidating multiple exchange rates, raising prices on some subsidized items, and establishing the Damascus Stock Exchange, but the economy remains highly regulated. Long-run economic constraints include foreign trade barriers, declining oil production, high unemployment, rising budget deficits, increasing pressure on water supplies caused by heavy use in agriculture, rapid population growth, industrial expansion, water pollution, and widespread infrastructure damage.', '$24.6 billion (2014 est.)', 'wheat, barley, cotton, lentils, chickpeas, olives, sugar beets; beef, mutton, eggs, poultry, milk', 'petroleum, textiles, food processing, beverages, tobacco, phosphate rock mining, cement, oil seeds crushing, automobile assembly', '3.871 million (2016 est.)', 'crude oil, minerals, petroleum products, fruits and vegetables, cotton fiber, textiles, clothing, meat and live animals, wheat', '16.83 billion kWh (2015 est.)', '28,670 bbl/day (2016 est.)', '111,600 bbl/day (2014 est.)', '4.3 billion cu m (2015 est.)', 'YK (2016)', '90 (2013)', '6 (2013)', 'gas 3,170 km; oil 2,029 km (2013)', '2,052 km', '69,873 km', '900 km (navigable but not economically significant) (2011)', '2018-02-07 18:03:36', NULL),
(221, 'TW', 'tw', 'Taiwan', 'First inhabited by Austronesian people, Taiwan became home to Han immigrants beginning in the late Ming Dynasty (17th century). In 1895, military defeat forced China''s Qing Dynasty to cede Taiwan to Japan, which then governed Taiwan for 50 years. Taiwan came under Chinese Nationalist (Kuomintang, KMT) control after World War II. With the communist victory in the Chinese civil war in 1949, the Nationalist-controlled Republic of China government and 2 million Nationalists fled to Taiwan and continued to claim to be the legitimate government for mainland China and Taiwan based on a 1947 Constitution drawn up for all of China. Until 1987, however, the Nationalist government ruled Taiwan under a civil war martial law declaration dating to 1948. Beginning in the 1970s, Nationalist authorities gradually began to incorporate the native population into the governing structure beyond the local level. The democratization process expanded rapidly in the 1980s, leading to the then illegal founding of Taiwan’s first opposition party (the Democratic Progressive Party or DPP) in 1986 and the lifting of martial law the following year. Taiwan held legislative elections in 1992, the first in over forty years, and its first direct presidential election in 1996. In the 2000 presidential elections, Taiwan underwent its first peaceful transfer of power with the KMT loss to the DPP and afterwards experienced two additional democratic transfers of power in 2008 and 2016. Throughout this period, the island prospered, became one of East Asia''s economic "Tigers," and after 2000 became a major investor in mainland China as cross-Strait ties matured. The dominant political issues continue to be economic reform and growth as well as management of sensitive relations between Taiwan and China.', 'Southeast Asia', '23 30 N, 121 00 E', '35,980 sq km', '23,508,428 (July 2017 est.)', 'Taiwan (singular and plural)', 'more than 95% Han Chinese (including Hoklo, who compose approximately 70% of Taiwan''s population, Hakka, and other groups originating in mainland China), 2.3% indigenous Malayo-Polynesian peoples', 'Mandarin Chinese (official), Taiwanese (Min), Hakka dialects', 'Buddhist 35.3%, Taoist 33.2%, Christian 3.9%, Taoist or Confucian folk religionist approximately 10%, none or unspecified 18.2% (2005 est.)', 'none', 'semi-presidential republic', 'Taipei', 'includes main island of Taiwan plus smaller islands nearby and off coast of China''s Fujian Province; Taiwan is divided into 13 counties (xian, singular and plural), 3 cities (shi, singular and plural), and 6 special municipalities directly under the jurisdiction of the Executive Yuan\r\ncounties: Changhua, Chiayi, Hsinchu, Hualien, Kinmen, Lienchiang, Miaoli, Nantou, Penghu, Pingtung, Taitung, Yilan, Yunlin\r\ncities: Chiayi, Hsinchu, Keelung\r\nspecial municipalities: Kaohsiung (city), New Taipei (city), Taichung (city), Tainan (city), Taipei (city), Taoyuan (city)', '-', 'Taiwan has a dynamic capitalist economy that is driven largely by industrial manufacturing, and especially exports of electronics, machinery, and petrochemicals. This heavy dependence on exports exposes the economy to fluctuations in global demand. Taiwan''s diplomatic isolation, low birth rate, rapidly aging population, and increasing competition from China and other Asia Pacific markets are other major long-term challenges.\r\nFollowing the landmark Economic Cooperation Framework Agreement (ECFA) signed with China in June 2010, Taiwan in July 2013 signed a free trade deal with New Zealand - Taipei’s first-ever with a country with which it does not maintain diplomatic relations - and, in November of that year, inked a trade pact with Singapore. However, follow-on components of the ECFA, including a signed agreement on trade in services and negotiations on trade in goods and dispute resolution, have stalled. In early 2014, the government bowed to public demand and proposed a new law governing the oversight of cross-Strait agreements, before any additional deals with China are implemented; the legislature has yet to vote on such legislation, leaving the future of ECFA uncertain. President TSAI since taking office in May 2016 has promoted greater economic integration with South and Southeast Asia through the New Southbound Policy initiative and has also expressed interest in Taiwan joining the Trans-Pacific Partnership as well as bilateral trade deals with partners such as the US.\r\nTaiwan''s total fertility rate of just over one child per woman is among the lowest in the world, raising the prospect of future labor shortages, falling domestic demand, and declining tax revenues. Taiwan''s population is aging quickly, with the number of people over 65 expected to account for nearly 20% of the island''s total population by 2025.\r\nThe island runs a trade surplus with many economies, including China and the US, and its foreign reserves are the world''s fifth largest, behind those of China, Japan, Saudi Arabia, and Switzerland. In 2006, China overtook the US to become Taiwan''s second-largest source of imports after Japan. China is also the island''s number one destination for foreign direct investment. Taiwan since 2009 has gradually loosened rules governing Chinese investment and has also secured greater market access for its investors on the mainland. In August 2012, the Taiwan Central Bank signed a memorandum of understanding (MOU) on cross-Strait currency settlement with its Chinese counterpart. The MOU allows for the direct settlement of Chinese renminbi (RMB) and the New Taiwan dollar across the Strait, which has helped Taiwan develop into a local RMB hub.\r\nCloser economic links with the mainland bring opportunities for Taiwan’s economy but also pose challenges as political differences remain unresolved and China’s economic growth is slowing. Domestic economic issues loomed large in public debate ahead of the January 2016 presidential and legislative elections, including concerns about stagnant wages, high housing prices, youth unemployment, job security, and financial security in retirement.', '$529.6 billion (2016 est.)', 'rice, vegetables, fruit, tea, flowers; pigs, poultry; fish', 'electronics, communications and information technology products, petroleum refining, chemicals, textiles, iron and steel, machinery, cement, food processing, vehicles, consumer products, pharmaceuticals', '11.73 million (2016 est.)', 'semiconductors, petrochemicals, automobile/auto parts, ships, wireless communication equipment, flat display displays, steel, electronics, plastics, computers', '264.1 billion kWh (2016 est.)', '196 bbl/day (2016 est.)', '917,500 bbl/day (2014 est.)', '340 million cu m (2015 est.)', 'B (2016)', '37 (2013)', '31 (2013)', 'condensate 25 km; gas 802 km; oil 241 km (2013)', '1,597 km', '42,520 km', '-', '2018-02-07 18:03:36', NULL),
(222, 'TJ', 'tj', 'Tajikistan', 'The Tajik people came under Russian rule in the 1860s and 1870s, but Russia''s hold on Central Asia weakened following the Revolution of 1917. Bands of indigenous guerrillas (called "basmachi") fiercely contested Bolshevik control of the area, which was not fully reestablished until 1925. Tajikistan was first created as an autonomous republic within Uzbekistan in 1924, but the USSR designated Tajikistan a separate republic in 1929 and transferred to it much of present-day Sughd province. Ethnic Uzbeks form a substantial minority in Tajikistan, and ethnic Tajiks an even larger minority in Uzbekistan. Tajikistan became independent in 1991 following the breakup of the Soviet Union, and experienced a civil war between regional factions from 1992 to 1997. Tajikistan has endured several domestic security incidents since 2010, including armed conflict between government forces and local strongmen in the Rasht Valley and between government forces and criminal groups in Gorno-Badakhshan Autonomous Oblast. In September 2015, government security forces rebuffed attacks led by a former high-ranking official in the Ministry of Defense. President Emomali RAHMON, who came to power during the civil war, used the attacks to ban the main opposition political party in Tajikistan. In May 2016, RAHMON further strengthened his position by having himself designated "Leader of the Nation" with limitless terms and lifelong immunity through constitutional amendments ratified in a referendum. The referendum also lowered the minimum age required to run for president from 35 to 30, which would make RAHMON''s son Rustam EMOMALI, eligible to run for president in 2020. The country remains the poorest in the former Soviet sphere. Tajikistan became a member of the WTO in March 2013. However, its economy continues to face major challenges, including dependence on remittances from Tajiks working in Russia, pervasive corruption, and the opiate trade emanating from neighboring Afghanistan.', 'Asia', '39 00 N, 71 00 E', '144,100 sq km', '8,468,555 (July 2017 est.)', 'Tajikistani(s)', 'Tajik 84.3%, Uzbek 13.8% (includes Lakai, Kongrat, Katagan, Barlos, Yuz), other 2% (includes Kyrgyz, Russian, Turkmen, Tatar, Arab) (2010 est.)', 'Tajik (official), Russian widely used in government and business', 'Sunni Muslim 85%, Shia Muslim 5%, other 10% (2003 est.)', 'Republic of Tajikistan', 'presidential republic', 'Dushanbe', '2 provinces (viloyatho, singular - viloyat), 1 autonomous province* (viloyati mukhtor), 1 capital region** (viloyati poytakht), and 1 area referred to as Districts Under Republic Administration***; Dushanbe**, Khatlon (Qurghonteppa), Kuhistoni Badakhshon [Gorno-Badakhshan]* (Khorugh), Nohiyahoi Tobei Jumhuri***, Sughd (Khujand)', '9 September 1991 (from the Soviet Union)', 'Tajikistan is a poor, mountainous country with an economy dominated by minerals extraction, metals processing, agriculture, and reliance on remittances from citizens working abroad. The 1992-97 civil war severely damaged an already weak economic infrastructure and caused a sharp decline in industrial and agricultural production. Today, Tajikistan has one of the lowest per capita GDPs among the 15 former Soviet republics. Less than 7% of the land area is arable and cotton is the most important crop. Tajikistan imports approximately 70% of its food. Mineral resources include silver, gold, uranium, antimony, and tungsten. Industry consists mainly of small obsolete factories in food processing and light industry, substantial hydropower facilities, and a large aluminum plant - currently operating well below its capacity.\r\nBecause of a lack of employment opportunities in Tajikistan, more than one million Tajik citizens work abroad - roughly 90% in Russia - supporting families back home through remittances that in 2014 were equivalent to nearly 50% of GDP. Some experts estimate the value of narcotics transiting Tajikistan is equivalent to 30%-50% of GDP.\r\nSince the end of the civil war, the country has pursued half-hearted reforms and privatizations in the economic sphere, but the poor business climate remains a hurdle to attracting foreign investment. Tajikistan has sought to develop its substantial hydroelectricity potential through partnership with Russian and Iranian investors, and is pursuing completion of the Roghun dam - which, if built according to plan, would be the tallest dam in the world. However, the project is a sensitive issue for downstream neighbors and faces large financing shortfalls. In 2016, Tajikistan officially contracted with Italian firm Salini Impregilo to construct the dam over a 13-year period for $3.9 billion.\r\nRecent slowdowns in the Russian and Chinese economies, low commodity prices, and currency fluctuations are hampering economic growth in Tajikistan. By some estimates, the dollar value of remittances from Russia to Tajikistan dropped by more than 65% in 2015. The government faces challenges financing the public debt, which is equivalent to 35% of GDP, and the National Bank of Tajikistan has aggressively spent its reserves to bolster the weakening somoni, leaving little space for fiscal or monetary measures to counter any additional economic shocks.', '$6.922 billion (2016 est.)', 'cotton, grain, fruits, grapes, vegetables; cattle, sheep, goats', 'aluminum, cement, vegetable oil', '2.295 million (2016 est.)', 'aluminum, electricity, cotton, fruits, vegetable oil, textiles', '16.98 billion kWh (2015 est.)', '180 bbl/day (2016 est.)', '445.8 bbl/day (2014 est.)', '20 million cu m (2015 est.)', 'EY (2016)', '24 (2013)', '-', 'gas 549 km; oil 38 km (2013)', '680 km', '27,767 km (2000)', '200 km (along Vakhsh River) (2011)', '2018-02-07 18:03:36', NULL),
(223, 'TZ', 'tz', 'Tanzania', 'Shortly after achieving independence from Britain in the early 1960s, Tanganyika and Zanzibar merged to form the United Republic of Tanzania in 1964. One-party rule ended in 1995 with the first democratic elections held in the country since the 1970s. Zanzibar''s semi-autonomous status and popular opposition led to two contentious elections since 1995, which the ruling party won despite international observers'' claims of voting irregularities. The formation of a government of national unity between Zanzibar''s two leading parties succeeded in minimizing electoral tension in 2010.', 'Africa', '6 00 S, 35 00 E', '947,300 sq km', '53,950,935', 'Tanzanian(s)', 'mainland - African 99% (of which 95% are Bantu consisting of more than 130 tribes), other 1% (consisting of Asian, European, and Arab); Zanzibar - Arab, African, mixed Arab and African', 'Kiswahili or Swahili (official), Kiunguja (name for Swahili in Zanzibar), English (official, primary language of commerce, administration, and higher education), Arabic (widely spoken in Zanzibar), many local languages', 'Christian 61.4%, Muslim 35.2%, folk religion 1.8%, other 0.2%, unaffiliated 1.4%', 'United Republic of Tanzania', 'presidential republic', 'Dodoma (legislative capital), Dar es Salaam (admin', '30 regions; Arusha, Dar es Salaam, Dodoma, Geita, Iringa, Kagera, Kaskazini Pemba (Pemba North), Kaskazini Unguja (Zanzibar North), Katavi, Kigoma, Kilimanjaro, Kusini Pemba (Pemba South), Kusini Unguja (Zanzibar Central/South), Lindi, Manyara, Mara, Mbeya, Mjini Magharibi (Zanzibar Urban/West), Morogoro, Mtwara, Mwanza, Njombe, Pwani (Coast), Rukwa, Ruvuma, Shinyanga, Simiyu, Singida, Tabora, Tanga', '26 April 1964 (Tanganyika united with Zanzibar to form the United Republic of Tanganyika and Zanzibar); 29 October 1964 (renamed United Republic of Tanzania); notable earlier dates: 9 December 1961 (Tanganyika became independent from UK-administered UN trusteeship); 10 December 1963 (Zanzibar became independent from UK)', 'Tanzania is one of the world''s poorest economies in terms of per capita income, but has achieved high growth rates based on its vast natural resource wealth and tourism. GDP growth in 2009-16 averaged 6%-7% per year. Dar es Salaam used fiscal stimulus measures and easier monetary policies to lessen the impact of the global recession. Tanzania has largely completed its transition to a market economy, though the government retains a presence in sectors such as telecommunications, banking, energy, and mining.\r\nThe economy depends on agriculture, which accounts for more than one-quarter of GDP, provides 85% of exports, and employs about 65% of the work force. All land in Tanzania is owned by the government, which can lease land for up to 99 years. Proposed reforms to allow for land ownership, particularly foreign land ownership, remain unpopular.\r\nThe financial sector in Tanzania has expanded in recent years and foreign-owned banks account for about 48% of the banking industry''s total assets. Competition among foreign commercial banks has resulted in significant improvements in the efficiency and quality of financial services, though interest rates are still relatively high, reflecting high fraud risk. Recent banking reforms have helped increase private-sector growth and investment.\r\nThe World Bank, the IMF, and bilateral donors have provided funds to rehabilitate Tanzania''s aging infrastructure, including rail and port, which provide important trade links for inland countries. In 2013, Tanzania completed the world''s largest Millennium Challenge Compact (MCC) grant, worth $698 million, but in late 2015, the MCC Board of Directors deferred a decision to renew Tanzania’s eligibility because of irregularities in voting in Zanzibar and concerns over the governments use of a controversial cybercrime bill.\r\nUnder the new government elected in 2015, Tanzania has developed an ambitious development agenda focused on creating a better business environment through improved infrastructure, access to financing, and education progress, but implementing budgets remains challenging for the government.', '$47.65 billion (2016 est.)', 'coffee, sisal, tea, cotton, pyrethrum (insecticide made from chrysanthemums), cashew nuts, tobacco, cloves, corn, wheat, cassava (manioc, tapioca), bananas, fruits, vegetables; cattle, sheep, goats', 'agricultural processing (sugar, beer, cigarettes, sisal twine); mining (diamonds, gold, and iron), salt, soda ash; cement, oil refining, shoes, apparel, wood products, fertilizer', '24.05 million (2016 est.)', 'gold, coffee, cashew nuts, manufactures, cotton', '6.025 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '1.1 billion cu m (2015 est.)', '5H (2016)', '166 (2013)', '-', 'gas 311 km; oil 891 km; refined products 8 km (2013)', '4,567 km', '86,472 km', '(Lake Tanganyika, Lake Victoria, and Lake Nyasa (Lake Malawi) are the principal avenues of commerce with neighboring countries; the rivers are not navigable) (2011)', '2018-02-07 18:03:36', NULL),
(224, 'TH', 'th', 'Thailand', 'A unified Thai kingdom was established in the mid-14th century. Known as Siam until 1939, Thailand is the only Southeast Asian country never to have been colonized by a European power. A bloodless revolution in 1932 led to the establishment of a constitutional monarchy. In alliance with Japan during World War II, Thailand became a US treaty ally in 1954 after sending troops to Korea and later fighting alongside the US in Vietnam. Thailand since 2005 has experienced several rounds of political turmoil including a military coup in 2006 that ousted then Prime Minister THAKSIN Chinnawat, followed by large-scale street protests by competing political factions in 2008, 2009, and 2010. THAKSIN''s youngest sister, YINGLAK Chinnawat, in 2011 led the Puea Thai Party to an electoral win and assumed control of the government. A blanket amnesty bill for individuals involved in street protests, altered at the last minute to include all political crimes - including all convictions against THAKSIN - triggered months of large-scale anti-government protests in Bangkok beginning in November 2013.\r\nIn early May 2014, YINGLAK was removed from office by the Constitutional Court and in late May 2014 the Royal Thai Army, led by Royal Thai Army Gen. PRAYUT Chan-ocha, staged a coup against the caretaker government. PRAYUT was appointed prime minister in August 2014. The interim military government created several interim institutions to promote reform and draft a new constitution, which was passed in a national referendum in August 2016. Elections are tentatively set for late-2018. King PHUMIPHON Adunyadet passed away in October 2016 after 70 years on the throne; his only son, WACHIRALONGKON Bodinthrathepphayawarangkun, ascended the throne in December 2016. He signed the new constitution in April 2017. Thailand has also experienced violence associated with the ethno-nationalist insurgency in its southern Malay-Muslim majority provinces. Since January 2004, thousands have been killed and wounded in the insurgency.', 'Southeast Asia', '15 00 N, 100 00 E', '513,120 sq km', '68,414,135', 'Thai (singular and plural)', 'Thai 97.5%, Burmese 1.3%, other 1.1%, unspecified <.1% (2015 est.)', 'Thai (official) 90.7%, Burmese 1.3%, other 8%', 'Buddhist 94.6%, Muslim 4.3%, Christian 1%, other <.1%, none <.1% (2015 est.)', 'Kingdom of Thailand', 'constitutional monarchy; note - interim military-affiliated government since May 2014', 'Bangkok', '76 provinces (changwat, singular and plural) and 1 municipality* (maha nakhon); Amnat Charoen, Ang Thong, Bueng Kan, Buri Ram, Chachoengsao, Chai Nat, Chaiyaphum, Chanthaburi, Chiang Mai, Chiang Rai, Chon Buri, Chumphon, Kalasin, Kamphaeng Phet, Kanchanaburi, Khon Kaen, Krabi, Krung Thep* (Bangkok), Lampang, Lamphun, Loei, Lop Buri, Mae Hong Son, Maha Sarakham, Mukdahan, Nakhon Nayok, Nakhon Pathom, Nakhon Phanom, Nakhon Ratchasima, Nakhon Sawan, Nakhon Si Thammarat, Nan, Narathiwat, Nong Bua Lamphu, Nong Khai, Nonthaburi, Pathum Thani, Pattani, Phangnga, Phatthalung, Phayao, Phetchabun, Phetchaburi, Phichit, Phitsanulok, Phra Nakhon Si Ayutthaya, Phrae, Phuket, Prachin Buri, Prachuap Khiri Khan, Ranong, Ratchaburi, Rayong, Roi Et, Sa Kaeo, Sakon Nakhon, Samut Prakan, Samut Sakhon, Samut Songkhram, Saraburi, Satun, Sing Buri, Si Sa Ket, Songkhla, Sukhothai, Suphan Buri, Surat Thani, Surin, Tak, Trang, Trat, Ubon Ratchathani, Udon Thani, Uthai Thani, Uttaradit, Yala, Yasothon', '1238 (traditional founding date; never colonized)', 'With a relatively well-developed infrastructure, a free-enterprise economy, and generally pro-investment policies, Thailand is highly dependent on international trade, with exports accounting for about two-thirds of GDP. Thailand’s exports include electronics, agricultural commodities, automobiles and parts, and processed foods. The industry and service sectors produce about 90% of GDP. The agricultural sector, comprised mostly of small-scale farms, contributes only 10% of GDP but employs about one-third of the labor force. Thailand has attracted an estimated 3.0-4.5 million migrant workers, mostly from neighboring countries.\r\nOver the last few decades, Thailand has sustained strong growth and has reduced poverty substantially. In 2013, the Thai Government implemented a nationwide 300 baht (roughly $10) per day minimum wage policy and deployed new tax reforms designed to lower rates on middle-income earners.\r\nGrowth has slowed in the last few years, however, due to domestic political turmoil and sluggish global demand. Nevertheless, Thailand’s economic fundamentals are sound, with low inflation, low unemployment, and reasonable public and external debt levels. Tourism and government spending - mostly on infrastructure and short-term stimulus measures – have helped to boost the economy, and The Bank of Thailand has been supportive, with several interest rate reductions.\r\nOver the longer-term, Thailand faces labor shortages, and domestic debt levels, political uncertainty, and an aging population pose risks to growth.', '$407.1 billion (2016 est.)', 'rice, cassava (manioc, tapioca), rubber, corn, sugarcane, coconuts, palm oil, pineapple, livestock, fish products', 'tourism, textiles and garments, agricultural processing, beverages, tobacco, cement, light manufacturing such as jewelry and electric appliances, computers and parts, integrated circuits, furniture, plastics, automobiles and automotive parts, agricultural machinery, air conditioning and refrigeration, ceramics, aluminum, chemical, environmental management, glass, granite and marble, leather, machinery and metal work, petrochemical, petroleum refining, pharmaceuticals, printing, pulp and paper, rubber, sugar, rice, fishing, cassava, world''s second-largest tungsten producer and third-largest tin producer', '38.3 million (2016 est.)', 'automobiles and parts, computer and parts, jewelry and precious stones, polymers of ethylene in primary forms, refine fuels, electronic integrated circuits, chemical products, rice, fish products, rubber products, sugar, cassava, poultry, machinery and parts, iron and steel and their products', '167.9 billion kWh (2015 est.)', '257,500 bbl/day (2016 est.)', '1.213 million bbl/day (2014 est.)', '39.82 billion cu m (2015 est.)', 'HS (2016)', '101 (2013)', '7 (2013)', 'condensate 2 km; gas 5,900 km; liquid petroleum gas 85 km; oil 1 km; refined products 1,097 km (2013)', '4,127 km', '180,053 km (includes 450 km of expressways) (2006)', '4,000 km (3,701 km navigable by boats with drafts up to 0.9 m) (2011)', '2018-02-07 18:03:36', NULL),
(225, 'TG', 'tg', 'Togo', 'French Togoland became Togo in 1960. Gen. Gnassingbe EYADEMA, installed as military ruler in 1967, ruled Togo with a heavy hand for almost four decades. Despite the facade of multi-party elections instituted in the early 1990s, the government was largely dominated by President EYADEMA, whose Rally of the Togolese People (RPT) party has been in power almost continually since 1967 and its successor, the Union for the Republic, maintains a majority of seats in today''s legislature. Upon EYADEMA''s death in February 2005, the military installed the president''s son, Faure GNASSINGBE, and then engineered his formal election two months later. Democratic gains since then allowed Togo to hold its first relatively free and fair legislative elections in October 2007. Since 2007, President GNASSINGBE has started the country along a gradual path to political reconciliation and democratic reform, and Togo has held multiple presidential and legislative elections that were deemed generally free and fair by international observers. Despite those positive moves, political reconciliation has moved slowly and many Togolese complain that important political measures such as presidential term limits and electoral reforms remain undone, leaving the country’s politics in a lethargic state. Internationally, Togo is still known as a country where the same family has been in power for five decades.', 'Africa', '8 00 N, 1 10 E', '56,785 sq km', '7,965,055', 'Togolese (singular and plural)', 'African (37 tribes; largest and most important are Ewe, Mina, and Kabre) 99%, European and Syrian-Lebanese less than 1%', 'French (official, the language of commerce), Ewe and Mina (the two major African languages in the south), Kabye (sometimes spelled Kabiye) and Dagomba (the two major African languages in the north)', 'Christian 29%, Muslim 20%, indigenous beliefs 51%', 'Togolese Republic', 'presidential republic', 'Lome', '5 regions (regions, singular - region); Centrale, Kara, Maritime, Plateaux, Savanes', '27 April 1960 (from French-administered UN trusteeship)', 'Togo is enjoying a period of steady economic growth fueled by political stability and a concerted effort by the government to modernize the country’s commercial infrastructure. The country has recently completed an ambitious large-scale infrastructure improvement program, including new principal roads, a new airport terminal, and a new sea-port. The economy depends heavily on both commercial and subsistence agriculture, which provides employment for around 60% of the labor force. Some basic foodstuffs must still be imported. Cocoa, coffee, and cotton and other agricultural products generate about 20% of export earnings with cotton being the most important cash crop. Togo is among the world''s largest producers of phosphate and seeks to develop its carbonate phosphate reserves, which provide more than 20% of export earnings.\r\nThe government''s decade-long effort, supported by the World Bank and the IMF, to implement economic reform measures, encourage foreign investment, and bring revenues in line with expenditures has moved slowly. Togo completed its IMF Extended Credit Facility in 2011 and reached a Heavily Indebted Poor Country debt relief completion point in 2010 at which 95% of the country''s debt was forgiven. Togo continues to work with the IMF on structural reforms, and is currently finalizing IMF approval for an agreement on an Extended Credit Facility arrangement consisting of a three-year $238 million loan package. Progress depends on follow through on privatization, increased openness in government financial operations, progress toward legislative elections, and continued support from foreign donors.\r\nTogo’s 2016 economic growth remained steady at 5.3%, largely driven by infusions of foreign aid, infrastructure investment in the port and mineral sectors, and improvements in the business climate. Foreign direct investment inflows have slowed in recent years.', '$4.434 billion (2016 est.)', 'coffee, cocoa, cotton, yams, cassava (manioc, tapioca), corn, beans, rice, millet, sorghum; livestock; fish', 'phosphate mining, agricultural processing, cement, handicrafts, textiles, beverages', '2.595 million (2007 est.)', 'reexports, cotton, phosphates, coffee, cocoa', '78.8 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '5V (2016)', '8 (2013)', '-', '-', '568 km', '11,652 km', '50 km (seasonally navigable by small craft on the Mono River depending on rainfall) (2011)', '2018-02-07 18:03:36', NULL),
(226, 'TK', 'tk', 'Tokelau', 'Originally settled by Polynesian emigrants from surrounding island groups, the Tokelau Islands were made a British protectorate in 1889. They were transferred to New Zealand administration in 1925. Referenda held in 2006 and 2007 to change the status of the islands from that of a New Zealand territory to one of free association with New Zealand did not meet the needed threshold for approval.', 'Oceania', '9 00 S, 172 00 W', '12 sq km', '1,285 (2016 est.)', 'Tokelauan(s)', 'Tokelauan 64.5%, part Tokelauan/Samoan 9.7%, part Tokelauan/Tuvaluan 2.8%, Tuvaluan 7.5%, Samoan 5.8%, other Pacific islander 3.4%, other 5.6%, unspecified 0.8% (2016 est.)', 'Tokelauan 88.1% (a Polynesian language), English 48.6%, Samoan 26.7%, Tuvaluan 11.2%, Kiribati 1.5%, other 2.8%, none 2.8%, unspecified 0.8%', 'Congregational Christian Church 50.4%, Roman Catholic 38.7%, Presbyterian 5.9%, other Christian 4.2%, unspecified 0.8% (2016 est.)', 'none', 'parliamentary democratic dependency (General Fono); a territory of New Zealand', 'none', 'none (territory of New Zealand)', 'none (territory of New Zealand)', 'Tokelau''s small size (three villages), isolation, and lack of resources greatly restrain economic development and confine agriculture to the subsistence level. The principal sources of revenue come from sales of copra, postage stamps, souvenir coins, and handicrafts. Money is also remitted to families from relatives in New Zealand.\r\nThe people rely heavily on aid from New Zealand - about $15 million annually in FY12/13 and FY13/14 - to maintain public services. New Zealand''s support amounts to 80% of Tokelau''s recurrent government budget. An international trust fund, currently worth nearly $32 million, was established in 2004 by New Zealand to provide Tokelau an independent source of revenue.', '$NA', 'coconuts, copra, breadfruit, papayas, bananas; pigs, poultry, goats; fish', 'small-scale enterprises for copra production, woodworking, plaited craft goods; stamps, coins; fishing', '440 (2001)', 'stamps, copra, handicrafts', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '2018-02-07 18:03:36', NULL),
(227, 'TO', 'to', 'Tonga', 'Tonga - unique among Pacific nations - never completely lost its indigenous governance. The archipelagos of "The Friendly Islands" were united into a Polynesian kingdom in 1845. Tonga became a constitutional monarchy in 1875 and a British protectorate in 1900; it withdrew from the protectorate and joined the Commonwealth of Nations in 1970. Tonga remains the only monarchy in the Pacific.', 'Oceania', '21 08 S, 175 12 W\r\n', '747 sq km', '106,479 (July 2017 est.)', 'Tongan(s)', 'Tongan 96.6%, part-Tongan 1.7%, other 1.7%, unspecified 0.03% (2006 est.)', 'English and Tongan 87%, Tongan (official) 10.7%, English (official) 1.2%, other 1.1%, unspecified 0.03% (2006 est.)', 'Protestant 64.9% (includes Free Wesleyan Church 37.3%, Free Church of Tonga 11.4%, Church of Tonga 7.2%, Tokaikolo Christian Church 2.6%, Assembly of God 2.3%, Seventh Day Adventist 2.2%, Constitutional Church of Tonga 0.9%, Anglican 0.8% and Full Gospel Church 0.2%), Mormon 16.8%, Roman Catholic 15.6%, other 1.1%, none 0.03%, unspecified 1.7% (2006 est.)', 'Kingdom of Tonga', 'constitutional monarchy', 'Nuku''alofa', '5 island divisions; ''Eua, Ha''apai, Ongo Niua, Tongatapu, Vava''u', '4 June 1970 (from UK protectorate)', 'Tonga has a small, open island economy and is the last constitutional monarchy among the Pacific Island countries. It has a narrow export base in agricultural goods. Squash, vanilla beans, and yams are the main crops. Agricultural exports, including fish, make up two-thirds of total exports. Tourism is the second-largest source of hard currency earnings following remittances. Tonga had 53,800 visitors in 2015. The country must import a high proportion of its food, mainly from New Zealand.\r\nThe country remains dependent on external aid and remittances from overseas Tongans to offset its trade deficit. The government is emphasizing the development of the private sector, encouraging investment, and is committing increased funds for health care and education. Tonga''s English-speaking and educated workforce offer a viable labor market, and the tropical climate provides fertile soil. Renewable energy and deep-sea mining also offer opportunities for investment.\r\nTonga has a reasonably sound basic infrastructure and well developed social services. The government faces high unemployment among the young, moderate inflation, pressures for democratic reform, and rising civil service expenditures.', '$413 million (2016 est.)', 'squash, coconuts, copra, bananas, vanilla beans, cocoa, coffee, sweet potatoes, cassava, taro and kava', 'tourism, construction, fishing', '33,800 (2011 est.)', 'squash, fish, vanilla beans, root crops', '50 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'A3 (2016)', '6 (2013)', '-', '-', '-', '680 km', '-', '2018-02-07 18:03:36', NULL),
(228, 'TT', 'tt', 'Trinidad and Tobago', 'First colonized by the Spanish, the islands came under British control in the early 19th century. The islands'' sugar industry was hurt by the emancipation of the slaves in 1834. Manpower was replaced with the importation of contract laborers from India between 1845 and 1917, which boosted sugar production as well as the cocoa industry. The discovery of oil on Trinidad in 1910 added another important export. Independence was attained in 1962. The country is one of the most prosperous in the Caribbean thanks largely to petroleum and natural gas production and processing. Tourism, mostly in Tobago, is targeted for expansion and is growing. The government is coping with a rise in violent crime.', 'Central America and the Caribbean', '10 39 N, 61 31 W', '5,128 sq km', '1,218,208 (July 2017 est.)', 'Trinidadian(s), Tobagonian(s)', 'East Indian 35.4%, African 34.2%, mixed - other 15.3%, mixed African/East Indian 7.7%, other 1.3%, unspecified 6.2% (2011 est.)', 'English (official), Trinidadian Creole English, Tobagonian Creole English, Caribbean Hindustani (a dialect of Hindi), Trinidadian Creole French, Spanish, Chinese', 'Protestant 32.1% (Pentecostal/Evangelical/Full Gospel 12%, Baptist 6.9%, Anglican 5.7%, Seventh-Day Adventist 4.1%, Presbyterian/Congretational 2.5%, other Protestant 0.9%), Roman Catholic 21.6%, Hindu 18.2%, Muslim 5%, Jehovah''s Witness 1.5%, other 8.4%, none 2.2%, unspecified 11.1% (2011 est.)', 'Republic of Trinidad and Tobago', 'parliamentary republic', 'Port of Spain', '9 regions, 3 boroughs, 2 cities, 1 ward', '31 August 1962 (from the UK)', 'Trinidad and Tobago relies on its energy sector for much of its economic activity, and has one of the highest per capita incomes in Latin America. Economic growth between 2000 and 2007 averaged slightly over 8% per year, significantly above the regional average of about 3.7% for that same period; however, GDP has slowed down since then, contracting during 2009-12, making small gains in 2013 and contracting again in 2014-16. Trinidad and Tobago is buffered by considerable foreign reserves and a sovereign wealth fund that equals about one-and-a-half times the national budget, but the country is in a recession and the government faces the dual challenge of gas shortages and a low price environment.\r\nEnergy production and downstream industrial use dominate the economy. Oil and gas typically account for about 40% of GDP and 80% of exports but less than 5% of employment. Trinidad and Tobago is home to one of the largest natural gas liquefaction facilities in the Western Hemisphere. Trinidad and Tobago produces about nine times more natural gas than crude oil on an energy equivalent basis with gas contributing about two-thirds of energy sector government revenue. The US is the country’s largest trading partner, accounting for 28% of its total imports and taking 48% of its exports.\r\nEconomic diversification is a longstanding government talking point, and Trinidad and Tobago has much potential due to its stable, democratic government and its educated, English speaking workforce. The country is also a regional financial center with a well-regulated and stable financial system. Other sectors the Government of Trinidad and Tobago has targeted for increased investment and projected growth include tourism, agriculture, information and communications technology, and shipping. Unfortunately, a host of other factors, including low labor productivity, inefficient government bureaucracy, and corruption, have hampered economic development.', '$21.13 billion (2016 est.)', 'cocoa, dasheen, pumpkin, cassava, tomatoes, cucumbers, eggplant, hot pepper, pommecythere, coconut water, poultry', 'petroleum and petroleum products, liquefied natural gas, methanol, ammonia, urea, steel products, beverages, food processing, cement, cotton textiles', '627,400 (2016 est.)', 'petroleum and petroleum products, liquefied natural gas, methanol, ammonia, urea, steel products, beverages, cereal and cereal products, cocoa, fish, preserved fruits, cosmetics, household cleaners, plastic packaging', '9.682 billion kWh (2015 est.)', '71,570 bbl/day (2016 est.)', '109,300 bbl/day (2014 est.)', '40.87 billion cu m (2015 est.)', '9Y (2016)', '4 (2013)', '-', 'condensate 257 km; condensate/gas 11 km; gas 1,567 km; oil 587 km (2013)', '-', '9,592 km', '-', '2018-02-07 18:03:36', NULL);
