(229, 'TN', 'tn', 'Tunisia', 'Rivalry between French and Italian interests in Tunisia culminated in a French invasion in 1881 and the creation of a protectorate. Agitation for independence in the decades following World War I was finally successful in convincing the French to recognize Tunisia as an independent state in 1956. The country''s first president, Habib BOURGUIBA, established a strict one-party state. He dominated the country for 31 years, repressing Islamic fundamentalism and establishing rights for women unmatched by any other Arab nation. In November 1987, BOURGUIBA was removed from office and replaced by Zine el Abidine BEN ALI in a bloodless coup. Street protests that began in Tunis in December 2010 over high unemployment, corruption, widespread poverty, and high food prices escalated in January 2011, culminating in rioting that led to hundreds of deaths. On 14 January 2011, the same day BEN ALI dismissed the government, he fled the country, and by late January 2011, a "national unity government" was formed. Elections for the new Constituent Assembly were held in late October 2011, and in December, it elected human rights activist Moncef MARZOUKI as interim president. The Assembly began drafting a new constitution in February 2012 and, after several iterations and a months-long political crisis that stalled the transition, ratified the document in January 2014. Parliamentary and presidential elections for a permanent government were held at the end of 2014. Beji CAID ESSEBSI was elected as the first president under the country''s new constitution. In 2016, the new unity government continued to seek to balance political cohesion with economic and social pressures.', 'Africa', '36 48 N, 10 11 E', '163,610 sq km', '11,403,800 (July 2017 est.)', 'Tunisian(s)', 'Arab 98%, European 1%, Jewish and other 1%', 'Arabic (official, one of the languages of commerce), French (commerce), Berber (Tamazight)', 'Muslim (official; Sunni) 99.1%, other (includes Christian, Jewish, Shia Muslim, and Baha''i) 1%', 'Republic of Tunisia', 'parliamentary republic', 'Tunis', '24 governorates (wilayat, singular - wilayah); Beja (Bajah), Ben Arous (Bin ''Arus), Bizerte (Banzart), Gabes (Qabis), Gafsa (Qafsah), Jendouba (Jundubah), Kairouan (Al Qayrawan), Kasserine (Al Qasrayn), Kebili (Qibili), Kef (Al Kaf), L''Ariana (Aryanah), Mahdia (Al Mahdiyah), Manouba (Manubah), Medenine (Madanin), Monastir (Al Munastir), Nabeul (Nabul), Sfax (Safaqis), Sidi Bouzid (Sidi Bu Zayd), Siliana (Silyanah), Sousse (Susah), Tataouine (Tatawin), Tozeur (Tawzar), Tunis, Zaghouan (Zaghwan)', '20 March 1956 (from France)', 'Tunisia''s diverse, market-oriented economy has long been cited as a success story in Africa and the Middle East, but it faces an array of challenges following the 2011 Arab Spring revolution, including slow economic growth and high unemployment. Following an ill-fated experiment with socialist economic policies in the 1960s, Tunisia embarked on a successful strategy focused on bolstering exports, foreign investment, and tourism, all of which have become central to the country''s economy. Key exports now include textiles and apparel, food products, petroleum products, chemicals, and phosphates, with about 80% of exports bound for Tunisia''s main economic partner, the EU.\r\nTunisia''s liberal strategy, coupled with investments in education and infrastructure, fueled decades of 4-5% annual GDP growth and improved living standards. Former President Zine el Abidine BEN ALI (1987-2011) continued these policies, but as his reign wore on cronyism and corruption stymied economic performance, and unemployment rose among the country''s growing ranks of university graduates. These grievances contributed to the January 2011 overthrow of BEN ALI, sending Tunisia''s economy into a tailspin as tourism and investment declined sharply.\r\nTunisia’s government remains under pressure to boost economic growth quickly to mitigate chronic socio-economic challenges, especially high levels of youth unemployment, which has persisted since the revolution in 2011. Successive terrorist attacks against the tourism sector and worker strikes in the phosphate sector, which combined account for nearly 15% of GDP, slowed growth to less than 1% of GDP in 2015 and 1.5% in 2016. Tunis is seeking increased foreign investment and working with labor unions to limit labor disruption.', '$42.07 billion (2016 est.)', 'olives, olive oil, grain, tomatoes, citrus fruit, sugar beets, dates, almonds; beef, dairy products', 'petroleum, mining (particularly phosphate, iron ore), tourism, textiles, footwear, agribusiness, beverages', '4.022 million (2016 est.)', 'clothing, semi-finished goods and textiles, agricultural products, mechanical goods, phosphates and chemicals, hydrocarbons, electrical equipment', '18.39 billion kWh (2015 est.)', '48,670 bbl/day (2016 est.)', '34,760 bbl/day (2014 est.)', '1.575 billion cu m (2015 est.)', 'TS (2016)', '15', '-', 'condensate 68 km; gas 3,111 km; oil 1,381 km; refined products 453 km (2013)', '2,173 km (1,991 in use)', '19,418 km', '-', '2018-02-07 18:03:36', NULL),
(230, 'TR', 'tr', 'Turkey', 'Modern Turkey was founded in 1923 from the remnants of the defeated Ottoman Empire by national hero Mustafa KEMAL, who was later honored with the title Ataturk or "Father of the Turks." Under his leadership, the country adopted radical social, legal, and political reforms. After a period of one-party rule, an experiment with multi-party politics led to the 1950 election victory of the opposition Democrat Party and the peaceful transfer of power. Since then, Turkish political parties have multiplied, but democracy has been fractured by periods of instability and military coups (1960, 1971, 1980), which in each case eventually resulted in a return of formal political power to civilians. In 1997, the military again helped engineer the ouster - popularly dubbed a "post-modern coup" - of the then Islamic-oriented government. A coup attempt was made in July 2016 by a faction of the Turkish Armed Forces.\r\nTurkey intervened militarily on Cyprus in 1974 to prevent a Greek takeover of the island and has since acted as patron state to the "Turkish Republic of Northern Cyprus," which only Turkey recognizes. A separatist insurgency begun in 1984 by the Kurdistan Workers'' Party (PKK), a US-designated terrorist organization, has long dominated the attention of Turkish security forces and claimed more than 40,000 lives. In 2013, the Turkish Government and the PKK conducted negotiations aimed at ending the violence, however intense fighting resumed in 2015. Turkey joined the UN in 1945 and in 1952 it became a member of NATO. In 1963, Turkey became an associate member of the European Community; it began accession talks with the EU in 2005. Over the past decade, economic reforms, coupled with some political reforms, have contributed to a growing economy, although economic growth slowed in recent years.\r\nFrom 2015 and continuing through 2016, Turkey witnessed an uptick in terrorist violence, including major attacks in Ankara, Istanbul, and throughout the predominantly Kurdish southeastern region of Turkey. On 15 July 2016, elements of the Turkish Armed forces attempted a coup that ultimately failed following widespread popular resistance. More than 240 people were killed and over 2,000 injured when Turkish citizens took to the streets en masse to confront the coup forces. In response, Turkish Government authorities arrested, suspended, or dismissed more than 100,000 security personnel, journalists, judges, academics, and civil servants due to their alleged connection with the attempted coup. The government accused followers of an Islamic transnational religious and social movement for allegedly instigating the failed coup and designates the followers as terrorists. Following the failed coup, the Turkish Government instituted a State of Emergency in July 2016 that has been extended to July 2017. The Turkish Government conducted a referendum on 16 April 2017 that will, when implemented, change Turkey from a parliamentary to a presidential system.', 'Middle East', '39 56 N, 32 52 E', '783,562 sq km', '80,845,215 (July 2017 est.)', 'Turk(s)', 'Turkish 70-75%, Kurdish 19%, other minorities 7-12% (2016 est.)', 'Turkish (official), Kurdish, other minority languages', 'Muslim 99.8% (mostly Sunni), other 0.2% (mostly Christians and Jews)', 'Republic of Turkey', 'parliamentary republic', 'Ankara', '81 provinces (iller, singular - ili); Adana, Adiyaman, Afyonkarahisar, Agri, Aksaray, Amasya, Ankara, Antalya, Ardahan, Artvin, Aydin, Balikesir, Bartin, Batman, Bayburt, Bilecik, Bingol, Bitlis, Bolu, Burdur, Bursa, Canakkale, Cankiri, Corum, Denizli, Diyarbakir, Duzce, Edirne, Elazig, Erzincan, Erzurum, Eskisehir, Gaziantep, Giresun, Gumushane, Hakkari, Hatay, Igdir, Isparta, Istanbul, Izmir (Smyrna), Kahramanmaras, Karabuk, Karaman, Kars, Kastamonu, Kayseri, Kilis, Kirikkale, Kirklareli, Kirsehir, Kocaeli, Konya, Kutahya, Malatya, Manisa, Mardin, Mersin, Mugla, Mus, Nevsehir, Nigde, Ordu, Osmaniye, Rize, Sakarya, Samsun, Sanliurfa, Siirt, Sinop, Sirnak, Sivas, Tekirdag, Tokat, Trabzon (Trebizond), Tunceli, Usak, Van, Yalova, Yozgat, Zonguldak', '29 October 1923 (republic proclaimed succeeding the Ottoman Empire)', 'Turkey''s largely free-market economy is driven by its industry and, increasingly, service sectors, although its traditional agriculture sector still accounts for about 25% of employment. The automotive, petrochemical, and electronics industries have risen in importance and surpassed the traditional textiles and clothing sectors within Turkey''s export mix. However, the recent period of political stability and economic dynamism has given way to domestic uncertainty and security concerns, which are generating financial market volatility and weighing on Turkey’s economic outlook.\r\nCurrent government policies emphasize populist spending measures and credit breaks, while implementation of structural economic reforms has slowed. The government is playing a more active role in some strategic sectors and has used economic institutions and regulators to target political opponents, undermining private sector confidence in the judicial system. Between July 2016 and March 2017, three credit ratings agencies downgraded Turkey’s sovereign credit ratings, citing concerns about the rule of law and the pace of economic reforms.\r\nTurkey remains highly dependent on imported oil and gas but is pursuing energy relationships with a broader set of international partners and taking steps to increase use of domestic energy sources including renewables, nuclear, and coal. The joint Turkish-Azerbaijani Trans-Anatolian Natural Gas Pipeline is moving forward to increase transport of Caspian gas to Turkey and Europe, and when completed will help diversify Turkey''s sources of imported gas.\r\nAfter Turkey experienced a severe financial crisis in 2001, Ankara adopted financial and fiscal reforms as part of an IMF program. The reforms strengthened the country''s economic fundamentals and ushered in an era of strong growth averaging more than 6% annually until 2008. An aggressive privatization program also reduced state involvement in basic industry, banking, transport, power generation, and communication. Global economic conditions and tighter fiscal policy caused GDP to contract in 2009, but Turkey''s well-regulated financial markets and banking system helped the country weather the global financial crisis, and GDP growth rebounded to around 9% in 2010 and 2011, as exports and investment recovered following the crisis.\r\nSince 2014, productivity and growth has slowed to reveal persistent underlying imbalances in the Turkish economy. In particular, Turkey’s low domestic savings and large current account deficit means it must rely on external investment inflows to finance growth, leaving the economy vulnerable to destabilizing shifts in investor confidence. The economy contracted in the third quarter of 2016 for the first time since 2009, in part due to a sharp decline in the tourism sector, and growth is likely to remain below potential in 2017. Other troublesome trends include rising unemployment and elevated inflation, which is likely to increase in 2017 given the Turkish lira’s recent depreciation against the dollar. Although government debt remains low at about 32% of GDP, bank and corporate borrowing has almost tripled as a percent of GDP during the past decade, outpacing its emerging-market peers and prompting investor concerns about its long-term sustainability.', '$863.4 billion (2016 est.)', 'tobacco, cotton, grain, olives, sugar beets, hazelnuts, pulses, citrus; livestock', 'textiles, food processing, automobiles, electronics, mining (coal, chromate, copper, boron), steel, petroleum, construction, lumber, paper', '30.55 million', 'apparel, foodstuffs, textiles, metal manufactures, transport equipment', '245.8 billion kWh (2015 est.)', '49,500 bbl/day (2016 est.)', '618,300 bbl/day (2016 est.)', '381 million cu m (2015 est.)', 'TC (2016)', '98 (2013)', '20 (2013)', 'gas 12,603 km; oil 3,038 km (2016)', '12,008 km', '385,754 km', '1,200 km (2010)', '2018-02-07 18:03:36', NULL),
(231, 'TM', 'tm', 'Turkmenistan', 'Present-day Turkmenistan covers territory that has been at the crossroads of civilizations for centuries. The area was ruled in antiquity by various Persian empires, and was conquered by Alexander the Great, Muslim armies, the Mongols, Turkic warriors, and eventually the Russians. In medieval times, Merv (located in present-day Mary province) was one of the great cities of the Islamic world and an important stop on the Silk Road. Annexed by Russia in the late 1800s, Turkmenistan later figured prominently in the anti-Bolshevik movement in Central Asia. In 1924, Turkmenistan became a Soviet republic; it achieved independence upon the dissolution of the USSR in 1991. Extensive hydrocarbon/natural gas reserves, which have yet to be fully exploited, have begun to transform the country. The Government of Turkmenistan is moving to expand its extraction and delivery projects and has attempted to diversify its gas export routes beyond Russia''s pipeline network. In 2010, new gas export pipelines that carry Turkmen gas to China and to northern Iran began operating, effectively ending the Russian monopoly on Turkmen gas exports. In 2016, Russia and Iran halted their purchase of gas from Turkmenistan making China the only buyer of Turkmen gas. President for Life Saparmurat NYYAZOW died in December 2006, and Turkmenistan held its first multi-candidate presidential election in February 2007. Gurbanguly BERDIMUHAMEDOW, a deputy cabinet chairman under NYYAZOW, emerged as the country''s new president. He was reelected in 2012 and again in 2017 with over 97% of the vote in both instances, in elections widely regarded as undemocratic.', 'Asia', '40 00 N, 60 00 E', '488,100 sq km', '5,351,277 (July 2017 est.)', 'Turkmen(s)', 'Turkmen 85%, Uzbek 5%, Russian 4%, other 6% (2003)', 'Turkmen (official) 72%, Russian 12%, Uzbek 9%, other 7%', 'Muslim 89%, Eastern Orthodox 9%, unknown 2%', 'Turkmenistan', 'presidential republic; authoritarian', 'Ashgabat (Ashkhabad)', '5 provinces (welayatlar, singular - welayat) and 1 independent city*: Ahal Welayaty (Anew), Ashgabat*, Balkan Welayaty (Balkanabat), Dasoguz Welayaty, Lebap Welayaty (Turkmenabat), Mary Welayaty', '27 October 1991 (from the Soviet Union)', 'Turkmenistan is largely a desert country with intensive agriculture in irrigated oases and significant natural gas and oil resources. The two largest crops are cotton, most of which is produced for export, and wheat, which is domestically consumed. Although agriculture accounts for roughly 9% of GDP, it continues to employ nearly half of the country''s workforce. Hydrocarbon exports (mainly natural gas) make up 25% of Turkmenistan’s GDP, the bulk of which is natural gas going to China. Ashgabat has explored two initiatives to bring gas to new markets: a trans-Caspian pipeline that would carry gas to Europe and the Turkmenistan-Afghanistan-Pakistan-India gas pipeline. Both face major financing and security hurdles and are unlikely to be completed soon.\r\nTurkmenistan’s autocratic governments under presidents NIYAZOW (1991-2006) and BERDIMUHAMEDOW (since 2007) have made little progress improving the business climate, privatizing state-owned industries, and combatting corruption, limiting economic development outside the energy sector. High energy prices in the mid-2000s allowed the government to undertake extensive development and social spending, including providing heavy utility subsidies.\r\nLow energy prices since mid-2014 are hampering Turkmenistan’s economic growth and reducing government revenues. The government has cut subsidies in several areas, and wage arrears have increased. In January 2014, the Central Bank of Turkmenistan devalued the manat by 19%, and downward pressure on the currency continues. There is a widening spread between the official exchange rate (3.49 TMM per US dollar) and the black market exchange rate (approximately 7 TMM per US dollar). Currency depreciation, corruption, isolationist policies, and limited spending on public services has resulted in a stagnate economy that is nearing crisis. Turkmenistan claims substantial foreign currency reserves, but non-transparent data limit international institutions’ ability to verify this information.', '$36.18 billion (2016 est.)', 'cotton, grain, melons; livestock', 'natural gas, oil, petroleum products, textiles, food processing', '2.305 million (2013 est.)', 'gas, crude oil, petrochemicals, textiles, cotton fiber', '21.18 billion kWh (2015 est.)', '230,800 bbl/day (2016 est.)', '191,100 bbl/day (2014 est.)', '83.7 billion cu m (2015 est.)', 'EZ (2016)', '26 (2013)', '1 (2013)', 'gas 7,500 km; oil 1,501 km (2013)', '2,980 km', '58,592 km', '1,300 km (Amu Darya River and Kara Kum Canal are important inland waterways) (2011)', '2018-02-07 18:03:37', NULL),
(232, 'TC', 'tc', 'Turks and Caicos Islands', 'The islands were part of the UK''s Jamaican colony until 1962, when they assumed the status of a separate crown colony upon Jamaica''s independence. The governor of The Bahamas oversaw affairs from 1965 to 1973. With Bahamian independence, the islands received a separate governor in 1973. Although independence was agreed upon for 1982, the policy was reversed and the islands remain a British overseas territory. Grand Turk island suffered extensive damage from Hurricane Maria on 22 September 2017 resulting in loss of power and communications as well as damage to housing and businesses.', 'Central America and the Caribbean', '21 28 N, 71 08 W', '948 sq km', '52,570 (July 2017 est.)', 'none', 'black 87.6%, white 7.9%, mixed 2.5%, East Indian 1.3%, other 0.7% (2006)', 'English (official)', 'Protestant 72.8% (Baptist 35.8%, Church of God 11.7%, Anglican 10%, Methodist 9.3%, Seventh-Day Adventist 6%), Roman Catholic 11.4%, Jehovah''s Witnesses 1.8%, other 14%', 'Turks and Caicos Islands', 'parliamentary democracy (House of Assembly); self-governing overseas territory of the UK', 'Grand Turk (Cockburn Town)', 'none (overseas territory of the UK)', 'none (overseas territory of the UK)', 'The Turks and Caicos economy is based on tourism, offshore financial services, and fishing. Most capital goods and food for domestic consumption are imported. The US is the leading source of tourists, accounting for more than three-quarters of the more than 1 million visitors that arrived in 2013. Three-quarters of the visitors came by ship. Major sources of government revenue also include fees from offshore financial activities and customs receipts.', '$NA', 'corn, beans, cassava (manioc, tapioca), citrus fruits; fish', 'tourism, offshore financial services', '4,848 (1990 est.)', 'lobster, dried and fresh conch, conch shells', '220 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'VQ-T (2016)', '8 (2013)', '-', '-', '-', '121 km', '-', '2018-02-07 18:03:37', NULL),
(233, 'TV', 'tv', 'Tuvalu', 'In 1974, ethnic differences within the British colony of the Gilbert and Ellice Islands caused the Polynesians of the Ellice Islands to vote for separation from the Micronesians of the Gilbert Islands. The following year, the Ellice Islands became the separate British colony of Tuvalu. Independence was granted in 1978. In 2000, Tuvalu negotiated a contract leasing its Internet domain name ".tv" for $50 million in royalties over a 12-year period. The agreement was subsequently renegotiated but details were not disclosed.', 'Oceania', '8 31 S, 179 13 E', '26 sq km', '11,052 (July 2017 est.)', 'Tuvaluan(s)', 'Polynesian 96%, Micronesian 4%', 'Tuvaluan (official), English (official), Samoan, Kiribati (on the island of Nui)', 'Protestant 98.4% (Church of Tuvalu (Congregationalist) 97%, Seventh-Day Adventist 1.4%), Baha''i 1%, other 0.6%', 'Tuvalu', 'parliamentary democracy (House of Assembly) under a constitutional monarchy; a Commonwealth realm', 'Funafuti; note - the capital is an atoll of some 2', '7 island councils and 1 town council*; Funafuti*, Nanumaga, Nanumea, Niutao, Nui, Nukufetau, Nukulaelae, Vaitupu', '1 October 1978 (from the UK)', 'Tuvalu consists of a densely populated, scattered group of nine coral atolls with poor soil. Only eight of the atolls are inhabited. It is one of the smallest countries in the world, with its highest point at 4.6 meters above sea level. The country is isolated, almost entirely dependent on imports, particularly of food and fuel, and vulnerable to climate change and rising sea levels, which pose significant challenges to development.\r\nThe public sector dominates economic activity. Tuvalu has few natural resources, except for its fisheries. Earnings from fish exports and fishing licenses for Tuvalu’s territorial waters are a significant source of government revenue. In 2013, revenue from fishing licenses doubled and totaled more than 45% of GDP.\r\nOfficial aid from foreign development partners has also increased. Tuvalu has substantial assets abroad. The Tuvalu Trust Fund, an international trust fund established in 1987 by development partners, has grown to $104 million (A$141 million) in 2014 and is an important cushion for meeting shortfalls in the government''s budget. While remittances are another substantial source of income, the value of remittances has declined since the 2008-09 global financial crisis, but has stabilized at nearly $4 million per year. The financial impact of climate change and the cost of climate related adaptation projects is one of many concerns for the nation.', '$37 million (2016 est.)', 'coconuts; fish', 'fishing', '3,615 (2004 est.)', 'copra, fish', '11.8 million kWh (2011)', '0 bbl/day (2014)', '0 bbl/day (2014 est.)', '0 cu m (2014)', 'T2 (2016)', '1 (2013)', '-', '-', '-', '8 km', '-', '2018-02-07 18:03:37', NULL),
(234, 'VI', 'vi', 'U.S. Virgin Islands', 'The Danes secured control over the southern Virgin Islands of Saint Thomas, Saint John, and Saint Croix during the 17th and early 18th centuries. Sugarcane, produced by African slave labor, drove the islands'' economy during the 18th and early 19th centuries. In 1917, the US purchased the Danish holdings, which had been in economic decline since the abolition of slavery in 1848. On 6 September 2017, Hurricane Irma passed over the northern Virgin Islands of Saint Thomas and Saint John and inflicted severe damage to structures, roads, the airport on Saint Thomas, communications, and electricity. Less than two weeks later, Hurricane Maria passed over the island of Saint Croix in the southern Virgin Islands inflicting considerable damage with heavy winds and flooding rains.', 'Central America and the Caribbean', '18 20 N, 64 50 W', '1,910 sq km', '107,268 (July 2017 est.)', 'Virgin Islander(s) (US citizens)', 'black 76%, white 15.6%, Asian 1.4%, other 4.9%, mixed 2.1%', 'English 71.6%, Spanish or Spanish Creole 17.2%, French or French Creole 8.6%, other 2.5% (2010 est.)', 'Protestant 59% (Baptist 42%, Episcopalian 17%), Roman Catholic 34%, other 7%', 'United States Virgin Islands', 'presidential democracy; a self-governing territory of the US', 'Charlotte Amalie', 'none (territory of the US); there are no first-order administrative divisions as defined by the US Government, but there are 3 islands at the second order; Saint Croix, Saint John, Saint Thomas', 'none (territory of the US)', 'Tourism, trade, and other services are the primary economic activities, accounting for nearly 60% of the Virgin Island''s GDP and about half of total civilian employment. The islands host nearly 3 million tourists per year, mostly from visiting cruise ships. The islands are vulnerable to damage from storms. The agriculture sector is small, with most food being imported. Industry and government each account for about one-fifth of GDP. The manufacturing sector consists of rum distilling, electronics, pharmaceuticals, and watch assembly. A refinery on St. Croix, one of the world’s largest, processed 350,000 barrels of crude oil a day until it was shut down in February 2012, after operating for 45 years.\r\nFederal programs and grants, totaling $241.4 million in 2013, contributed 19.7% of the territory’s total revenues. The economy declined in 2013, due to decreases in exports resulting from the loss of refined oil products. Nevertheless, the economy remains relatively diversified. Along with a vibrant tourism industry, rum exports, trade, and services will be major income sources in future years.', '$5.075 billion (2013)', 'fruit, vegetables, sorghum; Senepol cattle', 'tourism, watch assembly, rum distilling, construction, pharmaceuticals, electronics', '50,580 (2012 est.)', 'rum', '679 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2014 est.)', '-', '2 (2013)', '-', '-', '-', '1,260 km (2008)', '-', '2018-02-07 18:03:37', NULL),
(235, 'UG', 'ug', 'Uganda', 'The colonial boundaries created by Britain to delimit Uganda grouped together a wide range of ethnic groups with different political systems and cultures. These differences complicated the establishment of a working political community after independence was achieved in 1962. The dictatorial regime of Idi AMIN (1971-79) was responsible for the deaths of some 300,000 opponents; guerrilla war and human rights abuses under Milton OBOTE (1980-85) claimed at least another 100,000 lives. The rule of Yoweri MUSEVENI since 1986 has brought relative stability and economic growth to Uganda. A constitutional referendum in 2005 cancelled a 19-year ban on multi-party politics and lifted presidential term limits.', 'Africa', '0 19 N, 32 33 E', '241,038 sq km', '39,570,125', 'Ugandan(s)', 'Baganda 16.5%, Banyankole 9.6%, Basoga 8.8%, Bakiga 7.1%, Iteso 7%, Langi 6.3%, Bagisu 4.9%, Acholi 4.4%, Lugbara 3.3%, other 32.1% (2014 est.)', 'English (official national language, taught in grade schools, used in courts of law and by most newspapers and some radio broadcasts), Ganda or Luganda (most widely used of the Niger-Congo languages, preferred for native language publications in the capital and may be taught in school), other Niger-Congo languages, Nilo-Saharan languages, Swahili, Arabic', 'Protestant 45.1% (Anglican 32.0%, Pentecostal/Born Again/Evangelical 11.1%, Seventh Day Adventist 1.7%, Baptist .3%), Roman Catholic 39.3%, Muslim 13.7%, other 1.6%, none 0.2% (2014 est.)', 'Republic of Uganda', 'presidential republic', 'Kampala', '121 districts and 1 capital city*; Abim, Adjumani, Agago, Alebtong, Amolatar, Amudat, Amuria, Amuru, Apac, Arua, Budaka, Bududa, Bugiri, Buhweju, Buikwe, Bukedea, Bukomansimbi, Bukwa, Bulambuli, Buliisa, Bundibugyo, Bunyangabu, Bushenyi, Busia, Butaleja, Butambala, Butebo, Buvuma, Buyende, Dokolo, Gomba, Gulu, Hoima, Ibanda, Iganga, Isingiro, Jinja, Kaabong, Kabale, Kabarole, Kaberamaido, Kagadi, Kakumiro, Kalangala, Kaliro, Kalungu, Kampala*, Kamuli, Kamwenge, Kanungu, Kapchorwa, Kasese, Katakwi, Kayunga, Kibaale, Kiboga, Kibuku, Kiruhura, Kiryandongo, Kisoro, Kitgum, Koboko, Kole, Kotido, Kumi, Kween, Kyankwanzi, Kyegegwa, Kyenjojo, Kyotera, Lamwo, Lira, Luuka, Luwero, Lwengo, Lyantonde, Manafwa, Maracha, Masaka, Masindi, Mayuge, Mbale, Mbarara, Mitooma, Mityana, Moroto, Moyo, Mpigi, Mubende, Mukono, Nakapiripirit, Nakaseke, Nakasongola, Namayingo, Namisindwa, Namutumba, Napak, Nebbi, Ngora, Ntoroko, Ntungamo, Nwoya, Omoro, Otuke, Oyam, Pader, Pakwach, Pallisa, Rakai, Rubanda, Rubirizi, Rukiga, Rukungiri, Sembabule, Serere, Sheema, Sironko, Soroti, Tororo, Wakiso, Yumbe, Zombo', '9 October 1962 (from the UK)', 'Uganda has substantial natural resources, including fertile soils, regular rainfall, small deposits of copper, gold, and other minerals, and recently discovered oil. Agriculture is the most important sector of the economy, employing more than one-third of the work force. Coffee accounts for the bulk of export revenues. Uganda has a small industrial sector that is dependent on imported inputs like oil and equipment. Overall productivity is hampered by a number of supply-side constraints, including underinvestment in an agricultural sector that continues to rely on rudimentary technology. Industrial growth is impeded by high-costs due to poor infrastructure, low levels of private investment, and the depreciation of the Ugandan shilling.\nSince 1986, the government - with the support of foreign countries and international agencies - has acted to rehabilitate and stabilize the economy by undertaking currency reform, raising producer prices on export crops, increasing prices of petroleum products, and improving civil service wages. The policy changes were especially aimed at dampening inflation while encouraging foreign investment to boost production and export earnings. Since 1990, economic reforms ushered in an era of solid economic growth based on continued investment in infrastructure, improved incentives for production and exports, lower inflation, and better domestic security.\nThe global economic downturn in 2008 hurt Uganda''s exports; however, Uganda''s GDP growth has largely recovered due to past reforms and a rapidly growing urban consumer population. Oil revenues and taxes are expected to become a larger source of government funding as production starts in the next five to 10 years. However, lower oil prices since 2014 and protracted negotiations and legal disputes between the Ugandan government and oil companies may prove a stumbling block to further exploration and development.\nUganda faces many economic challenges. Instability in South Sudan has led to a sharp increase in Sudanese refugees and is disrupting Uganda''s main export market. High energy costs, inadequate transportation and energy infrastructure, insufficient budgetary discipline, and corruption inhibit economic development and investor confidence. During 2015 and 2016, the Uganda shilling depreciated 50% against the dollar.\nThe budget is dominated by energy and road infrastructure spending, while relying on donor support for long-term drivers of growth, including agriculture, health, and education. The largest infrastructure projects are externally financed through low-interest concessional loans. As a result, debt servicing for these loans is expected to rise.', '$25.31 billion (2016 est.)', 'coffee, tea, cotton, tobacco, cassava (manioc, tapioca), potatoes, corn, millet, pulses, cut flowers; beef, goat meat, milk, poultry, and fish', 'sugar processing, brewing, tobacco, cotton textiles; cement, steel production', '19.4 million (2016 est.)', 'coffee, fish and fish products, tea, cotton, flowers, horticultural products; gold', '3.235 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '5X (2016)', '47 (2013)', '-', '-', '1,244 km', '20,000 km (excludes local roads)', '(there are no long navigable stretches of river in Uganda; parts of the Albert Nile that flow out of Lake Albert in the northwestern part of the country are navigable; several lakes including Lake Victoria and Lake Kyoga have substantial traffic; Lake Albert is navigable along a 200-km stretch from its northern tip to its southern shores) (2011)', '2018-02-07 18:03:37', NULL),
(236, 'UA', 'ua', 'Ukraine', 'Ukraine was the center of the first eastern Slavic state, Kyivan Rus, which during the 10th and 11th centuries was the largest and most powerful state in Europe. Weakened by internecine quarrels and Mongol invasions, Kyivan Rus was incorporated into the Grand Duchy of Lithuania and eventually into the Polish-Lithuanian Commonwealth. The cultural and religious legacy of Kyivan Rus laid the foundation for Ukrainian nationalism through subsequent centuries. A new Ukrainian state, the Cossack Hetmanate, was established during the mid-17th century after an uprising against the Poles. Despite continuous Muscovite pressure, the Hetmanate managed to remain autonomous for well over 100 years. During the latter part of the 18th century, most Ukrainian ethnographic territory was absorbed by the Russian Empire. Following the collapse of czarist Russia in 1917, Ukraine achieved a short-lived period of independence (1917-20), but was reconquered and endured a brutal Soviet rule that engineered two forced famines (1921-22 and 1932-33) in which over 8 million died. In World War II, German and Soviet armies were responsible for 7 to 8 million more deaths. Although Ukraine achieved independence in 1991 with the dissolution of the USSR, democracy and prosperity remained elusive as the legacy of state control and endemic corruption stalled efforts at economic reform, privatization, and civil liberties.\r\nA peaceful mass protest referred to as the "Orange Revolution" in the closing months of 2004 forced the authorities to overturn a rigged presidential election and to allow a new internationally monitored vote that swept into power a reformist slate under Viktor YUSHCHENKO. Subsequent internal squabbles in the YUSHCHENKO camp allowed his rival Viktor YANUKOVYCH to stage a comeback in parliamentary (Rada) elections, become prime minister in August 2006, and be elected president in February 2010. In October 2012, Ukraine held Rada elections, widely criticized by Western observers as flawed due to use of government resources to favor ruling party candidates, interference with media access, and harassment of opposition candidates. President YANUKOVYCH''s backtracking on a trade and cooperation agreement with the EU in November 2013 - in favor of closer economic ties with Russia - and subsequent use of force against students, civil society activists, and other civilians in favor of the agreement led to a three-month protest occupation of Kyiv''s central square. The government''s use of violence to break up the protest camp in February 2014 led to all out pitched battles, scores of deaths, international condemnation, and the president''s abrupt departure for Russia. New elections in the spring allowed pro-West president Petro POROSHENKO to assume office on 7 June 2014.\r\nShortly after YANUKOVYCH''s departure in late February 2014, Russian President PUTIN ordered the invasion of Ukraine''s Crimean Peninsula claiming the action was to protect ethnic Russians living there. Two weeks later, a "referendum" was held regarding the integration of Crimea into the Russian Federation. The "referendum" was condemned as illegitimate by the Ukrainian Government, the EU, the US, and the UN General Assembly (UNGA). In response to Russia''s purported annexation of Crimea, 100 members of the UN passed UNGA resolution 68/262, rejecting the "referendum" as baseless and invalid and confirming the sovereignty, political independence, unity, and territorial integrity of Ukraine. Russia also continues to supply so-called separatists in two of Ukraine''s eastern provinces with manpower, funding, and materiel resulting in an armed conflict with the Ukrainian Government. Representatives from Ukraine, Russia, and the unrecognized separatist republics signed the Minsk Protocol and Memorandum in September 2014 to end the conflict. However, this agreement failed to stop the fighting. In a renewed attempt to alleviate ongoing clashes, leaders of Ukraine, Russia, France, and Germany negotiated a follow-on package of measures in February 2015 to implement the Minsk Agreements. Representatives from Ukraine, Russia, and the Organization for Security and Cooperation in Europe also meet regularly to facilitate implementation of the peace deal. More than 33,000 civilians have been killed or wounded in the fighting resulting from Russian aggression in eastern Ukraine.', 'Asia, Europe', '50 26 N, 30 31 E', '603,550 sq km', '44,033,874 (July 2017 est.)', 'Ukrainian(s)', 'Ukrainian 77.8%, Russian 17.3%, Belarusian 0.6%, Moldovan 0.5%, Crimean Tatar 0.5%, Bulgarian 0.4%, Hungarian 0.3%, Romanian 0.3%, Polish 0.3%, Jewish 0.2%, other 1.8% (2001 est.)', 'Ukrainian (official) 67.5%, Russian (regional language) 29.6%, ther (includes small Crimean Tatar-, Moldovan/Romanian-, and Hungarian-speaking minorities) 2.9% (2001 est.)', 'Orthodox (includes Ukrainian Autocephalous Orthodox (UAOC), Ukrainian Orthodox - Kyiv Patriarchate (UOC-KP), Ukrainian Orthodox - Moscow Patriarchate (UOC-MP)), Ukrainian Greek Catholic, Roman Catholic, Protestant, Muslim, Jewish', 'Ukraine', 'semi-presidential republic', 'Kyiv (Kiev)', '24 provinces (oblasti, singular - oblast''), 1 autonomous republic* (avtonomna respublika), and 2 municipalities** (mista, singular - misto) with oblast status; Cherkasy, Chernihiv, Chernivtsi, Crimea or Avtonomna Respublika Krym* (Simferopol''), Dnipropetrovs''k (Dnipro), Donets''k, Ivano-Frankivs''k, Kharkiv, Kherson, Khmel''nyts''kyy, Kirovohrad (Kropyvnyts''kyy), Kyiv**, Kyiv, Luhans''k, L''viv, Mykolayiv, Odesa, Poltava, Rivne, Sevastopol''**, Sumy, Ternopil'', Vinnytsya, Volyn'' (Luts''k), Zakarpattya (Uzhhorod), Zaporizhzhya, Zhytomyr', '24 August 1991 (from the Soviet Union); notable earlier dates: ca. 982 (VOLODYMYR I consolidates Kyivan Rus); 1648 (establishment of the Cossack Hetmanate)', 'After Russia, the Ukrainian Republic was the most important economic component of the former Soviet Union, producing about four times the output of the next-ranking republic. Its fertile black soil generated more than one-fourth of Soviet agricultural output, and its farms provided substantial quantities of meat, milk, grain, and vegetables to other republics. Likewise, its diversified heavy industry supplied unique equipment, such as, large diameter pipes and vertical drilling apparatus, and raw materials to industrial and mining sites in other regions of the former USSR.\r\nShortly after independence in August 1991, the Ukrainian Government liberalized most prices and erected a legal framework for privatization, but widespread resistance to reform within the government and the legislature soon stalled reform efforts and led to some backtracking. Output by 1999 had fallen to less than 40% of the 1991 level. Outside institutions - particularly the IMF encouraged Ukraine to quicken the pace and scope of reforms to foster economic growth. Ukrainian Government officials eliminated most tax and customs privileges in a March 2005 budget law, bringing more economic activity out of Ukraine''s large shadow economy. From 2000 until mid-2008, Ukraine''s economy was buoyant despite political turmoil between the prime minister and president. The economy contracted nearly 15% in 2009, among the worst economic performances in the world. In April 2010, Ukraine negotiated a price discount on Russian gas imports in exchange for extending Russia''s lease on its naval base in Crimea.\r\nUkraine’s oligarch-dominated economy grew slowly from 2010 to 2013. After former President YANUKOVYCH fled the country during the Revolution of Dignity, the international community began efforts to stabilize the Ukrainian economy, including a March 2014 IMF assistance package of $17.5 billion, of which Ukraine has received four disbursements, most recently in April 2017, bringing the total disbursed as of that date to approximately $8.4 billion. Ukraine has made significant progress on reforms designed to make the country prosperous, democratic, and transparent. But more improvements are needed, including fighting corruption, developing capital markets, and improving the legislative framework.\r\nRussia’s occupation of Crimea in March 2014 and ongoing aggression in eastern Ukraine have hurt economic growth. With the loss of a major portion of Ukraine’s heavy industry in Donbas and ongoing violence, Ukraine’s economy contracted by 6.6% in 2014 and by 14.3% in 2015, but grew by 2.3% in 2016 as key reforms took hold. After the EU and Ukraine enacted the Deep and Comprehensive Free Trade Area and Russia imposed a series of trade restrictions, the EU replaced Russia as Ukraine’s largest trading partner. Analysts predict approximately 2% growth in 2017, but a new prohibition on commercial trade with separatist-controlled territories will have an uncertain effect on Ukraine’s key industrial sectors.', '$93.26 billion (2016 est.)', 'grain, sugar beets, sunflower seeds, vegetables; beef, milk', 'coal, electric power, ferrous and nonferrous metals, machinery and transport equipment, chemicals, food processing', '18.04 million (2016 est.)', 'ferrous and nonferrous metals, fuel and petroleum products, chemicals, machinery and transport equipment, foodstuffs', '152.2 billion kWh (2015 est.)', '32,070 bbl/day (2016 est.)', '78,030 bbl/day (2014 est.)', '19 billion cu m (2015 est.)', 'UR (2016)', '187 (2013)', '9 (2013)', 'gas 36,720 km; oil 4,514 km; refined products 4,363 km (2013)', '21,733 km', '169,694 km', '1,672 km (most on Dnieper River) (2012)', '2018-02-07 18:03:37', NULL),
(237, 'AE', 'ae', 'United Arab Emirates', 'The Trucial States of the Persian Gulf coast granted the UK control of their defense and foreign affairs in 19th century treaties. In 1971, six of these states - Abu Dhabi, ''Ajman, Al Fujayrah, Ash Shariqah, Dubayy, and Umm al Qaywayn - merged to form the United Arab Emirates (UAE). They were joined in 1972 by Ra''s al Khaymah. The UAE''s per capita GDP is on par with those of leading West European nations. For more than three decades, oil and global finance drove the UAE''s economy. However, in 2008-09, the confluence of falling oil prices, collapsing real estate prices, and the international banking crisis hit the UAE especially hard. The UAE essentially avoided the "Arab Spring" unrest seen elsewhere in the Middle East in 2010-11 and in an effort to stem potential unrest, the government announced a multi-year, $1.6-billion infrastructure investment plan for the poorer northern emirates and aggressively pursued advocates of political reform. The UAE in recent years has played a vital role in regional affairs. In addition to donating billions of dollars in economic aid to help stabilize Egypt, the UAE is a member of a US-led global coalition to defeat the Islamic State in Iraq and the Levant (ISIL) and a coalition partner in a Saudi-led military campaign to restore the Government of Yemen.', 'Middle East', '24 28 N, 54 22 E', '83,600 sq km', '6,072,475 (July 2017 est.)', 'Emirati(s)', 'Emirati 11.6%, South Asian 59.4% (includes Indian 38.2%, Bangladeshi 9.5%, Pakistani 9.4%, other 2.3%), Egyptian 10.2%, Philippine 6.1%, other 12.8% (2015 est.)', 'Arabic (official), Persian, English, Hindi, Urdu', 'Muslim (official) 76%, Christian 9%, other (primarily Hindu and Buddhist, less than 5% of the population consists of Parsi, Baha''i, Druze, Sikh, Ahmadi, Ismaili, Dawoodi Bohra Muslim, and Jewish) 15%', 'United Arab Emirates', 'federation of monarchies', 'Abu Dhabi', '7 emirates (imarat, singular - imarah); Abu Zaby (Abu Dhabi), ''Ajman, Al Fujayrah, Ash Shariqah (Sharjah), Dubayy (Dubai), Ra''s al Khaymah, Umm al Qaywayn', '2 December 1971 (from the UK)', 'The UAE has an open economy with a high per capita income and a sizable annual trade surplus. Successful efforts at economic diversification have reduced the portion of GDP from the oil and gas sector to 30%.\r\nSince the discovery of oil in the UAE nearly 60 years ago, the country has undergone a profound transformation from an impoverished region of small desert principalities to a modern state with a high standard of living. The government has increased spending on job creation and infrastructure expansion and is opening up utilities to greater private sector involvement. The country''s free trade zones - offering 100% foreign ownership and zero taxes - are helping to attract foreign investors.\r\nThe global financial crisis of 2008-09, tight international credit, and deflated asset prices constricted the economy in 2009. UAE authorities tried to blunt the crisis by increasing spending and boosting liquidity in the banking sector. The crisis hit Dubai hardest, as it was heavily exposed to depressed real estate prices. Dubai lacked sufficient cash to meet its debt obligations, prompting global concern about its solvency and ultimately a $20 billion bailout from the UAE Central Bank and Abu Dhabi Government that was refinanced in March 2014.\r\nThe UAE’s dependence on oil is a significant long-term challenge. Low oil prices have prompted the UAE to cut expenditures, including on some social programs, but the UAE has sufficient assets in its sovereign investment funds to cover its deficits. The government reduced fuel subsidies in August 2015, and has announced plans to introduce excise and value-added taxes by January 1, 2018. The UAE''s strategic plan for the next few years focuses on economic diversification, promoting the UAE as a global trade and tourism hub, developing industry, and creating more job opportunities for nationals through improved education and increased private sector employment.', '$348.7 billion (2016 est.)', 'dates, vegetables, watermelons; poultry, eggs, dairy products; fish', 'petroleum and petrochemicals; fishing, aluminum, cement, fertilizer, commercial ship repair, construction materials, handicrafts, textiles', '5.242 million', 'crude oil 45%, natural gas, reexports, dried fish, dates (2012 est.)', '119.7 billion kWh (2015 est.)', '3.106 million bbl/day (2016 est.)', '479,400 bbl/day (2014 est.)', '60.18 billion cu m (2015 est.)', 'A6 (2016)', '43 (2013)', '5 (2013)', 'condensate 533 km; gas 3,277 km; liquid petroleum gas 300 km; oil 3,287 km; oil/gas/water 24 km; refined products 218 km; water 99 km (2013)', '-', '4,080 km', '-', '2018-02-07 18:03:37', NULL);
