(238, 'GB', 'gb', 'United Kingdom', 'The United Kingdom has historically played a leading role in developing parliamentary democracy and in advancing literature and science. At its zenith in the 19th century, the British Empire stretched over one-fourth of the earth''s surface. The first half of the 20th century saw the UK''s strength seriously depleted in two world wars and the Irish Republic''s withdrawal from the union. The second half witnessed the dismantling of the Empire and the UK rebuilding itself into a modern and prosperous European nation. As one of five permanent members of the UN Security Council and a founding member of NATO and the Commonwealth, the UK pursues a global approach to foreign policy. The Scottish Parliament, the National Assembly for Wales, and the Northern Ireland Assembly were established in 1998.\r\nThe UK has been an active member of the EU since its accession in 1973, although it chose to remain outside the Economic and Monetary Union. However, motivated in part by frustration at a remote bureaucracy in Brussels and massive migration into the country, UK citizens on 23 June 2016 narrowly voted to leave the EU. The UK and the EU are currently negotiating the terms of the UK''s withdrawal and will discuss a framework for their future relationship ahead of the UK''s scheduled departure from the bloc on 29 March 2019.', 'Europe', '51 30 N, 0 05 W', '243,610 sq km', '64,769,452 (July 2017 est.)', 'Briton(s), British (collective plural)', 'white 87.2%, black/African/Caribbean/black British 3%, Asian/Asian British: Indian 2.3%, Asian/Asian British: Pakistani 1.9%, mixed 2%, other 3.7% (2011 est.)', 'English', 'Christian (includes Anglican, Roman Catholic, Presbyterian, Methodist) 59.5%, Muslim 4.4%, Hindu 1.3%, other 2%, unspecified 7.2%, none 25.7% (2011 est.)', 'United Kingdom of Great Britain and Northern Ireland; note - the island of Great Britain includes En', 'parliamentary constitutional monarchy; a Commonwealth realm', 'London', '27 two-tier counties, 32 London boroughs and 1 City of London or Greater London, 36 metropolitan districts, 56 unitary authorities (including 4 single-tier counties*)', '12 April 1927 (Royal and Parliamentary Titles Act establishes current name of the United Kingdom of Great Britain and Northern Ireland); notable earlier dates: 927 (minor English kingdoms united); 3 March 1284 (enactment of the Statute of Rhuddlan uniting England and Wales); 1536 (Act of Union formally incorporates England and Wales); 1 May 1707 (Acts of Union formally unite England, Scotland, and Wales as Great Britain); 1 January 1801 (Acts of Union formally unite Great Britain and Ireland as the United Kingdom of Great Britain and Ireland); 6 December 1921 (Anglo-Irish Treaty formalizes partition of Ireland; six counties remain part of the United Kingdom and Northern Ireland)', 'The UK, a leading trading power and financial center, is the third largest economy in Europe after Germany and France. Agriculture is intensive, highly mechanized, and efficient by European standards, producing about 60% of food needs with less than 2% of the labor force. The UK has large coal, natural gas, and oil resources, but its oil and natural gas reserves are declining; the UK has been a net importer of energy since 2005. Services, particularly banking, insurance, and business services, are key drivers of British GDP growth. Manufacturing, meanwhile, has declined in importance but still accounts for about 10% of economic output.\r\nIn 2008, the global financial crisis hit the economy particularly hard, due to the importance of its financial sector. Falling home prices, high consumer debt, and the global economic slowdown compounded Britain''s economic problems, pushing the economy into recession in the latter half of 2008 and prompting the then BROWN (Labour) government to implement a number of measures to stimulate the economy and stabilize the financial markets. Facing burgeoning public deficits and debt levels, in 2010 the then CAMERON-led coalition government (between Conservatives and Liberal Democrats) initiated an austerity program, which has continued under the new Conservative majority government. However, the deficit still remains one of the highest in the G7, standing at 4.1% of GDP as of mid-2016, and Britain has pledged to lower its corporation tax from 20% to 17% by 2020. Britain had a debt burden of 92.2% GDP at the end of 2016.\r\nWhile the UK is one of the fastest growing economies in the G7, economists are concerned about the potential negative impact of the UK’s vote to leave the EU. The UK has an extensive trade relationship with other EU members through its single market membership and economic observers have warned the exit will jeopardize its position as the central location for European financial services.', '$2.629 trillion (2016 est.)', 'cereals, oilseed, potatoes, vegetables; cattle, sheep, poultry; fish', 'machine tools, electric power equipment, automation equipment, railroad equipment, shipbuilding, aircraft, motor vehicles and parts, electronics and communications equipment, metals, chemicals, coal, petroleum, paper and paper products, food processing, textiles, clothing, other consumer goods', '33.36 million (2016 est.)', 'manufactured goods, fuels, chemicals; food, beverages, tobacco', '309.8 billion kWh (2015 est.)', '933,000 bbl/day (2016 est.)', '1.28 million bbl/day (2016 est.)', '41.34 billion cu m (2015 est.)', 'G (2016)', '460 (2013)', '9 (2013)', 'condensate 502 km; condensate/gas 9 km; gas 28,603 km; liquid petroleum gas 59 km; oil 5,256 km; oil/gas/water 175 km; refined products 4,919 km; water 255 km (2013)', '16,837 km', '394,428 km', '3,200 km (620 km used for commerce) (2009)', '2018-02-07 18:03:37', NULL),
