(241, 'UY', 'uy', 'Uruguay', 'Montevideo, founded by the Spanish in 1726 as a military stronghold, soon took advantage of its natural harbor to become an important commercial center. Claimed by Argentina but annexed by Brazil in 1821, Uruguay declared its independence four years later and secured its freedom in 1828 after a three-year struggle. The administrations of President Jose BATLLE in the early 20th century launched widespread political, social, and economic reforms that established a statist tradition. A violent Marxist urban guerrilla movement named the Tupamaros, launched in the late 1960s, led Uruguay''s president to cede control of the government to the military in 1973. By yearend, the rebels had been crushed, but the military continued to expand its hold over the government. Civilian rule was restored in 1985. In 2004, the left-of-center Frente Amplio Coalition won national elections that effectively ended 170 years of political control previously held by the Colorado and National (Blanco) parties. Uruguay''s political and labor conditions are among the freest on the continent.', 'South America', '34 51 S, 56 10 W', '176,215 sq km', '3,360,148 (July 2017 est.)', 'Uruguayan(s)', 'white 88%, mestizo 8%, black 4%, Amerindian (practically nonexistent)', 'Spanish (official), Portunol, Brazilero (Portuguese-Spanish mix on the Brazilian frontier)', 'Roman Catholic 47.1%, non-Catholic Christians 11.1%, nondenominational 23.2%, Jewish 0.3%, atheist or agnostic 17.2%, other 1.1% (2006 est.)', 'Oriental Republic of Uruguay', 'presidential republic', 'Montevideo', '19 departments (departamentos, singular - departamento); Artigas, Canelones, Cerro Largo, Colonia, Durazno, Flores, Florida, Lavalleja, Maldonado, Montevideo, Paysandu, Rio Negro, Rivera, Rocha, Salto, San Jose, Soriano, Tacuarembo, Treinta y Tres', '25 August 1825 (from Brazil)', 'Uruguay has a free market economy characterized by an export-oriented agricultural sector, a well-educated workforce, and high levels of social spending. Uruguay has sought to expand trade within the Common Market of the South (Mercosur) and with non-Mercosur members, and President VAZQUEZ has maintained his predecessor’s mix of pro-market policies and a strong social safety net.\r\nFollowing financial difficulties in the late 1990s and early 2000s, Uruguay''s economic growth averaged 8% annually during the period 2004-08. The 2008-09 global financial crisis put a brake on Uruguay''s vigorous growth, which decelerated to 2.6% in 2009. Nevertheless, the country managed to avoid a recession and keep positive growth rates, mainly through higher public expenditure and investment; GDP growth reached 8.9% in 2010 but slowed markedly in the period 2012-16 as a result of a renewed slowdown in the global economy and in Uruguay''s main trade partners and Mercosur counterparts, Argentina and Brazil. Reforms in those countries should give Uruguay an economic boost.', '$52.42 billion (2016 est.)', 'Cellulose, beef, soybeans, rice, wheat; dairy products; fish; lumber, tobacco, wine', 'food processing, electrical machinery, transportation equipment, petroleum products, textiles, chemicals, beverages', '1.736 million (2016 est.)', 'beef, soybeans, cellulose, rice, wheat, wood, dairy products, wool', '12.23 billion kWh (2015 est.)', '0 bbl/day (2016 est.)', '42,440 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'CX (2016)', '133 (2013)', '-', 'gas 257 km; oil 160 km (2013)', '1,673 km (operational; government claims overall length is 2,961 km)', '77,732 km', '1,600 km (2011)', '2018-02-07 18:03:37', NULL),
(242, 'UZ', 'uz', 'Uzbekistan', 'Russia conquered the territory of present-day Uzbekistan in the late 19th century. Stiff resistance to the Red Army after the Bolshevik Revolution was eventually suppressed and a socialist republic established in 1924. During the Soviet era, intensive production of "white gold" (cotton) and grain led to overuse of agrochemicals and the depletion of water supplies, which have left the land degraded and the Aral Sea and certain rivers half dry. Independent since 1991 upon the dissolution of the USSR, the country has reduced its dependence on the cotton monoculture by diversifying agricultural production while developing its mineral and petroleum export capacity and increasing its manufacturing base. Uzbekistan’s first president, Islom KARIMOV, led Uzbekistan for 25 years until his death in September 2016. The political transition to his successor, then-Prime Minister Shavkat MIRZIYOYEV was peaceful, but sidelined the constitutional process where the chairman of the Senate would have served as the acting president. MIRZIYOYEV, who won the presidential election in December 2016, has improved relations with Uzbekistan’s neighbors and introduced wide-ranging economic and judicial reforms.', 'Asia', '41 19 N, 69 15 E', '447,400 sq km', '29,748,859 (July 2017 est.)', 'Uzbekistani', 'Uzbek 80%, Russian 5.5%, Tajik 5%, Kazakh 3%, Karakalpak 2.5%, Tatar 1.5%, other 2.5% (1996 est.)', 'Uzbek (official) 74.3%, Russian 14.2%, Tajik 4.4%, other 7.1%', 'Muslim 88% (mostly Sunni), Eastern Orthodox 9%, other 3%', 'Republic of Uzbekistan', 'presidential republic; highly authoritarian', 'Tashkent (Toshkent)', '12 provinces (viloyatlar, singular - viloyat), 1 autonomous republic* (avtonom respublikasi), and 1 city** (shahar); Andijon Viloyati, Buxoro Viloyati, Farg''ona Viloyati, Jizzax Viloyati, Namangan Viloyati, Navoiy Viloyati, Qashqadaryo Viloyati (Qarshi), Qoraqalpog''iston Respublikasi [Karakalpakstan Republic]* (Nukus), Samarqand Viloyati, Sirdaryo Viloyati (Guliston), Surxondaryo Viloyati (Termiz), Toshkent Shahri [Tashkent City]**, Toshkent Viloyati [Tashkent province], Xorazm Viloyati (Urganch)', '1 September 1991 (from the Soviet Union)', 'Uzbekistan is a doubly landlocked country in which 51% of the population lives in urban settlements; the agriculture-rich Fergana Valley, in which Uzbekistan’s eastern borders are situated, has been counted among the most densely populated parts of Central Asia. Since its independence in September 1991, the government has largely maintained its Soviet-style command economy with subsidies and tight controls on production, prices, and access to foreign currency. Despite ongoing efforts to diversify crops, Uzbek agriculture remains largely centered on cotton; Uzbekistan is the world''s fifth-largest cotton exporter and seventh-largest producer. Uzbekistan''s growth has been driven primarily by state-led investments, and export of natural gas, gold, and cotton provides a significant share of foreign exchange earnings. In early 2016, Russia’s Gazprom announced it planned to increase purchases of Uzbek gas.\r\nAware of the need to improve the investment climate, the government is taking incremental steps to reform the business sector and address impediments to foreign investment in the country. Since the death of first President Islam KARIMOV, rhetorical emphasis on such initiatives and ostensible government efforts to seek input from the private sector have increased. In the past, Uzbek authorities have accused US and other foreign companies operating in Uzbekistan of violating Uzbek laws and have frozen and seized their assets. At the same time, the Uzbek Government has actively courted several major US and international corporations, offering financing and tax advantages.\r\nIn 2003, the government accepted Article VIII obligations under the IMF, providing for full currency convertibility. However, strict currency controls and tightening of borders have lessened the effects of convertibility and have also led to some shortages that have further stifled economic activity, and the government has lately raised the issue of currency reform in a number of official decrees and proclamations. Recently, lower global commodity prices and economic slowdown in neighboring Russia and China have been hurting Uzbekistan''s trade and investment and worsening its problem of foreign currency shortage.', '$66.85 billion (2016 est.)', 'cotton, vegetables, fruits, grain; livestock', 'textiles, food processing, machine building, metallurgy, mining, hydrocarbon extraction, chemicals', '17.85 million (2016 est.)', 'energy products, cotton, gold, mineral fertilizers, ferrous and nonferrous metals, textiles, foodstuffs, machinery, automobiles', '59 billion kWh (2016 est.)', '52,910 bbl/day (2016 est.)', '63,650 bbl/day (2014 est.)', '55.7 billion cu m (2015 est.)', 'UK (2016)', '53 (2013)', '-', 'gas 13,700 km; oil 944 km (2016)', '4,304 km', '86,496 km', '1,100 km (2012)', '2018-02-07 18:03:37', NULL),
(243, 'VU', 'vu', 'Vanuatu', 'Multiple waves of colonizers, each speaking a distinct language, migrated to the New Hebrides in the millennia preceding European exploration in the 18th century. This settlement pattern accounts for the complex linguistic diversity found on the archipelago to this day. The British and French, who settled the New Hebrides in the 19th century, agreed in 1906 to an Anglo-French Condominium, which administered the islands until independence in 1980, when the new name of Vanuatu was adopted.', 'Oceania', '17 44 S, 168 19 E', '12,189 sq km', '282,814 (July 2017 est.)', 'Ni-Vanuatu (singular and plural)', 'Ni-Vanuatu 97.6%, part Ni-Vanuatu 1.1%, other 1.3% (2009 est.)', 'local languages (more than 100) 63.2%, Bislama (official; creole) 33.7%, English (official) 2%, French (official) 0.6%, other 0.5% (2009 est.)', 'Protestant 70% (includes Presbyterian 27.9%, Anglican 15.1%, Seventh Day Adventist 12.5%, Assemblies of God 4.7%, Church of Christ 4.5%, Neil Thomas Ministry 3.1%, and Apostolic 2.2%), Roman Catholic 12.4%, customary beliefs 3.7% (including Jon Frum cargo cult), other 12.6%, none 1.1%, unspecified 0.2% (2009 est.)', 'Republic of Vanuatu', 'parliamentary republic', 'Port-Vila (on Efate)', '6 provinces; Malampa, Penama, Sanma, Shefa, Tafea, Torba', '30 July 1980 (from France and the UK)', 'This South Pacific island economy is based primarily on small-scale agriculture, which provides a living for about two-thirds of the population. Fishing, offshore financial services, and tourism, with nearly 350,000 visitors in 2016, are other mainstays of the economy. Tourism has struggled after Efate, the most populous and popular island for tourists, was damaged by Tropical Cyclone Pam in 2015. Ongoing infrastructure difficulties at Port Vila’s Bauerfield Airport have caused air travel disruptions, further hampering tourism numbers. Australia and New Zealand are the main source of tourists and foreign aid. A small light industry sector caters to the local market. Tax revenues come mainly from import duties. Mineral deposits are negligible; the country has no known petroleum deposits.\r\nEconomic development is hindered by dependence on relatively few commodity exports, vulnerability to natural disasters, and long distances from main markets and between constituent islands. In response to foreign concerns, the government has promised to tighten regulation of its offshore financial center.\r\nSince 2002, the government has stepped up efforts to boost tourism through improved air connections, resort development, and cruise ship facilities. Agriculture, especially livestock farming, is a second target for growth.', '$807 million (2016 est.)', 'copra, coconuts, cocoa, coffee, taro, yams, fruits, vegetables; beef; fish', 'food and fish freezing, wood processing, meat canning', '115,900 (2007 est.)', 'copra, beef, cocoa, timber, kava, coffee', '55 million kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', 'YJ (2016)', '31 (2013)', '-', '-', '-', '1,070 km', '-', '2018-02-07 18:03:37', NULL),
(244, 'VA', 'va', 'Vatican City', 'Popes in their secular role ruled portions of the Italian peninsula for more than a thousand years until the mid-19th century, when many of the Papal States were seized by the newly united Kingdom of Italy. In 1870, the pope''s holdings were further circumscribed when Rome itself was annexed. Disputes between a series of "prisoner" popes and Italy were resolved in 1929 by three Lateran Treaties, which established the independent state of Vatican City and granted Roman Catholicism special status in Italy. In 1984, a concordat between the Holy See and Italy modified certain of the earlier treaty provisions, including the primacy of Roman Catholicism as the Italian state religion. Present concerns of the Holy See include religious freedom, threats against minority Christian communities in Africa and the Middle East, the plight of refugees and migrants, sexual misconduct by clergy, international development, interreligious dialogue and reconciliation, and the application of church doctrine in an era of rapid change and globalization. About 1.2 billion people worldwide profess Catholicism - the world''s largest Christian faith.', 'Europe', '41 54 N, 12 27 E', '0.44 sq km', '1,000 (2017 est.)', '-', 'Italian, Swiss, Argentinian, and other nationalities from around the world (2017)', 'Italian, Latin, French, various other languages', 'Roman Catholic', 'The Holy See (Vatican City State)', 'ecclesiastical elective monarchy; self-described as an "absolute monarchy"', 'Vatican City', 'none', '11 February 1929; note - the three treaties signed with Italy on 11 February 1929 acknowledged, among other things, the full sovereignty of the Holy See and established its territorial extent; however, the origin of the Papal States, which over centuries varied considerably in extent, may be traced back to A.D. 754', 'The Holy See is supported financially by a variety of sources, including investments, real estate income, and donations from Catholic individuals, dioceses, and institutions; these help fund the Roman Curia (Vatican bureaucracy), diplomatic missions, and media outlets. Moreover, an annual collection taken up in dioceses and from direct donations go to a non-budgetary fund, known as Peter''s Pence, which is used directly by the pope for charity, disaster relief, and aid to churches in developing nations. Donations increased between 2010 and 2011.\r\nThe separate Vatican City State budget includes the Vatican museums and post office and is supported financially by the sale of stamps, coins, medals, and tourist mementos; by fees for admission to museums; and by publication sales. Its revenues increased between 2010 and 2011 because of expanded operating hours and a growing number of visitors. However, the Holy See has not escaped the financial difficulties engulfing other European countries; in 2012, it started a spending review to determine where to cut costs to reverse its 2011 budget deficit of $20 million. The Holy See generated a modest surplus in 2012 before recording a $32 million deficit in 2013, driven primarily by the decreasing value of gold. Most public expenditures go to wages and other personnel costs; the incomes and living standards of lay workers are comparable to those of counterparts who work in the city of Rome. In February 2014, Pope FRANCIS created the Secretariat of the Economy to oversee financial and administrative operations of the Holy See, part of a broader campaign to reform the Holy See’s finances.', '-', '-', 'printing; production of coins, medals, postage stamps; mosaics, staff uniforms; worldwide banking and financial activities', '4,822 (2016)', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '-', '2018-02-07 18:03:38', NULL),
(245, 'VE', 've', 'Venezuela', 'Venezuela was one of three countries that emerged from the collapse of Gran Colombia in 1830 (the others being Ecuador and New Granada, which became Colombia). For most of the first half of the 20th century, Venezuela was ruled by generally benevolent military strongmen who promoted the oil industry and allowed for some social reforms. Democratically elected governments have held sway since 1959. Under Hugo CHAVEZ, president from 1999 to 2013, and his hand-picked successor, President Nicolas MADURO, the executive branch has exercised increasingly authoritarian control over other branches of government. At the same time, democratic institutions have deteriorated, freedoms of expression and the press have been curtailed, and political polarization has grown. The ruling party''s economic policies have expanded the state''s role in the economy through expropriations of major enterprises, strict currency exchange and price controls that discourage private sector investment and production, and overdependence on the petroleum industry for revenues, among others. Current concerns include: human rights abuses, rampant violent crime, high inflation, and widespread shortages of basic consumer goods, medicine, and medical supplies.', 'South America', '10 29 N, 66 52 W', '912,050 sq km', '31,304,016 (July 2017 est.)', 'Venezuelan(s)', 'Spanish, Italian, Portuguese, Arab, German, African, indigenous people', 'Spanish (official), numerous indigenous dialects', 'nominally Roman Catholic 96%, Protestant 2%, other 2%', 'Bolivarian Republic of Venezuela', 'federal presidential republic', 'Caracas', '23 states (estados, singular - estado), 1 capital district* (distrito capital), and 1 federal dependency** (dependencia federal); Amazonas, Anzoategui, Apure, Aragua, Barinas, Bolivar, Carabobo, Cojedes, Delta Amacuro, Dependencias Federales (Federal Dependencies)**, Distrito Capital (Capital District)*, Falcon, Guarico, Lara, Merida, Miranda, Monagas, Nueva Esparta, Portuguesa, Sucre, Tachira, Trujillo, Vargas, Yaracuy, Zulia', '5 July 1811 (from Spain)', 'Venezuela remains highly dependent on oil revenues, which account for almost all export earnings and nearly half of the government’s revenue. In 2016, GDP contracted 10%, inflation hit 720%, people faced widespread shortages of consumer goods, and central bank international reserves dwindled. On the other hand, Venezuela managed to pay down its external debt and narrow its current account deficit. Domestic production and industry continues to severely underperform and the Venezuelan government continues to rely on imports to meet its basic food and consumer goods needs.\r\nFalling oil prices since 2014 have aggravated Venezuela’s economic crisis. Insufficient access to dollars, price controls, and rigid labor regulations have led some US and multinational firms to reduce or shut down their Venezuelan operations. Market uncertainty and state oil company PDVSA’s poor cash flow have slowed investment in the petroleum sector, resulting in a decline in oil production.\r\nUnder President Nicolas MADURO, the Venezuelan Government’s response to the economic crisis has been to increase state control over the economy and blame the private sector for the shortages. MADURO has ceded increasing authority for the production and distribution of scarce goods to the military and to local socialist party member committees. The Venezuelan Government has maintained strict currency controls since 2003. On 17 February 2016, the Venezuelan Government announced a change from three official currency exchange mechanisms to only two official rates for the sale of dollars to private-sector firms and individuals, with rates based on the government''s import priorities. The official exchange rate used for food and medicine imports was devalued to 10 bolivars per dollar from 6.3 bolivars per dollar. The second rate moved to a managed float. These currency controls present significant obstacles to trade with Venezuela because importers cannot obtain sufficient dollars to purchase goods needed to maintain their operations. Meting out access to the multiple exchange rates has created opportunities for arbitrage and corruption. MADURO has used decree powers to enact legislation to deepen the state’s role as the primary buyer and distributor of imports, further tighten currency controls, cap business profits, and extend price controls.', '$236.4 billion (2016 est.)', 'corn, sorghum, sugarcane, rice, bananas, vegetables, coffee; beef, pork, milk, eggs; fish', 'agricultural products, livestock, raw materials, machinery and equipment, transport equipment, construction materials, medical equipment, pharmaceuticals, chemicals, iron and steel products, crude oil and petroleum products', '14.16 million (2016 est.)', 'petroleum and petroleum products, bauxite and aluminum, minerals, chemicals, agricultural products', '114.4 billion kWh (2015 est.)', '2.277 million bbl/day (2016 est.)', '1.028 million bbl/day (2014 est.)', '26 billion cu m (2015 est.)', 'YV (2016)', '444 (2013)', '3 (2013)', 'extra heavy crude 981 km; gas 5,941 km; oil 7,588 km; refined products 1,778 km (2013)', '447 km', '96,189 km (2014)', '7,100 km (Orinoco River (400 km) and Lake de Maracaibo navigable by oceangoing vessels) (2011)', '2018-02-07 18:03:38', NULL),
(246, 'VN', 'vn', 'Vietnam', 'The conquest of Vietnam by France began in 1858 and was completed by 1884. It became part of French Indochina in 1887. Vietnam declared independence after World War II, but France continued to rule until its 1954 defeat by communist forces under Ho Chi MINH. Under the Geneva Accords of 1954, Vietnam was divided into the communist North and anti-communist South. US economic and military aid to South Vietnam grew through the 1960s in an attempt to bolster the government, but US armed forces were withdrawn following a cease-fire agreement in 1973. Two years later, North Vietnamese forces overran the South reuniting the country under communist rule. Despite the return of peace, for over a decade the country experienced little economic growth because of conservative leadership policies, the persecution and mass exodus of individuals - many of them successful South Vietnamese merchants - and growing international isolation. However, since the enactment of Vietnam''s "doi moi" (renovation) policy in 1986, Vietnamese authorities have committed to increased economic liberalization and enacted structural reforms needed to modernize the economy and to produce more competitive, export-driven industries. The communist leaders maintain tight control on political expression but have demonstrated some modest steps toward better protection of human rights. The country continues to experience small-scale protests, the vast majority connected to either land-use issues, calls for increased political space, or the lack of equitable mechanisms for resolving disputes. The small-scale protests in the urban areas are often organized by human rights activists, but many occur in rural areas and involve various ethnic minorities such as the Montagnards of the Central Highlands, Hmong in the Northwest Highlands, and the Khmer Krom in the southern delta region.', 'Southeast Asia', '21 02 N, 105 51 E', '331,210 sq km', '96,160,163 (July 2017 est.)', 'Vietnamese (singular and plural)', 'Kinh (Viet) 85.7%, Tay 1.9%, Thai 1.8%, Muong 1.5%, Khmer 1.5%, Mong 1.2%, Nung 1.1%, Hoa 1%, other 4.3%', 'Vietnamese (official), English (increasingly favored as a second language), some French, Chinese, and Khmer, mountain area languages (Mon-Khmer and Malayo-Polynesian)', 'Buddhist 7.9%, Catholic 6.6%, Hoa Hao 1.7%, Cao Dai 0.9%, Protestant 0.9%, Muslim 0.1%, none 81.8% (2009 est.)', 'Socialist Republic of Vietnam', 'communist state', 'Hanoi (Ha Noi)', '58 provinces (tinh, singular and plural) and 5 municipalities (thanh pho, singular and plural)', '2 September 1945 (from France)', 'Vietnam is a densely populated developing country that has been transitioning from the rigidities of a centrally planned, highly agrarian economy since 1986 to a more industrial and market based economy, raising incomes substantially. In 2016, Vietnam missed its yearly growth target of 6.7% due to environmental issues – drought and salinization - impacting the agricultural sector and low oil prices affecting the extractive sector. However, annual GDP growth was 6.2%, reflecting strengthening domestic demand and strong manufacturing exports.\r\nVietnam has a young population, stable political system, commitment to sustainable growth, relatively low inflation, stable currency, strong FDI inflows, and strong manufacturing sector. In addition, the country is committed to continuing its global economic integration. Vietnam joined the WTO in January 2007 and concluded several free trade agreements in 2015-16, including the EU-Vietnam Free Trade Agreement, the Korean Free Trade Agreement, and the Eurasian Economic Union Free Trade Agreement.\r\nHowever, to continue its trajectory of strong economic growth, the government acknowledges the need to spark a ?second wave’ of reforms, including reforming state-owned-enterprises, reducing red tape, increasing business sector transparency, reducing the level of non-performing loans in the banking sector, and increasing financial sector transparency. Vietnam has demonstrated a commitment to sustainable growth over the last several years, but a recent slowdown in economic growth could test the government’s resolve.\r\nIn 2016, Vietnam cancelled its civilian nuclear energy development program, citing public concerns about safety and the high cost of the program, and is facing growing pressure on energy infrastructure. Overall, the country’s infrastructure fails to meet the needs of an expanding middle class. As the 2017 Asia-Pacific Economic Cooperation (APEC) chair, Vietnam will lead the dialogue on key APEC priorities such as inclusive growth, innovation, food security and climate change.', '$201.3 billion (2016 est.)', 'rice, coffee, rubber, tea, pepper, soybeans, cashews, sugar cane, peanuts, bananas; pork; poultry; seafood', 'food processing, garments, shoes, machine-building; mining, coal, steel; cement, chemical fertilizer, glass, tires, oil, mobile phones', '55.93 million (2016 est.)', 'clothes, shoes, electronics, seafood, crude oil, rice, coffee, wooden products, machinery', '146.9 billion kWh (2015 est.)', '301,800 bbl/day (2016 est.)', '156,900 bbl/day (2014 est.)', '9.08 billion cu m (2015 est.)', 'VN (2016)', '45 (2013)', '1 (2013)', 'condensate 72 km; condensate/gas 398 km; gas 955 km; oil 128 km; oil/gas/water 33 km; refined products 206 km; water 13 km (2013)', '2,600 km', '195,468 km', '47,130 km (30,831 km weight under 50 tons) (2011)', '2018-02-07 18:03:38', NULL),
(247, 'WF', 'wf', 'Wallis and Futuna', 'The Futuna island group was discovered by the Dutch in 1616 and Wallis by the British in 1767, but it was the French who declared a protectorate over the islands in 1842, and took official control of them between 1886 and 1888. Notably, Wallis and Futuna was the only French colony to side with the Vichy regime during World War II, a phase that ended in May of 1942 with the arrival of 2,000 American troops. In 1959, the inhabitants of the islands voted to become a French overseas territory and officially assumed that status in 1961. In 2003, Wallis and Futuna''s designation changed to that of an overseas collectivity.', 'Oceania', '13 57 S, 171 56 W', '142 sq km', '15,714 (July 2017 est.)', 'Wallisian(s), Futunan(s), or Wallis and Futuna Islanders', 'Polynesian', 'Wallisian (indigenous Polynesian language) 58.9%, Futunian 30.1%, French (official) 10.8%, other 0.2% (2003 census)', 'Roman Catholic 99%, other 1%', 'Territory of the Wallis and Futuna Islands', 'parliamentary democracy (Territorial Assembly); overseas collectivity of France', 'Mata-Utu (on Ile Uvea)', '3 administrative precincts (circonscriptions, singular - circonscription) Alo, Sigave, Uvea', 'none (overseas colectivity of France)', 'The economy is limited to traditional subsistence agriculture, with 80% of labor force earnings coming from agriculture (coconuts and vegetables), livestock (mostly pigs), and fishing. However, roughly 70% of the labor force is employed in the public sector, although only about 20% of the population is in salaried employment.\r\nRevenues come from French Government subsidies, licensing of fishing rights to Japan and South Korea, import taxes, and remittances from expatriate workers in New Caledonia. France directly finances the public sector and healthcare and education services. It also provides funding for key development projects in a range of areas, including infrastructure, economic development, environmental management, and healthcare facilities.\r\nA key concern for Wallis and Futuna is an aging population with consequent economic development issues. Very few people aged 18-30 live on the islands due to the limited formal employment opportunities. Improving job creation is a current priority for the territorial government.', '$NA', 'coconuts, breadfruit, yams, taro, bananas; pigs, goats; fish', 'copra, handicrafts, fishing, lumber', '3,104 (2003)', 'copra, chemicals, construction materials', '-', '-', '-', '-', '-', '2 (2013)', '-', '-', '-', '-', '-', '2018-02-07 18:03:38', NULL),
(248, 'EH', 'eh', 'Western Sahara', 'Western Sahara is a disputed territory on the northwest coast of Africa bordered by Morocco, Mauritania, and Algeria. After Spain withdrew from its former colony of Spanish Sahara in 1976, Morocco annexed the northern two-thirds of Western Sahara and claimed the rest of the territory in 1979, following Mauritania''s withdrawal. A guerrilla war with the Polisario Front contesting Morocco''s sovereignty ended in a 1991 cease-fire and the establishment of a UN peacekeeping operation. As part of this effort, the UN sought to offer a choice to the peoples of Western Sahara between independence (favored by the Polisario Front) or integration into Morocco. A proposed referendum never took place due to lack of agreement on voter eligibility. The 2,700 km- (1,700 mi-) long defensive sand berm, built by the Moroccans from 1980 to 1987 and running the length of the territory, continues to separate the opposing forces with Morocco controlling the roughly 80 percent of the territory west of the berm. Local demonstrations criticizing the Moroccan authorities occur regularly, and there are periodic ethnic tensions between the native Sahrawi population and Moroccan immigrants. Morocco maintains a heavy security presence in the territory.', 'Africa', '24 30 N, 13 00 W', '266,000 sq km', '603,253', 'Sahrawi(s), Sahraoui(s)', 'Arab, Berber', 'Standard Arabic (national), Hassaniya Arabic, Moroccan Arabic', 'Muslim', 'none', 'legal status of territory and issue of sovereignty unresolved - territory contested by Morocco and P', 'Laayoune (administrative center)', 'none officially; the territory west of the Moroccan berm falls under de facto Moroccan control; Morocco claims the territory of Western Sahara, the political status of which is considered undetermined by the US Government; portions of the regions Guelmim-Es Smara and Laayoune-Boujdour-Sakia El Hamra, as claimed by Morocco, lie within Western Sahara; Morocco also claims Oued Eddahab-Lagouira, another region that falls entirely within Western Sahara', '-', 'Western Sahara has a small market-based economy whose main industries are fishing, phosphate mining, and pastoral nomadism. The territory''s arid desert climate makes sedentary agriculture difficult, and Western Sahara imports much of its food. The Moroccan Government administers Western Sahara''s economy and is a key source of employment, infrastructure development, and social spending in the territory.\r\nWestern Sahara''s unresolved legal status makes the exploitation of its natural resources a contentious issue between Morocco and the Polisario. Morocco and the EU in December 2013 finalized a four-year agreement allowing European vessels to fish off the coast of Morocco, including disputed waters off the coast of Western Sahara.\r\nOil has never been found in Western Sahara in commercially significant quantities, but Morocco and the Polisario have quarreled over who has the right to authorize and benefit from oil exploration in the territory. Western Sahara''s main long-term economic challenge is the development of a more diverse set of industries capable of providing greater employment and income to the territory. However, following King MOHAMMED VI’s November 2015 visit to Western Sahara, the Government of Morocco announced a series of investments aimed at spurring economic activity in the region, while the General Confederation of Moroccan Enterprises announced a $609 million investment initiative in the region in March 2015.', '$NA', 'fruits and vegetables (grown in the few oases); camels, sheep, goats (kept by nomads); fish', 'phosphate mining, handicrafts', '144,000 (2010 est.)', 'phosphates 62% (2012 est.)', '0 kWh (2015 est.)', '0 bbl/day (2016 est.)', '0 bbl/day (2014 est.)', '0 cu m (2013 est.)', '-', '6 (2013)', '-', '-', '-', '-', '-', '2018-02-07 18:03:38', NULL),
(249, 'YE', 'ye', 'Yemen', 'North Yemen became independent from the Ottoman Empire in 1918. The British, who had set up a protectorate area around the southern port of Aden in the 19th century, withdrew in 1967 from what became South Yemen. Three years later, the southern government adopted a Marxist orientation. The massive exodus of hundreds of thousands of Yemenis from the south to the north contributed to two decades of hostility between the states. The two countries were formally unified as the Republic of Yemen in 1990. A southern secessionist movement and brief civil war in 1994 was quickly subdued. In 2000, Saudi Arabia and Yemen agreed to delineate their border. Fighting in the northwest between the government and the Huthis, a Zaydi Shia Muslim minority, continued intermittently from 2004 to 2010. The southern secessionist movement was revitalized in 2007.\r\nPublic rallies in Sana''a against then President SALIH - inspired by similar demonstrations in Tunisia and Egypt - slowly built momentum starting in late January 2011 fueled by complaints over high unemployment, poor economic conditions, and corruption. By the following month, some protests had resulted in violence, and the demonstrations had spread to other major cities. By March the opposition had hardened its demands and was unifying behind calls for SALIH''s immediate ouster. In April 2011, the Gulf Cooperation Council (GCC), in an attempt to mediate the crisis in Yemen, proposed the GGC Initiative, an agreement in which the president would step down in exchange for immunity from prosecution. SALIH''s refusal to sign an agreement led to further violence. The UN Security Council passed Resolution 2014 in October 2011 calling for an end to the violence and completing a power transfer deal. In November 2011, SALIH signed the GCC Initiative to step down and to transfer some of his powers to Vice President Abd Rabuh Mansur HADI. Following HADI''s uncontested election victory in February 2012, SALIH formally transferred his powers. In accordance with the GCC initiative, Yemen launched a National Dialogue Conference (NDC) in March 2013 to discuss key constitutional, political, and social issues. HADI concluded the NDC in January 2014 and planned to begin implementing subsequent steps in the transition process, including constitutional drafting, a constitutional referendum, and national elections.\r\nThe Huthis, perceiving their grievances were not addressed in the NDC, joined forces with SALIH and expanded their influence in northwestern Yemen, culminating in a major offensive against military units and rival tribes and enabling their forces to overrun the capital, Sanaa, in September 2014. In January 2015, the Huthis surrounded the presidential palace, HADI''s residence, and key government facilities, prompting HADI and the cabinet to submit their resignations. HADI fled to Aden in February 2015 and rescinded his resignation. He subsequently escaped to Oman and then moved to Saudi Arabia and asked the GCC to intervene militarily in Yemen to protect the legitimate government from the Huthis. In March, Saudi Arabia assembled a coalition of Arab militaries and began airstrikes against the Huthis and Huthi-affiliated forces. Ground fighting between Huthi-aligned forces and resistance groups backed by the Saudi-led coalition continued through 2016. In 2016, the UN brokered a months-long cessation of hostilities that reduced airstrikes and fighting, and initiated peace talks in Kuwait. However, the talks ended without agreement. The Huthis and SALIH’s political party announced a Supreme Political Council in August 2016 and a National Salvation Government, including a prime minister and several dozen cabinet members, in November 2016, to govern in Sanaa and further challenge the legitimacy of HADI’s government. Further attempts at peace have failed while neither side has made decisive battlefield gains, perpetuating the conflict and deepening the divisions between northern and southern Yemen. Amid rising tensions between the Huthis and SALIH, sporadic clashes erupted in mid-2017, and Huthi forces killed SALIH in early December 2017.', 'Middle East', '15 00 N, 48 00 E', '527,968 sq km', '28,036,829 (July 2017 est.)', 'Yemeni(s)', 'predominantly Arab; but also Afro-Arab, South Asians, Europeans', 'Arabic (official)', 'Muslim 99.1% (official; virtually all are citizens, an estimated 65% are Sunni and 35% are Shia), other 0.9% (includes Jewish, Baha''i, Hindu, and Christian; many are refugees or temporary foreign residents) (2010 est.)', 'Republic of Yemen', 'in transition', 'Sanaa', '22 governorates (muhafazat, singular - muhafazah); Abyan, ''Adan (Aden), Ad Dali'', Al Bayda'', Al Hudaydah, Al Jawf, Al Mahrah, Al Mahwit, Amanat al ''Asimah (Sanaa City), ''Amran, Arkhabil Suqutra (Socotra Archipelago), Dhamar, Hadramawt, Hajjah, Ibb, Lahij, Ma''rib, Raymah, Sa''dah, San''a'' (Sanaa), Shabwah, Ta''izz', '22 May 1990 (Republic of Yemen was established with the merger of the Yemen Arab Republic [Yemen (Sanaa) or North Yemen] and the Marxist-dominated People''s Democratic Republic of Yemen [Yemen (Aden) or South Yemen]); notable earlier dates: North Yemen became independent on 1 November 1918 (from the Ottoman Empire) and became a republic with the overthrow of the theocratic Imamate on 27 September 1962; South Yemen became independent on 30 November 1967 (from the UK)', 'Yemen is a low-income country that faces difficult long-term challenges to stabilizing and growing its economy, and the current conflict has only exacerbated those issues. The ongoing war has halted Yemen’s exports, pressured the currency’s exchange rate, accelerated inflation, severely limited food and fuel imports, and caused widespread damage to infrastructure. More than 80% of the population is in need of humanitarian assistance and over half are food insecure.\r\nPrior to the start of the conflict in 2014, Yemen was highly dependent on declining oil and gas resources for revenue. Oil and gas earnings accounted for roughly 25% of GDP and 65% of government revenue. The Yemeni Government regularly faced annual budget shortfalls and tried to diversify the Yemeni economy through a reform program designed to bolster non-oil sectors of the economy and foreign investment. In July 2014, the government continued reform efforts by eliminating some fuel subsidies and in August 2014, the IMF approved a three-year, $570 million Extended Credit Facility for Yemen.\r\nHowever, the conflict that began in 2014 stalled these reform efforts and ongoing fighting continues to accelerate the country’s economic decline. In September 2016, President HADI announced the move of the main branch of Central Bank of Yemen from Sanaa to Aden where his government could exert greater control over the central bank’s dwindling resources. Regardless of which group controls the main branch, the central bank system is struggling to function. Yemen’s Central Bank’s foreign reserves, which stood at roughly $5.2 billion prior to the conflict, have declined to negligible amounts. The Central Bank can no longer fully support imports of critical goods or the country’s exchange rate. The country also is facing a growing liquidity crisis and rising inflation. The private sector is hemorrhaging, with almost all businesses making substantial layoffs. Access to food and other critical commodities such as medical equipment is limited across the country due to security issues on the ground. The Social Welfare Fund, a cash transfer program for Yemen’s neediest, is no longer operational and has not made any disbursements since late 2014.\r\nYemen will require significant international assistance during and after the protracted conflict to stabilize its economy. Long-term challenges include a high population growth rate, high unemployment, declining water resources, and severe food scarcity.', '$27.32 billion (2016 est.)', 'grain, fruits, vegetables, pulses, qat, coffee, cotton; dairy products, livestock (sheep, goats, cattle, camels), poultry; fish', 'crude oil production and petroleum refining; small-scale production of cotton textiles, leather goods; food processing; handicrafts; aluminum products; cement; commercial ship repair; natural gas production', '7.418 million (2016 est.)', 'crude oil, coffee, dried and salted fish, liquefied natural gas', '5.006 billion kWh (2015 est.)', '21,670 bbl/day (2016 est.)', '56,840 bbl/day (2014 est.)', '2.85 billion cu m (2015 est.)', '7O (2016)', '57 (2013)', '-', 'gas 641 km; liquid petroleum gas 22 km; oil 1,370 km (2013)', '-', '71,300 km', '-', '2018-02-07 18:03:38', NULL);
