(1, 'Privacy Policy', 'privacy-policy', '<p><strong>MigoFly</strong> takes full responsibility on securing your personal information which are being&nbsp;collected along the process of acquiring flight and hotel services from our website. We require to collect this data for the sole purpose of providing your travel services.</p>\r\n<p>When you provide us your personal information, you agree that our Privacy Policy will apply to how we handle your private details and that you give us the consent to collect, use and disclose your personal information as outlined in this Privacy Policy. Hence, if you do not agree to our practices, you must not provide your personal information but the services we provide might not be completely fulfilled.</p>\r\n<p><strong>Collection of your personal information</strong></p>\r\n<p>We collect personal data in order to provide the services your request and the type of personal information we need from you will depend on the services being requested.</p>\r\n<p><strong>Use of your personal information</strong></p>\r\n<p>Your personal information will be collected to acquire the services we are offering such as:</p>\r\n<ul>\r\n<li>Airline and hotel bookings</li>\r\n<li>Fulfillment of an order or billing</li>\r\n<li>Provision of promotional deals</li>\r\n</ul>\r\n<p><strong>Disclosure of personal information</strong></p>\r\n<p>When you book travel arrangements though our website, your personal information will be collected and we act as agent on behalf of travel service providers, such as airlines, tour companies, and hotels who are responsible for providing your services. Your personal information may be disclosed to third parties to these travel service providers for the purpose of providing you with the travel services that you have requested.</p>\r\n<p><strong>Security of your personal information</strong></p>\r\n<p>We take reasonable steps to:</p>\r\n<ul>\r\n<li>Ensure that your personal information is accurate, complete, relevant, updated, and is stored in a secure environment;</li>\r\n<li>Implement necessary steps to protect your personal information from unauthorised access, modification or disclosure;</li>\r\n<li>Perform regular checks on our security measures to maintain the security and privacy of personal information;</li>\r\n<li>Remove or delete personal information when it is no longer required.</li>\r\n</ul>\r\n<p><strong>Third party websites</strong></p>\r\n<p>Our website contains links to other websites that are not controlled, operated or maintained by us. We are not responsible for the privacy practices of those websites. Before providing your personal information to such websites, you should read, and ensure that you understand, their privacy policies.</p>\r\n<p><strong>Cookies</strong></p>\r\n<p>We use cookies on our website to improve your experience of using the website and to deliver content that is specific to your interests. If you do not wish to receive cookies, or prefer to use the website anonymously, you should adjust your internet browser settings accordingly.</p>\r\n<p><strong>Updates to our Privacy Policy</strong></p>\r\n<p>This privacy policy is subject to change without prior or separate notification. Any changes will be posted to our website.</p>', 'We, at Migofly, commit ourselves to make sure that all of our users'' personal information will be stored and protected with total confidentiality.', 'page', 'Migofly, Travel', 'Our privacy policy contains user''s personal information protection, data collection purposes and authorized data transfer.', NULL, NULL, NULL, 'admin', 0, 1, '2017-07-19 16:00:00', '2017-12-28 00:39:40'),
(3, 'Contact Us', 'contact-us', '<p>Thank you for visiting our website! We hope that you found what you&rsquo;re looking for your travel needs. For any comments, recommendations or suggestions, do not hesitate to contact us using the form below or directly email us at <a href="mailto:info@migofly.com">info@migofly.com</a>.</p>', 'For any comments, recommendations or suggestions, do not hesitate to contact us using the form below or directly email us at info@migofly.com.', 'page', 'Migofly, Travel, Tips, Inquire, Comments, Suggestions, Concerns, Questions', 'For any comments, recommendations or suggestions, do not hesitate to contact us using the form below or directly email us at info@migofly.com.', NULL, NULL, NULL, 'admin', 0, 1, '2017-08-03 21:14:32', '2017-12-28 00:34:43'),
(54, 'About Us', 'about-us', '<p>Travel is what makes the world go around literally and we at MigoFly do it a whole lot better than anyone else! Whether you wish to soak in the sun, relax on exotic beaches, take a dip in cool lakes or go skiing down a snowy slope, your preferred destination is just a click away. We pride ourself on providing the holiday of a lifetime to its customers. You just can''t go wrong here! Welcome to the one-stop shop for flight &amp; hotels bookings with flights available for any destination on planet earth!</p>\r\n<p>Getting away has never been this easy or this fun before. Whether it''s the exotic Bahamas or the mysterious Orient, fashionable Paris or the sun-kissed the Mediterranean, we offer more flight booking than any of our competitors and offer flight tickets for all classes.</p>\r\n<p>Everything you need to organize your trip, is here, just a click away. The world is waiting out there, each destination more exotic than the other, landscapes filled with breathtaking beauty and natural wonders waiting to be explored. We are the premium European travel site offering outstanding deals on flight bookings, hotels, car rentals and more. For international flight booking, you have come to the right place! Wherever the destination, whatever the dates, you can book them all online right here right now, at unmatched prices. We also offer more budget flight &nbsp;and hotel deals than any of our competitors and cover the widest range of budget travel flights and accommodations.</p>\r\n<p>Over hundreds of airlines and hotels around the globe to provide you with only the best flights and accommodation deals that your local travel agencies could only dream of getting!</p>\r\n<p>Simply input your destinations and flight dates in the form above and we&rsquo;ll do the rest to connect you with the world&rsquo;s most economical airlines that match specifically to your criteria.</p>\r\n<p>Our mission is:</p>\r\n<ul>\r\n<li>To always maintain up to date data from our partnered hotels &amp; airlines.</li>\r\n<li>Ensure that its really easy to find what you want when you want with ease.</li>\r\n<li>Always remain competitive with our prices compared to the mainstream services currently available.</li>\r\n<li>Continue to offer flexibility &amp; choice of other related travel resources to our customers.</li>\r\n</ul>\r\n<p>Our service as a global travel search engine is completely free for our users, we know they save money and time so we encourage everyone to share the travel love and spread the word about MigoFly to everyone.</p>', 'Our service as a global travel search engine is completely free for our users', 'page', 'Flights, Hotels, Travel, Vacation, Destination', 'Our service as a global travel search engine is completely free for our users', NULL, NULL, NULL, 'admin', 0, 1, '2017-10-26 23:05:41', '2017-12-28 00:13:16'),
